INSERT INTO `empresa_seguimiento` (`id`, `empresa`, `fecha_registro`, `fecha_pactada`, `respuesta`, `envia`, `tipo`, `usuario`, `estado`, `estadoTipo`, `financiamiento`) VALUES
(15, 48, '2020-11-19', '2020-11-26', 'Mail enviado y llamada por teléfono el 07-04-2020 y 20-04-2020. Envío info Rubio el 08-04-2020. Avanzó con CFI Turismo, tenía deuda en ATER está tratando de resolverlo (20-04-20). No pudo aplicar a línea CFI por tener deuda en ATER por automóvil. Le rechazaron el BERSA 24% por mismo motivo (info 30-04-20). 13-05: obtuvo 0% como autónoma y ATP. Problema 0%: banco no se lo habilita. 01-06: consulta por ATP, cobró 1 empleado de 3, a los otros 2 no les toma CBU. Envió info, enviada a Nación el 2-6. 16-06: llamada a partir contacto por mail por ATP. Problema es con CBU inválida.', 0, 1, 32, 5, NULL, NULL),
(16, 48, '2020-11-19', '2020-11-26', '22-06: llamada por problema con tarjeta de crédito, quiere hacer retiro dinero para pagar GASNEA. 25-06: llamada por Bustamante, reclama por ATP, le aclaramos que tasa 0% no se puede retirar el dinero. 14-07: llamada por Bustamante, teníamos el dato nacional de que le salieron 2 meses. Está contenta, va a informarnos cuáles serían los dos meses, continuamos seguimiento', 0, 1, 32, 5, NULL, NULL),
(17, 48, '2020-11-19', '2020-11-26', '24-07: en junio les pagaron el ATP a los 3 empleados (21/06) la chica que venia cobrando regularmente cobró el viernes y luego los otros dos. Ayer 23/07 le pagaron los dos meses al otro empleado, y hay un tercero que aun no fue a revisar pero seguro que sí. 12-08: remitió consulta sobre la línea Fondo de Auxilio y Capacitación Turística y su complementariedad con ATP, respondida. 23-09: No nos pudimos comunicar', 0, 1, 32, 4, NULL, NULL),
(18, 49, '2020-09-28', '2020-12-14', 'Remitimos información por mail el 21-04-2020; llamado el 21-04-2020. 15-05: le salió ATP. Tema crédito 24% no ha tenido respuesta. Está presentado a 0%, en análisis del Banco. Remitió CFI Turismo aún sin novedades. 08-06: se lo llamó la mañana pasada por relevamiento, dice no entender algo de las líneas. 11-06: habló con Matías de CFI y le envió correo, nos hizo llegar copia. Es responsable inscripto. Hace 3 meses tiene el restaurante cerrado, lo da por perdido; sigue adelante con la sandwichería, donde tiene 2 empleados en este momento. Santander le ofreció línea 24% pero no le aseguraron que fuera elegible, va a presentar papeles 28-09: No pudo acceder a ninguna linea de financiamiento, ni CFI ni 24%. Accedio al ATP pero le pagan a dos empleados y son tres. Solicita información de lineas de financiamiento en los que pueda encuadrar para invertir en su emprendimiento. envio lineas por mail', 1, 2, 71, 4, NULL, NULL),
(19, 30, '2020-11-19', '2020-11-26', 'Mail enviado el 07-04, llamado por teléfono y enviada info Rubio el 08-04-2020. No pudo aplicar a 24%. Turno con CREDICOOP el 20-04; como sus empleados no están bancarizados no va (info 21-04-20). Esperando respuesta de BICE. Enviada info CFI Industria. 13-05: no pudo avanzar en nada bancario por no tener carpeta calificada. Bancarizaron empleados en Credicoop, para solicitar línea ahí. Remitió FCP CFI Industria el 19-05. Llegó respuesta CFI el 26-05, llamado el 27-05 para reformular. Credicoop desestimó. 28-05: Erika lo llamará el 01-06 (está en Corrientes); llamado: tiene modificaciones para incorporar y vuelve a enviar. 26-06: avisaron que no se van a presentar a CFI; 21-09: Solicitan información de una linea de financiamiento que este destinado a capital de trabajo.', 0, 1, 32, 5, NULL, NULL),
(20, 30, '2020-11-19', '2020-11-26', '22-09 enviamos informacion solicitada x mail. 23-09 asesorado. envie link prescripción de pac kaizen y pac diseño e innovacion. 6-10 finalmente no se va a presentar a ningun pac. Se presentó a Sostenimiento productivo', 0, 1, 32, 5, NULL, NULL),
(21, 50, '2020-04-21', '2020-12-14', 'Confirmamos recepción del formulario remitido el 21-04-20. 15-05: atiende el Cr. (Nelson Clivio), aún no ha tenido respuesta por este ni por Indumatics. Enviada info PyMEs Plus el 12-06. 28-09: Espera respuesta de CFI. Solicita información de lineas en las que encuadre su actividad', 0, 2, 71, 4, NULL, NULL),
(22, 51, '2020-11-19', '2020-11-26', 'Mail enviado el 13-04-2020. Mantuvimos videollamada por CFI Software. Enviada info PAC BID. Llamado el 05-05-20. Envió consulta por mail el 26-05 sobre PAC BID, llamado el mismo día, va a avanzar en presentación. Presentó proyecto a PAC BID el 27-05, mismo día fue desestimado. Enviada consulta a Nación al respecto, respondieron 28-05, enviada respuesta a Darío. Volvió a presentarlo, misma respuesta (29-05). Remitido a Diego de Nación.', 0, 1, 32, 5, NULL, NULL),
(23, 51, '2020-11-19', '2020-11-26', '18-09: contacto telefónico, quiere saber si hay novedades de evaluación de PAC BID porque nunca respondieron después de múltiples intercambios. Remitida consulta a Nación; 21-09: Solicita que se le informe sobre alguan linea de finacniamiento que no demore desmasiado en gestionarse para poder hacer contratación de personal. 23-09 envie lineas de financiamiento', 0, 1, 32, 5, NULL, NULL),
(24, 53, '2020-11-19', '2020-11-26', '13-05: llamados varias veces, nunca atendieron. 05-06: llamado por relevamiento, está llamando a encuestadora. 05-06: consulta por ATP (un poco tarde), quiere conocer líneas financiamiento. Tiene 2 empleados. Enviada info por mail; 21-09: Quiere una linea de finacniamiento para saldar deudas, en lo posible que sea un aporte no reembolsable. 22-09 envie mail con PAC Emprendedor y cfi', 0, 1, 32, 5, NULL, NULL),
(25, 53, '2020-11-19', '2020-11-26', 'CUIT DADA DE BAJA', 0, 1, 32, 5, NULL, NULL),
(26, 52, '2020-09-30', '2020-09-30', 'No respondió ultimo llamado.', 0, 2, 71, 5, NULL, NULL),
(27, 54, '2020-04-24', '2020-12-14', 'Llamado el 24-04, enviado mail el 24-04. 18-05 al 20-05: no atiende, enviamos correo. 30-09: No nos pudimos comunicar', 1, 2, 71, 5, NULL, NULL),
(28, 55, '2020-11-19', '2020-11-26', 'Se le remitió la info sobre BICE-Garantizar y tel Rubio el 07/04/2020. 24-06: llamado por Bustamante, consultas por línea FONDEP COVID Crédito, remitida información, van a enviar esbozo de propuesta para validar con Nación. 15-07: asistidos para presentación en Programa Soluciona, Reactivación de la Eco del Conocimiento. 22-07: enviada consulta para seguimiento presentación a Nación', 0, 1, 32, 5, NULL, NULL),
(29, 56, '2020-11-19', '2020-11-26', 'Se le remitió la info sobre BICE-Garantizar y tel Rubio el 07/04/2020. Intentamos comunicarnos sin éxito el 20-04. 23-09:No nos pudimos comunicar', 0, 1, 32, 4, NULL, NULL),
(30, 57, '2020-11-19', '2020-11-26', 'Llamada por teléfono y mail enviado el 08-04-2020. Se le remitió información actualizada líneas (info 20-04-20). Se le remitió info CFI el 27-04, llamó de nuevO el 29-04 agradeció info Envió mail a Shai el 26-04-20 con quejas sobre implementación de medidas por bancos. Solicitó info CFI, volvimos a llamarla. La llamamos sin éxito', 0, 1, 32, 5, NULL, NULL),
(31, 57, '2020-11-19', '2020-11-26', '11 y 12-05. 13-05: estuvo revisando CFI para proyecto gastronómico pero no avanzó; no salió ATP, ni 24%, no le convence 0% por la tarjeta (está gestionando para una SRL y estos préstamos son personales, no quiere meter a su cliente en estas cuestiones; si la tarjeta fuera para la SRL avanzaría). Dijo conocer a Pedro y que se comunicaría con él, que conoce la SRL. Envió FCP Turismo el 19-05, remitido a Virginia.', 0, 1, 32, 5, NULL, NULL),
(32, 57, '2020-11-19', '2020-11-26', 'Enviada info PyMEs Plus el 12-06. 23-09: No nos pudimos comunicar', 0, 1, 32, 4, NULL, NULL),
(33, 59, '2020-11-19', '2020-11-26', 'Llamada por teléfono y mail enviado el 08-04-2020. No interesado en líneas pago haberes quiero línea equipamiento. Remitido CFI (info 20-04-20). 13-05: no pudo acceder a créditos 0% y le paso a su contador CFI Industria para que revise; 21-09: Accedieron al tasa 0%, pero no es lo que necesitan, ya que no pueden pagar salarios con esa linea. El CFI lo evalúa el contador. Necesitan financiamiento para comprar herramientas y maquinaria. 23-09 envie mail con PAC Emprendedor y PAC Alimento', 0, 1, 32, 5, NULL, NULL),
(34, 58, '2020-04-23', '2020-12-12', 'No respondió ultimo llamado.Llamada el 23-04, enviado mail el 24-04. Llamada el 18-05: tuvieron un crédito bancario de $70.000, con eso pagaron salarios abril. ATP: aprobado pero aún no depositado. Fábrica sigue cerrada, esperan reapertura económica. 08-06: se lo llamó la mañana pasada por relevamiento, dice no entender algo de las líneas, llamar. 11-06: deuda con proveedor cajas y bolsas por un lote de fabricación. No están trabajando porque Colón volvió a fase 1. Ella y el marido son jubilados, no accedieron tasa 0. Empresa familiar, uno de los hijos es empleado y tienen 2 empleados más. Sacó 24% con Santander, mes que viene empieza a pagar 12 cuotas de $10.000. ATP los dos meses bien. Le enviamos CFI Turismo. 30-09: No nos pudimos comunicar', 1, 2, 71, 4, NULL, NULL),
(35, 60, '2020-11-19', '2020-11-26', 'Se le remitió mail general e info sobre BICE-Garantizar el 08/04/2020. Armando carpeta BICE. Quiere más info créditos 0% (info 20-04-20). Envió formulario CFI Industria el 21-04-20. 13-05: buenos avances en CFI Industria tiene todo presentado digital y papel a disposición. 19-06: CFI le envía guía para formulación de proyectos de inversión para microempresas. 11-08: solicita más información sobre Kaizen. 12-08: llamado, remitida información por mail', 0, 1, 32, 5, NULL, NULL),
(36, 60, '2020-11-19', '2020-11-26', '21-09: No avanzaron con el PAC KAIZEN porque no podian operativizarlo. El CFI esta presentado y aprobado, esperan la respuesta del banco. Necesitan un financiamiento para comprar maquinarias y stock de productos. 23-09 asesorado con pac alimento. pase modelo de carta de compromiso', 0, 1, 32, 5, NULL, NULL),
(37, 61, '2020-11-19', '2020-11-26', 'Se le remitió mail general e info sobre BICE-Garantizar el 08/04/2020. Avisó el 17-04 que tiene todo presentado en BICE y está a la espera de evaluación. 15-05: nos dice que BICE le aprobó el crédito por 2 millones; 21-09: No accedio a ninguna linea de financiamiento, pero solicita información para poder invertir y equipar su negocio. 23-09 envié mail con info de lineas', 0, 1, 32, 5, NULL, NULL),
(38, 62, '2020-04-17', '2020-09-30', 'Mail con info líneas FONDEP y CFI enviado el 17-04-20; llamada el 22-04-20. 11-05: decidieron no avanzar ni con CFI Industria Sanitaria ni con FONDEP. 15-05: de momento todo bien no les interesa avanzar con ninguna línea de crédito. 28-09: No nos pudimos comunicar', 0, 2, 71, 4, NULL, NULL),
(39, 63, '2020-11-19', '2020-11-26', 'Se le remitió mail general e info sobre BICE el 08/04/2020. Intentó tramitar BERSA por página web (conforme le indicaron en sucursal) y no pudo. 30-04 nos confirmó que tiene turno a principios de mayo. Presentó formulario CFI Industria el 20-04-20. Le confirmaron de CFI para avanzar con la documentación, confirmó recepción. Ok con crédito tasa 24% BERSA, esperando acreditación', 0, 1, 32, 5, NULL, NULL),
(40, 63, '2020-11-19', '2020-11-26', '22-09:No recibió financiación de la línea tasa 24%, porque el banco le exigía documentación extra y desistió de hacer el seguimiento. En este momento no necesita ninguna linea de financiamiento ya que utilizo medios propios para poner en funcionamiento su negocio.', 0, 1, 32, 5, NULL, NULL),
(42, 65, '2020-04-24', '2020-12-12', 'Mail enviado el 24-04-20. Llamado por Erika el 05-05-20. No califica a CFI porque ya tiene uno en ejecución y el hijo se inscribió hace solo 3 meses. 19-05: tiene turno al Banco estos días, enviado contacto Rubio. 20-05: comenta por mail que fue al Banco y le dijeron que no hay más cupos; sólo para pago de salarios pero ellos no tienen empleados. 18-06: vuelve a cargar formulario 24%, crédito no fue otorgado por estar cupo completo. 30-09: No nos pudimos comunicar', 0, 2, 71, 4, NULL, NULL),
