(95, 114, '2020-04-27', '2020-12-12', 'Llamado por teléfono el 27-04-20; mail enviado el 28-04-20. Llamado de nuevo el 30-04. 15-05: empezó a laburar \"de a puchitos\"; buscaba un subsidio o líneas pero no está dado de alta en AFIP así que es realista. 1-10: No nos pudimos comunicar.', 0, 2, 71, 4, NULL, NULL),
(96, 117, '2020-11-26', '2020-12-03', 'Enviado el mail el 17-04, llamado el mismo día. Envió mail el 11-05 avisando presentación FCP CFI; lo llamamos nuevamente el 13-05 confirmando que está en evaluación. Recibió ok para avanzar, no cumple requisitos libre deuda y cumplimiento obligaciones fiscales, pide que se revisen (21-05). 26-05: libre deuda le frustró CFI, acaba de comprar una máquina en Zunino pensando que le podía salir alguna línea. No conoce Jóvenes Emprendedores 24-09: No nos pudimos comunicar', 0, 1, 32, 4, NULL, NULL),
(97, 118, '2020-04-27', '2020-12-12', 'Llamado por teléfono el 27-04-20; mail enviado el 28-04-20. Se presentó en CFI, envió toda la info el miércoles de esta semana (debe haberlo enviado directo). Quiere algún aporte o crédito porque se le paralizó obra de un local propio: techo, suelo, cerrado. Remitimos info CFI. 1-10: No prospero CFI, desistio de todas las líneas.', 0, 2, 71, 4, NULL, NULL),
(98, 120, '2020-11-26', '2020-12-03', 'Llamados por teléfono y enviado mail con líneas FONDEP y CFI el 17-04-20. Llamado el 21-04-20. Llamaron el 06-05-20, consulta por exportación (llamada por la tarde y enviada consulta y contacto de Mansur, 06-05-20) y PAC COVID (enviado mail 06-05-20). 24-09: No avanzaron con las lineas de PAC COVID. Instalaron una planta en Concepción del Uruguay, las lineas de financiamiento que necesitan se detinaría a infraestructura, contratación de personal y compra de vehículos. Enviar informción de lineas que encuadre con la empresa. (poner en el asunto \"Laura Davin). 28-09 envie linea PAC Emprendedor', 0, 1, 32, 5, NULL, NULL),
(99, 119, '2020-05-15', '2020-12-03', 'Shai envió mail y estuvo en contacto telefónico. Llamada el 15-05 no atendió; llamada el 18-05, averiguó por crédito tasa 0% pero no le interesa porque necesita efectivo, no tarjeta de crédito (18-05). 1-10: No nos pudimos comunicar', 0, 2, 71, 4, NULL, NULL),
(100, 122, '2020-11-26', '2020-12-03', 'Llamado por teléfono el 17-04-20, interesado en líneas financiamiento agro. Llamado por CFI Inversión por Erika el 05-05, va por esa línea. Llamado el 19-05 tras consulta remitida por Armocida sobre cancelación crédito FOGAPYME, envió mail. 22-05: hablamos con Leticia Cortese, pide CUIT y razón social de la empresa, avisado Lell, va ir al Banco. 24-06: nos llamó por CFI, tiene papeles en banco consulta si podrá motivarse el dinamismo de los mismos. 12-08: confirman recepción y consulta por PAC KAIZEN. 24-09: Recibió asesoramiento telefonico de Erika. Le depositaro cfi', 0, 1, 32, 5, NULL, NULL),
(101, 121, '2020-04-24', '2020-12-12', 'Llamado y mail enviado el 24-04. 18-05: desistió de tomar créditos, si hay algo de industrias culturales pidió que le avisemos 30-09: No nos pudimos comunicar', 0, 2, 71, 4, NULL, NULL),
(102, 124, '2020-11-26', '2020-12-03', 'Llamado por teléfono y enviado mail con línea CFI y FONDEP el 17-04-20. Enviada info PyMEs Plus el 12-06. 24-09: No nos pudimos comunicar', 0, 1, 32, 5, NULL, NULL),
(103, 123, '2020-04-28', '2020-12-12', 'Mail enviado, llamado por teléfono el 28-04-20. 15-05: recibió la info pero entiende que no es elegible en la línea. 12-08: envía consulta por certificado MiPyME y PAC KAIZEN, respondida. 1-10: No nos pudimos comunicar.', 0, 2, 71, 4, NULL, NULL),
(104, 126, '2020-11-26', '2020-12-03', 'Llamado por teléfono el 17-04-20, se le envió información por mail el 20-04. Interesado en línea CFI, aunque no está claro que califique. Envió formulario CFI el 04-05-20. 21-05: consulta por respuesta al FCP. Llegó respuesta el 26-05, debe incorporar facturación, llamado el mismo día. Lo reenvió el 27-05, revisado, llamado el 28-05 por Erika, envió FCP corregido. Remitido a Claudio. 02-09 consulto por PAC Emprendedor sobre la EEAE. 24-09: Se va a presentar en PAC Emprendedor, esta en comunicación con Erika por asesoramiento.', 0, 1, 32, 5, NULL, NULL),
(105, 125, '2020-04-30', '2020-12-12', 'Llamado el 30-04-2020, enviada info líneas generales por mail. 18-05: no está interesado en ninguna línea en particular ni avanzó. Enviada info PyMEs Plus el 12-06. 27-07: nos contacta con consulta referida a fianza como contragarantía PyMEsPlus ante Santander Río. Llamado por Bertonchini el 28-07, remitida consulta a Nación dicho día (sobre si es exigible que por ser sociedad de hecho fianza sea realizada por su pareja). 1-10: Accedio a Pymes Plus, pero con garantía propia, los Bancos piden mucha documentación y ponen trabas. Accedieeron al ATP.', 0, 2, 71, 5, NULL, NULL),
(106, 32, '2020-11-27', '2020-12-04', 'Mail enviado el 17-04-20 con info gral y CFI, Mansur viene dialogando con él. Envió mail el 04-05 solicitando info PAC COVID. 11-05: están con un préstamo de empresas autogestionadas del Ministerio de Trabajo. 08-06: llamado, va a enviar por mail info por línea Trabajo Nación que no ha tenido respuesta. 11-06: el Cr. Aníbal Pastre nos dijo que la gestión de ese financiamiento había avanzado. 18-06: enviada info financiamiento Crédito Cooperativas INAES y Programa Trabajo Autogestionado. 23-06: llamado a partir mail enviado, quiere info Jóvenes y CFI. 20-08: llamado a partir de mail enviado, pase info de Pac Kaizen y quede en pasar contacto de asesor certificado. 24-09: Mantuvieron dos reuniones por zoom con el asesor del INTI, por lo que su proyecto de PAC KAIZEN sigue su curso. Pidieron saber en que estado estaba la inscripción que realizaron al programa de exportaciones (MANSUR).', 0, 1, 32, 4, NULL, NULL),
(107, 127, '2020-05-19', '2020-12-12', 'Teléfono no responde; le enviamos mail solicitando nos confirme número. 19-05 llamado. Es autónomo. Aplicó a 0% y no se lo otorgaron. Solicitó en Santander tasa 24%, le dijeron que le pueden dar sin meses de gracia por aprox $230.000. Enviada info PAC BID. Enviada info PyMEs Plus el 12-06. 1-10: No nos pudimos comunicar.', 0, 2, 71, 4, NULL, NULL),
(108, 128, '2020-11-27', '2020-12-04', 'Enviada información solicitada sobre línea CFI hasta $2.500.000. 13-05: mail enviado pidiendo N° de teléfono', 0, 1, 32, 4, NULL, NULL),
(109, 130, '2020-11-27', '2020-12-04', 'Llamado por teléfono el 22-04-2020, lo volvió a llamar Tomy por la tarde. Enviada info BICE por mail el 23-04-20. 13-05: Beneficiario Jemp, habló con Cristian para no pagar la cuota. Obtuvo crédito tasa 0%. Consultó por FONDEP pero le avisamos que no es elegible. 28-09: Enviarle información de lineas en las que encuadre y sean para invertir en capital de trabajo. Envie por mail linea de PAC Emprendedor y CFI', 0, 1, 32, 5, NULL, NULL),
(110, 129, '2020-04-27', '2020-12-12', 'Llamado por teléfono el 27-04-20; mail enviado el 28-04-20. 15-05: ya está trabajando, está contento. 1-10: No recibio ninguna linea vigente, pero tienen un credito de nación que tiene que refinanciar la devolucion. Solicita informacion sobre lineas vigentes en la que encuadre para comprar herramientas y equipamientos.', 0, 2, 71, 4, NULL, NULL),
(111, 131, '2020-05-12', '2020-12-04', '12-05: CFI no le sirvió por ser montos muy bajos. No respondió consulta sobre ATP. Taboada llamado el 08-05-20, teléfono no da. Enviado mail solicitando Nº, envió uno nuevo. Llamado el 11-05, comentamos que estamos en contacto directo con Ardal', 0, 1, 32, 4, NULL, NULL),
(112, 133, '2020-11-27', '2020-12-04', 'Llamado por teléfono y enviado mail el 21-04-20. Remitida información PACO el 11-05-2020. 13-05: no atiende el teléfono, enviado mail. Reconfirmó teléfono que ya teníamos. 02-06: llamado por Shai. Nos cuenta su historial: 13-04 se contactaron son Sec Turismo, recibieron FCP, estuvieron 45 días para juntar documentación. 28-05 mandaron papeles, está en evaluación CFI y BERSA. Restaurante cerró 18-03; 25-05 arrancaron deliverys; 29-05 abrieron al público pero no fue nadie. Pidieron préstamo familiar para gastos proveedores y estan publicando en redes sociales. Interés en CeCER y PACO, llamado por ambos el 03-06. 28-09: Accedieron al ATP por tres meses. No accedio a ninguna linea, pero esta interesado en las que pueda encuadrad para poder pagar deudas y reactivar el restaurante. envie mail con lineas', 0, 1, 32, 5, NULL, NULL),
(113, 132, '2020-04-27', '2020-12-12', 'Llamado por teléfono el 27-04-20; mail enviado el 28-04-20. 15-05: panorama sumamente complicado, están por echarla del local. Agradece el llamado, necesita para subsistir 3 meses. Quiere subsidio, crédito no le sirve. 03-06: insiste con averiguar por subsidio. 22-06: la llamaron de CAFESG ofreciéndole una línea de aportes, va a avanzar, pensó que era nuestra. 07-08: hablamos con ellos y con Daniel Benítez, están interesados en conseguir un ANR para la empresa, es una preocupación del Municipio de Federación. Van a estar en contacto. 1-10: No nos pudimos comunicar', 0, 2, 71, 4, NULL, NULL),
(114, 135, '2020-11-27', '2020-12-04', 'Remitimos información por mail el 20-04-2020; llamado el 21-04-2020. Le interesa CFI Industria. 13-05: está terminando FCP y lo enviaría a correo SDEyE. 28-09: No accedio a ninguna linea de financiación pero quiere recibir información de lineas vigentes en las que encuadre y sea para invertir en el armado de equipos innovadores. Envie info de PAC', 0, 1, 32, 5, NULL, NULL),
(115, 134, '2020-03-23', '2020-12-13', 'Hablamos por teléfono el 23-04-2020, mail enviado por consulta Formulario el 24-04-20, 19-05: contactado por teléfono y envió mail. Es firma exportadora, está gestionando prefinanciación de exportaciones CFI (180 días), ya está firmado. Está presentando a FONDEP K de Trabajo, tramitando aval SGR. 07/09 llamaron consultando por PAC Alimentos - 10-09 me llamo, estan avanzando con PAC Alimentos, ya envio 3 proyectoS de pac alimento', 0, 2, 71, 5, NULL, NULL),
(116, 137, '2020-11-27', '2020-12-04', 'Remitimos información por mail el 20-04-2020; llamado el 21-04-2020. Llamado el 13-05, pidió tasa 0% pero no le salió. Están trabajando muy bien desde que reabrieron. 28-09: No nos pudimos comunicar', 0, 1, 32, 5, NULL, NULL),
(117, 136, '2020-04-23', '2020-12-13', 'Llamado por teléfono el 23-04-2020, mail enviado por consulta Formulario el 24-04-20. Contacto el 12-05, consulta por SIMI Importación. Llamado y enviado contacto Mansur. 27-05: envió consulta por resultados línea, llamado, le pedimos si tiene algún número de trámite para remitir. Enviada info PyMEs Plus el 12-06. 30-09: Solicitan información de lineas vigentes en las que encuadren. 16-10: habló con Bustamante sobre presentación a línea BNA, tiene carpeta en Garantizar. Llamamos a Garantizar para consultar estado del trámite, está en curso. Notificado de esta situación', 0, 2, 71, 4, NULL, NULL),
(118, 138, '2020-04-28', '2020-12-12', 'Le enviamos el link para que avance en el registro el 28-04-20. 15-05: no atendió. 18-05: están trabajando proyecto fumigación autos, tendrían todo listo para presentar. 19-05: llamar por Shai, cómo sigue tramitación línea. Está ayudando a 2 ingenieros agrónomos a armar proyecto. Enviada info PyMEs Plus el 12-06. 18-06: enviada info financiamiento Crédito Cooperativas INAES y Programa Trabajo Autogestionado. 1-10: Me comunique con Maximiliano, pero ya no forma parte del directorio, sin embargo le va a transmitir la información al tesorero de la cooperativa para que estemos en contacto. Y va a colaborar para que puedan avanzar con la gestión de lineas y asesoramientos.', 0, 2, 71, 4, NULL, NULL),
(119, 139, '2020-04-30', '2020-12-04', 'Llamado el 30-04-2020, mail enviado el mismo día. Enviaron CFI Industria Sanitaria el 16-05, remitido a CFI para su análisis. Tenían una consulta de Industria, los llamamos el 26-05, hablamos con Javier que no estaba al tanto, se volverán a comunicar. 1-10: No quieren que lo llamen mas', 0, 2, 71, 4, NULL, NULL),
(120, 140, '2020-11-27', '2020-12-04', 'Remitimos información por mail el 20-04-2020; llamado el 21-04-2020. Revisa la información y nos llama. Enviada info PAC COVID el 05-05-20. Llamado el 06-05-20 no califica en PAC COVID, se lo tendrá al tanto futuras líneas caso Jemp. 13-05: habló con la Vicegobernadora para fabricar camillas ortopédicas, se contacta de nuevo en 2 semanas por interés en JEmp. 26-05: cerró kiosco, sigue interesado en emprender fabricación camillas hospitalarias. 08-06: pidió que lo llamen por Jóvenes, lo va a llamar Tommy. 28-09: No nos pudimos comunicar', 0, 1, 32, 4, NULL, NULL),
(121, 141, '2020-04-28', '2020-12-12', 'Llamado por teléfono el 28-04-20; mail enviado el 28-04-20. 15-05: NBER nunca más le contestó, las otras líneas no lo convencieron. Enviada info PyMEs Plus el 12-06. 15-07: hablamos por teléfono, remitimos más info PyMEs Plus, nos tendrán al tanto de la gestión en tanto su experiencia con el Bersa ha sido sumamente negativa. 30-09: Solicita que resolvamos que el banco le otrogue el credito porque considera que se resuelve si el Ministerio llama al Banco. Que no le sirve que lo llamemos para ver si puede acceder a lineas de financiamiento si los bancos hacen lo que no deben. Se va a financiar con medio propios.', 0, 2, 71, 4, NULL, NULL),
(122, 142, '2020-11-27', '2020-12-04', 'Remitimos respuesta inicial por mail; llamado el 21-04-20. Tomy lo ha estado llamando, 20-05: habló con Shai. Interés en Empleo Verde Red Argentina Municipios. Pueden llegar a asociarse con Vatios para presentación CFI. 28-09:No nos pudimos comunicar', 0, 1, 32, 5, NULL, NULL),
(123, 143, '2020-05-22', '2020-05-22', 'Llamado el 22-05. Le aparece que aún se encuentra en estudio la solicitud.', 0, 2, 71, 5, NULL, NULL),
(124, 145, '2020-11-27', '2020-12-04', 'Llamada el 04-05, mail enviado el mismo día. Llamada el 22-05, avanzando con tasa 0%; cargó débito y no crédito, lo está modificando 1-10: Accedio a tasa 0%. Esta en contacto con Nair.', 0, 1, 32, 5, NULL, NULL),
(125, 144, '2020-05-22', '2020-05-22', 'Llamado el 22-05: enviamos info Desarrollo Social y Jóvenes Emprendedores. No tiene ninguna inscripción ni nada en marcha. 05-06: está con mucho laburo, quiere comprar una fijadora y un compresor para su carpintería. 31 años. Nos va a pasar mail. Fue monotributista pero ya no. Enviada info por mail 23-09 quiere elementos para la carpinteria. Envié mail con programas de Desarrollo Social.', 1, 2, 71, 4, NULL, NULL),
(126, 146, '2020-11-27', '2020-12-04', 'Llamado el 04-05-20, mail enviado el mismo día. Tasa 0%, la mujer (Paola) lo está avanzando. 1-10: Accedio al tasa 0% , pero por ahora no quiere endeudarse. Si hay algun ANR o subsidio que le avisemos por mail.', 0, 1, 32, 5, NULL, NULL),
(127, 147, '2020-11-27', '2020-12-04', 'Mail info PAC COVID enviado el 04-05-2020. 22-05: enviado mail solicitando teléfono, respondió. 26-05: hace pan casero, quiere financiamiento para escalar. Tiene edad para Jóvenes Emprendedores. Llamado el 08-05-20, es perfil Jóvenes Emprendedores. Es chef, emprendimiento se llama \"Mi dulce paladar\", hace reparto a domicilio, tiene dado de baja monotributo. Enviado mail con contacto Jóvenes el 11-05-20. 1-10: Se dio de alta en AFIP hace un mes, por lo que no cumplia con los requisitos de ninguna linea, pero queire que le avisemos de la apertura de la convocatoria de Jóvenes y de las líneas en las que encuadre para invertir en su panadería.,', 0, 1, 32, 5, NULL, NULL),
(128, 148, '2020-05-22', '2020-05-22', 'Llamado el 22-05: emprendimiento venta de carnaza y pescado. No tiene inscripción ni nada similar, quiere financiamiento para comprar freezer o cámara, y también redes y demás. 26-06: remitido a Coordinador de Pescadores del Ministerio, Pablo Gudiño. 23-09 Comenta que no accedio a ninguna linea, pero quiere comprar elementos para la pesca. Comento que puedo ofrecerle alguna linea, no tiene correo electronico.', 0, 2, 71, 4, NULL, NULL),
(129, 149, '2020-05-26', '2020-05-26', 'Llamada el 26-05: tiene una cervecería y hamburguesería y etc. 24% y líneas bancarias en general: no puede acceder porque está en el Veraz, tiene deuda con Banco Ciudad. CFI: se presentó en 2018 y le perdieron carpeta desde Ofi Concordia. 12-08: consulta por PAC KAIZEN, remitida información. 23-09 No pudo acceder a la linea pac kaizen, quiere averiguar por otra linea, necesita comprar maquinarias , aprox $ 150 mil. 24-09 envie mail con info de cfi, pac emprendedor y pac alimento', 0, 2, 71, 5, NULL, NULL);
