(130, 150, '2020-11-27', '2020-12-04', 'Mail info general y PAC COVID enviado el 04-05-2020. 22-05: enviado mail solicitando teléfono. 21-09-20 Se le envia email solicitando nº de telefono. 22-09 Llamo indica que no tramito al final pac covid, tiene pyme de sonido e iluminacion , pide algun pac , se le va estar enviando info. Se le envio mail de pac emprendedor, pac eficiencia energetica y pac digital.', 0, 1, 32, 5, NULL, NULL),
(131, 151, '2020-09-24', '2020-12-04', 'Cobro atp para 7 empleados, pero al empleado que tiene mas antigüedad no se lo depositaron.', 0, 2, 71, 4, NULL, NULL),
(132, 152, '2020-09-24', '2020-12-04', 'Envio mail con informacion de microcredito, cuit dado de baja', 0, 1, 71, 4, NULL, NULL),
(133, 153, '2020-11-27', '2020-12-04', 'Mail info PAC COVID enviado el 04-05-2020. Ya estábamos en contacto por plataforma CeCER. 22-05: enviado mail solicitando teléfono, respondió. 26-05: no accedió a IFE ni a tasa 0% (por ser monotributista social). 21.09 pregunta por resultados de jovenes emprendedores.', 0, 1, 32, 5, NULL, NULL),
(134, 154, '2020-09-24', '2020-12-04', 'Comenta que tomo cfi y se lo autorizaron , pero desde el banco todavía no tiene noticias, esta en la espera.', 0, 2, 71, 5, NULL, NULL),
(135, 155, '2020-09-24', '2020-12-04', 'Consultaron por línea Producción Regional Exportable CFI, información enviada, no respondieron ultimo llamado.', 0, 2, 71, 4, NULL, NULL),
(136, 157, '2020-11-27', '2020-12-04', 'Mail enviado solicitando confirmación N° de teléfono (no atendió el 05-05-20). Llamado el 06-05-20. Tiene crédito CFI vigente; muy enojado con BERSA, interesado en línea BICE. 13-05: va a llamar a Rubio por la línea, lo conoce. 22-05: factura $2 millones por año. BERSA lo llamó y le ofrece $800.000 a devolver en 6 meses sin período de gracia. No avanzó por BICE. Gerente BERSA dijo que Bahillo y Bordet son charlatanes. Sacó todas sus cuentas de BERSA se fue al BICA, está tramitando el 24% ahí. (21-09-20) Obtuvo linea Bice con banco Entre rios .', 0, 1, 32, 5, NULL, NULL),
(137, 156, '2020-09-24', '2020-12-04', 'No respondió los últimos llamados.', 0, 2, 71, 4, NULL, NULL),
(138, 158, '2020-12-02', '2020-12-09', 'Enviado mail solicitando un teléfono. Enviada info sobre créditos a tasa 0%. Enviaron un mail el 10-05 con teléfono de Sterzzi. 13-05: jubilada, no aplica a 0%. Interés en Jóvenes. 22-05: queja de que no hay líneas dirigidas a ellos.21-09-20 Informo que se le va estar enviado las evaluaciones.', 0, 1, 32, 4, NULL, NULL),
(139, 159, '2020-09-24', '2020-12-09', 'Llamada el 28-05: está en Sta Fe, trabaja con 3 chicos de allá en sanitizador hecho con Arduino. 29-05: remitida info. 02-06: consultada si vio info líneas. El 04-06 se reúne con chicos que están desarrollando sanitizador, estan averiguando por esto. El 05-06 nos comenta. En diciembre 2019 empezó a pagar Jóvenes. 24-09 No accedio a ninguna linea, porque pudo volver a trabajar, no requiere info de otra linea.', 0, 2, 71, 4, NULL, NULL),
(140, 160, '2020-12-02', '2020-12-09', 'Enviado mail con info PAC COVID, solicitado un número de teléfono. 22-05: aún no envió teléfono. 21-09-20 Comento que cambio de rubro y dejo tramite porque lo necesito.', 0, 1, 32, 5, NULL, NULL),
(141, 161, '2020-12-02', '2020-12-09', 'Enviado mail con info PAC COVID, lo analizó y vio que no es para ella la línea. Llamada el 05-05-20, enviada info créditos tasa 0%. No puede acceder porque trabaja para el CGE. 22-05: la enviamos a Jóvenes, tiene 35 años. 0% no entra porque tiene sueldo fijo. 21-09-20 No pudo acceder a credito tasa 0, porque el sistema le rechazo tema de números, comenta que necesita maquinas, brindò monto destinado. Envío mail de pack emprendedor.', 0, 1, 32, 5, NULL, NULL),
(142, 162, '2020-09-24', '2020-12-09', 'No accedió a ninguna linea , cfi turismo no realizo tramite, comenta que su rubro esta muy afectado y si toma un crédito no va poder devolverlo.', 0, 2, 71, 4, NULL, NULL),
