(354, 233, '2020-06-29', '2020-12-16', 'llamado: trabajan en la costanera de Paraná en el turismo con la gente. No tienen ingreso de ningún tipo ni ayuda económica del gobierno. Están pagando su terreno que están atrasados.\r\nTienen un puesto de tortas en la costanera tipo carpa. Su hija más grande está sin trabajo también.\r\nNo cuentan con ningún tipo de ayuda. Completó el formulario Laura (mujer de Ernesto) él es monotributista. Hace 5 años compraron una camioneta porque los contrataban para torneos en clubes, que también está todo parado. Su unica fuente de trabajo es actualmente esta camioneta.\r\nSolicitaron el IFE --> Le dijeron que no se lo podían otorgar. Figuran como vendedores ambulantes pero no saben si es por esto.\r\nSe sugiere revisar crédito Tasa 0% a través de AFIP.', 0, 2, 71, 5, NULL, NULL),
