INSERT INTO `evaluacion` (`id`, `proyecto`, `evaluador`, `estado`, `resultado`, `fecha`, `comentario`, `puntaje1`, `observacion1`, `puntaje2`, `observacion2`, `puntaje3`, `observacion3`, `puntaje4`, `observacion4`, `puntaje5`, `observacion5`, `puntaje6`, `observacion6`, `puntaje7`, `observacion7`, `puntaje8`, `observacion8`, `created_at`, `updated_at`) VALUES
(13, 14, 33, 20, 72, '2020-10-09', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación del proyecto.', 5, 'El sector al que pertenece esta MiPyME no fue considerado como actividad esencial inicialmente. Motivo por el cual la producción estuvo pausada por semanas, generando costos como por ejemplo de sueldos e impuestos. Actualmente están solicitando el crédito para comprar materia prima para producir hornos.', 10, 'Fortalece el sector industrial de la Provincia de Entre Ríos y el sector panadero acercándole hornos rotativos y maquinaria con tecnología que mejora y facilita su producción.', 8, 'Tiene una capacidad de producción actual de 60 hornos anuales. Con la solicitud del préstamo buscan llevar la producción a 100 hornos anuales. Los integrantes manifestaron que si bien en el año 2019 la situación económica del país puso en crisis a todas las PyMEs, a comienzos del año 2020 el estado de animo de sus clientes cambió y tuvieron un impacto positivo en sus ventas, situación que se vio comprometida por la pandemia.', 10, 'La MiPyME facturó mas del doble de lo que solicitan al programa. Motivo por el cual cumpliría con este requisito. Su facturación en el periodo 2019 fue $7.713.046,20', 17, 'El proyecto busca solventar el impacto negativo que tuvo con la pandemia Covid 19. El financiamiento se destinara a capital de trabajo para escalar la producción.', 15, 'Actualmente tiene 4 empleados. 3 están en sector productivo y 1 en sector administrativo. Se proyecta no solo la preservación de esta fuente sino que también incorporación de personal en el área operativo y venta a calle para el año 2021', 7, 'Los desechos de la fabricación son recortes de chapa de acero inoxidable los cuales son donados a la municipalidad para la planta recicladora. No genera contaminación de medioambiente. En materia social genera puestos de trabajo a nivel local. No presenta un abordaje especifico en perspectiva de genero', 0, 'Cumple con los requisitos y destino previsto en el marco de la presenta linea', '2020-10-02 15:06:04', '2022-06-07 15:09:10'),
(17, 18, 33, 19, 78, '2020-10-21', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación del\r\nproyecto.', 5, 'El sector al que pertenece la PyME no fue considerado como actividad esencial inicialmente, motivo por el cual la producción estuvo suspendida por algunas semanas. Actualmente están solicitando el crédito para comprar materia prima e insumos para confeccionar indumentaria para las Fuerzas Armadas, de trabajo, sanitario, entre otros.', 10, 'Fortalece al sector de industria textil de la Provincia de Entre Ríos y a todos los trabajadores alcanzados con indumentaria adecuada a su puesto de trabajo.', 10, 'De acuerdo a los Estados Contables del periodo 2019, cuenta con amplia capacidad financiera y económica. Ademas es categorizada como Pequeña empresa de acuerdo al certificado MiPyME. En cuanto a la capacidad operativa, la empresa cuenta con la maquinaria e instalaciones necesarias para realizar la producción de indumentaria.', 10, 'Tiene una facturación ampliamente superior a la que exige el programa para solicitar el monto máximo de $1.000.000.', 12, 'El presente proyecto busca solventar el impacto negativo que tuvo con la pandemia Covid 19. El financiamiento se destinara a capital de trabajo para escalar la producción.', 15, 'La cooperativa cuenta con 95 asociados.', 6, 'Los desechos de telas y cubos son donados a una entidad intermedia que los recicla y los vuelve usar en otra entidad. Ademas no genera residuos que contaminen el medio ambiente.\r\nEn cuanto a la perspectiva social genera puestos de trabajo social. Cabe destacar que no presenta un abordaje especifico en perspectiva de genero', 10, 'El monto solicitado será destinado para la compra de materia prima e insumo, por lo tanto cumple con los requisitos y destino del crédito previsto en el marco de la presenta linea.', '2020-10-06 12:01:55', '2020-11-09 12:56:42'),
(18, 19, 33, 19, 90, '2020-10-27', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación del proyecto', 8, 'El sector al que pertenece esta PyME no fue considerado como actividad esencial inicialmente. Esto produjo una suspensión de las actividades de producción por un periodo temporal de semanas, mientras tanto se seguían generando costos de como por ejemplo alquiler, sueldos e impuestos.', 12, 'Fortalece el sector industrial del país compitiendo directamente con productos importados. Además es proveedor de equipamientos a otras MiPyMEs de los sectores de Industria, servicio, agropecuario y principalmente del sector construcción de todo el país.', 10, 'El certificado de MiPyME le otorgó la categoría de pequeña empresa lo que muestra que esta PyME tiene una capacidad económica, financiera  y operativa suficiente para respaldar la solicitud del crédito del presente programa.', 10, 'Esta empresa facturó en 2019 mas del doble del monto solicitado en el programa. En el periodo 2019 facturó $94.755.212,27', 19, 'La PyME proyecta destinar el monto del crédito a la adquisición de materia prima para la construcción de dos puentes grúa para facilitar el traslado de los materias del proceso productivo.', 13, 'Cuenta con 25 empleados en relación de dependencia. Se proyecta preservar esta la fuente laboral.', 8, 'Los residuos que generan en la actividad productiva reciben el tratamiento correspondiente para cuidar el medio ambiente. En\r\nmateria social genera puestos de trabajo a nivel local. No presenta un abordaje especifico en perspectiva de genero.', 10, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea', '2020-10-07 19:26:18', '2020-11-09 12:57:02'),
(19, 20, 33, 19, 75, '2020-10-15', 'Por lo desarrollado en los puntos anteriores y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación de este proyecto.', 8, 'Si bien fueron pocas semanas las que tuvieron que frenar la producción. La MiPyME se vio obligada a adaptarse a las nuevas formas de comercialización de su producto ya que solo se podía realizar en modalidad \"delivery\" lo que generó un impacto negativo en sus ingresos . Esta heladería también fue afectada por la prohibición del turismo ya que la misma se caracteriza por tener una importante clientela generada por turistas que visitan las termas en todas las épocas del año.', 12, 'Contribuye  de forma sumamente positiva al sector productivo que pertenece ya que se mantiene hace mas de 40 años como una empresa entrerriana, familiar y de producción artesanales compitiendo con franquicia que se encuentran instaladas en todo el país.', 7, 'Tiene una amplia capacidad operativa determinada por la producción de helados y tortas heladas que abastece a dos puntos de ventas de la ciudad de Victoria. En cuanto a su capacidad económica y financiera considero que se encuentra en una posición favorable de tomar un préstamo por el monto solicitado ya que el periodo 2019, su facturación fue el doble.', 8, 'Como mencioné en el punto anterior, la MiPyME cumple con el requisito de que su facturación del periodo 2019 fue del doble del monto solicitado al programa.', 15, 'La financiación solicitada será destinada para la adquisición de capital de trabajo (insumos y materia prima) para poder sobrellevar la situación actual generada por el Covid 19.', 10, 'Ademas de participar la familia en esta MiPyME (titular del proyecto, su hermano, su padre y su abuela) también cuenta con tres empleados en relación de dependencia. Se proyecta la preservación de estos puestos de trabajo.', 5, 'Tiene impacto positivo en la perspectiva social ya que genera empleo local y se destaca en el turismo con sus productos artesanales y su ubicación. No afecta de manera negativa al medio ambiente ni contempla la perspectiva de genero.', 10, 'Proyectan la utilización de los fondos solicitados a la compra de capital de trabajo. Por tal motivo cumple con los requisitos y destino previsto en el marco de la presenta linea.', '2020-10-08 12:56:29', '2020-11-09 12:57:26'),
(26, 27, 33, 19, 77, '2020-10-20', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación del proyecto.', 5, 'Al pertenecer al sector de salud, no tuvo en ningún momento suspensión de actividades. Sin embargo tuvieron que adaptarse a los nuevos protocolo de sanidad ya que el personal se encontraba con una mayor exposición al Covid19. Esta situación generó un aumento de costos en insumos de prevención. Ademas, este sector sufrió las consecuencia de una afluencia de pacientes y consultas mucho menor, debido a que la gente prefería no asistir por la pandemia cuando las condiciones no eran muy graves.', 8, 'La incorporación de la tecnología objeto del presente proyecto impacta positivamente en la calidad y eficacia de los servicios brindados por la Cooperativa, contribuyendo a su sostenimiento y crecimiento.', 10, 'Según los Estados Contables presentados, la PyME cuenta con excelente capacidad económica y financiera. En cuanto a la capacidad operativa, el sanatorio esta completamente equipado y adecuado para prestar diversos servicios.', 10, 'La PyME tiene una facturación que supera ampliamente el doble del monto solicitado al presente programa. Según el Estado de Resultado, en el periodo 2019 tuvo una facturación de $46.524.009,33', 12, 'Con la realización de este proyecto se busca brindar un mejor servicio de salud a la comunidad, aumentando la capacidad instalada del sanatorio y consolidando con ello su presencia como actor en materia de salud.', 15, 'La PyME esta conformada por 50 cooperativistas.', 8, 'Los desechos son de los insumos descartables que se utilizan diariamente; estos reciben el tratamiento correspondiente para que no contaminen el medio ambiente. En materia social genera puestos de trabajo a nivel local. En cuanto al abordaje especifico en perspectiva de genero, existe equidad en la composición de los miembros de la cooperativa, pero no hay un abordaje específico de la materia a partir del proyecto', 9, 'El destino del monto solicitado es para maquinaria. Esto implica el correcto encuadramiento a los términos previstos en la Resolución y normas complementarias.', '2020-10-15 16:21:49', '2020-11-09 14:52:40'),
(32, 33, 33, 19, 70, '2020-10-23', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación del proyecto.', 8, 'Este sector se vio fuertemente afectado de forma indirecta ya que sus principales clientes, los \"bares\", permanecieron cerrados por varios meses lo que provoco una disminución en la demanda y por lo tanto en la producción de la cerveza artesanal.', 10, 'Contribuye de forma favorable al sector relativamente nuevo de la cerveza artesanal compitiendo directamente y sustituyendo la cerveza industrial.', 7, 'Cuenta con una capacidad operativa para abastecer a distinto bares de la ciudad y con este proyecto busca ampliarla para alcanzar un nuevo mercado. En cuanto a su capacidad económica y financiera, le da el respaldo suficiente para solicitar el crédito al presente programa.', 9, 'Cumple con el requisito de haber facturado como mínimo , en el periodo 2019, el doble de lo solicitado al programa. Según el formulario 1272 de AFIP, en 2019 facturó $3.185.660,32.', 15, 'Como se menciono anteriormente, el proyecto busca aumentar su capacidad productiva y ofrecer su producto en lata para insertarse en un nuevo mercado.', 8, 'Actualmente tiene 3 empleados. La MiPyME proyecta  la preservación de esta fuente de trabajo.', 5, 'Los desechos de la producción artesanal de cerveza no generan contaminación de medioambiente. En materia social genera puestos de trabajo a nivel local. No presenta un abordaje especifico en perspectiva de genero', 8, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea ya que destinara el monto a la adquisición de fermentadores.', '2020-10-19 11:53:07', '2020-11-09 14:52:51'),
(33, 34, 33, 19, 74, '2020-11-20', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación del proyecto.', 6, 'El sector al que pertenece esta MiPyME se vio afectado indirectamente por la caída de la actividad económica de sus potenciales clientes, afectando la cadena de pago como así también la suspensión del servicio.', 15, 'Genera una contribución favorable al sector informático al que pertenece y a todos los sectores en general que utilizan estas herramientas para comercializar y alcanzar un mayor mercado. Las paginas Web que desarrolla esta MiPyME fueron indispensable para la nueva forma de comercialización en tiempo de pandemia. Actualmente busca desarrollar servicio Web en la nube, servicio que facilita la digitalización y archivo evitando la utilización del papel.', 5, 'Presenta capacidad adecuada para llevar adelante el proyecto que presenta.', 8, 'Esta MiPyME cumple con el requisito de haber facturado en el periodo 2019, el doble del monto que solicita.', 13, 'El proyecto busca mejorar las condiciones de comercialización adaptándolas a la situación actual. El financiamiento se destinara para brindar un nuevo servicio a las MiPyMEs', 10, 'Proyecta incorporar personal para desarrollar el nuevo proyecto.', 7, 'No genera residuos que contaminan el medio ambiente. El servicio que pretende realizar será unico a nivel provincial, ya que no hay otro competidor que lo brinde.  En cuanto a la perspectiva de genero, no presenta un abordaje especifico .', 10, 'Cumple con todos los requisitos y destino previsto en el marco del presente programa.', '2020-10-19 12:26:06', '2020-11-24 15:09:31'),
(34, 35, 33, 19, 82, '2020-10-22', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación del proyecto.', 5, 'El sector al que pertenece esta PyME no fue declarado como actividad esencial inicialmente, esto llevo a una suspensión de la actividad por un tiempo relativamente corto. Si bien no generó efecto económicos severos, la PyME tuvo que afrontar sueldos mensuales de sus empleados sin haber tenido ingresos en esos periodos.', 13, 'Favorece al sector productivo industrial al cual pertenece tanto como cliente adquiriendo desechos post-industriales como proveedor de por ejemplo bolsas a revendedores que distribuyen a aeropuertos, hospitales y otras empresas.', 9, 'Tiene una capacidad operativa mensual de 150 toneladas. En cuanto a su capacidad económica y financiera tiene una facturación y resultado neto anual muy rentable.', 10, 'La PyME cumple con el requisito de obtener el doble de facturación del monto solicitado al programa. Cabe destacar que la misma supera ampliamente la facturación requerida para acceder al programa. Su facturación anual fue de $170.958.548,16', 13, 'Con este proyecto buscan reemplazar la adquisición de materia prima en la provincia de Buenos Aires, por la propia producción de la misma a través del procesamiento de sus desechos.', 15, 'Este empresa proyecta preservar la fuente laboral de sus 40 empleados e incorporar 4 mas.', 8, 'En cuanto a la perspectiva de sustentabilidad ambiental no genera residuos tóxicos y reutiliza los desechos de otras industrias. En la perspectiva social genera puestos de trabajo local y en lo referido a la perspectiva de genero no contempla un abordaje especifico del mismo.', 9, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea ya que utilizará los fondos para adquisición e instalación de la nueva maquina que procesará sus desechos convirtiéndolos en su propia materia prima.', '2020-10-19 19:51:37', '2020-11-09 14:53:55'),
(36, 37, 33, 19, 88, '2020-10-29', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación del proyecto.', 4, 'Esta PyME pertenece al sector alimenticio, el cual no se vio tan afectado con las medidas de la pandemia en relación a otros sectores donde suspendieron su producción/servicio por meses.', 14, 'Contribuye favorablemente al sector que pertenece, reemplazando otras marcas de lácteos y fomentando empleo tanto a tambos como a personal de la industria y comercios.', 10, 'Cuenta con capacidad económica y financiera suficiente para poder solicitar el crédito. En lo referido a la capacidad operativa, cuanta con una capacidad productiva de 700.000 litros y 85.000.', 10, 'La PyME supero ampliamente el doble de facturación del monto solicitado al presente programa, cumpliendo con el requisito.', 15, 'El destino del fondo solicitado es para la adquisición de capital de trabajo para aumentar la capacidad productiva de la empresa.', 15, 'Actualmente tiene 23 empleados en relación de dependencia. La PyME proyecta preservar esta fuente de trabajo.', 10, 'La empresa no genera residuos tóxicos que contaminen el medio ambiente. En cuento a la perspectiva social genera empleo local y además demanda materia prima lo que genera empleo/actividad en el sector tambero y ganadero. No presenta un abordaje especifico en perspectiva de genero', 10, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea ya que destinará el crédito a adquisición de materia prima.', '2020-10-23 18:10:18', '2020-11-09 14:54:05'),
(37, 38, 33, 19, 84, '2020-11-02', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación del proyecto.', 8, 'El impacto que generaron las medidas de aislamiento social, preventivo y obligatorio fue en la forma de comercialización convencional. Ante esta situación la MiPyME se vio obligada a implementar ventas on line y formalizar vínculos comerciales directos con distribuidoras mayoristas y cadenas de franquicias dietéticas.', 12, 'En los comienzos de esta actividad, era un sector desconocido en el país. Actualmente contribuye favorablemente al sector que pertenece, incorporando tecnología al cultivo de pecan y también siendo proveedor de franquicias dieteticas.', 10, 'Tiene una capacidad económica y financiera suficiente para respaldar la solicitud del crédito. En cuanto a la capacidad operativa, viene incrementadose desde los años 90 permitiendo vender en todo el país y en el exterior.', 8, 'La empresa facturó mas del doble del monto del crédito solicitado en el programa. En el periodo 2019 tuvo ingresos por ventas de $5.533.218,14', 16, 'Además de recuperarse de los efectos de la pandemia, esta MiPyME busca reutilizar los desechos de su producción generando un nuevo producto.', 12, 'La MiPyME cuenta con 6 empleados en relación de dependencia. Se proyecta la preservación de esta fuente de trabajo.', 8, 'Con la adquisición de la nueva maquina buscan optimizar los residuos que genera el proceso productivo. Los desechos se utilizaran como abono para las plantas. En lo referido a la perspectiva social y de genero, genera empleo local pero no presenta un abordaje especifico en la perspectiva de genero.', 10, 'En el proyecto presentado se manifiesta que el destino del crédito será para la adquisición de maquinaria. Esto conlleva al cumplimiento de los términos previstos en la Resolución y normas complementarias.', '2020-10-26 13:46:40', '2020-11-09 14:51:50'),
(38, 39, 33, 19, 76, '2020-10-30', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación del proyecto.', 7, 'Este sector no fue considerado como actividad esencial inicialmente por lo cual la producción estuvo suspendida por semanas mientras se seguían generando costos de sueldos, impuestos, energía, etc.', 12, 'Contribuye favorablemente al sector industrial al que pertenece y al sector de los frigoríficos avícolas de los cuales es proveedor de la mayor cantidad de los productos que utilizan.', 7, 'Tiene una capacidad financiera y económica suficiente para respaldar la solicitud del crédito. En cuanto a su capacidad operativa, si bien la demanda que tiene es mayor a la que puede satisfacer es un gran proveedor de la provincia.', 10, 'La MiPyME cumple con el requisito de haber facturado el doble del monto solicitado al presente programa según documentación respaldatoria (Estados Contables).', 17, 'El proyecto se presento con el fin de obtener financiamiento para la adquisición de materia prima con el fin de tener stock para responder a la demanda creciente.', 9, 'Tiene ocho empleados en relación de dependencia y proyecta la preservación de esta fuente de trabajo.', 6, 'Los desechos que se producen de la actividad son reutilizados como bolsas de consorcio. En cuanto a la perspectiva social genera empleo a nivel local. No presenta un abordaje especifico para la perspectiva de genero.', 8, 'El destino del financiamiento cumple con los términos previstos en la presente Resolución y normas complementarias que reglamentan el presente programa.', '2020-10-29 18:58:41', '2020-11-09 15:44:59'),
(40, 41, 33, 19, 69, '2020-11-06', 'Por lo desarrollado en los puntos anteriores y de acuerdo a los parámetros de la Resolución N° 1098/20 SDEyE se recomienda la financiación de este proyecto.', 4, 'Este sector no tuvo efectos negativos con la declaración nacional y provincial del aislamiento social, preventivo y obligatorio. Si bien esta actividad no fue declarada esencial, pudo desarrollarse normalmente ya que la realización de la misma no conlleva la participación de muchas personas.', 13, 'Contribuye favorablemente al sector agropecuario con la mejora de genética del sistema de ganadería que proyecta realizar esta MiPyME con el crédito solicitado.', 8, 'Cuenta con casi 200 hectáreas para desarrollar la actividad lo que le genera una amplia capacidad operativa. Tiene suficiente capacidad financiera y económica para respaldar la solicitud del crédito.', 10, 'Cumple con el requisito de haber facturado el doble de los solicitado al programa. Según la documentación respaldaría (formulario 1272 AFIP) en 2019 facturó $1.637.797,29', 15, 'Proyecta adquirir materiales e insumos necesarios para mejorar la instalaciones y darle un valor agregados a sus productos.', 5, 'Por el momento no tiene empleados en relación de dependencia ya que es una MiPyME familiar, pero proyecta incorporar personal en un futuro cercano.', 6, 'Esta actividad no genera residuos que contaminen el medio ambiente. En la perspectiva social, si bien no genera empleo directo, es proveedor de frigoríficos de la provincia de Entre Ríos que cuentan con gran cantidad de empleados. No presenta un abordaje especifico en perspectiva de genero.', 8, 'El presente proyecto destinará el financiamiento solicitado en mejorar las instalaciones cumpliendo con los términos previstos en la Resolución y normas complementaria que reglamentan en el programa.', '2020-11-04 23:23:39', '2020-11-09 14:51:23'),
(41, 42, 33, 20, 72, '2021-03-04', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 233/21 SDEyE se recomienda la financiación del proyecto.', 10, 'El sector al que pertenece la MiPyME no fue considerado como actividad esencial inicialmente, motivo por el cual la producción estuvo suspendida por algunas semanas generándose gastos . También tuvo efecto negativo de forma indirecta ya que la mayoría de sus clientes pertenecen al sector de deporte, el cual estuvo en receso por varios meses.', 10, 'Fortalece al sector de industria textil de la Provincia de Entre Ríos al cual pertenece con alcance de su producción en todo el país.', 8, 'De acuerdo al formulario de AFIP 1272, cuenta con amplia capacidad financiera y económica. En cuanto a la capacidad operativa, la\r\nempresa cuenta con la maquinaria e instalaciones necesarias para realizar la producción de indumentaria comercializada en todo el país.', 7, 'Tiene una facturación ampliamente superior a la que exige el programa para solicitar el monto máximo de $1.400.000.', 9, 'El presente proyecto busca solventar el impacto negativo que tuvo con la pandemia Covid 19. El financiamiento se destinará a la compra de materia prima e insumos con el fin de tener un stock sostenido.', 10, 'Actualmente cuenta con dos empleados pero proyecta incorporar personal ante el aumento de su producción que pretende lograr con el financiamiento del presente programa.', 8, 'Los desechos de telas y papeles que se generan del proceso productivo son donados entidades que se dedican al reciclado de los mismos. Además no genera residuos que contaminen el medio ambiente. En cuanto a la perspectiva social genera puestos de trabajo social.\r\nCabe destacar que no presenta un abordaje especifico en perspectiva de genero', 10, 'El proyecto cumple con el requisito del destino de financiamiento ya que lo va a destinar para la compra de capital de trabajo (telas e insumos)', '2021-02-26 22:40:29', '2021-03-12 14:33:43'),
(43, 44, 33, 20, 78, '2021-04-20', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0233/21 SDEyE  y su rectificativa N° 0721/21 se recomienda la financiación del proyecto', 7, 'El sector al que pertenece esta MiPyME fue afectado negativamente ya que no fue considerado como actividad esencial inicialmente.', 12, 'Fortalece el sector industrial de la provincia, abasteciendo consumidores finales como a entes gubernamentales de municipios cercanos a la ciudad de Larroque.', 8, 'Según la documentación presentada, esta empresa unipersonal cuenta con suficiente capacidad económica, financiera y operativa para  solicitar el crédito al presente programa y para cumplir el objetivo de aumentar la producción.', 10, 'La empresa facturó el año anterior $3.190.429,61 según el Formulario 1271 de AFIP. Con esta documentación respaldaría se de por cumplido el requisito de solicitar no mas del 50% de lo facturado en el año anterior.', 15, 'La PyME proyecta destinar el monto del crédito a la adquisición de maquinaria para lograr mayor calidad, rapidez y eficacia de los productos comercializados a corto plazo.', 8, 'Por el momento tiene un solo empleado en relacion de dependencia. Proyecta preservar la fuente laboral.', 8, 'Los residuos que generan en la actividad productiva reciben el tratamiento correspondiente de ser llevados a la planta de reciclado . En materia social genera puestos de trabajo a nivel local. No presenta un abordaje especifico en perspectiva de genero.', 10, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea', '2021-03-12 14:00:26', '2021-04-26 13:08:59'),
(45, 46, 33, 20, 79, '2020-03-22', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0233/21 SDEyE se recomienda la financiación del proyecto', 8, 'El sector al que pertenece esta PyME no fue considerado como actividad esencial inicialmente por lo cual se produjo una suspensión temporal de las actividades de producción mientras tanto se seguían generando costos generales como por ejemplo sueldos, impuestos, etc.', 12, 'Fortalece el sector industrial del país compitiendo directamente con productos importados. Además es proveedor de equipamientos a frigoríficos, plantas de alimentos, molinos, transportistas, productores, corralones y empresas constructoras.', 10, 'Según el balance presentado, tiene una capacidad económica, financiera y operativa suficiente para respaldar la solicitud del\r\ncrédito del presente programa.', 10, 'Según el ultimo balance presentado, la empresa cuenta con una facturación anual de $32.887.987,20. Monto que supera ampliamente lo solicitado por el programa para acceder al máximo de $1.400.000', 14, 'La empresa destinará el crédito para la adecuación de la oficina técnica, lo que les permitirá un aumento de la producción, reorganización de procesos y tareas, disminución de costos y tiempos, etc.', 8, 'Proyecta preservar esta la fuente laboral actual.', 7, 'En lo que respecta a la perspectiva de sustentabilidad ambiental, la empresa manifiesta que busca reducir el impacto ambiental. En materia social genera puestos de trabajo a nivel local. No presenta un abordaje especifico en perspectiva de genero.', 10, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea', '2021-03-15 16:10:27', '2021-03-29 13:03:36'),
(46, 47, 33, 20, 80, '2021-03-23', 'Por lo desarrollado en los puntos anteriores y de acuerdo a los parámetros de la Resolución N° 0233/21 SDEyE se recomienda la financiación de este proyecto.', 6, 'Si bien fueron pocas semanas las que tuvieron que frenar la producción, la MiPyME se vio afectada negativamente en las cadenas de pago con sus potenciales clientes.', 12, 'Contribuye de forma positiva al sector productivo que pertenece abasteciendo a sectores avícola y ganadero. Además comercializa sus productos en todo el país y exporta a Uruguay.', 10, 'Tiene una amplia capacidad operativa y busca aumentarla a 1200 TN por mes. En cuanto a su capacidad económica y financiera, cuenta con suficiente estructura para respaldar su solicitud de crédito de acuerdo al ultimo balance presentado.', 10, 'La empresa cumple con este requisito, ya que de acuerdo al ultimo balance cerrado tuvo una facturación de $ 117.280.647,82', 15, 'La financiación solicitada será destinada para la adquisición de capital de trabajo ( materia prima) para poder alcanzar el objetivo de producir 1200 TN de poroto de soja por mes.', 13, 'La empresa cuenta actualmente con 22 de empleados y proyecta la preservación de la misma.', 7, 'El proceso productivo no genera residuos tóxicos. En materia social genera puestos de trabajo a nivel local. No presenta un abordaje especifico en perspectiva de genero', 7, 'Cumple con los requisitos y destino previsto en el marco de la presenta linea.', '2021-03-16 18:59:10', '2021-03-30 13:57:45'),
(47, 48, 33, 20, 73, '2021-03-31', 'Por lo antes señalado y de acuerdo a los parámetros de las Resoluciónes N° 0233/21 SDEyE  y 0721/21 SDEyE se recomienda la financiación del proyecto.', 10, 'La empresa cuenta con la actividad primaria de transporte de carga y como secundaria la producción de tarimas. El proyecto presentado es para la financiación de su actividad secundaria, la cual no fue considerada como esencial inicialmente por lo cual la producción estuvo suspendida por semanas mientras se seguían generando costos de sueldos, impuestos, energía, etc', 13, 'Contribuye favorablemente al sector productivo que pertenece, ya que con la financiación del programa va a generar un aumento de producción logrando cubrir la demanda insatisfecha a todos sus potenciales clientes.', 7, 'Tiene una capacidad financiera y económica suficiente para respaldar la solicitud del crédito. En cuanto a su capacidad operativa, proyecta aumentarla a través del acondicionamiento de la planta fabril y la adquisición de mayor cantidad de materia prima.', 10, 'La empresa cumple con este requisito, presentando como documentación respaldatoria el Formulario 1272 donde muestra que su facturación fue de $70.553.821,30', 6, 'El proyecto presentado manifiesta la proyección del aumento de la producción a través del financiamiento del presente programa.', 11, 'Se proyecta la preservación de esta fuente de trabajo y la incorporación de nuevos empleados.', 6, 'No genera residuos tóxicos. En cuanto a la perspectiva social, genera empleo local.  No presenta un abordaje especifico para la perspectiva de genero.', 10, 'El destino del financiamiento cumple con los términos previstos en la presente Resolución y normas complementarias que reglamentan el presente programa.', '2021-03-17 15:24:09', '2021-04-09 13:29:20'),
(48, 49, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-03-18 15:42:06', '2021-03-18 15:42:06'),
(49, 50, 33, 20, 70, '2021-03-25', 'Por lo desarrollado en los puntos anteriores y de acuerdo a los parámetros de la Resolución N° 0233/21 SDEyE y N° 0721/21 SDEyE se recomienda la financiación de este proyecto.', 7, 'Esta empresa pertenece al sector alimenticio, por lo tanto fueron pocas semanas las que tuvieron que frenar la producción. Cabe destacar que si bien no tuvo un fuerte impacto negativo directo, la PyME se vio afectada por los atrasos en las cadenas de pago de sus potenciales clientes.', 12, 'Contribuye favorablemente al sector que pertenece, ya que abastece a distintas cadenas de supermercado y con el préstamo lograran la optimización de carga y descarga acortando los plazos de entrega.', 10, 'Cuenta con suficiente capacidad económica, financiera y operativa para llevar a cabo el proyecto presentado. Cabe destacar que según el ultimo balance cerrado tuvo una facturación por ventas de $39.879.211,07 .', 8, 'De acuerdo a lo que se mencionó en el punto anterior, supera ampliamente el requisito de facturación para solicitar el monto máximo del programa', 8, 'El monto solicitado será destinado a la adquisición de un auto elevador (maquinaria) para mejorar el proceso de carga y descarga en el deposito.', 8, 'Actualmente cuenta con 3 empleados y se proyecta la preservación de estos puestos de trabajo.', 7, 'En cuanto a la perspectiva social, tiene impacto positivo ya que genera empleo local. No afecta de manera negativa al medio ambiente ni\r\ncontempla la perspectiva de genero.', 10, 'Proyectan la utilización de los fondos solicitados a la compra de maquinaria. Por tal motivo cumple con los requisitos y destino previsto en el marco de la presenta línea.', '2021-03-19 22:12:13', '2021-04-09 11:40:23'),
