(51, 52, 33, 20, 83, '2021-04-12', 'Por lo desarrollado en los puntos anteriores y de acuerdo a los parámetros de la Resolución N° 0233/21 SDEyE y N° 0721/21 SDEyE se recomienda la financiación de este proyecto', 10, 'La actual pandemia afectó negativamente en el abastecimiento de insumos necesarios para la producción, lo que ocasionó demoras e incumpliendo en la demanda de sus potenciales clientes.', 12, 'El aporte requerido contribuirá al aumento de stock y al envasado correspondiente que necesitan las pastas frescas que producen.', 8, 'Según el Balance presentado, la empresa cuenta con suficiente capacidad económica, financiera y operativa para respaldar la solicitud del monto máximo al programa.', 10, 'La empresa cumple con el requisito de haber facturado mas del doble del monto solicitado. Presentando facturación de $53.236.399,92 en el balance presentado cerrado al 30 de septiembre del 2020', 16, 'El destino del fondo solicitado es para la adquisición de capital de trabajo (insumos para envasar) para aumentar la capacidad productiva de la empresa.', 10, 'Actualmente tiene 20 empleados en relación de dependencia. La PyME proyecta preservar esta fuente de trabajo.', 7, 'Los residuos reciben su tratamiento correspondiente para reducir los efectos de contaminación del medio ambiente. En lo que respecta la perspectiva social, la empresa genera puestos de trabajo locales. No presenta un abordaje especifico en perspectiva de genero', 10, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea ya que destinará el crédito a adquisición de insumos.', '2021-04-07 15:53:34', '2021-04-14 14:03:09'),
