(53, 54, 33, 20, 86, '2021-04-27', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0233/21 SDEyE y su rectificativa N° 0721/21 se recomienda la financiación del proyecto', 8, 'El sector al que pertenece esta MiPyME no fue considerado como actividad esencial inicialmente por tal motivo la producción estuvo pausada por semanas, generando costos pero no ingresos para solventarlos.', 13, 'Contribuye favorablemente al sector que pertenece tanto en fortalecer el sector industrial de la provincia como en abastecer a los frigoríficos a nivel nacional e internacional', 10, 'Cuenta con suficiente capacidad económica, financiera y operativa para solicitar el crédito al presente programa y cumplir con sus objetivos propuestos de alcanzar un aumento de espacio y producción.', 10, 'Según el formulario F1272 de AFIP la MiPyME facturó $33.284.858,86 en el periodo 2020 dando cumplimiento al requisito de no solicitar mas del 50% de la facturación del periodo anterior.', 17, 'La MiPyME proyecta destinar el monto del crédito a la construcción de dos puentes grúa para facilitar el traslado de los materias del proceso productivo, simplificar el trabajo, aumentar la producción y mejorar la seguridad de trabajo reduciendo la posibilidad de riesgos y accidentes.', 12, 'Actualmente cuenta con cuatro empleados (tres técnicos operarios y un administrativo) y proyecta preservar esta fuente de trabajo', 6, 'Los residuos (restos de plástico y de acero inoxidable) que se generan en la actividad productiva son reciclados. En materia social genera\r\npuestos de trabajo a nivel local. No presenta un abordaje especifico en perspectiva de genero', 10, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea', '2021-04-09 13:31:04', '2021-05-05 13:51:48'),
(58, 59, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-05-03 13:14:53', '2021-05-03 13:14:53'),
(59, 60, 33, 20, 78, '2021-06-07', 'Por lo desarrollado en los puntos anteriores y de acuerdo a los parámetros de la Resolución N° 1334/21 SDEyE se recomienda la financiación de este proyecto.', 5, 'Este sector no tuvo efectos negativos directos con la declaración nacional y provincial del aislamiento social, preventivo y obligatorio ya que, si bien esta actividad no fue declarada esencial, pudo desarrollarse normalmente debido a que el desarrollo de la misma no conlleva la participación de muchas personas. Sin embargo, tuvo efectos negativos en los retrasos de la cadena de pago y en la caída de ingresos a nivel general.', 12, 'Contribuye favorablemente al sector ictícola de la provincia, ya que pretende destinar el crédito a aumentar la capacidad productiva y a atender la demanda creciente e insatisfecha de su mercado.', 8, 'Tiene suficiente capacidad operativa, financiera y económica para respaldar la solicitud del crédito.', 10, 'Según la nota en carácter de Declaración Jurada presentada por ambos suscribientes del convenio, cumple con el requisito de haber facturado el doble de lo que solicita al programa en el periodo 2020.', 15, 'Proyecta adquirir alimento balanceado para el engorde de pacú y con eso aumentar la producción.', 13, 'Tiene empleados en relacion de dependencia en los distintos sectores de la empresa. Proyecta mantener la fuente laboral e incorporar nuevos empleados.', 5, 'Esta actividad no genera residuos que contaminen el medio ambiente. En la perspectiva social genera empleo local. No presenta un abordaje especifico en perspectiva de genero.', 10, 'El presente proyecto destinará el financiamiento a la adquisición de capital de trabajo, cumpliendo con los términos previstos en la Resolución y normas complementaria que reglamentan en el programa', '2021-05-03 13:43:46', '2021-06-09 14:05:02'),
(61, 62, 33, 20, 83, '2021-05-17', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1334/21 SDEyE se recomienda la financiación del proyecto. Además, cabe destacar que por el destino del financiamiento \"inversión\" se le otorgó un plazo de gracia de 12 meses para la devolución', 8, 'Esta empresa unipersonal se vio afectada negativamente, por la suspensión de actividades en determinadas semanas, tanto en la producción como en la adquisición de las materias primas y el transporte. Además se vieron afectadas las cadenas de pago impactando directamente en los ingresos de la empresa.', 11, 'Contribuye favorablemente al sector que pertenece ya que manifiesta ser el único en la provincia en producir casillas, acoplados de diversos tipos y desmalezadora agrícola. Además es el principal proveedor del sector agropecuario y ganadero de toda la provincia de Entre Ríos.', 8, 'Cuenta con suficiente capacidad económica, operativa y financiera para llevar adelante el proyecto que presenta y lograr el objetivo de implementar las Normas ISO, aumentar su producción y exportar sus productos a los países limítrofes.', 10, 'Según el Formulario 1272,  cumple con el requisito de haber facturado el doble de lo que solicita al programa en el año anterior. Cabe destacar que en el periodo 2020 facturó $11.972.468,37', 18, 'El presente proyecto busca incorporar las Normas ISO en su producción. Para eso solicita financiamiento que destinará a la adecuación del galpón de producción.', 12, 'Actualmente cuenta con un empleado. Proyecta mantener la fuente laboral e incorporar nuevos empleados.', 8, 'Los desechos son retirados para los chatarreros para su reciclado o comercialización generándole ingresos a los mismo. En cuanto a la\r\nperspectiva social genera puestos de trabajo social. Cabe destacar que no presenta un abordaje especifico en perspectiva de genero.', 8, 'El monto solicitado será destinado a inversión para ampliar el taller, por lo tanto cumple con los requisitos y destino del crédito previsto en el marco de la presenta línea.', '2021-05-06 15:54:03', '2021-06-01 12:21:27'),
(65, 66, 33, 20, 85, '2021-05-27', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1334/21 SDEyE se recomienda la financiación del proyecto. Además, cabe destacar que por el destino del financiamiento \"inversión\" se le otorgó un plazo de gracia de 12 meses para la devolución', 10, 'Esta empresa refleja, en el balance presentado, los efectos negativo de la pandemia, disminuyendo sus ingresos en el año 2020 en un 25% respecto a los ingresos por ventas obtenidos en el 2019', 12, 'Contribuye favorablemente al sector que pertenece, fortaleciendo el sector vitivinícola de la provincia ya que no solo tiene cultivo de vid si no que también produce el vino.', 8, 'Cuenta con suficiente capacidad económica, operativa y financiera para llevar adelante el proyecto que presenta y para lograr el objetivo de optimizar y aumentar la producción a través de la nueva bodega.', 10, 'Según el Estado de Resultado del año 2020, cumple con el requisito de haber facturado el doble de lo que solicita al programa en el año anterior.', 15, 'El destino del financiamiento que solicita es para instalar un nueva bodega.', 12, 'Actualmente cuenta con empleados capacitados y profesionales en todas la áreas de la empresa. Se proyecta la preservación de la fuente laboral', 8, 'No genera contaminación de medioambiente. En materia social genera puestos de trabajo a nivel local y favorece el turismo con visitas guiadas y degustación en su predio. Si bien no presenta un abordaje especifico en perspectiva de genero, el presente proyecto lo encabeza una mujer como socia gerente de la empresa.', 10, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea', '2021-05-15 00:26:44', '2021-06-07 14:42:49'),
(70, 71, 33, 20, 85, '2021-07-01', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1553/21 SDEyE se recomienda la financiación del proyecto.', 5, 'Esta MiPyME pertenece al sector alimenticio, el cual no se vio tan afectado con las medidas de la pandemia en relación a otros sectores donde suspendieron su producción/servicio por meses.', 12, 'Contribuye favorablemente al sector que pertenece, reemplazando otras marcas nacionales de miel. Mediante el aporte requerido van a lograr aumentar su producción y abastecer a mayor cantidad de negocios de Rosario del Tala y otros de las ciudades vecinas.', 10, 'Esta Cooperativa cuenta con capacidad operativa, económica y financiera suficiente para poder solicitar el crédito de acuerdo al ultimo balance presentado.', 8, 'Supera ampliamente el doble de facturación del monto solicitado al presente programa, cumpliendo con el requisito. Según el ultimo balance presentado facturo $28.738.020,51', 20, 'El crédito solicitado será destinado a la adquisición de dos maquinarias (tapadora y etiquetadora) con el objetivo de aumentar la producción y acelerar el proceso productivo.', 14, 'La cooperativa esta formada por 30 personas, entre ellas asociados, personal administrativo y personal operario. Se proyecta la preservación de estas fuentes laborales.', 6, 'No genera residuos tóxicos que contaminen el medio ambiente. En cuento a la perspectiva social genera empleo local.\r\nNo presenta un abordaje especifico en perspectiva de genero', 10, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea ya que destinará el crédito a adquisición de materia prima', '2021-06-10 21:02:29', '2021-07-30 12:27:38'),
(79, 80, 33, 20, 83, '2021-08-17', 'Por lo desarrollado en los puntos anteriores y de acuerdo a los parámetros de la Resolución N° 1553/21 SDEyE se recomienda la financiación de este proyecto.\r\nCabe destacar que se le ha otorgado un plazo de gracia de 12 meses por destinar el monto solicitado a inversión.', 8, 'Si bien fueron pocas semanas las que tuvieron que frenar la producción, la MiPyME se vio afectada negativamente en las cadenas de pago con sus potenciales clientes.', 15, 'Contribuye favorablemente al sector que pertenece, siendo el principal proveedor entrerriano de empresas nacionales e internacionales elaboradoras de sabores y aromas.', 10, 'Tiene una amplia capacidad operativa y busca mejorar la calidad de la misma. En cuanto a su capacidad económica y financiera, cuenta con\r\nsuficiente estructura para respaldar su solicitud de crédito de acuerdo al ultimo balance cerrado', 9, 'Cumple con el requisito de haber facturado como mínimo el doble de lo que solicita al presente programa. Mostrando una facturación del periodo 2020 de mas de $89.000.000', 18, 'La financiación solicitada será destinada para la adquisición de un polarímetro de alta precisión con el objetivo de mejorar el proceso de control de calidad en el laboratorio.', 5, 'La empresa cuenta actualmente con 1 empleado en el área de laboratorio y proyecta la preservación de la misma.', 8, 'El proceso productivo no genera residuos tóxicos. En materia social genera puestos de trabajo a nivel local. No presenta un abordaje especifico en perspectiva de genero.', 10, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea.', '2021-07-20 15:33:20', '2021-08-19 15:29:34'),
(81, 82, 33, 20, 83, '2021-07-29', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1553/21 SDEyE se recomienda la financiación del proyecto.', 10, 'Esta MiPyME unipersonal se encontraba realizando sus primeros vínculos de exportación  de sus productos, pero con la declaración nacional y provincial del aislamiento social, preventivo y obligatorio se vio obligada a suspender estas actividades, situación que hasta el día no ha podido retomar.', 13, 'Contribuye favorablemente al sector productivo al que pertenece, siendo una de las zingueria mas importante de la provincia. Con el aporte requerido podrá aumentar la producción logrando abastecer de manera mas rápida a todos sus clientes.', 9, 'Cuenta con suficiente capacidad económica, financiera y operativa para respaldar el crédito de $1.400.000 solicitado al presente programa.', 10, 'De acuerdo al formulario de AFIP 1272 presentado, cumple con el requisito de haber facturado mas del doble de lo que solicita al programa. De acuerdo a dicho Formulario, el año pasado facturó $22.059.534', 15, 'Esta MiPyME busca aumentar su producción, adquiriendo materia prima en mayor cantidad.', 13, 'Cuenta con 12 empleados en relación de dependencia. Proyecta mantener esta fuente laboral e incorporar mas personal.', 5, 'Los residuos que genera son reciclados. En materia social genera puestos de trabajo a nivel local. No presenta un abordaje especifico en perspectiva de genero.', 8, 'Cumple con los requisitos y destino previsto en el marco de la presenta linea', '2021-07-27 12:48:24', '2021-08-03 15:12:28'),
(82, 83, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-08-02 12:52:07', '2021-08-02 12:52:07'),
