INSERT INTO `evaluacion` (`id`, `proyecto`, `evaluador`, `estado`, `resultado`, `fecha`, `comentario`, `puntaje1`, `observacion1`, `puntaje2`, `observacion2`, `puntaje3`, `observacion3`, `puntaje4`, `observacion4`, `puntaje5`, `observacion5`, `puntaje6`, `observacion6`, `puntaje7`, `observacion7`, `puntaje8`, `observacion8`, `created_at`, `updated_at`) VALUES
(85, 86, 33, 20, 83, '2021-09-02', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1553/21 SDEyE se recomienda la financiación del proyecto.', 8, 'La declaración nacional y provincial del aislamiento social, preventivo y obligatorio afecto negativamente sus ventas  así como también la cadena de pago de sus potenciales clientes.', 15, 'Contribuye favorablemente al sector de la economía del conocimiento de la provincia, produciendo software de gestión contable administrativo para MiPyMEs del país. Mediante el aporte requerido buscan contratar personal para lograr obtener mayor cantidad de clientes y brindar un servicio de mejor calidad con atención personalizada.', 7, 'Según el ultimo balance presentado, cuenta con suficiente capacidad económica y financiera para desarrollar las actividades propuestas. En cuanto a la capacidad operativa se busca aumentar la misma  a través del crédito solicitado.', 10, 'Según las ventas declaradas en el balance presentado, cumple con el requisito de haber facturado mas del doble de lo solicitado al presente programa.', 15, 'Con el proyecto presentado buscan contratar personal para lograr obtener mayores clientes y mejorar su servicio prestado.', 12, 'Proyecta preservar las fuentes laborales dependientes y además incorporar nuevo personal.', 6, 'No genera residuos que contaminan el medio ambiente. Genera empleo a nivel local. En cuanto a la perspectiva de genero, no presenta un abordaje especifico .', 10, 'Cumple con todos los requisitos y destino previsto en el marco del presente programa.', '2021-08-04 13:43:14', '2021-09-06 13:41:22'),
(87, 88, 33, 20, 85, '2021-08-06', 'Cabe destacar que se le dio un plazo de gracia de 12 meses porque el destino del crédito es para inversión; y que obtuvo una bonificación de 4 puntos porcentuales extras sobre la tasa de interés por ser una cooperativa de trabajo liderada por mujeres y jóvenes de entre 18 y 40 años.\r\nPor lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0750/21 SDEyE se recomienda la financiación del proyecto.', 10, 'Esta Cooperativa de trabajo del sector de industria textil fue afectada por las medidas de la pandemia, a tal punto que de casi los 100 asociados que tenia tuvieron la necesidad de reducir a la mitad de dicha cantidad.', 10, 'Contribuye favorablemente al sector que pertenece, brindando sus productos a titulares de primeras marcas de ropa de vestir.\r\nMediante el aporte requerido van a lograr aumentar su producción y abastecer su creciente demanda', 8, 'Según el ultimo balance presentado, la cooperativa presenta suficiente capacidad económica, financiera y operativa para respaldar el crédito solicitado y lograr los objetivos propuestos.', 10, 'Según el balance presentado con cierre al 31/12/2021 la cooperativa facturó $10.640.073,63 por tal motivo se da cumplimento al requisito exigido por la línea.', 15, 'El crédito solicitado será destinado a la adquisición de maquinaria y capital de trabajo incremental asociado con el objetivo de aumentar y mejoras el proceso productivo.', 15, 'La cooperativa esta formada por 55 asociados. Se proyecta la preservación de estas fuentes laborales y la incorporación de 40 operarios mas con la habilitación de otra nave.', 10, 'No genera residuos tóxicos que contaminen el medio ambiente. En cuento a la perspectiva social genera empleo local. \r\nLa cooperativa esta liderada por mujeres.', 7, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea ya que destinará el crédito a adquisición de materia prima y maquinaria.', '2021-08-11 14:09:22', '2021-08-11 14:44:01'),
(93, 94, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-08-18 13:45:05', '2021-08-18 13:45:05'),
(95, 96, 33, 20, 88, '2021-11-03', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto. Además se recomienda un plazo de gracia de 12 meses por tratarse de un proyecto con destino de inversión.', 13, 'La MiPyME busca mejorar los equipos, software y sobre todo recursos humanos que permitan mejorar los contenidos y aumentar la audiencia. También, proyecta dotar de mayor infraestructura a la empresa.', 7, 'De acuerdo con el formulario y balance presentado, cuenta con suficiente capacidad económica, financiera y operativa para llevar adelante las actividades propuestas.', 10, 'De acuerdo con el balance presentado cerrado el 31/12/2020, cumple con este requisito. Cabe aclarar que la empresa tuvo ingresos por $4.679.777,72.', 18, 'El proyecto presentado busca mejorar equipos, capacitar personal y dotar de mayor infraestructura con el objetivo de aumentar la calidad de los contenidos y aumentar la audiencia generando mayores ingresos.', 15, 'Cuenta con 12 fuentes laborales dependientes, actualmente son seis trabajadores en redacción, dos trabajadores en diagramación, tres trabajadores en administración y un coordinador en contacto con revendedores, kioscos y canillitas.. Proyecta la preservación de las mismas', 15, 'En la perspectiva ambiental, manifiesta tener mínimos desechos en el sector de imprenta. En cuanto la perspectiva social, genera puestos de trabajo local y representa el medio grafico mas antiguo de la ciudad. No presenta un abordaje especifico de la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-08-23 15:19:24', '2021-11-10 14:41:21'),
(96, 97, 33, 20, 80, '2021-09-23', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1553/21 SDEyE se recomienda la financiación del proyecto.', 8, 'La MiPyME se vio afectada negativamente, por la suspensión de actividades en determinadas semanas. Además se vieron afectadas las cadenas de pago impactando directamente de forma negativa en sus ingresos.', 15, 'Contribuye de forma favorable al sector metalúrgico de la provincia que pertenece, siendo proveedor de equipos para pasteurizar y producir lácteos a pequeños y medianos productores rurales.', 9, 'Según la documentación presentada, esta empresa cuenta con suficiente capacidad económica, financiera y operativa para respaldar la solicitud del crédito y aumentar su stock para responder de forma mas ágil a sus clientes.', 10, 'De acuerdo al formulario 1272 AFIP presentado, cumple con el requisito de haber facturado mínimamente el doble de lo solicitado al presente programa.', 16, 'El presente proyecto busca adquirir capital de trabajo (materia prima, insumos, etc) para poder aumentar su stock. Esto dará a la empresa una gran oportunidad de ofrecer sus productos de forma inmediata a nuevos clientes.', 5, 'Es una empresa familiar, por tal motivo no cuentan con fuentes laborales dependientes.', 7, 'Los desechos reciben su adecuado tratamiento. En cuanto a la perspectiva social abastece necesidades de productores de la zona. Cabe destacar que no presenta un abordaje especifico en perspectiva de genero', 10, 'El monto solicitado será destinado a capital de trabajo, por lo tanto cumple con los requisitos y destino del crédito previsto en el marco de la presenta línea.', '2021-08-23 19:27:57', '2021-09-27 13:49:22'),
(99, 100, 33, 20, 75, '2021-09-03', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1553/21 SDEyE se recomienda la financiación del proyecto.', 8, 'Esta empresa unipersonal se vio afectada negativamente, por la suspensión de actividades en determinadas semanas, tanto en la producción como en la adquisición de las materias primas. Además se vieron afectadas las cadenas de pago impactando directamente en sus ingresos.', 8, 'Contribuye favorablemente al sector metalmecánico que pertenece, siendo proveedor de productos de metal de grandes empresas y clientes particulares de la zona.', 10, 'Cuenta con suficiente capacidad económica, operativa y financiera para llevar adelante el proyecto que presenta de conseguir insumos de mejor calidad y logrando un crecimiento en la empresa a través del cumplimiento con los clientes de manera mas efectiva', 10, 'Según el Formulario 1272, cumple con el requisito de haber facturado el doble de lo que solicita al programa en el año anterior. Cabe destacar que en el periodo 2020 facturó $4.541.718,21', 16, 'El presente proyecto busca adquirir insumos de mejor calidad y variedad e invertir en nuevos insumos. Esto dará a la empresa una gran oportunidad de sostenibilidad y crecimiento económico.', 7, 'Actualmente cuenta con un empleado en relación de dependencia. Proyecta mantener esa fuente laboral e incorporar nuevos empleados en un futuro.', 6, 'Los desechos reciben su adecuado tratamiento. En cuanto a la perspectiva social genera puestos de trabajo. Cabe destacar que no presenta un abordaje especifico en perspectiva de genero.', 10, 'El monto solicitado será destinado a capital de trabajo, por lo tanto cumple con los requisitos y destino del crédito previsto en el marco de la presenta línea.', '2021-08-27 13:57:41', '2021-09-10 13:07:54'),
