(105, 106, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-09-03 12:30:02', '2021-09-03 12:30:02'),
(106, 107, 33, 20, 72, '2021-09-06', 'Por lo desarrollado en los puntos anteriores y de acuerdo a los parámetros de la Resolución N° 1553/21 SDEyE se recomienda la financiación de este proyecto.\r\nCabe destacar que se otorga un plaza de gracia de 12 meses por destinar el crédito al rubro de inversión.', 5, 'Este sector no tuvo efectos negativos con la declaración nacional y provincial del aislamiento social, preventivo y obligatorio. Si bien esta\r\nactividad no fue declarada esencial, pudo desarrollarse normalmente ya que la realización de la misma no conlleva la participación de muchas personas.', 12, 'Contribuye favorablemente al sector agrícola que pertenece, siendo proveedor de importantes empresas de la provincia de Entre Ríos.', 10, 'Cuenta con suficiente capacidad operativa, financiera y económica para respaldar la solicitud del crédito.', 10, 'Cumple con el requisito de haber facturado el doble de los solicitado al programa. Según la documentación respaldaría (formulario 1272 AFIP) en el período 2020 facturó $19.375.364,86', 15, 'Proyecta adquirir insumos agrícolas necesarios para el desarrollo normal de su actividad y materiales de construcción para construir un deposito que resguarde dichos insumos y maquinarias de riegos de deterioros y robos.', 5, 'Actualmente no posee personal en relaciona de dependencia ya que terceriza los servicios.', 5, 'Esta actividad no genera residuos que contaminen el medio ambiente. En la perspectiva social, no genera empleo directo. No\r\npresenta un abordaje especifico en perspectiva de genero.', 10, 'El presente proyecto destinará el financiamiento a inversión y capital de trabajo, cumpliendo con los términos previstos en la Resolución y normas complementaria que reglamentan en el programa', '2021-09-03 18:54:37', '2021-09-09 14:05:29'),
(107, 108, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-09-10 15:17:58', '2021-09-10 15:17:58'),
(109, 110, 33, 20, 86, '2021-10-06', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1553/21 SDEyE se recomienda la financiación del proyecto.\r\nCabe aclarar, que se le otorgó un plazo de gracia de 12 meses por estar destinado a inversión y que recibió bonificación de 2 puntos porcentuales extra por ser empresa liderada por mujer,', 15, 'Esta MiPyME unipersonal se dedica a la producción de indumentaria descartable para el Sector salud. Con el aporte requerido proyecta incorporar un producto nuevo para poder responder a la demanda de sus clientes', 10, 'Cuenta con suficiente capacidad económica, financiera y operativa para respaldar su solicitud de crédito de acuerdo a la documentación y formulario presentado al presente programa', 8, 'De acuerdo al papel de trabajo presentado sobre las ventas mensuales del periodo 2020, cumple con este requisito. En el año 2020 facturo $5.075.736,86', 15, 'El crédito solicitado será destinado a la adquisición de maquinaria y materia prima para producir un nuevo producto.', 18, 'Cuenta con dos empleados en relación de dependencia y proyecta incorporar dos personas más.', 10, 'No genera residuos tóxicos. En cuento a la perspectiva social y de género, genera empleo locales y la empresa esta liderada por una mujer.', 10, 'El destino del financiamiento cumple con los términos previstos en la Resolución y normas complementarias con el que se rige el programa', 0, 'El monto solicitado será destinado a capital de trabajo e inversión, por lo tanto cumple con los requisitos y destino del crédito previsto en el marco de la presenta línea', '2021-09-22 11:22:56', '2021-11-18 14:35:55'),
(110, 111, 33, 20, 90, '2021-10-26', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto.', 15, 'La MiPyME proyecta adquirir capital de trabajo mediante el aporte requerido para producir una nueva vacuna. La misma ya ha sido desarrollada y probada con resultados  satisfactorios, ahora buscan producirla generando un escalonamiento de la empresa.', 10, 'De acuerdo al formulario y balance presentado, la empresa cuenta con suficiente capacidad operativa, financiera y económica para respaldar la solicitud del crédito.', 10, 'De acuerdo al balance presentado cerrado el 30 de agosto de 2020, la empresa facturo $64.915.836,87 dando cumplimiento a este requisito.', 15, 'La empresa presento un proyecto en busca de financiamiento para comprar capital de trabajo (insumos, envases, excipientes) para producir un nuevo producto, generando un aumento en las ventas.', 18, 'Cuenta con 30 fuentes laborales dependiente. Proyecta mantener las mismas.', 12, 'Busca brindar una solución a la grave situación sanitaria en la avicultura a través de una nueva vacuna. En cuento a la perspectiva social, genera empleo local. No presenta un abordaje especifico en lo referido a la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-09-22 14:51:30', '2021-11-04 12:06:34'),
(113, 114, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-09-30 14:31:58', '2021-09-30 14:31:58'),
(116, 117, 33, 20, 89, '2021-10-29', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto. Cabe aclarar, que se le otorgó un plazo de gracia de 12 meses por estar destinado a inversión y que recibió bonificación de 2 puntos porcentuales extra por ser empresa liderada por mujer.', 15, 'Esta mi MiPyME unipersonal busca acelerar el proceso productivo con el aporte requerido para satisfacer de forma mas rápida la demanda y expandir la logística y ventas.', 8, 'De acuerdo al formulario y documentación presentada, cuenta con suficiente capacidad económica, financiera y operativa para respaldar la solicitud del crédito.', 10, 'Según el formulario de AFIP 1272 donde muestra la facturación del año 2020, cumple con el requisito de haber facturado el doble del monto solicitado al presente programa.', 15, 'El crédito solicitado estará destinado a la compra de maquinaria, restauración de la planta productiva y capacitación de personal para agilizar el proceso productivo, mejorar la calidad de los productos y aumentar las ventas.', 18, 'La MiPyME proyecta mantener y capacitar sus fuentes laborales dependientes.', 13, 'No genera residuos tóxicos. En cuento a la perspectiva social y de género, genera empleo locales y la empresa esta liderada por una\r\nmujer', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-10-18 19:43:20', '2021-11-01 14:57:57'),
(117, 118, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-10-19 16:05:39', '2021-10-19 16:05:39'),
(118, 119, 33, 20, 77, '2021-11-29', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto.', 12, 'Esta Cooperativa es una de las principales proveedores de miel a empresas exportadoras. Con el crédito solicitado, buscan expandir sus producción y realizar exportaciones directas.', 10, 'De acuerdo al ultimo balance presentado, la Cooperativa cuenta con capacidad operativa, económica y financiera suficiente para poder respaldar la solicitud del crédito.', 10, 'Supera ampliamente el doble de facturación del monto solicitado al presente programa, dando cumplimiento con el requisito. Según el ultimo balance tuvo ventas por $25.375.951,01', 10, 'El crédito será destinado a la adquisición de equipamiento de laboratorio y materia prima con el fin de generar valor agregado y mejorar la calidad para luego exportar al cliente final. De esta manera, la cooperativa aumentaría su rentabilidad.', 15, 'Cuenta con 15 socios y proyecta la preservación de los mismos.', 10, 'No genera residuos tóxicos que contaminen el medio ambiente. En cuento a la perspectiva social genera empleo local. No presenta un abordaje especifico en perspectiva de genero', 10, 'El proyecto presentado encuadra con los términos previstos en la normativa que regula al programa de Asistencia Financiera para la Consolidación Productiva', 0, 'Cumple con los requisitos y destino previsto en el marco de la presenta línea ya que destinará el crédito a adquisición de materia prima', '2021-10-20 13:06:26', '2021-12-10 12:35:08'),
(119, 120, 33, 20, 86, '2022-02-14', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0129/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 15, 'Esta empresa se encuentra en una etapa de maduración buscando consolidarse con la inversión a realizar con el objetivo de mejorar la producción acompañada por una tendencia creciente de un consumo de alimentos saludables.', 8, 'De acuerdo al formulario presentado y a la documentación respaldatoria del mismo,  cuentan con suficiente capacidad económica, financiera y operativa para poder llevar a cabo las actividades propuestas.', 10, 'Cumple con este requisito. De acuerdo a la nota presentada, la empresa no solicita un monto mayor al 50% de lo facturado en el periodo 2021.', 16, 'La empresa busca abaratar costos de insumos, mejorar el control de los tiempo productivos, aumentar la superficie de producción e implementar un sector de maternidad para la germinación y maduración de semillas. Logrando esto mejoraría la rentabilidad y lograría la sostenibilidad económica de la empresa.', 17, 'Actualmente trabajan en el invernadero hidropónico los solicitantes del crédito. Proyectan incorporar fuentes laborales para llevar a cabo la obra que solicitan financiar y dos empleados para el sector productivo.', 10, 'No generan residuos tóxicos y tienen como objetivo lograr una producción sustentable y sin la utilización de agroquímicos. En lo referido a la perspectiva social, genera empleo local y es proveedor de la zona. No presenta abordaje especifico en la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias', 0, NULL, '2021-10-21 11:38:59', '2022-02-18 12:55:32'),
(125, 126, 33, 20, 84, '2021-11-30', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto.', 12, 'Con el aporte requerido proyecta adquirir un autoelevador que actualmente lo esta alquilando. Con esta adquisición va a poder destinar dicho costo de alquiler a la compra de materia prima, aumentando la producción.', 10, 'El titular del proyecto presentó formulario y documentación respaldatoria donde demuestra que cuenta con la capacidad económica, financiera y operativa para llevar adelante las actividades proyectadas.', 8, 'De acuerdo al Formulario 1272 AFIP y la nota en carácter de Declaración Jurada cumple con este requisito. En el periodo 2020 facturo $1.800.000. Cabe aclarar que hasta agosto del año 2020 fue monotributista y luego paso a ser autónomo, por tal motivo presento amba documentación respaldatoria de ingresos', 20, 'Con el proyecto presentado aumentará la rentabilidad de la empresa, ya que el costo que destinaba al alquiler de la maquina que proyecta adquirir será usado en capital de trabajo.', 15, 'Cuenta con 3 empleados bajo la modalidad de pasantía. Proyecta mantener estas fuentes laborales y en un futuro', 9, 'Los escasos desechos que se generan son retirados para su reciclado. En cuanto la perspectiva social, genera empleo local. No presenta un abordaje especifico en lo referido a la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-10-25 12:43:12', '2021-12-06 12:46:12'),
