(132, 133, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-10-29 13:06:00', '2021-10-29 13:06:00'),
(133, 134, 33, 20, 83, '2021-11-05', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto. Cabe aclarar, que se le otorgó un plazo de gracia de 12 meses por estar destinado a inversión.', 15, 'Mediante el aporte requerido, esta empresa busca pasar de una producción artesanal a una producción en serie provocando una disminución de tiempos de entrega y un aumento de sus ventas.', 8, 'Cuenta con suficiente capacidad económica y financiera para desarrollar el proyecto presentado, cumpliendo con el objetivo de aumentar la capacidad operativa.', 10, 'De acuerdo al Formulario AFIP 1272 presentado, esta empresa facturó $7.937.601,47. De esta forma se da por cumplido el presente requisito', 17, 'El proyecto consiste en la construcción de un galpón y adecuación de instalaciones para realizar una producción en serie generando mayores ventas e ingresar a otros mercados a través de importadores y distribuidores. Cabe destacar que es la única empresa de la provincia que se dedica exclusivamente a la producción de maquinaria para elaborar discos de empanadas.', 15, 'Cuenta con tres fuentes laborales dependiente. Proyecta la preservación de las mismas y la incorporación de un nuevo empleado.', 8, 'Los residuos de chapas y caños que generan son entregados a empresas de reciclado. En cuento a la perspectiva social genera empleo local. No presenta abordaje especifico en los referido a la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-10-29 15:19:39', '2021-11-09 13:01:56'),
(135, 136, 33, 20, 86, '2021-11-03', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/20 SDEyE se recomienda la financiación del proyecto. Además, se otorgar plazo de gracia de 12 meses de gracia por estar destinado a inversión.', 10, 'Mediante el aporte requerido, busca mejorar el sector de carga y descarga mejorando los tiempos de entrega', 10, 'De acuerdo al formulario y balance presentado al presente programa, cuenta con suficiente capacidad económica, financiera y operativa para desarrollar las actividades propuestas.', 10, 'En el periodo 2020 tuvo una facturación por la actividad de producción de $37.019.526,05 dando cumplimiento a este requisito', 20, 'La PyME proyecta realizar mejoras en el playón de carga y descargas con el fin de mejorar los tiempos de entregas al cliente y evitar las perdidas por derrames y roturas de envoltorios de la mercadería.', 13, 'Se proyecta preservar las fuentes laborales dependientes y contratar mano de obra para realizar la obra.', 13, 'Cumple un rol importante en la perspectiva de sustentabilidad ambiental ya que la empresa se dedica al reciclado. En cuanto a la perspectiva social genera empleo local y concientización en cuanto al reciclado. No presenta un abordaje especifico en lo referido a la perspectiva de genero', 10, 'El proyecto presentado y el destino del aporte solicitado cumple con los términos previstos de la Resolución del programa y normas complementarias.', 0, NULL, '2021-10-29 16:57:20', '2021-11-08 13:14:03'),
(137, 138, 33, 20, 90, '2021-11-04', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto. Cabe aclarar, que se le otorgó un plazo de gracia de 12 meses por estar destinado a inversión y que recibió bonificación de 2 puntos porcentuales extra por ser empresa liderada por mujer.', 15, 'El aporte requerido será destinado a la ampliación de la sala de procesamiento de la nuez pecan donde se realizara la limpieza y selección de la nuez permitiendo una optimización de dicho proceso y un crecimiento del emprendimiento', 7, 'De acuerdo con el formulario presentado, cuenta con suficiente capacidad económica y financiera para llevar adelante las actividades propuestas y aumentar la capacidad operativa.', 10, 'De acuerdo con la Nota en Carácter de Declaración Jurada presentada, cumple con este requisito. Cabe aclarar que los ingresos declarados coinciden con la categoría de monotributo a la que pertenece.', 18, 'La ampliación edilicia le permitirá mejorar el proceso de limpieza y acondicionamiento de la nuez pecan logrando una reducción de costos y mejorando los tiempos de entrega. Esto provocaría un aumento de sus ganancias.', 15, 'Si bien es una empresa familiar, esta proyectado la incorporación de una fuente laboral dependiente a futuro. Además se proyecta contratar mano de obra local para llevar adelante la ampliación edilicia.', 15, 'No genera residuos toxico. En cuanto a la perspectiva social, genera empleo local. En lo referido a la perspectiva de genero, es una empresa unipersonal fundada y liderada por una mujer.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-10-31 17:13:48', '2021-11-09 14:15:24'),
(140, 141, 33, 20, 78, '2021-11-19', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto.', 12, 'Esta MiPyME busca mejorar la combinación de genética actual, mediante el aporte requerido, logrando ofrecer un ganado de genética reconocida y aumentar el numero de cabezas de ganado.', 10, 'De acuerdo al formulario y Estado Contable presentado, la empresa cuenta con la capacidad económica, financiera y operativa para llevar adelante las actividades y objetivos propuestos.', 10, 'Según el Estado Contable presentado cerrado el 30/04/2021, la empresa facturó $61.241.101,45 dando cumplimiento a este requisito.', 16, 'Esta empresa ha manifestado en el proyecto presentado, que su objetivo es mejorar la rentabilidad de la misma mediante el aumento del numero de cabeza de ganado.', 10, 'Actualmente no cuenta con fuente laborales dependiente ya que los socios de la SAS son los encargados de llevar a cabo la actividad. Cabe destacar que proyectan la incorporación de empleados para llevar adelante las actividades propuestas.', 10, 'No genera residuos tóxicos. En cuento a la perspectiva social, generará puesto de trabajo. No presenta un abordaje especifico en la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-11-04 13:04:30', '2021-11-29 12:59:31'),
