(147, 148, 33, 20, 86, '2021-11-19', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto. También se recomienda la bonificación de la tasa de interes en 2 puntos porcentuales por ser una empresa liderada por mujeres.', 15, 'La empresa solicitante proyecta adquirir capital de trabajo para producir una nueva línea de sus productos logrando alcanzar nuevos mercados. Esto generaría un escalonamiento en la producción y un aprovechamiento mas eficiente de la capacidad instalada.', 10, 'De acuerdo al formulario y documentación presentada, la titular del proyecto cuenta con suficiente capacidad económica, financiera y operativa para llevar adelante las actividades proyectadas.', 10, 'De acuerdo a la Nota en Carácter de Declaración Jurada, la empresa unipersonal facturó $4.557.986,41 dando cumplimiento a este requisito. Cabe aclarar que los ingresos declarados son a través de la modalidad monotributo que supero los montos máximos por lo cual a partir de enero 2021 es Autónoma - Responsable Inscripta.', 16, 'El proyecto presentado busca llegar a nuevos mercados y aumentar la producción lo que provocaría un aumento en los ingresos de la empresa', 12, 'Cuenta con dos fuentes laborales dependientes. Proyecta la preservación de las mismas.', 13, 'Los desechos generados son almacenados hasta ser retirados por la municipalidad de Gualeguaychú para su disposicional final. En cuanto a la perspectiva social, genera empleo local. Es una empresa liderada por mujeres.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-11-10 16:06:11', '2021-12-02 13:55:42'),
(149, 150, 33, 20, 70, '2021-11-12', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto.', 9, 'Mediante el aporte requerido, busca aumentar la cría de ganado bovino de la raza Angus en pastizales naturales con suplementación estratégica de forma que aumente la calidad de los mismos y sus ventas.', 10, 'De acuerdo al formulario y documentación respaldatoria presentada, el representante del proyecto y su asociado cuentan con suficiente capacidad económica, financiera y operativa para llevar adelante las actividades proyectadas.', 10, 'De acuerdo al formulario 1272 de ambos solicitantes, cumple con este requisito. Cabe destacar que suman una facturación de mas de $57.000.000', 12, 'El objetivo del proyecto a financiar es ofrecer al mercado, recriadores y feedlot un producto de primera calidad que genere mayores clientes y aumente los ingresos de esta actividad.', 10, 'No cuenta con fuentes laborales dependientes ya que es un emprendimiento familiar.', 9, 'Los desechos generados son las heces que son absorbidas por la tierra como abono natural. No presenta abordaje especifico en la perspectiva de genero. En cuanto a la perceptiva social, es proveedor recriadores o feedlot de la zona', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-11-12 01:46:41', '2021-11-29 11:32:16'),
