(151, 152, 33, 20, 72, '2021-11-24', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto.', 8, 'Mediante el aporte requerido, el titular del proyecto busca aumentar la recría de bovinos mediante pasturas implementadas para ofrecer al mercado feedlot.', 10, 'La empresa unipersonal cuenta con suficiente capacidad económica, financiera y operativa para llevar a cabo las actividades propuestas de acuerdo al formulario y documentación presentada', 10, 'De acuerdo al formulario 1272 de AFIP, el titular facturó $47.799.525 en el periodo 2020 dando cumplimiento al requisito de no haber solicitado mas del 50% de su facturación', 20, 'El proyecto presentado busca incrementar sus ingresos a través de la venta de mayor cantidad de animales recriados para su terminación al mercado feedlot.', 8, 'No cuenta con fuentes laborales dependientes. La actividad es llevada a cabo por el titular de la actividad. Cabe destacar que el mismo cuenta con conocimiento y experiencia de varias años en el rubro.', 6, 'No genera residuos toxicos, los residuos generados se convierten en abono de la tierra. Provee de animales recriados para terminación a los clientes de la zona. En cuanto a la perspectiva de genero, no presenta un abordaje especifico.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-11-12 11:34:35', '2021-11-29 14:57:13'),
(152, 153, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-11-12 12:03:10', '2021-11-12 12:03:10'),
(154, 155, 33, 20, 84, '2021-11-24', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto.', 15, 'La empresa busca alcanzar el 100% de la capacidad productiva de las maquinarias. Esto conlleva un reacondicionamiento del sistema eléctrico, lo cual lo va a realizar con el aporte requerido, permitiendo escalar en la cantidad de su producción.', 10, 'De acuerdo al formulario y balance contable presentado, la empresa cuenta con suficiente capacidad económica, financiera y operativa para llevar a cabo las actividades propuestas y respaldar la solicitud del préstamo.', 8, 'De acuerdo al ultimo balance cerrado, la empresa cumple con este requisito. Su facturación fue de $3.890.803 y ajustó a esta el monto solicitado, pidiendo $1.900.000', 15, 'El proyecto presentado consiste en aumentar la capacidad productiva, pudiendo utilizar al 100% las maquinarias existentes. Esto permitiría tener una mayor producción y por lo tanto mayores ingresos.', 16, 'Cuenta con 5 fuentes laborales dependientes. Proyecta mantener las mismas.', 10, 'Todos los subproductos generados son reciclados. En cuanto a la perspectiva social, generan puestos de trabajos locales. No presenta un abordaje especifico respecto a la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-11-16 12:40:33', '2021-11-30 15:28:37'),
(155, 156, 33, 20, 86, '2021-12-14', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 13, 'Mediante el aporte requerido podrán lograr un escalonamiento de la empresa. Esto se llevara a cabo a través de una venta al por mayor de sus productos y de incorporación de nuevos productos alcanzando una oferta integral.', 10, 'Esta MiPyME presentó el formulario y el ultimo balance contable donde muestra que cuenta con la capacidad económica, financiera y\r\noperativa para desarrollar las actividades y  cumplir objetivos proyectados.', 10, 'De acuerdo al Estado Contable cerrado el 30 de abril del 2021 la empresa cumple con este requisito. En dicho periodo facturó $85.545.862,05, por tal motivo se da por cumplido el requisito.', 16, 'El presente proyecto busca aumentar la rentabilidad de la empresa mediante la venta al por mayor que actualmente no están pudiendo realizar ya que no tiene la capacidad de responder a dicho mercado.', 15, 'Cuenta con  una fuente laboral dependiente: Proyecta preservar la misma e incorporar un empleado mas. Además, manifiesta que son nueve familias las que viven de este proyecto.', 12, 'Los desechos generados son reutilizados para el mismo proceso productivo. No presenta abordaje especifico en la perspectiva de genero, pero cabe destacar que la representación legal de la empresa la tiene una mujer. En lo referido a la perspectiva social, genera empleo local.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias', 0, NULL, '2021-11-18 13:01:57', '2021-12-14 13:10:02'),
(156, 157, 33, 25, 80, '2021-11-25', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar un plazo de gracia de 12 meses por ser un poryecto destinado a inversion.', 15, 'Este empresa tiene como perspectiva el escalonamiento de su producción mediante la adquisición de una maquina que mejore la calidad de las terminaciones de su productos y agilice la producción.', 10, 'De acuerdo al formulario presentado, la empresa cuenta con suficiente capacidad económica, financiera y operativa para llevar a cabo las actividades propuestas y para respaldar la solicitud del crédito.', 10, 'Cumple con el presente requisito. El titular del proyecto presento una nota en carácter de Declaración Jurada donde manifestó que en el periodo 2020 facturó un total de $1.061.170 lo cual coincide con los parámetros de AFIP de su categoría de monotributo y además ajusta el monto solicitado a su facturación.', 15, 'Mediante el aporte requerido busca aumentar la producción y por lo tantos sus ingresos por ventas, abasteciendo la demanda de todos sus clientes en tiempo y forma.', 20, 'Actualmente trabaja con miembros de la familia. Proyecta incorporar empleados para cumplir el proyecto presentado.', 10, 'Los excedentes de tela se donan a talleres y los papeles y film de vinilo se separan en residuos inorgánicos que reciben su adecuado tratamiento. En lo referido a la perspectiva social, generará puesto de trabajos locales. No presenta tratamiento especifico en cuenta a la perspectiva de genero.', 0, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-11-18 15:03:18', '2022-06-08 15:01:59'),
