(159, 160, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-11-29 12:31:34', '2021-11-29 12:31:34'),
(164, 165, 33, 20, 85, '2021-12-06', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar un plazo de gracia de doce meses por haber presentado un proyecto destinado a inversión.', 12, 'Mediante el aporte requerido, el titular del proyecto busca incorporar un nuevo equipo de enrollado de pasto para cubrir la demanda actual y captar nuevos clientes. Esto generaría un escalonamiento de la empresa unipersonal.', 8, 'De acuerdo al formulario presentado, esta MiPyME cuenta con suficiente capacidad económica, financiera y operativa para llevar a cabo las actividades propuestas.', 10, 'La empresa presentó el formulario 1272 de AFIP donde muestra que en el periodo 2020 facturó un total de $11.835.454,57. Con esta documentación respaldatoria se da por cumplido el requisito.', 18, 'Busca captar nuevos clientes, tanto en la venta de los rollos como en los servicios de siembra, cosecha y pulverización. Logrando este objetivo, el titular del proyecto va a aumentar sus ingresos y reducir los costos operativos.', 12, 'Actualmente cuenta con un empleado en relación de dependencia. Proyecta preservar esta fuente e incorporar una mas.', 15, 'No genera residuos tóxicos. En lo referido a la perspectiva social, genera empleo local y brinda servicios necesarios a los productores de la zona. No presenta abordaje especifico en la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-11-29 22:18:26', '2021-12-07 12:52:37'),
(166, 167, 33, 20, 80, '2021-12-03', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto.', 15, 'Esta MiPyME busca disminuir costos de los artefactos ofrecidos y ofrecer mayor cantidad de productos abasteciendo la demanda creciente con la que cuentan. El destino del aporte requerido será para la adquisición de insumos y partes de placa led con los que armaran los artefactos.', 8, 'De acuerdo a la documentación y  formulario presentado, la empresa cuenta con suficiente capacidad económica, financiera y operativa para llevar a cabo las actividades propuestas y para respaldar la solicitud del crédito.', 10, 'La empresa solicitante cumple con este requisito, ya que en el periodo 2020 facturó mas del doble de lo solicitado al presente programa. De acuerdo al formulario de AFIP 1272, facturó un total $54.837.927,60', 15, 'El proyecto busca adquirir placas e insumos para el ensamblado de los artefactos. Esto le permitirá a la empresa abaratar costos y generar mayor rentabilidad.', 15, 'Cuenta con 15 fuentes laborales dependientes. Proyecta la preservación de las mismas.', 7, 'Solo se generan residuos de papelería, los cuales son retirados para su reciclado. En lo referido a la perspectiva social, generará puesto de trabajos locales. No presenta tratamiento especifico en cuenta a la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-12-01 15:10:51', '2021-12-03 14:49:03'),
(170, 171, 33, 20, 83, '2021-12-03', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2573/21 SDEyE se recomienda la financiación del proyecto.', 15, 'Mediante el aporte requerido, la cooperativa proyecta adquirir un bobcat e insumos que permitirá reducir los tiempos de producción y aumentar la misma satisfaciendo la potencial demanda con productos de mayor calidad y en menor tiempo.', 8, 'La cooperativa presentó el formulario y el ultimo balance social donde muestra que cuenta con la capacidad económica, financiera y operativa para desarrollar las actividades y objetivos proyectados.', 10, 'De acuerdo al Estado Contable cerrado el 31 de diciembre del 2020 la empresa cumple con este requisito. En dicho periodo facturó $4.979.775,02, por tal motivo se da por cumplido el requisito', 15, 'Sobre lo referido a la perspectiva de sostenibilidad económica, el titular del proyecto busca aumentar sus ingresos y rentabilidad con la incorporación de un nuevo producto que tiene un potencial mercado de acuerdo al estudio que realizó la cooperativa.', 16, 'Cuenta con 5 empleados en relación de dependencia. La cooperativa proyecta mantener estas fuentes laborales en relación de dependencia.', 9, 'Los desechos generados son reutilizados para el mismo proceso productivo. No presenta abordaje especifico en la perspectiva de genero, pero cabe destacar que en el consejo de administración se encuentra una mujer. En lo referido a la perspectiva social, genera empleo local.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2021-12-03 13:11:15', '2021-12-07 13:35:58'),
(172, 173, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-12-07 11:12:59', '2021-12-07 11:12:59'),
(173, 174, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2021-12-17 13:03:24', '2021-12-17 13:03:24'),
(174, 175, 33, 20, 78, '2022-02-08', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0129/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 12, 'Esta MiPyME busca comprar maquinaria para poder lograr una mayor producción y mejorar la calidad de sus productos para poder cumplir con la demanda actual y alcanzar nuevos clientes.', 10, 'De acuerdo al formulario y documentación respaldatoria presentada, esta empresa unipersonal cuenta con la capacidad económica, operativa y financiera suficiente para llevar a cabo las actividades propuestas y devolver el crédito solicitado.', 9, 'Según la categoría de monotributo a enero del 2022 y el documento emitido con clave fiscal que muestra lo facturado en el periodo 2021, no solicita mas del 50% de lo facturado en dicho periodo.', 15, 'La solicitante busca aumentar la rentabilidad de su actividad con la mejora del proceso, alcanzando nuevos clientes que le generen mayores ingresos de forma que logre una producción en escala y así una disminución de costos.', 10, 'Se trata de una empresa familiar por lo cual no cuenta con fuentes laborales dependientes.', 12, 'No genera residuos tóxicos ya que todos los desechos son reutilizados. En lo referido a la perspectiva de genero, es una empresa liderada por una mujer. En cuento a la perspectiva social, es proveedor de locales comerciales.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias', 0, NULL, '2022-01-17 19:24:19', '2022-03-03 11:40:50'),
(175, 176, 33, 20, 83, '2022-02-02', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0129/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 13, 'Mediante el aporte requerido, esta empresa unipersonal busca consolidar e incrementar la producción de terneros de 200 kg en establecimiento ganadero.', 8, 'De acuerdo al formulario presentado y a la documentación que respalda sus ventas, cuenta con suficiente capacidad económica, financiera y operativa para respaldar la solicitud del crédito.', 10, 'La empresa cumple con este requisito, ya que en el periodo 2021 facturó $65.903.375,55. Cabe destacar que todavía no se encuentra disponible en  AFIP el formulario 1272 del periodo 2021, por tal motivo se presento dicho formulario del periodo 2020 acompañado por una declaración de ventas del año 2021.', 15, 'El proyecto presentado busca incrementar sus ingresos a través de la venta de mayor cantidad de terneros con buena genética y rápido desarrollo.', 16, 'Cuenta con 5 fuente laborales dependientes y 2 jornaleros. Proyecta la preservación de estas fuentes laborales.', 11, 'Los residuos generados se acondicionan para su correcta degradación. Genera empleo local. En cuanto a la perspectiva de genero, no presenta un abordaje especifico', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias', 0, NULL, '2022-01-19 14:51:25', '2022-02-02 15:16:00'),
(176, 177, 1781, 20, 82, '2022-04-27', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0129/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 12, 'La empresa dedicada a la actividad agropecuaria tiene perspectivas de escalonamiento mediante la compra de vientres, con el aporte requerido, que le permitirá una mayor reproducción.', 8, 'De acuerdo al formulario y documentación presentada, cumple con el requisito de contar con la capacidad económica, financiera y operativa para llevar a cabo los objetivos propuestos.', 10, 'De acuerdo al Formulario 1272 de AFIP, el solicitante no pide un monto mayor al 50% de lo facturado en el año 2021. Según dicho formulario, tuvo una facturación de $1.816.255,90', 15, 'Con el proyecto presentado busca aumentar la rentabilidad de su empresa y solventar los costos fijos a través del incremento del porcentaje de preñez con el que cuenta.', 15, 'La MiPyME no cuenta con fuentes laborales dependientes ya que es una empresa familiar donde trabajan los miembros de la misma.', 12, 'No genera residuos tóxicos la actividad que desarrolla esta empresa. En cuanto a la perspectiva social, es proveedor principal de cooperativas de la zona. En lo que respecta a la perspectiva de genero, no presenta un abordaje especifico.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstos en la Resolución 0129/22 SDEyE y normas complementarias.', 0, NULL, '2022-01-25 03:40:22', '2022-04-28 13:05:21'),
