(192, 193, 33, 20, 85, '2022-03-23', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0129/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 15, 'Con el aporte solicitado, esta MiPyME proyecta el escalonamiento con la incorporación de una maquina que automatice el proceso de corte, sellado y plegado. Dicho escalonamiento se dará por la mayor producción y abastecimiento de la demanda en menor tiempo.', 10, 'De acuerdo al formulario presentado y a la documentación respaldatoria, cuenta con suficiente capacidad económica, financiera y operativa para alcanzar los objetivos propuestos y afrontar la devolución del crédito.', 10, 'La empresa cumple con este requisito, ya que en el periodo 2021 facturó $ 9.852.386,01 de acuerdo a la certificación de ingresos presentada. Cabe destacar que todavía no se encuentra disponible en AFIP el formulario 1272 correspondiente al periodo 2021, por tal motivo se presento dicho formulario del periodo 2020 acompañado por la certificación antes mencionada junto a las Declaraciones Juradas mensuales de ingresos.', 15, 'Con el proyecto se reducirán los tiempos de producción y disminuirán los costos de mantenimiento de la maquina que se va a reemplazar. La mayor producción y la satisfacción de la demanda en menor tiempo generará un aumento en la rentabilidad.', 10, 'La empresa incorporará personal para la instalación y puesta en marcha de la maquinaria a adquirir.', 15, 'Los productos son susceptible de ser reciclados, en cuanto a los retazos son enviados a otra empresa para su reciclado y luego vuelven en forma de materia prima para producir. En lo referido a la perspectiva social, genera empleo local. No presenta abordaje especifico sobre perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias.', 0, NULL, '2022-03-14 13:42:42', '2022-03-30 15:04:05'),
