(199, 200, 1781, 20, 79, '2022-05-13', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 12, 'La empresa busca transformar los procesos productivos a través de la incorporación de tecnología con nueva maquinaria. Esto permitirá que se agilicen los procesos y aumente la producción, posicionándose en el mercado local.', 9, 'De acuerdo al formulario 1272 de AFIP y al correspondiente a la presentación del programa, esta Sociedad de Hecho cuenta con la capacidad económica, financiera y operativa necesaria para cumplir con las actividades propuestas.', 10, 'Según el formulario de AFIP 1272 presentado, la empresa tuvo una facturación en el 2021 por un monto de $10.300.589. Con esto damos por cumplido el requisito de no solicitar mas de 50% de la facturación total del año anterior. La misma solicitó $3.000.000', 15, 'A través de la incorporación de tecnología y por lo tanto la agilización de procesos y aumento de producción, la MiPyME podrá mejorar sus ingresos', 18, 'Es una empresa familiar que cuenta con ocho empleados en relación de dependencia. Se proyecta mantener la fuente laboral.', 15, 'Los residuos de cartón son reciclados y los alimenticios son destinados a chancherías de la zona para alimento de porcinos. En lo referido a la perspectiva social, genera puestos de trabajo y abastece a distintos negocios e instituciones de la zona. No presenta abordaje especifico sobre perspectiva de genero.', 0, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstos en la Resolución vigente del programa y normas complementarias.', 0, NULL, '2022-04-13 12:15:43', '2022-05-17 14:28:00'),
(203, 204, 1781, 20, 89, '2022-05-04', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0129/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 15, 'Con la realización de la sala de fraccionamiento y extracción de miel, la cooperativa podrá abastecer el aumento de la demanda del consumo interno y externo, agregar valor al desarrollo del producto final suprimiendo un trabajo que se terciarizaba y reducir los costos de envasado y fraccionamiento, fletes y tiempo del proceso.', 10, 'De acuerdo a los formularios y documentación respaldatoría presentada, cuenta con la capacidad operativa, financiera y económica suficiente para lograr los objetivos propuestos.', 10, 'De acuerdo al ultimo balance presentado, la empresa tuvo facturación por la producción  y venta de miel por mas del doble de lo que solicita al presente programa.', 18, 'Contando con una sala de fraccionamiento y envasado propia, la cooperativa podrá tener mayores ingresos, lograr exportar sus productos y disminuir costos que generan una mayor rentabilidad.', 15, 'La cooperativa no tiene empleados en relación de dependencia ya que todos son asociados de la misma. Cabe destacar que son 55 asociados, entre en su mayoría apicultores inscriptos en el RENAPA.', 11, 'Esta actividad no genera residuos tóxicos que contaminen el medio ambiente y además, de la limpieza de los cuadros, se obtienen un subproducto (cera) que se vende para la realización de otros productos. En lo referido a la perspectiva social, genera puestos de trabajo en la zona. No presenta abordaje especifico sobre perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos previstos en la presente Resolución y normas complementarias que regulan el programa.', 0, NULL, '2022-04-26 13:11:38', '2022-05-17 11:54:56'),
(204, 205, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2022-04-29 14:17:13', '2022-04-29 14:17:13'),
(205, 206, 1781, 20, 88, '2022-05-27', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 10, 'La empresa busca su consolidación a través de la mejora del proceso de distribución. Con la compra del equipamiento térmico, sus productos podrán mantener la cadena de frio durante su distribución en el mercado.', 10, 'El Estado contable, el contrato social y los formularios de inscripción demuestra que la empresa cuenta con la capacidad económica, financiera y operativa para llevar a cabo las actividades propuestas en el proyecto presentado.', 10, 'En el ultimo balance cerrado tuvo una facturación de $378.508.718,40. Por lo tanto se da por cumplido el requisito de no haber solicitado al programa un monto mayor al 50% de lo facturado el año anterior, ya que la empresa solicitó $3.000.000', 18, 'Con la mejor del proceso de distribución, van a lograr disminuir los costos de deterioro de mercadería y la aceleración de dicho proceso. Esto impactara favorablemente en la rentabilidad de la empresa.', 20, 'La empresa cuenta, actualmente, con 20 empleados en relación de dependencia. Se proyecta conservar los mismos.', 10, 'No presenta abordaje especifico en lo referido a la perspectiva ambiental. En lo que respecta sobre perspectiva social y de genero, genera empleo local y es una empresa liderada por mujeres.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstos en la Resolución 1135/22 SDEyE y normas complementarias.', 0, NULL, '2022-04-29 17:34:13', '2022-05-31 13:10:46'),
(206, 207, 1781, 20, 93, '2022-05-17', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión y el subsidios de dos puntos porcentuales sobre la tasa por tratarse de un proyecto presentado por empresa liderada por mujer.', 15, 'Con el aporte requerido busca comprar maquinaria e insumos para poder aumentar la producción y abastecer la demanda que viene creciendo, incorporar nueva tecnología y disminuir los tiempos de distribución. Con esta situación lograría consolidar su MiPyME y posicionar la marca a nivel nacional.', 8, 'Con la documentación presentada y la descripción en el formulario se constata que la MiPYME tiene capacidad económica, financiera y operativa suficiente para llevar adelante las actividades y objetivos propuestos.', 10, 'De acuerdo a la Nota en carácter de Declaración Jurada de los ingresos del año 2021, no solicita mas del 50% de dicha facturación realizada.', 20, 'Tiene ventas mayoristas y minoristas en todo el país, con una demanda que duplica la producción que puede realizar con la maquinaria que cuenta actualmente. El proyecto tiene perspectiva de poder abastecer la demanda, duplicando los ingresos y por lo tanto la rentabilidad', 15, 'Es una empresa familiar que cuenta con un empleado en relación de dependencia y proyecta incorporar tres empleados mas.', 15, 'Reutilizan los retazos de tela para hacer accesorios o prendas de menor tamaño. En cuanto la perspectiva social, generará nuevos puestos de trabajo. Es una empresa liderada por una mujer', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstos en la Resolución 1135/22 SDEyE y\r\nnormas complementarias.', 0, NULL, '2022-05-06 13:52:31', '2022-05-17 13:09:26'),
(207, 208, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2022-05-09 12:52:47', '2022-05-09 12:52:47'),
(208, 209, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2022-05-09 14:01:37', '2022-05-09 14:01:37'),
(209, 210, 1781, 20, 78, '2022-05-30', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 15, 'La empresa tiene perspectiva de escalamiento a través de la incorporación de bienes de capital que permita la automatización de líneas de producción. Con esto podrá aumentar y agilizar la producción, llegando a nuevo mercado.', 8, 'Cuenta con la capacidad económica, financiera y operativa, para llevar a cabo las actividades propuestas y lograr el objetivo de competir con industrias de mayor envergadura, de acuerdo al formulario y documentación respaldatoria presentada.', 10, 'La empresa presentó el formulario 1272 de AFIP donde muestra que en el año anterior tuvo una facturación de $14.597.648,25. Con esto se da por cumplido el requisito de no haber solicitado mas de la mitad de lo facturado el año pasado, ya que solicito $3.000.000 al programa', 20, 'Con el proyecto pretende aumentar la rentabilidad, a través de compra de nueva maquinaria que lograra la agilización e incremento de la producción y la disminución de costos de mantenimiento de maquinarias que se encuentran obsoletas.', 15, 'Es una empresa familiar que cuenta con 6 empleados en relación de dependencia. Se proyecta la conservación de estas fuentes laborales.', 0, 'Con los residuos se elabora otros productos, como la ricota. En la perspectiva social, genera puestos de trabajo y abastece a comercios locales. No presenta abordaje especifico en lo que respecta a la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstos en la Resolución 1135/22 SDEyE y normas complementarias.', 0, NULL, '2022-05-10 13:52:25', '2022-06-02 13:41:08'),
