(214, 215, 1781, 20, 79, '2022-06-07', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 12, 'Esta empresa unipersonal busca expandir su producción. Destinará el crédito a la adquisición de nuevos materiales para el cuidado de colmenares y la crianza de abejas.', 10, 'De acuerdo al formulario y documentación respaldatoria presentada, la empresa cuenta con la capacidad económica, financiera y operativa suficiente de desarrollar las actividades propuestas.', 10, 'De acuerdo a la categoría de monotributo determinada en enero 2022 teniendo en cuenta la facturación del 2021 y la nota en carácter de declaración jurada presentada, cumple con el requisito de no haber solicitado al presente programa mas del doble de lo facturado el año anterior.', 15, 'Con la renovación de los materiales apícolas, mejorará y aumentará la producción generando un aumento de la rentabilidad', 10, 'Es una empresa familiar que no tiene empleados en relación de dependencia.', 12, 'Los residuos que se generan son reutilizados. En cuanto a la perspectiva social, es proveedor principal de negocios y consumidores de la zona. En lo que respecta a la perspectiva de genero, no presenta un abordaje especifico', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstos en la Resolución 1135/22 SDEyE y normas complementarias.', 0, NULL, '2022-05-23 12:42:22', '2022-06-13 14:17:32'),
(215, 216, 1781, 20, 91, '2022-05-27', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 15, 'La empresa busca consolidarse a través de la adquisición de dos maquinaria que permita producir a mayor velocidad y realizar la impresión de cajas y papelerías en un formato mas grande que actualmente se esta tercerizando fuera de la provincia.', 10, 'De acuerdo a la documentación y formularios presentados, se considera que la empresa cuenta con la capacidad económica, financiera y operativa para desarrollar las actividades y cumplir los objetivos.', 10, 'La empresa facturó un total de $15.621.745,87 en el año 2021, de acuerdo al formulario 1272 AFIP. Con esto se da por cumplimentado el requisito. Cabe destacar que la empresa bajo el formato de \"Sociedad de Hecho\" no está obligada a llevar balance contable.', 20, 'Con el aumento de la producción y el reemplazo de la terciarización, la empresa va a lograr disminuir los costos y aumentar la facturación. Esto genera un aumento de la rentabilidad de la sociedad.', 15, 'La empresa cuenta con 8 empleados en relación de dependencia. La misma pretende preservar las fuentes laborales.', 11, 'Los desechos son retirados periódicamente por otra empresa que se encarga del proceso de reciclado. En lo que respecta a la perspectiva social, genera empleo a nivel local. No presenta abordaje especifico sobre perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 1135/22 SDEyE y normas complementarias.', 0, NULL, '2022-05-23 14:50:01', '2022-05-30 14:40:00'),
