(220, 221, 1781, 20, 73, '2022-09-09', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto.', 12, 'Esta empresa busca su consolidación a partir de la adquisición de materia prima para contar con un stock que le permita aumentar la producción y cumplir en tiempo y forma con los pedidos de los clientes.', 5, 'Si bien la firma es nueva, ya contaba con una base de activos que le dió la capacidad económica, financiera y operativa para desarrollar el proyecto presentado.', 4, 'Si bien en el Balance Contable se ve una facturación de $667.077,70 correspondiente al periodo de agosto a noviembre 2021 donde cerró el ejercicio, la empresa aclaró que en el inicio de dicho ejercicio la facturación se realizó con el CUIT de cada socio que forman el 100% del capital de la empresa hasta estar en condiciones de facturar con el CUIT de la SRL. Cabe destacar que los socios presentaron un facturación de un total de $42.490.868,23', 18, 'Con el desarrollo del proyecto, buscan abastecer la demanda creciente logrando la fidelización de los clientes y logrando captar nuevos, generando mayores ingresos a la empresa.', 14, 'Cuenta con 5 fuentes laborales dependientes. Proyectan preservar las mismas.', 10, 'La planta se encuentra con las instalaciones correspondiente para tratar los residuos. No presenta abordaje especifico en la perspectiva de genero. En lo que se refiere a la perspectiva social, genera empleo a nivel local.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstos en la Resolución 1135/22 SDEyE y normas complementarias.', 0, NULL, '2022-05-31 13:17:41', '2022-09-09 13:37:07'),
(222, 223, 1781, 20, 87, '2022-06-15', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto. También se recomienda otorgar el plazo de gracia de doce meses por tratarse de un proyecto de inversión.', 12, 'Con el aporte requerido busca la ampliación del deposito de tambores para mejorar la producción y separar la sala de envasado de la de extracción. Con esto lograría tener el control de cada espacio independiente y el aumento de la producción.', 10, 'De acuerdo al Estado Contable y formulario presentado, cuenta con suficiente capacidad económica, financiera y operativa para llevar adelante las actividad propuestas y los objetivos proyectados.', 10, 'De acuerdo al ultimo balance cerrado tuvo una facturación de $6.611.082,17. Con esto se da por cumplimentado el requisito de no solicitar al programa mas del 50% de lo facturado.', 18, 'Con la conclusión del proyecto, se vera un aumento de la producción y por lo tanto de la rentabilidad de la empresa.', 15, 'La cooperativa no cuenta con empleados en relación de dependencia, si no que son 22 socios. Los mismo se encargan de todas las actividades.', 12, 'En el proceso productivo no se generan residuos tóxicos. En la perspectiva social, genera puestos de trabajo y abastece a consumidores finales, acopiadores o exportadores a nivel nacional. No presenta abordaje especifico en lo que respecta a la perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstos en la Resolución 1135/22 SDEyE y normas complementarias.', 0, NULL, '2022-06-02 14:32:07', '2022-06-22 14:41:26'),
(224, 225, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2022-06-08 15:22:50', '2022-06-08 15:22:50'),
(225, 226, 1781, 20, 78, '2022-06-22', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto.', 12, 'El aporte requerido será destinado a la adquisición de cepilladora y prensa de tableros para generar valor agregado a sus productos. Con esto podrá abastecer la demanda creciente y aumentar sus ingresos.', 10, 'De acuerdo al formulario y documentación respaldatoria presentada, se considera que la empresa cuenta con la capacidad económica,\r\nfinanciera y operativa para desarrollar las actividades y cumplir los objetivos proyectados.', 8, 'La empresa facturó un total de $ 5.337.875,86 en el año 2021, de acuerdo al formulario 1272 AFIP. Con esto se da por cumplimentado el requisito ya que solicito $2.450.000 al programa', 13, 'Con el aumento de la producción y el agregado de valor a productos que no tenían mucha demanda, generará un aumento de la rentabilidad de esta empresa unipersonal.', 12, 'La empresa cuenta con 2 empleados en relación de dependencia. La misma pretende preservar las fuentes laborales.', 13, 'Los desechos generados son vendidos a otros emprendimientos. En lo que respecta a la perspectiva social, genera empleo a nivel local. No presenta abordaje especifico sobre perspectiva de genero', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 1135/22 SDEyE y normas complementarias.', 0, NULL, '2022-06-08 15:46:16', '2022-07-01 12:21:16'),
(230, 231, 1781, 20, 84, '2022-06-30', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto.', 15, 'La empresa busca adquirir insumos para el acondicionamiento y mejora de las maquinarias utilizadas en la extracción. Esto le permitirá obtener sus maquinas en optimas condiciones, abasteciendo la demanda en menor tiempo y generando un escalamiento de la empresa.', 10, 'La empresa cuenta con los activos necesario para llevar adelante las actividades propuestas. De acuerdo al balance, sus capacidad financiera, operativa y económica son suficientes.', 10, 'Cumple con dicho requisito de acuerdo al balance presentado, ya que tuvo una facturación que supera ampliamente el doble de lo solicitado al programa. Dicha facturación fue de $28.272.912', 15, 'Con el acondicionamiento de las maquinas se disminuirán los costos de mantenimiento y demoras por mal funcionamiento de las mismas. Por este motivo y el cumplimiento de la demanda creciente tendrá mayor rentabilidad.', 12, 'La empresa cuenta con 8 empleados en relación de dependencia. La misma pretende preservar las fuentes laborales', 12, 'Esta actividad no genera desechos tóxicos. En lo que respecta a la perspectiva social, genera empleo a nivel local y es proveedor de obras viales de municipios y comunas cercanas. No presenta abordaje especifico sobre perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 1135/22 SDEyE y normas complementarias.', 0, NULL, '2022-06-22 12:47:52', '2022-07-01 14:08:42'),
