(248, 249, 1781, 20, 76, '2022-09-16', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto. Además se recomienda otorgar el plazo de 12 meses de gracia por tratarse de un proyecto de inversión.', 12, 'Esta empresa busca consolidarse a través de la construcción de galpones para desarrollar su actividad de producción intensiva de cerdos. Además busca ampliar su producción y mejorar el nivel sanitario de la granja.', 8, 'Según con el formulario y balance presentado cuenta con suficiente capacidad económica, operativa y financiara para respaldar la solicitud del crédito y desarrollar las actividades propuestas.', 8, 'De acuerdo al ultimo balance cerrado el 28 de febrero del corriente año, la empresa tuvo un a facturación de $7.337.275,82. Se da por cumplimentado este requisito.', 15, 'Se proyecta un incremento en la producción, lo que conlleva aumento de sus ingresos.', 13, 'Es una empresa familiar en la que trabajan los socios y que no tiene fuente de laborales dependiente pero si cuenta con asesores externos. Se proyecta la contratación de fuentes laborales dependientes.', 10, 'Los desechos son almacenados en lagunas de tratamiento impermeabilizada para luego ser esparcidas en las chacras como un abono orgánico. En lo que respecta a la perspectiva social, genera empleo a nivel local y es proveedor de los frigoríficos de la región. El capital social de la empresa esta representado en una parte por una mujer.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 1135/22 SDEyE y normas complementaria.', 0, NULL, '2022-06-24 14:48:06', '2023-02-14 12:01:14'),
(249, 250, 1781, 20, 88, '2022-07-04', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto.', 12, 'La empresa proyecta adquirir insumos (frascos de vidrios) en cantidad para poder abastecer la demanda creciente a dos grandes cadenas a nivel nacional. Con esto se logrará un escalonamiento de esta empresa joven que tiene mucho potencial.', 10, 'De acuerdo al balance y el formulario presentado, la empresa cuenta con la capacidad financiera, operativa y económica para lograr las actividades y objetivos propuestos.', 9, 'De acuerdo al Balance presentado, la empresa tuvo una facturación en el año 2021 de $6.680.007,45. Con esto se da por cumplido este requisito ya que al programa solicitó el monto de $3.000.000.', 20, 'La PyME proyecta que con la financiación y concreción del proyecto presentado logrará un aumento de un 50% en la producción y en la facturación al poder abastecer la demanda actual de grandes cantidades.', 15, 'Cuentan con cuatro fuentes laborales dependientes. Proyectan preservar las mismas e incorporar dos mas.', 12, 'Los plásticos y cartones se donan a recolectores de recicladoras de la ciudad. En el caso desechos x limpieza se tratan en una cámara desengrasadora. En lo que respecta a la perspectiva social, genera empleo local. No presenta abordaje especifico sobre perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 1135/22 SDEyE y normas complementarias.', 0, NULL, '2022-06-24 15:43:58', '2022-07-15 14:35:09'),
(250, 251, 1781, 20, 85, '2022-07-13', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto. Además se recomienda otorgar el plazo de 12 meses de gracia por tratarse de un proyecto de inversión.', 15, 'La empresa busca realizar una construcción en el inmueble que permita fabricar nuevos productos con la finalidad de exportarlos. Esto permitirá un escalonamiento en la misma.', 10, 'De acuerdo al Estado Contable y al formulario presentado, la empresa tiene la capacidad económica, financiera y operativa suficiente para desarrollar el proyecto presentado.', 10, 'Cumple con este requisito. La empresa tuvo una facturación en el ultimo periodo de $25.208.858,68.', 15, 'Se generaran aumento de los ingresos de la MiPyMEs al fabricar nuevos productos para el mercado externo. La misma manifiesta contar con clientes potenciales para llevar a cabo este proyecto.', 15, 'Cuenta con mas de 50 empleados en relación de dependencia. La empresa proyecta mantener los mismo e incorporar nuevas fuentes de trabajo al proyecto de los productos a exportar.', 10, 'Los desechos generados son reutilizados. En lo que respecta a la perspectiva social, genera empleo a nivel local y es proveedor de grandes empresas de la provincia. No presenta abordaje especifico sobre perspectiva de genero.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 1135/22 SDEyE y normas complementaria.', 0, NULL, '2022-06-24 17:17:45', '2022-07-19 13:04:53'),
(252, 253, 1781, 20, 93, '2022-07-08', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto.\r\nAdemás se recomienda otorgar el plazo de 12 meses de gracia por tratarse de un proyecto de inversión y la bonificación de la tasa de interés en 2 puntos porcentuales por tratarse de una empresa liderada por mujeres.', 15, 'La empresa busca adquirir un nuevo auto elevador que le permitirá agilizar la carga, descarga y traslado de materia prima y mercadería. De esta forma, reducirá los tiempos de logística interna y acelerará el proceso producción.', 10, 'De acuerdo al balance y el formulario presentado, la empresa cuenta con los activos necesario para llevar adelante las actividades propuestas. Por lo tanto sus capacidad financiera, operativa y económica son suficientes.', 10, 'La empresa facturó un total de $ 714.029.990,29 en el ultimo ejercicio. Con esto se da cumplimentado el requisito.', 15, 'Actualmente existen demoras en el proceso productivo por la espera de que el auto elevador esté desocupado. Con la adquisición de uno nuevo, estos tiempos se reducirán, generando mayores ventas que aumentara la rentabilidad.', 20, 'Cuenta con 120 empleados en relación de dependencia. Proyecta la preservación de dicha fuente.', 13, 'Los residuos generados reciben el proceso correspondiente y son enviados a una planta de reciclado. En lo que respecta a la\r\nperspectiva social, genera empleo a nivel local. No presenta abordaje especifico sobre perspectiva de genero, pero es un empresa liderada por mujeres.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 1135/22 SDEyE y normas complementaria.', 0, NULL, '2022-06-27 14:24:20', '2022-07-15 12:54:33'),
