(273, 274, 1781, 20, 82, '2022-10-26', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2357/22 SDEyE se recomienda la financiación del proyecto.', 15, 'La empresa busca un escalonamiento tras alcanzar un nuevo mercado al descubrir por la necesidad de sus clientes de una maquina envasadora de membrillo. Buscan ofrecer una envasadora innovadora que optimice el proceso de envasado.', 8, 'La empresa manifiesta en el formulario contar con una trayectoria de 15 años y una superación de todas las dificultades. Cuenta con la capacidad operativa para realizar una nueva maquinaria, y con capacidad económica y financiera suficiente para respaldar la solicitud del credito.', 10, 'De acuerdo al formulario 1272 de AFIP, esta empresa unipersonal facturó $177.763.419,36 en el periodo 2021 superando ampliamente el doble de lo solicitado. Por tal motivo se da por cumplimentado el requisito.', 15, 'La fabricación de un nuevo tipo de envasadora permitirá ingresar a un nuevo mercado y generar mayores ingresos.', 15, 'La empresa cuenta con 10 empleados en relación de dependencia. La misma pretende preservar dichas fuentes laborales y generar nuevos puestos de trabajo.', 9, 'Todos los residuos que se generan son vendidos a charrateros. No presenta abordaje especifico acerca de la perspectiva de genero. En cuanto a la perspectiva social, genera empleo local y brinda soluciones a la demanda de empresas de la provincia.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 2357/22 SDEyE y normas complementarias.', 0, NULL, '2022-07-08 15:30:43', '2022-11-16 15:07:30'),
(274, 275, 1781, 20, 88, '2022-09-05', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 1135/22 SDEyE se recomienda la financiación del proyecto.', 15, 'Esta empresa busca financiamiento para adquirir capital de trabajo (materia prima e insumos) para producir un tipo de acoplado para productores de citrus. Con esto se insertará en un nuevo mercado y logrará un escalonamiento en la empresa.', 10, 'De acuerdo al Estado Contable y al formulario presentado, la empresa tiene la capacidad económica, financiera y operativa suficiente para desarrollar el proyecto presentado y lograr los objetivos propuestos.', 10, 'De acuerdo al ultimo Balance Contable presentado, en el año 2021 tuvo una facturación de $27.402.320,79. Se da cumplimentado este requisito.', 15, 'La inserción en nuevo mercado le generara mayores ingreso y con esto aumentará su rentabilidad.', 18, 'Cuenta con 8 fuentes laborales dependientes. Proyecta preservar las mismas.', 10, 'Se generan desechos de acero que se reciclan como chatarra. En lo que respecta a la perspectiva social, genera empleo a nivel local y se convertirá en proveedor del sector citrícola de la provincia. No presenta abordaje especifico sobre perspectiva de genero.', 10, 'Busca adquirir capital de trabajo con el financiamiento solicitado.  Este destino encuadra con los términos y condiciones previstas en la Resolución 1135/22 SDEyE y normas complementaria.', 0, NULL, '2022-07-15 11:56:12', '2022-09-05 12:00:29'),
