(279, 280, 1781, 20, 82, '2023-02-01', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 2357/22 SDEyE se recomienda la financiación del proyecto. Además se recomienda otorgar el plazo de gracias de 12 meses por tratarse de un proyecto de inversión y la bonificación de 2 puntos porcentuales sobre la tasa de interés por ser una empresa liderada por mujeres.', 12, 'Esta PyME se encuentra consolidada hace varios años y actualmente busca su escalonamiento a través de un aumento y orden de su producción. Mediante el aporte adquirido busca adquirir materia prima y estanterías para tener un stock de las mismas ordenado y aumentar sus producción.', 10, 'La empresa cuenta con una trayectoria de mas de 30 años, en la que ha logrado tener una capacidad económica, financiera y operativa suficiente para llevar a cabo una mayor producción y para respaldar el crédito solicitado.', 10, 'De acuerdo al ultimo Balance Contable, esta empresa facturó $69.529.103,72 en el periodo 2021 superando ampliamente\r\nel doble de lo solicitado. Por tal motivo se da por cumplimentado el requisito.', 15, 'Se proyecta un incremento en la producción, lo que conlleva aumento de sus ventas y disminución de sus costos en un futuro por tener materia prima en stock y por lo tanto ingresos.', 15, 'Cuenta con 9 empleados en relación de dependencia. La misma proyecta preservar dicha fuente de trabajo e incorporar personal a corto o mediano plazo.', 10, 'Todos los residuos que se generan son reutilizados o desechados con el tratamiento adecuado. En cuanto a la perspectiva social, genera empleo local. Sobre la perspectiva de genero, se trata de una empresa liderada por mujeres dada por un 40% de la representación social y la ocupación de un cargo con toma de decisiones.', 10, 'El destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 2357/22 SDEyE y normas complementarias.', 0, NULL, '2022-07-29 13:40:50', '2023-02-14 12:05:25'),
