(305, 306, 1781, 20, 88, '2023-04-18', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0492/23 SDEyE se recomienda la financiación del proyecto. Además se recomienda otorgar el plazo de gracias de 12 meses por tratarse de un proyecto de inversión.', 12, 'La empresa busca la consolidación a través de la culminación de la obra y traslado a la nueva planta procesadora', 10, 'La empresa cuenta con una trayectoria de mas de 30 años, en la que ha logrado tener una capacidad económica, financiera y operativa suficiente para abrir una nueva planta y para respaldar el crédito solicitado.', 10, 'Si bien todavía no tiene el balance cerrado en 2022, la empresa presento el balance del periodo 2021 y la documentacion correspondiente a lo facturado en el periodo 2022. De acuerdo a dicha documentacion, la empresa cumple con el requisito de haber facturado mas de $16.000.000 en el año 2022', 18, 'La empresa proyecta disminuir sus costos y mejorar los procesos logrando productos mas competitivos a nivel nacional e internacional. Esto mejoraría la rentabilidad de la empresa y ampliaría el mercado.', 18, 'Actualmente cuenta con 16 empleados. Proyecta mantener la nomina e incorporar 10 empleados mas para trabajar en la nueva planta.', 10, 'Todos los desechos son recolectados por una empresa para su adecuado tratamiento. En cuanto a la perspectiva social, genera empleo local y ofrece productos que reemplazan los medicamentos quimicos. Sobre la perspectiva de genero, no presenta un abordaje especifico.', 10, 'El destino del financiamiento solicitado es para maquinaria y capital de trabajo asociado por lo cual encuadra con los términos y condiciones previstas en la Resolución 0492/23 SDEyE y normas complementarias.', 0, NULL, '2023-04-11 11:25:38', '2023-04-20 14:50:52'),
(306, 307, 1781, 20, 92, '2023-04-19', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0492/23 SDEyE se recomienda la financiación del proyecto. Además se recomienda otorgar el plazo de gracias de 12 meses por tratarse de un proyecto de inversión y la bonificación de 2 puntos porcentuales sobre la tasa de interés por ser una empresa liderada por mujeres.', 12, 'La PyME busca el escalonamiento de la empresa, alcanzando nuevos clientes con productos de mejor calidad. Busca posicionar su marca en todo el territorio nacional.', 10, 'Cuenta con una experiencia de mas de 28 años en el rubro, lo que ha logrado alcanzar una capacidad económica, financiera y operativa suficiente para llevar a cabo el proyecto presentado.', 10, 'Según el ultimo Balance cerrado el 31 de octubre del 2022, la empresa facturó $34.252.839,01 cumplementando con el presente requisito.', 15, 'Con la financiación del proyecto presentado se busca mejorar la productividad y calidad para poder abastecer la demanda actual y la de nuevos potenciales clientes. Con esto logrará mayores venta e ingresos.', 20, 'La empresa cuenta con 6 empleados en relación de dependencia y 7 profesionales de manera indirecta. Se proyecta mantener esta fuente e incrementarla en un 50%.', 15, 'Todos los desechos son vendidos o guardados para ser retirados anualmente y recibir el tratamiento adecuado. En cuanto a la perspectiva social, genera empleo local. Sobre la perspectiva de genero, se trata de una empresa liderada por mujeres dada por un 25% de la representación social y la ocupación de un cargo con toma de decisiones como gerente suplente.', 10, 'El destino del crédito es para construcción de galpón. por lo tanto, el destino del financiamiento solicitado encuadra con los términos y\r\ncondiciones previstas en la Resolución 0492/23 SDEyE y normas complementarias.', 0, NULL, '2023-04-12 14:11:11', '2023-04-21 11:02:41'),
(308, 309, 1781, 20, 87, '2023-04-26', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0492/23 SDEyE se recomienda la financiación del proyecto. Además se recomienda otorgar la bonificación de 2 puntos porcentuales sobre la tasa de interés por ser una empresa liderada por mujeres.', 12, 'La empresa busca consolidarse a través de la compra de insumos para tener stock a menor precio por la adquisición en cantidad y ganarle al contexto inflacionario. De esta forma reducirá los costos de producción a largo plazo y obtendrá una mayor cantidad de productos en stock.', 10, 'Esta empresa viene desarrollando su actividad desde 1977. Desde dicha fecha a la actualidad ha logrado conseguir una capacidad económica, financiera y operativa suficiente para llevar adelante los objetivos propuestos en el proyecto presentado y para respaldar el crédito solicitado.', 10, 'La empresa no tiene aun el Balance Contable certificado cerrado el 31 de diciembre del 2021. Por tal motivo, presentó el balance del periodo 2021 y el formulario 1272 donde muestra la facturación del periodo 2022.  De acuerdo a este ultimo, la misma facturó un total de $ 395.395.931,01 en el año 2022.', 15, 'Mejorará su rentabilidad a través de la disminución de los costos de materia prima en largo plazo y el precio de mercado.', 18, 'La PyME cuenta con 64 empleados en relación de dependencia. Proyecta preservar esta fuente laboral.', 12, 'Los recortes de madera son utilizados en la caldera donde calientan el aceite para el sistema de prensado, los demás recortes de aluminio y chapa son reciclados. La empresa es proveedora de sus productos en todo el país y genera empleo local. En cuanto a la perspectiva de genero, se trata de una empresa liderada por mujeres.', 10, 'El destino del crédito es para compra de materia prima para producir, por lo tanto, el destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 0492/23 SDEyE y normas complementarias.', 0, NULL, '2023-04-17 14:30:00', '2023-04-28 13:47:57'),
(309, 310, NULL, 20, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2023-04-19 13:59:58', '2023-04-19 13:59:58'),
(311, 312, 1781, 20, 87, '2023-05-15', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0492/23 SDEyE se recomienda la financiación del proyecto. Además se recomienda otorgar la bonificación de 2 puntos porcentuales sobre la tasa de interés por ser una empresa liderada por mujeres.', 12, 'EJEMPLAR SA cuenta con la perspectiva de escalonamiento a través de la compra de materia prima en cantidad para lograr una mayor producción que le permita abastecer la demanda de todos los clientes y alcanzar nuevos.', 10, 'Esta empresa cuenta con una trayectoria de mas de 20 años y de acuerdo al balance, cantidad de producción y empleados se entiende que tiene la capacidad económica, financiera y operativa suficiente para llevar a cabo las actividades propuestas.', 10, 'la empresa aun no cuenta con el balance cerrado en 2022 certificado, por tal motivo presentó el balance del periodo 2021 acompañado por el formulario 1272 de AFIP que muestra lo facturado en el periodo 2022. De acuerdo a dicha documentacion, la empresa facturó $313.610.982,24 cumplementando este requisito.', 15, 'Tener materia prima en stock generará mayor producción y a menor costo a largo plazo.', 20, 'La empresa cuenta con 98 empleados en relación de dependencia. Proyecta mantener la nomina', 10, 'Es una empresa liderada por mujeres. Genera empleo a nivel local. Los desechos textiles se vuelven a reutilizar y los envases de productos químicos son devueltos al proveedor.', 10, 'El destino del crédito es para la adquisición de capital de trabajo para la producción, encuadrando con los términos y\r\ncondiciones previstas en la Resolución 0492/23 SDEyE y norma complementarias.', 0, NULL, '2023-04-26 16:45:31', '2023-05-18 13:25:19'),
(312, 313, 1781, 20, 73, '2023-05-18', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0492/23 SDEyE se recomienda la financiación del proyecto. Además se recomienda otorgar el plazo de gracias de 12 meses por tratarse de un proyecto de inversión', 12, 'Esta empresa unipersonal tiene perspectiva de crecimiento, a través de la compra de una nueva maquinaria que le permita optimizar y aumentar su prestación de servicios.', 8, 'De acuerdo a lo descripto en el formulario presentado, esta pyme cuenta con la capacidad financiera, operativa y económica para respaldar el crédito solicitado para la compra de la nueva maquinaria.', 10, 'De acuerdo al formulario 1272 AFIP presentado, en el periodo 2022 facturó un total de $5.154.361,95. Este requisito se encuentra cumplimentado, ya que solicitó un monto de $2.570.000', 15, 'Tiene perspectiva de aumento de los ingresos a través de la expansión de los servicios prestados.', 8, 'Realiza subcontrataciones de forma eventual. Proyecta mantener esta forma de contratación.', 10, 'Por la naturaleza de la actividad, no se generan residuos tóxicos. Genera empleo local, y brinda servicios a todas las pymes agropecuarias de la zona. No presenta un abordaje especifico sobre perspectiva de genero.', 10, 'El destino del financiamiento solicitado es para bien de capital para la actividad de servicios asociado a la actividad agropecuaria. De esta forma, encuadra con los términos previstos en el punto VIII del anexo I de la Resolución 0492/23 SDEyE y normas complementarias.', 0, NULL, '2023-05-02 12:09:36', '2023-05-22 15:05:33');
INSERT INTO `evaluacion` (`id`, `proyecto`, `evaluador`, `estado`, `resultado`, `fecha`, `comentario`, `puntaje1`, `observacion1`, `puntaje2`, `observacion2`, `puntaje3`, `observacion3`, `puntaje4`, `observacion4`, `puntaje5`, `observacion5`, `puntaje6`, `observacion6`, `puntaje7`, `observacion7`, `puntaje8`, `observacion8`, `created_at`, `updated_at`) VALUES
(313, 314, 1781, 20, 82, '2023-05-08', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0492/23 SDEyE se recomienda la financiación del proyecto. Además se recomienda otorgar el plazo de gracias de 12 meses por tratarse de un proyecto de inversión.', 12, 'Esta empresa sufrió una explosión de la caldera generando destrucción total del sector en el que se encontraba. Con el aporte solicitado busca adquirir una nueva caldera que reduzca los riesgos de la nueva falla y reparar el galpón dañado.', 10, 'Cuenta con suficiente capacidad operativa, financiera y económica para hacer frente a este hecho fortuito y retomar las actividades normales de la empresa.', 10, 'La empresa cierra balance el 31 de marzo de cada año, por tal motivo aun no tiene vencido el balance 2023. Presentó el estado cerrado al 31 de marzo 2022 con una facturación de $42.119.325,33 y el formulario 1272 donde muestra que en todo el periodo 2022 tuvo facturación por $33.994.604,72.', 18, 'Con la adquisición de la nueva caldera proyectan mejorar el proceso de secado, obteniendo mayor cantidad de materia prima y resolver al antiguo cuello de botella con el que contaban. Esta mayor producción mejorara la rentabilidad de la empresa', 12, 'Actualmente cuenta con 8 fuentes laborales dependientes en el sector de producción.', 10, 'Cuentan con un proceso de reciclado de los desechos plásticos para convertirla en materia prima y utilizarla en su producción. En cuanto a la perspectiva social, genera empleo local. No presenta un abordaje especifico sobre la perspectiva de genero.', 10, 'El destino del financiamiento solicitado es para maquinaria y materiales de construcción para reparar los daños del galpon, por lo cual encuadra con los términos y condiciones previstas en la Resolución 0492/23 SDEyE y normas complementarias.', 0, NULL, '2023-05-05 19:40:54', '2023-05-15 12:38:51'),
(317, 318, 1964, 20, 85, '2023-05-23', 'Por lo antes señalado y de acuerdo a los parámetros de la Resolución N° 0492/23 SDEyE se recomienda la financiación del proyecto. Además se recomienda otorgar el plazo de gracias de 12 meses por tratarse de un proyecto de inversión y la bonificación de 2 puntos porcentuales sobre la tasa de interés por ser una empresa liderada por mujeres.', 15, 'La empresa tiene perspectiva de escalonamiento a través de una mayor producción, generar nuevos productos y exportar a Brasil, Uruguay y Paraguay.', 10, 'De acuerdo al formulario presentado y documentacion respaldatoria, la empresa cuenta con las suficientes capacidades para llevar adelante los objetivos propuestos de aumentar la producción, exportar y crear nuevos productos.', 10, 'La empresa no esta obligada a llevar Estado Contable. Para mostrar la facturación, presentaron el formulario 1272 donde muestra que en el periodo 2022 facturaron $9.263.762,01. Cumple con este requisito.', 18, 'La empresa proyecta que a partir de la adquisición de la maquina, podrán cuadruplicar su producción y realizar nuevos productos.', 10, 'Cuenta con 3 operarios en relación de dependencia.', 12, 'Los desechos generados son por las bolsas de la materia prima, las mismas son recicladas. Sobre la perspectiva de genero, se trata de una empresa liderada por mujeres dado por un 50% de la representación social y del derecho de administrar y representar la sociedad. En cuanto a la perspectiva social, genera empleo y es proveedor de comercios mayoristas y distribuidoras.', 10, 'El destino del crédito es para compra de maquinaria y gastos de traslado e instalación de la misma, por lo tanto, el destino del financiamiento solicitado encuadra con los términos y condiciones previstas en la Resolución 0492/23 SDEyE y normas complementarias.', 0, NULL, '2023-05-17 20:43:29', '2023-05-29 15:06:09'),
