INSERT INTO `noticia` (`id`, `fecha_publicacion`, `titulo`, `subtitulo`, `cuerpo`, `autor`, `imagen`, `categoria`, `active`) VALUES
(11, '2022-01-31', 'Secretaría de Desarrollo Económico y Emprendedor - Colón', NULL, 'El ministro de Producción, Turismo y Desarrollo Económico, Juan José Bahillo, junto al secretario de la Pequeña y Mediana Empresa y de los Emprendedores del Ministerio de Desarrollo Productivo de la Nación, Guille Merediz, otorgaron aportes a empresas de #SanJosé y #Colón.\r\nEn el encuentro participaron la subsecretaria de Financiamiento y Competitividad PyME, Laura Tuero, el secretario de Desarrollo Económico y Emprendedor de la provincia, Pedro Gebhart, y el intendente de Colón, José Luis Welser.', NULL, '11noticia.jpg', NULL, 1),
(12, '2022-02-01', 'Secretaría de Desarrollo Económico y Emprendedor - Té', NULL, 'La provincia acompaña un emprendimiento de elaboración de mezclas para mate de té\r\nDesde el gobierno provincial, en el marco del Programa de Asistencia Financiera Para la Consolidación Productiva, se otorgó a la empresa con sede en Gualeguaychú un crédito de dos millones de pesos, a amortizar en 24 meses, destinado a la compra de capital de trabajo.', NULL, '12noticia.jpg', NULL, 1),
(13, '2022-02-02', 'Secretaría de Desarrollo Económico y Emprendedor - Fruit', NULL, 'El Ministerio de Producción, Turismo y Desarrollo Económico de Entre Ríos, junto con el Consejo Federal de Inversiones, invitan a empresas entrerrianas del sector frutihortícola a participar de Fruit Logistica 2022 que se evará a cabo del 5 al 7 de abril en #Berlín.', NULL, '13noticia.jpg', NULL, 1),
(14, '2022-02-17', 'La provincia acompaña al sector metalúrgico de General Ramírez', 'El secretario de Desarrollo Económico y Emprendedor de la provincia, Pedro Gebhart, junto al intendente de General Ramírez, Gustavo Vergara, otorgaron un aporte financiero a una empresa unipersonal de la localidad dedicada a la fabricación de carrocería y productos de metal.', 'También participaron del encuentro el director general de Desarrollo Económico Territorial de la provincia, Oscar Bustamante, y el secretario de Gobierno, Economía y Coordinación de la Municipalidad de General Ramírez, Pablo Omarini.\r\n<br/>\r\nSe trata de un crédito a amortizar en 24 meses con 6 meses de gracia y a una tasa del 18,48 por ciento del Programa de Asistencia Financiera para la Consolidación Productiva de la Secretaría de Desarrollo Económico y Emprendedor del Ministerio de Producción, Turismo y Desarrollo Económico. El mismo se destinará a capital de trabajo para la inversión en materia prima e insumos para mejorar la calidad de sus productos.\r\n<br/>\r\nPor otro lado, la firma se suma a las 1.500 empresas asistidas por la provincia para acceder a líneas nacionales, la cual se encuentran en proceso de gestión para obtener un crédito en el marco del Programa FONDEP del Ministerio de Desarrollo Productivo de Nación.\r\n<br/>\r\nEzequiel Bauer, dueño de la empresa, explicó que: “Estamos muy agradecidos por el crédito que nos pudieron dar, ya que la idea es que la empresa siga creciendo. Nosotros estamos dentro del pueblo, y si todo sale bien, vamos a estar invirtiendo en un lote de Parque Industrial donde vamos a tener más espacio y estar más cómodos”.\r\n<br/>\r\nEn ese sentido, el secretario Pedro Gebhart expresó: “Destacamos el crecimiento de la empresa, así como el incremento del empleo en el sector metalúrgico, el cual registra un 8 por ciento más en el último año y los niveles más altos de los últimos cinco años”.\r\n<br/>\r\nAgregó finalmente el funcionario que “hoy el sector metalúrgico nuclea el 12 por ciento del empleo industrial en nuestra provincia, por lo que nos parece primordial seguir acompañando el desarrollo de las micro, pequeñas y medianas empresas en el rubro”.', 'Secretaría de Desarrollo Económico y Emprendedor', '14noticia.jpg', 1, 1),
(15, '2022-04-07', 'Stratta aseguró que trabajar con las empresas que generan trabajo genuino es prioridad', 'La vicegobernadora Laura Stratta estuvo este jueves en la localidad de San José. Allí visitó la planta avícola \"Las Camelias SA” donde compartió un encuentro de trabajo con el titular de la firma, Raúl Marsó, sus hijos y sobrinos, que son parte del Directorio.', 'Participaron además, integrantes del gabinete provincial y legisladores. La agenda también incluyó una recorrida por HODIMA, el Hogar para personas con discapacidad de esa ciudad. <p>La vicegobernadora Laura Stratta visitó este jueves la planta avícola \"Las Camelias SA” ubicada en la localidad de San José, en el departamento Colón. Acompañada por el intendente Gustavo Bastián y la viceintendenta Marisa Folonier, el senador departamental Mauricio Santa Cruz, el diputado Mariano Rebord, y del Ministerio de la Producción Pedro Gebhart secretario de Desarrollo Económico y Emprendedor, el secretario de Industria y Comercio Fernando Caviglia, y el director general de Industria, Cristian Kaheler, compartió una reunión de trabajo con el titular de la firma Raúl, Fernando, Pablo y Gimena Marsó y otros miembros del Directorio. <p>“Para nosotros el sector agrícola es una de las cadenas de valor más importantes que tiene la provincia”, dijo la vicegobernadora Stratta y resaltó que Entre Ríos es la “principal productora de carne aviar del país”, por lo que “trabajar estratégicamente con las empresas que generan trabajo genuino en nuestra provincia para nosotros es prioridad”.<p>“Por eso estamos aquí, para poder dialogar respecto hasta dónde hemos llegado y de todas las estrategias que nos hemos dado en conjunto como también los desafíos que tenemos por delante porque esos desafíos son también nuestros desafíos como provincia”, apuntó.<p>En ese sentido, expresó la relevancia de “sentar las bases para crecer y desarrollarnos en un mundo complejo, complicado, en un contexto internacional y regional que también es complejo, pero donde creemos que en la articulación público privada - como nos manda siempre el Gobernador - logramos generar respuestas que sean más integrales y sostener el trabajo, que también es nuestra gran preocupación”.<p>Sobre ese punto, Stratta hizo referencia a la misión comercial que encabeza por estos días el gobernador Gustavo Bordet en Inglaterra y Alemania en busca de nuevos mercados para productos regionales entrerrianos.<p>A continuación, consideró: “Por eso es importante que los Gobiernos dialoguen, se muevan y posibiliten condiciones para que las empresas puedan despegar y también, en el marco de su responsabilidad, generen trabajo. De eso se trata lo que nosotros hacemos y en lo que nosotros creemos”, destacó y para concluir, sobre la producción aviar, dijo: “Me parece que es una apuesta fuerte que tenemos que seguir haciendo para que se siga expandiendo y que empresas como Las Camelias pueda seguir afianzándose y dando trabajo”.<p>Por su parte, en nombre de la empresa Las Camelias SA Raúl Marsó, tras trazar un panorama de cómo se encuentra la producción avícola con escenarios dispares dentro del mismo sector, señaló que en lo que respecta a su firma están “funcionando bien” y si bien planteó que siempre se encuentran dificultades, afirmó: “El tema es tener gente que te ayude a solucionarlo y eso es lo que busca mi empresa. Y eso es lo que busco también en la relación que tengo con los Gobiernos que nos tocan y que tenemos”.<p>“Nosotros somos responsables de transmitirle al Gobierno los problemas y las cosas que nos van bien porque es la única forma de que esta famosa relación público- privado funcione, sino esto no va”, consideró para manifestar luego: “Estamos muy contentos de que nos venga a visitarla la Vicegobernadora y poder conversar de estos temas”.<p>Sobre Las Camelias<p>Los orígenes de Las Camelias se remontan al año 1936, año en que comenzaron con la crianza de aves de forma intensiva, siendo actualmente una empresa conducida por integrantes de la tercera generación de la familia fundadora.<p>Su actividad se centra en la producción de carne aviar, ya sea como pollo entero, diferentes cortes trozados, gallinas, menudencias y subproductos como harinas de pluma, sangre, vísceras y aceite de pollo. Realiza una faena en planta del orden de 1.000.000 de aves semanalmente, el 65% de la producción se destina al mercado interno (7.200 toneladas) y el 35% restante (3.800 toneladas) se exporta a diferentes destinos.<p>Cabe destacar que dentro de las distintas líneas de acompañamiento dirigidas a los sectores productivos de la provincia, Las Camelias ha resultado beneficiaria de líneas de crédito a tasa subsidiada, tanto provincial como nacional.<p>Visita al Hogar Hodima<p>Como parte de la agenda desplegada en San José, la vicegobernadora estuvo en el Hogar para Discapacitados Mentales HODIMA. Allí fue recibida por la presidenta y la vice de la comisión directiva de la Asociación Civil que administra la institución, Sara Deladoie y María Cristina Delaloye, respectivamente.<p>Con ellas recorrió el lugar, dialogó con el personal que allí se desempeña, a la vez que fue interiorizada sobre su funcionamiento y la necesidad de la construcción de un nuevo sector para el edificio.<p>“Este es un centro que hemos acompañado desde el Gobierno de Entre Ríos, porque las instituciones y las organizaciones de la sociedad civil cumplen un rol central y una función social que para nosotros es muy importante y desde el Estado creemos que tenemos que acompañar”, indicó Stratta al respecto. “Tiene que ver con tener instituciones sólidas, fuertes, con trabajar ejes temáticos que son importantes como la discapacidad, las políticas de cuidado son una prioridad también en la agenda pública”, agregó.<p>Acompañaron a Stratta en esta recorrida, la directora del Instituto Provincial de Discapacidad (Iprodi), Inés Artusi y la directora general de Subsidios, Agustina Camino.<p>(Prensa Vicegobernación)', 'Vicegobernación', '15noticia.jpg', 1, 1),
(16, '2022-04-13', 'Stratta participó del lanzamiento del programa Jóvenes Emprendedores Convocatoria 2022', 'La vicegobernadora Laura Stratta, con el ministro de Producción, Turismo y Desarrollo Económico, Juan José Bahillo, y el secretario de Desarrollo Económico y Emprendedor, Pedro Gebhart, lanzaron la convocatoria 2022 del programa Jóvenes Emprendedores.', 'Lo hicieron junto a los emprendedores del Laboratorio de AGTeam </p>En el marco del lanzamiento del Programa Jóvenes Emprendedores- Convocatoria 2022, Stratta, Bahillo y Gebhart visitaron este martes el Laboratorio de AGTeam, ubicado en Oro Verde.</p>En la oportunidad, recorrieron las instalaciones y dialogaron con el bioingeniero Ismael Cassi y el oftalmólogo Diego Ramirez Arduh. Ellos forman parte del equipo emprendedor multidisciplinario, especializado en ingeniería biomédica, prototipado, desarrollo de dispositivos y software médicos. Allí, y a partir de la experiencia comentada por los emprendedores, se concretó una nueva convocatoria del Programa Jóvenes Emprendedores 2022.</p>“Hoy estamos acá para conocer más sobre la marcha de proyectos que desde el Gobierno de Entre Ríos acompañamos”, expresó la vicegobernadora Laura Stratta.</p>En este sentido, valoró “el crecimiento y el desarrollo del emprendimiento que impulsan estos dos jóvenes profesionales que potenciando sus saberes: la medicina y la bioingeniería, al servicio del bien común”, dijo Stratta recordando que el objetivo del proyecto de los emprendedores es brindar atención primaria oftalmológica a poblaciones en situación de vulnerabilidad y de escasos recursos.</p>Seguidamente, la vicegobernadora se mostró orgullosa por este proyecto y ratificó el compromiso de “seguir promoviendo la cultura emprendedora, construyendo un Estado presente que acompaña los desafíos de las y los que emprenden en nuestra provincia”.</p>Laboratorio de AGTeam</p>El Laboratorio de Prototipado de AGTeam está especializado en ingeniería biomédica, prototipado, desarrollo de dispositivos y software médicos. Su hardware y software, permiten al médico adquirir imágenes de calidad para su utilización en telemedicina y posterior procesamiento de datos epidemiológicos. Lo que se destaca en su tecnología es su portabilidad; su conexión a teléfonos inteligentes y la posibilidad de vincularlo con los sistemas de telemedicina.</p>Diego Ramirez Arduh, socio fundador de AGTeam, explicó: “Nosotros producimos aparatología para el diagnóstico de enfermedades oftalmológicas a distancia, es decir, portátil”.</p>Contó que en el 2021 fueron adjudicatarios de un crédito otorgado por la Secretaria de Desarrollo Económico y Emprendedor para comprar máquinas 3D e insumos para equipamiento óptico. “Nos sirvió para arrancar a comparar materiales y la aparatología para empezar la producción de nuestro proyecto”, dijo el oftalmólogo.\r\nY agregó: “Es muy importante el acompañamiento del Estado porque a través de estos programas se genera producción y empleo genuino”.</p>Por su parte, Ismael Cassi, bioingeniero y parte del grupo de AGTeam, emprendedores dedicados a la tecnología médica. Destacó las oportunidades que genera el Gobierno de la Provincia para las y los emprendedores. “Hay que animarse a desarrollar las ideas, hay que aprovechar todos los beneficios que tiene la provincia. Nosotros lo hicimos y estamos avanzando”, expresó el profesional</p>Programa Jóvenes Emprendedores</p>El Programa Jóvenes Emprendedores asesora, capacita y financia a emprendimientos en marcha de jóvenes residentes en Entre Ríos, con ideas de emprendimientos innovadores, sustentables y con potencial para crecer. Es una de las herramientas integrales que constituyen el Régimen de Promoción para el Emprendedorismo Joven Entrerriano, creado por la ley provincial 10.394.</p>Registrate para acceder a los distintos programas vigentes, noticias, instancias de capacitación y contacto con el equipo técnico de Jóvenes Emprendedores.</p>Requisitos 2022</p>* Tener entre dieciocho (18) y cuarenta (40) años de edad.</p>* Detentar domicilio real en la Provincia de Entre Ríos.</p>* Realizar actividades vinculadas a la producción industrial y TICs, agropecuarios o de servicios. asociados a estos sectores</p>(Prensa Vicegobernación)', 'Vicegobernación', '16noticia.jpg', 1, 1),
(17, '2022-04-15', 'El gobierno provincial acompaña a pymes en su primera exportación', 'En el marco del Programa de Asistencia Técnica para el Fortalecimiento MiPyME del Ministerio de Producción, Turismo y Desarrollo Económico, la empresa Máquinas Cerveza & Lata recibió asistencia técnica para la elaboración de su plan de exportación y la promoción internacional de sus productos.', 'A comienzos de abril lograron concretar su primera exportación a La Paz, Bolivia.<p>El secretario de Desarrollo Económico y Emprendedor, Pedro Gebhart, y el director general de Comercio Exterior, Juan Mansur, visitaron la firma, dedicada a la fabricación de máquinas envasadoras y enlatadoras de bebidas gasificadas. Gebhart explicó: “Nos pone muy contentos que esta empresa, que a fines de 2021 se incorporó a nuestro programa a través del cual se le brindó asesoría técnica profesional en Comercio Exterior, haya podido concretar su primera exportación con destino La Paz, Bolivia. Afortunadamente, seguimos trabajando en conjunto en la promoción internacional de sus productos mediante diagnóstico y estudios de mercado, y del mejoramiento del plan de exportación”.<p>“Venimos acompañando a empresas entrerrianas en su proceso de expansión e inserción internacional a través de capacitación, asistencia técnica y financiamiento. Desde el Ministerio contamos con diversos programas para impulsar el crecimiento de las MiPyMEs y el desarrollo productivo de la provincia”, añadió el secretario.<p>Por su parte, Claudio Almeida, socio titular de la firma, valoró “el apoyo constante de técnicos asistiéndonos” y señaló que “siendo una empresa muy joven, que la provincia nos apoye es fundamental; sin ese constante apoyo no podemos crecer”. “Las herramientas tienen que venir del Estado como están viniendo y nos están llevando a buen puerto”, manifestó.<p>Sobre el Programa<p>El Programa de Asistencia Técnica para el Fortalecimiento MiPyME (ATF MiPyME) apunta a contribuir al incremento de la productividad, competitividad e internacionalización de las MiPyMEs entrerrianas, mediante tres componentes: capacitaciones; asesoramiento técnico a cargo de profesionales de probada trayectoria y competencia en diversas áreas temáticas; y financiamiento a proyectos de asistencia integral a través de Aportes No Reembolsables de hasta 400.000 pesos destinados a fortalecimiento técnico, formación y mejoramiento de procesos de la empresa.<p>Para más información ingresar a: https://www.entrerios.gov.ar/economicoemprendedor/patecnica', 'Ministerio de Producción', NULL, 1, 1),
(18, '2022-04-19', 'Se encuentra abierta la preinscripción al programa Jóvenes Emprendedores', 'El Ministerio de Producción, Turismo y Desarrollo Económico de la provincia abrió la convocatoria 2022 para que jóvenes emprendedores entrerrianos que estén interesados en obtener financiamiento puedan registrarse en el programa.', 'El mismo apunta a emprendimientos en marcha vinculados a la producción industrial, agropecuaria, de TICs, o de servicios asociados a dichos sectores.<p>El Programa Jóvenes Emprendedores de la Secretaría de Desarrollo Económico y Emprendedor del Ministerio de Producción, Turismo y Desarrollo Económico asesora, capacita y financia a emprendimientos en marcha de jóvenes residentes en Entre Ríos, con propuestas innovadoras, sustentables y con potencial para crecer. Es una de las herramientas del Régimen de Promoción de Emprendedurismo Joven y MiPyMEs.<p>El crédito Jóvenes Emprendedores no tiene tasa de interés ni necesidad de garantía, y otorga un año de gracia para comenzar con la devolución del mismo a partir de su entrega. En el segundo año se plantea un esquema de devolución consistente en 24 cuotas mensuales consecutivas, con la posibilidad de dar una prórroga en caso de que el emprendimiento no dé los resultados esperados.<p>Requisitos de la edición 2022:<p>- Tener entre 18 y 40 años de edad.<p>- Detentar domicilio real en la provincia de Entre Ríos.<p>- Realizar actividades vinculadas a la producción industrial, agropecuaria, TICs, o de servicios asociados a estos sectores.<p>La inscripción se realiza mediante la página web: http://www.entrerios.gov.ar/desarrolloemprendedor/frontend/programa_jovenes.php', 'Ministerio de Producción', '18noticia.jpg', 1, 1),
(19, '2022-04-26', 'Invitan a empresas a participar de capacitación en exportación de servicios', 'La misma se realizará el día jueves 28 de abril en la ciudad de Paraná y está dirigida a pymes y profesionales independientes relacionados con el sector del software.', 'La actividad es organizada por el Ministerio de Producción, Turismo y Desarrollo Económico de la provincia, el Ministerio de Relaciones Exteriores, Comercio Internacional y Culto de la Nación, la Agencia Argentina de Inversiones y Comercio Internacional, y el Polo Tecnológico de Paraná.<p>Se llevará a cabo en la Facultad de Ciencias Económicas de la Universidad Nacional de Entre Ríos (Urquiza 552), en el horario de 10:00 a 12:00. Para participar se requiere inscripción previa dado que existen cupos limitados.<p>Entre los temas que se abordarán se encuentran:<p>- Panorama actual del comercio exterior.<p>- Modalidades de exportación.<p>- Exportación de servicios profesionales y aspectos que intervienen.<p>- Criterios sobre exportación de servicios.<p>- Exportación de intangibles.<p>- Quién exporta y cómo se comercializan los servicios. Las cuatro modalidades de exportación de servicios según la OMC.<p>- Argentina exportadora de servicios y propiedad intelectual.<p>- Normativas relacionadas con el comercio de servicios.<p>- Barreras al comercio exterior y convenios que evitan la doble imposición.<p>Para más información comunicarse con la Dirección General de Comercio Exterior del Gobierno de Entre Ríos (exportaciones.entrerios@gmail.com).', 'Ministerio de Producción', '19noticia.jpg', 1, 1),
(20, '2022-04-13', 'Emprendedores y emprendedoras mantuvieron un encuentro con Peirano y Stratta', 'La vicegobernadora Laura Stratta participó del encuentro Desafíos de las empresas, MiPyMEs y emprendimientos de TICs en el contexto de recuperación económica, y estuvo con emprendedores, referentes de MiPyMEs y titulares de instituciones vinculadas a la ciencia y la tecnología de varias localidades.', 'Fue en el encuentroque se realizó este martes en el Centro Provincial de Convenciones, y que contó con la presencia del titular de la ‎Agencia I+D+i, Fernando Peirano; la diputada nacional Carolina Gaillard; el ministro de Producción, Juan José Bahillo y el secretario de Desarrollo Económico y Emprendedor, Pedro Gebhart, entre otras autoridades.<p>La vicegobernadora Laura Stratta participó del encuentro “Desafíos de las empresas, MiPyMEs y emprendimientos de TICs en el contexto de recuperación económica”. La actividad se realizó este martes por la tarde en el Centro Provincial de Convenciones (CPC) de Paraná, junto a emprendedores, MiPyMEs y titulares de instituciones vinculadas a la ciencia y la tecnología, de distintas localidades de la provincia.<p>La reunión contó con la presencia de Fernando Peirano, presidente de la Agencia Nacional de Promoción de la Investigación, el Desarrollo Tecnológico y la Innovación (Agencia Nacional I+D+i); la diputada nacional Carolina Gaillard; el ministro de Producción, Turismo y Desarrollo Económico, Juan José Bahillo y el secretario de Desarrollo Económico y Emprendedor, Pedro Gebhart.<p>Estado presente y activo\r\nLa vicegobernadora Laura Stratta destacó la importancia de generar este espacio de encuentro y de diálogo “porque para quienes creemos que la política repara y transforma, también creemos que la política tiene que escuchar”, resaltó tras valorar el trabajo articulado entre Nación y Provincia.<p>Stratta se mostró “orgullosa” por las y los emprendedores que tiene la provincia de Entre Ríos, quienes “trabajan con una gran responsabilidad social, mirada solidaria y en cooperación, que ponen sus conocimientos al servicio del desarrollo social y humano, generando empleo y dando impulso a nuestras cadenas de valor”.<p>En otro tramo de su discurso, habló de la necesidad de invertir en educación. “Siempre decimos que la educación es la obra más importante para la provincia de Entre Ríos y esto tiene que ver con una apuesta muy fuerte que hacemos desde el Gobierno nacional y provincial”, expresó Stratta al tiempo que consideró: “Fomentar el emprendedurismo también lo venimos sosteniendo desde hace varios años porque nos parece central para el diseño de las políticas públicas, para pensar una provincia que crezca y desarrolle con bases sólidas”.<p>Seguidamente, consideró que “es central trabajar en el eje Nación, Provincia y Municipio, pero también en articulación con los sectores público y privado que nos permitan dar respuestas integrales a las grandes demandas que nos plantea la sociedad”. Y agregó: “Tenemos un Estado presente, promotor y activo, que pone la cara, el cuerpo y resuelve. Esta reconstrucción del Estado, tiene que ver con la decisión política de nuestro presidente Alberto Fernández y nuestro gobernador Gustavo Bordet. Es por eso que hoy estamos acá para emprender juntos una provincia con más oportunidades para todas y todos”, concluyó.<p>Las ideas son las protagonistas<p>Por su parte, el titular de la ‎Agencia I+D+i, Fernando Peirano, habló del contexto actual y las políticas de acompañamiento. “Recorremos el país entendiendo la federalización como la identificación de buenos proyectos con buenos métodos e instrumentos dignos y necesarios de ser nacionalizados”, dijo el funcionario nacional.<p>“Ideas, métodos, alianzas, la relación público -privada hoy en una economía donde lo intangible gana peso, las ideas tienen protagonismo, la innovación es un motor, y la forma de trabajo se está modificando, por eso vengo entusiasmado para escucharlos”, expresó el presidente del organismo promotor de la investigación, el conocimiento y la innovación, dependiente del Ministerio de Ciencia, Tecnología e Innovación.<p>Gestión participativa<p>En tanto, el ministro de Producción de la Provincia, Juan José Bahillo, recordó: “El objetivo central del encuentro es escuchar a los emprendedores, es marcar una vez más una consigna que el gobernador nos reitera a diario: llevar adelante una gestión participativa, cercana a la gente y con un oído puesto a todos los sectores productivos de la provincia”, dijo tras subrayar: “Queremos escuchar desde las experiencias personales hasta las necesidades para el crecimiento y desarrollo de sus emprendimientos, los desafíos que tienen y cuál es la agenda que les gustaría tener con el Gobierno, porque escucharlos nos permite ser más certeros y eficaces a la hora de definir políticas y acciones concretas”, manifestó Bahillo.<p>Durante la reunión, se abrió el micrófono a las y los emprendedores, MiPyMEs y titulares de instituciones, quienes contaron sus proyectos, iniciativas y desafíos presentes y futuros.<p>Acompañamiento<p>A su turno, la diputada Carolina Gaillard expresó: “Es un orgullo escuchar a cada uno de los emprendimientos con una historia y una idea detrás. Quiero decirles que hay un Estado presente para acompañarlos, con la escucha atenta para atender las necesidades y dificultades que se presenten”.<p>En este sentido, la Legisladora nacional dijo que tanto al Presidente como al Gobernador “les interesa generar valor agregado a nuestra producción por eso cada uno de sus proyectos son valiosísimos”. Y añadió: “Somos nosotros quienes tenemos que acompañarlos, acá estamos para dar respuestas”.<p>Presencias<p>Del encuentro participaron además, el secretario de Industria y Comercio, Fernando Caviglia; el director General de Desarrollo Económico Territorial, Oscar Bustamante; el director General de Desarrollo Emprendedor, Claudio Rosas Vico; y el director General de Comercio Exterior de la Provincia, Juan Mansur.<p>En este espacio de diálogo también estuvieron presentes emprendedores, MiPyMEs y titulares de instituciones vinculadas a la ciencia y la tecnología, laboratorio farmacéutico, software y medicina, entre otros, de distintas localidades de la provincia.<p>(Prensa Vicegobernación)', 'Vicegobernación', '20noticia.jpg', 1, 1),
(21, '2022-05-03', 'Stratta y Tolosa Paz compartieron un diálogo con empresarios entrerrianos', 'Stratta y Tolosa Paz compartieron un diálogo con empresarios entrerrianos', 'Entre otros, también formó parte del encuentro la subsecretaria de Financiamiento y Competitividad PyME, Laura Tuero. Antes, hicieron entrega de un crédito de Fondep por 15 millones de pesos a la firma Nogolac.<p>La vicegobernadora Laura Stratta, junto a la diputada nacional Victoria Tolosa Paz; la subsecretaria de Financiamiento y Competitividad PyME del Ministerio de Desarrollo Productivo de la Nación, Laura Tuero; el secretario de Desarrollo Económico y Emprendedor del Ministerio de Producción de Entre Ríos, Pedro Gebhart; la senadora provincial Flavia Maidana; el intendente de Nogoyá, Rafael Cavagna y su par de Hernández Luis Gaioli, mantuvieron un encuentro este martes en Nogoyá con empresarios de distintos rubros de la provincia, en el Centro de Empleados de Comercio de la localidad.<p>Allí se expuso sobre las políticas nacionales vigentes para acompañar el sector, las líneas de crédito disponibles entre las que se destaca el desempeño del Fondo de Desarrollo Productivo (Fondep), a la vez que se recibieron propuestas y proyectos de las y los referentes empresarios presentes.<p>“Esta visita tiene que ver con cumplir con la palabra empeñada, y no solamente significa venir a ver los desafíos que tienen por delante los empresarios sino a hacer un nuevo compromiso para que puedan crecer y desarrollarse”, destacó la vicegobernadora Laura Stratta y agradeció la presencia de la diputada nacional Victoria Tolosa Paz y de la subsecretaria Laura Tuero en Nogoyá.<p>“Cuando las empresas crecen y se desarrollan, también crece y se desarrolla nuestra provincia. Esa es la premisa que nos ha dado el gobernador”, subrayó Stratta al tiempo que acotó: “Yo siempre digo que para que la política pueda transformar primero tiene que escuchar, por eso hoy estamos aquí”.<p>En esa línea, mencionó a la senadora provincial Maidana “que siempre está gestionando para su zona” y agradeció a los empresarios “por apostar a este país, al trabajo, por apostar a crecer y por creer en la articulación público privada que es tan importante. Yo hablaba de círculo virtuoso y de eso se trata lo que hacemos pero sobre todo en lo que creemos”, acentuó la también presidenta del Senado entrerriano.<p>Por su parte, el intendente Rafael Cavagna agradeció a la vicegobernadora Stratta, a la diputada nacional Tolosa Paz y funcionarios, la visita a la ciudad de Nogoyá, destacando el trabajo articulado entre Nación, provincia y municipio. Luego, invitó a los presentes a la Expo Provincial de la Leche, a realizarse del 6 al 8 de mayo próximo en el predio de la Sociedad Rural.<p>Del encuentro participaron alrededor de 25 empresarios entrerrianos de distintos sectores productivos, entre ellos, tamberos y metalúrgicos.<p>Impulso a la cadena láctea<p>Previo a la reunión con empresarias y empresarios entrerrianos, Stratta, Tolosa Paz y Tuero recorrieron la planta de Nogolac SA. Allí fueron recibidos por Patricio y Ricardo Ward, socios gerentes de la empresa, a quienes se les hizo entrega de un crédito de Fondep por 15 millones de pesos, destinado a la ampliación y automatización productiva.<p>Cabe destacar que esta firma procesa 10 millones de litros de leche por año que se transforma en una completa línea de productos de distintas variedades que pueden adquirirse en seis provincias argentinas.<p>“Estoy muy contenta de estar recorriendo una industria de esta ciudad en el marco de una cuenca lechera como es esta zona de Nogoyá, acompañando a las industrias como hace el gobierno nacional y el provincial”, dijo al respecto Stratta quien expresó que la visita de Tolosa Paz y Tuero responde a “un compromiso que hizo Victoria Tolosa Paz hace un tiempo y que materializó el Ministerio de Desarrollo Económico de la Nación por disposición del Presidente de la Nación” en referencia al crédito que recibió la firma.<p>Una Argentina con más oportunidades<p>Por su parte, Tolosa Paz aseveró que uno de los ejes centrales del gobierno nacional que encabeza el presidente Alberto Fernández, “es crear una Argentina con oportunidades y trabajo en cada rincón de la Patria. Y hoy estamos aquí en Nogolac, en Nogoyá, mostrando que hay una Argentina posible que se expresa a partir de las Pymes”. Y recordó: “Pymes que pasaron años bravos donde no había demanda interna, donde no había tasas subsidiadas, no había ministerios que pusieran en manifiesto la voluntad de crecer y acompañar el proceso productivo”.<p>Seguidamente, la diputada nacional contó que hace dos años, de visita en Paraná, escuchó la demanda de un empresario que le solicitaba al Estado el acompañamiento de una línea de crédito por 15 millones de pesos para comprar materia prima con capacidad instalada, es decir, capital de trabajo, maquinarias y ampliación de estas instalaciones. “Hoy podemos caminar aquí y hacemos entrega de estos certificados que ya ocurrió, esos 15 millones de pesos que es el compromiso de una pyme que toma una línea de crédito con una tasa subsidiada y un Estado que sigue mirando el proceso productivo pero cómo esta pyme va ampliar su matriz y diversificar todos sus productos”, dijo Tolosa Paz. Y continuó: “Con el acompañamiento del Estado, están trabajando junto al ministro Matias Kulfas en lo que se llama un aporte no reembolsable para que Nogolac siga creciendo. Queremos apuntalar este modelo productivo desde la Provincia con Gustavo Bordet y desde la Nación con el presidente Alberto Fernández, queremos una Argentina que crece, se desarrolla y se generan inversiones con un rol muy activo del Estado”.<p>Cadena láctea<p>La cadena láctea entrerriana se ubica en el cuarto lugar respecto al volumen de producción de leche en nuestro país, significando el 3.7 por ciento de la producción nacional. Conforma uno de los complejos agroalimentarios más importantes y dinámicos dentro de la economía entrerriana, siendo considerada como una de las principales cadenas por su distribución territorial y generación de empleo, lo que la constituye en un motor fundamental como economía regional, en la que conviven grandes, medianas y pequeñas empresas de producción primaria e industrial. En Entre Ríos se localizan 471 tambos con pequeñas superficies y rodeos reducidos, 399 de ellos se ubican en la cuenca oeste, sobre el río Paraná. Nuestra provincia se destaca también por la particularidad de que los propietarios de los tambos suelen tener la propiedad de la tierra, y por contar con mano de obra familiar.<p>Otras presencias<p>Participaron de las actividades también el asesor de la Subsecretaría de Financiamiento y Competitividad de la Nación PyME del Ministerio de Desarrollo Productivo de la Nación, Sebastián Cernadas; el intendente de Hernández Luis Gaioli, el dirigente de Nogoyá, César Márquez.<p>(Prensa Vicegobernación)', 'vicegoberanción', '21noticia.jpg', 1, 1),
(22, '2022-05-04', 'El gobierno acompaña el desarrollo de empresas entrerrianas', '\"Estar aquí significa reafirmar un modelo de producción y de desarrollo, muy lejos de aquellos especulativos de capitales financieros”, dijo el gobernador Gustavo Bordet al visitar, junto a la diputada nacional Victoria Tolosa Paz, una empresa que recibió un aporte para incrementar su producción.', 'Ejemplar S.A., que funciona en el Parque Industrial de Paraná y se dedica a la elaboración de algodón de alta calidad y pureza, recibió este miércoles un aporte nacional no reembolsable por 40 millones de pesos para la transformación y ampliación productiva, durante la visita realizada por el gobernador Gustavo Bordet, junto a la vicegobernadora Laura Stratta; el intendente de Paraná, Adán Bahl; y la diputada nacional Tolosa Paz que integra la Comisión de Industria de esa Cámara.\r\n<p>\"El aporte que se hace con el gobierno nacional y el trabajo articulado con la provincia posibilita que, como en este caso, también se llegue a otras industrias y empresas entrerrianas para que tengan oportunidades de incrementar su capital de trabajo y puedan lograr mayor producción y más venta. Eso redunda en generación de empleo sostenible que es lo que se está buscando generar desde Entre Ríos\", remarcó el mandatario durante la visita a la planta fabril.\r\n<p>Por su parte, la diputada nacional Victoria Tolosa Paz consideró que “Ejemplar es el ejemplo más claro de la política que lleva adelante el gobierno nacional con el acompañamiento del gobernador Bordet. Un gobernador que piensa a la Entre Ríos ampliando su matriz productiva y generando las condiciones para que cada entrerriano tenga trabajo. Ese es el proyecto político que encarnan Bordet y el presidente de la Nación”.<p>La gerente general de la empresa, Carolina Ribetti; el gerente de Producción, José Ribetti, y la asesora legal responsable de Recursos Humanos, Gabriela Romero Cepelli, fueron los encargados de recibir a las autoridades que se hicieron presentes para entregar el aporte en el marco del Programa de Desarrollo Productivo PyME. El proyecto presentado por Ejemplar S.A. para recibir esta ayuda se centró en aumentar la capacidad productiva, la eficiencia y diversificar la oferta de productos ciento por ciento nacionales para el mercado interno y de exportación en el rubro algodonero.<p>Durante la actividad, en la que también participaron el ministro de Producción, Juan José Bahillo; la subsecretaria de Financiamiento y Competitividad PYME de Nación, Laura Tuero; y el asesor de esa repartición, Sebastián Cernadas, entre otras autoridades, el gobernador Gustavo Bordet recordó que la firma Ejemplar tomó hace 11 años esta planta que estuvo desocupada por quiebra y recuperó sus niveles de empleo.<p>El gobernador se refirió al aporte entregado en la oportunidad y mencionó que meses atrás hubo una reunión en el Parque Industrial de Paraná en la que se analizaron distintos aspectos con el intendente Adán Bahl, donde la firma Ejemplar planteó la necesidad de aprobación de un aporte no reembolsable presentado en el Ministerio de Producción. En ese sentido, Bordet comentó que se puso en contacto con el Ministerio de Producción y \"de manera muy efectiva y con celeridad se consiguió el aporte de 40 millones de pesos para esta firma que trabaja en el Parque Industrial de Paraná y que genera puestos de trabajo genuinos, gran parte de ellos de mujeres”.<p>Explicó que con ello también se logra avanzar en una línea de producción que no es típica de la provincia como el algodón, pero que completa toda la cadena desde la cosecha en Santiago del Estero hasta la elaboración final en la planta de la capital entrerriana.<p>\"Estar en la planta hoy nos da la posibilidad de entender y conocer el funcionamiento de una cadena de valor que a veces, cuando se gestiona y se entrega un Aporte No Reembolsable, no se ve lo que hay detrás. Y detrás hay personas, directivos de la empresa que trabajan, trabajadores y trabajadoras, y hay un mecanismo que genera una redinamización de la economía porque se conecta con otras industrias y esto multiplica el valor agregado que se genera\", detalló el mandatario.<p>Y remarcó: \"Estar hoy aquí significa reafirmar un modelo de producción y de desarrollo muy lejos de aquellos especulativos de capitales financieros. Aquí está la producción, el trabajo, las empresas que apuestan para genera más desarrollo local y nacional y más empleo. Por eso la importancia de estar hoy aquí e ir pensando cómo en el futuro generamos otras oportunidades para las y los entrerrianos\".<p>En relación al aporte, Bordet explicó que \"son proyectos que se presentan, fundamentalmente para incorporar capital de trabajo, es decir, maquinarias que puedan generar mayor productividad, además de posibilitar la compra de maquinaria local, con lo cual también se beneficia a otras empresas que producen y empujan a la cadena. Luego hay una evaluación y luego se efectiviza”, expresó y completó: “En Entre Ríos hay mucho más ejemplos que se vienen aplicando porque hay una política decidida del Ministerio de Producción de la Nación, impulsada por el presidente Alberto Fernández, en generar este tipo de modelo de desarrollo\".<p>Desarrollo e inclusión<p>Tolosa Paz comentó que se encuentra en Entre Ríos desde ayer donde visitó la firma láctea Nogolac, de Nogoyá, la que recibió un crédito a tasa subsidiada, “en apoyatura con lo que ya viene haciendo el gobierno de la provincia\".<p>Destacó que desde el Parlamento nacional y como parte de la Comisión de Industria, llevan adelante “una agenda muy potente y leyes muy importantes”, como la Ley del Consejo Agrobioindustrial “que pregona un modelo productivo con desarrollo e inclusión que es el que soñamos para Entre Ríos y para toda la Argentina\".<p>“Entendemos que tecnificando y dando ese capital de trabajo se puede dar un proceso más eficiente”, dijo la legisladora nacional y consideró que la firma Ejemplar podrá llegar muy lejos si recibe este aporte no reembolsable del Estado nacional. “Juntar 40 millones de pesos para un destino que es diversificar la matriz, permitirá aumentar el consumo interno de este producto y al mismo tiempo la exportación tan necesaria”.<p>Opinó que esto le dará a Entre Ríos “no solamente la posibilidad de garantizar el consumo interno y generar puestos de trabajo, sino de exportar estos productos para llenar de reservas y divisas que vuelvan a traccionar lo que necesitamos para que la Argentina crezca”.<p>“Creo que Ejemplar es el ejemplo más claro de la política que lleva adelante el gobierno nacional con el acompañamiento del gobernador Bordet. Un gobernador que piensa a la Entre Ríos ampliando su matriz productiva y generando las condiciones para que cada entrerriano tenga trabajo. Ese es el proyecto político que encarnan Bordet y el presidente de la Nación”, subrayó.<p>Acompañamiento del municipio<p>En tanto, Adán Bahl afirmó que “la industria es clave en nuestro proyecto productivo de ciudad capital. Por eso acompañamos a los que producen, a los apuestan por la ciudad y eligen seguir creciendo en Paraná; a los que crean fuentes de trabajo y generan oportunidades para los paranaenses que quieren progresar, como esta empresa con más de 20 años de trayectoria y una visión hacia delante”.<p>“Por esto estamos invirtiendo en el Parque Industrial, mejorando la infraestructura”, continuó diciendo el intendente paranaense, al tiempo que indicó que “vemos que ese también es el proyecto del gobierno nacional y provincial. Muchas de las obras que hoy estamos haciendo a favor del desarrollo productivo, muchas de las herramientas que nuestros productores usan para seguir creciendo, se deben al trabajo conjunto con el Presidente y su equipo, con el gobernador y sus ministros”.<p>“Gracias por apoyar a los que producen y ayudarnos a construir una Paraná capital con trabajo y desarrollo”, concluyó.<p>Destino del aporte<p>Por su parte, el gerente de producción de Ejemplar, José Ribetti, dijo que \"este aporte que estamos recibiendo nos pone muy contentos y nos moviliza mucho. Es la primera vez que vamos a poder importar una maquinaria, lo que nos va a permitir tener un nuevo producto y vamos a poder atender pedidos. Por ejemplo, en Argentina se comercializa el algodón en zig zag, y es uno de los pocos países en que se hace así. Internacionalmante se lo comercializa en rollo o en pompones y con este aporte lo que vamos hacer es importar maquinaria italiana para poder fabricar algodón de ese modo para poder salir a mercados que hoy no podemos estar abasteciendo y tenemos pedidos para poder llegar\".<p>\"Así que estamos muy contentos con este desembolso y vamos a ponernos a trabajar para girar a Italia, encargar las máquinas, y va a llevar seis u ocho meses que las fabriquen para nosotros”, explicó.<p>Y agregó: “Estamos emocionados por esto, porque nosotros venimos de una familia donde siempre hemos acondicionado maquinarias usadas, trabajando y creciendo, apostando y haciendo inversiones propias; y eso demanda más tiempo. Ahora tenemos un proyecto de ampliación de duplicar la producción, así que este es el camino”.<p>“Con esto recibimos un empujón más que significativo y vamos a aprovecharlo para poder cumplir este objetivo que nos planteamos para seguir creciendo”, finalizó.<p>La empresa<p>Ejemplar S.A. cuenta con 20 años de experiencia en la elaboración de algodón de alta calidad y pureza. En la elaboración de sus productos se utiliza un 100 por ciento de fibra natural.<p>Con el objeto de preservar el medio ambiente, la compañía desarrolló un cuidado e innovador proceso de blanqueado sin la utilización de cloro o blanqueadores ópticos. Ello da como resultado productos de alta calidad y pureza, que renuevan y profundizan en forma constante el compromiso de la empresa con la sociedad.<p>Ejemplar S.A. cuenta con una planta de elaboración de algodón hidrófilo de calidad superior diferenciada, obtenido a partir de fibra 100 por ciento natural con procesos libres de cloro o derivados. También cuenta con dos plantas de desmotado de algodón en bruto.', 'gobernación', '22noticia.jpg', 1, 1),
(23, '2022-05-11', 'Stratta dijo que “acompañamos a jóvenes emprendedores para que sigan creciendo y concretando nuevos desafíos”', 'La vicegobernadora Laura Stratta, junto al secretario de Desarrollo Económico y Emprendedor del Ministerio de Producción, Pedro Gebhart, visitaron este miércoles “La Picada Hnos SRL”, una empresa familiar a la cual le hicieron entrega de un crédito para la Consolidación Productiva.', 'La vicegobernadora Laura Stratta, junto al secretario de Desarrollo Económico y Emprendedor del Ministerio de Producción, Pedro Gebhart, estuvieron esta mañana en La Picada Hnos. SRL, una empresa familiar entrerriana, ubicada en la localidad La Picada, en el departamento Paraná, poseedora de un corralón y ferretería a la que sumó la fabricación de premoldeados.<br><br>Allí, con la socia gerenta Valeria Ocaranza, su esposo Luis María Carletti, junto a Lucas Carletti y su esposa Mariángeles, recorrieron las instalaciones de la firma y se interiorizaron sobre la historia de la familia y el desarrollo del negocio que empezó siendo de transporte y luego fue diversificándose hasta llegar hasta el día de hoy, brindándole empleo a 13 familias de la zona. A esta empresa, el Gobierno provincial le otorgó un crédito de dos millones de pesos del Programa de Asistencia Financiera para la Consolidación Productiva, destinado a la adquisición de moldes para hacer premoldeados.<br><br><br><br><strong>En territorio</strong><br><br>“En este país heredamos la cultura del trabajo de nuestros padres y abuelos, y ustedes tienen una visión de empresa que también habla de la responsabilidad social y de la importancia de cuidar el trabajo”, dijo Stratta a los jóvenes emprendedores.<br><br>\"No hay que olvidarse de dónde venimos, tampoco hay que desatender el deseo de crecer que moviliza a las personas. Hay un Estado que hace las cosas bien y a la vez acompaña, esto se puede materializar en estas experiencias de vida”, expresó Stratta tras resaltar: “El desafío de ustedes de creer en el Estado y el Estado de creer en ustedes, es un círculo virtuoso”.<br><br>Seguidamente, la vicegobernadora habló sobre la importancia de recorrer cada una de las localidades entrerrianas, de estar en territorio. “A mí me gusta mucho recorrer la provincia porque es la única manera de conocer las demandas de nuestra sociedad. Impulsamos políticas públicas y trabajamos con diferentes programas con las mejores intenciones, y al venir al terreno sabemos que se multiplican en experiencias de éstas características”, señaló Stratta al tiempo que destacó el acompañamiento del Gobierno a las empresas de la provincia, permitiendo generar empleo genuino y movimiento económico. “Qué importante es ver cómo se materializan las políticas públicas en experiencias transformadoras de vidas y comunidades”, agregó.<br><br>Por su parte, Valeria Ocaranza manifestó su agradecimiento y dijo sentirse “muy acompañada” por el Gobierno, al dar cuenta de la posibilidad que les brindaron y de otros créditos de los que resultó beneficiaria la empresa en otras oportunidades para seguir creciendo y concretar nuevos desafíos.<br><br><br>(Prensa Vicegobernación)', 'vicegobernación', '23noticia.jpg', 1, 1);
INSERT INTO `noticia` (`id`, `fecha_publicacion`, `titulo`, `subtitulo`, `cuerpo`, `autor`, `imagen`, `categoria`, `active`) VALUES
(24, '2022-05-20', 'Entre Ríos suma una plataforma digital para fomentar las exportaciones de la provincia', 'El ministro de Producción, Juan José Bahillo firmó un convenio específico para el desarrollo e implementación de la plataforma digital del Consejo Consultivo Interinstitucional, destinada a promover en el mundo los productos exportables entrerrianos.', 'Se trata de una propuesta innovadora que cuenta con el respaldo de la Unión Industrial de Entre Ríos; el Consejo Empresario; la Bolsa de Cereales y de Comercio; y la Cámara de Comercio Exterior. El acuerdo se suscribió junto a las autoridades de las organizaciones ligadas a la producción, el trabajo.<br><br>“El potencial de crecimiento que poseemos como provincia es muy grande. Como Estado avanzamos con políticas públicas que fomentan el comercio exterior; como así también es nuestra responsabilidad generar la confianza necesaria para poder trabajar en conjunto con el sector privado”, determinó el titular de la cartera productiva. Además, sentenció que “en este contexto global donde el mundo demanda alimentos, debemos posicionar a Entre Ríos como un fuerte competidor en el sector externo”.<br><br>Por su parte, el presidente de la Bolsa de Comercio, Alcides Balla; ponderó el funcionamiento del Fondo de Garantías de Entre Ríos como herramienta para obtener el respaldo necesario para las distintas líneas de financiamiento para la producción. “Hay un trabajo que se hace entre los sectores público y privado que crece a partir de objetivos comunes y eso es muy saludable”, determinó el empresario.<br><br>A su vez, el vicepresidente de dicha entidad, Alfredo Calabrese, expresó que “el desarrollo de esta plataforma es una experiencia muy valiosa, permitiendo a las entidades trabajar con el sector público en pos de un objetivo claro: facilitar el acceso a la información y la autogestión de las empresas exportadoras en lo que respecta a comercio exterior. Asimismo, esta herramienta servirá para identificar nichos comerciales donde Entre Ríos tenga ventajas para exportar”.<br><br>Héctor Fratoni, presidente del Consejo Empresario, sostuvo que la plataforma dinamizará tanto la oferta exportable como la búsqueda de oportunidades para posicionar la producción entrerriana en el sector externo. Por otro lado, Gabriel Bourdin, titular de la Unión Industrial, valoró la oportunidad de concentrar la totalidad de la oferta exportable entrerriana en un solo sitio.<br><br>Diego Maier, titular de la Bolsa de Cereales, aportó que “hay una base que sostiene esta iniciativa que es muy fuerte; ya que hace tiempo llevamos adelante un trabajo articulado con la provincia que se sostiene en la confianza”.<br><br>Dicha plataforma busca fomentar el comercio exterior y fortalecer el ecosistema exportador a través de la generación de vínculos entre las empresas que comercializan en el exterior y las que están iniciando un proceso de internacionalización. Se suman proveedores de servicios, ofertas de capacitaciones, asistencia técnica a las compañías, publicación de información relevante y todas las acciones que lleven a cabo las partes que suscribieron el convenio.<br><br>Además de los citados, participaron los secretarios de Industria y Comercio y, Desarrollo Económico, Fernando Caviglia y Pedro Gebhat; el titular del Polo Tecnológico de Paraná, Joel Lifschitz; el coordinador del Consejo Empresario, Francisco Uranga; y Analía Villaroel, integrante del equipo que desarrolló la plataforma; y el director general de Comercio Exterior, Juan Mansur. <br><br><br><br>(Prensa Ministerio de Producción)<br>', 'producción', '24noticia.jpg', 1, 1),
(25, '2022-06-24', 'Stratta participó de la apertura del Taller de Transformación Digital', 'La actividad, organizada por la Unidad de Transformación Digital (UTD) del Centro Industrial de Las Parejas, tiene por objetivo desarrollar acciones de sensibilización, asesoramiento y asistencia técnica para acompañar a las PyMEs en su transformación digital, en la zona de Entre Ríos y Santa Fe.', 'La vicegobernadora Laura Stratta participó este martes por la mañana del acto de apertura del Taller de Transformación Digital. La actividad, organizada por la Unidad de Transformación Digital (UTD) del Centro Industrial de Las Parejas, se llevó a cabo en el Centro Provincial de Convenciones (CPC) de Paraná, y contó con la presencia del ministro de Producción, Turismo y Desarrollo Económico de Entre Ríos, Juan José Bahillo; del secretario de Desarrollo Económico y Emprendedor, Pedro Gebhart; también del coordinador del programa de digitalización pyme del Ministerio de Desarrollo Productivo de La Nación, Santiago Polo; del coordinador de la actividad por parte de la UTD, Pablo Basta; y del presidente de Adimer, Sergio de Luca.<br><br><br><br><strong>Articulación público- privado</strong><br><br>Al hacer uso de la palabra, la vicegobernadora habló de la importancia de “generar estos encuentros donde además de abordar los temas específicos que nos convocan hoy como lo es la transformación digital, la capacitación y formación, también son espacios para poder escucharnos y definir estrategias comunes en esta articulación entre gobierno nacional, provincial y gobierno locales con el privado”. Y agregó: “La articulación pública-privada para nosotros es fundamental a la hora de trazar una estrategia de crecimiento y desarrollo en la provincia de Entre Ríos”.<br><br>En este sentido, resaltó la necesidad de “escucharnos en función de esa escucha atenta para trazar una estrategia concreta” y recordó que “hay líneas de financiamientos, programas y acciones pero si esas acciones y estrategias no llegan a los destinatarios, no llegan al territorio de la manera que tienen que llegar tendremos que trazar otra estrategia o redefinir algunas cuestiones que nos permitan poder hacerlo”.<br><br>Luego, Stratta valoró el crecimiento que ha tenido la metalúrgica en la provincia, “crecimiento que está atado al compromiso empresario, pero también al Estado para que ese crecimiento pueda darse de manera armónica y pueda permitir la generación de puesto de trabajos de calidad, que también es lo que buscamos cuando trazamos objetivos comunes y cuando pensamos en un proyecto de provincia y en un proyecto de país”, resaltó.<br><br>“Hoy nos convoca la transformación digital, porque hay un contexto que nos interpela a que podamos pensar cómo mejorar nuestra productividad, cómo mejorar nuestro procesos y cómo generar mejores condiciones”, aseveró Stratta. Y continuó: “También nos convoca ese hacer que tiene que ver con potenciar nuestra cadena de valor, con potenciar la metalúrgica en la provincia pero sobre todo con generar las herramientas que ustedes necesitan para poder crecer y desarrollarse, porque cuando ustedes crecen y se desarrollan también crece la provincia”, concluyó la vicegobernadora.<br><br><br><br><strong>Desarrollo productivo</strong><br><br>Por su parte, el ministro de Producción, Juan José Bahillo, expresó: “Nuestra provincia afortunadamente cuenta con una matriz productiva muy diversa, con cerca de 19 cadenas productivas, y precisamente el sector metalúrgico es transversal a todas ellas. Por ello, es nuestro deber el fijar y diseñar políticas que se reflejen en acciones concretas para permitir que este sector de la economía provincial continúe creciendo”, a lo que agregó: “Ustedes los empresarios son los especialistas que nos deben guiar para lograr así mejores políticas de acompañamiento al sector. Personalmente siempre rescato el valor que tienen los empresarios y emprendedores para nuestra sociedad, ya que el desarrollo productivo de nuestra provincia es resultado de la sumatoria entre la fuerza de trabajo y la visión empresarial, quienes arriesgan su capital para generar empleo y terminan haciendo de sus emprendimientos un proyecto de vida”.<br><br>El ministro indicó también que existe una oferta muy variada de líneas de financiamiento, tanto del Ministerio de Desarrollo Productivo de la Nación como también las que ha elaborado el ministerio de Producción con el agente financiero provincial: “Una de las que elaboramos junto con Adimer es la del transportista, que toma lo que es acoplados y semi-remolques. Esa fue la línea más efectiva de las desarrolladas, junto con la línea avícola fueron las únicas que agotaron sus cupos. Además, nos encontramos elaborando otra línea con el Banco Nación”.<br><br>En tanto, el coordinador del programa de digitalización pyme del Ministerio de Desarrollo Productivo de La Nación, Santiago Polo, señaló: \"En primer lugar, quería traer el saludo del ministro Matias Kulfas, del secretario de la Pyme, Guillermo Merediz. Para ambos la política de transformación digital, como pudieron ver en lo que le fuimos contando, es una política central la política industria 4.0 para nuestras pymes. Y añadió: \"No será de otra manera que dentro de una articulación con los gobiernos provinciales, con los gobiernos municipales, con las cámaras empresarias, las distintas universidades y el sector científico tecnológico. Por eso, quiero agradecer la presencia de la vicegobernadora Laura y del ministro Juan José y de todas las autoridades provinciales que hoy están acá\".<br><br>\"Las UTD, son un programa de Unidades de Transformación Digital federal, de apoyo a instituciones locales para brindar capacitaciones, para brindar asistencia técnica y para poder canalizar las herramientas de financiamiento a las Pymes para que accedan a las herramientas de financiamiento. Es importante que resaltemos las políticas que encaramos de Sepyme. Nosotros recibimos una Sepyme con un presupuesto de 3 millones de pesos . Hoy en día ese presupuesto es de 120 mil millones de pesos, es importante resaltar las prioridades de este gobierno y las prioridades que tienen con el impulso a los empresarios y sus trabajadores para el desarrollo económico de nuestro país. Para nosotros el motor es la producción y el trabajo y en ese sentido todas las políticas y todas nuestras líneas de financiamiento - las más de 35- todo el esfuerzo que estamos poniendo en fortalecer las herramientas y las inclusiones financieras\".<br><br>Sergio De Luca, presidente de la Asociación de Industriales Metalúrgicos de Entre Ríos, al tomar la palabra remarcó: “Les agradezco que estén acompañándonos porque es la oportunidad de que ustedes escuchen lo que nosotros vivimos en cada una de nuestras empresas”. En ese sentido, se refirió a los problemas de acceso al crédito que presentan algunas firmas entrerrianas y ratificó: “Nosotros tenemos un empuje enorme para generar fuentes de trabajo, creemos en Entre Ríos, estamos acá, vamos a seguir estando acá pero necesitamos que esas medidas lleguen a las pequeñas empresas”, le dijo a los funcionarios presentes. Asimismo, consideró: “Nos falta un desarrollo enorme por delante, y ojalá se pueda concretar. Lo que sí estoy de acuerdo en que la única forma de poder concretarlo es juntarnos en estos ambientes, que estén autoridades nacionales, provinciales y que estemos empresarios y nuestros empleados porque la única forma de hacerlo, es trabajando en conjunto”.<br><br><br><br><strong>Taller</strong><br><br>Tras el acto de apertura y las palabras de bienvenida, los referentes del Ministerio de Desarrollo Productivo de la Nación hicieron referencia a los objetivos del programa y expectativas del evento. Durante la jornada se trabajó en una dinámica sobre el conocimiento que tiene la empresa de la industria 4.0 y cómo ve que se puede aplicar a su empresa. Además, entre otras actividades, se presentaron los casos de implementación de transformación digital en las empresas, que muestran cómo impacta esto en la industria, y cómo se podría aplicar. Se realizó también un autodiagnóstico para identificar el punto de partida de cada empresa a través de mostrar la aplicación del Autodiagnóstico de Madurez Digital de INDtech, detallando sus dimensiones. Antes del cierre, los participantes realizaron actividades de taller en mesas de trabajo, compartiendo experiencias y haciendo un balance de lo aprendido.<br><br>(Prensa Vicegobernación)<br>', 'vicegobernación', '25noticia.jpg', 1, 1),
(26, '2022-06-02', 'El gobierno provincial lanza una línea de crédito subsidiado para el sector agropecuario', 'La línea de crédito conjunta con el Banco Entre Ríos será para comprar maquinaria agricola y cuenta con una tasa fija bonificada del 27% y un plazo de hasta 48 meses.', 'Así lo hizo saber la vicegobernadora Laura Stratta en el marco de la Feria Agroactiva en la localidad santafesina de Armstrong.<br><br>Stratta destacó \"lo valioso de diseñar y generar herramientas que sean eficaces y que den respuestas a cada uno de los sectores. Estamos convencidos que cuando crecen nuestros productores, cuando crecen nuestros industriales también crece nuestra provincia”.<br><br>La vicegobernadora, estuvo este miércoles junto al ministro de Agricultura de la Nación Julián Domínguez; el gobernador de Santa Fe Omar Perotti y el ministro de Producción, Juan José Bahillo, en la apertura oficial de AgroActiva, la feria vinculada a la actividad agropecuaria que se desarrolla en la localidad santafesina de Armstrong.<br><br>Allí hizo saber que la Provincia bonificará créditos para la compra de maquinaria agrícola a través de una Línea de Financiación que se pone a disposición junto al Banco Entre Ríos. Esta herramienta crediticia estará vigente exclusivamente en AgroActiva (del 1 al 4 de junio 2022), con una tasa fija final del 27,04% y un plazo de hasta 48 meses.<br><br><br><strong><br>Acompañar los nuevos desafíos</strong><br>“Para nosotros es muy importante poder estar lanzando hoy una línea de crédito del Banco Entre Ríos en articulación con el Gobierno de la provincia para un sector que para nosotros es tan importante como el agropecuario, porque estamos convencidos de que hay que diseñar políticas públicas y herramientas que nos permitan que en el sector puedan crecer y puedan desarrollarse”, aseveró la vicegobernadora al inicio de su discurso.<br><br>En este sentido, Stratta recordó las palabras del gobernador Gustavo Bordet: “El equilibrio fiscal y el ordenamiento de las cuentas públicas nos permiten avanzar en este tipo de iniciativa conjuntas para diseñar herramientas que sean eficaces acorde a las demandas que tiene cada sector”, sostuvo.<br><br>La vicegobernadora destacó la importancia de “acompañar desde el Gobierno, los nuevos desafíos que tiene el sector para la incorporación de la tecnología y la renovación de la maquinaria de trabajo”. Y continuó: “Por eso estamos aquí, ratificando el trabajo en articulación con el gobierno nacional, provincial y nuestro agente financiero pero también valorar el trabajo que hacemos con cada uno de los sectores que nos permiten escucharlos para poder generar esas herramientas y esas políticas acordes a sus necesidades”.<br><br>Luego, Stratta señaló que en la provincia “tenemos 19 cadenas de valor, 12 de ellas son muy competitivas y están entre los ranking de primer y cuarto nivel nacional, en esa diversidad está la riqueza de nuestra provincia a la que le tenemos que seguir aportando infraestructura, transporte, caminos, puertos, trenes y conectividad, siempre de la mano de estas herramientas que necesitamos para acompañar el desarrollo de las empresas”. Y agregó que esta inversión de pesos “se van a volcar en nuestra provincia porque su a vez no solamente le llega a los productores sino a las empresas que venden los servicios, a nuestros productores y generamos un círculo virtuoso que siempre redunda en respuestas integrales a las demandas que nos plantea nuestra sociedad”, concluyó Stratta.<br><br><br><br><strong>Herramienta financiera</strong><br>Por su parte, Miguel A. Malatesta, Gerente General del Banco de Entre Ríos, se refirió a la presencia en Agroactiva, y a la oferta de productos y servicios financieros para el sector: “Estamos presentes en la feria con un stand de 900 m2 y un equipo de gerentes y oficiales que brindan asesoramiento al productor\". Y agregó: \"En nuestro rol de agente financiero acompañamos a cada uno de los sectores que integran la cadena de valor de la provincia así como lo venimos haciendo desde hace mucho tiempo con otras líneas muy atractivas para cada sector”, dijo tras subrayar que “el objetivo es que seamos la herramienta financiera para el productor agropecuario y así ofrecerle una línea que sea beneficiosa para la concreción de negocios, ya sea el recambio de equipamiento tecnológico o la compra de bienes de capital que demande cada una de sus actividades”.<br><br><br><br><strong>Compromiso con los sectores productivos</strong><br><br>En tanto, el ministro de Producción, Turismo y Desarrollo Económico de Entre Ríos Juan José Bahillo, consideró que “el financiamiento es una herramienta que apalanca fuertemente el crecimiento de todos estos sectores productivos. Por eso hemos trabajado con líneas de asistencia y financiamiento de créditos, distintas asistencias y programas que puedan llegar a estos sectores para que puedan desplegar toda su capacidad productiva”.<br><br>Dijo además que a pesar del contexto de pandemia “se ha ido transformando rápidamente debido al crecimiento de la actividad de las 19 cadenas de valor que tiene nuestra provincia, en una rueda de financiamiento para bienes de capital, para bienes de trabajo, para ampliar la capacidad productiva, para invertir en nueva maquinaria, para hacernos competitivos y desarrollar nuevos mercados”, mencionó.<br><br>“Hay una agenda del sector privado que tensiona fuertemente y de manera positiva sobre las políticas públicas y hay una decisión política del Ejecutivo Provincial, del gobernador Gustavo Bordet de acompañar el desarrollo, el crecimiento de nuestra provincia, la generación de nuevos puestos de trabajo con distintas herramientas”, subrayó al tiempo que reiteró: “Una de las herramientas más importante para nosotros es el financiamiento para el sector privado”.<br><br>En este sentido, Bahillo recordó que el gobierno provincial trabajó en el financiamiento para el sector avícola, arrocero, transportistas, tamberos, porcinos, entre otros. “Nuestro compromiso es seguir trabajando y diseñando políticas públicas que permitan a estos sectores productivos, que tanto nos enorgullecen como provincia, seguir creciendo”.<br><br><br><br><strong>Características de la línea:</strong><br><br>Beneficiarios: productores agrícolas radicados en la provincia de Entre Ríos<br>Destino: adquisición de máquinas agrícolas-<br>Cupo de la línea: $ 2.000.000.000<br>Plazo: hasta 48 meses<br>Tasa Fija Final Cliente: 27,04%<br>Vigencia: exclusiva para AgroActiva 2022, desde el 1/6/22 hasta el 4/6/22 inclusive.<br><br><br><br><strong>AgroActiva 2022</strong><br>En el marco de la apertura oficial de AgroActiva, la feria vinculada a la actividad agropecuaria que se desarrolla en la localidad santafesina de Armstrong, el ministro de Agricultura de la Nación, Julián Domínguez, al tomar la palabra celebró “la institucionalidad” que tenemos en Argentina “para defender nuestro sistema de producción y nuestra identidad que está vinculada a lo que pasa en la tierra, a nuestra forma de producir”.<br>En ese sentido, aseveró: “Esta muestra es el producto de toda esta historia, por eso va a seguir creciendo. Todo nos indica que el mundo va a demandar lo que el campo argentino produce”, destacó sin dejar de remarcar que el contexto mundial señala que “está comprometida la seguridad alimentaria en Europa”.<br><br>Señaló luego: “Mi sueño en esta etapa de Ministro es poder transmitir esa mística del ser argentino, poder despejar la imprevisibilidad de la cual todos los productores me hablan, lo que conspira contra la posibilidad de levantar esa identidad y esta mística”.<br><br><br><br><strong>Orgullo para Santa Fe</strong><br>Luego, el gobernador Omar Perotti expresó: “Sin dudas, es un orgullo para la provincia de Santa Fe tener a AgroActiva desarrollándose nuevamente”. Y agregó: “En primer lugar, agradecer en esta oportunidad donde volvemos a encontrarnos de la forma que nos gusta”.<br>En otro tramo de su discurso, el mandatario santafesino valoró la muestra y luego manifestó: “Las perspectivas del sector son distintas, eso entusiasma y nos motiva en saber que estamos frente a una clara expresión de la realidad y del futuro de la Argentina”.<br><br>“Este es el escenario que queremos para Argentina, porque lo que aquí se vive es entusiasmo, no alejado de las dificultades pero sí una visión de futuro y crecimiento y oportunidades para todos”, resaltó Perotti.<br><br><br><br><strong>Mística</strong><br><br>La presidenta de AgroActiva, Rosana Nardi, al hacer uso de la palabra expresó: “Agroactiva es un trabajo, capacitación, servicios, profesionalización, negocios, pero no hay que confundirse, lo que hizo grande a Agroactiva, fue la gente, porque afortunadamente lo que sigue moviendo al mundo son los sentimientos, el encuentro entre las personas, el sentirse parte, acompañarnos, compartir. Mi papá lo llamaba mística”. Y aseguró: “Hoy presentamos una AgroActiva que va a quedar en la historia”.<br><br><br><br><strong>Otras presencias</strong><br>La actividad contó además con la presencia del intendente de Armstrong, Pablo Horacio Verdecchia,y de Rosario Pablo Javkin. Participaron también los ministros de Agricultura y Producción de las provincias de Santa Fe y Córdoba; la presidenta de AgroActiva, Rosana Nardi y el presidente honorario de AgroActiva Luis Nardi; legisladores nacionales, provinciales y concejales, intendentes y presidentes comunales de la región, autoridades de la delegación cubana, entidades intermedias, cámaras, empresarios, productoras y productores del sector agropecuario, invitados especiales.<br><br><br><br>(Prensa Vicegobernación)', 'vicegobernación', NULL, 1, 1),
(27, '2022-06-10', 'Se lanzó una nueva edición del programa Tutorías dirigido a emprendedores', 'El secretario de Desarrollo Económico y Emprendedor, Pedro Gebhart, participó del lanzamiento del programa Tutorías, el cual brinda asistencia técnica que tiene como fin generar espacios de trabajo grupal intensivo para abordar aspectos específicos relacionados al camino emprendedor.', 'El Programa Tutorías, impulsado por la Secretaría de Desarrollo Económico y Emprendedor del Ministerio de Producción, Turismo y Desarrollo Económico de la provincia, dispone de tutores asignados a diversos emprendedores para acompañarlos durante un periodo consecutivo de seis meses.<br><br>En grupos acotados trabajan de manera virtual y presencial para abordar contenidos relacionados a aspectos y desafíos del camino emprendedor; la misión y visión de cada emprendimiento; formulación de planes de negocios; asesoramiento en las líneas de apoyo a emprendedores disponibles; formulación, presentación y seguimiento de proyectos; figura jurídica y aspectos contables y financieros del emprendimiento; vinculación y generación de redes de contactos; markenting; entre otros.<br><br>En esta edición participarán emprendimientos de las localidades de Paraná, Viale, Crespo, Victoria, Concordia, Gualeguaychú, Diamante, Villaguay y San José, a través de tres grupos de tutorías.<br><br>En el lanzamiento estuvieron presentes el director general de Desarrollo Emprendedor de la provincia, Claudio Rosas Vico; el director de Formación en Competencias Emprendedoras, Marcelo Tisler; y los tutores del Programa Tutorías, Gastón Ábalos, María Victoria Alonso y Ricardo Rodríguez.<br><br>(Prensa Ministerio de Producción)<br>', 'producción', '27noticia.jpg', 1, 1),
(28, '2022-07-18', 'La provincia presentó el Programa Jóvenes Emprendedores junto a instituciones del ecosistema emprendedor', 'El secretario de Desarrollo Económico y Emprendedor de la provincia, Pedro Gebhart, participó de la presentación del Programa Jóvenes Emprendedores en el Club de Emprendedores de Paraná, ubicado en la sede de Ciencias Económicas de la Universidad Nacional de Entre Ríos.', 'En el encuentro estuvieron presentes el decano de la facultad de Ciencias Económicas, Sebastián Pérez, el director general de Desarrollo Emprendedor de Entre Ríos, Claudio Rosas Vico, y el director de Políticas de Formación Emprendedoras de la provincia, Marcelo Tisler.<br><br>En esta oportunidad, se llevó a cabo la presentación del programa Jóvenes Emprendedores del Ministerio de Producción, Turismo y Desarrollo Económico en la sede del Club de Emprendedores de Paraná, un espacio que promueve el surgimiento de emprendimientos innovadores con impacto económico, ambiental y social a través del trabajo colaborativo, integrado actualmente por la Secretaría de Desarrollo Económico y Emprendedor del Gobierno de Entre Ríos, la Facultad de Ciencias Económicas de la UNER y la Asociación Civil Entre Ríos Emprende.<br><br>En ese marco, el secretario Pedro Gebhart, expresó: “Una vez más presentamos el Programa de Jóvenes Emprendedores que ya cuenta con más de 10 años de funcionamiento. El mismo está destinado a emprendedores y emprendedoras de la provincia de entre 18 y 40 años, o personas jurídicas que quieran participar y obtener un financiamiento sin ningún tipo de garantía. Así mismo, les acercamos todos los programas con los cuales contamos desde el Gobierno de Entre Ríos, no solamente para emprendedores sino también para pymes y empresas de tramo más grandes”.<br><br>Anteriormente el Programa Jóvenes Emprendedores se presentó en las localidades de localidades de Concepción del Uruguay, Rosario del Tala, Victoria, Hernández, Villa del Rosario, General Galarza, Maciá, San Benito y Gualeguaychú.<br><br>(Prensa Ministerio de Producción)<br>', 'producción', NULL, 1, 1),
(29, '2022-07-18', 'Promueven propuestas de base tecnológica entre emprendedores e innovadores', 'La iniciativa fue impulsada por la Secretaría de Vinculación Tecnológica e Innovación de La Facultad de Ingeniería de la Universidad Nacional de Entre Ríos (UNER). Participaron representantes del Ministerio de Producción, Turismo y Desarrollo Económico de la provincia.', 'En la jornada estuvieron presentes el director general de Desarrollo Emprendedor de la provincia, Claudio Rosas Vico; el director de la Inversión y Emprendedurismo de la municipalidad de Paraná, Pablo Ayala; el decano de la Facultad de Ingeniería de la UNER, Diego Campana; y la secretaria de Vinculación e Innovación del Instituto Balseiro, María Luz Martiarena.<br><br>En el encuentro se lanzó la edición número 12° del Concurso IB50k para Planes de Negocio de Base Tecnológica. El mismo es organizado por el Instituto Balseiro, dependiente de la Comisión Nacional de Energía Atómica y la Universidad Nacional de Cuyo, y coordinado por la Secretaría de Vinculación e Innovación de la Facultad de Ingeniería de la UNER. Además, cuenta con el apoyo de la Secretaría de Desarrollo Económico y Emprendedor de la provincia y la Dirección de Inversión y Emprendedurismo de la municipalidad.<br><br>En ese sentido, el director de Desarrollo Emprendedor de la provincia, Claudio Rosas Vico, brindó información acerca de las líneas de asistencia técnica y financiera dirigidas a emprendedores, y expresó: “A partir de los desafíos que van surgiendo en el trayecto emprendedor es que generamos herramientas de acompañamiento para los distintos momentos. Por eso, disponemos de programas que abarcan desde el estadio de ideación de proyectos hasta la etapa empresarial”.<br><br>Por otro lado, Santiago Romero Ayala del emprendimiento Lumi, y Facundo Cuestas del emprendimiento Givemove compartieron sus experiencias como ex finalistas del IB50K de Entre Ríos.<br><br><br><br><strong>Sobre el concurso</strong><br>El premio consiste en financiamiento destinado a proyectos relacionados con el desarrollo de tecnologías (dispositivos, plataformas, sistemas, algoritmos, etc) asociados a la bioingeniería y la bioinformática.<br><br>Para recibir asesoramiento para participar del concurso comunicarse a economicoemprendedorer@gmail.com (Secretaría de Desarrollo Económico y Emprendedor de Entre Ríos)<br>', 'producción', '29noticia.jpg', 1, 1),
(30, '2022-07-18', 'Bordet recibió emprendedores que proyectan exportar a Uruguay', 'El gobernador Gustavo Bordet, junto al ministro de Producción, Juan José Bahillo, se reunió con emprendedores entrerrianos que participarán esta semana de una misión comercial Uruguay, organizada por la provincia, que también integrarán empresarios de Pymes.', '“Estas misiones resultan muy importantes. Nosotros desde Entre Ríos exportamos a 60 países del mundo y acompañamos a las grandes empresas a las ferias internacionales en distintas misiones comerciales, algunas de ellas en el marco de la Región Centro, pero también a emprendedores y pequeños y medianos empresarios que pueden tener una oferta exportable a países limítrofes, como es el caso de Uruguay, donde se va a realizar esta misión comercial esta semana”, dijo gobernador tras el encuentro que se desarrolló en el Salón de Gobernadores de la Casa de Gobierno y en el que también participó el secretario de Desarrollo Económico y Emprendedor, Pedro Gebhart.<br><br>La misión se concretará este miércoles y jueves hacia Montevideo, Uruguay, en la cual participarán cinco emprendedores entrerrianos, los que contarán con el apoyo de la provincia para poder realizar esta incursión, que comprenden asistencia para cubrir el traslado y el hospedaje de los mismos. El objetivo es impulsar el desarrollo en escala y el aumento de canales de ventas de los emprendedores, favoreciendo la cadena productiva entrerriana.<br><br>También estarán presentes en el evento internacional pequeños y medianos productores de la provincia.<br><br>Al reiterar la decisión del gobierno de concretar este apoyo, el mandatario expresó: \"Esta es una forma de poder generar oportunidades de negocios para nuestros productores, emprendedores, industriales que tienen mucha capacidad de innovación, tecnología y conocimiento aplicado a sus empresas y es importante poder expandirlo y llegar a otros lugares\".<br><br>En este marco, agregó que también están previstas misiones a Brasil, el próximo mes, para luego concretar una agenda en Santa Cruz de la Sierra, Bolivia; como así también en Asunción del Paraguay y en Santiago de Chile.<br><br>Por su parte, el ministro de Producción, Juan José Bahillo, indicó que esta misión se enmarca “en la decisión del gobierno provincial y del gobernador de fomentar y alentar el crecimiento de la producción entrerriana, y una de las patas más importantes para este crecimiento y desarrollo es fomentar las exportaciones al sector externo de nuestra provincia\".<br><br>Precisó que la provincia tiene una oferta exportable de alrededor de 90 productos, llegando a alrededor de 120 países y aseguró que esta nueva incursión a Uruguay “es una de las tantas misiones que se realizan con esta agenda”.<br><br>Detalló que, \"en esta oportunidad, vamos a estar dos días de esta semana en Montevideo, Uruguay, con una agenda importante para industrias, empresarios pymes, sectores de servicio; ya que por decisión del gobernador, desde hace varios años se viene incluyendo en estas misiones a un grupo de emprendedores\".<br><br>Mencionó que, en este caso, pertenecen al \"programa Jóvenes Emprendedores, que financia y fortalece el desarrollo de emprendimientos de jóvenes en toda la provincia”, dijo y explicó que en la tutela y el acompañamiento que otorga el Estado provincial, más allá del financiamiento para el emprendimiento, también está el asesoramiento y capacitación para el desarrollo de mercados externos para darle más volumen a este tipo de emprendimientos.<br><br>En relación a la reunión de este martes es con los cinco emprendedores que concurrirán a la misión, mencionó: “Es muy importante para nosotros poder acompañar a este segmento de emprendedores, porque si no fuera por el acompañamiento y la gestión del gobierno provincial para ellos les sería muy difícil porque no tienen la capacidad instalada ni la infraestructura administrativa para desarrollar el comercio exterior”, apuntó.<br><br>Detalló que se trata de emprendimientos de distintos puntos de la provincia, como una fábrica de alfajores; un emprendimiento que desarrolla suplementos vitamínicos y núcleos minerales para alimentos balanceados para distintos sectores productivos; otro que desarrolla tecnologías para el control de la higiene y hábito en centros de salud y hospitales; un emprendedor que ha desarrollado una tecnología de evaluación oftalmológica de los ciudadanos en territorio; y una destilaría.<br><br><br><strong>La misión</strong><br><br>Con el objetivo de desarrollar la escalabilidad y aumento de canales de ventas de los emprendedores entrerrianos en Misiones Comerciales desarrolladas en otros países, el Ministerio de Producción, Turismo y Desarrollo Económico a través de la Secretaría de Desarrollo Económico y Emprendedor brinda asistencia financiera para cubrir el traslado y el hospedaje de los emprendedores que asistan a la Misión Comercial Montevideo-Uruguay que se hará este miércoles y jueves en la capital del país vecino.<br><br>Los emprendimientos que participan son la destilería Gin Mitos, de Paraná, la fábrica de alfajores Mamazzita, de Concordia ; la productora de núcleo vitamínico/mineral Nutrelar, de Larroque; la productora de instrumentos ópticos portátiles Agteam, de Oro Verde,; y la productora de instrumentos para desinfección con tecnología UV Lumi, de la capital entrerriana.<br><br><br><br><strong>Balance turístico</strong><br>En otro orden, en referencia al fin de semana extra largo que se vivió en el país, el gobernador destacó que Entre Ríos “la vivió de manera excelente, hemos tenido un fin de semana colmado de turistas en toda la provincia, los medios nacionales destacan el posicionamiento que han tenido las ciudades entrerrianas en todo el concierto nacional como entre los destinos más elegidos\".<br><br>\"La verdad es que viene creciendo sostenidamente el turismo, esta política de fines de semana largos alienta que venga mucho turismo, por las proximidades a los grandes centros urbanos. Buenos Aires, Rosario Córdoba, que eligen nuestra zona y también hay una gran movilidad interna en la provincia de turistas que se mueven dentro de Entre Ríos y que pueden tener con su familia la posibilidad de estar en distintos lugares con una oferta turística para la cual nos hemos preparado y trabajamos en conjunto con el sector privado. Esto nos posibilita que el turista que viene sea bien recibido, sea satisfecho en todas las expectativas y que siempre quiera volver\", subrayó.<br><br>Indicó que \"para ello se hacen campañas publicitarias en Buenos Aires, en medios nacionales, para poder difundir la oportunidad que da Entre Ríos de estar en hora y media o dos horas en nuestro territorio y poder elegir cualquier ciudad en la costa del Uruguay, del Paraná y en todo lo que es el centro de la provincia que cada vez se viene posicionando más como destino turístico. Esto genera desarrollo, empleo y los trabajaremos sostenidamente\", afirmó.<br>', 'gobernación', '30noticia.jpg', 1, 1),
(31, '2022-06-29', 'La provincia y productores avanzaron en el diseño de la agencia para la promoción de exportaciones', 'La primera jornada de trabajo para la puesta en marcha de la Agencia Público-Privado para la Promoción de Exportaciones, Inversiones y Desarrollo Económico de Entre Ríos se llevó a cabo este miércoles en el puerto de Concepción del Uruguay.', 'Estuvo encabezada por la vicegobernadora Laura Stratta y participaron representantes del sector privado.<br><br>La vicegobernadora Laura Stratta, junto al ministro de Economía Hugo Ballay y al intendente de Concepción del Uruguay Martin Oliva, participaron de una reunión de trabajo con diferentes sectores del entramado productivo entrerriano, especialmente vinculados al sector exportador, con el objetivo de conformar un ente mixto público privado para fortalecer el desarrollo económico de la provincia.<br><br><br><br><strong>Apostar a un modelo de producción y de trabajo en la provincia</strong><br><br>Al hacer uso de la palabra, la vicegobernadora agradeció a los presentes su participación en la primera reunión de trabajo que tiene por objetivo “apostar a un modelo de producción y de trabajo en la provincia, y que la sinergia entre el sector público y privado pueda convertirse en un factor de desarrollo”, destacó tras señalar la importancia de rescatar las 19 cadenas de valor que tiene Entre Ríos.<br><br>Stratta consideró necesario “afianzar esta propuesta que en algún momento plasmó el gobernador Gustavo Bordet en la Asamblea Legislativa sobre la creación de agencia público privada, para potenciar las chances que tenemos en Entre Ríos”.<br><br>En otro tramo de su discurso, mencionó las experiencias de las provincias de Santa Fe y Córdoba. “Hay un camino transitado del diálogo permanente, pero necesitamos seguir mejorando las condiciones en que nos vinculamos, y esta Agencia apunta a potenciar las chances que tiene la provincia”, indicó al tiempo que sostuvo que desde el gobierno “también queremos escuchar sus voces y, especialmente, potenciar la inversión, nuestra oferta exportable y trabajar en líneas de financiamiento que ayuden a cumplir esos objetivos”.<br><br>Por último, Stratta agradeció a los presentes la confianza y les pidió “construir juntos este texto que dará volumen y potencialidad a la Agencia, que una ley es mucho más fuerte y mucho más potente que un decreto, y que tiene que ver también con la trazabilidad que le demos a esta experiencia que tienen otras provincias y que necesitamos consolidar a la nuestra”, aseveró la vicegobernadora.<br><br><strong>Trabajo mancomunado</strong><br>El intendente anfitrión dio la bienvenida a todos los presentes y expresó: “Para nosotros es muy importante que en este lugar tan emblemático como es el puerto de nuestra ciudad, nos estén acompañándonos. A todos los que hacen de La Histórica este lugar único y diferente, muchas gracias a empresarios y a las instituciones que hoy están acá”. Y agregó: “Para el municipio todo lo que tenga que ver con la educación, la producción o la actividad que se desarrolle en este lugar es importante”, dijo Martin Oliva.<br><br>A su turno, el ministro de Economía de la Provincia, Hugo Ballay, expresó: “Hoy es una realidad el Fondo de Garantía de Entre Ríos, es el mejor ejemplo de funcionamiento de trabajo conjunto entre lo público y lo privado, ese el Estado y 17 instituciones, cámaras representantes de diferentes sectores que lo conforman, tiene un director y un síndico que presenta al sector privado”, dijo tras destacar el otorgamiento de líneas de crédito y acompañamiento de subsidios de tasas para varios sectores. “Más allá de lo que hoy se inicia podemos mostrar que los objetivos se logran”, aseveró.<br><br>Por su parte, Fernando Caviglia, secretario de Industria y Comercio del Gobierno de Entre Ríos, valoró “el trabajo mancomunado que venimos haciendo con las distintas las entidades empresarias y empresarios en particular, le hemos dado mucho énfasis en los últimos tiempos porque creemos que de la única forma que podemos promover el desarrollo de Entre Ríos es trabajando en conjunto con los sectores productivos, y así lo venimos haciendo”. Seguidamente mencionó las actividades que realizan mancomunadamente con los sectores productivos y ahora también con las entidades representativas de la industria. “Estamos reunidos para trabajar, pensar y planificar juntos porque necesitamos el aporte de estos sectores. No hay solución de los problemas sociales sin producción de las actividades económicas”, aseveró.<br><br>Luego, el secretario de Desarrollo Económico y Emprendedor, Pedro Gebhart, dio detalles de la propuesta de la Agencia. “Hay una apuesta a la inclusión financiera y a la inversión productiva para mejorar la productividad, competitividad y la inserción internacional”, resaltó al tiempo que explicó que “la Agencia es una herramienta de gestión que permitirá acompañar, potenciar y consolidar a las empresas provinciales en el actual contexto de crecimiento económico”. Entre otros ejes, sostuvo que esta Agencia también permitirá mejorar el posicionamiento de la provincia ante la Región Centro y jerarquizarla a nivel nacional e internacional.<br><br>En la reunión de trabajo, Martín Eduardo Herlax, decano de la UTN de Concepción del Uruguay, agradeció la invitación a esta primera jornada y se refirió a “la importancia de la relación público privada y con el apoyo de la universidad, dando esa transferencia de conocimiento a través de un grupo de investigación”. Y continuó: “En el ámbito local y regional lo tenemos reforzado y con pruebas concretas a través de tecnicaturas, diplomaturas o pasantías que nos vinculan con el sector privado y que nos ha dado una importante relación para que la universidad esté donde tenga que atender los requerimientos de la sociedad”, subrayó.<br><br><strong>Apoyo del sector privado</strong><br>Santiago Caprarulo, de la Cámara de Exportadores del Citrus del NEA (CECNEA) agradeció la invitación y celebró la iniciativa de la Agencia. “Los puntos que están destacando son muy importantes a los efectos de la competencia y colocación de los productos”, dijo tras considerar que “la articulación público-privado es fundamental para tratar de ser más competitivos”. Enseguida valoró el trabajo conjunto que vienen realizando con la provincia calificandolo de “excelente”. Mencionó la importancia de “poder lograr el acceso al crédito, a las refinanciaciones, en definitiva, facilitar la dinámica de la producción con transformación de valor, con proceso industrial y exportación”. Y agregó: “Les agradezco la invitación y estoy muy interesado en conocer los detalles del plan de acción”.<br><br>En tanto, Sofía García, del Centro de Empresas Procesadoras Avícolas (CEPA) habló de las actividades de la empresa que representa. “Es un buen momento para las explotaciones avícolas pero también son momentos difíciles los que estamos viendo en Argentina”, dijo al hacer uso de la palabra. Valoró la iniciativa de la Agencia porque “trabajará en dos ejes centrales: la competitividad y la negociación” asegurando que “desde la avicultura estamos a plena disposición para trabajar, integrarnos y pensar en conjunto. También para escuchar a los nuestros y transmitir experiencias a otros desarrollos de la provincia”. Y añadió: “Parte del sueño de la avicultura es que desde el puerto de Concepción del Uruguay salga pollo argentino”.<br><br><strong>Presencias</strong><br>Participaron de la reunión de trabajo representantes de instituciones y empresas de la provincia, entre ellos, Claudio Lambert (UIER, ADIMER, empresario Acoplados Lambert), Fernando Marsó (Las Camelias, CEPA). Estela Miño (CODEGU), Gaspar Girard (CACEGU), Gerente Laboratorio INFADER (Industrias Farmacéuticas de Entre Ríos), Marcelo Ceballos (CISCU). Mediante zoom, se conectaron Federico Gadea (CIAER) y Antonella Fontana (ADIMER). También estuvieron presentes el senador Horacio Amavet, el presidente del Instituto Portuario de la Provincia de Entre Ríos (IPPER), Carlos Schepens; el director General de Comercio Exterior del Gobierno de Entre Ríos, Juan Mansur; el director General de Desarrollo Económico Territorial de Entre Ríos, Oscar Bustamante; intendentes, funcionarios y concejales, invitados especiales.', 'vicegobernación', '31noticia.jpg', 1, 1),
(32, '2022-07-11', 'Emprendedores, pymes y cooperativas entrerrianas podrán crear a su propia tienda online', 'Entre Ríos es la primera provincia en implementar el programa Soy tu tienda que acompañar el desarrollo de proyectos online de emprendedores, sectores de la economía social, pymes y cooperativas con el fin de potenciar su actividad y generar mayor sostenibilidad económica', 'El programa es un desarrollo de NIC Argentina, el organismo que administra los dominios de Internet en Argentina, y está destinado a sectores de la economía social, pymes, cooperativas y emprendedoras/es con el objeto de que puedan acceder a tiendas online. Se trata de un programa abierto y de suscripción gratuita para todas las personas con interés en mejorar las ventas online de sus productos, a quienes, además, se les brindará asistencia permanente y capacitaciones intensivas sobre marketing digital, gestión online y módulos de pago online, entre otros ejes.<br><br><br><strong><br>Presentación del programa</strong><br><br>“Soy tu tienda” fue presentado por primera vez en Entre Ríos el pasado 7 de julio, por la secretaria Legal y Técnica de la Presidencia de la Nación, Vilma Ibarra, en la Facultad de Trabajo Social (UNER), a través de un trabajo en conjunto con la diputada nacional, Carolina Gaillard; la Secretaría de Modernización encabezada por María Lucrecia Escandón; y la Secretaría de Desarrollo Económico y Emprendedor a cargo de Pedro Gebhart.<br><br>Al respecto, Escandón señaló: \"Estamos en medio de una revolución digital que está cambiando la forma en que tomamos nuestras decisiones económicas diarias. Por eso nos parece muy importante que el Estado esté diseñando e implementando programas de economía digital y comercio electrónico, promoviendo el crecimiento de nuestras Pymes, cooperativas y emprendedores; contribuyendo a achicar las brechas digitales que quedaron en evidencia durante la pandemia en un mercado cada vez más competitivo\".<br><br>Por su parte, Vilma Ibarra destacó que “La primera provincia con la cual se viene a trabajar en contacto directo es Entre Ríos, y por eso estoy acá para poder acompañar este lanzamiento e impulsar que aquella gente que tiene emprendimientos pequeños pueda tener su página web, su sitio y dar difusión a sus productos a través de páginas de internet”.<br><br>Además, la funcionaria afirmó que “esto de ayudar al comercio por internet impulsa mucho los emprendimientos. Sabemos que es una época donde no siempre se cuenta con las herramientas tecnológicas necesarias o con el acompañamiento que uno precisa para estas cosas”.<br><br>Luego de la presentación se llevó a cabo la firma de un Convenio de Colaboración entre las autoridades, y una instancia de formación con la participación de emprendedoras y emprendedores, a cargo de Pablo Gutiérrez, en la cual se abordaron conceptos básicos y el modo de implementación del programa.<br><br>En la actividad estuvieron presentes el subsecretario Técnico de la Secretaria Legal y Técnica, Emiliano Suaya; la directora del Registro de Dominios de Internet, Andrea Ramos, la diputada nacional, Carolina Gaillard; la secretaria de Modernización, Lucrecia Escandón; el secretario de Desarrollo Económico y Emprendedor, Pedro Gebhart; y la decana de la Facultad de Trabajo Social (UNER), quien recibió a las autoridades en la casa de estudios donde luego se desarrolló la capacitación para Pymes, cooperativas y emprendedoras/es que participaron del encuentro, a cargo de Pablo Gutiérrez.<br><br><strong><br><br>¿De qué se trata el programa Soy tu tienda?<br><br><strong>Es una iniciativa impulsada por NIC Argentina, que depende de la Secretaría Legal y Técnica de la Presidencia de la Nación, junto con otros organismos nacionales, provinciales, locales y organizaciones, con el fin de introducir al comercio electrónico a quienes ya cuenten con un emprendimiento y quieran aprender a crear su propia tienda online, vender a través de Internet y profesionalizar sus proyectos, a través de capacitaciones, acompañamiento técnico y talleres.<br><br>Más información: <a href=\"https://nic.ar/es/novedades/noticias/lanzamos-soy-tu-tienda\" h=\"t\">https://nic.ar/es/novedades/noticias/lanzamos-soy-tu-tienda</a><br><br><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfKKjosbXUyMFhb00smyDTm688TkOH36XdKc3G-d0xrAVB5gw/viewform\" h=\"t\">Inscribite a “Soy tu tienda” acá</a></strong></strong>', 'comercio', '32noticia.jpg', 1, 1),
(33, '2022-07-24', 'Emprendedores participan de jornadas de sensibilización para acceder a créditos de la provincia', 'Desde el Ministerio de Producción, Turismo y Desarrollo Económico de la provincia brindan capacitaciones en localidades de la provincia para que entrerrianos accedan al Programa Jóvenes Emprendedores.', 'En Pronunciamiento, Piedras Blancas y La Paz se llevó a cabo la presentación del programa que está dirigido a jóvenes de entre 18 y 40 años que detenten domicilio real en la provincia de Entre Ríos y cuenten con emprendimientos en marcha o en estado de ideación, vinculados a la producción industrial, agropecuaria, TICs, o de servicios asociados a dichos sectores.<br><br>En los distintos encuentros estuvieron presentes el intendente de Pronunciamiento, Ricardo Luis Sandoval, el secretario de Turismo y Producción de la Municipalidad de Piedras Blancas, Marcelo Varela, el representante de la Asociación para la Promoción de Economía Regional de La Paz, Gastón Ojeda, y el director de Políticas de Formación en Competencias Emprendedoras de la provincia, Marcelo Tisler.<br><br>El crédito Jóvenes Emprendedores no tiene tasa de interés ni necesidad de garantía, y otorga un año de gracia para comenzar con la devolución del mismo a partir de su entrega. En el segundo año se plantea un esquema de devolución consistente en 24 cuotas mensuales consecutivas.<br><br>En ese sentido, se capacitó a emprendedores para la formulación de su idea-negocio, tales como la elaboración del resumen ejecutivo de sus proyectos, la descripción de los objetivos y de los procesos productivos del emprendimiento, la determinación del mercado para la venta de sus productos, entre otros.<br><br>Anteriormente el Programa Jóvenes Emprendedores se presentó en las localidades de Paraná, Hernández, Villa del Rosario, General Galarza, Maciá, San Benito, Victoria, Cerrito, Diamante, Concordia, Federación, Villaguay, Rosario del Tala, Maciá, Viale, Concepción del Uruguay y Gualeguaychú.', 'producción', NULL, 1, 1);
INSERT INTO `noticia` (`id`, `fecha_publicacion`, `titulo`, `subtitulo`, `cuerpo`, `autor`, `imagen`, `categoria`, `active`) VALUES
(34, '2022-08-11', 'Se presentó la Agencia Público-Privado para Promoción de Desarrollo Económico provincial', 'El acto de presentación para la constitución de la Agencia Público-Privado para la Promoción de Exportaciones, Inversiones y Desarrollo Económico de Entre Ríos estuvo encabezado por la vicegobernadora Laura Stratta, junto al ministro de Economía, Hugo Ballay, y el intendente de Paraná Adán Bahl.', 'La actividad se realizó este jueves en la empresa Molinos San José, ubicada en el Parque Industrial General Belgrano.\r\n<br>\r\n<br>\r\n<br>“Hoy venimos a contarles esta definición política que tomó el gobernador Gustavo Bordet de crear esta Agencia Público- Privada para la Promoción de Exportaciones, Inversiones y Desarrollo Económico de Entre Ríos, que tiene que ver con una mirada, una definición política que nos pareció más importante que no fuera letra de un decreto sino que forme parte de una ley, para que tenga una musculatura, trazabilidad y previsibilidad porque necesitamos seguir consolidando en nuestra provincia”, indicó Stratta.\r\n<br>\r\n<br>Recordó el primer encuentro que se llevó a cabo en el puerto de Concepción del Uruguay, donde se escucharon las voces de distintos representantes de entidades e instituciones, empresarios y empresarias. Y continuó: “Tenemos una provincia que produce, un gobierno provincial y local que ordenaron sus cuentas y que invierten, pero también creemos en la articulación público- privado para generar desarrollo social y económico. También creemos en los consensos, en la articulación y en la sinergia, y para ello necesitamos generar espacios de diálogo porque el gobernador Bordet definió además construir colectivamente esta Agencia”.\r\n<br>\r\n<br>Asimismo informó que “en Entre Ríos hay inscritas 67.700 Pymes distribuidas a lo largo y ancho de la provincia, con distintas características y cada una de ellas genera desarrollo local”.\r\n<br>\r\n<br>Sobre el financiamiento a las actividades productivas, confirmó que “en este año se financió por más 51 millones de pesos, lo que representa un 64 por ciento más de lo que se financió el primer trimestre del año anterior”. Y agregó: “En Entre Ríos tenemos 19 cadenas de valor consolidados con perfil agroindustrial, pero también hay otros sectores y empresas que están creciendo como la industria farmacéutica, química, metalmecánica y del conocimiento, a quienes tenemos que seguir acompañando. Y esto nos exige que redoblemos los esfuerzos para dialogar y potenciar el financiamiento, inversión y oferta exportable”.\r\n<br>\r\n<br>Para Stratta, “cuando las empresas crecen y se consolidan, también crece el empleo genuino y eso es lo que necesitamos en la provincia. En Paraná, según dijo el intendente, en el último año se crearon 2000 nuevos puestos de trabajo. En la provincia, se crearon cerca de 4000 en el sector privado- Pero como creemos que no es suficiente, se está trabajando en articulación con la Unión Industrial, en una propuesta público privada para poder potenciar nuevos puestos de trabajo”, subrayó.\r\n<br>\r\n<br>La vicegobernadora señaló además que en la provincia hay 35 Parques Industriales, distribuidos de manera homogénea. “Tenemos que seguir potenciando estas áreas y esos parques industriales, por eso es tan importante la Ley de Promoción Industrial, en el marco de un diálogo fecundo, sincero y genuino, que tenemos que seguir llevando adelante, para generar respuestas integrales a las demandas que nos plantea la sociedad”, acotó.\r\n<br>\r\n<br>Durante su discurso, valoró la presencia de representantes de las Universidades, destacando el rol central que cumple el conocimiento aplicado al desarrollo social y humano. “Necesitamos hacer un Estado eficaz y eficiente, achicar la burocracia y mejorar los procesos administrativos”, dijo en otro tramo de su alocución.\r\n<br>\r\n<br>Al cierre, Stratta rescató la importancia de “compartir información, de afinar el proyecto, de la complementariedad que necesitamos para seguir potenciando y aunando esfuerzos”. También destacó “la entrerrianía, con la distinción de lo que significan nuestros productos entrerrianos en potenciar nuestra oferta exportable”. Y agregó: “Hoy estamos aquí para ratificar un compromiso y una convicción pero sobre todo una decisión que tomó el gobernador Bordet y equipo de trabajo de formalizar esta Agencia Público-Privado para la Promoción de Exportaciones, Inversiones y Desarrollo Económico de Entre Ríos”.\r\n<br>\r\n<br>Por su parte el ministro de Economía, Hacienda y Finanzas del Gobierno de Entre Ríos, Hugo Ballay mostró su agrado por \"compartir este proyecto de una iniciativa público-privada que estuvo siempre dentro de los criterios que nuestro gobernador pregonó\", y explicó que \"desde los inicios de la gestión fue un objetivo ordenar las finanzas del estado provincial, fundamentalmente para poder avanzar en otros temas que hoy ya son concretos, como líneas de crédito para los sectores productores de la provincia aportando subsidios de tasas, que han funcionado con determinados sectores\".\r\n<br>\r\n<br>En este sentido, destacó que \"estamos puliendo un esquema de una línea de créditos similar a las vigentes para que todos los sectores que se desarrollan en la provincia que tengan la posibilidad de acceso\" y que, entre otras iniciativas, se encuentra en desarrollo una nueva ley de promoción industrial \"que tiene la última versión del proyecto trabajada por diputados y con miembros del Ministerio de Producción, que pronto será presentado ante la Cámara baja\".\r\n<br>\r\n<br>Noemí Delizotti, empresaria de Molinos San José y anfitriona del evento, expresó: \"Para Molino San José es un honor recibirlos hoy y especialmente recibirlos con un fin tan importante como es la presentación de una ley, una agencia que va abarcar ejes tan importantes para las empresas como es la inversión y la exportación, y la guinda de la torta que es el desarrollo de la provincia de Entre Ríos”.\r\n<br>\r\n<br>“Tenemos la suerte de tener un gobierno tanto provincial como municipal que no han apoyado muchísimo durante toda su gestión. Ha sido muy importante para las empresas las decisiones que han tomado en la pandemia no cerrando las fábricas, los comercios y permitiendo trabajar y mantener no solo la economía privada de cada uno de nosotros y de los trabajadores sino que mantener la economía de la provincia\", dijo la empresaria. “Es muy triste ver que en otras provincias y otras localidades, donde cómo ha afectado decisiones cerradas en esto llevó al cierre de muchas fábricas y muchos comercios. Sabemos que podemos trabajar siempre con el apoyo de nuestros gobiernos y esto para nosotros es vital, así que gracias por ocuparse, gracias en nombre del Parque industrial de Paraná, que siempre tienen las puertas abiertas, es un honor recibirlos”, manifestó.\r\n<br>\r\n<br>El intendente Adán Bahl destacó la iniciativa del gobernador Bordet porque \"de las 47 empresas que están instaladas en el Parque, 12 son exportadoras netas, con el objetivo de que muchas más puedan también exportar. El ingreso de divisas es una de las prioridades que hoy tiene la Argentina. Estamos muy felices y vamos a aportar todo lo necesario y a trabajar sinérgicamente con el Gobierno provincial, como lo hacemos todos los días”.\r\n<br>\r\n<br>“Concretamente en Paraná, en los últimos seis meses, se han generado casi dos mil nuevos puestos de trabajo privados. El Parque Industrial ha tenido un aporte significativo porque desde el primer día venimos gestionando y haciendo obras en el predio para tener accesibilidad, conectividad, una excelente iluminación y un sistema de seguridad. En ese sentido, actualmente estamos haciendo todo el cierre perimetral”.\r\n<br>\r\n<br>Al mismo tiempo, Bahl anunció que “hoy se promulgó la ordenanza para comprar 200.000 metros cuadrados, más de 20 hectáreas que vamos a anexar al Parque Industrial. Hay muchas empresas interesadas en venir a radicarse y necesitamos más lugar. Esto implica más movimiento económico pero sobre todo, la generación de más puestos de trabajo, algo fundamental para la construcción de una Ciudad Capital\".\r\n<br>\r\n<br>En tanto, Gabriel Bourdin, presidente de la UIER y empresario Petropack SA, expresó: “Mostrar nuestro beneplácito por este tipo de herramientas que se van poniendo en marcha. Es un conjunto de herramientas que necesita nuestro sector productivo para poder conseguir mercados externos”. Y continuó: “Celebro esta construcción colectiva, que considero que es lo más importante, y no solo de esta construcción colectiva, sabiendo que todos somos participantes del estado, no solo sumar al gobierno en esto sino el poder trabajar entre nuestras mismas asociaciones en forma conjunta, porque los que buscamos es de qué manera nosotros vamos a hacernos fuertes”.\r\n<br>\r\n<br>“No considero que nuestra querida Argentina y nuestra hermosa provincia que tenemos pueda tener una salida si no es en forma conjunta y sobre todo con trabajo. Seguramente habrá cosas para mejorar y propuestas para que esto sea exitoso, pero lo que tenemos que tener en mente es que lo que estamos celebrando es poder ponernos de acuerdo en las políticas públicas que queremos llevar adelante. Desde esta base es desde donde vamos a construir realmente esa Entre Ríos que queremos”.\r\n<br>\r\n<br><br><strong>Presencias</strong><br>Acompañaron a la Vicegobernadora, el presidente de la Cámara de Diputados de Entre Ríos, Ángel Giano, los diputados Nestor Loggio, Julio Solanas y la diputada Stefanía Cora; el senador provincial por el departamento Paraná y secretario de la Comisión de Producción, Juan Carlos Kloss; el secretario de Desarrollo Económico y Emprendedor Entre Ríos, Pedro Fernando Gebhart; el secretario de Industria y Comercio, Fernando Caviglia; el secretario de Hacienda, Inversión, Empleo, Ciencia y Tecnología del municipio de Paraná Eduardo Macri; entre otros legisladores, funcionarios provinciales y municipales, invitados especiales.\r\n<br>\r\n<br>De la actividad participaron distintas entidades e instituciones como la Asociación de Empresas del Parque Industrial de Paraná (ASEMPI), la Unión Industrial de Entre Ríos (UIER), el Consejo Empresario de Entre Ríos; la Federación Económica de Entre Ríos, la Bolsa de Cereales de Entre Ríos, la Asociación de Industriales Metalúrgicos de Entre Ríos, el Polo Tecnológico de Paraná, la Cámara de Productores Porcinos; y la Asociación de Pequeñas y Medianas Empresas Lácteas.\r\n<br>\r\n<br>Asimismo, la Cámara de Exportadores de Citrus del Noreste Argentino, la Cámara Entrerriana de Turismo, la Mesa Empresaria de Turismo de Entre Ríos, el Colegio de Profesionales en Turismo de la Provincia de Entre Ríos, el Centro de Industrias Lácteas de Entre Ríos, el Instituto del Seguro, el Clúster del Pecán, la Asociación de Pequeños y Medianos Empresarios, la Cámara de Industrias Cárnicas de Entre Ríos, la Cámara de Industriales del Extrusado Prensado y derivados de Entre Ríos, la Corporación para el Desarrollo de Paraná y la Federación Empresaria Hotelera Gastronómica de la República Argentina. Además, empresas como Eriochem, Lafedar, Dominguez Lab y representantes de entidades radicadas en la zona.\r\n<br>También estuvieron presentes representantes de la Universidad Nacional de Entre Ríos (UNER) y de la Universidad Autónoma de Entre Ríos (UADER).\r\n<br>\r\n<br>(Prensa Vicegobernación).', 'vicegobernación', '34noticia.jpg', 1, 1),
(35, '2022-08-17', 'La vicegobernadora y Cancillería avanzaron en estrategias para seguir potenciando la oferta exportable entrerriana', 'Con Cecilia Todesca y Fernando López, de Cancillería, la vicegobernadora Laura Stratta dialogó sobre la propuesta para la creación de la Agencia Público- Privada para la Promoción de Exportaciones.', 'Posteriormente con Luciana Tito y Lila Anllo abordó la participación entrerriana en el Women Economic Forum Argentina 2022.\r\n<br>\r\n<br>La vicegobernadora de Entre Ríos, Laura Stratta, llevó adelante este martes una intensa jornada de trabajo en la ciudad de Buenos Aires con funcionarios de Cancillería Argentina.\r\n<br>\r\n<br>En primer lugar en el Palacio San Martín mantuvo un encuentro con Cecilia Todesca, secretaria de Relaciones Económicas Internacionales del Ministerio de Relaciones Exteriores, Comercio Internacional y Culto, y con Fernando López, director de Promoción de Exportaciones de la Subsecretaría de Promoción de Comercio e Inversión.\r\n<br>\r\n<br>Acompañaron a la vicegobernadora los funcionarios provinciales Pedro Gebhart, secretario de Desarrollo Económico y Emprendedor y Juan Mansur, director general de Comercio Exterior.\r\n<br>\r\n<br>En la oportunidad se le hizo entrega a Todesca y López de una herramienta digital elaborada por el gobierno provincial que reúne toda la oferta exportable entrerriana.\r\n<br>\r\n<br>El objetivo es que este material esté presente en todas las embajadas y representaciones del Gobierno Nacional en el exterior para la difusión de los productos entrerrianos y la búsqueda de oportunidades comerciales para empresas de la provincia.\r\n<br>\r\n<br>Al mismo tiempo, Stratta interiorizó al equipo de Cancillería sobre la Agencia Público-Privado para la Promoción de Exportaciones, Inversiones y Desarrollo Económico de Entre Ríos, la propuesta que se viene trabajando con sectores productivos e industriales de la provincia para impulsar y expandir las ventas entrerrianas al exterior. Luego invitó a las autoridades nacionales a participar de la eventual presentación del proyecto de ley provincial para la creación de esta Agencia.\r\n<br>\r\n<br>“Tenemos un gobierno que ordenó sus cuentas, una provincia que produce y queremos seguir potenciando ese crecimiento”, resumió la vicegobernadora tras el encuentro.\r\n<br>\r\n<br>En el marco de la agenda desarrollada con Cancillería, Stratta por otro lado, se reunió con la Jefa de Gabinete de ese organismo, Luciana Tito, con quien abordó aspectos vinculados al Women Economic Forum Argentina 2022 que se realizará en octubre y que contará con la participación de empresarias entrerrianas.\r\n<br>\r\n<br>Posteriormente, hizo lo propio con la directora general de este foro Lina Anllo, a quien le agradeció el recibimiento, tras destacar la importancia de que Entre Ríos forme parte de este importante evento.\r\n<br>\r\n<br>(Prensa Vicegobernación)', 'vicegobernación', '35noticia.jpg', 1, 1),
(36, '2022-08-26', 'Se realizó el lanzamiento de la plataforma de comercio exterior de la provincia', 'La vicegobernadora Laura Stratta y el ministro de Economía, Hacienda y Finanzas, Hugo Ballay, participaron del lanzamiento de la plataforma digital de comercio exterior “Entre Ríos Exporta”. La actividad fue este jueves por la tarde en la sede de la Bolsa de Cereales de Entre Ríos, en Paraná.', 'Se trata de una propuesta innovadora que cuenta con el respaldo de la Unión Industrial de Entre Ríos; el Consejo Empresario; la Bolsa de Cereales y de Comercio; y la Cámara de Comercio Exterior; y con el aporte técnico del Polo Tecnológico del Paraná.\r\n<br>\r\n<br><br>“Queremos celebrar junto a ustedes el lanzamiento de esta plataforma que es parte de un proceso que hoy comienza y que se afianza para potenciar la oferta exportable, las actividades productivas y el desarrollo económico de la provincia”, dijo Stratta. “Esta herramienta que es parte de esta línea y articulación público -privado se inscribe en esta línea de pensar la provincia para mediano y largo plazo”, añadió.\r\n<br>\r\n<br>En ese mismo sentido, mencionó los encuentros con el sector para conformar la Agencia Público-Privado para la Promoción de Exportaciones, Inversiones y Desarrollo Económico de Entre Ríos. “Es una definición política que tomó el gobernador Gustavo Bordet y nos pareció importante que se plasme en una ley, para que tenga una musculatura, trazabilidad y previsibilidad”, explicó la vicegobernadora.\r\n<br>\r\n<br>Luego consideró que “construir políticas de Estado a mediano y largo plazo, en articulación, significa trazar un camino distinto para Entre Ríos, un camino de crecimiento basado en el diseño de mejores políticas públicas. Por eso, necesitamos seguir potenciando esta alianza estratégica”, concluyó.\r\n<br>\r\n<br>A su turno, el ministro Ballay felicitó a las cinco instituciones que en 2021 firmaron un convenio marco que les permitió avanzar con esta plataforma digital. “Hoy estamos nuevamente concretando la colaboración entre lo público y lo privado”, subrayó tras mencionar las acciones conjuntas que se vienen concretando con los sectores productivos e industriales de la provincia. “Es por eso que estoy muy contento por esta interacción”, añadió el ministro de Economía, y finalmente consideró “el enorme potencial de nuestra provincia, que tiene mucho para dar todavía”.\r\n<br><br>\r\n<br>La apertura de la actividad estuvo a cargo del presidente de la Bolsa de Cereales Entre Ríos, Diego Maier, quien destacó la iniciativa de la plataforma digital, fruto del trabajo conjunto de las cinco entidades y el gobierno provincial. “La potencia está en sumar esfuerzos de lo público y privado para poder lograr una herramienta que sea de utilidad y lleve desarrollo a la economía entrerriana”, resaltó.\r\n<br>\r\n<br><br>Por su parte, Alfredo Calabrese, vicepresidente Bolsa de Comercio, hizo una breve reseña del proyecto; destacó el apoyo el Gobierno y valoró el trabajo compartido calificándolo como “muy fecundo” entre las entidades que forman parte del Consejo Consultivo Interinstitucional: Unión Industrial de Entre Ríos, el Consejo Empresario de Entre Ríos, la Bolsa de Cereales de Entre Ríos, la Bolsa de Comercio de Entre Ríos y la Cámara de Comercio Exterior de Entre Ríos.\r\n<br><br>\r\n<br>Seguidamente, Aquiles Guillermo Arús, presidente de la Cámara de Comercio Exterior de Entre Ríos, expresó unas palabras en representación del sector exportador provincial y de las organizaciones que integran el proyecto.\r\n<br><br>\r\n<br>Luego, Salvador Alejandro Celía, Cofounder de Be The Driver, habló sobre el desarrollo técnico de la plataforma entreriosexporta.com\r\n<br><br>\r\n<br>Y finalmente, Pablo Zárate, responsable de Comercio Exterior de Petropack S.A., como potencial usuario, se refirió a los beneficios de la plataforma digital entreriosexporta.com para la promoción de la oferta exportable.\r\n<br>\r\n<br>\r\n<br>\r\n<br><strong>Plataforma digital</strong>\r\n<br>\r\n<br>La plataforma de comercio exterior tiene como objetivo central promover el desarrollo del sector exportador entrerriano de manera sostenible y potenciar las cadenas de valor provinciales que lo componen, facilitando el acceso a nuevos mercados y el posicionamiento de los productos y servicios entrerrianos en el mundo. Esta herramienta está destinada a pymes, agentes y prestadores de servicios relacionados con el comercio exterior de la provincia.\r\n<br>\r\n<br>Desde las instituciones que integran el proyecto se invita a las empresas y emprendedores a registrar sus productos y servicios en la plataforma y a seguir las redes sociales vinculadas al proyecto.\r\n<br>\r\n<br>\r\n<br>\r\n<br><strong>Presencias</strong>\r\n<br>\r\n<br>Participaron además, los secretarios de Industria y Comercio y Desarrollo Económico, Fernando Caviglia y Pedro Gebhart; y el director general de Comercio Exterior, Juan Mansur. También estuvo presente Patricia Popelka, Gerente General de Elevadores Neumáticos S.A. y miembro del Consejo Empresario de Entre Ríos; el titular del Polo Tecnológico de Paraná, Joel Lifschitz; entre otros invitados especiales.', 'vicegobernación', '36noticia.jpg', 1, 1),
(37, '2022-09-01', 'Más de 300 emprendedores se capacitaron en diferentes localidades de la provincia', 'Desde el Ministerio de Producción se llevan adelante capacitaciones de asistencia comercial dirigidas a emprendedores. Las mismas ya se realizaron en las localidades de Villaguay, General Galarza, Urdinarrain, Concepción del Uruguay, Villa del Rosario, Gualeguaychú, Villa Elisa, Viale y San José.', 'Las capacitaciones, talleres y seminarios son de participación gratuita y abiertas a la comunidad, y se llevan adelante en el marco del Programa de Formación en Competencias Emprendedoras de la Secretaría de Desarrollo Económico y Emprendedor de la provincia. Se brindan más de 20 propuestas temáticas y se realizan conjuntamente con municipios e instituciones del ecosistema emprendedor.\r\n<br>\r\n<br>En ese sentido, se realizaron las capacitaciones Nuevas formas de atender al cliente, en la localidad de Villaguay; Comercializa con tus redes sociales en General Galarza; Arma tu modelo de negocios en Urdinarrain; Imágenes que venden en Concepción del Uruguay; Emprendimientos con impacto en Villa del Rosario; el curso que cuenta con cuatro encuentros Capacitación en gestión emprendedora y empresarial en la ciudad de Gualeguaychú; Los números de mi emprendimiento realizada en Viale y en Villa Elisa, y Mis imágenes, mis ventas en San José.\r\n<br>\r\n<br>Los encuentros contaron con la presencia del director general de Desarrollo Emprendedor de la provincia, Claudio Rosas Vico, el director de Formación en Competencias Emprendedoras de Entre Ríos, Marcelo Tisler.\r\n<br>\r\n<br>Próximos encuentros\r\n<br>- viernes 5 de septiembre, 15:00hs, Rosario del Tala. Capacitación Organiza tu modelo de negocios en el Salón Consejo Deliberante.\r\n<br>- martes 6 de septiembre, 14:00hs, San Benito. Capacitación Imágenes que venden en el NIDO (Buenos Aires y Misiones).\r\n<br>- Martes 6 de septiembre, 19:00hs, Crespo. Capacitación Mis imágenes, mis ventas. Sala Auditorio Municipal Eva Perón (San Martín 1327, Crespo).', 'Secretaría de Desarrollo Económico y Emprendedor', '37noticia.jpg', 1, 1),
(38, '2022-09-27', 'Empresarias se reunieron con Bordet y valoraron el apoyo a los emprendimientos liderados por mujeres', 'Empresarias entrerrianas que participaron de la misión comercial a Italia fueron recibidas por el gobernador, Gustavo Bordet y la vicegobernadora, Laura Stratta. Valoraron el apoyo del gobierno provincial a la exportación y al desarrollo de emprendimientos productivos liderados por mujeres.', 'Participó también del encuentro del ministro de Economía y Producción, Hugo Ballay. En ese marco, la propietaria de la Cabaña Apícola Reina Madre de Maciá, Eladia Weber, explicó que “es importante para las pequeñas empresas que desde el gobierno nos escuchen y se interesen por nuestra producción, que en Entre Ríos es muchísima y muy variada”. “Me siento orgullosa de mi provincia y más con esta recepción del gobernador”, acotó.\r\n<br>\r\n<br>Weber destacó la misión comercial, remarcó que “colmamos todas las expectativas”, y valoró el acompañamiento de la vicegobernadora que “nos brindó su apoyo”. “Poder charlar con otras mujeres sobre lo que hacemos es importante, ya que muchas llevamos adelante la economía de nuestros hogares”, subrayó.\r\n<br>\r\n<br>Por último, contó que “queremos sumar a más mujeres, emprendedoras y empresarias, para que puedan cumplir sus sueños y dar a conocer los productos que realizan”.\r\n<br>\r\n<br><br><br><strong>Más allá de la misión</strong>\r\n<br>\r\n<br>En tanto, la propietaria de Doninas SAS, Julia Fontana, expresó que “le presentamos al gobernador nuestras empresas y productos, y la experiencia que tuvimos en la misión comercial a Italia”.\r\n<br>\r\n<br>En esa línea, sostuvo que “fue muy importante que pueda conocer lo que hacemos en Entre Ríos y todo lo que tenemos para mostrar al país y al mundo. También pudo atender las necesidades que tenemos en nuestras empresas, por lo cual el balance es súper positivo”.\r\n<br>\r\n<br>“La idea es continuar el trabajo para invitar a más mujeres y avanzar más allá de la misión que nos congregó. Abarcar otros temas y a más mujeres”, concluyó Fontana.\r\n<br>\r\n<br><br><br><strong>Hacer realidad este proyecto</strong>\r\n<br>\r\n<br>Por su parte, la propietaria de la empresa Amándote, de Gualeguaychú, Gabriela de la Torre, aseguró que “este encuentro con el gobernador fue el broche de oro de la misión”.\r\n<br>\r\n<br>Remarcó que durante su presencia en Italia “pudimos ver otros mercados, analizarlos y ver oportunidades a mediano y corto plazo”, y puntualizó “el apoyo de la provincia para facilitarnos el camino”, porque “así sabemos que podemos hacer realidad este proyecto por el acompañamiento”.\r\n<br>\r\n<br>“Los pasos a seguir son hacer las propuestas a los posibles clientes y contactos que logramos, y evaluar la posibilidad de participar de nuevas rondas de negocios en otros países. Viajar permite conocer culturas y costumbres, ampliar la mirada, no cerrarnos en lo que hacemos sino en las necesidades que pueden surgir en otros mercados y que nosotros podemos ser un potencial proveedor. El balance de la reunión es extremadamente positivo”, detalló De Torre.\r\n<br>\r\n<br>Entre Ríos tiene potencial\r\n<br>\r\n<br>Por último, la gerente de administración y gestión comercial de la empresa Caysi S.A., de Oro Verde, Julieta Aimone, señaló que “el encuentro fue excelente, porque el gobernador Gustavo Bordet tomó las actividades que hacemos cada una y se asombró por la novedad y particularidad de nuestros productos”.\r\n<br>\r\n<br>“Esto refuerza que seguimos teniendo en Entre Ríos una gran potencial, tanto en el nivel emprendimientos empresarios y, sobre todo, en las que están lideradas por mujeres”, subrayó Aimone.\r\n<br>\r\n<br>Seguidamente reveló que “la misión comercial a Italia fue excelente, porque salimos a los mercados internacionales a tomar conocimiento de cuál es su situación. También conocer las necesidades para tener opciones de emprendimiento dentro de la propia empresa y generar unidades de negocios”.\r\n<br>\r\n<br>“Tenemos pensado generar un espacio para seguir potenciando a las mujeres empresarias, las emprendedoras, para seguir teniendo lugar, herramientas y márgenes para continuar creciendo”, manifestó.<br><br>\r\n<br><strong>Un piso de igualdad</strong>\r\n<br>\r\n<br>Por su parte, la vicegobernadora Laura Stratta resaltó que \"para nosotros es muy importante decir que esta fue la primer misión comercial exclusivamente de mujeres, donde emprendedoras y empresarias pudieron llegar a otro país a mostrar lo que hacen, sus productos y también la forma de liderar las empresas”.\r\n<br>\r\n<br>“Había representaciones de todas las provincias y Entre Ríos fue una de las delegaciones más nutridas y que más posibilidades también generó”, resaltó Stratta, y explicó que eso fue posible gracias a la decisión del gobernador Gustavo Bordet de “generar un piso de igualdad desde donde caminar”.\r\n<br>\r\n<br>Por último, resaltó la importancia de “incorporar emprendedores y emprendedoras a las misiones comerciales para que sus productos, que son de excelente calidad, puedan llegar a más mercados en el marco de la estrategia que lleva adelante Entre Ríos para potenciar las exportaciones, la generación de divisas y, sobre todo, la creación de puestos de trabajo”.<br><br>\r\n<br><strong>Participantes</strong>\r\n<br>\r\n<br>De la reunión participaron Gabriela María de los Ángeles De La Torre, por el emprendimiento AMANDOTE de Gualeguaychú. La empresa desarrolla infusiones tales como mate de té y blends de yerba mate. Recientemente han logrado la aprobación para incorporar la Marca País a sus productos.\r\n<br>\r\n<br>Carola Bolzán, de BIO NOGOYÁ SA de Nogoyá. La empresa se dedicada a la producción y comercialización de biocombustibles a base de Aceite de Soja. También ofrecen un subproducto que es la glicerina cruda.\r\n<br>\r\n<br>Julia Fontana Doninas, de DONINAS SAS de Aldea María Luisa, elabora galletitas sin gluten, dulces, saladas y sin azúcar. Como principal diferencial ofrecen un alimento con agregados de insumos naturales como los son las frutas secas, semillas, frutas desecadas y esencias naturales aptos para celíacos. Cuentan con certificación de productos libre de gluten.\r\n<br>\r\n<br>Eladia Weber Criadero, de CABAÑA APÍCOLA REINA MADRE de Maciá, quienes trabajan con colmenas y comercialización de abejas reinas vivas. La genética que presentan las abejas es italiana resistente a enfermedades. La empresa realizó una exportación a Francia hace algunos años generando una experiencia favorable en el proceso de comercialización exterior. La firma tiene también producción de miel por lo que en la Ronda de Negocios en Italia se ofrecerán ambos productos.\r\n<br>\r\n<br>Julieta Aimone, de CAYSI SA de Oro Verde. La empresa exporta el servicio de montaje, mantenimiento, reparación y puesta en marcha de Plantas Asfálticas y de Hormigón. También ofrece el servicio de reparación de equipos viales. La empresa ha exportado su servicio a Italia, Alemania, Uruguay y Perú. Además se ha asociado con MARINI Spa Italia, por lo que realizan la asistencia técnica y el montaje en Sudamérica.\r\n<br>\r\n<br>Durante la Misión las empresarias conocieron la Feria Sana Bologna, dedicada a promover la nutrición y estilo de vida saludable y el Mercado Agroalimentario de Milán, con el cual se firmó convenio de entendimiento para el ingreso de productos entrerrianos. También mantuvieron vínculos comerciales en Rondas de Negocios de las que participaron tanto en Roma como en Milán, participaron de un encuentro con Cámaras empresariales regionales y de una reunión con Cluster Lombardo Scienze della Vita.', 'Gobierno de Entre Ríos', '38noticia.jpg', 1, 1),
(39, '2022-09-12', 'La provincia brinda asesoramiento sobre financiamiento a jóvenes empresarios y emprendedores de Paraná', 'La provincia brindó asesoramiento a jóvenes empresarios y emprendedores de Paraná sobre distintas líneas de financiamiento que ofrece la provincia, a través de la Secretaría de Desarrollo Económico y Emprendedor.', 'La actividad fue organizada por el Ministerio de Producción junto a la Confederación Argentina de la Mediana Empresa (CAME), el Centro Comercial e Industrial de Paraná (CECIP) y Jóvenes Empresarios de Paraná (JEP).\r\n<br>\r\n<br>En la oportunidad, se expusieron las diversas líneas de la Secretaría de Desarrollo Económico y Emprendedor dirigidas a empresas y emprendimientos, tales como los programas provinciales Jóvenes Emprendedores; Asistencia Financiera para la Consolidación Productiva dirigido a empresas; líneas de crédito MiPyME junto al Banco de Entre Ríos y al Banco Nación Argentina; el Programa Federal de Reactivación Productiva, líneas de Aporte No Reembolsables del Fondep, entre otras.\r\n<br>\r\n<br>Al respecto, el director general de Desarrollo Emprendedor de la provincia, Claudio Rosas Vico, destacó que, “a partir de un proceso que tuvimos con el Programa Jóvenes Emprendedores, identificamos que además del financiamiento inicial se necesitan herramientas de asistencia técnica para acompañar los diferentes proyectos. Por otro lado, existen muchas experiencias de emprendedores que pasaron a ser Mipymes, y en ese sentido, también estamos acompañando a través de los programas de asistencia financiera y técnica, tanto provinciales como nacionales”.\r\n<br>\r\n<br>Estuvieron presentes la directora de Asistencia Mipyme de Entre Ríos, Erika Cardozo, y el presidente de la Cámara de Jóvenes Empresarios de Paraná, Jorge Nery. <br>', 'Secretaría de Desarrollo Económico y Emprendedor', '39noticia.jpg', 1, 1),
(40, '2022-09-29', 'Invitan a emprendedores de Paraná a participar de capacitaciones sobre marketing digital', 'Las mismas darán inicio el día miércoles 5 de octubre y es organizado por la Secretaría de Desarrollo Económico y Emprendedor de la provincia junto al Club de Emprendedores de Paraná.', NULL, 'Secretaría de Desarrollo Económico y Emprendedor', '40noticia.jpg', 1, 1),
(41, '2022-10-10', 'Se llevó a cabo un encuentro sobre gestión de redes sociales dirigido a emprendedores', 'Organizada por el Ministerio de Producción y el Club de Emprendedores de Paraná, se realiza en la capital entrerriana una capacitación sobre gestión de redes sociales para emprendedores.', 'Se trata del taller “Liderá tu negocio: Gestión estratégica de redes sociales” que cuenta con cuatro encuentros intensivos. Los mismos son dictados por profesionales de la comunicación visual y la comunicación social.\r\n<br>\r\n<br>Las capacitaciones se realizan en el Club de Emprendedores de Paraná, y se llevan a cabo en el marco del Programa de Formación en Competencias Emprendedoras de la Secretaría de Desarrollo Económico y Emprendedor de la provincia\r\n<br>\r\n<br>En el primer encuentro estuvo presente el director de Formación en Competencias Emprendedoras de Entre Ríos, Marcelo Tisler.', 'Secretaría de Desarrollo Económico y Emprendedor', NULL, 1, 1),
(42, '2022-10-24', 'Entre Ríos en la Feria Internacional de la Alimentación', 'Con apoyo del gobierno entrerriano, empresarios y emprendedores de diversas localidades de la provincia presentaron sus productos en la Feria Internacional de Alimentación de Rosario, que tuvo lugar del 19 al 22 de octubre.', 'Se trata de la edición N° 12 de FIAR, que viene desarrollándose desde 1998. En esta oportunidad, participaron la empresa Entrenuts SRL de Colón, la MiPyME 7 Colinas de Concepción del Uruguay, y el emprendimiento Evouovo de Paraná.\r\n<br>\r\n<br>El stand provincial se organizó en el marco del Programa de Apoyo al Comercio Emprendedor de la Secretaría de Desarrollo Económico y Emprendedor de Entre Ríos, que impulsa la participación de MiPyMEs y emprendimientos entrerrianos en eventos nacionales e internacionales para impulsar la ampliación de sus ventas.\r\n<br>\r\n<br>La misma contó con la participación de empresas e industrias alimenticias de Santa Fe, Buenos Aires, Córdoba, San Luis, Entre Ríos, Catamarca, Salta, entre otras. En lo que respecta a las rondas internacionales, estuvieron presentes empresarios de Colombia, Costa Rica, Honduras, Perú, Brasil, Paraguay, Bolivia, Uruguay y Chile.\r\n<br>\r\n<br>Por su parte, el secretario de Desarrollo Económico y Emprendedor de la provincia, Pedro Gebhart, expresó que: “Es de gran orgullo acompañar a empresas y emprendimientos entrerrianos en las diversas exposiciones, ferias y eventos internacionales. Sabemos que para ciertos rubros estos encuentros dan a conocer sus productos e incrementan sus ventas, interactúan con futuros clientes, competidores e identifican tendencias de mercado”.\r\n<br>\r\n<br>En el encuentro estuvo presente el director general de Desarrollo Emprendedor de Entre Ríos, Claudio Rosas Vico.<br><br>\r\n<br><strong>Emprendimientos disertantes</strong>\r\n<br>\r\n<br>- Entrenuts SRL es una empresa productora y comercializadora de productos saludables libres de gluten. La misma dio sus inicios en marzo del 2020 en la ciudad de Colón, Entre Ríos, con la producción de pasta de maní en sus 7 sabores. A la actualidad comercializan a las 24 provincias del país a través de distribuidores, mayoristas y cadenas de supermercado. Además, incorporaron productos de características saludables como la miel, leche de maní, aceite de coco, dulce de leche con y sin azúcar y alfajores. Hoy alcanzan entre 70.000 y 80.000 unidades de productos al mes.\r\n<br>\r\n<br>\r\n<br>- 7 Colinas comenzó en el año 2017 cuando abre las puertas del bar Fábrica 7 Colinas de Concepción del Uruguay, con 4 estilos de cerveza y tirada de barril. Ya en el año 2018 los estilos de cerveza llegaron a 10 y en el año 2019 a 25 estilos de cerveza. Durante la pandemia comenzaron a enlatar y embotellar cerveza y desarrollaron la línea de destilados que contempla la elaboración de whisky single malt, gin y ron. En el año 2022 lanzan el Gin bajo la denominación Séptimo. El volumen de producción actual es de 12.000 litros mensuales.\r\n<br>\r\n<br>\r\n<br>- Evouovo nace en la ciudad de Paraná y ofrece un producto que funciona como complemento al consumo diario de huevo. En ese sentido, brinda al consumidor la opción de incorporar huevo saliendo de la forma tradicional y convencional. Trabajan en el fraccionamiento, empaquetado, etiquetado y distribución, y la producción de huevo en polvo es realizada por productores de Crespo. Actualmente desarrollan 5 productos: huevo entero, clara de huevo, clara de huevo alto batido, clara de huevo hidrolizada y clara de huevo hidrolizada saborizada con cacao 100% endulzada con estevia.<br>', 'Secretaría de Desarrollo Económico y Emprendedor', '42noticia.jpg', 1, 1),
(43, '2022-11-16', 'Difunden los beneficios del aval del Fogaer a las pymes entre contadores y contadoras de la provincia', 'Con modalidad presencial y virtual, se llevó a cabo una instancia de diálogo entre el Fondo de Garantías de Entre Ríos (Fogaer) y el Consejo Profesional de Ciencias Económicas. Se abordaron las herramientas con las que cuentan las pymes para financiarse a través del mercado de capitales.', 'Se trata de la primera acción conjunta que ambos organismos llevan a cabo luego de la firma del convenio de colaboración mutua. El objetivo es difundir entre las y los profesionales de ciencias económicas las herramientas y garantías que el Fogaer pone a disposición de las pymes entrerrianas que le permitirán financiarse a través del mercado de capitales y mejorar su posicionamiento en el sistema bancario. Así como también dar a conocer las líneas de financiamiento con tasas subsidiadas por el gobierno provincial.\r\n<br>\r\n<br>“La idea es apelar a la ayuda de los y las profesionales de ciencias económicas para difundir los beneficios que el Fogaer le brinda a los empresarios entrerrianos para avalar los préstamos que estén pensando tomar y ofrecerles la posibilidad de introducirse en el mercado de capitales”, expresó el presidente del Fogaer y secretario de Hacienda de la provincia, Gustavo Labriola.\r\n<br>\r\n<br>El funcionario provincial describió como “un orgullo poder estar en al casa de todos los contadores y contadoras de Entre Ríos”. Explicó que la instancia de hoy “es virtual y presencial, en Paraná”, pero que “tenemos el compromiso de llevarlo a cada una de las ciudades donde requieran esta información para vincular al empresario que necesita aval para su financiamiento con aquellos que tienen los recursos, que queremos que permanezcan en la provincia para financiar más producción, infraestructura y genere trabajo entrerriano”.\r\n<br>\r\n<br>“El Fogaer, como fondo de garantía provincial, es un instrumento ineludible para posibilitar que todos aquellos que están en una economía informal puedan pasar a la economía formal, y que tengan la posibilidad de acceder a créditos en condiciones más ventajosas, sea por tasas más convenientes o extensión de plazos\", puntualizó Labriola.\r\n<br>\r\n<br>Por último, el titular del Fogaer explicó que la actividad fue desarrollada en forma conjunta con las secretarías de Comercio e Industria, y de Desarrollo Emprendedor, para “brindar un pantallazo de todas las líneas de crédito que hoy están disponibles, ya que muchas cuentan con tasas de interés subsidiadas por el gobierno provincial y representan una buena oportunidad para financiarse”, concluyó.\r\n<br>\r\n<br>Por su parte, el tesorero del Consejo de Profesionales de Ciencias Económicas, Saúl Deris, sostuvo que el objetivo de la entidad es que “los colegas puedan ofrecerle una posibilidad de un servicio a sus clientes, al transmitir todas las ventajas que tiene el Fogaer como acceder al mercado de capitales, mejores tasas, mejores condiciones de plazo. Además, a través de ese asesoramiento, creemos que el colega puede ampliar su cartera de clientes y también ayudar al empresariado entrerriano”.\r\n<br>\r\n<br>\"Es transformar parte del ahorro entrerriano a través del Fogaer y, mediante el Fogaer, que llegue al empresariado entrerriano que son nuestros clientes, los que nos dan trabajo”, recordó.\r\n<br>\r\n<br>El referente del Consejo, valoró la herramienta del Fogaer que pone a disposición el Estado de la provincia: \"es una herramienta muy buena y poco conocida”, dijo, y agregó: “es por eso que nos involucramos en estas actividades, que le permite al pequeño empresario acceder al mercado capitales, a mejores condiciones de tasa, mejores plazos y a otros circuitos”. “Tener una carpeta garantizada por el Fogaer permite que tu banco te califique mejor\", resaltó Deris.\r\n<br>\r\n<br>En esta primera jornada participaron 120 personas de toda la provincia conectadas de forma virtual, más asistentes presenciales. Sin embargo, Deris remarcó que estos cursos quedarán disponibles en la página del Concejo para sus socios. \"Tenemos una aula virtual en la que se puede acceder las 24 horas y donde acceden los más de 3.400 matriculados que tenemos actualmente\", precisó y puso de relieve que el Cpceer posee 14 delegaciones en toda la provincia, incluida la de la ciudad de Paraná.', 'Secretaría de Desarrollo Económico y Emprendedor', NULL, 1, 1),
(44, '2022-12-16', 'La provincia integra el Consejo Federal para el Desarrollo Emprendedor', 'Se realizó la primera reunión del Consejo Federal para el Desarrollo Emprendedor que aglutina a todas las provincias del país y es impulsado por el Ministerio de Economía de la Nación.', 'El encuentro contó con la presencia autoridades provinciales y representantes de la Secretaría de Industria y Desarrollo Productivo del Ministerio de Economía de la Nación.\r\n<br>\r\n<br>El objetivo de la nueva mesa de trabajo es fortalecer la vinculación federal, profundizar las políticas para la promoción de los ecosistemas emprendedores locales, impulsar el intercambio de experiencias y colaborar en la identificación de sectores productivos con potencial desarrollo.\r\n<br>\r\n<br>En representación de Entre Ríos, estuvo presente el director general de Desarrollo Emprendedor de la provincia, Claudio Rosas Vico, quien expresó que: “La articulación de nuestra provincia con Nación es fundamental para acompañar a los emprendedores y emprendedoras desde sus inicios y su crecimiento, ya que trabajamos tanto con líneas de asistencia técnica y financiera provinciales como nacionales. Además, consideramos fundamental este espacio para compartir y conocer las experiencias de otras provincias del país”.\r\n<br>\r\n<br>Por otro lado, se presentó el Programa Emprendimiento Argentino, una línea nacional que brinda créditos de hasta 50 millones de pesos para la consolidación de emprendimientos. Para acceder a más información sobre este programa comunicarse a: economicoemprendedorer@gmail.com.', 'Secretaría de Desarrollo Económico y Emprendedor', '44noticia.jpg', 1, 1);
INSERT INTO `noticia` (`id`, `fecha_publicacion`, `titulo`, `subtitulo`, `cuerpo`, `autor`, `imagen`, `categoria`, `active`) VALUES
(45, '2023-01-13', 'El detalle de los aportes y el financiamiento para impulsar la producción que entregaron Bordet y Massa', 'Con el objetivo de fortalecer a los productores del sector avícola y porcino, producir más valor agregado, generar empleo y arraigo territorial, el gobernador Gustavo Bordet y el ministro de Economía, Sergio Massa, anunciaron una batería de inversiones, programas y obras para Entre Ríos. El detalle.', 'Durante el acto que se llevó a cabo el jueves en la planta Asado del Grupo Motta, en Estación Racedo, el gobernador Bordet destacó los pilares para el desarrollo provincial que impulsó desde comienzos de gestión: desarrollo portuario, infraestructura energética y caminos.\r\n<br>\r\n<br>“Podemos hacerlo porque hay una provincia que ha ordenado sus números, que rinde permanentemente cuenta de cada acto y acción de gobierno. Esta es la manera de llegar a las demandas que el sector privado nos plantea. Este es el camino de poder seguir trabajando”, expresó el mandatario provincial en compañía del ministro de Economía, Sergio Massa.\r\n<br>\r\n<br>“Agradezco al ministro de Economía y al presidente Alberto Fernández porque cada vez que golpeamos una puerta en Casa Rosada siempre tuvimos una respuesta. Y también agradezco el acompañamiento que he tenido en cada lugar de la provincia de todos los vecinos y vecinas, de los grupos de producción, las cámaras, industriales, empresariales, comerciales y de turismo, con quienes siempre hemos trabajado y seguiremos haciéndolo hasta el último día de gestión”, afirmó Bordet.\r\n<br>\r\n<br>Para finalizar, el mandatario provincial sostuvo que “nuestra provincia tiene un horizonte futuro de previsibilidad y de crecimiento. Ese es el camino y seguiremos transitándolo”.\r\n<br>\r\n<br>Durante el acto, el ministro Massa, juntos a sus secretarios y secretarias, concretaron una serie de aportes, créditos y financiamiento para la provincia, los municipios, cooperativas y empresas entrerrianas. El detalle:<br><br>\r\n<br><strong>Aportes a municipios para proyectos productivos</strong>\r\n<br>\r\n<br>Se entregaron aportes por un total de 296.288.981 pesos a municipios en concepto de compra de maquinarias para mitigación de emergencias y proyectos productivo, a saber: Concordia 18.554.608 pesos; Paraná 68.536.950 pesos; Diamante 32.000.000 pesos y 11.087.423 pesos; Pueblo Gral. Belgrano 11.990.000 pesos; Hernández 32.000.000 pesos; San Salvador 35.000.000 pesos; Urdinarrain 55.120.000 pesos; y La Criolla 32.000.000 pesos. Total de aportes 296.288.981 pesos.\r\n<br>\r\n<br>Fortalecimiento de cooperativas agroalimentarias\r\n<br>\r\n<br>Asimismo, se dieron a conocer los aportes brindados a cooperativas agroalimentarias, en el marco del Plan Coopar, por un total de 442.406.463 pesos.\r\n<br>\r\n<br>Las cooperativas que ya recibieron el aporte son la Cooperativa Agropecuaria Federada de Gobernador Mansilla; y la Cooperativa Agropecuaria de Industrialización, Comercialización y Vivienda Campo Unido Ltda., para implementar un plan de desarrollo cooperativo de la lechería en el norte entrerriano.\r\n<br>\r\n<br>En tanto, las que cuentan con los aportes aprobados son la Cooperativa de Provisión, Transformación y Comercialización Citrícola del noreste entrerriano; la Cooperativa La Ganadera General Ramírez Agropecuaria, de Consumo y Provisión de Servicios Públicos; la Federación de Cooperativas Apícolas de Entre Ríos; la Cooperativa Apícola Del Paraná; la Federación de Cooperativas Apícolas de Entre Ríos; la Cooperativa Apícola Gualeguaychú; Procitrus Cooperativa de Productores Frutihorticolas Colonia Freytas; la Cooperativa de Servicios Públicos General José de San Martín; la Cooperativa Arrocera de San Salvador; la Cooperativa Agrícola Ganadera y de Servicios Públicos Aranguren; y la Cooperativa Apícola Del Tala.\r\n<br>\r\n<br><br><strong>Promoción de la ganadería</strong>\r\n<br>\r\n<br>Por otra parte, se firmaron convenios entre el Ministerio de Economía y la provincia, en el marco del Plan de Ganadería Argentina (Plan Gan.ar), por un monto de 400.000.000 de pesos.<br><br>\r\n<br><strong>Inversiones en caminos rurales</strong>\r\n<br>\r\n<br>Otro de los acuerdos suscriptos por la provincia en la jornada del jueves fue con la Secretaria de Planificación del Desarrollo y la Competitividad Federal de la Nación, en el marco del Programa de Gestión Integral de los Riegos en el Sistema Agroindustrial Rural (Girsar). El objetivo es la readecuación de caminos rurales, y comprende la ruta provincial s/n tramo ruta provincial 32, con financiamiento del Banco Internacional de Reconstrucción y Fomento (BIRF), con un préstamo de 10.099.863 dólares y la contraparte provincial de 5.782.424 dólares, lo que hace un monto total del proyecto de 15.882.287 dólares, con un plazo de ejecución de 24 meses.<br><br><br><strong>Producción sustentable y adaptación al cambio climático</strong>\r\n<br>\r\n<br>También, a través del Proyecto de Sistemas Agroalimentarios Climáticamente Inteligentes e Inclusivos (CIAF), se aprobó financiamiento con el objetivo de mejorar la gestión sustentable de las explotaciones y la producción, fortalecer la soberanía alimentaria, contribuir a la adaptación de los productores ante el cambio climático, proveer infraestructura, servicios sociales básicos, asistencia técnica y capacitación.\r\n<br>\r\n<br>Se acordó un aporte no reembolsable, con financiamiento del BIRF, por 1.400.000 dólares, y una contraparte provincial de 228.148 dólares. El monto total del proyecto es de 1.628.148 dólares, con un plazo de vigencia hasta el 31 de diciembre de 2024.\r\n<br>\r\n<br><br><strong>Desarrollo de parques industriales</strong>\r\n<br>\r\n<br>Desde la Secretaria de Industria y Desarrollo Productivo también se entregó la resolución para el otorgamiento de un ANR de 48 millones de pesos al Parque Industrial de Cerrito.\r\n<br>\r\n<br>De esta forma, desde 2020 a la fecha se asistieron con Aportes No Reembolsables a siete parques industriales por un total de 339,5 millones de pesos. Actualmente están en trámite administrativo otras tres asistencias más por 289,4 millones de pesos para el Parque Industrial de Villaguay, un ANR por 99,8 millones de pesos; Parque Industrial y de Servicios de Pronunciamiento, un ANR por 99,9 millones de pesos; y Parque Industrial Sustentable de Ubajay, un ANR por 89,7 millones de pesos.\r\n<br><br><br><strong>Créditos, financiamiento y aportes a empresas entrerrianas</strong>\r\n<br>\r\n<br>Por otro lado, se aprobaron durante 2022 bonos de crédito fiscal a 15 empresas de la provincia de Entre Ríos por un total de 301,5 millones de pesos.<br><br>Además, se aprobaron 61 proyectos de financiamiento directo a Pymes de Entre Ríos por 778 millones de pesos, y esta semana serán aprobados tres nuevos proyectos de la provincia.<br><br>En el marco del financiamiento CreAr, el monto total a ejecutar es de 1.000 millones de pesos, en tanto que la provincia otorga un 5 por ciento de bonificación de tasa extra.\r\n<br>\r\n<br>Respecto al Programa Capacitación Estratégica, que otorga aportes no reembolsables para proyectos de capacitación que potencien a Mipymes, se aprobaron cinco proyectos en la provincia, por un total de 39,7 Millones de pesos. Los beneficiarios son el Centro Comercial e Industrial de la Producción de Colón, beneficiando a 29 Pymes; el Centro Comercial de Victoria, beneficiando también a 29 Pymes; la Asociación de Empresarios Hoteleros y Gastronómicos del Departamento Uruguay, beneficiando a 21 Pymes; La Fundación Camelias y Municipalidad de Villaguay, con beneficio para 31 Pymes; y la Cámara de Equipamiento Hospitalario de Fabricación Argentina y municipio de Oro Verde, con 35 pymes beneficiadas.\r\n<br>\r\n<br>En los últimos tres años el BICE desembolsó créditos en la provincia 1.418 millones de pesos y hay otros 2.172 millones de pesos pendientes para este año.\r\n<br>\r\n<br>En total, desde 2020 la asistencia otorgada a empresas de Entre Ríos totaliza 3.592 millones de pesos.Son 100 créditos los que se llevan entregados, que beneficiaron a empresas localizadas en 37 localidades distintas. El 70% de la asistencia crediticia del BICE en Entre Ríos se destina a financiar proyectos vinculados al sector agropecuario y la producción de alimentos y bebidas.\r\n<br>\r\n<br><strong><br>Obras energéticas y promoción de la economía del conoimiento</strong>\r\n<br>\r\n<br>También se firmó un convenio con la Secretaría de Energía para Plan de Obras R268 de Gualeguaychú, por 86.000.000 pesos.\r\n<br>\r\n<br>Desde la Secretaría de Economía del Conocimiento, en el marco de la Ley de Economía del Conocimiento (LEC), se asiste a cinco empresas que suman beneficios por un total de 23 millones de pesos y ganancias por un total de 6 millones de pesos.\r\n<br>\r\n<br>En tanto, a través del Programa Soluciona, 10 empresas fueron alcanzadas y reciben ANRs por un total de 126 millones de pesos.\r\n<br>\r\n<br>En el marco del Programa Nodos, tres proyectos son financiados con las municipalidades de Paraná, Concordia y Concepción del Uruguay, con una inversión total de 118 millones de pesos.\r\n<br>\r\n<br>Mediante Argentina Programa 4.0, se alcanza a un total de 5720 personas en cursada, 1065 personas aprobadas y/o certificadas; 284 tarjetas aprobadas, 209 entregadas y 75 por entregar.\r\n<br>\r\n<br><br><strong>Promoción del empleo joven</strong>\r\n<br>\r\n<br>A través del Convenio Insertar, provincia y Nación busca beneficiar la vinculación laboral de jóvenes con las micro, pequeñas y medianas empresas, con financiamiento del Fonpec hasta el 50 por ciento y una inversión total de 45 millones de pesos. Las empresas que forman parte del programa reciben un salario 30.000 pesos por 12 meses por cada trabajador nuevo incorporado.<br>', 'Gobierno de Entre Ríos', '45noticia.jpg', 1, 1),
(46, '2023-04-10', 'La provincia participó del lanzamiento de la Red para Emprender Costa del Uruguay', 'Desde el Ministerio de Economía y Producción de la provincia, junto a autoridades del Ministerio de Economía de la Nación y municipales, se presentó una nueva red del ecosistema emprendedor que aglutina a más de 20 instituciones de distintas localidades de la costa del Uruguay.', 'Las localidades involucradas, son: Concepción del Uruguay, Concordia, Colón, Gualeguaychú, San José, Villaguay, Galarza y Basavilbaso.\r\n<br>\r\n<br>La nueva Red para Emprender Costa del Uruguay fue presentada en la ciudad de Concepción del Uruguay por la subsecretaria de Desarrollo Emprendedor de la Nación, Natalia Del Cogliano; el intendente de Concepción del Uruguay, Martín Oliva; el director general de Desarrollo Emprendedor de la provincia, Claudio Rosas Vico; y el coordinador de Desarrollo Emprendedor de la municipalidad de Concepción del Uruguay, Fernando Diorio.\r\n<br>\r\n<br>La misma surge como incentivo del Programa Nacional Red para Emprender, de la Subsecretaría de Desarrollo Emprendedor del Ministerio de Economía de la Nación, el cual otorga Aportes No Reintegrables (ANRs) a nuevas redes, con el fin de incrementar el desarrollo productivo local e impulsar capacitaciones o actividades que propicien el encuentro entre emprendimientos y ecosistemas.\r\n<br>\r\n<br>Por otro lado, se realizó un taller para las 25 instituciones presentes con el objetivo de brindar herramientas para la evaluación de modelos de negocios y validación de la propuesta de valor.\r\n<br>\r\n<br><br><br><strong>Conformación de la Red</strong>\r\n<br>\r\n<br>La Red está integrada por las municipalidades de Concepción del Uruguay; San José; Gualeguaychú; Concordia; Colón; Villaguay; Centro Comercial de Concepción del Uruguay; Centro Comercial de Colón; Centro Comercial de Basavilbaso; Club de Emprendedores de Basavilbaso; Incubadora Creativo; Incubadora Fortalecer; Secretaría Desarrollo Económico y Emprendedor de la provincia; Incubadora Proyectar Innova; Facultad de Ciencias de la Gestión de UADER; Facultad de Ciencia y Tecnología de UADER; Facultad Regional UTN; Universidad de Concepción del Uruguay; Instituto Nacional de Tecnología Industrial (INTI); Instituto Nacional de Tecnología Agropecuaria (INTA); Instituto Nacional de la Agricultura Familiar, Campesina e Indígena (INAFCI); Instituto de Bromatología de la provincia; Cámara del Software; Mentores de la sede de Comunidad Mentora; y Agencia de Desarrollo Gualeguaychú (Codegú).<br><br>\r\n<br><em>(Prensa Ministerio de Producción)</em>', 'Ministerio de Producción', '46noticia.jpg', 1, 1),
(47, '2023-04-03', 'Se presentó la Red de Empresarias Entrerrianas', 'La vicegobernadora Laura Stratta, junto al ministro de Economía Hugo Ballay, participó de la presentación de la Red de Empresarias de Entre Ríos.', 'Además de habilitar un espacio de encuentro y reflexión, se mostraron las herramientas destinadas a las empresarias, como líneas de financiamiento y capacitación y asistencia técnica.\r\n<br>\r\n<br>Este lunes en el Centro Provincial de Convenciones de Paraná, la vicegobernadora Laura Stratta participó de la presentación de la Red de Empresarias Entrerrianas. La acompañaron el ministro de Economía Hugo Ballay; la secretaria de Modernización Lucrecia Escandón; el secretario de Desarrollo Económico y Emprendedor, Pedro Gebhart; la directora de Comercio Exterior de la Provincia, Ivana Calafatich; entre otras autoridades provinciales. Participaron alrededor de 30 empresarias de diversos rubros y distintos puntos de la provincia.<br><br>\r\n<br><strong>Articulación público-privado</strong>\r\n<br>Al hacer uso de la palabra, Stratta expresó: “Quiero agradecerles al ministro Hugo Ballay, a su equipo de trabajo y a la secretaria de Modernización Lucrecia Escandon, porque hoy están aquí ratificando un compromiso y un modo de construir y defender la gestión que tiene que ver con el diálogo fecundo y espacios que nos permiten encontrarnos y potenciar lo que cada una y cada uno tiene para dar”. Agradeció, además, a Julia Fontana y Carola Bolzán “que me acercaron la inquietud de poder generar un espacio de red de mujeres empresarias para poder potenciar y en la articulación público privado, generar respuestas a las demandas que tenemos en la provincia”.\r\n<br>\r\n<br>Seguidamente, la vicegobernadora recordó cómo “se empezó a gestar una red multipartidaria y multisectorial para la igualdad, donde empezamos a trazar la ley de paridad en el marco de un diálogo consensuado y necesario donde la política tenía que escuchar y legislar en función de lo que veníamos recogiendo. Esa experiencia, más allá del impacto en lo social, político y electoral, nos sirvió que esa era la manera de construir que necesitamos seguir profundizando, potenciando y transitando”.\r\n<br>\r\n<br>Mencionó luego la Misión Comercial de Mujeres a Italia, concretada en septiembre del año pasado. “Allí empezamos a sentir la necesidad de potenciar y compartir estos espacios pero también la necesidad de generar políticas y acciones que nos permitan crecer, desarrollarnos y afianzarnos”, indicó Stratta.\r\n<br>\r\n<br>En otro tramo de su discurso, repasó las acciones realizadas durante la gestión y destacó la importancia de saber “cuándo el diálogo se transforma en política”. Hizo mención por ejemplo al trabajo conjunto que se realizó con la Unión Industrial de Entre Ríos (UIER), en el programa de Promoción del Empleo Industrial Entrerriano, una herramienta originada “en un espacio de articulación y escucha para trazar un horizonte de crecimiento y de desarrollo”, valoró.\r\n<br>\r\n<br>En referencia a la Red de Empresarias Entrerrianas. “Estamos aquí para afianzar el camino de articulación, el trabajo en red con un Gobierno que siempre hizo de la escucha y la articulación, su bandera, un modo de gestionar y construir”. Y agregó: “Sigamos tejiendo redes y entendiendo que los objetivos generales son más importantes que los personales o sectoriales y que independientemente de los caminos, todas queremos lo mejor para nuestra provincia y esto tiene que ver con lo que somos, pero sobre todo en lo que sentimos, pensamos y creemos”, dijo finalmente la vicegobernadora de la provincia.\r\n<br>\r\n<br>Por parte, el ministro manifestó: “Consideré que es un espacio interesante para compartir algunas ideas y acciones que han ocurrido en el último tiempo. Con Laura acompañamos al gobernador Gustavo Bordet desde el primer día de su primera gestión, en roles distintos, Laura fue ministra de Desarrollo Social antes y después el voto popular la llegó a la Vicegobernación”.\r\n<br>\r\n<br>En esta línea, Ballay comentó que “muchas de las ideas y apoyos que hoy estamos dando, y trabajando en forma conjunta, en articulación público privado, siempre las tuvimos pero antes había que darle orden a las cuentas fiscales de la provincia”, aclaró. Y añadió: “Hoy tenemos vigente distintas líneas de crédito con el agente financiero donde la provincia también hace un esfuerzo de 14 puntos de la tasa habitual de mercado”. Habló además del nuevo compromiso del gobierno a partir de la sequía; o el acompañamiento en el consumo a través de la billetera virtual. “Todas estas medidas tienen un efecto fiscal que hoy lo podemos sostener. Son políticas de Estado que se tienen que instalar y quedar definitivamente porque son en beneficio de todos los entrerrianos”, aseguró Ballay. “Hoy más que una invitación fue un pedido mío para poder acompañar en esta reunión y rescato verlas a todas ustedes empresarias y emprendedores de nuestra querida provincia y todas con el mismo objetivo: que nos vaya bien a todos”, concluyó.\r\n<br>\r\n<br>En tanto, Lucrecia Escandón indicó que desde la Secretaria de Modernización “a través de la Vicegobernación venimos trabajando desde hace tres años en la adhesión de la provincia a la agenda de los Objetivos de Desarrollo Sostenible (ODS), en la cual estamos convencidos que es una agenda para la acción, que nos invita a trabajar de forma colectiva entre sector público, privado y las organizaciones de la sociedad civil para enfrentar los grandes retos que todos conocemos a nivel mundial, pero también tiene un arraigo muy importante en el trabajo en territorio y en cada una de las empresas y emprendimientos”, sostuvo la funcionaria provincial. Y añadió: “Fundamentalmente hay uno de esos objetivos que es el que traza un poco el contenido de esta red que tiene que ver con la igualdad de género, con el empoderamiento de las mujeres en la vida económica, social, política y en los distintos aspectos que nos tocan a cada una de nosotras llevar adelante”, expresó Escandón.\r\n<br>\r\n<br>En la oportunidad, se pusieron a disposición de las empresarias, las herramientas de financiamiento existentes a nivel provincial y nacional, como así también las capacitaciones y asistencia brindada por técnicos y profesionales de distintas disciplinas.\r\n<br>\r\n<br><strong>Presencias</strong>\r\n<br>Participaron del encuentro las empresarias: Carola Bolzan, Julia Fontana, Florencia Herrera, Eladia Weber, Sandra Ostorero, Melina Gottig, Ana Maria Mera, Valeria Ocaranza, Johanna Echeverria, Carolina Vittor, Silvana Rotman, Antonella Fontana, Paola Fontana, Ofelia Gentile, Maria Paula Ambroggio, Noemi Altamirano, Noemi Delizzotti y Marcia Rabey, entre otras.<br><br><br><em>Prensa Vicegobernación</em>', 'Vicegobernación', '47noticia.jpg', 1, 1),
(48, '2023-04-11', 'La provincia sigue acompañando los desafíos de las empresas entrerrianas', 'La vicegobernadora Laura Stratta, junto a Lina Anllo, directora WEF en la Argentina, visitaron la firma Ejemplar, ubicada en el Parque Industrial de Paraná. Una empresa familiar dedicada a la elaboración de algodón, que está liderada por mujeres y con presencia mayoritaria de operarias en su planta.', 'Este martes al mediodía, la vicegobernadora Laura Stratta, junto a Lina Anllo, directora del Women Economic Forum (WEF) en la Argentina, visitaron la firma Ejemplar, ubicada en el Parque Industrial de Paraná. De la actividad también participó el secretario de Desarrollo Económico y Emprendedor, Pedro Gebhard. Allí, recorrieron la planta y dialogaron con Analía Ribetti, presidenta de la empresa, y su hermano el ingeniero textil José Augusto Ribetti, jefe de área de Producción.\r\n<br>\r\n<br><br><br><strong>Producir con manos entrerrianas</strong>\r\n<br>\r\n<br>“En primer lugar quiero agradecer a Analía y su familia por recibirnos, por apostar a la responsabilidad social, por producir y crecer siendo amigable con el ambiente, generando mano de obra local, viendo cómo consolidan el mercado interno y cómo trazan horizontes”, expresó la vicegobernadora Laura Stratta recordando que el año pasado también visitó la fábrica, junto al gobernador Gustavo Bordet, para entregarles un aporte destinado a la compra de maquinarias que les permitió crecer en innovación, tecnología y mano de obra.\r\n<br>\r\n<br>En tal sentido, valoró la articulación público- privado y el acompañamiento del Estado. “Con su empresa, su empuje y con el Estado acompañando a través de políticas públicas, podemos impulsar empleo y desarrollo. De eso se trata en lo que hacemos pero sobre en lo que creemos”, remarcó Stratta.\r\n<br>\r\n<br>“Quiero agradecerles porque ellos apuestan a la provincia de Entre Ríos, a la ciudad de Paraná, apuestan a producir con manos entrerrianas”, destacó la vicegobernadora tras ratificar “el acompañamiento del gobierno provincial en sus desafíos y para seguir afianzando la articulación que tanto bien nos hace”.\r\n<br>\r\n<br>La firma está liderada por mujeres y con presencia mayoritaria de operarias en su planta. “Se trata de generar condiciones de igualdad desde donde caminar para construir entre todos una mejor sociedad”, dijo finalmente Stratta.\r\n<br>\r\n<br>Por su parte, Anllo se mostró agradecida por la invitación de la vicegobernadora y por el recibimiento de los titulares de la firma Ejemplar “una empresa familiar que está liderada por mujeres”, subrayó la directora del WEF en la Argentina tras valorar su historia y el progreso de su crecimiento. Y añadió: “Las invitamos a la Misión Comercial de mujeres y emprendedoras argentinas que se realizará este año en México, ojalá se puedan sumarse”.\r\n<br>\r\n<br>En tanto, Analía Ribetti, presidenta de la empresa Ejemplar, manifestó: “Es una alegría y un gusto recibir a la vicegobernadora nuevamente en casa”. Mencionó y destacó el financiamiento que recibieron por parte del gobierno para la incorporación de tecnología.\r\n<br>\r\n<br>Seguidamente, indicó que la empresa Ejemplar, con 20 años de experiencia en la elaboración de algodón hidrófilo de alta calidad y máxima pureza, está ubicada en el Parque Industrial de la ciudad de Paraná. Contó que en la elaboración de sus productos se utiliza un 100 por ciento de fibra natural, y para preservar el medio ambiente, la firma desarrolló un cuidado e innovador proceso de blanqueado sin la utilización de cloro o blanqueadores ópticos. “Toda la producción se comercializa a nivel nacional, es decir, que estamos en todo el país. La fuerza laboral de la empresa es entrerriana, nuestros productos están hechos con manos entrerrianas”, resaltó Ribetti.\r\n<br>\r\n<br>En el marco del programa de Desarrollo Productivo PyME la empresa recibió un Aporte No reembolsable por 40 millones de pesos destinado a la transformación productiva de la empresa. El proyecto propone una serie de acciones estratégicamente ideadas para la transformación de esta empresa pyme del rubro algodonero hacia un nivel más abarcativo con un desarrollo intensivo de su integración en la cadena de valor. En términos generales, se propone realizar una reingeniería de procesos, incorporando tecnología para lograr una mayor eficiencia a través de control, automatización y reciclos, así como un aumento de la productividad y de la capacidad instalada mediante incorporación de maquinaria específica para fabricar nuevos productos. El monto total de inversión de la empresa es de 57.273.947 pesos. El monto aprobado ANR: 39.999.00 pesos.', 'vicegobernación', '48noticia.jpg', 1, 1),
(49, '2023-04-24', 'Entre Ríos avanza en estrategias para que las pymes accedan a créditos de mayor magnitud', 'El ministro de Economía, Hugo Ballay, encabezó la reunión ordinaria del Fondo de Garantías de Entre Ríos (Fogaer) junto con las instituciones del sector privado que conforman el organismo.', 'Dieron a conocer las gestiones ante Nación para que las Pymes entrerrianas puedan acceder a créditos de mayor envergadura.\r\n<br>\r\n<br>“El Fogaer es el mejor ejemplo del diálogo que permanentemente promueve el gobernador Gustavo Bordet. Es una herramienta estratégica para el futuro de la provincia y la construimos conjuntamente entre el sector público, el Estado, y el sector privado sentados en la misma mesa, uniendo nuestros esfuerzos. Este es el único camino para transformar Entre Ríos, favorecer la producción y crear trabajo”, afirmó Ballay.\r\n<br>\r\n<br>Durante la reunión se acordó que el titular de la cartera económica sea también el nuevo presidente del Fogaer, cargo que desempeñará ad honorem. En ese marco, destacó “el trabajo que el contador Gustavo Labriola tuvo al frente del organismo. Fue una de las personas centrales para que el Fogaer esté en pleno funcionamiento, participó tanto en su diseño como en su puesta en práctica, generó consensos y marcó un rumbo”. También expresó “un profundo agradecimiento a las instituciones del sector privado de la provincia con las que venimos trabajando mancomunadamente”.\r\n<br>\r\n<br>Durante el encuentro se aprobó la memoria y el balance del organismo de participación mixta, pública y privada, en el que las entidades representativas de los sectores productivos, industriales y comerciales de la provincia también son socias accionistas junto con la provincia.\r\n<br>\r\n<br>Durante el encuentro, la provincia y las entidades del sector privado acordaron difundirlos las oportunidades que tienen las micro, pequeñas y medianas empresas de Entre Ríos al operar mediante el Fogaer para para acceder a créditos y mecanismos de financiamiento en el sistema bancario y en el mercado de capitales. También se dieron a conocer los avances en las gestiones ante organismos nacionales para avalar conjuntamente financiamientos de mayor magnitud para las MiPymes entrerrianas.\r\n<br>\r\n<br>En representación del sector privado participaron Alcides Balla, por la Bolsa de Comercio de Entre Ríos; Hector Fratoni, por el Consejo Empresario de Entre Ríos; Raquel Brunengo, por la Asociación de Cooperativas Argentinas (Acacoop); Ronald Garnier y Miguel Laurencena, por la Federación de Cooperativas de Entre Ríos (Fedeco); Carlos Sinesi, por el Centro de Empresas Procesadoras Avícolas; Alfredo Bel, por la Federación Agraria Argentina; Juan Adolfo Balbi, por la Cooperativa Agropecuarias Federadas de Entre Ríos (Cafer).\r\n<br>\r\n<br>Asimismo, estuvieron presentes el gerente General de Fogaer, Lisandro Luna de Luca; el síndico de Fogaer, Diego Camuña, y el representante del Ministerio de Producción en el directorio de Fogaer, Pedro Gebhart. La representación de la provincia la lleva adelante el ministro Ballay.\r\n<br>\r\n<br>Al término del encuentro, el gerente General de Fogaer, Lisandro Luna de Luca explicó que la reunión “fue el cierre de la aprobación del tercer ejercicio económico de Fogaer”, y el balance “ha sido muy bueno”. “Hemos generado financiamiento por casi 1000 millones de pesos para el sector Mipyme de la provincia. Y el sector micro y pequeña empresa ha sido uno de los principales sectores que ha operado con Fogaer. Hemos generado financiamiento en casi 350 pymes, tenemos calificadas cerca de 60 o 70 pymes más, en este poco tiempo que estamos funcionando. Y consideramos muy importante el conocimiento que está empezando a tener el sector pyme de la provincia y dándole la importancia que tiene la garantía a la hora de conseguir el financiamiento”.\r\n<br>\r\n<br>Además, recordó que “el gobierno nacional en su momento ha hecho aportes para que la provincia pueda aumentar la capitalización del fondo de riesgo y con eso generar un aumento en la capacidad individual que tiene Fogaer de prestar”, y adelantó que “hemos celebrado convenios con organismos nacionales para hacer de co-avales o co-garantías y tratar de generar un andarivel de mayor musculatura a la hora de pensar en financiamientos de montos más importantes”.\r\n<br>\r\n<br>A su turno, el presidente de la Bolsa de Comercio de Entre Ríos, Alcides Balla, destacó que el Fogaer “tiene un crecimiento exponencial y que está prácticamente dedicada su orientación es hacia las pymes”.\r\n<br>\r\n<br>“Sabemos que Entre Ríos es un conjunto de emprendedores, de pymes, y que realmente la base de la actividad económica de la provincia, del espíritu emprendedor entrerriano, son las pymes. Es por eso que es muy satisfactorio, porque cuando se constituyó esta sociedad, después de tantos esfuerzos, a lo mejor si pensábamos que hoy podíamos estar en esta situación nos parecía, a lo mejor, utópica”, apuntó el empresario.\r\n<br>\r\n<br>El titular de la Bolsa de Comercio de la provincia subrayó que el Fogaer “es una herramienta fundamental para apoyar el desarrollo. Y más aún en estos tiempos de crisis, especialmente para el sector agroalimentario, el Fogaer está apuntalando”.\r\n<br>\r\n<br>Por último, Balla insistió en la posibilidad de acceder al mercado de capitales a través del Fogaer. “Pareciera que es una cuestión lejana, pero no. El mercado de capitales brinda oportunidad de financiamiento y de inversión a los entrerrianos. Creo que a través del Fogaer, y de la difusión que hacemos nosotros como entidad representativa regional, es un gran desafío, tiene un futuro muy grande para apalancar el desarrollo de nuestra economía”, concluyó.\r\n<br>\r\n<br>Por último, el presidente de Cafer, Juan Balbi, calificó como “muy positivo” el encuentro. Advirtió que “en el sector agropecuario, la necesidad de financiamiento y de garantía realmente es muy importante”, y que es un actor “muy dinámico y muy importante en el orden provincial”.\r\n<br>\r\n<br>También resaltó que durante la asamblea se abordó la importancia de “de incorporar nuevas entidades”. El Fogaer, “con el poco tiempo que tiene, ha sido importante en todos los créditos que se han dado”, indicó y puso de relieve “el apalancamiento de mucha gente a la que el Fogaer ayuda para poder tener la garantía correspondiente en el tema financiero y bancario\".\r\n<br>\r\n<br>\"Si, es todo un tema. Nosotros en el sector agropecuario tenemos realmente un gran desafío, no sólo ver cómo al productor lo ayudamos desde su pasivo que le va a quedar por la falta de recolección de su cosecha, ya que en muchos casos prácticamente es el ciento por ciento de pérdida, no sólo eso sino cómo encaramos la nueva campaña. O sea, son dos desafíos: cómo sostenemos hoy al productor y cómo conseguimos financiamiento para la nueva campaña que se viene que es la cosecha fina, en este caso principalmente de trigo en la provincia de Entre Ríos\".', 'gobierno', '49noticia.jpg', 1, 1);
