INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(14, 30, 30, 19, 1, 'HORNOS ROTATIVOS, ENERGIA LIMPIA', 'Nos dedicamos a la fabricacion y venta de hornos rotativos para la industria panaderil, con el financiamiento lo que queremos es implementar en consumo masivo un horno eléctrico que funciona a base de energía limpia (electricidad) de bajo consumo y que ya esta siendo utilizado en diferentes provincias en nuestra red de distribuidores con gran exito.', '1000000.00', 0, 0, 'El proyecto consiste en producir masivamente un horno rotativo totalmente eléctrico de bajo consumo. Esta necesidad fue identificada por nuestros distribuidores de todo el país, ya que el costo de la energía eléctrica y el combustible gaseoso prácticamente son iguales.\r\nLos clientes encontraron en este producto el beneficio del AHORRO ECONOMICO, además de no hacer una obra de instalación de gas con todos los inconvenientes que esto significa.', 'Posicionar nuestra Marca Hornos grafo para ser reconocida por nuestro mercado meta por nuestra innovación tecnológica, conocimiento del rubro y cuidado del medio ambiente.\r\nSiguiendo con nuestra filosofía de generar vínculos estratégicos y comerciales  tanto del cliente como de nuestra empresa.', 'Reemplazo del combustible fósil, por energía eléctrico. Con un ahorro en el consumo de hasta un 50 %\r\nAdemás llegar al nicho de panaderías pequeñas con un precio accesible.', 'En estos momentos se están fabricando estos hornos, con gran aceptación en las pequeñas panaderias.', 'Grafos S.H. es una empresa que nace en el año 2005, se dedica a la fabricación de hornos rotativos y máquinas para la industria del panificado.\r\nNos especializamos en dar consejos, soluciones y adaptarnos a las necesidades del cliente siempre desde la innovación, creatividad en sus diseños y servicio al cliente. Este desafío es llevado a cabo por los socios Gustavo Grasiani y Darío Foletto.', 'Actualmente estamos desarrollando nuestra actividad en nuestra planta, radicada en el parque industrial de la ciudad de Seguí, provincia de Entre Ríos.', 'Planta de 6000m2, ocupando en el momento 375m2. en el Parque industrial de la ciudad de Segui, Entre Rios.', 'No se alquila, ni se arrenda.', 'Nuestros productos son diseñados para la utilización en la industria del panificado y gastronómico.', 'Nuestros equipos están provistos de tableros electromecánicos, que hacen su funcionamiento en forma automática, evitando de esta manera el estar pendiente del ciclo de cocción.', 'Compra de materia prima y recepción de las mismas en la fábrica. Distribución de las mismas en los diferentes sectores. Corte y plegado de chapas de acero inoxidables y ensambles.', 'Acero inoxidable, motores eléctricos, quemadores automáticos, aislantes térmicos, materiales eléctricos, instrumental de medición, mano de obra.', 'Recorte de chapa de acero inoxidable, los cuales se donan a la municipalidad para la planta recicladora.', 'Nuestro producto está dirigido al rubro gastronómico y panaderil', 'Nuestros clientes son panaderías, restaurant, bares, pizzerías, rotiserías, estaciones de servicio, autoservicios chicos, comercios del rubro y distribuidoras', 'En este momento en nuestra provincia no hay una competencia para nuestro producto', 'American Burners S.A. proveedor de Quemadores .\r\nChiaza S.A. proveedor de acero inoxidable\r\nOrganizacion Bassi proveedor de aislantes térmicos industriales\r\nFerrenet -CMS S.A. Proveedor de  ferretería industrial\r\nValentinuz Hnos. proveedor de motores eléctricos y  rodamientos\r\nDistrivolt S.A. proveedor de materiales eléctricos industriales', 'Los riesgos son la incertidumbre económica influenciada para la pandemia. \r\nIncursionar en el comercio exterior exportando este producto. Ya hemos hecho relevamientos en países limítrofes como Uruguay, Paraguay y Bolivia.', 'Adjuntamos presupuestos estimados de materia prima, costos variables y costo de estructura necesario para llevar adelante este proyecto', '3 empleados en fabricación y un administrativo.', 'Con este proyecto se incorporaría un operario en fábrica y un vendedor a calle', 'Precio a distribuidora  $ 165.000\r\nPrecio a panaderos y otros por $ 189.700', '•	conocimiento y experiencia en el rubro\r\n•	Maquinaria propia\r\n•	Planta propia ubicada en parque industrial de Seguí con amplio deposito\r\n•	Licencia para exportar', '•	Diversificación del mercado\r\n•	Crecimiento del rubro gastronómico\r\n•	Políticas favorables para exportar\r\n•	Alianzas estratégicas con distribuidores', '•	Capital insuficiente\r\n•	Falta de personal para la venta', '•	Incertidumbre del desarrollo de la economía post pandemia \r\n•	suba exponencial no previsible en el costo de la energía eléctrica', '2020-10-02 15:06:04', '2021-06-09 13:04:12'),
(18, 31, 32, 24, 1, 'MATERIAS PRIMAS E INSUMOS PARA CONFECCIÓN DE INDUMENTARIA', 'Nuestra cooperativa, se dedica a la confección de indumentaria para las fuerzas armadas, de trabajo, sanitarios y accesorios relacionados. En la actualidad somos 95 asociados que formamos parte de la Cooperativa. Debido a la situación actual de publico conocimiento, las ventas han disminuido y se ha cortado la cadena de pagos y entrega de insumos, esto nos afecta directamente ya que nos imposibilita tener la mat. prima en tiempo y forma, ademas se complica pagar anticipadamente.', '1000000.00', NULL, 0, 'Obtener financiamiento para adquirir insumos y materias primas para poder operar.', 'Este proyecto tiene como fin obtener financiamiento necesario para la adquisición de materia prima e insumos que resultan indispensables para continuar con la actividad operativa de nuestra cooperativa.', 'Seguir en el mercado ofreciendo nuestros productos y cumplir con nuestros compromisos adquiridos.', 'La cooperativa está participando de licitaciones por lo cual resulta necesario contar con un importante stock de materia prima.', 'Desde 2004 y con el objetivo principal de generar un trabajo digno, la Cooperativa de Trabajo del Centro la cual confecciona indumentaria de trabajo;  viene desarrollándose en base a la voluntad, esfuerzo, perseverancia y a una convicción clara de trabajo en equipo y superación día a día.\r\nCreamos un emprendimiento que nos permite mostrar la calidad de nuestro trabajo textil. Fuimos Hilvanando este proyecto que hoy es realidad: una cooperativa de trabajo que nos permite vivir y trabajar.-', 'Al día de hoy la cooperativa cuenta con 95 asociados. A lo largo de este camino nos hemos ido reinventado, creando nuevos productos, esforzándonos y manteniendo la calidad humana y laboral como eje principal que es lo que nos pondera y conocen nuestros clientes.', '.', 'Alquiler (16 años), compuesto de 2 galpones que en su totalidad son unos 1800mts cuadrados.', 'Nuestros productos cuentan con una excelente calidad y terminación, lo que asegura un buen y prolongado uso.', 'Se incorpora paulatinamente a medidas que los clientes lo solicita telas técnicas que brindan mayor confort y calidad.', 'Nuestro proceso productivo comienza con el área de diseño y molderia, para entrar al sector de corte y loteo, una vez loteado ingresa a producción donde contamos con maquinas de tecnología avanzada que nos permiten un proceso mas rápido y preciso, para finalizar en el área de control y calidad.', 'Se cuenta con materia prima nacional de diversos tipos debido a que nuestra producción abarca una cartera de varios productos por lo que contamos con diversos proveedores.', 'Los desechos de telas y cubos son donados a una entidad intermedia que los recicla y los vuelve a usar en otra entidad como ser la UP6.', 'Nuestro mercado son las fuerzas de seguridad, laboral regional y pequeños consumidores.', 'Dentro de nuestros clientes se encuentran: Dirección Nacional de Vialidad, Dirección Provincial de Vialidad, Policía de Corrientes, Policía de Entre Ríos, IAPV, Consejo General de Educación, Bomberos de Córdoba, Eduardo Stertz e Hijos SRL, El fueguino, Martín Bustamante, Frigorifico Alberdi, entre otros.', 'Como cooperativa nos abocamos al continuo crecimiento. Si somos conscientes de nuestra calidad y precio acorde. Nuestra competencia son empresas como Pampero que están en el mismo nicho de mercado.', 'Nuestros proveedores son nacionales, entre ellos figuran: Santista SA, Texameri SA, Hilos de Luca, Textil 24 de Abril, Dinopack, Textil Band, entre otros.', 'En estos momentos actuales es muy alto el riesgo al cual nos vemos sometidos debido a que los costos cambian continuamente y no podemos abastecernos de materia prima en tiempo y forma, ya que los proveedores cambiaron sus metodologías en plazos de pagos (como pagos anticipados). Nuestra estrategia es tratar de abastecernos lo antes posible para poder seguir brindando nuestros productos de calidad en tiempo y forma.', 'Comprar insumos para la confección de los productos, telas y avíos.', '95 asociados', 'El impacto en lo económico y social es directo debido a que con los insumos se puede seguir elaborando los productos y así continuar con la cadena productiva.', 'Al ser nuestra cartera de productos amplia nuestros precios rondan desde: $600 (remera) a un $4850 (Campera de Trabajo Anorack).', 'Al ser Cooperativa nuestra mayor fortaleza esta en los asociados (mano de obra) y tener las maquinarias necesarias para la producción.', 'En este momento incierto, otras empresas no Operan, esto nos da una oportunidad de que los clientes confíen en nosotros y a la vez se consigue nuevos potenciales.', 'Entrega en tiempo de materias primas y avíos por no tener el dinero necesario.', 'Inflación, no tener un mercado con reglas claras.', '2020-10-06 12:01:55', '2020-10-22 11:16:35'),
(19, 45, 33, 24, 1, 'PUENTE GRÚA', 'Elaboración de puente grúa', '1000000.00', NULL, 0, 'Adquisición de herramientas y materiales para la elaboración de puentes grúa', 'El proyecto tiene como objetivo mejorar la seguridad y eficiencia en la planta de producción a través de la fabricación de dos puentes grúas, lo que permitirá trasladar los equipos semielaborados y elaborados por las distintas lineas y etapas del proceso', 'El proyecto permitirá reducir los tiempos de producción así como también el riesgo por la manipulación de material pesado y de difícil manipulación', 'Actualmente, el proyecto se encuentra en un desarrollo inicial', 'Tercec y su marca \"Pecarí Implementos\" nace en la ciudad de Concepción del Uruguay a partir de una necesidad insatisfecha observada por los socios la cual se trataba de la dificultad con la que se encontraban las empresas constructoras a la hora de darle mayor utilidad a su minicargadora', 'A los largo de estos años Tercec SRL demostró ser una empresa con mucho potencial y de valor agregado. La basta red de concesionarios y representantes de nuestra marca a lo largo y ancho del país así lo confirman. Creemos que tenemos mucho espacio para seguir creciendo (tanto en Argentina como en el resto de Sudamérica) y mejorar nuestros márgenes a través de la disminución de costos', '.', 'Actualmente la empresa tiene un contrato de alquiler por tres años. En este inmueble realiza todas sus actividades.', 'Son productos utilizados como herramientas, compuesto fundamentalmente de chapas de acero, con componentes mecánicos y oleo hidráulicos, capaces de generar distintos trabajos mediante la energía entregada por las distintas maquinas en los cuales pueden llegar a instalarse.', 'Los distintos productos son fabricados para la utilización en sector vial y en el de la construcción (entre los principales). Cada uno es capaz de realizar distintos trabajos como lo pueden ser movimientos de suelo, compactación, excavación, perforación, barrido, etcétera.', 'Corte y plegado, la chapa es cortada y plegada. Armado, cada pieza se une a otras en distintos conjuntos. Pintura, los conjuntos metálicos son tratados superficialmente y se realiza el pintado. Terminación y control de calidad, se realiza el ensamble final con las piezas hidráulicas y control final.', 'Chapas de hierro en espesores que van desde 3.2mm hasta 25mm, Caños, trefilados y laminados de hierro hasta 100mm de diámetro. Pinturas poliuretánicas. Bulonería, distintas piezas mecanizadas. Accesorios, mangueras, válvulas, motores y actuadores olehidráulicos.', '.', 'Comercializamos en todo el territorio nacional de manera directa o a través de nuestros distribuidores. Nuestros productos tienen la particularidad de brindar a empresas del sector (pymes), la posibilidad de realizar inversiones relativamente bajas considerando los costos-beneficios que se obtienen adquiriendo implementos que permiten aumentar el abanico de posibilidad para realizar múltiples trabajos con una misma minicargadora.', 'Forman parte de nuestra red de socios, representantes y distribuidores de marcas mundialmente líderes, con trayectoria y reconocimiento en el mercado, permitiendo a los usuarios de Pecarí obtener soluciones a su alcance en todo el territorio a través de esta red.', 'Respecto a la competencia, hoy fraccionamos el mercado nacional en tres grandes partes: implementos de origen asiático, de origen europeo/norteamericano y de origen nacional.\r\nEn cuanto a los de origen nacional, si bien hay aparte de nosotros empresas (talleres) que realizan algunos implementos para minicargadores (entre otras unidades de negocios), nosotros somos la única fábrica nacional dedicada íntegramente a la fabricación y diseño de implementos para minicargadores', 'Nuestro proveedores principales se encuentran en las provincias de Buenos Aires, Córdoba, Santa Fe y Entre Ríos. A lo largo de los años', 'Reducciones de Costos: proceso de optimización de recursos y redirección de gastos, logrando optimizar los gastos. Dentro del sector de producción se logró optimizar los recursos y aprovechar la disponibilidad de maquinarias.', 'Elaboración y puesta en marcha de dos puentes grúas en la planta fabril', 'Tercec se encuentra empleando a 25 personas:\r\n01 Gerencia\r\n14 fábrica\r\n04 administrativos\r\n02 diseño/técnica\r\n04 vendedores', '.', '.', '1- Productos registrados en INPI\r\n2- Oficina de diseño y desarrollo\r\n3- Centro de atención al cliente con personal capacitado y/o profesionales\r\n4- Más de 2500 equipos colocados en e mercado\r\n5- Aseguramos la adaptabilidad (compatibilidad) de nuestro producto tus maquinas\r\n6- Logística propia\r\n7- Más de 30 lineas de productos diseñados y fabricados\r\n8- Múltiples modelos por linea de productos\r\n9- Red de concesionarios en la mayoría de las provincias\r\n10- Múltiples formas de pagos', '1- Mercado sudamericano desatendido\r\n2- Implementos para maquinaria vial pesada\r\n3- Incrementar los canales de Comercialización en Argentina\r\n4- Sustitución de Importaciones\r\n5- Asociaciones estratégicas con fábricas de maquinarias\r\n6- No hay un referente líder en resolver todas las necesidades de implementos', '1- No tenemos certificaciones de calidad (ISO9001)\r\n2- No tenemos un plan/estratégica de fidelización de clientes\r\n3- Falta de conocimientos prácticos sobre el rubro de la construcción', '1- Guerra de precios  - Fabricantes/talleres nacionales\r\n2- Fabricantes de implementos agrícolas que quieran sumar el rubro vial\r\n3- Continuidad de la caída del sector de la construcción', '2020-10-07 19:26:18', '2020-11-09 12:36:37'),
(20, 29, 34, 19, 1, 'HELADERIA SAMOA', 'ESTE PROYECTO ES PARA INVERSION EN COMPRA DE INSUMOS Y  DE CAPITAL DE TRABAJO. ESTE APORTE SERIA DE GRAN AYUDA PARA PODER SOBRELLEVAR LA SITUACION ACTUAL.', '825825.00', 0, 0, 'INVERSION PARA COMPRA DE INSUMOS Y AMPLIACION DE CAPITAL DE TRABAJO', 'CON ESTE APORTE DEL PROGRAMA VAMOS A ADQUIRIR INSUMOS PARA LA PRODUCCION Y TAMBIEN APLIAREMOS EL CAPITAL DE TRABAJO CON EL QUE CONTAMOS, PUESTO QUE AL HABERSE REDUCIDO LAS VENTAS EN ESTA EPOCA DE PANDEMIA, SE HA REDUCIDO EL MISMO PARA ENFRENTAR EL PAGO DE SUELDOS', 'LA OPORTUNIDAD QUE IMPLICA ES LA DE PODER SEGUIR PRODUCIENDO, Y ADQUIRIR INSUMOS A PRECIOS INFERIORES AL HACER COMPRAS EN CANTIDAD.', 'NOS PERMITIRIA OPTIMIZAR RECURSOS', 'Samoa es una “Empresa Familiar” dedicada a la elaboración Artesanal de Helados y postres asentada en nuestra cuidad de Victoria Entre Ríos; con más de 40 años de trayectoria.\r\nSu fundador “Bebe Oberti” siempre estará presente en el espíritu de todos los que forman parte. Quienes siguen su legado (Esposa, Hijos, Sobrino, Nietos, Etc.) nunca perderán de vista sus principios: Trabajo, Esfuerzo, Dedicación, calidad de sus productos; y, sobre todo, la gran pasión y el amor por lo que realizan.', 'En la actualidad, se conserva la fábrica original junto con un pequeño lugar de atención al público donde se inició Samoa, en calle Italia 461, además de un segundo local alquilado (frente a la plaza principal) que permitió darle la comodidad y espacio que nuestros clientes merecían.', 'LA EMPRESA FUNCIONA EN LA CIUDAD DE VICTORIA, PROVINCIA DE ENTRE RIOS', 'EL LUGAR DONDE TENEMOS UNO DE LOS PUNTOS DE VENTA ES ALQUILADO, MUY BIEN UBICADO DE POR CIERTO, EN LA ESQUINA DE LA PLAZA PRINCIPAL DE LA CIUDAD, Y EL OTRO LOCAL ES PROPIEDAD DE MI ABUELA, DONDE ADEMAS TENEMOS LA FABRICA.', 'LOS PRODUCTOS QUE ELABORAMOS SON CREMAS Y TORTAS HELADAS.', 'LOS PRODUCTOS Y SERVICIOS QUE OFRECEMOS NO POSEEN CARACTERISTICAS TECNOLOGICAS.', 'SE SELECCIONA LA FRUTA - LAVADO Y PREPARACION PARA TRITURACION - MOLINO COLOIDAL - PASTEURIZADOR - TINAS DE MADURACION - FABRICADORA DE HELADO - DEPOSITO EN POZOS DE FRIO PARA SU COMERCIALIZACION AL PUBLICO.', 'LECHE FLUIDA ,LECHE EN POLVO, CREMA DE LECHE Y AZUCAR SON LAS PRINCIPALES MATERIAS PRIMAS UTILIZADAS', 'SE REALIZA UNA FILTRACION DEL ESCASO RESIDUO LIQUIDO PARA VOLCARSE FINALMENTE AL SISTEMA DE CLOACAS.', 'EL MERCADO ESTA COMPUESTO POR CONSUMIDORES DE HELADOS Y POSTRES', 'NUESTROS CLIENTES ESTAN COMPUESTOS POR HABITANTES DE NUESTRA CIUDAD Y TURISMO PRINCIPALMENTE QUE PROVIENE DE LA CIUDAD DE ROSARIO, LOS MISMO BUSCAN BUENA CALIDAD DE LOS PRODUCTOS QUE NOSOTROS LES PODEMOS OFRECER.', 'LA COMPETENCIA ESTA COMPUESTA POR EL RESTO DE LAS HELADERIAS Y EN PARTE POR ALGUNAS PANADERIAS QUE VENDEN TORTAS CONGELADAS, QUE SON MUY POCAS.', 'NUESTROS PROVEEDORES ESTAN UBICADOS EN SU GRAN MAYORIA EN NUESTRA CIUDAD EN TODO LO QUE SE PUEDE ADQUIRIR, PERO ALGUNOS INSUMOS SE ADQUIEREN A PROVEEDORES DE ROSARIO POR NO SER COMERCIALIZADOS POR AQUELLOS.', 'AL SER DE PRODUCCION NACIONAL TODOS LOS INSUMOS, NO TENEMOS PROBLEMAS EN EL ABASTECIMIENTO. CON EL APORTE QUE NOS BRINDARIA ESTE PROGRAMA, PODRIAMOS PLANIFICAR COMPRAS MAYORES A LAS QUE HACEMOS Y DE ESA MANERA REDUCIR COSTOS.', 'EL MONTO SOLICITADO SERA PARA LA COMPRA DE INSUMOS Y MATERIA PRIMA DE PRODUCCION.', 'ACTUALMENTE TENEMOS 3 EMPLEADOS, Y PARTICIPAMOS DE LA PRODUCCION MI PADRE, ABUELA Y UNO DE MIS HERMANOS.', 'NUESTRA EMPRESA EMPLEA GENTE DE LA CIUDAD Y TENEMOS UN PROYECTO DE EXPANSION PARA TRASLADAR LA FABRICA Y ABRIR OTRO PUNTO DE VENTA, QUE NOS PERMITIRIA ABASTECER HELADERIAS DE OTRAS LOCALIDADES Y AUMENTAR LA CANTIDAD DE EMPLEADOS, GENERANDO DE ESA MANERA OTROS PUESTOS DE TRABAJO.', 'LOS PRECIOS DE NUESTROS PRODUCTOS SE UBICAN APENAS POR ENCIMA DEL RESTO DE LAS HELADERIAS QUE NO SON ARTESANALES, LOGICAMENTE POR LOS MAYORES COSTOS, PERO TAMBIEN POR LA CALIDAD DEL PRODUCTO.', 'NUESTRA FORTALEZA ES LA TRAYECTORIA DE LA EMPRESA CON MAS DE 40 AÑOS EN EL RUBRO, Y POR EL EXCELENTE PRODUCTO QUE OFRECEMOS.', 'CON LA SITUACION ACTUAL DEL MERCADO QUE HA PRODUCIDO EL CIERRE DE OTRAS HELADERIAS, NOS PERMITIRIA EXPANDIRNOS Y CUBRIR LA CUOTA DE MERCADO QUE HA QUEDADO DISPONIBLE.', 'LA DEBILIDAD QUE TENEMOS ES QUE AL NO PODER PRODUCIR A MAYOR ESCALA, LOS COSTOS SON SUPERIORES A LOS QUE OBTIENEN CADENAS DE HELADERIAS.', 'NUESTRA PRINCIPAL AMENAZA SON EL COSTO DE LAS MAQUINARIAS Y SUS REPUESTOS, QUE AL SER IMPORTADOS Y CON LA CONSTANTE SUBA DEL DOLAR, SE HACE CADA VEZ MAS COSTOSO REPONER LOS MISMOS.', '2020-10-08 12:56:29', '2022-06-08 12:07:43'),
(27, 44, 39, 24, 1, 'ECÓGRAFO PORTÁTIL PARA SERVICIOS DE MEDICINA', 'El sanatorio \"Cooperativa de Trabajo Luis Jeanot Sueyro Ltda\" se dedica a brindar servicios médicos asistenciales. Para un mejor servicio de diagnostico por imagen, se necesita incorporar un ecografo portátil que será de gran utilidad para poder trasladar a los distintos sectores del sanatorio brindando mayor eficacia y comodidad del enfermo.', '1000000.00', NULL, 0, 'Como se menciono en el resumen ejecutivo, nuestro proyecto se basa en la compra de un ecógrafo portátil para mejorar el servicio brindado.', 'El objetivo es garantizar la prestación de servicios a los beneficiarios, velar por la salud de la vida de los mismos, garantizar la calidad de atención a los pacientes , mejorar la eficiencia del servicio, preservar los puestos de trabajo, crear nuevas oportunidades laborales, fomentar el modelo asociativo, entre otros.', 'La adquisición del ecografo portátil permitirá mejorar el diagnóstico de cada paciente y recategorizar el servicio de Diagnostico por Imagen. De esta forma atraeríamos nuevos clientes.', 'Actualmente se brindan servicio de guardia médica permanente, de internación ambulatoria, quirúrgica de baja-media y alta complejidad, ginecológica – obstétrica, clínica, de esterilizacion, de diagnóstico por imagen. etc. El sanatorio cuenta con 30 camas, 6 camas de terapia intensiva, 6 camas de maternidad, 2 camas en showroom y con un equipamiento con toda la aparatología adecuada. Ademas se cuenta con 3 quirófanos, sala de partos y esterilización.', 'Bajo el lema \"Compromiso Social con la Salud\" esta cooperativa de Trabajo surge del cierre del Sanatorio AGOS. Los empleados que perdieron la fuente laboral, decidieron emprender un nuevo camino logrando formar la cooperativa obteniendo y  la matricula del INAES en 6/2016 y abriendo sus puertas el 13/02/2017.', 'Hoy hemos logrado re acondicionar la parte edilicia, equipar con aparatología en los sectores que lo requieran, brindar nuevos servicios, como por ejemplo la Unidad de Terapia Intensiva. Este sanatorio esta bien posicionado en la ciudad, los ciudadanos apoyan y aprecian los esfuerzos de la cooperativa para llevar adelante este sanatorio. Siempre con el lema \"Compromiso Social con la Salud\"', 'Sanatorio ubicado en la calle Ayacucho 229 de la ciudad de Gualeguaychú, provincia de Entre Ríos.-', 'Alquilado. En calle Ayacucho 229 ciudad de Gualeguaychú, provincia de Entre Ríos', 'Monitor Led de alta resolución de 15.6, hasta 120 de angulación, touch panel de 8\" que simplifica el flujo de trabajo, modos: 2D modo-M conector universal de traductores Xcen para compactibilidad total con toda la linea VINNO. Plataforma de RF y procesamiento de datos RF, densidad de lineas hasta512', 'Plataforma RF trabaja con información precisa, transfiere los datos RF adquiridos en la etapa digital del sistema, lo procesa, generando un mayor nivel de detalle de las imagenes y contraste ultra-premiun. es capaz de resolver múltiples hilos de procesamiento de datos.', 'Fase de la inversión:La compra del ecógrafo. Fase de Operaciónoperar en forma eficiente la unidad de prestación de servicios. Prestar servicios. Optimizar los  procurando en todo momento la mejor calidad posible Cronograma una vez adquirido el préstamo  se comunica con los para adquirir apatologia', 'No utiliza materia prima ya que brinda servicios.', 'Todos los materiales descartables son procesados con el tratamiento correspondiente', 'La realización de este proyecto permitirá captar mas clientes de la ciudad de Gualeguaychú y zonas aledañas.  Esta aparatología aumentaría la capacidad de competencia con los otro centros privados de la ciudad.', 'Los clientes a capturar son los pacientes de las Obras sociales sindicales, prepagas, particulares, lograr obtener mas cápitas de del PAMI.', 'En la localidad de Gualeguaychú existen tres centros privados Sanatorio San Lucas, Sanatorio Pronto. Los mismos brindan servicios de imágenes, por tal motivo necesitamos incrementar tecnología a nuestro servicio', 'Los proveedores en este caso es el médicos al cual se le abona por practicas realizadas. Y los cooperativistas a incorporar para este servicio.', 'Los riesgos en este caso no serían de relevancia porque es de uso para todos los sectores. Consultorios extrenos. Internacion en piso y en UTI. Guardia.', 'El destino del monto es para la compra de un ecografo portátil. El valor total ea de $3.000.000 pero se solicitara $1.000.000 a este programa', 'Un médico radiológo, un administrativo y un Técnico de rayos X.', 'Lograríamos una avanzada tecnología para facilitar Diagnósticos por imágenes rápidamente, ideal para Anestesia, Emergencia y medicina del dolor y punto de atención del paciente. Soluciones De Calidad.', 'Servicio de medicina', 'Equipo de profesionales altamente calificados avala nuestra forma de trabaja. Una alternativa en salud con especialistas en todas las áreas\r\nInfraestructura edilicia con capacidad de internación en las distintas especialidades atención a las obras sociales, con primacía a los adultos mayores comprendidos en PAMI y prepagas que predominan en la zona. Aparatología: se cuenta con aparatología para realizar procedimientos de baja y mediana complejidad. Contar la apoyo de la comunidad de Gualeguaychú', '-Desarrollar la infraestructura necesaria para brindar la mejor atención con aparatologia adecuada, procurando el perfeccionamiento tecnológico.\r\nPara lograr nuestro objetivo necesitamos adquirir el ecografo digital , a través de una asistencia financiera  ya que por nuestros medios no podríamos lograr la modernización y la competitividad que el mercado interno demanda.', 'No contar con esta tecnología para realizar operaciones quirúrgicas y dar el bienestar al médico y al paciente es una debilidad.', 'La amenaza es que los pacientes y los médicos opten por elegir otros sanatorios y esto se vea reflejado en la facturación.-', '2020-10-15 16:21:49', '2020-10-23 11:57:33'),
(33, 47, 35, 24, 1, 'AUMENTO CAPACIDAD FERMENTACION', 'Viva la birra srl, fábrica de cerveza artesanal, posee una capacidad productiva actual de 10 mil litros por mes. Debido a la ampliación de nuevos mercados así como al crecimiento de la marca y elección de los consumidores necesitamos aumentar nuestra capacidad de fermentación y por ende de producción en 4 mil litros mensuales. Esto sería posible con la compra de 2 fermentadores de 1280 litros cada uno.', '1000000.00', NULL, 0, 'El aumento de capacidad de producción de la fabrica esta directamente vinculada con la compra de fermentadores que permiten transformar el mosto en cerveza a partir de la acción de levaduras cerveceras en un ambiente controlado de presión y temperatura. El proceso de fermentación dura 14 dias promedio que dependerá del estilo elaborado. Cada fermentador tiene una capacidad útil de 90 por ciento del volumen total. Necesitamos 4 mil litros mensuales para satisfacer la demanda actual.', 'Aumentar nuestra capacidad de producción en 4 mil litros mensuales.', 'Una gran oportunidad ha sido generada a partir de la inversión en una maquina enlatadora de cerveza y esto ha permitido la apertura de un nuevo mercado tanto local, provincial, nacional e internacional. El conocimiento de los consumidores sobre cerveza artesanal ha incrementado la demanda de este producto tanto en formato de cerveza tirada como en latas.', 'La empresa se encuentra produciendo 10 mil litros mensuales, cuenta con canal de venta directo y abastecimiento a distintos bares de la provincia. Hemos comenzado el canal de comercialización de latas que permiten nuevos mercados y nuevos desafíos en cuanto a los volumenes de venta.', '7 Colinas como nombre de fantasia y en su forma legal de VIVA LA BIRRA SRL, nace hace 3 años con el objetivo de poder desarrollar nuestras profesiones (Ingeniero en alimentos e Ingeniero industrial) en nuestra ciudad y poder generar un polo cervecero en la provincia. La pasión implementada junto a la mejora continua en calidad nos ha permitido posicionarnos como una empresa joven, emprendedora, profesional y con muchas expectativas en cuanto al futuro.', 'Hoy 7 Colinas se encuentra presente en las principales ciudades de la provincia. Producimos 10 mil litros de cerveza artesanal de primera calidad en mas de 18 estilos diferentes. Tenemos un canal de venta directo generado por 2 bares donde se cuenta con una gastronomía acorde a la cerveza y en estos puntos de venta se trabajan por sistema de \"delivery\" y \"take away\". El canal de distribución ya desarrollado ofrece la cerveza en barriles de 50 litros y esta destinado a bares.', 'La fábrica funciona en calle estrada 838 de Concepción del Uruguay, Entre Rios', 'El alquiler esta pactado con renovación cada 3 años. Es una propiedad de 900 metros cuadrados.', 'La cerveza artesanal es un producto alimenticio que se consume hace mas de 10 mil años y es producido a partir de un cereal, agua, lúpilo y la fermentacion de levaduras cerveceras. Existen muchos estilos y cada uno de ellos cumple con ciertos parámetros de:% alcohol, IBU (unidades de amargor), color', 'La producción de cerveza requiere de tecnología de control de temperatura, tiempos, concentraciones y presiones. Se trabaja en sistema por batch todo entra todo sale. Estos controles se lleva adelante dentro de los fermentadores y se necesitan servicios auxiliares para generar calor, frio y aire.', 'El proceso comienza con la molienda del grano, luego maceracion de los granos en agua caliente. Se filtra usando el mismo manto de grano. Trasvase del mosto. Cocción, enfriamiento y fermentación. Envasado y comercialización.', 'La materia prima utilizada en nuestra fabrica es malta de cebada, trigo malteado, agua filtrada, lúpulo (dependiendo del estilo a elaborar es su variedad y cantidad) levadura cervecera. En estilos particulares utilizamos: miel, frutas y condimentos', 'El principal subproducto es el grano luego de macerar que es destinado para alimentación animal. El residuo liquido es agua de lavado cuya carga es mínima ya que los productos de limpieza son re circulados y recuperados para su reutilización.', 'En Argentina se consumen actualmente 40 lts/hab/año, de esta cantidad el mercado ela cerveza artesanal se encuentra entre el 4y 5   % en rápida expansión. Cabe mencionar que en mercados como Brasil cuya explosión de cerveza artesanal comenzo antes que en Argentina el porcentaje de esta bebida ocupa entre el 10 y 12 %', 'Los clientes son consumidores que están ávidos de nuevos sabores y aromas. La cerveza como bebida todos la conocen y este nuevo mundo de la cerveza artesanal la ha permitido redescubrir por fuera dee los estándares que nos tenían acostumbrado los productos industriales.', 'El mercado artesanal es pequeño y los volúmenes comparados con respecto al total consumido de cerveza hace que la única competencia sea poder \"robarle\" un pequeño porcentaje a las cervezas industriales. Entre cervezas artesanales no existe competencia directa mas allá de algún caso particular.', 'Los proveedores de maltas que utilizamos son de Argentina y hay buena disponibilidad del cereal. Respecto a levaduras y lúpulos es un poco mas complicado porque en su mayoria son importadores. Nuestra estrategia es contar con un banco de levaduras propios y la utilización en lo que mas podamos de lúpulos nacionales.', 'Banco propio de levaduras y re utilización de las mismas, esto nos permite minimizar costos de este insumo. Compra de lúpulos nacionales en todo lo posible y desarrollo de mejoras en procesos para hacerlos muy eficientes.', 'Compra de 2 fermentadores de 1280 litros cada uno.', '3 Personas directas', 'Abastecer la demanda y la expansión en las ventas nos permitirá seguir creciendo en volumen así como poder avanzar en otras formas de comercialización y crecmiento del negocio generando nuevas áreas de trabajo y nuevos conocimientos a todos los actores de la empresa.', '1350000 pesos las 2 unidades', 'Empresa sólida, ordenada y en expansión. Con equipos de trabajo de profesionales con conocimiento y pasión.', 'Mercado en crecimiento. Oportunidad en venta de producto enlatado inclusive exportación', 'Mercado claramente fluctuante cuanto a la estacionalidad. Muy dependiente de situación económica de la población.', 'Las grandes marcas tradicionales están avanzando en el mercado de las artesanales. Tanto con la compra de pequeñas empresas como en el desarrollo de productos competitivos. Todo esto usando su situación de poder económico y de marketing', '2020-10-19 11:53:07', '2020-11-04 23:56:21'),
(34, 58, 40, 19, 1, 'SERVICIOS DE SOFTWARE E INFRAESTRUCTURA EN LA NUBE.', 'El continuo incremento del dólar hace inviable la contratación por parte de las Pymes de los servicios en la Nube como ser Saas e IaaS; software como servicio e Infraestructura como servicio. Nuestro proyecto consiste en construir infraestructuras destinadas a brindar servicios cotizados en pesos. Si bien la adquisición de infraestructura se realiza en dólares del Banco Nación, el negocio podría crecer a un 50 % anual solamente con las empresas de la región como clientes, incluído Uruguay.', '650000.00', NULL, 0, 'Desplegar la tecnología necesaria para brindar los servicios de computación en la nube. El proyecto es el primero que se llevará a cabo en la provincia.', 'Construir infraestructuras y sistemas de alta disponibilidad para brindar servicios de calidad mundial a las industrias regionales. Compartir el conocimiento adquirido con las organizaciones académicas de la región, de modo de incentivar el desarrollo tecnológico de la comunidad.', 'Brindar servicios en la nube a precios en pesos argentinos y no en dólares como lo hacen la mayoría de las empresas.', 'Actualmente está desplegado un 40 % del software (Open Source) que contempla el proyecto de servicios en la nube con alta disponibilidad. El despliegue se encuentra en servidores propios.', 'Simplifica DC nace en la región del Río Uruguay como la primera consultora en Seguridad Informática y Continuidad de los Negocios. Fundada en mayo de 2009 con la vocación de prevenir y gestionar el riesgo de las organizaciones  en su vida digital.  Teniendo como pilar el contribuir a la creación de una cultura de la seguridad de la información y continuidad de los procesos. Simplifica DC ofrece el servicio de data center, único en la región, para el almacenamiento y protección de la información.', 'Simplifica DC desarrolla soluciones a medida para todo tipo de necesidades, prácticas e innovadoras, entre ellos contamos con sistemas de acreditaciones de eventos, sistemas de turnos, sistemas de contact center y mucho más. Todas estas aplicaciones residen nuestro Datacenter. Queremos convertirnos en la primer software factory regional con mano de obra provista por las universidades locales.', 'Oficinas propias, incluyendo un datacenter que puede contener hasta 8 racks., diseñada para que trabajen hasta 5 personas con comodidad (ergonomía) de alto nivel.', 'No aplica.', 'El cloud computing abarca muchos aspectos diferentes, por lo que pueden realizarse distintas clasificaciones dependiendo de la característica que se considere, tradicionalmente se pueden señalar los siguientes tipos de clouds: Software como Servicio (SaaS), Infrestructura como Servicio (IaaS) y PaaS', 'A nuestra escala utilizamos tecnología de nivel mundial como ser servidores IBM/HP/DELL, redes HP, infraestructura de wifi Ubiquiti, Cableado Commscope, Pc ´s de escritorio Lenovo, impresoras HP Color, Ups Eaton On-Line con supervisión remota y fibra óptica para el acceso a Internet.', 'Los procesos principales son la instalación de paquetes de software de base (Sistemas Operativos y Motores de Bases de  Datos), parametrización, tuning y control operativo de los mismos. También está como proceso productivo principal la programación de aplicaciones que dan soporte a los servicios.', 'No Aplica.', 'No Aplica.', 'Los servicios informáticos no tienen fronteras, estamos muy confiados en que los mercados internacionales serán una gran oportunidad para el ingreso de divisas a la ciudad, así como, abastecer de estos servicios a los negocios locales que hoy recurren a proveedores ubicados en las grandes urbes o en otros países inclusive.', 'Estamos focalizados en clientes locales que ya no pueden pagar estos servicios en dólares y además en clientes de otros países que pueden permitir el ingreso de divisas.', 'La competencia es de nivel mundial, pero tenemos el conocimiento y experiencia para hacer frente y hasta mejorar los servicios brindados, diferenciandonos tanto en costos como en el valor agregado a las organizaciones.', 'Nexsys Argentina S.A. - Proveedor de Hardware (Servidores y Dispositivos de Backup).\r\nISECOM S.A. - Proveedor de Infraestructura de redes.\r\nEmelec S.A. - Proveedor de Ups Eaton (Energía).', 'Variablidad del dólar oficial que es el que se utiliza para las compras de hardware critico (servidores y sus repuestos). La estrategia para conseguir dólares sería la de desplegar las ventas a los países vecinos a precios extremadamente competitivos.', 'Será destinado para adquirir hardware y contratar mano de obra especializada para construir los sistemas de alta disponibilidad.', '3 (tres) freelancers de nivel universitario.', 'Actualmente en la región no hay empresas locales que ofrezcan el servicio de tecnología de cloud computing o computación en la nube. \r\nPor lo tanto, seríamos la primer PyMe de Entre Ríos en brindar servicios de clase mundial en infraestructura y software, con precios para el mercado local en pesos argentinos.', 'Página Web (Hosting & Correo Electrónico): $ 12.000.- (Anual).\r\nServidores Virtuales: $ 25.000.- (Anual).\r\nHora de Consultoría (de primer nivel): $ 1.000.- \r\nHora de Consultoría (de segundo nivel): $ 1800.-', 'Inversión y costos reducidos para los clientes.\r\nControl de costos, varían con el uso, escalable a demanda. \r\nInmediato despliegue de infraestructura y software.\r\nRobustez y mantenimiento profesional.', 'Aumento de la estabilidad, ancho de banda y seguridad de Internet por cada peso del servicio.\r\nAcompañar el crecimiento y desarrollo de la región.\r\nCrisis económica (costo del dólar muy alto)\r\nTendencia mundial del crecimiento de mercado del “Cloud”.', 'Posibles costos moderados o fuertes para la inversión inicial.\r\nVersionado del software.\r\nConexión de Internet.', 'Problemas de algún proveedor del mercado de seguridad, disponibilidad, privacidad, etc.\r\nDispersión de la nube sin control en varios centros de datos.\r\nMercado inmaduro. \r\nBaja de costos en infraestructura y mantenimiento tradicionales.', '2020-10-19 12:26:06', '2020-11-20 14:52:07'),
(35, 60, 41, 24, 1, 'PLANTA RECICLADORA MATERIAL Y DESECHOS PLASTICOS', 'COMPRA DE MÁQUINA  E INSTALACIÓN ELÉCTRICA  PARA PONER FUNCIONAMIENTO UNA RECICLADORA DE DESECHOS Y DESPERDICIOS PLÁSTICOS DE NUESTRA EMPRESA Y DE TODAS LAS ZONAS DE INFLUENCIA, CON UNA CAPACIDAD DE PRODUCCIÓN DE 100 TN MENSUALES. EN SÍNTESIS EL PROCESO CONSISTE EN VOLVER A RE INDUSTRIALIZAR LOS DESECHOS PLÁSTICOS QUE TANTO CONTAMINA AL MEDIOAMBIENTE', '1000000.00', NULL, 0, 'RECOLECTAR PLÁSTICOS COMO SILOS BOLSAS, BIDONES, DESECHOS SEPARADOS POR PLANTAS MUNICIPALES, DESECHOS POST-INDUSTRIAL, Y NUESTRO PROPIO DESPERDICIO DE LA EMPRESA QUE TENEMOS EN MARCHA.\r\nPROCEDER A SU LAVADO, MOLIDO, SECADO Y PROCESADO POR LA MÁQUINA EN FORMA DE GRUMO LISTO PARA SER USADO COMO MATERIA PRIMA EN NUESTRA EMPRESA Y ADEMÁS SU COMERCIALIZACIÓN A OTRAS EMPRESAS DEL RUBRO.', 'BAJAR NUESTRO COSTO DE PRODUCCIÓN YA QUE EN LA ACTUALIDAD ESTE MATERIAL LO ADQUIRIMOS EN OTRAS PROVINCIAS DE NUESTRO PAÍS. CON ESTE PROCESO NOS PROVEEREMOS DE NUESTRA MATERIA PRIMA, INCORPORAREMOS EMPLEADOS Y VOLVEREMOS A RE INDUSTRIALIZAR DESECHOS Y DESPERDICIOS PLÁSTICOS CON TODA LA MEJORA MEDIO AMBIENTAL QUE ESTO SIGNIFICA.', 'NUESTRA EMPRESA PROVEE ENTRE OTROS VARIOS ARTÍCULOS BOLSAS A DISTRIBUIDORES DIRECTOS QUE PROVEEN A TODOS LOS AEROPUERTOS Y CASINOS DEL PAÍS, A DEMÁS A HOSPITALES, CENTROS DE SALUD Y MUNICIPIOS VARIOS. LA MAYOR OPORTUNIDAD ES BAJAR EL COSTO Y MEJORAR LA CALIDAD DE NUESTRA MATERIA PRIMA CON EL OBJETO DE SEGUIR MANTENIENDO Y MEJORANDO NUESTRAS POSIBILIDADES DE VENTAS.', 'EN LA ACTUALIDAD NOS ENCONTRAMOS ADQUIRIENDO ESTA MATERIA PRIMA EN LA PROVINCIA DE BUENOS AIRES, SAN LUIS Y MENDOZA PRINCIPALMENTE, A DEMÁS NUESTRA EMPRESA PRODUCE DESPERDICIOS PLÁSTICOS EN SU PROCESO DE PRODUCCIÓN DE UNAS 10 TN MENSUALES APROXIMADO, ESTOS DESECHOS SON VENDIDOS A UN MUY BAJO VALOR A ESTOS PROVEEDORES PARA QUE ELLOS PUEDAN DESARROLLAR EL PROCESO QUE ESTAMOS DESARROLLANDO NOSOTROS .', 'NUESTRA EMPRESA HACE MAS DE 25 AÑOS QUE ESTA EN EL MERCADO EN FORMA CONTINUA Y HA MANTENIDO UN CRECIMIENTO SOSTENIDO EN TODOS ESTOS AÑOS. COMENZÓ PRODUCIENDO BOLSAS IMPRESAS A BAJA ESCALA., UNAS 3 TN MENSUALES APROXIMADO', 'EN LA ACTUALIDAD SE PRODUCEN APROXIMADAMENTE 150 TN MENSUALES Y CONTAMOS CON 40 EMPLEADOS ENTRE CONTRATADOS DIRECTOS Y TERCIA RIZADOS, ATENDEMOS A LA INDUSTRIA FRIGORÍFICA, ALIMENTICIA, LÁCTEA Y TEXTIL ENTRE OTRAS. A DISTRIBUIDORES EN DISTINTAS PROVINCIAS DEL PAÍS CON BOLSAS LISAS E IMPRESAS HASTA 6 COLORES Y EN MATERIALES DE POLIETILENO  Y POLIPROPILENO ENTRE OTROS. LA PRODUCCIÓN SE DIVIDE,  50 % APROXIMADO MATERIALES VÍRGENES Y EL RESTO EN MATERIALES RECUPERADOS', 'CONTAMOS CON 4 GALPONES (MAS DE 3.000 M2 CUBIERTOS) Y NOS ENCONTRAMOS EN EL PARQUE INDUSTRIAL DE LA CIUDAD DE LARROQUE. A DEMÁS ACABAMOS DE ADQUIRIR UN TERRENO MUNICIPAL DE 2.600M2 DONDE FUNCIONARÁ ENTRE OTRAS COMO ACOPIO DE MATERIA PRIMA', NULL, 'PRODUCIMOS BOLSAS-FILM  LISAS E IMPRESAS PARA EL PACKASING DE LOS PRODUCTOS QUE LAS EMPRESAS ANTES MENCIONADAS PRODUCEN COMO POR EJEMPLO EL FILM PARA SACHET DE YOGURT Y LECHE, HASTA BOLSAS DE DESECHOS PATOLÓGICOS DE HOSPITALES ENTRE OTROS.', 'TENEMOS MÁQUINAS EXTRUSORAS, IMPRESORAS Y CONFECCIONADORAS DE ÚLTIMA GENERACIÓN CON LO CUAL PARTIMOS DE LA MATERIA PRIMA QUE ES EL PLÁSTICO Y LUEGO EN ESTOS PROCESOS USAMOS ENERGÍA ELÉCTRICA, TINTAS Y DILUYENTES, POLÍMEROS Y MANO DE OBRA PARA OBTENER LA PRODUCCIÓN FINAL.', 'PRIMERO LLEGA LA MATERIA PRIMA A NUESTROS GALPONES QUE SERÍA GRUMO DE PLÁSTICO, VIRGEN Y RECUPERADO (EL RECUPERADO  LO VAMOS A PRODUCIR NOSOTROS AHORA). ESTE MATERIAL INGRESA EN EL PRIMER PROCESO QUE ES LA EXTRUSIÓN, LUEGO IMPRESIÓN Y POR ÚLTIMO CONFECCIÓN O CORTE.', 'USAMOS MATERIAL VIRGEN (  DE ORIGEN NACIONAL O IMPORTADO POLIETILENO  Y POLIPROPILENO) Y MATERIAL RECUPERADO. A DEMÁS USAMOS USAMOS TINTAS Y DILUYENTES, POLÍMEROS COMO PRINCIPALES COMPONENTES DE NUESTRA MATERIA PRIMA', 'LOS DESPERDICIOS PLÁSTICOS QUE SE GENERAN SE VUELVEN A RE INDUSTRIALIZAR COMO SE EXPLICO ANTERIORMENTE. CON LA NUEVA MÁQUINA SE DESECHARÁ AGUA EN POCA CANTIDAD PREVIAMENTE TRATADA EN SU PH.', 'NUESTRO MERCADO ES NACIONAL Y COMERCIALIZAMOS EN LA MAYORÍAS DE LAS  PROVINCIAS DEL PAÍS A TRAVÉS DE DISTRIBUIDORES Y DIRECTAMENTE A LAS GRANDES INDUSTRIAS.', 'INDUSTRIAS FRIGORÍFICAS, LÁCTEAS, HOSPITALES, TEXTILES Y GRANDES DISTRIBUIDORES Y EN UN MENOR PORCENTAJE MENOR A PEQUEÑOS CLIENTES COMO BOUTIQUE, PANADERÍAS, FARMACIAS ETC.', 'NOS ENCONTRAMOS EN UNA ESCALA MEDIA DENTRO DEL RUBRO CON LA CUAL NUESTRA PRINCIPAL COMPETENCIA SE ENCUENTRA EN LA PROVINCIA DE BUENOS AIRES BÁSICAMENTE.', 'EL PLÁSTICO ES UN COMODITI, CON RESPECTO AL MATERIAL VIRGEN EXISTEN CUATROS PRINCIPALES COMERCIALIZA DORES Y NOSOTROS MANTENEMOS CONTACTOS FLUIDOS CON TODOS ELLOS. A DEMÁS HEMOS IMPORTADO DIRECTAMENTE CUANDO EL PRECIO CONVIENE. CON EL MATERIAL RECUPERADO ADQUIRIMOS EN DISTINTAS PROVINCIAS. OTRO IMPORTANTE PROVEEDOR ES ENERSA  YA QUE  LA ENERGÍA ELÉCTRICA ES EL SEGUNDO COMPONENTE DEL COSTO. Y LA LOGÍSTICA LA HACEMOS CON TRANSPORTE PROPIO Y EN SU MAYORÍA CON TRASPORTE MOSTTO.', 'NUESTRO PRINCIPAL RIESGO SE ENCUENTRA EN LA PRODUCCIÓN PARA PODER CUMPLIR EN TIEMPO Y FORMA EN LOS TIEMPOS REQUERIDOS POR NUESTROS CLIENTES. OTRO RIESGO ES EL TIPO DE CAMBIO OFICIAL DOLAR Y LA CADENA DE PAGO. COMO ESTRATEGIA QUEREMOS PRODUCIR NUESTRA MATERIA PRIMA RECUPERADA A EFECTOS DE CONTAR CON STOCK PERMANENTE. A DEMÁS TENEMOS STOCK DE MATERIAL VIRGEN PARA PROTEGERNOS DE LA SUBA DEL TIPO DE CAMBIO Y DE LOS SALDOS EN CUENTAS CORRIENTES. DE ESTA FORMA EQUILIBRAMOS LA BALANZA Y NOS MATENEMOS', 'ADQUISICIÓN DE TABLEROS, CABLES, Y DEMÁS COMPONENTES ELÉCTRICOS NECESARIOS PARA LA INSTALACIÓN Y PUESTA EN FUNCIONAMIENTO DE LA MÁQUINA EXTRUSORA QUE ACABAMOS DE ADQUIRIR', '40 EMPLEADOS (ENTRE DIRECTOS Y TERCIA RIZADOS)  Y CON ESTE NUEVO EMPRENDIMIENTO  INCORPORAREMOS 4 MÁS.', 'COMO IMPACTO SOCIAL DESTACAMOS EL CUIDADO Y MEJORA DEL MEDIO AMBIENTE Y ECONÓMICAMENTE DAREMOS UN INGRESO REAL EN NUESTRA ECONOMÍA PROVINCIAL YA QUE LA MAYORÍA DE DESECHOS DE DESPERDICIOS Y PLÁSTICOS ERAN ADQUIRIDOS POR PRODUCTORES DE OTRAS PROVINCIAS Y TRANSFORMADOS EN GRUMOS. LUEGO NUESTRA EMPRESA Y OTRAS DEL RUBRO LO ADQUIRÍAMOS', 'ES MUY VARIADO DETALLARLOS DEBIDO A LA CANTIDAD DE DIFERENTES PRODUCTOS PERO A MODO DE IDEA UN KG DE MATERIAL VIRGEN PROCESADO  ESTÁ ALREDEDOR DE $220,00 , Y 1 KG DE MATERIAL RECUPERADO $160,00', 'EXPERIENCIA EN EL RUBRO, CONTACTO Y RELACIONES A LO LARGO Y ANCHO DE TODO EL PAÍS, TENEMOS BUENA CALIFICACIÓN EN LOS BANCOS, CARPETA IMPOSITIVA Y DOCUMENTACIÓN AL DÍA. LA ZONA DONDE ESTAMOS INSTALADOS Y POR ÚLTIMOS SOMOS UNA GENERACIÓN JOVEN CON MUCHAS GANAS DE SEGUIR DESARROLLANDO LA EMPRESA A SU MÁXIMO POTENCIAL.', 'ESTE ES EL MOMENTO OPORTUNO PARA PONER EN FUNCIONAMIENTO NUESTRO NUEVO PROYECTO, DEBIDO A QUE BAJANDO LOS COSTOS VAMOS A PODER ABSORBER LA PÉRDIDA DEL MERCADO DEBIDO A LA ACTIVIDAD ECONÓMICA ACTUAL.', 'LA SITUACIÓN ECONÓMICA ACTUAL, COMPLICACIÓN PARA CONSEGUIR EMPLEADOS ESPECIALIZADOS EN EL RUBRO.', 'INCERTIDUMBRE REFERENTE AL FUTURO CON LAS VARIABLES QUE NOS EXCEDEN Y NOS PODEMOS MANEJAR COMO POR EJEMPLO ESTA E´POCA DE PANDEMIA ENTRE OTRAS.', '2020-10-19 19:51:37', '2020-10-26 22:46:47'),
(37, 68, 43, 24, 1, 'AMPLIACIÓN DE LA CAPACIDAD PRODUCTIVA', 'La Empresa está en proceso de ampliación de su capacidad productiva, para lo cual necesita financiamiento de capital de trabajo para la compra de mayor cantidad de leche cruda y ampliación de su espacio de saladero el que será de saladero dinámico.', '1000000.00', NULL, 0, 'La Empresa está en proceso de ampliación de su capacidad productiva, para lo cual necesita financiamiento de capital de trabajo para la compra de mayor cantidad de leche cruda y ampliación de su espacio de saladero el que será de saladero dinámico.', '1.800.000 litros de leche a procesar\r\n240.000 kg de producto final', 'oportunidad de nuevos mercados, ampliación de la planta de personal, ampliación de facturación y crecimiento de la cadena de valor', 'actualmente se cuenta con una capacidad instalada de 700.000 litros y 85.000 kilogramos de productos elaborados', 'Omar Paulini, fundador, comenzó como productor tambero por tradición familiar, siendo su padre socio fundador de Cotapa (Cooperativa Tambera Paraná).\r\nEn sus comienzos trabajó como transportista en la empresa Sancor, durante 20 años. Hace quince, se unió a pequeños y medianos productores, comenzando con la concentración, transporte y enfriado de leche bajo el nombre de Esperanza Blanca lo cual se vendía a grandes empresas.', 'Desde nuestros inicios hasta hoy, muchas cosas han pasado, y hoy, cumpliendo nuestros 15 años, felizmente podemos decir que somos una marca conocida en la región, destacada por la calidad de los productos y nuestra cálida atención al cliente', 'Ruta Nacional 12 - Kilómetro 54', 'La planta funciona en un predio e inmueble propio', 'Quesos duros, semiduros y blandos sin TACC', 'Productos totalmente naturales', 'Ingreso de leche, pasteurización, coagulación, salado, estacionado y envasado', 'Leche natural', 'Se utiliza la totalidad del suero y grasa butirosa', 'Los productos se venden en la provincia de Entre Ríos, Misiones, Salta, Formosa y Entre Ríos', 'Mayoristas, minoristas y consumidores finales', 'Demás industrias lácteas entrerrianas (principalmente nucleadas en la CILER, pero con gran colaboración entre todas) e industrias lácteas santafesinas y cordobesas', 'Tamberos del departamento Paraná', 'Los principales riesgos son los avatares económicos y financieros\r\nLa estrategia para superar los mismos es planificación y presupuestación del capital de trabajo', 'Capital de trabajo en general', '23 en empleo directo', 'Hacia toda la cadena de valor, 25 tamberos, empleados y consumidores en general', 'Son 16 productos propios elaborados, cuya base de medición es el valor de la leche establecido nacionalmente SIGLEA', 'Estructura relativamente pequeña. Productos reconocidos por su calidad. Empresa ya afianzada en la zona. elaboración versátil', 'Ubicación geográfica. Disponibilidad de mano de obra calificada.', 'Falta de capital para invertir. infraestructura insuficiente para solventar mayor demanda', 'Mejor posicionamiento de la competencia. Pandemia sin precedente', '2020-10-23 18:10:18', '2020-11-04 23:55:58');
INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(38, 65, 44, 24, 1, 'INVERSIÓN Y PERFECCIONAMIENTO PRODUCTIVO', 'Empresa unipersonal formada por Forissi María Julieta.', '1000000.00', NULL, 0, 'El dinero se va a invertir en la adquisición de: Molino Micronizador de residuos de cascara de nuez pecan, Molino Triturador de residuos de poda y Máquina para FABRICACION DE PELLETS DE CASCARA DE NUEZ PECAN.', 'Procesamiento de la cascara de desecho de la fruta, se microniza para la obtención de la harina. Con la incorporación del molino triturador se busca incorporar materia orgánica al suelo (aserrín) y producir materia prima para la producción de pellets. Por último, con la producción de pellets barato y no fósil, obtenemos un combustible coon un elevado poder calorífico de aproximadamente 4500Kcal sin perjudicar al medioambiente.', 'Optimizar parte de nuestro proceso productivo, utilizando al máximo nuestros desechos, En nuestra empresa, particularmente, la producción de pellets se utilizará, para el secado de la nuez pecan que es para bajar la humedad de la fruta que se cosecha. Su residuo, la ceniza es de origen vegetal y no es tóxica pudiéndose reciclar como abono para plantas.', 'La posibilidad de incorporar este equipamiento mejora el proceso productivo, que comienza desde la cosecha de la nuez, pasando por el acondicionamiento y posterior comercialización de la misma, en óptimas condiciones y con la mejor calidad.', 'La empresa se funda en el año 1986,cuando su precursor Ingeniero Agrónomo Roberto Ramond , en aquel momento esposo de María Julieta Forissi, comienza con un pequeño vivero de autoabastecimiento y una plantación de arboles de la misma especie en  la zona rural de la ciudad de San José , distante 7 km. De Colon. No fue fácil, el cultivo de pecan era desconocido en el país.Para principios de la década del 90 se comenzó con las primeras cosechas , método rudimentario hasta entonces.', 'A partir del 2004 empieza la importación sucesiva de maq. desde los EEUU. Con este advenimiento se da el crecimiento sostenido a la actividad con alto valor agregado y con el incremento de volumen. Durante 4 años (2014-2017) , se realizaron exportaciones a China , Argelia, siendo merecedores del Premio a la PRIMERA EXPORTACION (Pcia. Entre Ríos). Actualmente incursionamos en el sector turístico explotando \"La Boutique de la Nuez Pecán\".', 'Ciudad de San José, Provincia de Entre Ríos, Ruta 26 Km. 7; el establecimiento está conformado por 20 hectáreas.', 'Propio', 'Diversidad de nuez pecán, con diferentes sabores, tales como: con sal, azúcar, chocolate, vainilla; productos elaborados a base de la misma nuez. Y en la boutique ofrecemos gran variedad de productos gourmets.', 'Son productos comestibles con diversidad en sus acabados.', 'A) Cosecha de la Nuez\r\nB) Almacenamiento\r\nC) Selección y Acondicionamiento\r\nD) Descascarado de la Nuez\r\nE) Conservación en cámara de Frio\r\nF) Procesamiento\r\nG) Fraccionamiento y Empaque\r\nH) Comercialización', 'La materia prima es producida por nosotros mismos, independientemente de los distintos insumos para cosechar y procesar la misma.', 'Justamente la maquinaria que se desea implementar se encuentra destinada a la optimización de dichos residuos, correspondientes a la cáscara de la nuez y residuos de ramas y podas de nogales.', 'Casi el 99% de la comercialización se vuelca en el mercado interno. Con el paso del tiempo hemos logrado abrirnos paso en este nicho de los frutos secos bajo la marca comercial “LA REINA DE LAS FRUTAS SECAS”.', 'Comercializamos regionalmente y en toda la República Argentina, con vista a reactivar la exportación.', 'Estamos muy bien posicionados con relación a la competencia ya que nuestro producto se diferencia por ser artesanal. El aspecto negativo es la competencia desleal de productores no inscriptos y que repercute en diferenciación de precios.', 'Nuestros insumos son adquiridos por medio de proveedores nacionales.', 'Ante la marcada caída en la ventas convencionales, se ha logrado enfocar y propiciar la VENTA ON LINE A TRAVES DE DIFERENTES PLATAFORMAS. Se han formalizado vínculos comerciales directos con Distribuidoras mayoristas y cadenas franquiciadas de dietéticas para llegar a los comercios minoristas y al consumidor final.', 'Adquisición de Molino Micronizador de residuos de cascara de nuez pecan, Molino Triturador de residuos de poda y Máquina para FABRICACION DE PELLETS DE CASCARA DE NUEZ PECAN.', 'Seis empleados en relación de dependencia.', 'Tal como lo mencionamos implica una mejora del proceso productivo, óptima utilización de residuos e impacto positivo en el medioambiente al generar combustible barato y no fósil.', 'Diversos, desde 250$ en adelante, en función a la variedad y cantidad.', '*Recurso Humano , gran experiencia y permanencia en la empresa\r\n*Excelente clima de trabajo en equipo\r\n*Seguridad Laboral\r\n*Posesión de infraestructura adecuada\r\n*Contar con capital propio\r\n*Know hawk \r\n*Calidad de productos\r\n*Excelente relación con proveedores\r\n*Marketing efectivo en redes sociales, medios de comunicación.\r\n*Propiedad de Marca comercial registrada.\r\n*Certificación LIBRE DE GLUTEN de nuestros  productos \r\n*Proyección de la imagen comercial\r\n*Cumplimiento efectivo ante nuestros clientes', 'Demanda incesante, en franco crecimiento en el mercado interno.\r\n*Marca reconocida por clientes minoristas y mayoristas\r\n*Certificación Libre de Gluten para nuestros productos\r\n*Experiencia en el mercado\r\n*Atención y asesoramiento permanente a nuestros clientes\r\n*Productos muy competitivos, bien posicionados con respecto a la competencia\r\n*Compromiso con el medio ambiente\r\n*Cobertura en todo el país.\r\n*Innovación permanente  en los productos.', 'Nuestra mercadería cuenta con un alto contenido “artesanal”, debido a este punto es  que cuando se juntan varios pedidos ocurra el llamado “cuello de botella” generando cantidad de horas extras del personal que modifican nuestros costos de producción', '*Dificultades de acceder a créditos a tasas blandas, necesarias para seguir siendo competitivos.\r\n*La tendencia alcista del dólar que nos dificulta ya que aumentan los costos de los productos / repuestos que se importan\r\n*Competencia desleal de productores que no se encuentran inscriptos y que ofrecen a precios muchos más bajos.\r\n*Problemas externos no controlables como la inflación, la inestabilidad económica , entre otros.', '2020-10-26 13:46:40', '2020-11-05 20:21:54'),
(39, 67, 45, 24, 1, 'PRODUCCIÓN DE ENVASES', 'El monto del crédito es destinado exclusivamente a la compra de materia prima para la producción de envases para la industria avícola. Permitiéndonos generar un stock de productos críticos los cuales en gran parte son importados', '1000000.00', NULL, 0, 'Compra de materia prima', 'Volver a ubicar la empresa como proveedor de la industria avícola.', 'Tener stock para cumplir con una demanda creciente', 'Producción en constante aumento desde abril del 2019', 'Fundada en 2004 como proveedores de la industria Avícola. Referente del sector por muchos años. Debido a los problemas económicos y societarios en el año 2018 se presentó en concurso de acreedores. En el año 2019 fue adquirida por Villamea Hnos logrando la continuidad de Embolsar S.A.', 'Se aumenta día a día la producción, mediante la compra de nuevas maquinarias y de personal.  Se desarrollan nuevos productos y expanden los mercados.', 'Un predio de aprox 1 has en el Parque Industrial de Concepción. Cuenta con 2 galpones para almacenamiento y producción.', 'Contamos con nuestro propio inmueble', 'Film de polietileno tanto de alta como de baja densidad.', 'Según solicitud el film de polietileno es impreso y confeccionado.', 'La materia prima de extruda formando un film de pe. Con este film luego se confeccionan las bolsas, impresas o no', 'Polietileno de Alta Densidad, Polietileno de Baja Densidad y Polietileno Lineal', 'Los desechos son entregados para su disposición final, se reutilizan como bolsa de consorcio o residuos.', 'Mercado avícola.', 'Frigoríficos Avícolas de la provincia, los cuales utilizan gran cantidad de nuestros productos', 'Existencia dentro de la provincia pero no tan específica como nuestra frábrica.', 'Se ha logrado recuperar el vínculo con nuestros proveedores. La mayor parte de ellos son de fuera de la Provincia', 'El mayor riesgo es una crisis avícola, que se reduzcan las exportaciones. Debido a la cantidad de maquinaria se podría desarrollar nuevos productos para industrias diversas. También los socios de Embolsar cuentan con otras empresas que se pueden relacionar.', 'Compra de materia prima', '8 (ocho)', 'Una fuente de trabajo en la ciudad, radicada y dirigida por personas de la cuidad.', 'Los precios de nuestros productos se encuentran determinados en pesos', 'Ubicación y especialidad', 'Desarrollar el mercado de la zona', 'Por el proceso de convocatoria de acreedores que afrontó la empresa por el momento no se cuenta con posibilidades de financiar la compra de maquinaria', 'No vemos a la competencia como amenazas, todo lo contrario nos permite y nos obliga de mejorar', '2020-10-29 18:58:41', '2020-12-21 14:06:58'),
(41, 70, 46, 24, 1, 'CABAÑA DON SAMUEL', 'la idea es hacer una mejora en genetica  del sistema de ganaderia al que vengo haciendo es decir darle valor agregado alproducto.', '815000.00', NULL, 0, 'realizar una cabaña de raza angus para poder incursionar en puros controlados y pedegree , para poder poder acceder a una rentabilidad mejor con venta de reproductores y vientres.', 'el objetivo es justamente darle el valor agregado a la produccion actual de la produccion que hoy es solo cria para vender invernada', 'es una oportunidad para poder mejorar las instalaciones y realizar las tareas de los que significa un buen manejo de la ganaderia .', 'hoy estoy desarrollando la mejora de la instalciones , corrales y divisiones de potreros para poder lograr el manejo adecuado a lo q estoy apuntando', 'es una propiedad que viene de la familia , generalmente apuntando a la ganaderia y produccion de terneros para la venta de invernada', 'hoy busco aplicar un plus a este trabajo para mejorar la rentabilidad y poder apuntar a un abanico mas amplio con respectos a la ganaderia en la misma superficie de trabajo.', 'un campo de casi 200 hectareas propiedad de mi padre.', 'no aplico', 'calidad en animales y lograr mas eficiencia en reproduccion a base de genetica', 'seria aplicar tecnología en pasturas y alimentación del bovino en general', 'poder realizar por separado los procesos prductivos, de los reporductores  y vientres seleccionados ya sea para vaquillas para servicio , vaquiloonas con garantia de preñez y tambien novillos para distintas categorias', 'no aplica', 'no aplica', 'local, zonal y poder hacer exportacion', 'general', 'no aplica', 'no aplica', 'riesgos generales de la producción ganadera , poder tener forraje en distinta estaciones del año para poder mitigar las falencias del clima.', 'el destino seria para perforaciones nuevas de agua ,colocación de bebederos estrategicamente ubicados y alambrados para divisiones de potreros existentes.', 'no tengo por el momento seria a futuro', 'no aplica', 'no aplica', 'al estar respaldado por una asociación de una raza tenes un valor agregado y tenes mas posibilidades de tener un mercado regional y nacional', 'de vincular negociaciones en forma regional e internacional.', 'que no se pueda hacer sustentable en forma rápida para tener una buena respuesta en cuanto a los objetivos deseados.', 'incertidumbres de tercer índole en cuanto a clima fundamentalmente.', '2020-11-04 23:23:39', '2020-11-09 14:55:06'),
(42, 131, 115, 24, 1, 'TELAS E INSUMOS PARA LA PRODUCCIÓN', 'El dinero será destinado a la compra de Telas e Insumos para la Producción TEXTIL.', '1400000.00', NULL, 0, 'El dinero será destinado a la compra de Telas e Insumos para la Producción TEXTIL,', 'Aumentar la producción, y tener un stock sostenido de Telas e Insumos, para la producción de prendas textiles.', 'Este préstamo, permitiría adquirir nuevas mas telas e insumos, y así aumentar ala producción.', 'Meta \"donde quieras llegar\", se esta posicionando en toda la Republica ARGENTINA, como una marca innovadora, creativa y ofreciendo un producto de excelente calidad a un precio muy competitivo.', 'Meta \"donde quieras llegar\" nace gracias a la demanda y al mercado en ascenso de la Indumentaria y accesorio deportivos,', 'Hoy se comercializa  en todo el pais , siendo hoy una marca muy reconocida en el mercado.', 'actualmente, tenemos el taller Caseros  1043, NOGOYA ENTRE RIOS', 'INMUEBLE PROPIO  500M2', 'TELAS DEPORTIVAS:  set de poliéster, algodón RUSTICO, suplex, lycra, etc\r\nINSUMOS: tintas y papel para sublimación.', 'Trabajamos con telas, que tienen sistemas de mayor absorción, rapidez en secado, no se planchan, etc', 'PROCESO PRODUCTIVO\r\n1-Definir prendas-lìnea  a confeccionar\r\n2-Diseñar, crear moldes\r\n3-Definir Telas.\r\n4-Corte:  se despliega la tela y se produce el corte de la misma.\r\n5-Confeccion: una vez cortada se recurre a la confección de la misma.\r\n6-Etiquetar:  por ultimo se etiqueta  y embolsa la prenda.', 'Mayormente usamos telas que tienen los siguientes componentes:  Poliéster, algodón, elastano, etc,.', 'los únicos residuos que se generan son, papeles (que son entregados para reciclar) y recortes de tela (son entregados a JARDINES-INSTUCIONES para su reciclado)', 'Nuestro principal mercado es la zona de Entre Ríos, pero hoy con las redes sociales vendemos en toda la Rep.Argentina.\r\nNuestros segmento de mercado abarca de niños de 4 años  hasta adultos mayores, dado que hacemos prendas para el publicaren General.', 'En la linea de tiempo libre, nuestros productos estan destinados a clientes en General, los cuales buscan indumentarias cómodas y livianas, para uso diario y deportivo; y  nuestra linea personalizada y de Ciclismo estas mas dedicada a Ciclistas, Clubes, Agrupaciones, Municipios, Colegios, etc.', 'Nuestra competencia en la linea tiempo libre son marcas que entran en general de Buenas Aires, y la linea personalizada la mayor competencia se concentra en la redes, donde tenemos una fuerte presencia, lo mismo pasa con con la linea de Ciclismo.', 'Nuestros proveedores en telas son de Buenos Aires y Rosario,  y los de papeles - tintas todos de Buenos Aires.', 'Un riesgo que tenemos en la falta de productos importados, nuestra estrategia y el destino de este préstamo es la compra de Productos de Industria Nacional.', 'El destino del monto Solicitado, es para la compra de Telas e insumos, dando la oportunidad de aumentar la producción y asegurarnos  obtención de las mismas.', 'Actualmente tenemos dos personas empleadas, de obtener este prestamos, podremos aumentar la producción y requerir mas personal.', 'este préstamo, nos permitiría aumentar la producción y a su vez  necesitar de mas mano de obra.', 'Pecios promedios:\r\nremeras  $1199\r\nshort  $1199\r\nremeras personalizadas $949\r\nmusculosas  $1099\r\npantalón  $1999', '-RELACION PRECIO-CALIDAD DE NUESTROS PRODUCTOS\r\n-TIEMPO DE PRODUCCION\r\n-FUERTA PRESENCIA EN VENTA X REDES\r\n-LOCALES PROPIOS (Venta al publico)', '-AUMENTAR LA PRODUCCION\r\n-ABRIR NUEVOS MERCADOS', '-IMPOSIBLIDAD DE COMPRAR MATERIA PRIMA', '-FALTA DE TELAS provenientes del exterior.', '2021-02-26 22:40:29', '2021-03-18 14:04:46'),
(44, 871, 893, 19, 1, 'ABERTURAS LARROQUE', 'SE COMPONE DE UN TITULAR RUIZ MARIO NICOLAS, CON EL QUE QUIERE LOGRA   EL OBJETIVO DE INCREMENTAR LA PRODUCCIÓN.', '1000000.00', NULL, 0, 'SE QUIERE ADQUIRIR UNA MAQUINARIA PARA PODER INCREMENTAR LA PRODUCCIÓN DE ABERTURAS LARROQUE, EN LA QUE SE ESPECIALIZA EN LA PROZUCCION DE VENTANAS, PUERTAS, ABERTURA EN GRAL', 'LOGRAR CON LA COMPRA DE LA MAQUINARIA QUE MEJORE LA PRODUCCIÓN DE MANERA QUE SE VEA REFLEJADO EN LA RAPIDEZ Y EFICACIA DE LOS PRODUCTOS ENTREGADOS RESTALLANDO LA CALIDAD Y RAPIDEZ A LA HORA DE ENTREGA', 'OPORTUNIDAD SIGNIFICA TENER ACCESIBLE ESTA LINEA DE MONTO SOLICITADO PARA PODER AUMENTAR LA PRODUCCIÓN E INCREMENTAR LAS VENTAS', 'EN LA ACTUALIDAD CUENTA CON UN  PROCESO PRODUCTIVO COMO ASÍ TAMBIÉN DE SERVICIOS EN LO QUE SE REFIERE A COLOCACIÓN DE PRODUCTOS TERMINADOS', 'ABERTURAS LARROQUE COMENZO COMO UN PROYECTO FAMILIAR AL QUE SOY TITULAR,  TOMANDO PEDIDOS Y TRAYENDO PRODUCTOS DE VENTAS, PUERTAS ETC A MEDIDA QUE LO SOLICTABAN, CON EL TIEMPO SE LOGRO NO SOLAMENTE FUE EL PEDIDO SI NO TAMBIÉN LA COLOCACIÓN DE DICHOS PRODUCTOS.', 'EN EL PRESENTE CUENTA ADEMAS DE LA COLACIÓN DE PRODUCTOS, CUENTA CON UN LOCAL A LA VISTA DONDE POSSEE ARTÍCULOS A LA VISTA Y HA PODIDO ESTABLECER LINEAS DE PRODUCCIÓN', 'ES DE MI HERMANA', 'AL SER DE MI HERMANA NO SE PAGA ALQUILER', 'Ventanas, puertas, aberturas en general', 'SON DE ALUMINIO', 'PRIMER ETAPA ES EL CORTE DE MATERIAL  PERFIL Y LUEGO ENSAMBLADO', 'ALUMINIO EN BARRA  DE 6MT, VIDRIO EN PLANCHA 2.50 MTR X1.8 MTR', 'se lo lleva a la planta de reciclado', 'EL MERCADO ES LOCAL Y PROVINCIAL', 'LOS CLIENTES SON 60% DE CONSUMIDORES FINALES Y UN 40% SON GUBERNAMENTALES ESPECIALMENTE MUNICIPIOS DE LOCALDIADES CERCANA A LA CUIDAD DE ORIGEN', 'LA COMPETENCIA  ES VARDIADA TANTO EN MERCADO LOCAL COMO PROVINCIAL DEBIDO A QUE EXISTE COMPETENCIA MINORISTA COMO MAYORISTA', 'LOS PROVEEDORES SON DE CARÁCTER MAYORISTAS Y PROVENIENTES DE LA PROVINCIA DE ENTRE RÍOS COMO TAMBIÉN\r\n DE BUENOS AIRES', 'RISESGOS: MUCHA COMPETENCIA, Actividad económica desigual, Situación económica, política y social, cargas fiscales.\r\nEStrategia: Publicidad en Redes Sociales, Estrategias de venta en las redes sociales, Testimonios, confianza y credibilidad,  Venta por teléfono, Venta a puerta,', 'compra de mauqinaria', '1', 'en crecimiento', 'ventana de aluminio 130x10  $11000', 'publicidad. en crecimiento- buena ubicación comercial', 'crecimiento  en la producción', 'falta de maquinaria', 'competencia local', '2021-03-12 14:00:26', '2021-04-14 21:16:05'),
(46, 918, 947, 24, 1, 'EQUIPAMIENTO DE OFICINA TECNICA Y SALA DE REUNIONES', 'Adquirir 3 computadoras con 3 monitores, 2 impresoras, 1 fotocopiadora, 2 escritorios con 2 sillas giratorias, 1 mesa de reuniones con 10 sillas, 1 tv Smart de 43\"', '799500.00', NULL, 0, 'Adquirir equipamiento y amoblamiento para el funcionamiento de la nueva oficina técnica y sala de reuniones', 'EL principal objetivo de la oficina técnica es el aumento de la producción, reorganización de tareas, disminución de costos y tiempos perdidos, aumento de los puestos de trabajo, planificación de la producción, gestión de la calidad, y trabajar en post de certificar normas de calidad. Capacitación y entrenamiento del personal con la sala de reuniones.', 'Contar con estas nuevas areas significa trabajar mas ordenados y seguros, organizar las tareas y procesos, con el objetivo a largo plazo de certificar normas de calidad', 'Aplicación de la metodología 5S en tres puestos de trabajo. Relevamiento de costos. Calidad. Implementación de nueva unidad de negocios', 'El año 1979 marca el comienzo de una nueva empresa familiar. Nace Metalúrgica Lincar, dedicada a brindar servicios de reparaciones. Un año más tarde Lincar comienza con la fabricación de distintos tipos de carrocerías para camiones de transportes, impulsados por la demanda de sus clientes.\r\nA principios del año 90’ Lincar inicia la producción de cajas volcadoras y lo que sería su principal producto: tolvas autodescargables para el transporte de alimentos balanceados.', 'Con el correr de los años Lincar implementa mejoras continuas tanto en el producto como en el proceso como por ejemplo, maquinaria de última generación, controles de calidad, servicio post venta de excelencia. Tal es así, que en el año 2006 Lincar decide expandir sus horizontes y comienza a canalizar parte de su producción en el exterior, siendo sus principales destinos de exportación la República Oriental del Uruguay y Bolivia, realidad que se mantiene consolidada en sus días.', 'Parque Industrial de Concepcion del Uruguay', 'Contamos con inmueble propio', 'Tolvas de 10 a 30 tn para transporte de alimento balanceado, y de 7 a 15 tn para transporte de alimento para cerdos\r\nCarrocerías playas, cerealeras, todo puertas, mixtas, etc\r\nVolcadoras vuelco trasero, bilateral y trivuelco', '1 tolva, que es nuestro principal producto cuenta con motores a paleta de desplazamiento fijo, para el funcionamiento de los sinfines, motores orbitales para el giro, comando de válvulas de 3 cuerpos, 1 bomba hidráulica de 150tls', 'El proceso comienza con el corte  y plegado de la chapa con guillotina y pantógrafo, elaboración de autopartes, ensamble, lavado y pintura, terminación y control de calidad', 'Chapas de varios espesores, hierros, caños, sin fines, accesorios hidráulicos y mangueras, art de ferretería, pintura, elementos de corte para torno y pantógrafo, ropa de trabajo e indumentaria de seguridad.', 'Se generan residuos solidos que son desechados como chatarra y residuos líquidos (aceites hidráulicos y productos de lavado)', 'Fabricación de transporte para alimento de aves, ganado e industria porcina\r\nFabricación de cajas volcadoras para industria de la construcción', 'Frigoríficos, plantas de alimentos, molinos, transportistas, productores, corralones, empresas constructoras', 'Las dos principales empresas competidoras se encuentran ubicadas en las provincias de Bs As y Santa Fe', 'Proveedores de chapas, hierros, caños, tubos, sin fines, mangueras, motores, bombas, válvulas, art de ferreteria, soldadoras, tornería, lavado y pintura. Proveedores de ropa de trabajo y elementos de protección personal entre otros.', 'El principal riesgo seria que la competencia absorba parte de nuestro mercado\r\nNo poder hacer frente al avance tecnológico\r\nComo estrategia buscamos generar productos de calidad superior e intensificar el servicio post venta', 'Adquirir bienes necesarios para el correcto funcionamiento de la oficina técnica y sala de reuniones', '3 empleados', 'Económico: se busca reducir costos y tiempos, aumentar la producción, ordenar los procesos\r\nSocial: se busca trabajar con mas seguridad en cada puesto, reducir el impacto ambiental.', 'la variedad de productos hace que el rango de precios varie desde los $400000.00 hasta las $2900000.00', 'Calidad en los productos\r\nServicio post venta', 'Desarrollo de nuevos productos y mercados', 'Bajo nivel del uso de la capacidad instalada', 'Cambio en variables macroeconómicas, demanda sujeta a la industria avicola', '2021-03-15 16:10:27', '2021-03-30 12:00:56'),
(47, 917, 892, 19, 1, 'MINERALES SUR ENTRERRIANO', 'Empresa dedicada hace más de 20 años a la producción de alimentos balanceados para animales, en esta etapa de vida empresarial se encuentra en el desarrollo de una planta de extracción de aceite de soja que complementará nuestra producción de alimentos balanceados.', '1400000.00', NULL, 0, 'El proyecto busca incorporar una planta de extracción de aceite de soja para acoplar a la ya existente fabrica de alimentos balanceados que posee la firma.', 'Se busca procesar en la primera etapa 1200 tn de poroto de soja por mes.', 'Para la empresa es una enorme oportunidad de crecimiento vertical en la cadena comercial, ya que actualmente estamos comprando estos subproductos, con lo cual evitaríamos costos de logística y comerciales, haciendo mas eficiente la empresa.', 'El proyecto tiene mas de un 95% de cumplimiento.', 'Minerales Sur Entererriano SRL es una empresa familiar y en la actualidad la llevan a delante la segunda generación de la familia. Se comenzó fabricando suplementos minerales y con el correr del tiempo se fueron agregando una paleta completa de alimentos para rumiantes.', 'En la actualidad la empresa busca consolidarse en los mercados que posee y ampliar los mismos. Agregando valor a la producción local por medio de este nuevo emprendimiento.', 'La misma se encuentra localizada en el acceso a la localidad de Aldea San Antonio, sobre 2 has cuyos propietarios del terreno son Otero Amilcar y Otero Aureliano (ambos hijos del Sr. Carlos Otero). Sobre dicho terreno se encuentra enclavada la principal fabrica donde se procesan nuestros productos', 'La planta principal tiene un comodato gratuito de uso otorgada por los hijos del Sr. Otero Carlos, quienes se han incorporado recientemente como socios a la firma.', 'Los productos que se producirán son aceite de soja crudo y expeller de soja. Las características son las habituales para este tipo de productos.', 'El aceite de soja es utilizado como insumo para la fabricación de biodiesel o para consumo humano y el expeller es fuente de proteínas de alto valor biológico para la industria de la alimentación animal.', 'El poroto de soja ingresa a la planta donde se lo hace pasar por una prensa, esta hace que levante la temperatura por fricción. El poroto así aplastado pasa a una prensa donde se separa el aceite del resto del poroto el cual pasa a otro sector donde se lo enfría y envía a los depósitos.', 'La materia prima utilizada es poroto de soja.', 'El proyecto no genera residuos en el proceso, ya que sale aceite y expeller.', 'El mercado para estos productos es muy grande en nuestra región ya que la gran producción avícola y lechera, son usuarios del  expeller de soja y el aceite tiene a los fabricantes de biodiesel como clientes.', 'El principal cliente sera nuestra planta de balanceados, y el resto de la producción estará disponible para ser comercializada dentro del país o exportada a Uruguay. El aceite se venderá a los productores de biodiesel (en Entre Ríos y Santa Fe)', 'En nuestra zona solamente existe una empresa que actualmente comercializa estos productos, dejando un importante mercado para nosotros. En la actualidad la mayoría del expeller utilizado en la zona, viene de fuera de la región (Nogoyá, Rosario, etc)', 'Los proveedores son los productores agrícolas de nuestra zona.', 'En principio no se detectan riesgos en el proyecto, ya que un eslabón fundamental que es la venta del expeller, estaría garantizada por nuestra otra planta de balanceados.', 'El monto del destino solicitado se aplicará a capital de trabajo. La firma viene realizando inversiones destinadas a la terminación de una planta de extracción de aceite de soja, con lo que este monto máximo de linea solicitada nos ayudará a reforzar nuestro capital de trabajo.', 'MInerales Sur Entrerriano SRL cuenta actualmente con una dotación de personal de 22 empleados.', 'El impacto económico que se busca al desarrollar el emprendimiento señalado será ser nuestro propio proveedor de una de nuestras principales materias primas, mejorando la formación de precios de nuestros productos. En cuando al impacto social se espera generar empleo directo e indirecto en nuestra zona.', 'Debido al contexto actual, y viendo el comportamiento (en muchos casos volátil) de nuestras materias primas, nos encontramos en un momento de difícil formación de precios, variando acorde al mercado imperante actual.', 'El proyecto se suma a otro que ya esta en marcha hace muchos años y esta consolidado. Esta simbiosis de las dos plantas es una de las mayores fortalezas del proyecto', 'Se podrá mejorar al bajar considerablemente los costos de logística y comerciales del expeller.', 'Se desconocen debilidades de importancia.', 'Que baje demasiado el consumo de alimentos balanceados y haga caer la demanda de expeller.', '2021-03-16 18:59:10', '2021-03-16 19:42:05'),
(48, 919, 1007, 19, 1, 'ACONDICIONAMIENTO PLANTA FABRIL Y ADQUISICIÓN MATERIA PRIMA', 'Transporte \"Raíces\" es una pequeña empresa unipersonal radicada en al area industrial municipal de la ciudad de Larroque, Entre Ríos; orientada a prestar soluciones logísticas de transporte de madera y venta de pallets. Desde el año 2013 nos dedicamos a la venta de pallets,  siendo los únicos de la localidad y alrededores.', '1400000.00', NULL, 0, 'Siendo los únicos de la localidad y alrededores que nos dedicamos a la fabricación, ensamblado  y venta de pallets; nos vemos en la necesidad de ampliar la producción; por lo cual nuestro proyecto consiste en la colación del piso de la planta fabril, donde realizamos el ensamblado de pallets nuevos y la adquisición de materia prima para ampliar la producción de los mismos.', 'Ampliar la producción de pallets y consecuentemente sus ventas para cubrir la demanda insatisfecha.', 'Transformar su actividad secundaria en principal, ampliando volumen y calidad de sus productos, acompañados de la incorporación de mano de obra calificada a tal fin.', 'Hoy la fabricación y venta de pallets representa aproximadamente el 40% de sus operaciones totales.', 'Inició sus actividades en Noviembre de 2013, como transportista de maderas, y con el fin de ampliar y completar la actividad anexo la venta de productos de madera (exceprto muebles), principlamnete fabricación de pallets.', 'Hoy contamos con una flota de 20 camiones que nos asisten en la logistica de transporte. Además, la fabricación y venta de pallets representa el 40% de nuestras ventas e ingresos totales.', 'Area industrial municipal de la ciudad de Larroque, Entre Ríos.', 'Contamos con un tinglado y oficinas propias.', 'Fabricamos 5 tipos de tarimas, dependiendo de sus dimensiones; utilizando como madera Eucalipto Saligna.', 'Utilizamos cortadoras, sierras de madera y clavadora neumática.', 'Una vez recibida la madera, se clasifica, se corta y se comienza con ensamblado y armado.', 'Eucalipto Saligna (madera principal) y clavos', 'Se genera despunte, aserrín y clavos.', 'Cubrimos la demanda, aunque no al 100%, de las empresas locales y de la zona; siendo el único proveedor de las mismas.', 'Nuestro principal cliente es Domvil SA, empresa dedicada al procesamiento y elaboración de carne de aves.', 'No poseemos competencia dentro los alrededores de nuestra región.', 'Contamos con dos proveedores de madera, de la ciudad de San José, Entre Ríos.', 'No contar con la materia prima oportunamente para cubrir las necesidades en tiempo y forma, por lo cual se intenta contar con stock disponible y suficiente.', '- Mejoramiento piso de la planta fabril\r\n- Compra de materia prima', '- Incorporación de 4 empleados.', 'Ampliar la producción de pallets e incorporar mano de obra local.', '-Precio unitario $570', '-Proximidad aserraderos proveedores, optimizando costos\r\n-Reconocido clientes y proximidad con los mismos\r\n-Calidad en los productos', '- Crecimiento sector maderero\r\n- Posibilidad aumentar la capacidad de inversión y producción', '- Deficiente infraestructura proceso elaboración \r\n- No cuenta con publicidad de sus productos y ventas por internet', '- Extinción del recurso forestal\r\n- Crecimiento competencia regional', '2021-03-17 15:24:09', '2021-03-23 15:23:12'),
(49, 216, 212, 24, 1, 'PROGRAMA DE ASISTENCIA FINANCIERA PARA SOSTENIMIENTO PRODUCTIVO', 'Adquisición de materia prima- Tela SMS grado medico con certificación de origen e insumos.-', '1400000.00', NULL, 0, 'Descripción de los Productos: Ropa Quirúrgica Descartable: Camisolines -Ambos-Batas-Camilleros-Botas- Equipos de Cirugía -NO ESTERIL 							\r\nMateria Prima: Tela SpunBond -SMS- Uso Grado Medico -Certificada 				\r\nDestinatarios: Ministerios de Salud Provinciales, Droguerías En diferentes localidades del país, Clínicas y Sanatorios En diferentes localidades del país.', 'Incrementar la producción de los actuales productos- ropa quirúrgica descartable y el desarrollo de nuevos productos- Equipos de cirugía.', 'Creciente demanda en el mercado con gran impacto de COVID-19, esto nos permitirá atender a nuevos clientes: Droguerías, Clínicas, Sanatorios de diferentes puntos del país.', 'Fabrica de ropa descartable hospitalaria, no estéril.', 'Inducel Group- Victor De Mattia: tiene una trayectoria y recorrido de mas de 8 años en la industria textil y en la confección de ropa descartable de uso hospitalario NO ESTERIL. Posee importante cartera de clientes en distintos puntos del país. Ministerios de salud provinciales, Droguerías, Clínicas y Sanatorios.', 'Actualmente la empresa unipersonal Victor De Mattia se transformo en una empresa de SRL cuyo nombre es MEDIKOM SRL inscripta bajo el cuit 30-71698975-1 con fecha 11/11/2020, con nuevos objetivos en la producción y conquista de nuevos mercados basados en un desarrollo empresarial sustentable.', 'Avda. Almafuerte n° 2284, Paraná Entre Ríos', 'Comodato a partir de julio año 2020. El lugar cuenta con dos plantas y diferentes sectores con ingreso de transporte de carga y descarga. Planta baja oficinas administrativas, areas de depósito de materia prima, area limpia- tendido, corte, empaque y control de calidad.\r\nPlanta alta deposito.', 'Camisolines -Ambos-Batas-Cubrecamillas- Botas- Equipos de Cirugía, confeccionados en tela especial de uso medico, no estéril, diferentes gramajes de las telas, medidas de largos. Con puño en manga con elástico y/o algodón.', '-', 'Recepción de la tela con 2 mts de ancho en rollos de 500 a 1000 mts, pasa área de tendido, tizado y corte sobre una mesa de 10 mts de largo, pasa a área costura para la confección del producto una vez terminado, ingresa al área de doblado, empaque y control de calidad.', 'Materia Prima: Tela no tejida SpunBond -SMS- características: tiene barrera microbiana capaz de bloquear los gérmenes patógenos de los fluidos por su propiedad Hidrofóbica gran resistencia al desgarre lo que garantiza la movilidad sin riesgo. Uso medico', 'Generan pequeños cortes de desperdicios según los modelos de confección.', 'Droguerías, Clínicas, Sanatorios, de diferentes puntos del pías, Ministerios provinciales. Nuestros clientes están ubicados principalmente en las provincias de Entre Ríos, Santa fe, Córdoba, Mendoza, Tucumán, Chaco, Corrientes. Hemos hecho estudio de mercado para exportar Paraguay y Uruguay.', 'Las principales Clínicas, Sanatorios, regionales con una alta capacidad de consumo de nuestros productos que varían desde 5000 a 15000 unidades mes.', 'No existe en el país empresa vertical de este rubro es decir que fabrique la tela y confeccione las prendas tanto nosotros como la competencia tenemos los mismos proveedores (3 a nivel nacional) lo que genera un plano de igualdad en cuanto a la fabricación. Por lo general la competencia provee en forma directa a las droguerías y nosotros como estrategias de mercado nos orientamos a las clinas y sanatorios.', 'Proveedores: -Espuma Pilar y Del Solar. Ubicados en Provincia de Buenos Aires.', 'No entra mercadería importada.', 'Adquisición de materia prima para incrementar el proceso productivo y generar la base de sustentabilidad para alcanzar los objetivos propuestos. Lanzamiento de nuevo producto kit de cirugía.', 'Contamos con cuatro personas en área de producción, dos en administración, uno ventas y uno dirección.', '-', 'Los precios varían entre $40 y $90 según características de modelo y gramaje.', 'Somos la unida Industria del rubro en Entre Ríos y region. Gran capacidad de venta, trayectoria y experiencia. Bajos costos fijos.', 'Gran impacto en la demanda de nuestros productos vinculados al COVID-19 que genero un cambio en el paradigma de uso y consumo de nuestros productos en remplazo de las prendas convencionales de tela.', 'En proceso de habilitación de ANMAT.', 'Ingrese al país mercadería de origen chino a bajos costos, situación muy poco probable que se de.', '2021-03-18 15:42:06', '2021-04-13 15:36:35'),
(50, 1090, 1063, 19, 1, 'OPTIMIZACION DE CARGA Y DESCARGA EN DEPÓSITO', 'Actualmente, cargamos y descargamos los camiones en el deposito a mano.  Por ello compramos un autoelevador Toyota nuevo.  Señamos el 30% con fondos propios, y necesitamos el otro 70% para retirarlo.  \r\nSe esta manera, optimizamos el proceso de carga y descarga.', '1400000.00', NULL, 0, 'Adquisición de Autoelevador.', 'Optimización, agilización del proceso de carga y descarga de los camiones de planta al deposito, y del deposito al cliente.', 'Optimizacion y baja de costos y roturas de producto.', 'Somos una pyme que produce y comercializa productos alimenticios en las principales cadenas de Supermercados.', 'A mediados/fines del 2010, para diversificar los negocios personales y con nuestra convicción de continuar con proyectos propios, lanzamos una nueva empresa llamada Palacios SRL, cuyo nombre fantasía es “secretos de mi país”.\r\nCon el fin de encontrar esos pequeños productos regionales, desarrollamos “Secretos de mi país”.   Nos dedicamos a buscar productos ricos y diferentes, pocos desarrollados donde las grandes empresas no se meten por ser productos de nicho y pequeños volúmenes, en sus inicios', 'Actualmente comercializamos tres lineas de productos.\r\nRIANITOS - son nuestro primer descubrimiento. \r\nParadores Nacionales - es nuestro descubrimiento.  Incursionamos en la cocina tradicional de cada una de las regiones de España y encontramos nuevos secretos.\r\n.ORG - decidimos descubrir secretos que llevan a una vida saludable.', 'Actualmete, producimos en 3 plantas los productos.', 'Deposito en Bs As, que desde ahi, hacemos base para la distribucion en los distintos canales.', 'Alimentos', 'Alimentos.', 'producción de alimentos', 'Según la variedad de producto', 'N/A', 'Alimentos', 'Carrefour\r\nCOTO\r\nCencosud\r\nWalmart\r\nMakro\r\nYaguar\r\nentre otros.', 'Tia Maruca\r\nDon Satur\r\nDos Hermanos', 'Proveedores principales de Insumos, como Harina (Molino Chacabuco, ASSAM), Arroces (CARMABE), Galletitas (ALEM), Insumos (ZUCAMOR, MAXIPACK, Bolsafilm, BolsaFlex, Papelera Orlando) entre otros.', 'El gran riesgo hoy, son los costos.   Tenemos que trabajar fuertemente en optimizar los costos en todos los proceso, ya que nuestros productos están con precios congelados, y los costos con altos aumentos.', 'Adquisición de un autoelevador.', '3', 'N/A', 'Los precios varían según el canal, estrategias y acciones comerciales.', 'PYME muy dinámica para la adaptación', 'Dentro del mercado actual, los faltantes de mercaderías de los competidores, se presenta como oportunidad para forzar venta.', 'No tener respaldo financiero para encarar el crecimiento.', 'Suba de Costos, con precios congelados.', '2021-03-19 22:12:13', '2021-03-22 20:15:22'),
(51, 489, 465, 19, 1, 'ADQUISICIÓN DE CAPITAL DE TRABAJO PARA NUEVA LINEA DE EXTRUSADO Y PRENSADO DE SOJA', 'LA EMPRESA A LA CUAL REPRESENTO YA POSEE UNA LINEA DE EXTRUSADO Y PRENSADO DE SOJA DESDE EL AÑO 2017, DEBIDO AL AUMENTO EN LA DEMANDA DE LOS INSUMOS QUE SE OBTIENEN DEL MISMO (ACEITE Y EXPELLER) SE TOMO LA DESICION DE INCORPORAR UNA NUEVA LINEA QUE ESTARÁ PRÓXIMA A LLEGAR EN LOS 60 A 90 DIAS. POR TAL MOTIVO NECESITAREMOS LA ADQUISICIÓN DE LA MATERIA PRIMA', '1400000.00', NULL, 0, 'ESTE PROYECTO SE INCORPORA COMO UNA LINEA PARALELA A LA EXISTENTE LA CUAL TIENE UNA PRODUCCIÓN DE 500 KG/H A LA CUAL DUPLICAREMOS A LA ACTUAL', 'AGREGADO DE VALOR EN ORIGEN Y DUPLICAR LA ACTUAL PRODUCCIÓN ASEGURANDO UN PRODUCTO DE CALIDAD EL CUAL LO USAMOS EN LA COMPOSICIÓN DE NUESTROS ALIMENTO', 'ABASTECER LA ZONA DE INFLUENCIA EN LA CUAL YA ESTAMOS TRABAJANDO PERMITIENDO UN NEXO MAYOR CON NUESTROS CLIENTE', 'EN LA ACTUALIDAD NO PODEMOS ABASTECER A POTENCIALES CLIENTES POR FALTA DE CAPACIDAD DE PRODUCCION', 'NUESTRA PYME COMENZÓ EN EL AÑO 2012 EN LA ELABORACIÓN DE ALIMENTO BALANCEADO, GRACIAS AL CRECIMIENTO QUE LOGRAMOS EN EL AÑO 2017 INCORPORAMOS LA ELABORACIÓN DE EXPELLER Y ACEITE.', 'EN LA ACTUALIDAD EL 70 % DEL EXPELLER PRODUCIDO LO CONSUMIMOS PARA LA ELABORACIÓN DE ALIMENTO Y EL RESTO SE VENDE A TERCEROS IGUAL QUE EL ACEITE QUEDANDO UNA DEMANDA INSATISFECHAS DE EXPELLER', 'ESTAMOS UBICADOS EN EL AREA INDUSTRIAL DE LA LOCALIDAD DE MACIA DESDE EL INICIO. HEMOS LOGRADO TENER EL SERVICIO DEL GAS NATURAL ESTA AÑO', 'EL PREDIO ES PROPIO DESDE EL INICIO', 'LOS PRODUCTOS LOGRADOS SON DE ALTICIMO VALOR ALIMENTICIO TANTO PARA BOVINO, AVES Y CERDOS.', 'LOS PRODUCTOS OBTENIDOS ES POR PROCESOS MECÁNICOS DE LAS MATERIA PRIMAS', 'INGRESA LA MATERIA PRIMA (SOJA) SE ALMACENA Y SE ACONDICIONA CON LIMPIADORA Y SECADORA A 10% DE HUMEDAD. LUEGO SE DEPOSITA EN SILO LUEGO DE QUIEBRA Y INGRESA AL EXTRUSOR QUE GENERA TEMPERATURA POR LA FRICCIÓN INIVIENDO LA TRIPCINA, LUEGO INGRESA A LA PRENSA LA CUAL SEPARA EL ACEITE DEL EXPELLER', 'LA MATERIA PRIMA QUE SE UTILIZA ES EL POROTO DE SOJA', 'EL ÚNICO RESIDUO QUE NO SE APROVECHA ES EL VAPOR QUE RONDA EN UN 3 %', 'EL MERCADO ES PEQUEÑO PERO CONSUME A LO LARGO DEL AÑO CONSTANTE', 'LOS CLIENTE SON LOS PRODUCTORES TAMBERO LOS CUALES SE HACEN SU ALIMENTO EN EL ESTABLECIMIENTO', 'LA COMPETENCIA A LA CUAL TENEMOS NO BRINDAN UN SERVICIO DE ENTREGA DE PRODUCTO EN EL CAMPO EL CUAL NOSOTROS LO TENEMOS', 'OS PROVEEDORES SON PEQUEÑOS PRODUCTORES DE LA ZONA A LOS CUALES LE SIRVE VENDER A NOSOTROS POR EL MÍNIMO FLETE QUE POSEEN', 'EL RIESGO MAS IMPORTANTE ES LA BAJA EN EL PRECIO DE LOS LÁCTEOS Y ESTRATEGIA QUE PODEMOS HACER UN SERVICIO COMPLETO DESDE LLEVARLO MOLERLO O AGREGARLE ALGÚN ADITIVO SI EL CLIENTE LO DESEA', 'EL DESTINO DEL MISMO VA NETAMENTE PARA CAPITAL DE TRABAJO', 'CON LA INCORPORACION DE LA MISMA VAMOS A NECESITAR DOS EMPLEADOS MAS', 'DUPLICAREMOS LA PRODUCCIÓN Y GENERARIAMOS MAS MANO DE OBRA LOCAL', 'EN LA ACTUALIDAD RONDA LOS $30500 LA TN', 'YA ESTAMOS EN EL RUBRO Y LO CONOCEMOS', 'DUPLICAR LA PRODUCCION', 'UNA BAJA EN LA DEMANDA POR BAJO PRECIO DE LA PRODUCCION', 'INGRESO DE COMPETENCIA A BAJO PRECIO', '2021-04-05 17:55:14', '2021-04-05 18:35:14'),
(52, 1232, 1276, 19, 1, 'PROYECTO INCREMENTO STOCK FILM BOPP', 'Debido a la continua búsqueda de nuevos mercados donde posicionar los productos QUIERO! y con la actual situación de demoras en conseguir insumos que requieren algún componente importado, nos resulta sumamente necesario ampliar el stock de seguridad de nuestros films de BOPP preimpreso utilizados como packaging de nuestra línea de productos frescos.', '1400000.00', NULL, 0, 'Financiar la compra de insumos críticos para incrementar el stock de seguridad y así atender a los requerimientos de aumentos de producción requeridos por la ampliación del mercado.', 'Asegurar los insumos necesarios para la producción de la línea completa de productos.', 'No perder presencia ni visibilidad en el mercado y asegurar a nuestros clientes su constante abastecimiento.', 'Análisis y seguimiento del porcentaje de incremento en las ventas de cada producto en los últimos meses para determinar el porcentaje de aumento de stock de insumo.', 'Alimentos Ben es una empresa dedicada a la producción y comercialización de alimentos farináceos que busca abastecer el mercado local y regional con productos de calidad con su marca QUIERO!. \r\nNació como un emprendimiento familiar que en el año 2012 comenzó a producir tapas de empanadas, tapas para pascualinas, ravioles y fideos frescos y actualmente completa su línea de pastas con una amplia variedad de productos pasteurizados y en los últimos años hemos incorporado también panificados.', 'Año a año la empresa muestra un crecimiento sostenido y debido a esto es necesario estar preparados para los requerimientos de los nuevos volúmenes de venta esperados.\r\nEn los comienzos solo comercializábamos nuestros productos en Entre Rios, actualmente nos expandimos hacia las provincias de Santa Fe y Corrientes.', 'Alimentos BEN S.R.L. está radicada en el predio del Parque Industrial Basavilbaso.', 'No aplica', 'Nuestros productos:\r\nLínea Frescos: tapas para empanadas, tapas para pascualina, tapas para pasteles, fideos y ravioles\r\nLínea Pasteurizados: fideos, ravioles, sorrentinos y capellettis\r\nLínea Panificados: panes de molde, pan para hamburguesa y panchos, tortillas, prepizzas, pan dulce y budines', 'Tanto las líneas de frescos como las de pasteurizados requieren almacenamiento y transporte refrigerados. \r\nEl packaging utilizado en productos frescos consiste en láminas pre impresas de BOPP que por medio de máquinas automáticas permiten el envasado y cierre inmediatamente después de su producción.', 'La planta recibe y controla las materias primas e insumos y las acopia en su depósito. Según la programación diaria se elaboran los diferentes tipos de masa, se cortan los discos y luego de su control se envasan para luego ser almacenados en frio hasta su venta y distribución.', 'La materia prima principalmente utilizada es la harina de trigo 0000, también llamada harina tapera. Otras de nuestras materias primas son agua, semolín, materia grasa de origen animal, conservantes químicos.\r\nNuestros insumos: film preimpreso de BOPP, film transparente (separador), cajas de cartón.', 'Los desechos generados en la producción son: aguas residuales que pueden contener harina por lo que son tratadas en un sedimentador previo a su vertido y residuos sólidos como recortes del film de BOPP generado en arranques del proceso de envasado y harina que pueda haber caído fuera del proceso.', 'La primera elección fue llegar con nuestros productos a toda la provincia y luego comenzar la expansión gradual hacia provincias vecinas.', 'Buscamos como clientes a distribuidores independientes ya en actividad que trabajen con productos afines a los nuestros y se ocupen de abastecer pequeñas despensas y les ofrecemos exclusividad en la representación de nuestra marca, asesoramiento y atención en lo referido a nuestros productos (manipulación, conservación y forma de consumo), como así también atendemos a pedidos específicos de algunos grandes clientes en cuanto a características especiales del producto (Ej. rotiserías).', 'Nos ubicamos en la franja de productos de buena calidad y bajos precios donde podríamos encontrar marcas como Don Yeyo, Tapamanía, etc. pero buscamos diferenciarnos con nuestra atención y nuestros productos adaptados según la necesidad de clientes específicos.', 'La estrategia planteada en cuanto a todos nuestros proveedores es tener siempre una segunda alternativa que presente la misma calidad de productos que nuestro proveedor principal.\r\nBuscamos en todo momento proveedores que sean reconocidos por su constancia en cuanto a la calidad en los productos entregados y que sean flexibles a la hora de requerir desarrollos o cambios en los productos que nos entregan.', 'Una demora en la entrega de insumos nos obliga a discontinuar el producto ya que el packaging no es genérico ni  intercambiable. La discontinuidad en la producción nos dejaría con faltantes en la línea de productos permitiendo así el ingreso y posicionamiento de nuestros competidores en nuestra zona de venta o, lo que es peor aún, no permitiéndonos afianzar las ventas en los nuevos mercados a los que intentamos acceder. La mitigación del riesgo sería elevar nuestro stock de seguridad.', 'Compra de film preimpreso de BOPP para los diferentes productos de la línea de frescos priorizando los de mayor rotación.', '20 empleados', 'Facturación mensual estimada $7.000.000\r\nCadena de distribución conformada por 60 clientes', 'Precio Film preimpreso de BOPP U$D 6,75 + IVA por kilo\r\n\r\nPasteles 379 unidades por kilo de film\r\nEmpanadas 379 unidades por kilo de film\r\nRotiseras 284 unidades por kilo de film\r\nPascualinas 90 unidades por kilo de film', '#   Know-how en elaboración de productos farináceos.\r\n#   Participación en el segmento de productos de alta calidad y bajos precios.\r\n#   Productos adaptados según la necesidad de cada cliente.\r\n#   Sólida relación con proveedores y distribuidores zonales y regionales.\r\n ', '#   Consumo per cápita en continuo crecimiento.\r\n#   Aumento de precios de productos sustitutos como las carnes.\r\n#  Demanda creciente de alimentos para terminar de preparar en el hogar.\r\n# Los competidores de las grandes marcas no cuentan con distribución en pequeñas localidades y\r\nalmacenes.\r\n ', '#   Insumos producidos en otras provincias elevan los costos de transporte.\r\n#   Alta inversión en adquisición y altos costos en mantenimiento de equipos y maquinarias.\r\n#   Demoras de entregas de insumos por faltantes de componentes importados.\r\n#   Calidad de harina de trigo puede verse afectada por el clima (sequias o inundaciones).', '#   Inflación anual presiona sobre los precios de los productos.\r\n#   Guerra de precios (competidores con alta capacidad de producción a bajos costos)\r\n#   Incremento en los costos de producción (servicios e insumos)', '2021-04-07 15:53:34', '2021-04-14 13:20:09');
INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(53, 332, 302, 19, 1, 'COSTANERA BURGER \'S', 'Soy Orlando S. Atencio, el objetivo es hacer un  complemento al  comedor en zona costanera que tengo, para poder captar a los niños con mobiliarios, inflables, parque infantil.-', '1200000.00', 0, 0, 'El proyecto que quiero realizar es para ofrecer un mejor servicio al salón de comidas rápidas/salón de eventos infantiles,  anexándole mobiliario infantiles, juegos infantiles, peloteros y plaza blandas, y linea de calor y de frió para el sector de cocina para poder atraer a los mas pequeños de la ciudad y al turismo.-', 'Crear un espacio con mobiliarios de niños para que se sientan comodos, como asi tambien  juegos, proyectando un lugar donde llevar los niños a divertirse, festejar un cumpleaños, realizar eventos etc.-', 'La oportunidad que tengo es el espacio amplio para poder desarrollar este proyecto, como asi también la ubicación del comedor en plano corazón de la costanera de victoria, donde es el paso obligado de los TURISTA.-', 'El comedor ya ha sido alquilado para eventos y observamos que no cumple la exigencia de los clientes, por eso empezaríamos con una primer etapa de mobiliario para niños, mobiliario para cocina,  plaza blanda, e inflables y luego con juegos de parques infantiles.-', 'El comedor funcionaba de diciembre del año 2013 para 150 cubiertos, en la zona costanera de la ciudad de Victoria, contando con un anexo de un maxi kiosco, en marzo de 2020, sufrió un siniestro (incendio), en el cual las perdidas fueron totales, me re invente re organizando en tres modulos, Maxikiosco, Comedor y comidas rápidas.-', 'Los 3 modulos,  Maxikiosco, Comedor y comidas rapidas que desde el siniestro estan sin uso por pandemia, seran una nueva alternativa para el turismo,', 'Victoria, Zona Costanera, ubicada en Pedro Radio y Guemes, con una superficie de mas de 300 mts2 cubiertos y 60mts 2 semi cubiertos,', 'El local, esta  CONCESIONADO A LA MUNICIPALIDAD DE VICTORIA hace 8 años, abonando un canon mensual por temperado alta y baja, venciendo el mismo 2024, con posibilidad a prorroga automatica por 5 años mas .-', 'LOS PRODUCTOS SERAN DE PRIMERA CALIDAD, TANTO SEA EN EL MOBILIARIO Y JUEGOS INFANTILES COMO LA LINEA DE FRIO CALOR PARA LA COCINA,', 'El proyecto contará con el mobiliario (peloteros, inflables, juegos infantiles, etc.) e instalaciones (cerramiento al aire libre con un cerco perimetral ) adecuado y de la mejor calidad existente en el mercado actualmente, con el fin de garantizar la seguridad del público que haga uso de los mismos.', 'El proceso se inicia con el ingreso del público al salón de expendio de comidas para luego los niños ingresar al sector de juegos infantiles.', 'La materia prima principal estará compuesta por los insumos necesarios para la preparación de comidas y refrigerios que se brindarán al público asistente.', 'El proyecto generará desechos de materiales descartables (vasos, bandejas, papeles biodegradables, cajas de hamburguesas, etc. los cuales serán retirados del establecimiento por el servicio de recolección de residuos municipal.', 'EN EL MERCADO LOCAL, NO HAY UN ESPACIO DONDE SALIR A CENAR Y QUE LOS NIÑOS S ENTRETANGAN, COMO ASI TAMBIEN NO HAY UN ESPACIO DONDE FESTAJAR CUMPLEAÑOS CON JUEGOS INFANTILES.-', 'Amplia es la gama que se puede captar con la realizacion de este proyecto,.-', 'NO HAY OTRO RUBRO SIMILAR EN LA CIUDAD.', 'Los proveedores serán Locales en la parte gastronómicas, insumos, bebidas y descartables, y en la parte de juegos sera foraneos.-', 'Desde nuestro punto de vista es un proyecto que tiene riesgos mínimos ya que en la ciudad no existe otro predio que tenga similares carácteristicas. Además por el diseño y estructura del mismo no existen los riesgos sanitarios derivados de la actual pandemia porque se contará con los protocolos sanitarios exigidos por la autoridad competente local.', 'EL DESTINO DEL MONTO SRA PARA LA COMPRA DE MOBILIARIO INFANTIL, LINEA DE FRIO Y CALOR PARA LA COCINA, INFLABLES, PELOTEROS, Y JUEGOS INFANTILES.-', 'Es un emprendimiento Fliar, que llevara al menos 3 /4 empleados para las distintas actividades a desarrollarse.-', 'El impacto es que por este emprendimiento se necesitan proveedores y hace que gira la rueda comercial de la ciudad y provincia.-', 'Serán precios que se manejan en el rubro de comidas rápidas (hamburgesas, panchos, pizzas , picadas ,etc.)', 'Ser el único en la ciudad por sus características y diseño y por conocer la actividad por estar desarrollándola desde hace mas de 8 años.', 'Cubrir una demanda insatisfecha reclamada por el turismo de buen poder adquisitivo que visita la ciudad.', 'Las debilidades serían mínimas ya que se cuenta con una experiencia de 20 años en el sector gastronómico. Entre las que se podrían mencionar están las referidas  la relación empleador - empleado que se actúa en consecuencia de acuerdo a los contratiempos de acuerdo a la vasta experiencia que se posee.', 'Cambio en la legislación laboral, conflictos gremiales y aumento generalizado de precios (inflación) lo cual impide planificar a mediano y largo plazo', '2021-04-08 14:49:36', '2021-06-10 21:22:22'),
(54, 816, 795, 24, 1, 'PUENTE GRÚA.', 'El proyecto para el cual vamos a destinar el valor es construir dos puente grúa que van a situarse en las dos nuevas naves de nuestra fábrica en el parque industrial.\r\nEl galpón ya dispone de los soportes y los pescantes para soportar los PNI300 (Perfil Normalizado I 300 milímetros) que deben ir 280mts de perfil normalizado.', '1400000.00', NULL, 0, 'Los PNI300 son perfiles normalizados de 300mlts de altos que son los que se utilizaran como rieleras donde se deslizarán los puente grúas.', 'Alcanzar la mayor cantidad de producción posible, hoy en dia nos encontramos limitados en el ámbito de la cantidad de producción ya que no contamos con el espacio suficiente.', 'El puente grúa en la fabricación va a simplificar el trabajo, aumentar la producción, mejorar la seguridad de trabajo reduciendo la posibilidad de riesgos y accidentes.', 'El proyecto que estamos desarrollando aumente cuatro veces la capacidad de espacio y de igual manera en producción.', 'En el pasado seleccionábamos los insumos y reparábamos para lograr los mejores desempeños en Equipamientos Industriales, además de buscar siempre asesorar a nuestros clientes.', 'Hoy en día estamos fabricando los repuestos, nos especializamos en diferentes tipos de mecanizados y en su manera de elaboración, reptando siempre los mayores estándares de calidad.\r\nLogramos abastecer el mercado argentino, pero también comercializando nuestros productos en Uruguay y Chile.\r\nSomos una Industria que se inicio prestando servicios a la industria alimenticia en general, a demás de la venta de materia y repuestos indispensables para el funcionamiento de los equipos industriales.', 'El desarrollo de este proyecto se está ejecutando en el Parque Industrial de Concepción del Uruguay.', 'No alquilamos.', 'El desarrollo de nuestra actividad está orientada a resolver las necesidades técnicas de maquinarias de frigoríficos de aves y a abastecer los repuestos necesarios para esas maquinarias que hasta hace muy poco tiempo debían ser importadas del extranjero.', 'Nuestros servicios son de corte láser y plegado, corte de acero por chorro de agua, tornería y fresado.', 'El proceso productivo comienza por el abastecimiento de materia prima (que en su mayoría son aceros inoxidables y plásticos de ingeniería), son procesados por las maquinarias (corte, plegado y mecanizado) y vamos abasteciendo a los frigoríficos según pedidos.', 'Acero inoxidable 304, acero inoxidable 430, acero inoxidable 420 y materiales plásticos Grillon y Delrin.', 'Los residuos generados son el Scrap que sería el sobrante de acero inoxidable, el mismo es pesado y vendido, al igual que los plásticos. En síntesis no tenemos residuos que puedan contaminar, todos los sobrantes son reciclables.', 'La determinación del mercado es que nuestros clientes nos elijan por tener precios competitivos, respuesta inmediata y la calidad necesaria que requieren los productos determinados.', 'Frigoríficos de faena avícola.', 'Fabricantes de repuestos de máquinas avícolas.', 'Importadores de materias primas como acero inoxidable y plásticos.', 'Estrategia: Ir reemplazando los productos que hoy se importan manteniendo la calidad de los mismos.\r\nRiesgo: No alcanzar en los objetivos necesarios para cubrir las necesidades de nuestros clientes.', 'Dos puente grúas para la nueva empresa.', 'Actualmente contamos con cuatro, tres técnicos operarios y uno administrativo.', 'Al tener mayor posibilidades económicas podríamos dar más seguridad de trabajo y un trabajo altamente sustentable.', 'Cuchilla circular de acero inoxidable 420 de 200ml USD100.', 'Somos una de las únicas empresas que abastece lo que la industria avícola necesita.', 'Abastecemos una industria exportadora.', 'Nuestros pares en el extranjero tienen precios competitivos con nosotros.', 'Que nuestros pares del extranjero sigan avanzando en abastecer nuestro mercado.', '2021-04-09 13:31:04', '2022-06-07 14:15:52'),
(59, 1128, 1134, 19, 1, 'MOLINO TRITURADOR DE PLASTICOS.', 'Recypol es una micropyme constituida por dos socios, encargada de reciclar polietileno, el cual es utilizado como materia prima para la fabricación de bolsas de consorcio. \r\nEl segmento de mercado al que apunta es tanto al de minorista como a mayoristas.\r\nLa misma se encuentra ubicada en el parque industrial lote 7 de la ciudad de Larroque, Gualeguaychú.', '1400000.00', NULL, 0, 'Nuestro proyecto busca la adquisición de un molino triturador para procesar mayores cantidad de materia prima.', 'El objetivo buscado es procesar mayor cantidad y variedad de polietilenos, logrando así reducir costos y cumplir con nuestros clientes en el corto plazo.', 'Es una buena oportunidad para seguir apostando a la industria, al crecimiento, al cuidado del medio ambiente y a la creación de nuevos puestos de trabajo.', 'Actualmente para el procesado de la materia prima contamos con un molino triturador de baja producción, lo que no nos deja ser competitivos.', 'Hace 8 años cada uno de los socios tenia su emprendimiento por separado. Uno se dedicaba al reciclado de materia prima y el otro a la produccion de las bolsas. \r\nEn el 2019 decidimos fusionarnos y crear Recypol, lo que fue una desición muy acertada ya que pudimos reducir costos y expandirnos en el mercado.', 'Actualmente incorporamos maquinas extrusoras para la fabricación de bolsas de residuos y somos  dos socios empleados y 2 operarios.', 'La empresa se encuentra en el area industrial de la ciudad de Larroque, lote 7. Es un galpón de aproximadamente 1500 m2 cubiertos.', 'El lugar de trabajo es propiedad de uno de los socios.', 'La materia prima (grumo) es realizada con polietileno post fabrica, la cual se obtiene mediante un proceso de triturado y extrusado.\r\nLa bolsas de consorcio son realizada con la materia prima antes mencionada, por lo que son 100% recicladas. Se realizan de varias medidas y colores.', 'Extrusora/recuperadora: maquina para el reciclado del nylon.\r\nExtrusora/film: maquina con la que se produce la bolsa de consorcio.', 'El proceso consiste en la recolección de nylon post fabrica y nylon desechado de supermercados, etc. Este se somete a un proceso de triturado y extrusado, y así se obtiene la materia prima. Base con la cual luego se fabrican bolsas de residuo.', 'La materia prima esta compuesta por diferentes tipos de polietilenos, entre ellos:\r\n-Silo bolsa: proveniente de los campos\r\n-Strich/film: el cual es recolectado de industrias, supermercados, etc.', 'Nuestra empresa no genera residuos, ya que todo polietileno sobrante se vuelve a reciclar.', 'El mercado en el que se ubica Recypol es 100% viable ya que nuestro producto es demandado y consumido por todo tipo de clientes.', 'Nuestros clientes son: \r\n-Mayorista: distribuidoras, empresas, municipios, hospotales, instituciones, etc.\r\n-Minoristas: kioscos, particulares, entre otros.', 'Si bien en Larroque hay otras fabricas de polietilenos, la competencia no es mayor ya que las mismas tienen su fuerte en otros productos, siendo las bolsas de consorcio algo secundario.', 'Nuestros proveedores son recolectores de nylon y empresas que generan residuos termoplásticos reciclables.', 'El riesgo es la existencia de potenciales competidores. \r\nNuestra estrategia es poder producir mayores cantidad, calidad y menor precio y así poder agrandar la cartera de clientes.', 'Adquisición de un molino triturador.', '2 socios empleados y 2 operarios.', 'El impacto es muy bueno ya que mediante el reciclado de polietilenos disminuimos la contaminación ambiental y mejoramos la calidad de vida.\r\nEconómicamente, buscamos poder producir mayores cantidades, tener menores costos y poder contratar mas personal.', 'El precio del producto (bolsas de consorcio) difiere según sus medidas. La mas vendida es la de 45x60x30u, la cual se vende en un bulto de 50 paquetes a $50 aproximadamente.', '-Cultura ecologica: bolsas realizadas con material reciclado, impactando positivamente tanto en el mercado. \r\n-Precios accesibles: al realizar nosotros mismos la materia prima, podemos recudir costos y tener mejores precios.\r\n-Personal comprometido con la produccion y politicas de la empresa.\r\n-Producto adaptado a las necesidades del cliente: variedad de medidas, colores.\r\n-Fácil alcance de materia prima.', '-Obtención de créditos.\r\n-Desarrollo tecnológico de maquinarias.\r\n-Cuidado del medio ambiente.\r\n-Incursionar nuevas lineas en el mercado.', '-Poca implementación tecnológica.\r\n-Elevado costo de energía, no pudiendo utilizar las maquinarias en su nivel optimo.', '-Potenciales competidores en la zona.\r\n-Carga impositiva.\r\n-Costos salariales.', '2021-05-03 13:14:53', '2022-03-18 13:04:37'),
(60, 1439, 1473, 24, 1, 'PRODUCCIóN Y COMERCIALIZACIóN ICTíCOLA', 'Producción primaria de pacú basada en tecnología semi-intensiva. Comienza con la compra de alevines para la recría, sigue con el engorde en estanques de mayor tamaño hasta la cosecha. Finalmente, se comercializa directamente a consumidores finales con proyección al mercado mayorista. En un futuro cercano, el objetivo es incrementar la productividad vía incorporación de tecnología y asociación con productores locales.', '900000.00', NULL, 0, 'Ampliación de la capacidad productiva instalada para el engorde de pacú.', 'Producir carne de pacú de calidad homogénea en un entorno ambiental sustentable. Proveer a la población de alimento con altos valores nutricionales. Incentivar el consumo de pescado. Asociarse con productores entrerrianos para optimizar la producción y aumentar el volumen de comercialización.', 'Existe una demanda creciente e insatisfecha y una oferta estacional y volátil. Nuevos segmentos de mercado.', 'Capacidad instalada y conocimientos para producir 1,5 tonelada de pescado por año.', 'En noviembre de 2018 el emprendimiento empezó con la siembra de alevines de pacú. Todo el 2019 transcurrió aprendiendo sobre alimentación, manejo y control de variables del proceso productivo. En marzo del 2020 se realizó la primer cosecha total y en abril del 2021 la segunda.', 'Establecimiento ubicado en la localidad de Espinillo Norte, dirigido por el Cr. Lucas Marcos y el Ing. Ind. Juan Manuel Rossi. En el mes pasado de abril finalizó la segunda campaña de producción.', 'Predio de 5,5 Ha. frente a la ruta 18 en el km. 23,5, localidad de Espinillo Norte.', 'Establecimiento habilitado para la producción de piscicultura. \r\nContrato comodato.', 'Pacúes a base de alimento balanceado de alta calidad en un ambiente controlado.', 'Carne de pacú homogénea, de alta calidad proteica, abundante en minerales y vitaminas con un peso promedio de 1,2 [kg].', 'Producción en estanques rectangulares en tierra con sistema de bombeo de agua, provisión de oxígeno, aporte de alimento, manejo y control de los peces y calidad del agua.', 'Alimento balanceado con proteína mayor al 32%.\r\nFertilizantes naturales a base de nitrógeno, fósforo y potasio.', 'El agua desechada, enriquecida por la actividad de los peces, fertiliza las tierras aledañas del establecimiento.', 'En Argentina se consume 5 kg por habitante por año, mientras que en el mundo ese promedio es de 20,5 kg.', 'Consumidores finales, restaurantes y comercio minorista de Paraná y alrededores.', 'Comercios de venta al público como pescaderías o puestos informales de pescado en zonas aledañas al río Paraná. A diferencia de ellos que se abastecen de la pesca extractiva, nosotros engordamos especies a partir de la reproducción artificial de larvas.', 'Empresa ISLA PE (experiencia nacional en el ramo, confiabilidad y alta tecnología en acuicultura).\r\nHOMEOAGRO (referencia en provisión de alimento balanceado).', 'El mayor riesgo es el de mortandad de los peces cuando la temperatura del agua disminuye por debajo de los 10 °C.  Para superarlo, se instaló una bomba sumergible a 55 metros bajo tierra que permite inyectar agua en los estanques a 21 °C independientemente de la temperatura atmosférica.  Asimismo, el ingreso del agua a 21 °C se combina con el accionar de válvulas que permiten el desagote del agua fría.', 'Aumento de la producción de carne de pacú.', 'Marcos, Lucas: economía-finanzas, legales, proveedores y comercialización.\r\nRossi Juan Manuel: producción, administración y organización.', 'Novedosa actividad en la región con generación de empleo indirecta, consumo de insumos, materiales y mano de obra local, búsqueda de asociación con otros productores para aprovechar oportunidades, ampliación de la oferta de carne de pescado, concientización de una sana alimentación, interacción científica con el INTA e INALI-CONICET.', '900 $ por kilo', 'Margen de agregado de valor del producto. Posibilidad de desarrollo de nuevos segmentos de mercado. Potencialidad agroecológica. Disponibilidad de conocimiento, técnicas y tecnología para mejora de los procesos productivos y productos. Grupo humano.', 'Demanda creciente e insatisfecha. Oferta volátil. Productos heterogéneos y de baja calidad. Turismo. Producción limpia y sustentable.', 'Seguridad en el establecimiento. Largo ciclo productivo. Bajo volumen de producción. Canales precarios de comercialización. Nula capacidad de inversión con fondos propios.', 'Alimento balanceado costoso, de calidad variable y provisión volátil. Logística de transporte inadecuada. Posición monopólica de frigoríficos. Baja interacción entre el sector científico-tecnológico y productivo. Escaso hábito de consumo de pescado en la población.', '2021-05-03 13:43:46', '2022-04-21 13:43:23'),
(62, 461, 433, 24, 1, 'AMPLIACION Y ADECUACION DE INSTALACIONES BAJO NORMAS ISO', 'podre crecer día a día en mi empresas desarrollando y vendiendo nuevos productos', '1400000.00', NULL, 0, 'Ampliacion del taller para la adaptacion a las normas ISO', 'Adecuar las instalaciones para ser mas eficientes en nuestra produccion y calidad de nuestros productos.', 'Mayor mercado de nuestros productos', 'en la actualidad estamos produciendo acoplados y casillas rurales', 'En el año 1995 empecé con un pequeño taller dedicado a la reparación de herramientas agrícolas , luego en el año 1998 empecé a construir casillas rodantes agrícolas y acoplados rurales a baja escala. En el año 2003 me instale en el Parque Industrial de General Galarza siendo el primero en el parque. Sume colaboradores para poder producir mas. Con mucho esfuerzo he podido comprar equipamiento.', 'Actualmente producimos casillas, acoplados de varios tipos y desmalezadoras agrícolas. Quiero seguir creciendo y poder certificar en ISO por eso preciso financiamiento para cumplir mis objetivos y poder generar mas fuentes de trabajo produciendo trailers homologados para patentar.  Es un nicho de mercado que nuestra provincia no hay producción de ese tipo de unidades.', 'estoy situado en el parque industrial de general galarza con un taller de 500 m2 en la actualidad', 'el inmueble es de mi propiedad', 'acoplados, construidos en hierro y chapa con una capacidad de entre 3 a 5 tt', 'casillas rodantes agrícolas equipadas para que los operarios de los distintos equipos puedan vivir cómodamente en ellas,', 'descarga de materiales , cortado y acondicionado de las diferentes piezas , soldado y armado terminando con el pintado de las diferentes unidades', 'materia primas : hierro UPN  en diversas medidas. chapas laminadas en caliente , la minadas en frio y prepintadas en diversas medidas de espesores y tamaños', 'residuos : distintos descartes de hierros y chapas que los retiran los diversos  ( chatarreros)', 'mi mercado actual es la provincia de entre ríos , las intenciones es poder ampliar a otras provincias y  algún Paiz limítrofe', 'mis clientes son del sector agropecuario y ganadero en su gran mayoría , pero tengo clientes de otros sectores productivos', 'debido a que en nuestra zona no esta muy instalada la industrialización de hierro , nuestros principales competidores son de otras provincias , que operan en la zona con revendedores o distintos distribuidores', 'mis principales promovedores son del sector siderúrgico y están instalados en las provincia de buenos aires, santa fe y córdoba', 'en toda actividad económica hay riesgos , y estoy acostumbrado a sortearlo con mucho esfuerzo y dedicación , teniendo un objetivo de crecimiento sostenido , marcado para el futuro', 'ampliación del taller de 500 m2 a 800 m2', 'actualmente tengo 1 empleado en relaciona de dependencia , el objetivo al ampliar las instalaciones es poder incorporar mas personal', 'el impacto económico es positivo al poder producir mas , por ende mayores ingresos y poder dar mas trabajo en nuestra ciudad al incorporar empleo seria importante en lo social.', 'los acoplados oscilan entre los 300.000 y los 600.000 pesos de acuerdo al modelo que sea', 'veo un fortalecimiento en el taller al corto plazo , con dicha ampliación vendría la certificación en normas ISO ,', 'oportunidad de poder comercializar productos bajo normas , la posibilidad de generar mas y mejores ventas', 'debilidades , la falta de mayor tecnología para poder bajar los costos y conseguir una mayor competitividad', 'la economía de nuestro pais , que creo que va a empezar a creces , con el contexto actual de pandemia , se a debilitado demasiado y ya es tiempo de empezar a crecer', '2021-05-06 15:54:03', '2022-06-07 14:16:47'),
(66, 1035, 1481, 19, 1, 'BODEGA NUEVA EN COLONIA ENSAYO', 'La bodega actual se encuentra instalada en Crespo y el viñedo en Colonia Ensayo, se necesita la instalacion de una nueva bodega junto al viñedo para mejorar y optimizar la produccion, realizar procesos mas eficaces, ampliar la capacidad de elaboracion y guarda, en la actualidad no se procesa toda la vid por la escases de espacio de elaboracion y guarda, ademas permitira mejorar las ventas y los servicios a los visitantes al viñedo. Permitira  mejorar la  oferta turistica para la zona.', '495000.00', NULL, 0, 'Instalacion de una bodega nueva en Colonia Ensayo en el lugar donde esta el viñedo, este proyecto consta de dos etapas, la primera es la construccion de la cava y la sala de elaboracion, la segunda etapa es la construccion de una sala de degustacion y exibicion de vinos a los visitantes. La primer etapa a la vez se dividira en dos momento en un plazo de cuatro meses se construira la cava y en un plazo no mayor a 1 año se construira la sala de elaboracion.', 'Aumentar la capacidad de elaboracion y guarda de vino. Los procesos seran mas eficientes al evitar el traslado de las vides hasta Crespo para su elaboracion y guarda. Se podra mejorara la oferta turistica actual destinada al enoturismo, se aprovechara mejor la estructura existente en el lugar, se aprovecharan los residuos durante el proceso de molienda y el proceso de descube, que seran materia organica para el viñedo. hoy se lleva a un basural', 'La oportunidad de instalacion de esta primera parte de la primera etapa de la bodega permitira una mejor guarda de los vinos, dado que su construccion sera subterranea lo que se ahorrara energia y se lograra mejor equilibrio en los vinos, se podra complementar el servicio de visita al viñedo y al bosque nativo.', 'Actualmente se cuenta con una bodega de capacidad para 17000 litros de elaboracion y guarda de 22000 botellas, un viñedo con 7000 plantas para vinificar, tanto el viñedo como la bodega se encuentran inscriptos en Instituto Nacional de Vitiviniultura,  se cuenta con asesoramiento dos enologos, un ingeniero agronomo con especial en vides, se requiere mayor capacidad de elaboracion y guarda.', 'Pyme familiar constituida por Fernando Jacob, Noelia Zapata y nuestros tres hijos Leandro Jacob, Matias Jacob y Mauro Jacob, dedicada al cultivo de vid para vinificar, a la elaboracion de vinos, ofrecimiento turistico en el bosque nativo aledaño al viñedo y un reducido cultivo de arboles, actualmente la actividad central se desarrolla en Entre Rios y una minima plantacion de eucaliptos y yerba mate en Misiones. Se cuenta con dos empleados permanentes para las actividades agropecuarias', 'Viñedo con 7000 plantas en produccion implantadas desde 2012 hasta 2016 con un rendimiento promedio por planta de 3 Kgrs., el viñedo instalado en 3 has con el sistema de conduccion lyra en Colonia Ensayo en el lugar se dispone de un bosque nativo de 6 has en proceso de ser reconocido reserva de usos multiples. La bodega se encuentra en Crespo con una capacidad de proceso de 30000 kgrs de uva, con una capacidad en litros de 17000;  se dispone de toda la maquina para los procesos.', 'Administracion y bodega en la ciudad de Crespo.  El viñedo en Colonia Ensayo.   y pequeña implantacion de eucaliptos y yerba mate en campo grande misiones.', '---', 'vinos tintos y blancos.  servicio de enoturismo,', 'produccion de uvas y elaboracion de  vinos', 'Cuidado del viñedo: proceso de alto requerimiento laboral y manual en la poda, conduccion de las vides, en la cosecha y en la posterior elaboracion de los vinos con procesos con alto grado de seguimientos personalizados, baja automatizacion de procesos. Elaboracion, envasado, guarda, venta de vinos', 'Uvas para vinificar producidas por 7000 plantas de cepas: tannat, malbec, merlot, marcelan, chardonnay, marcelan', 'Los desechos son organicos: escobado que contiene a las uvas en el proceso de molienda o separacion de los granos de uva de su racimo y comienzo de la fermentacion, al realizarse el descube y desborres se obtienen desechos tambien organicos: las semillas y el orujom, la borra.', 'El mercado es en un principio interno en la provincia de entre rios, santa fe y buenos aires.', 'Consumidores finales, vinotecas, y turistas que disfrutan del enoturismo y el contacto con la naturaleza', 'con la  productos diferenciales como son nuestros vinos, se compite con productos industriales de menor valor', 'Los proveedores en su mayoria son de Mendoza, los insumos para la elaboracion de vino, los corchos, las botellas, las cajas, las etiquetas se pueden lograr localmente o en otras provincias. Los insumos para el cuidado de la vid se obtiene de proveedores locales', 'Baja escala de elaboracion incrementa los costos fijos, las estrategias de superacion estan dadas con la posibilidad de elaborar mayor cantidad de litros de  vinos.\r\nLa guarda equilibrada de los vinos, se podra contrarrestar con una adecuada instalacion de una nueva cava.\r\nBaja oferta para trabajar con mercado exportacion, se tratara de lograr mayor cantidad de litros en guarda y disponer de mayor cantidad  de botellas para una venta mayor', 'construccion de una nueva bodega que se instalara junto al viñedo. El proyecto constara de dos etapas y la primera etapa consta de la construccion de la cava y la sala de elaboracion, a su vez esta etapa se dividira en dos pasos primero construccion de la cava, se dispone de los materiales  y se necesita para la mano de obra de estas etapas.', 'Dos empleados en relacion de dependencia permanentes y mano de obra adicional en poda y cosecha. se cuenta ademas con tres profesionales especificos dos enologos y un ingeniero agronomo con conocimientos especificos sobre vides, ademas todos los integrantes de la pyme trabajan en todo tipo de actividad.', 'mayor produccion, mayor generacion de ingresos e incremento de posibilidades de mano de obra. en lo ambiental el aprovechamiento de los desechos como materia organica para el mismo viñedo.', 'al publico con iva incluido 400 pesos por botella, los servicios turisticos  $ 300 por persona', 'conocimiento de los productos y procesos, personal calificado, entorno y relieve especiales para este tipo de produccion, cercania de la capital y de la ciudad de santa fe con gran posibilidad de ofrecer servicios enoturisticos a los habitantes de estas ciudades.  la cercania al rio y las lomadas de la zona presentan un espacio agradable al visitante', 'Posibilidad de crecimiento de la demanda de productos diferenciados tanto en el consumo de los vinos como en el servicio de enoturismo y el bosque nativo', 'Requerimiento alto de inmobilizacion en el proceso de elaboracion, desde la poda, la cosecha, la fermentacion, la elaboracion, el envasado, la guarda, requiriendose alta inversion en mano de obra, materiales hasta la posterior venta que implica un periodo mayor a dieciocho meses.\r\ndesconocimiento de un producto diferencial.', 'El clima influye cada añada.\r\ningreso de productos poco diferenciados mas economicos,', '2021-05-15 00:26:44', '2021-05-27 13:20:02'),
(71, 1323, 1355, 19, 1, 'ADQUISICIÓN MAQUINARIA AUTOMATIZACIÓN DE PROCESOS', 'La Cooperativa Apícola del Tala Ltda se encuentra rediseñando sus estrategias con especial énfasis en objetivos relacionados con la comercialización de miel fraccionada para los mercados internos y externos. En el mismo sentido, se llevaron adelante una serie de actividades relativas a la visibilidad de marca, renovación de logo y presencia web.\r\nLa automatización de los procesos de tapado y etiquetado de nuestra miel fraccionada son esenciales para el desarrollado de dicha estrategia.', '1400000.00', 1, 0, 'El proyecto consiste en la adquisición de 2 máquinas bien identificadas.\r\n- 1 tapadora automática/semiautomática para envases de vidrio y de plástico.\r\n- 1 etiquetadora automática/semiautomática para envases de vidrio y de plástico de diferentes capacidades cúbicas.', 'El objetivo del presente proyecto es la tecnificación y automatización de los procesos de tapado y etiquetado de los envases en formato fraccionado.', 'Esta inversión representa la búsqueda de celeridad en los procesos de tapado y etiquetado, ahorro de mano de obra, precisión y prolijidad en la colocación de las etiquetas. La tecnificación de dichos procesos tiene como fin último el de ubicar a nuestro producto final de góndola en un producto de primer nivel con especial atención a sus características estéticas, al mismo nivel que otros grandes jugadores de la miel fraccionada.', 'La cooperativa se encuentra actualmente involucrada en varios programas promovidos desde organismos nacionales (AAICI) y provinciales (Dirección de Comercio Interior de Entre Ríos) que acompañan la nueva estrategia para nuestro formato fraccionado.', 'La Cooperativa Apícola del Tala Ltda. fue creada en el año 2011 acompañada por 27 socios productores de miel pura de abeja. Nuestras instalaciones cuanta con todas las habilitaciones correspondiente para su funcionamiento, cuenta con una sala de extracción, una sala de pre-calentado y homogeneizado, una sala de envasado y una sala de acopio de tambores. \r\nCuenta también con un sistema de trazabilidad de Lote.', 'Nuestra Cooperativa esta comprometida con la actividad del sector apícola en su conjunto, de hecho tenemos participación activa en FILAPI, somos socios fundadores de la FECAER -Federación de Cooperativas Apícolas de Entre Ríos-.\r\nEn la actualidad promovemos el consumo de miel a temprana edad y estamos al pendiente de innovar nuestras instalaciones.', 'Nuestra Cooperativa se encuentra en Rosario del Tala (Entre Ríos), cuanta con una superficie de 200m2 aproximadamente.', 'No alquilamos/arrendamos. Somos propietarios.', 'Miel de abeja 100% pura. Las características técnicas serian: COLOR:  Varía de ámbar claro a marrón oscuro\r\nhasta 50mm Pfund. ASPECTO Y TEXTURA:  Líquido denso, variable de\r\nacuerdo a la floración. SABOR: Particular del tipo de miel.', 'La Cooperativa tiene:  sala de extracción, una sala de pre-calentado y homogeneizado, una sala de envasado y una sala de acopio de tambores. \r\nAsí también cuenta con una sala de limpieza de material (cuadros)', 'La miel ingresa a la Cooperativa en cada colmena, la miel se extracta y es envasada en tambores de 300Kg. Para el proceso de envasado, ingresa el tambor a sala de pre-calentado y es ingresada a la sala de homogeneizada dejándola decantar unas 24 a 48 hs luego se comienza a envasar.', 'Miel pura de abeja', 'Los desechos que se producen son de Cera, que es la materia prima que se utiliza para la creación de cuadros para la colmena. La misma es pasada por un proceso de reutilización luego de la limpieza.', 'Respecto al mercado interno en formato fraccionado, abastecemos a los negocios de la ciudad de Rosario del Tala y algunos de las ciudades vecinas a través de nuestros socios. También llegamos a Buenos Aires a una cadena de supermercados.\r\nAdemás destinamos una gran parte de nuestra producción a mercados externos a través de grandes exportadores.', 'Nuestros clientes pertenecen al ámbito público y privado, en formatos fraccionado y a granel.\r\nRealizan pedidos de productos regularmente.', 'Nuestra competencia a nivel local no es muy notoria, de hecho no hay otra Cooperativa que produzca miel. Hablando a nivel pías, lo que nos pasa es que talvez nuestro proceso de producción sea mas caro y no llegamos a competir con los precios en góndola.', 'Nuestros proveedores están con nosotros desde el comienzo de nuestra Cooperativa, hay un lazo de confianza.\r\nLa mayoría de ellos relacionados con insumos de la actividad apícola y de packaging.', 'Los riesgos más importantes refieren la cadena de financiación de nuestros socios relacionada con la financiación de nuestros nuevos clientes.\r\nLa estrategia consiste entonces en colocar énfasis en la comercialización de miel fraccionada, que cuenta con mayor valor agregado con una rentabilidad superior comparada con la comercialización del producto a granel.', 'Adquisición de máquina tapadora y etiquetadora.', 'En nuestra Cooperativa trabajan 30 personas, entre socios, personal administrativo y personal operario.', 'Creemos que el principal impacto social es la consolidación de un producto de cooperativa con vistas hacia el posicionamiento de marca a nivel nacional e internacional.', 'Presentaciones de miel:\r\n1kg: $528\r\n500gr plástico: $330\r\n500gr vidrio: $ 352\r\n480gr: $ 430\r\n250gr: $ 198\r\nPolen 150gr: $ 517', '- reconocimiento de entidades del sector\r\n- envasadora importada\r\n- planta en regla\r\n- excelente capacidad de producción', '- marca país para la miel\r\n- miel argentina más cara del mundo', '- imposibilidad de financiar al cliente final\r\n- débil estructura comercial', '- variable climática\r\n- fuerte poderío del trader', '2021-06-10 21:02:29', '2021-06-28 19:53:44'),
(80, 1576, 1602, 19, 1, 'ADQUISICION DE EQUIPAMIENTO DE LABORATORIO PARA CONTROL DE CALIDAD', 'La Empresa requiere adquirir equipamiento para su laboratorio de control de calidad', '1400000.00', 1, 0, 'Adquisición de un polarímetro de precisión para control de calidad de aceites esenciales', 'Dotar a nuestro Laboratorio de control de calidad de una herramienta indispensable en la actividad de procesamiento de aceites esenciales de cítricos.', 'El equipamiento de laboratorio es de costo muy elevado, disponer de una financiación adecuada pone a nuestro alcance alcanzar este objetivo sin inmovilizar recursos de caja', 'Nuestro laboratorio cuenta con capacidad de realización de varios parámetros de calidad y personal profesional capacitado.', 'Somos una empresa que nació en el año 2007 .\r\nNuestra actividad es la producción y venta principalmente de productos derivados de los aceites esenciales y jugos concentrados de cítricos, destinados principalmente a la industria alimenticia, entre otras.\r\nSu aplicación principalmente se encuentra en las bebidas y alimentos, así como también en productos aromáticos y solventes orgánicos de otras aplicaciones.', 'Trabajamos dia a dia para satisfacer el mercado local con un producto competitivo, mejorando  los procedimientos de elaboracion y garantizando su calidad.  Recientemente hemos podido ampliar el mercado a destinos  internacionales con los mismos objetivos. Exportamos a México, Japón y EEUU', 'Domicilio de la planta y administración: Los Chingolos 463- Área Industrial Oro Verde E3100XAD- Dpto. Paraná- Entre Rios Argentina.', NULL, 'Destilacion de aceites esenciales de cítricos, elaboración de sabores para alimentos, elaboración de bases para bebidas y jugos concentrados.', 'Los aceites esenciales concentrados son productos de alto valor y estabilibilidad organolépticos. Se obtienen por destilación fraccionada a alto vacío y muy baja temperatura. También se obtienen los terpenos respectivos en el mismo proceso de destilación que constituyen solventes de origen biológico', 'Consiste en acondicionar por dewaxing en cámara a -20ºC, estandarizar y someter a destilación los aceites esenciales en columna de alto vacío.', 'La materia prima son los aceites esenciales de los distintos cítricos obtenidos por expresión en frío', 'No hay efluentes sólidos, líquidos ni gaseosos que se generen en el proceso. El circuito de refrigeración es cerrado por recirculación en chiller. El sistema de calentamiento del proceso es 100% eléctrico y el agua caliente se genera en un termocalefón solar.', 'Nuestro mercado de aceites concentrados son los fabricantes de alimentos que requieren aromas y saborizantes cítricos. También elaboradores de perfumería. Los terpenos principalmente se destinan a consumidores de solventes de origen biológicos, fabricantes de tensioactivos de uso en la industria alimentaria.', 'Nuestros clientes en el mercado nacional e internacional son empresas elaboradoras de sabores y aromas para la industria, algunas con sucursales en Argentina. También industrias que elaboran alimentos  o productos para alimentos.', 'Nuestro principal competidor en el mercado nacional es FRITZCHE SAICA, ubicado en la PBA. Dispone de proceso similar de destilación aunque principalmente se dedique a procesar aceite de limon de origen en el NOA.', 'Los proveedores son empresas procesadoras de cítricos de la Argentina y eventualmente de Paraguay y Uruguay.  Principalmente la Coop Citr. Agroindustrial de Misiones, con quien tenemos contrato de asociación comercial y productiva mediante un contrato para la producción de jugos concentrados clarificados congelados y aceites.', 'Trabajamos en un segmento de empresas que requiere altos estándares de calidad. El equipamiento de nuestro laboratorio es indispensable para fortalecer nuestros parámetros de producción en las materias primas y productos', 'El monto solicitado será destinado a la adquisición de un polarímetro de alta precisión.', 'Uno, de laboratorio de control de calidad', NULL, 'Nuestros productos son de alto valor agregado. La facturacion de Five Fold SRL registra un promedio de usd 900.00 en los ultimos 3 balances.', 'Presencia y trayectoria en este mercado durante mas de 10 años en un segmento de muy pocos competidores. Tecnología de proceso adecuada y con capacidad de expansión. Expertising en materias primas y productos. Integración vertical mediante asociación con la producción primaria de nuestras materias primas con la CCAM de Misiones. Implantación de 8 ha de cultivares de cítricos desde este 2021 en Colonia Guaraní , Leandro N Alem, Misiones.', 'La producción de alimentos y coadyuvantes naturales para alimentos en un mercado mundial que aumenta su demanda', 'Proceso de certificación de no concluído aún. Dotar de equipamiento de muy alto costo nuestro laboratorio', 'Variabilidad climática que pueda afectar la producción de cítricos.', '2021-07-20 15:33:20', '2021-08-19 15:29:34'),
(82, 735, 715, 19, 1, 'CAPITAL DE TRABAJO', 'El principal insumo en la producción de zingueria es la chapa galvanizada lisa \r\n\r\nPor lo cual el total del proyecto se destinara a la adquisición de este insumo basico.', '1400000.00', 0, 0, 'Se proyecta la compra de alrededor de 800 chapas adicionales a la compra habitual que realiza la empresa mensualmente, Con el fin de garantizar y aumentar la producción.', 'El objetivo del proyecto es adquirir materias primas básicas para producir. \r\nEs fundamental asegurar la disponibilidad de esta materia prima para garantizar la continuidad de la producción.', 'La posibilidad de comprar mas materia prima, accediendo a fondos que no dispone actualmente la empresa, significa una oportunidad de crecimiento.', 'La empresa cuenta con capacidad ociosa, no así con recursos económicos para darle uso a esa capacidad.', 'Zinguería Aguirre fue fundada en el año 1988 por Oscar Hugo Aguirre como un emprendimiento familiar, cuando adquiere las primeras máquinas, que aún se encuentran funcionando. Actualmente cuenta con 30 años de trayectoria en la producción y venta de productos de zinguería y bebederos vacunos. \r\nGuiados por los valores que los inspiran desde sus inicios, son una PYME familiar, que se caracteriza por la responsabilidad, el compromiso, la integridad, el respeto, y la honestidad.', 'La empresa elabora, comercializa y distribuye productos de zinguería como canaletas, sombreros simples, de una aleta, de dos aletas y tipo H, caños, codos, babetas, caballetes, cenefas, soportes, entre otros; todos en una amplia variedad de medidas, así como también bebederos para vacunos. Todos estos productos son elaborados estándar y a medida por pedido.', 'En 2018 adquirió un inmueble que posibilito el traslado de la planta a las afueras de la localidad, lo que permitió que la actividad productiva pase de desarrollarse en un área cubierta de 190 m2 a un área de 900 m2.   El moderno edificio cuenta con un área exclusivamente destinada a la comercializa', NULL, 'Los accesorios para el techo, tales como canaletas, cumbreras, recibidores, babetas, etc., son piezas metálicas que constituyen entre otras, la especialidad de trabajo denominada “zinguería”. \r\nLa zinguería es parte fundamental de todo tipo de techo de chapa, ya sea de tejas, chapa solas.', 'Los productos son realizados empleando maquinaria automatizada y manual, si bien se puede incorporar a la  producción de artículos de zingueria maquinaria moderna, el trabajo en gran parte es artesanal.', 'El proceso productivo básicamente incluye dos procesos: el corte y deformación de metales mediante distintas técnicas. \r\nCorte por balancín, tijera, guillotina.\r\nDeformación por plegado, cilindrado engrafado.', 'La principal materia prima es la chapa lisa galvanizada en distintos espesores y largos, también se utiliza chapa lisa pre pintada y laminada en frío', 'La empresa genera recorte metálicos durante el mecanizado y corte de chapas.  Residuos tales como recipientes vacíos, cartones y papeles de embalaje', 'El mercado de consumo de los productos de zinguería para techos, ventilación y desagües es de gran dimensión, debido a que está integrado por una gran variedad de productos destinados a hogares y ambientes públicos y privados, que los emplean al momento de construir viviendas, comercios, edificios públicos, etc.', 'Los principales clientes de los productos elaborados por la empresa son corralones, ferreterías y negocios orientados a la construcción, así como también particulares del sector ganadero, y veterinarias. Los principales clientes de la empresa se encuentran en las provincias de, Entre Ríos, Corrientes y en menor medida en Santa Fe', 'La competencia en la industria de zinguería se considera fuerte, debido que en la zona hay tres grandes competidores, prácticamente iguales en tamaño y capacidad, que ofrecen productos muy similares. a pesar de la distancia, estas empresas situadas en su gran mayoría en la provincia de Buenos Aires, llegan con un precio competitivo generado por la producción a gran escala.', 'La empresa cuenta con alrededor de 5 proveedores habituales en su mayoría situados en la vecina provincia de Santa Fe', 'Los productos sustitutos y los competidores son las principales amenazas. Desde la empresa se trabaja para posicionarla como la mejor opción, se trata con un buen precio, productos de calidad, buena atención y un canal de distribución exclusivo.', 'El total del monto solicitado se destinara a la compra de chapa lisa calibre 0,30', '8 empleados en producción\r\n1 empleado en distribución\r\n3 en administración (miembros de la familia)', 'Acceder a un préstamo con una tasa menor que la que ofrecen entidades privadas tiene un impacto muy positivo desde lo económico para la empresa y en lo social todo beneficio es volcado a la sociedad ya que un aumento del consumo generado en la empresa es un aumento de demanda de otra empresa.', 'chapa lisa galvanizada numero 0,30 1,00x2,00 $ 1718,38\r\nchapa lisa galvanizada numero 0,27 1,22x 2,00 $2296,48', 'la calidad de los productos y el buen servicio de atención y distribución le permiten a la empresa establecer vínculos confiables y duraderos con sus clientes. Siendo esta su principal fortaleza ademas de por su ubicación estar en el centro de la provincia lo que le da una ventaja en cuanto a la distribución.', 'La aparición de nuevas tecnologías es constante, las redes sociales las nuevas formas de publicitar, vender, comunicarse con los clientes y proveedores son una de las oportunidades que tiene la empresa', 'una de las debilidades de la empresa es la falta de recursos tanto económicos, como humanos capacitados.', 'El panorama económico se encuentra atravesando una situación compleja, la inflación y el faltante de materias primas para producir.', '2021-07-27 12:48:24', '2021-08-03 15:10:52');
INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(83, 79, 52, 24, 1, 'AMPLIACIÓN DE CAPACIDAD PRODUCTIVA', 'SCHNEITER ALIMENTOS NATURALES, tiene su arraigo en la agroindustria, específicamente en la producción y comercialización de miel fraccionada. Por un lado cuento con producción apícola primaria, y por el otro cuento con una fraccionadora de miel habilitada para la comercialización de miel diferenciadas y fraccionadas. El proyecto contempla las dos aristas, por un lado  la expansión de la base de producción y por otro las mejoras en la industrialización necesarias para seguir agregando valor.', '750000.00', 1, 0, 'Por medio del presente proyecto pretendo adquirir insumos (capital de trabajo) necesarios para ampliar la base apícola productiva, y por el otro se incluyen inversiones necesarias para la adecuación del establecimiento elaborador.\r\nCon el proyecto generaremos mejoras productivas que nos permitan generar una producción mas voluminosa y con valor agregado a lo producido.', 'Aumentar la base productiva por medio de la Adquisición de insumos de capital de trabajo para la producción apícola.\r\nMejorar las condiciones de proceso de elaboración por medio de la Adquisición de Materiales de construcción para la ampliación de un deposito para la producción.', 'La oportunidad radica en que los valores del producto miel, como materia prima en los últimos 2 años viene un incremento de su precio del 100% interanual. Por otro lado en el mercado interno cada vez mas la población esta consumiendo miel, en cada supermercado hoy en día se encuentran varias marcas de miel junto a otros endulzantes del rubro.\r\nHay una marcada tendencia de consumo de productos naturales, y la miel es un excelente producto para este nicho. Hay un marcado aumento del consumo.', 'Actualmente cuento con 300 unidades productivas (colmenas) y con la sala de fraccionado de miel habilitada por ICAB y SENASA. Los productos también se encuentran inscriptos, todos son Libre de Gluten Sin TACC. Cuento con 2 marcas, Caranday para una linea de miel estándar multiflorales; y La Nodriza para las mieles premium diferenciadas pro origen botánico.', 'Schneiter Alimentos Naturales, es la puesta en valor a la producción de miel de la familia, nace como la segunda generación, retomando el manejo de colmenas, pero con la mirada puesta en la innovación, la calidad y el valor agregado.\r\nAsí fue que en el 2020 primero se gestionó un predio de el Área Industrial de Macia y luego se habilitó la fraccionadora y luego los productos. posteriormente se hizo lo propio con SENASA.', 'Actualmente cuento con 300 colmenas en producción primaria.\r\nEl establecimiento se encuentra habilitado por el ICAB y por SENASA.\r\nSe encuentran inscriptos 5 líneas de productos en diferentes presentaciones, con dos marcas.\r\nMe encuentro trabajando en la Implementación de los requerimientos de calidad para en un futuro exportar miel fraccionada.', 'Predio de 550m2 en el Área Industrial de Macia. Con un establecimiento productivo de 250m2.', '...', 'La miel es un producto natural, lo que nosotros hacemos en trabajar desde la producción primaria con la selección y diferenciación de las mismas en las siguientes variedades:\r\n- Miel Multifloral Suave.\r\n- Miel Multifloral Intensa.\r\n- Mieles Monoflorales de Acacia, Eucalipto y Pradera. \r\n- Miel Crema.', 'Las mieles son cuidadosamente seleccionadas y luego procesadas con los máximos requerimientos del mercado, esto es: calentamiento a temperaturas controladas; filtrados, homogeneización y mezclas, dosificados con maquinarias que disminuyen manipulación.', 'Produccion de miel, bajo sistema de producción primaria de Buenas prácticas.\r\nProceso de fraccionamiento de miel siguiendo las Bunas Practicas de Manufactura. (selección, derretido, filtrado, mezclado, decantado, envasado)', 'La materia prima para la producción de miel, se basa en los insumos necesarios: como ser la cera virgen necesaria para los panales (material inerte) y las reinas para el mejoramiento genético (material vivo).\r\nLa Materia prima para las mieles diferenciadas es la miel producida bajo dichos estándares.', 'En la producción apícola y el fraccionado de miel no contamos con subprocesos ni desechos o residuos considerables.', 'La miel fraccionada tiene un mercado interno en franca expansión, y por otro lado argentina es el segundo exportador de miel a nivel mundial, dentro de esta Entre Ríos es la segunda provincia productiva.\r\nLos precios se ven en aumento debido a el aumento de consumo de miel y baja productividad mundial.', 'Los clientes directos son negocios del rubro Dietéticas o almacenes naturales; también supermercados y almacenes o distribuidoras y mayoristas.\r\nLos nichos de mercados son población con tendencia al consumo de productos naturales, con cuidado de la salud y ambiente.', 'Las principales empresas fraccionadoras miel son Aleluya, Las Quinas, BeePure, y otras similares.\r\nTodas cuentan con el esquema de producción primaria y fraccionamiento.', 'En Entre Ríos hay proveedores para la producción primaria en diversos rubros.\r\npara el fraccionamiento los proveedores de insumos, como envases, etiquetas y embalajes principalmente están en Bs As.', 'Un riesgo latente en la producción primaria, es que las condiciones climáticas no permitan buena producción, la estrategia sería adquirir la producción de otros productores hasta que se regularice.\r\nOtro riesgo es la baja de precios, con lo cual debiéramos diferenciaarnos y llegar a nichos de mercado que paguen mas por un producto de mayor calidad.', 'El destino del monto solicitado será para la adquisición de capital de trabajo de producción primaria. cera de abejas y abejas reinas.\r\ny se compraran materiales para la ampliación de un deposito para la producción.', 'Por el momento estamos vinculados 3 personas, trabajamos de forma familiar, yo como propietario, mi hermana y mi cuñado.', 'En lo económico con el aumento de producción ayudará a lograr un incremento en un 15-20% de base productiva. y consecuente comercialización.\r\n2 familias nos veremos beneficiadas en sostenernos plenamente de la empresa.', 'Actualmente los precios de la miel fraccionada son los siguientes:\r\nMiel Caranday x 250g: $125\r\nMiel Caranday x 500g: $220\r\nMiel Caranday x 1kg: $400\r\nMieles la Nodriza x 500g: $250', 'Produccion apícola propia.\r\nBuenos rindes de producción en la provincia y la zona\r\nConocimiento del producto y del mercado.\r\nPlanta en funcionamiento', 'Expansión del consumo de miel y productos relacionados a lo natural\r\nDemanda internacional del producto.\r\nPotencial de innovación e innovación en el sector.', 'Falta escala productiva.\r\nFalta mayor desarrollo en le sector tecnológico.\r\nCompetencia desleal con productos no habilitados y/o adulterados', 'Trabas comerciales.\r\nClima.\r\nCompetencia', '2021-08-02 12:52:07', '2021-08-09 12:37:00'),
(85, 985, 1613, 20, 1, 'DELICIAN', 'Somos una empresa que elabora panificados libres de gluten que nace con el objetivo de igualar la calidad de la mejor panadería tradicional.  Hoy estamos vendiendo por medio de distribuidores a nivel nacional y nos encontramos en 85 tiendas Carrefour, distribuidas la mayoría en Buenos Aires pero también en sucursales de Bariloche, Mendoza, Córdoba, Rosario, San Juan, Tucumán entre otras provincias, con la posibilidad de estar en la totalidad de sus sucursales, 600 tiendas en todo el país.', '1400000.00', 1, 1, 'El proyecto nace para dar respuesta a la problematica con la que hoy nos encontramos. Necesitamos poder abastecer la demanda de Carrefour, estar en todas sus sucursales (600 tiendas) y los distribuidores que nos contactan de todo el país. Nuestra fabrica es 100% artesanal y necesitamos contar con máquinas que nos ayuden a optimizar procesos y así poder crecer, de la mano de incorporación de personal.', 'Sumar máquinas y personal para optimizar los procesos de producción.\r\nResponder con mayor agilidad a la demanda de Carrefour.\r\nIncrementar los distribuidores en zonas que nos solicitan a nivel nacional.', 'El proyecto nos significa dar un paso de crecimiento en máquinas, así mejorar aún más nuestra calidad de producción y aumentar la diversidad de nuestros productos.\r\nDar trabajo a la población.', 'Hoy nos encontramos con procesos totalmente manuales y artesanales diferentes productos libre de gluten, entre los que puedo mencionar: diferentes tipos de panes, pizzetas, budines, coquitos, minitortas entre los man vendidos.', 'Mi nombre es Mariana Cian, titular de la empresa `Delician´. Soy licenciada en nutrición e hija de panaderos. El proyecto nace con la necesidad de dar respuesta a la demanda de la población con enfermedad celíaca por encontrar mayor diversidad de panificados y con mejor calidad. Hace 5 años empezamos junto a mi pareja, a elaborar panificados libres de gluten ya que entendíamos que había pocas opciones en el mercado igualando a la mejor panadería tradicional', 'Hoy en día tenemos una planta con 9 empleadas, todas mujeres, con procesos artesanales. Vendemos a traves de distribuidores en el país y Carrefour en 85 de sus 600 tiendas.', 'Estamos en una propiedad de mi familia con 110m2. de la ciudad de Paraná. Hoy necesitamos mudarnos a una planta mas grande.', 'Estamos en comodato sin fecha de vencimiento. Necesitamos mudarnos a un planta de al menos 800m2 para poder dar respuesta a la demanda.', 'Panificados libre de gluten:\r\nPan para hamburguesas, pizzetas, pan chips, budines, brownies, coquitos, pastafrolas, alfajores, minitortas.\r\nTodos registrados y certificados por ANMAT', 'Hoy en día son productos elaborados 100% artesanales.\r\nLos panes, pizzetas y coquitos son envasados en selladoras con atmósfera modificada.', 'En la planta se hace recepción de materias primas, elaborado de masas y productos, horneado en hornos convectores a gas. Los mismos son envasados manualmente y algunos de ellos son sellados con maquinas con atmósfera modificada.', 'Utilizamos: almidón de maíz, fécula de mandioca, harina de arroz, manteca, leche, azúcra, dulce de leche, chocolate, coco rallado, entre los más utilizados.', 'Los desechos son separados entre orgánicos e inorgánicos.', 'El mercado es muy amplio. a nivel nacional demandan nuestros productos desde distribuidoras, dietéticas, almacenes, quioscos, supermercados, panaderías, rotiserías, restaurantes, estaciones de servicio, hotelería, y cafeterías', 'Población en general, personas con enfermedad celíaca y aquellas con intolerancia al gluten', 'A nivel local no hay otra marca que se encuentre elaborando nuestros mismo productos que venda a nivel nacional y en supermercados carrefour.', 'Las materias primas que podemos conseguir a nivel local son compradas acá mismo. Otras en cambio desde Santa Fe, Córdoba y Buenos Aires', 'Hoy en día nos proponemos a realizar mejores ventas para poder obtener mejor plazo y', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-08-04 13:14:51', '2021-10-09 16:59:14'),
(86, 117, 99, 19, 1, 'CIANBOX - SOFTWARE DE GESTIóN', 'Contratación de personal para expansión de operaciones, se incluye personal en ventas, administración y soporte para poder atender a mayor cantidad de clientes.', '1400000.00', 0, 0, 'Cianbox es una empresa vinculada a la economía del conocimiento que produce y comercializa Software de gestión contable administrativo para micro y pequeñas empresas de Argentina que comercializa bajo la modalidad de software como servicio.', 'El objetivo actual es incorporar más personal para poder atender a más clientes, actualmente no hay empleados dedicados exclusivamente a ventas y necesitaríamos al menos una persona más para soporte. La contratación de alguien en ventas de manera primordial permitiría mejorar el seguimiento a los contactos que nos ingresan diariamente para poder cerrar más ventas. Por otro lado la expansión en clientes implica necesariamente contar con más personas para dar soporte post venta y programación.', 'Mejorar la conversión de demos a clientes de pago. Mensualmente se reciben más de 20 demos de manera orgánica, la intención es invertir en acciones de marketing para generar más contactos y oportunidades de negocio y hacer un mejor seguimiento de los interesados que llegan para lograr una mayor tasa de conversión de interesados a clientes. El objetivo sería incrementar al menos un 30% la conversión de ventas. Además hay oportunidad de generar ingresos a través de desarrollos personalizados.', 'En la actualidad cuenta con dos socios fundadores que trabajan en el proyecto, tres empleados a tiempo completo y dos a tiempo parcial. Estamos recibiendo pedidos de desarrollos personalizados que no podemos atender por falta de personal, la gestión de ventas la hace uno de los socios que también gerencia la empresa, por lo que su dedicación al área no es full time.', 'El proyecto arrancó inicialmente con sus socios fundadores trabajando desde su casa armando un software que sería comercializado bajo la modalidad de software como servicio (saas), este proyecto fue llevado a la par de otras actividades económicas ya que en los primeros años no era rentable como para vivir de eso.', 'Actualmente estamos constituidos como una SAS, con 5 empleados, alquilamos una oficina y tenemos cerca de 300 clientes directos más otros indirectos, distribuidos mayormente en las provincias de Buenos Aires y Córdoba. Contamos con una facturación neta de más de 12 millones de pesos netos en los últimos 12 meses.', 'No posee local propio.', 'Alquiler de oficina ubicada en Moreno 1020 de la ciudad de Crespo (E.R.), contratado desde el 16 de septiembre de 2019, el valor actual del mismo es de $12.470 por mes. El espacio tiene aproximadamente unos 50 metros cuadrados que se dispone entre una sala común compartida, un baño y una cocina.', 'Se produce software de gestión que cuenta con una estructura modular que incluye gestión de clientes, proveedores, compras y ventas, caja y banco, productos, stock. Además se ofrecen integraciones con carritos de compras web y algunas plataformas como MercadoLibre y TiendaNube.', 'El software desarrollado funciona en la nube, utilizando los servicios de datacenter de Amazon (AWS), se usan servidores Linux y bases de datos MySQL, el desarrollo está hecho con diversos lenguajes de programación como php, c#, Go, node.js, python, entre otros.', 'Se añaden constantemente nuevas funciones para potenciar la herramienta, además de actualizaciones requeridas para cumplimentar normativas de AFIP (ej.: cambios en la facturación electrónica) y nuevas integraciones con otras plataformas. Esto incluye la programación, testeo e implementación.', 'Al ser una empresa de base en la economía del conocimiento no se utilizan materias primas en sí. El mayor insumo es el capital humano que aporta su conocimiento para la programación, el desarrollo de nuevas funciones y la atención al cliente.', 'La empresa no genera ningún tipo de desechos o residuos a excepción de los habituales insumos de baño y cocina utilizados por el personal.', 'Apuntamos actualmente a micro y pequeñas empresas de Argentina, principalmente concentrados en los grandes centros económicos del país, como son Buenos Aires, Córdoba, Rosario, Santa Fe, etc. Se apunta a  micro y pequeñas empresas, mayormente en rubros comerciales (compra/venta) tanto minoristas como mayoristas. El software no es de nicho, por lo que es utilizado por empresas de rubros diversos, desde corralones hasta tiendas de calzado e indumentaria.', 'Nuestros potenciales clientes son emprendedores y micro empresas que van desde unipersonales, pasando por una gran mayoría que tienen 4/5 empleados hasta algunas organizaciones con 10/15 personas. No hay un foco en un nicho específico, aunque estamos teniendo mucha tracción en rubros como accesorios y reparación de celulares y venta de electrónica online.', 'Los principales competidores son empresas tradicionales de software como Tango o Flexxus, que ofrecen soluciones enlatadas con licencias que resultan caras para micro empresas y no funcionan 100% en la nube o no están bien integradas con los diversos Marketplaces (como Mercadolibre) y las webs de carrito de compras. Por otro lado hay competidores que son 100% online, están integrados con e-commerce y son relativamente económicos pero no cuentan con todas las funciones que requieren los clientes.', 'Los principales proveedores son internos, nuestros empleados. Al ser una empresa de economía del conocimiento el principal costo que se integra es la mano de obra, el trabajo intelectual de producir el software y de atender a nuestros clientes. De manera secundaria tenemos proveedores de servicios de infraestructura como Amazon, Slack, Mailchimp, etc. de quienes adquirimos servicios que se abonan mensualmente en dólares.', 'Problemas económicos en el país (por el COVID), si nuestros cierran dejamos de cobrarles, éste es un factor que está fuera de nuestro control, igualmente constantemente ingresan nuevos clientes e incluso algunos que han cerrado al tiempo vuelven a contratar para un nuevo emprendimiento. Por otro lado la curva de aprendizaje del personal contratado (que lleva unos 6 meses) hace que si un empleado se va antes signifique una pérdida de tiempo importante, para esto tratamos de pagar buenos sueldos.', 'Cubrir los sueldos y cargas sociales de los empleados a contratar por al menos 6 meses. Se piensa mínimamente en 3 personas, una en ventas, una en soporte y otra en programación. Adicionalmente se requerirá la compra de equipos informáticos (notebook o PC, UPS, teléfonos IP). También se haría una consultoría y rediseño del portal web de la empresa que actualmente es el principal canal de ingresos de clientes nuevos.', 'Además de los ya mencionados 5 empleados vigentes la intención es tomar 3 personas más, llegando a ocupar 8 personas sin contar a los socios fundadores que también son parte del proyecto.', 'Contribuir con la economía de nuestra ciudad y región mediante la generación de 3 puestos nuevos de trabajo. Además quienes utilizan nuestro software tienen la posibilidad de usar una herramienta de gestión que ayuda a optimizar su trabajo a un bajo costo, lo cual es un beneficio real para nuestros usuarios.', 'Se ofrecen 4 planes. Emprendedores $2399 x mes, Comercios $3299 x mes, PyMEs $5.099 y Empresas $8.799. Además se venden usuarios adicionales $999 para Comercios, $1.149 para PyMES y $1.399 para Empresas, todos valores mensuales NETOS + IVA del 21%.', 'Contamos con un producto sólido y un modelo de negocios ya validado. Muy buena imagen de marca entre los clientes (nos recomiendan mucho). Estructura de costos estable. Ofrecemos un servicio vinculado a procesos que actualmente son indispensables para cualquier empresa (vinculación con e-commerce, facturación electrónica, etc.).', 'Expansión a nuevos clientes que tienen software obsoleto y que no se integra con e-commerce. Aprovechar las tendencias que se están gestando como el trabajo remoto y la virtualidad, ya que el software al ser 100% online permite trabajar desde cualquier lugar. Apalancarnos en integraciones como MercadoLibre y Tienda Nube para una posible expansión en países limítrofes.', 'Un poco de falta de organización. La transición de trabajar solo dos socios a contar con una pequeña estructura con varios empleados nos ha costado un poco, estamos trabajando para ordenar nuestros procesos internos y ser más eficientes. El valor del peso frente al dólar hace difícil y costoso conseguir y retener programadores capacitados, ya que muchos prefieren trabajar para empresas del exterior.', 'Posibles problemas a nivel macroeconómico que afecten directa o indirectamente a nuestros clientes, que produzcan el cierre de comercios pequeños y medianos, reduciendo el mercado. Otros competidores están respaldados por fondos de inversión o son empresas muy grandes que pueden contratar mas personal y hacer desarrollos mas grandes o invertir más en marketing que nosotros.', '2021-08-04 13:43:14', '2021-08-25 14:57:15'),
(88, 1375, 1623, 19, 1, 'ADQUISICIóN CAPITAL DE TRABAJO', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-08-11 14:09:22', '2021-08-11 14:44:01'),
(94, 1611, 1633, 19, 1, 'POR AMPLIACIóN Y MEJORAS DE LUGAR DE TRABAJO.', 'Somos una empresa metalúrgica que se dedica a la construcción y montajes de estructuras metálicas, soldadura certificada (cañería bajo presión). Este ultimo tiempo hemos adquiridos nuevas maquinarias de importante dimensión, lo que ah reducido nuestro espacio de trabajo, como consecuencia, tenemos que aceptar trabajos con fecha de entrega superiores a los acostumbrados, ésto es un problema para el cliente y para nosotros, en muchos casos, los trabajos solicitados tienen su urgencia.', '3000000.00', 1, 0, 'Nuestro proyecto se basa en poder ampliar y mejorar el lugar de trabajo. Se pretende ampliar el lugar físico y mejorar el existente, así como también adecuar un buen lugar a las maquinarias nuevas, ya que necesitan su lugar fijo.', 'Nuestro objetivo es poder tomar mas trabajos. Se busca avanzar más rápido con los trabajos y obras contratadas, poder contratar mas empleados para hacer rendir al máximo las maquinarias adquiridas.', 'Este proyecto es de suma importancia para nosotros, ya que nos permitiría tomar mas trabajos, poder contratar mas personal, crecer en el mercado metalúrgico, ya que ademas contamos con unos de los pocos soldadores matriculados con que cuenta la provincia.', 'Actualmente, recibimos trabajos con fecha  de entrega a 1 o 2 meses.  Debemos primero terminar con una obra, para poder empezar con otra, se debe vaciar el lugar de trabajo, por eso nuestro interés en este proyecto.', 'Esta metalúrgica se inició hace mas de 15 años, donde realizábamos pequeños trabajos de la rama, en el año 2018 pasamos a ser Responsable inscripto y proveedores de distintas empresas de la zona, donde tuvimos un avance considerable en maquinarias y experiencia laboral.', 'Actualmente contamos con maquinarias y herramientas de gran avance tecnológico, soldadores matriculados en cañerías de alta y baja presión, dicha matricula se renueva cada 6 meses, al igual que las captaciones en seguridad e higiene, ademas hacemos un control de todas las herramientas manuales y eléctricas que van acompañadas de la firma de nuestro Ingeniero en SyH, logrando con todo esto, una buena posición en el mercado.', 'Taller de nuestra propiedad, cuenta con 250m².., tiene acceso por un portón de chapa, es un galpón grande donde se realizan los trabajos, tiene un sector de deposito de hierros, un deposito de herramientas mas pequeñas, un baño, una oficina administrativa y un puente grúa.', 'No alquilamos.', 'Nuestra larga trayectoria en el rubro nos ah ido perfeccionando en la técnica de nuestros trabajos, actualmente contamos con soldadores matriculados. En nuestra empresa también se enseña a nuevos empleados a soldar, que luego son evaluados por la institución competente.', 'Las nuevas maquinarias, nos permiten agilizar la mano de obra, mejorar la calidad de los trabajos, el tiempo de producción, también el de incorporar nuevos servicios a ofrecer, como es el caso de \"corte con pantografo\".', 'En es caso de elaboración y montaje de estructuras metálicas: En la empresa cliente, primero se hace un revelamiento de todo lo que se pretende hacer/modificar, se coordinan pasos a seguir y se establecen días y horarios a trabajar.  En nuestro taller se avanza dependiendo el tipo producto.', 'Hierros: caños, tubos, chapas, perfiles, etc.', 'En nuestro taller la mayoría de desechos y/o residuos son cortes pequeños de hierros, hay tachos donde se juntan y luego son vendidos a desarmaderos.', 'Clientes locales y sumar nuevos clientes de otras provincias,', 'La gran mayoría de nuestros clientes son empresas industriales locales. También hacemos trabajos para empresas de otras provincias, como Corrientes, Córdoba, Buenos aires. Nuestro principal cliente, del cual somos proveedores permanentes, es CARTOCOR S.A.', 'Dependiendo el producto o servicio demandado, nuestra competencia, puede variar. Somos unas de las pocas empresas de la provincia que cuenta con soldadores matriculados, empresas de Córdoba, Santa fe y Buenos aires son competencia, también lo son, para nuestro nuevo servicio de corte con pantografo, \r\nPara construcción de estructuras metálicas y cortes con pantografo tenemos varios competidores a nivel local.', 'Nuestros mayores proveedores en hierros, son METALÚRGICA PASGAL de Paraná , ACEROS COCO de Rosario, ACEROTEK de Bs As. Para Insumos básicos: FERRENET/PROMATTI/COLOMÉ/JULIO GOMEZ, todos de Paraná.', 'Al contar con un taller precario y reducido, nuestro riesgo es quedarnos estancados y no poder seguir avanzando.', 'Poder ampliar el taller, mejorar el lugar existente.', 'Es una empresa familiar, somos 5 personas de la familia que trabajan en el taller. A demás tenemos contratado 1 empleado. También de nosotros dependen varios subcontratistas, que realizan trabajos en la fabrica cliente junto a nosotros, como por ejemplo, Ingeniero en Seguridad Industrial, maquinistas de grúas, soldadores, etc todo depende de lo que se necesite en la obra contratada.', 'Empresa local en crecimiento. \r\nPoder generar mas puestos de trabajo.\r\nFortalecer esta rama (soldadores certificados) en la provincia.', 'Los precios son por hora de trabajo, depende de que tipo de trabajo, del tipo de soldadura (cañerías de agua, rosacada, de gasoil; cada tipo tiene su precio, si es trabajo es el altura o no), hay muchas cosas de la obra que se tienen en cuanta a la hora de presupuestar, esto es para el caso de contrato por servicio de mano de obra únicamente. En el caso de estructuras metálicas, depende del material del trabajo, se cotizan los materiales + mano de obra.', 'Nuestra fortaleza es la tranquilidad que le ofrecemos al cliente al momento de contratarnos, contamos con  muy buenas recomendaciones, con personal que se capacita constantemente. Tenemos documentos que respaldan nuestros controles cada 6 meses de las herramientas que usamos,capacitaciones que recibimos, tanto en temas de seguridad e higiene laboral, cuidado del medio ambiente, como así también en técnicas nuevas de trabajos.', 'Aprovechar el buen momento que estamos teniendo y poder seguir creciendo con la ayuda de este proyecto.', 'Creemos que la falta de publicidad, nos debilita el alcance a nuevos clientes. Nuestros clientes actuales llegaron a nosotros por recomendaciones de otros clientes. No hemos pensado en la parte de publicidad ya que no podemos recibir mas trabajo por falta de lugar de trabajo', 'Que el cliente pierda el interés en nuestros trabajos por no actualizarnos en nuevas técnicas de trabajo.', '2021-08-18 13:45:05', '2022-02-10 13:37:11'),
(96, 1571, 1588, 19, 1, 'INVERSIÓN DIGITAL', 'En el año 2007 se plasmó el proyecto de un nuevo medio de comunicación en la ciudad saliendo a la calle con 24 páginas de información local ininterrumpidamente durante 13 años en paralelo con la página web bajo el dominio www.laprensafederal.com.ar. Siendo en la actualidad el medio gráfico de mayor antigüedad en la ciudad.', '1400000.00', 1, 0, 'Dotar de mayor infraestructura al Diario La Prensa Federal, mejorando equipos, software y sobre todo recursos humanos que permitan mejorar los contenidos y aumentar la audiencia desarrollando áreas específicas para la producción, el turismo y la cultura, estableciendo vinculación con empresas y prestadores de servicios de la ciudad, la región y la provincia.', 'Dotar de mayor infraestructura a la empresa, mejorando equipos, software y sobre todo recursos humanos que permitan mejorar los contenidos y aumentar la audiencia', 'Aprovechar el tiempo de recuperación económica y social para inyectar un flujo de capital que permita potenciar las virtudes y fortalezas del medio y explorando proyectos de crecimiento que se encuentran en desarrollo.\r\nEl acceso a la información es uno de los bienes que más se multiplica todos los días y la búsqueda de contenidos en medios tradicionales ha crecido notablemente porque las personas, en medio de la abundancia de noticias, buscan fuentes de información confiables.', 'La empresa apuesta al desarrollo de su sitio online como también a la revista digital, para alcanzar todas las audiencias particularmente las más jóvenes, ya que se suficiente disponer de un smarhpone, tablet u ordenador, buscando posicionarnos como la fuente de acceso de información principal de la ciudad. Somos uno de los 5 medios gráficos de la costa del Uruguay. Buscamos posicionarnos como líderes en el acceso a la informacion en todas las audiencias por todos los canales.', 'El objeto principal de la empresa es la publicación de un medio de noticias cuyas características contaban con un diseño que hoy día se mantiene y una tirada inicial que creció en poco tiempo, La Prensa Federal marcó desde el comienzo su diferencia con el periodismo local por su redacción,  sus notas de actualidad y la impronta local.', 'En la actualidad, hemos mantenido ese estilo que ha sido apreciado por la comunidad, empresas e instituciones que hasta la fecha continúan acompañando, pretendiendo avanzar en nuevos proyectos para brindar mejores servicios a esos segmentos.', 'La empresa se encuentra establecida en un espacio amplio con oficinas, y comodidades que permite desarrollar las diversas actividades sin mayores inconvenientes. Además se encuentra a escasas 4 cuadras de la plaza Ramírez, principal centro social, político y económico de la ciudad.', 'Alquiler: 15 años. Hemos establecido un nuevo emplazamiento alquilando hace pocos meses nuevas oficinas en Almafuerte 635 a cuatro cuadras del centro social, político y económico de la ciudad. Cuenta con amplias oficinas para cada actividad.', 'Publicación gráfica en formato tabloide, de edición diaria, de 16 páginas de lunes a sábado y de 24 páginas los domingos. Además, publicación de Página Web periodística, de información general, predominantemente local y regional.', 'No aplica', 'El grupo de periodistas genera la información para la que se utilizan computadoras de escritorios con trabajo en red. Diagramación, edición de fotografía, redacción y puesta en página. Por otra parte se realiza venta de publicidad y diseño.', 'Insumos de papel y tinta en la imprenta.', 'Descripción de los subprocesos, desechos y/o residuos que se generan durante los Procesos Productivos: Solamente lo generado en la imprenta. Impacto en la redacción y administración del diario: mínimo.', 'se está ante un Universo de 60 mil habitantes mayores de 18 años en Concepción del Uruguay, y el doble si se llega a la región  zona de influencia. Se puede considerar acotar el mercado a los lectores posibles considerando edades, intereses, hábitos y costumbres , y el.mercado sé reduce a unas 10 mil personas.', 'Los principales clientes de pautas publicitarias del diario son los organismos del estado nacional, provincial y / o municipal. Luego se ubica el rubro comercial local y finalmente los profesionales.', 'La competencia está comprendida por otro medio de similar característica y tirada y menor antigüedad que nuestro medio, siendo competencia directa. Los diarios digitales, generan una competencia más diversificada, con 5/6 páginas web de alcance avanzado y que disputan hoy el mercado digital.', 'No hay proveedores de impacto directo de peso en redacción o administración. De forma indirecta: proveedores de papel (complejo por escasez de insumos y costos elevados) y de tinta (importaciones) tareas que se desarrollan en el taller de impresión (servicio tercerizado)', 'Los desafíos apuntan a superar la crisis económica a partir de estrategias relacionadas a sumar contenido que atraiga tanto a lectores como a empresas, comercio o profesionales interesados en auspiciar algunas de las iniciativas propuestas vinculadas a la producción, la industria, el turismo, etc', 'El destino del monto solicitado está previsto para la mejora de los contenidos del medio y la generación de nuevos productos vinculados a temáticas que puedan atraer lectores y potenciales clientes. Estas temáticas son Producción, Turismo, Cultura y actividades propias de la ciudad. Esta ayuda permitirá actualizar equipamientos, software y personal que permitan un producto de mayor calidad para la audiencia.', 'Seis trabajadores en redacción, dos trabajadores en diagramación, tres trabajadores en administración. En la distribución, un coordinador en contacto con revendedores, kioscos y canillitas.', 'El periodismo se encuentra dentro de un entorno invadido por el escepticismo y la polarización del consumidor que demanda confiabilidad y transparencia en la información. El contexto económico sigue resultando un factor determinante a la hora de tomar decisiones. Hay amenazas que se presentan como la contracción económica y la alta concentración en ventas a través de canales indirectos que serían un disparador para buscar desarrollar nuevas oportunidades de negocios en nuevos mercados regionales', 'El diario en su edición gráfica tiene un valor de 40 pesos de lunes a sábado; y de 60 pesos los domingos, valores que se van actualizando. Otro servicio que se brinda es la publicidad cuyos valores varían según tamaño, ubicación, fecha de publicación, repetición, etc.', 'La presencia diaria en las calles y en los domicilios de los suscriptores, de manera ininterrumpida desde hace más de 15 años es nuestra principal fortaleza. Ello se complementa con la presencia en línea, a través de una página web que también se encuentra online desde el primer día de publicaciónn del medio gráfico. También se cuenta con una gran base de datos de contactos; experiencia en su plantel de redactores.', 'Oportunidades. Como medio de comunicación creemos que en una ciudad tradicional como Concepción del Uruguay tiene posibilidades de crecimiento en un medio gráfico. Pero además, hay una apuesta fuerte al fortalecimiento de la página web y un proyecto de llegar a nuevos lectores a través del “diario digital”, el formato de la edición gráfica que puede llegar a los vecinos a través del celular o el correo electrónico.', 'La ventas de periódicos en tiempos de alta preponderancia de las redes sociales, alta rotación de personal necesitando del desdoble de tareas en más de una oportunidad, anticuados software de edición y equipos.', 'Las amenazas que pueden dañar el crecimiento, es el aumento en la cantidad de contenido gratuito de las redes sociales, rápidamente cambiante, la tecnología y los métodos de distribución, disminución del interés público de la noticia, y el aumento en los costos.', '2021-08-23 15:19:24', '2021-11-03 13:19:43'),
(97, 1598, 1617, 24, 1, 'TALLER METALÚRGICO - SANTA RITA', 'ATENTO AL CRECIMIENTO Y DESARROLLO, EN LA REGIÓN NACIONAL E INTERNACIONAL, DE PEQUEÑOS SECTORES PRODUCTIVOS LACTEOS/TAMBEROS. NOS VEMOS IMPOSIBILITADO DE PODER BRINDAR UNA RESPUESTA ÁGIL Y RÁPIDA A LA DEMANDA DE NUESTROS CLIENTES Y/O POTENCIALES. ES POR ELLO QUE EL FINANCIAMIENTO NOS PERMITIRÁ TENER UN BUEN STOCK DE EQUIPOS PARA AFRONTAR LA DEMANDA DE NUESTRAS HERRAMIENTAS, Y DE ESTA MANERA PODER DAR UN SALTO DE CALIDAD Y POSICIONAMIENTO, BRINDANDO ACTIVOS DE EXCELENTE CALIDAD Y NORMALIZADOS.', '1400000.00', 0, 0, 'SIENDO FABRICANTES DE EQUIPOS PARA ELABORACIÓN DE ALIMENTOS PRINCIPALMENTE LÁCTEOS, QUEREMOS PROFUNDIZAR Y LOGRAR UNA MAYOR PRODUCCIÓN DE HERRAMIENTAS FUNDAMENTALES PARA ESTE SECTOR.', 'NUESTRO OBJETIVO AFIANZAR LA ELABORACIÓN DE EQUIPOS QUE APUNTEN AL PEQUEÑO PRODUCTOR QUE ESTA EN LA ETAPA DE INICIO Y/O DESARROLLO DE LA ACTIVIDAD', 'NOS HABRE NUEVAS OPORTUNIDADES DE LLEGAR A MERCADOS POCO DESARROLLADOS QUE NECESITAN MEJORAR SUS PRODUCTOS Y/O PRODUCCIÓN', 'ACTUALMENTE ESTAMOS LIMITADOS EN PRODUCTOS TERMINADOS Y QUEREMOS CRECER EN STOCK', 'FABRICAMOS DESDE EL AÑO 2006 CON LA EXPERIENCIA DE SEGUIR LA LINEA FAMILIAR  EN LA ACTIVIDAD', 'HOY ESTAMOS LIMITADOS A TERCEROS PARA PRODUCIR, CON ESTA AYUDA FINANCIERA PODRÍAMOS MEJORAR ES STOCK Y CALIDAD', '0', 'EL INMUEBLE DONDE DESARROLLO LA ACTIVIDAD ES DE MI PADRE, SOBRE EL CUAL TENGO UN COMODATO. LAS INSTALACIONES DE LA EMPRESA CONSTAN DE UN GALPÓN DE APROX. 160 Mtr2.  TOTALMENTE CERRADO Y EQUIPADO CON LAS HERRAMIENTAS PARA EL DESARROLLO DE LA ACTIVIDAD', 'EQUIPOS PARA PASTEURIZAR LECHE Y FABRICAR LÁCTEOS (CONSTRUIDOS EN ACERO INOXIDABLE)', 'NUESTROS EQUIPOS SE ADAPTAN A DIFERENTES NECESIDADES TÉCNICAS Y CAPACIDADES', 'ADQUIRIMOS EL MATERIAL Y SE PROCESA TODO EN NUESTRO TALLER', 'CHAPAS - TUBOS Y BARRAS DE METAL', 'EL ÚNICO DESECHO ES VIRUTA DE METAL LA CUAL ES UN MATERIAL RECICLABLE', 'CRECIENTE YA QUE MUCHOS PEQUEÑOS PRODUCTORES NECESITAN DESARROLLARSE', 'PEQUEÑOS Y MEDIANOS PRODUCTORES RUARLES', 'DE ORIGEN MAYORMENTE IMPORTADO', 'IMPORTADORES DE CHAPA Y FABRICAS NACIONALES (50% Y 50%)', 'EL RISGO ES MENOR YA QUE ES UN MERCADO EN CRECIMIENTO Y POTENCIAL EXPORTADOR', 'ADQUISICIÓN DE HERRAMIENTAS, MATERIA PRIMA E INSUMOS', 'AL TRATARSE DE UNA EMPRESA FAMILIAR NO CONTAMOS CON EMPLEADOS', 'ANTE LA CRECIENTE DEMANDA ,Y POR ENDE MAYOR PRODUCCIÓN NOS POSICIONA EN UNA ETAPA ESTRATEGICA PARA PODER DESARROLLARNOS E INSTALARNOS EN NUEVOS MERCADOS BRINDANDO UN PRODUCTO ACCESIBLE Y DE CALIDAD, TENIENDO UN IMPACTO POSITIVO EN NUESTRA SOCIEDAD CREANDO NUEVAS FUENTES DE TRABAJO DIRECTA E INDIRECTAMENTE', 'A DETERMINAR UNA VEZ FINALIZADO EL PROCESO DE FABRICACIÓN, TENIENDO EN CUENTA EL CONSTO DE LOS MATERIALES Y LAS DEMÁS VARIABLES QUE INTERVIENEN EN LA PRODUCCIÓN', 'MERCADO EN CRECIMIENTO CON POCA OFERTA', 'POTENCIAL EXPORTADOR EN CRECIMIENTO', 'FALTA DE STOCK', 'APERTURA DE IMPORTACIONES, ASIÁTICAS, ECONÓMICAS', '2021-08-23 19:27:57', '2022-06-07 15:30:22'),
(100, 929, 903, 19, 1, 'NUEVO PROYECTO PARA LA COMPRA DE MATERIALES E INSUMOS PARA LA FABRICACIÓN DE CARROCERÍAS', 'Solicito este monto para la compra de materiales necesarios para la fabricación de carrocerías y fabricación de plegados a terceros (canaletas, cenefas, moldes para industrias de pre moldeados) tales como: \r\nchapas de espesor 1/4\r\nEspesor 3/16\r\nChapas negras números 1/8, 12, 14, 16, 18\r\nChapas galvanizadas números 18, 20, 22 y 25', '1400000.00', 0, 0, 'El proyecto consiste en la necesidad de adquirir nuevos insumos, en mayor cantidad y variedad, para la realización de carrocerías.', 'El objetivo principal es contar con una amplia variedad de insumos,que nos permitan el armado, terminación y colocación de carrocerías. A su vez, la fabricación de plegados a terceros.', 'Este monto nos presenta una gran oportunidad de crecer como empresa. De poder cumplir con nuestros clientes de manera más efectiva, con la posibilidad de conseguir mejores insumos.', 'Actualmente la empresa no cuenta con el dinero para invertir en nuevos insumos, es por eso que se solicita el monto de $1.400.000 para solventar los gastos de los mismos.', 'Esta empresa fue creada con el fin de satisfacer las necesidades de los clientes y de trabajo. En sus inicios, sólo se dedicaban a la fabricación de productos de metal en general.', 'Actualmente en la empresa se fabrican de productos de metal en general, así como también la reparación y pintura de carrocerías, colocación y reparación de guardabarros y protecciones exteriores.', 'Galpón, dónde se cuenta con las herramientas y la capacitación adecuada para llevar a cabo el proceso productivo', 'El lugar es propio.', 'Chapas a medida.', 'Corte y plegado para terceros.', 'El proceso es simple, primero se elabora un presupuesto; luego se procede a la compra de los materiales, cortado y ensamblado de los mismos. El paso final es el pintado, primero con anticorrosivos y luego con pintura sintética si es solicitado.', 'Se utilizan materias primas, tales como: chapas, fibra de vidrio, pinturas, aleaciones de hierro y aleaciones de aluminio.', 'Aunque los efluentes son mínimos, el lugar de trabajo cuenta con perfecto desahogo de los desechos', 'A través de nuestro trabajo buscamos satisfacer la necesidad de los clientes, la demanda de trabajo aumentó.', 'Contamos con clientes de empresas grandes y particulares.', 'Actualmente la competencia es mínima, y la demanda de trabajo es mayor.', 'Nuestros proveedores son, en su mayoría, de nuestra ciudad.', 'No posee.', 'El monto solicitado será destinado para la compra de materiales e insumos para la fabricación de productos de carrocerías y a su vez, para la fabricación de plegados a terceros.', 'Actualmente cuento con un empleado.', 'Este proyecto impactaría de manera positiva, teniendo en cuenta que nos daría lugar para crecer como empresa, para ofrecer mejores productos a nuestros clientes.', 'El precio de los productos varía, teniendo en cuenta el volumen de materia prima ocupado para la fabricación del mismo.', 'El propietario es una persona joven, con ganas de prosperar, responsable con su trabajo.', 'Teniendo en cuenta que la demanda de trabajo supera la oferta en nuestra ciudad, esta seria una gran oportunidad de crecer como empresa.', 'No posee.', 'No posee.', '2021-08-27 13:57:41', '2021-09-10 13:07:54'),
(101, 1622, 1642, 24, 1, 'ESTUDIO CONTABLE', 'Estudio Contable dirigido por jóvenes graduados en Ciencias Económicas, con voluntad de trabajo y ganas de ofrecer herramientas al sector productivo para gestionar los recursos y administrar correctamente los negocios.', '1400000.00', 1, 1, 'Construcción de un Local Físico donde brindar atención adecuada al sector productivo e industrial zonal de asesoramiento financiero y económico  para realizar inversiones productivas. Actualmente en la ciudad se proyecta la ampliación del Parque Industrial y la necesidad de asesoramiento en inversiones es creciente ; motivo por el cual deseamos poder  brindar en un espacio adecuado nuestros servicios.', 'Establecernos  en un lugar físico adecuado y brindar un servicio de asesoramiento integral para las Pymes de la zona, donde no solo encuentren quien liquide sus impuestos sino un espacio donde puedan encontrar las respuestas a sus proyectos y asesoramiento integral, tanto para la obtención de fondos como para gestionar su empresa .', 'En este momento el sector productivo de la ciudad y de la zona se enfrenta a la posibilidad de crecimiento ante la ampliación del Parque Industrial de la ciudad, nos encontramos cada vez mas  atendiendo las inquietudes de empresas familiares y demas pymes en relacion a la necesidad de asesoramiento para gestionar proyectos de ampliación, mudanza e instalación en el nuevo predio, pero nos vemos limitados en cuanto al espacio físico para la atención de esta necesidad.', 'La correcta atención de las necesidades de asesoramiento contable impositivo, laboral y en general implican un espacio físico adecuado en virtud de la situacion actual, pero también requieren de espacio de almacenamiento de la informacion y equipamiento.', 'Somos profesionales en Ciencias Económicas, recibidos en Universidades Publicas,  que nos unimos  en el año 2016,  con la finalidad de brindar asesoramiento fiscal, contable y laboral, pero con el correr del tiempo vemos necesidad del sector productivo e industrial zonal de asesoramiento financiero y económico  para realizar inversiones productivas. Actualmente en la ciudad se proyecta la ampliación del Parque Industrial y la necesidad de asesoramiento es creciente.', 'Actualmente nos desarrollamos sin un espacio físico propio ni acorde, si bien los servicios actualmente se facilitan con los medios electrónicos se requiere espacio de almacenamiento, equipamiento y un entorno adecuado para la atención del sector productivo industrial y comercial de la zona', 'Local cedido en forma gratuita por otro profesional', 'Cesion de uso gratuita por 2años', 'Servicio de asesoramiento impositivo, contable, laboral integral.', 'Servicio de asesoramiento personalizado', 'Asesoramiento personal en asuntos impositivos,  contables, laborales y de gestión empresarial', 'no posee', 'no posee', 'Empresas y contribuyentes pyme de la zona', 'contribuyentes locales y zonales que se desarrollen actividades productivas, comerciales y de servicios', 'Estudios contables tradicionales dedicados exclusivamente a la liquidación de impuestos, no abarcan el servicio de gestión empresarial', 'proveedores de sistema informático de procesamiento de datos', 'no posee', 'Construcción de un Local y oficinas de atención y desarrollo de nuestros servicios, para ello contamos con un espacio físico: terreno ubicado en Calle Libertad 116 de la ciudad de Gral. Ramírez', '2 empleados administrativos en relacion de dependencia', 'El servicio de Asesoramiento Gerencial tendrá para las Pymes un impacto positivo en cuanto la los resultados al encontrar como canalizar las inquietudes y verse inmersos en un entorno que les brinde seguridad y asesoramiento antes sus inquietudes, logrando asi mejorar la eficiencia y alcanzando mejores resultados, a su vez impactaría en un incremento de las inversiones a traves del desarrollo de proyectos productivos en manos de las pymes de la zona.', 'variable en relacion a cada cliente, nivel de facturación, empleados, etc', 'Consideramos que actualmente la actividad de Asesoramiento integral de la gestión en las empresas no está cubierto, por lo tanto nuestra fortaleza seria cubrir esa necesidad para lo cual nos consideramos capacitados.', 'Los estudios contables de la zona brindad servicio de liquidación de impuestos, y nuestra intención es la de ampliar hacia un asesoramiento integral de la gestión empresaria.', 'no encontramos limitados en cuanto al espacio físico necesario para desarrollar correctamente la labor', 'no posee', '2021-08-27 16:58:16', '2021-09-01 14:51:47');
INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(105, 1621, 1648, 24, 1, 'ACONDICIONAMIENTO DE TALLER EN EMPRESA DE TRANSPORTE', 'ACONDICIONAMIENTO DEL PREDIO DE CAMIONES YA EXISTENTE EN LA EMPRESA CON LA ADQUISICIÓN DE UN CONTENEDOR PARA GUARDA DE HERRAMIENTAS Y UTILIZACIÓN COMO TALLER Y UNA PLANCHADA DE HORMIGON PARA LAVADO DE LAS UNIDADES. TENDRA COMO BENEFICIO PARA LA SOCIEDAD LA CONTRATACION DE UN MECANICO ENCARGADO DEL TALLER.', '1400000.00', 1, 0, 'COMPRA DE UN CONTENEDOR UTILIZADO EN EL RUBRO DE TRANSPORTE PARA INSTALARLO EN UN PREIDO D ELA EMPRESA Y DEJARLO FIJO. SE PRETENDE UTILIZARLO COMO LUGAR DE GUARDA DE HERRAMIENTAS Y TALLER PARA LOS CAMIONES DE LA EMPRESA. ADEMAS SE CONSTRUIRA UNA PLANCHADA DE HORMIGON ELABORADO PARA CREAR UN ESPACIO ADECUADO DE LAVADO DE LAS UNIDADES Y SE COMPRARAN LAS HERRAMIENTAS NECESARIAS.', 'AGREGAR DENTRO DE LA EMPRESA EL SECTOR TALLER, LAVADO Y ENGRASE A CARGO DE UN NUEVO EMPLEADO A CONTRATAR', 'DISMINUCION DE COSTOS VARIABLES DE LA EMPRESA LOGRANDO MEJORES TIEMPOS EN EL MANTENIMIENTO DE LAS UNIDADES CON MANO DE OBRA PROPIA', 'SE CUENTA CON UN PREDIO DE 4000 METROS CUADRADOS UBICADO EN GENERAL RAMIREZ PARA LLEVAR ADELANTE EL PROYECTO', 'EMPRESA FAMILIAR FUNDADA EN 2015 DEDICADA SIEMPRE AL RUBRO DE TRANSPORTE INTERNACIONAL CON SU SOCIO GERENTE EN EL RUBRO DESDE EL AÑO 2005. EN PRINCIPIO SE PRESTABAN SERVICIOS DE FLETES INTERNACIONALES CON CAMIONES CONTRATADOS DE TERCEROS Y LUEGO SE COMENZARON A ADQUIRIR UNIDADES PROPIAS', 'ACTUALMENTE LA EMPRESA CUENTA CON 10 UNIDADES PROPIAS ENTRE LAS QUE SON DE TITULARIDAD DE LA SRL Y SU SOCIO GERENTE SEÑOR BRESSAN EDGARDO. ADEMAS TIENE MAS DE 15 UNIDADES DE TERCEROS CONTRADAS EN LA FLOTA BRINDANDO SERVICIOS DE FLETES INTERNACIONALES ENTRE ARGENTINA Y URUGUAY.', 'OFICINA COMERCIAL UBICADA EN CALLE FRENCH 377 Y PREDIO DE CAMIONES EN EJIDO DE GENERAL RAMIREZ', 'LAS INSTALACIONES SON PROPIAS', 'LOS SERVICIOS PRESTADOS INCLUYEN TODA LA ETAPA DE TRANSPORTE Y ADUANA, DESDE QUE EL CAMIÓN CARGA EN PLANTA DEL CLIENTE, PASANDO POR ADUANA ARGENTINA Y URUGUAYA, Y FINALIZANDO CON LA DESCARGA EN EL PAIS DE DESTINO', 'PARA LLEVAR A CABO EL SERVICIO SE CUNETA CON UNIDADES DE CAMIONES CON MENOS DE 10 AÑOS DE ANTIGUEDAD EN SU CONJUNTO', 'SE RECEPCIONA EL PEDIDO DEL FLETE Y LUEGO COMIENZA LA ETAPA DE LOGISTICA COORDINANDO TODAS LAS PARTES INVOLUCRADAS EN EL PROCESO, ES DECIR CHOFERES, MERCADERIAS, DESPACHANTES DE ADUANA, AGENTES DE TRANSPORTE ADUANERO, CARGA Y DESCARGA', 'LA MATERIA PRIMA EN EL TRANSPORTE ESTA COMPUESTA POR EL FACTOR HUMANO QUE ES LO PRINCIPAL Y MAS IMPORTANTE PARA NOSOTROS, LOS CHOFERES, Y LUEGO LOS INSUMOS QUE PERMITEN EL MOVIMIENTOS DE LAS UNIDADES, ENTRE LSO QUE SE DESTACAN FUNDAMENTALMENTE EL COMBUSTIBLE Y LOS NEUMATICOS', 'EN UNA MANERA DE CONSERVAR EL MEDIO AMBIENTE SE INTENTA GENERAR EL MENOR IMPACTO POSIBLE UTILIZANDO UNIDADES NUEVAS CON EURO 5 QUE DISMINUYEN LA CONTAMINACION DEBIDO A LA UTILIZACION DE UREA PARA COMBUSTIBLE  Y POR OTROL ALDO SE REUTILIZAN LOS NEUMATICOS LOGRANDOS 2 RECAPADOS POR CADA UNO', 'SE ENCUENTRA EN CONSTANTE EXPANSION CON UN COMERCIO INTERNACIONAL QUE SIGUE CRECIENDO FUNDAMENTALMENTE POR EL AUMENTO DE LA DEMNDA DEL PAIS URUGUAYO Y EL CRECIMIENTO SOSTENIDO DEL PUERTO DE MONTEVIDEO, MEDIANTE EL CUAL INGRESAN CONTENEDORES CON MERCADERIAS DESDE ASIA Y EUROPA Y LUEGO VIENEN POR FLETE TERRESTRE HASTA ARGENTINA', 'LOS CLIENTES SON EMPRESAS ARGENTINAS Y URUGUAYAS Y PUEDEN SER FABRICAS O COMERCIOS, ASI COMO TAMBIEN EMPRESAS DEDICADAS A LA REALIZACION DE TODA LA CADENA DE TRANSPORTE AEREO, MARITIMO Y TERRESTRE QUE SE ENCARGAN DE TODA LA OPERATORIA DESDE QUE LA MERCADERIA SALE DE LOS PUERTOS INTERNACIONALES HASTA QUE LLEGA A NUESTRO PAIS', 'EXISTEN DIVERSAS EMPRESAS EN EL RUBRO, PERO MUY POCAS PRESTAN UN SERVICIO INTEGRAL COMO EL NUESTRO', 'SE TRATA DE MANTENER UNA FLUIDA Y EXTENSA RELACION CON PROVEEDORES DE LA ZONA , LOGRANDO DISMINUIR TIEMPOS DE ESPERA Y SOLICITANDO PRESUPUESTOS PARA BAJAR LOS COSTOS DIRECTOS', 'NO SE OBSERVAN RIESGOS EN EL PROYECTO', 'ADQUISICION DE UN CONTENEDOR DE 40 PIES, CONSTRUCCIÓN DE UNA PLANCHADA CON HORMIGON ELABORADO Y COMPRA DE HERRAMIENTAS NECESARIAS PARA LA INSTALACION DE UN TALLER PROPIO', 'DE PLANEA LA CONTRATACION DE UN NUEVO EMPLEADO PARA EL PROYECTO', 'GENERACION DE NUEVOS PUESTOS DE TRABAJO', 'LSO SERVICIOS OFRECIDOS COTIZAN EN DOLARES CON PRECIOS ESTABLES EN EL TIEMPO Y TENIENDO EN CUENTA LAS DISTANCIAS A RECORRER', 'SE CUENTA CON GRAN EXPERIENCIA EN EL RUBRO, CON UNA EMPRESA DE FAMILIA TRABAJNDO TODOS UNIDOS EN LOS PROYECTOS ASUMIDOS, UNA FLOTA DE UNIDADES NUEVAS Y LAS INSTALACIONES NECESARIAS PARA LLEVAR ADELANTE EL PROYECTO', 'AUMENTO CONSTANTE DE LA DEMANDA DE TRANSPORTE ENTRE ARGENTINA Y URUGUAY', 'NO POSEE', 'NO POSEE', '2021-09-03 12:25:42', '2021-09-03 13:38:56'),
(106, 729, 1650, 24, 1, 'NUEVO PROYECTO PARA LA COMPRA DE MATERIALES PARA LA FABRICACIóN DE PRODUCTOS DE METAL', 'Solicito este monto para la compra de materiales necesarios para la fabricación de carrocerías y otras estructuras de metal . Tales como:\r\nchapas de 1/4 de espesor\r\nchapas de 3/16 de espesor \r\nchapas negras número: 12,14,16,18\r\nchapas galvanizadas números: 18,20,22', '1400000.00', 0, 0, 'Nuestra empresa se dedica a la fabricación de productos metálicos, basándonos en eso, este proyecto nace con la necesidad de adquirir nuevos insumos, en mayor cantidad y variedad, para la realización de los mismos.', 'El objetivo principal es obtener una amplia variedad de materia prima; que nos permita el armado, terminación y colocación de las estructuras.', 'El monto solicitado presenta una gran oportunidad de crecimiento para la empresa y cumplir con  nuestros clientes de manera mas eficaz.', 'Actualmente la empresa no cuenta con el dinero necesario para invertir en nuevos insumos, es por eso que se solicita el monto de $1.400.000, para solventar los gastos de los mismos.', 'Spreafico Equipamientos nace con el fin de satisfacer las necesidades de los clientes, y como realización de un proyecto familiar.', 'Actualmente la empresa se dedica a la producción de estructuras metálicas, buscando crecer y superarse día a día.', 'Galpón, dónde se cuenta con las herramientas y capacitación adecuada para llevar a cabo el proceso productivo.', 'Lugar propio.', 'Chapas a medida.', 'Corte y armado de estructuras.', 'El proceso comienza con el armado de un presupuesto teniendo en cuenta lo que desea el cliente. Luego se procede a la compra del material, cortado y ensamblado de los mismos. El paso final es el pintado, primero con anticorrosivos y luego con pintura sintética si así lo requiere el cliente.', 'Se utilizan materias primas, tales como: chapas, fibra de vidrio,pinturas,aleaciones de hierro y aleaciones de aluminio.', 'Aunque los efluentes son mínimos, el lugar de trabajo cuenta con perfecto desahogo de los desechos.', 'A través de nuestro trabajo, buscamos satisfacer la necesidad de los clientes, teniendo en cuenta que la demanda de trabajo aumentó.', 'Contamos con clientes de empresas grandes (industriales, constructoras, etc.) y también clientes particulares.', 'Teniendo en cuenta que la demanda de trabajo aumentó, no hay real competencia.', 'Tenemos proveedores de distintos puntos de la provincia, pero la mayoría de nuestra ciudad.', 'No posee.', 'El monto solicitado será destinado para la compra de materiales e insumos para la fabricación de productos metálicos y a su vez, para la fabricación de plegados a terceros.', 'No cuenta con empleado en relación de dependencia, ya que es una empresa familiar.', 'Este proyecto impactaría de manera positiva, teniendo en cuenta que nos daría lugar para seguir creciendo como empresa, para ofrecer mejores productos a nuestros clientes.', 'El precio de los productos varía, teniendo en cuenta el volumen de materia prima ocupado para la fabricación del mismo.', 'Este proyecto nos serviría para afianzar nuestro vínculo, teniendo en cuenta que somos una empresa familiar, con ganas de seguir creciendo.', 'Teniendo en cuenta que la demanda de trabajo supera la oferta en nuestra ciudad, esta seria una gran oportunidad de crecer como\r\nempresa.', 'No posee.', 'No posee.', '2021-09-03 12:30:02', '2021-09-22 12:32:52'),
(107, 1482, 1495, 24, 1, 'PROYECTO PARA LA COMPRA DE INSUMOS AGRICOLAS Y MATERIALES PARA LA CONSTRUCCION.-', '1) OBTENCION DE FONDOS PARA LA COMPRA DE INSUMOS, AGROQUIMICOS, FERTILIZANTES Y SEMILLAS VINCULADOS DE MANERA DIRECTA A LA OBTENCION DE LOS PRODUCTOS AGRICOLAS (GRANOS DE TRIGO, SOJA Y MAIZ).-\r\n2) OBTENCION DE FONDOS PARA LA INVERSION/COMPRA DE MATERIALES Y DEMÁS NECESARIOS PARA LA CONSTRUCCION DE UN GALPON DESTINADO A LA PROTECCIÓN DE LOS BIENES DE USO AFECTADOS A LA ACTIVIDAD AGROPECUARIA.-', '1400000.00', 1, 0, 'EL PROYECTO CONSISTE EN ADQUIRIR PARTE DE LOS INSUMOS, AGROQUÍMICOS, FERTILIZANTES Y SEMILLAS NECESARIOS PARA PODER DESARROLLAR MI ACTIVIDAD DE PRODUCTOR AGROPECUARIO PARA LA CAMPAÑA DE SOJA/MAÍZ AÑO 2021/2022.-\r\nEL PROYECTO ADEMÁS INCLUYE LA ADQUISICIÓN DE MATERIALES Y DEMÁS NECESARIOS PARA LA CONSTRUCCIÓN DE UN GALPÓN DESTINADO A LA PROTECCIÓN DE LOS BIENES DE USO AFECTADOS A LA ACTIVIDAD AGROPECUARIA COMO ASÍ TAMBIÉN PARA DEPÓSITO DE LOS INSUMOS AGRÍCOLAS PROPIOS DE LA ACTIVIDAD.-', 'EL OBJETIVO FUNDAMENTAL ES, A TRAVÉS DE DICHO CRÉDITO, LOGRAR ADQUIRIR A PRECIOS DE CONTADO DICHOS INSUMOS INDISPENSABLES PARA EL DESARROLLO NORMAL DE MI ACTIVIDAD Y MATERIALES DE CONSTRUCCION PARA EL RESGUARDO DE INSUMOS Y MAQUINARIAS.-', 'LA OPORTUNIDAD ES PARA EL CORTO PLAZO YA QUE LOS INSUMOS AGRÍCOLAS PARA LA CAMPAÑA DE SOJA/MAÍZ AÑO 2021/2022 SE DEBEN ADQUIRIR EN ESTOS MESES DE SEPTIEMBRE 2021 Y OCTUBRE 2021 Y LAS INVERSIONES EN MATERIALES DE CONSTRUCCIÓN ES FUNDAMENTAL LLEVARLAS A CABO AHORA YA QUE LOS BIENES AL INTEMPERIE CORREN EL RIESGO DE AVERÍAS, DETERIOROS Y DEMÁS PROPIOS DE LAS INCLEMENCIAS DEL TIEMPO Y ADEMÁS DE SEGURIDAD PARA EVITAR ROBOS.-', 'SOY UN PEQUEÑO PRODUCTOR AGROPECUARIO QUE SIEMBRA GRANOS DE TRIGO, SOJA Y MAÍZ EN EL DEPARTAMENTO GUALEGUAYCHÚ, ESPECÍFICAMENTE EN LOS DISTRITOS DE TALITAS Y PEHUAJO SUD. ACTUALMENTE SEMBRÉ TRIGO CAMPAÑA 2021/2022, REALIZANDO TODAS LAS TAREAS PROPIAS DEL MANEJO DE SUELDOS Y CULTIVOS Y EN UNOS MESES SEMBRARÉ SOJA Y MAÍZ CAMPAÑA 2021/2022.-', 'SOY UNA EMPRESA UNIPERSONAL CON 8 AÑOS DE ANTIGUEDAD EN EL SECTOR DE GRANOS. CUENTO CON LA EXPERIENCIA DE HABER TRABAJADO EN RELACIÓN DE DEPENDENCIA EN LA EMPRESA TIERRA GREDA SA EN EL SECTOR DE MANEJO DE CULTIVOS Y ACTUALMENTE DESDE HACE 8 AÑOS COMO PRODUCTOR AGROPECUARIO INDEPENDIENTE CULTIVANDO GRANOS DE TRIGO, SOJA Y MAÍZ. CUENTO CON MAQUINARIA PROPIA PARA EL DESARROLLO DE MIS ACTIVIDADES AGRICOLAS. LOS ESTABLECIMIENTO DONDE DESARROLLO MIS ACTIVIDADES SON DE PROPIEDAD DE TERCEROS.-', 'EL PRESENTE ES PROMETEDOR PARA LOS CULTIVOS DE INVIERNO (TRIGO) PERO LA COMPLICACIÓN DE LA FALTA DE LLUVIAS EN ESTA REGIÓN GENERAN INCERTIDUMBRE RESPECTO A LOS RENDIMIENTOS DE LOS CULTIVOS TANTO PARA TRIGO COMO PARA SOJA Y MAÍZ.-', 'NO CUENTO CON ESTABLECIMIENTOS AGRÍCOLAS PROPIOS PARA EL DESARROLLO DE MIS ACTIVIDADES.-', '• CAMPO LA PANTERA - TALITAS - INICIO 01/06/2021 - VENCIM. 31/05/2022 - CARTA OFERTA ARREND.\r\n• CAMPO POCHO -  PEHUAJO SUD - INICIO 01/06/2021 - VENCIM. 31/05/2024 - CARTA OFERTA ARREND.\r\n• CAMPO SAN PEDRO - PEHUAJO SUD - INICIO 01/06/2021 -  VENCIM. 31/05/2024 - CARTA OFERTA ARREND.', 'LOS PRODUCTOS RESULTANTES DE MI ACTIVIDAD COMO PRODUCTOR AGROPECUARIO SON GRANOS DE TRIGO, SOJA Y MAÍZ QUE SON ENTREGADOS EN ACOPIOS PARA LUEGO SER COMERCIALIZADOS EN EL MERCADO INTERNO VIA INTERMEDIARIOS O CORREDORAS. SON PRODUCTOS PRIMARIOS OBTENIDOS DEL SUELO EN SU PRIMER ETAPA.-', 'PARA LA OBTENCIÓN DE DICHOS PRODUCTOS SE ADQUIEREN INSUMOS, AGROQUIMICOS, FERTILIZANTES Y SEMILLAS PROPIAS/FISCALIZADAS QUE HAN SIDO PROBADAS POR LAS EMPRESAS QUE OFRECEN DICHOS PRODUCTOS YA SEA CON NORMAS INTERNACIONALES O SEMILLEROS CON CERTIFICACIONES DE PRODUCTOS.-', 'LA DESCRIPCIÓN ES EN ETAPAS Y DEPENDERÁ SI SON CULTIVOS DE INVIERNO (TRIGO) O CULTIVOS DE VERANO (SOJA Y MAÍZ):\r\n1) PREPARACIÓN/ROTURACIÓN DEL SUELO.-\r\n2) SIEMBRA.-\r\n3) COSECHA/OBTENCIÓN DEL PRODUCTO FINAL GRANO DE TRIGO, SOJA Y MAÍZ.-', 'SON ESENCIALMENTE SEMILLAS, AGROQUÍMICOS, FERTILIZANTES, INSUMOS VARIOS.-', 'COMO SOY PRODUCTOR AGROPECUARIO Y OBTENGO UN PRODUCTO PRIMARIO EN SU PRIMER ETAPA NO HAY SUBPRODUCTOS, DESECHOS Y/O RESIDUOS.-', 'EL MERCADO QUE OPERO ES EL INTERNO NEGOCIANDO MI PRODUCCIÓN CON ACOPIOS DE LA ZONA DEL DEPARTAMENTO GUALEGUAYCHÚ. TAMBIÉN DEBIDO A CONTRATOS DE CANJE NEGOCIO PARTE DE MI PRODUCCIÓN CON EMPRESAS QUE ME PROVEEN PRODUCTOS AGRICOLAS CON REPRESENTANTES EN ENTRE RIOS.-', 'EL PRINCIPAL CLIENTE CON EL QUE OPERO ES TIERRA GREDA SA, QUE ES UN ACOPIO UBICADO EN LA LOCALIDAD DE LARROQUE, PROVINCIA DE ENTRE RÍOS. EL RESTO DE LOS CLIENTES SON EMPRESAS CON LAS CUALES LLEVO A CABO CONTRATOS DE CANJES DE INSUMOS POR GRANOS TAMBIÉN EN LA PROVINCIA DE ENTRE RÍOS.-', 'NO HAY COMPETIDORES DIRECTOS YA QUE HABLAMOS DE QUE LOS GRANOS ES UN PRODUCTO COMODITY, DE FÁCIL REALIZACIÓN/VENTA QUE  LOS OPERADORES NEGOCIAN CON EMPRESAS DEL MERCADO INTERNO Y CON EXPORTADORES.-', 'MIS PROVEEDORES SON LA MAYORIA DE LA PROVINCIA DE ENTRE RIOS (AGRO GESTION DEL LITORAL SA, LARROQUE CEREALES SRL, ENTRE OTROS) Y ALGUNOS PUNTUALES SON GRANDES EMPRESAS DEL SECTOR QUE TIENEN REPRESENTANTES EN TODAS LAS PROVINCIAS COMO LO SON MONSANTO ARG. SRL, BAYER SA, ENTRE OTROS.-', 'LOS RIESGOS EN ESTE TIPO DE ACTIVIDAD SON MUY ALTOS YA QUE SE DEPENDE DEL FACTOR CLIMÁTICO 100% SITUACIÓN QUE SIEMPRE GENERA INCERTIDUMBRE Y OBLIGA A REALIZAR ESTRATEGIAS ACORDES CON LA ÉPOCA/ESTACIÓN DEL AÑO PUNTUAL QUE SE TRATE Y SE CORRESPONDEN CON LAS SEQUÍAS E INUNDACIONES.-', 'EL DESTINO DEL MONTO SOLICITADO ES:\r\n• $500.000 PARA LA ADQUISICIÓN DE INSUMOS AGRÍCOLAS.-\r\n• $900.000 PARA LA ADQUISICIÓN DE MATERIALES DE CONSTRUCCIÓN.-', 'NO SE POSEE PERSONAL EN RELACIÓN DE DEPENDENCIA. EN CASO DE REQUERIR SE TERCERIZAN LOS SERVICIOS.-', 'EL IMPACTO ECONÓMICO Y SOCIAL ES QUE SI LA PRODUCCIÓN OBTENIDA CUMPLE LAS EXPECTATIVAS DE RENDIMIENTOS ESPERADOS ESTO GENERA EN LA ZONA MAYORES COMPRAS EN NEGOCIOS DE MATERIALES DE CONSTRUCCIÓN, MÁS REALIZACIONES DE CONSTRUCCIONES RESIDENCIALES, MAYOR CONSUMOS EN COMERCIOS AL POR MENOR DE INDUMENTARIA Y DE PRIMERA NECESIDAD ENTRE MUCHOS OTROS QUE SE PUEDEN INDICAR.-', 'LOS PRECIOS DE LOS PRODUCTOS ESTÁN DETERMINADOS POR LOS DIFERENTES MERCADOS GRANARIOS QUE OPERAN EN EL PAÍS YA SEA ROSARIO, BAHÍA BLANCA, BUENOS AIRES, ESPECIFICAMENTE DONDE ESTÁN LOS PUERTOS Y POR CONSIGUIENTE LAS EXPORTADORAS.-', 'CONTAR CON AMPLIA EXPERIENCIA EN MANEJOS DE CULTIVOS.-', 'MANEJOS DE PRECIOS DE CONTADO DE LOS INSUMOS AGRÍCOLAS CON PROVEEDORES FIELES, BUENA FINANCIACIÓN ACORDE A LAS EXIGENCIAS DEL SECTOR.-', 'NO SE POSEEN DEBILIDADES.-', 'INCLEMENCIAS CLIMÁTICAS (SEQUIA, INUNDACIONES, GRANIZO), DESEQUILIBRIO EN LOS MERCADOS DE GRANOS, ENTRE OTROS.-', '2021-09-03 18:54:37', '2022-06-07 15:34:09'),
(108, 385, 353, 24, 1, 'TAP ROOM DE FÁBRICA', 'Finalizar nuestro TapRoom interno, para poder ofrecer nuestros productos en el mismo lugar de elaboración, siguiendo con la tradición de las fábricas de cervezas como lugares de degustacion y turismo, asi también como la posibilidad de generar un espacio en el cual refleje nuestros valores, personalidad e identidad.', '380000.00', 1, 0, 'El crédito solicitado está orientado a finalizar las obras necesarias y realizar las mejoras para recibir público en la fábrica y poder brindar una oferta de nuestros productos en el mismo lugar de elaboración', 'Finalizar tap-room interno de la fábrica, donde además de las degustaciones y oferta de cerveza, los visitantes se puedan interiorizar y ver los procesos de elaboración, además de posibilitar los abrir un nuevo canal directo de comercialización.', 'Se convertiría en el primer Tap-room de la ciudad, además nos permite desarrollar el segmento de venta directa de nuestra producción lo que nos mejora la rentabilidad y nos permite tener un feedback más directo con los consumidores.', 'Actualmente el proyecto se encuentra avanzado, con toda la parte de producción de cerveza, ya terminada y habilitada, y el sector de bar/tap-room con un avance del 60%, faltando terminar obras de adecuación en los baños, frente del local, insonorización del interior, adquisición de mobiliario y obras finas de terminación.', 'Somos una Pyme de la localidad de Paraná, que desde 2017 elaboramos Cerveza de forma independiente, con acento en la calidad y estabilidad del producto, apostamos a la producción regional y vincularnos con nuestra comunidad de forma responsable, la empresa esta conformada por dos socios, que comenzamos a comercializar cerveza en pequeña escala y durante 2019 logramos a mudarnos a una locación mas amplia y aumentar la producción', 'Actualmente nos encontramos en producción activa, con habilitación municipal para la elaboración de Cerveza y abasteciendo a bares y comercios de la región, empezando a tramitar la habilitación nacional para poder expandirnos y llegar a otras provincias, con las dificultades y problemáticas propias de todas las pymes argentinas que tuvimos que atravesar la pandemia, pero con un esperanzador objetivo a futuro de aumentar la producción y diversificar los canales de venta.', 'Planta de elaboración Dr. Alejandro Gesino 104, Parana, ER', 'Desde 2019 estamos alquilando un inmueble (Galpón) de 300mt2 en que 100mt2 están destinados al sector de producción de cerveza, y 200mt2 están destinados a oficinas, baños y sector de tap-room, el mismo se encuentra ubicado en la zona sur de Parana (Dr. Alejandro Gesino 104).', 'Elaboramos Cerveza en diversos estilos (4 fijos y aprox. 5 rotativos de estación) los mismos se comercializan en barriles principalmente a bares o pubs de Paraná y zona, además contamos con un local propio en Villa libertador San Martín, ER. Donde realizamos recargas de growlers  y venta directa.', 'Somos una empresa que trabaja y tienen todos sus sistemas en la nube, utilizamos software libre para todas las áreas de gestión, nuestra planta es totalmente de acero inoxidable de grado sanitario tanto el sector de cocción como de fermentación, y disponemos de control de frió automatizado.', 'La Cerveza es un fermentado, se muele la Cebada malteada y los adjuntos, luego se macera para extraer azúcares, se hierve y adiciona lúpulo, finalmente ese mosto se enfría y se fermenta a temperatura controlada.\r\nLa totalidad del proceso lleva entre 2 y 4 semanas aproximadamente', 'Principalmente Cebada Malteada, Lúpulo y Levadura, Argentina es productor líder de Cebada Cervecera a nivel mundial, el lúpulo también es producido en el país, mientras que la levadura (Saccharomyces cerevisiae) también es producida en el país, pero principalmente se utilizan cepas importadas.', 'Limpieza de barriles en los cuales se envasa la cerveza, los productos, procesos y protocolos, al ser todo de inoxidable son los mismos que los utilizados en la industria láctea, el desecho principal es el bagazo Cervecero (grano húmedo de desecho) que va a una granja de porcinos como alimento.', 'Actualmente existe una amplia demanda de Cerveza independiente en todo el país, y puntualmente en la ciudad de Parana, se instalaron bares y comercios especializados, como así también ferias y eventos que refuerzan y aumentan el conocimiento y demanda del producto por parte de los consumidores, entendemos que existe margen para seguir ese crecimiento y aumentar la cuota de consumo, en esa dirección se dirige este proyecto.', 'Apuntamos a consumidores que gustan del producto y tienen un conocimiento intermedio del la Cerveza Artesanal, la posibilidad de ir a probar cerveza en el mismo lugar de producción y conocer los procesos in situ, es un plus que para quienes gustan de estos productos resulta un atractivo que refuerza la experiencia.', 'En este momento no hay tap-rooms en la ciudad, de todos modos no vemos como competencia directa a otras cervecerías, ya que entendemos que la cuota de mercado de la cerveza artesanal dentro del consumo total de cerveza, tiene un margen muy importante todavía para crecer, en nuestro proyecto está contemplado tener \"Canillas Invitadas\" con otros productores de la zona, para reforzar el concepto de la calidad de cerveza regional y la diversidad de opciones que existen en la zona.', 'Actualmente disponemos de una cadena de proveedores consolidada y estable, lo que nos permite tener estabilidad en la producción, de los proveedores con los que actualmente trabajamos, el principal es el el distribuidor zonal de insumos de cerveza (Almacén Cervecero) y otros insumos lo manejamos directamente con importadores de insumos.', 'El mayor riesgo corresponde a la zona de emplazamiento, (zona sur de la ciudad de Parana) que si bien gracias al nuevo acceso realizado en 2019 tiene una mayor conexión con el centro de la ciudad, no es una zona comercial totalmente desarrollada, Para trabajar sobre esto, incluye contar con espectáculos en vivo y gastronomía invitada, como una forma de mejorar la comunicación y conformar una oferta mas atractiva.', 'El Destino del Crédito se utilizara para poder finalizar las obras en el espacio del tap-room (adecuación de baños, pintura, isonorizacion, etc) y comprar el los muebles necesarios para poder acomodar a los visitantes.', 'Durante las obras se emplean 3 personas para realizarlas, y luego con el tap-room en funcionamiento, se prevee la incorporación de 2 personas de forma estable para atenderlo.', 'Entendemos que este proyecto ayuda a dinamizar la zona y aumenta la oferta gastronómica y comercial, en una zona de la ciudad que actualmente se esta conformando con un aumento de población y construcción de nuevas casas y loteos, ademas tenemos como prioridad vincularnos con la comunidad a traves de las vecinales y realizar acciones y eventos que permitan realizar mejoras en la zona.', 'El monto solicitado cubre aproximadamente un 40% del proyecto, ya que los presupuestos con los que contamos a la fecha, son de $220.00 pesos en mobiliario y aproximadamente $450.000 pesos en obras civiles y materiales para terminar el lugar.', '- Conocimiento del mercado\r\n- Producto ya instalado\r\n- Obras con un avance del 60%\r\n- Bajos Costos fijos ya que se cubren desde el sector de producción.', '- Primer Tap-room de la ciudad\r\n- Vinculación con el sector gastronómico\r\n- Mejora de la rentabilidad por venta directa.', '- Lugar de emplazamiento a desarrollar\r\n- Disminuye la cantidad de horas que la el área de producción esta en funcionamiento ya que el tap-room funciona a contraturno del momento de elaboración de Cerveza.\r\n- Requiere adecuar la fabrica para recibir visitas y armar recorridos.', '- Algunos estilos de cerveza están atados a la variación del dólar.\r\n- Posibilidad que el sector gastronómico tenga un nuevo cierre por cuestiones sanitarias debido a nuevas cepas.', '2021-09-10 15:17:58', '2021-09-13 11:29:29'),
(110, 646, 617, 24, 1, 'GASA HIDRóFILA TUBULAR Y TROZADA', 'Este nuevo proyecto, se basa, en satisfacer la demanda del área de la salud ,como lo venimos haciendo con la indumentaria de bioseguridad , tratando de cubrir una nueva gran demanda a corto plazo que son las cirugías postergadas por la pandemia en las cuales es indispensable el uso de gasa hidrófila 24/1 tanto en cirugía como ,curaciones de todo tipo, además fortalecernos y enfocarnos a largo plazo en cubrir esa demanda constante en sanatorios ,clínicas y hospitales con carencia de oferta local', '1400000.00', 1, 1, 'ACTUALMENTE REALIZAMOS INDUMENTARIA DESCARTABLE , QUEREMOS ANEXAR A NUESTRA PRODUCCION LA GASA HIDROFILA , PARA ELLO NECESITAMOS UNA INVERSION EN MATERIA PRIMA (GASA HIDROFILA X KG) , ADEMAS DE UNA CORTADORA MINICUTTER ,  UNA MESA ADAPTADA CON BALANZA Y RIELES PARA EL TENDIDO DE GASA , CON LA INYECCION DE CAPITAL EN  4 SEMANAS LOGRAREMOS PONER EN MARCHA UNA PRODUCCION OPTIMA.', 'COMPRAR MATERIA PRIMA : GASA HIDROFILA HILADO 24/1 TRAMA CERRADA POR KILO PRODUCIRLA Y DESTINAR LA GANANCIA 80% PARA COMPRAR MAS GASA Y 20% A PRODUCCION POR LO MENOS HASTA LLEGAR AL OBJETIVO DESEADO QUE ES 3000 KG DE GASA HIDROFILA MENSUAL , UNA VEZ ALCANZADO ESE MONTO LAS GANANCIAS IRAN DESTINADAS A LA COMPRA DE UN TERRENO EN EL PARQUE INDUSTRIAL DE CRESPO, DONDE ACENTAREMOS UNA FUTURA FABRICA DE INFRAESTRUCTURA PROPIA , DONDE CUMPLIREMOS CON LAS NORMAS EXIGIDAS PARA LOS DESECHOS DE LA FABRICA', 'AUMENTAR PRODUCCION PARA EXPANDIR MAS EL NEGOCIO A NUEVOS CLIENTES ,IMPLEMENTAR LA GASA HIDROFILA EN EL MERCADO DEL CENTRO Y NORTE DE LA REPUBLICA DONDE EXISTE MUCHA DEMANDA Y POCOS OFERENTES  , Y NOSOTROS CON UN ESTUDIO DE MERCADO LOGRAMOS MEJORAR CALIDAD Y PRECIO, PROYECTANDO A LARGO PLAZO PODER LLEGAR A FABRICAR NUESTRA PROPIA GASA EN UNA FABRICA EN EL PARQUE INDUSTRIAL , DONDE LA HUBICACION ES NECESARIA POR LOS DESECHOS QUIMICOS.', 'ACTUALMENTE NOS ENCONTRAMOS EN FUERTE CRECIMIENTO , HEMOS REALIZADO UN ESTUDIO DE MERCADO MEJORANDO NOTABLEMENTE CON NUESTROS PRODUCTOS LA CALIDAD Y PRECIOS DEL DESCARTABLE, GANANDO ASI CLIENTES POTENCIALES. INICIALMENTE POR RECOMENDACIONES, LUEGO CON VISITAS PRESENCIALES MEJORANDO ASI LA RELACION, PREVIAMENTE NOS PREPARAMOS CON UN CURSO DE MARKETING ,QUE JUNTO CON LOS CERTIFICADOS DE CALIDAD  DE VALIDEZ INTERNACIONAL DE NUESTRO SMS,LOGRAMOS UN GRAN CRECIMIENTO DURANTE LA PANDEMIA', 'EMPEZAMOS EN OCTUBRE DEL 2019 , EN EL GARAGE CON 1000 METROS DE SMS , UNA CORTADORA Y UNA OVERLOCK QUE HABIAMOS PODIDO COMPRAR CON LA VENTA DE UN VEHICULO QUE TENIAMOS , YA QUE VIMOS QUE ERA ALGO QUE SE NECESITABA FABRICAR Y TENER FUERTES FABRICANTES EN LA PROVINCIA PARA PODER ABASTECER A ENTRE RIOS INICIALMENTE Y LUEGO EXPANDIR, AL MES PUDIMOS COMPRAR MAS MATERIA PRIMA Y PODER ALQUILAR UN GALPON, COMPRAR UNA MESA DE TENDIDO DE 10 METROS Y EMPEZAR A MAS ALTA ESCALA.', 'ACTUALMENTE NOS MUDAMOS A OTRO LOCAL EL CUAL FUE VISITADO POR USTEDES , DONDE HAY MEJORES INSTALACIONES , CONTAMOS CON 5 MAQUINAS OVERLOCK , UN PROMEDIO DE 20.000 METROS DE SMS , UNA CARTELERA DE CLIENTES FIJOS SEMANAL , QUINCENAL Y MENSUALMENTE , PROYECTAMOS PODER EMPEZAR CON EL PROCESO DE GASA A CORTO PLAZO Y A LARGO PLAZO PODER FABRICAR NUESTRA PROPIA MATERIA PRIMA Y TENER UNA INFRAESTRUCTURA PROPIA EN EL PARQUE INDUSTRIAL DONDE ES INDISPENSABLE POR LOS DESECHOS DE LA FABRICACION DE LA GASA', 'NO CONTAMOS CON LUGAR PROPIO  , ALQUILAMOS UN LUGAR ADECUADO.', 'ACTUALMENTE ESTAMOS HACE 1 AÑO EN CALLE ANA MONTI 1630 , NOS MUDAMOS A ESTE LUGAR DONDE TENEMOS BUENA ILUMINACION NATURAL , CIELORRRAZO DE DURLOCK , PISO CERAMICO, PAREDES REVOCADAS Y PINTADAS , BAÑO EQUIPADO Y SALIDA DE EMERGENCIA , HACIENDO ASI UN LUGAR MAS HIGIENICO Y ADECUADO.', 'TENDIDO GASA TUBULAR: CONTROL DE PESO DE ROLLO, COLGADO,TENDIDO, CORTADO, PESADO, EMPAQUETADO, EMBALADO\r\nTENDIDO GASA RECTO: CONTROL DE PESO DE ROLLO, COLGADO,TENDIDO,MARCADO, CORTADO, PESADO, EMPAQUETADO, EMBALADO\r\nVENDAS CAMBRIC: CONTROL DE PESO DE ROLLO, COLGADO,TENDIDO,MARCADO, CORTADO , BOBINADO', 'APORTAR EQUIPAMIENTO DE BIOSEGURIDAD PARA PATOLOGIAS EN ESTUDIO , HACIENDO KIT CERRADOS EN UNA COMBINACION DE NUESTROS PRODUCTOS INDUMENTARIA / GASA', 'GASA TUBULAR Y TROZADA: TENDIDO, PESADO POR KILOS PEDIDOS, EMPAQUETADO, EMBALADO. \r\nVENDAS: TENDIDO, CORTADO, BOBINADO, PESADO POR KILOS PEDIDOS , EMPAQUETADO , EMBALADO', 'VAMOS A TRABAJAR CON HILADO 24/1 SUPER CARDADO Y 30/1 SUPER CARDADO PURGADO,LA GASA HIDROFILA ES  UN TEJIDO DE PUNTO,NO DEBE TENER MENOS DE 10 HILOS POR CM DE URDIMBRE Y NO MENOS DE 6 HILOS POR TRAMA ,TENIENDO ASI UNA BAJA CALIDAD DE 16/1 , NUESTRA MATERIA PRIMA SUPERA ESA TRAMA DANDOLE MAS UTILIDAD', 'NOSOTROS VAMOS A DIVIDIR LAS AREAS DE INDUMENTARIA DE BIOSEGURIDAD CON LA DE GASA,LA GASA VAMOS A PROCESAR  SU FRACCIONAMIENTO,POR EL MOMENTO NO LA FABRICAMOS,ASI QUE NO GENERA NI DESECHOS , NI RESIDUOS , SOLAMENTE EL CARTON DONDE VIENE BOBINADO EL ROLLO,QUE JUNTO CON LOS DEL OTRO AREA SON VENDIDOS', 'ES UN MERCADO ESTABLE , CON CLIENTES COMO DROGUERIAS , CLINICAS, SANATORIOS Y HOSPITALES A NIVEL NACIONAL, QUE LO HACE ESTABLE ECONOMICAMENTE Y EN CONSTANTE CRECIMIENTO, CON VENTAS QUE RONDAN ARRIBA DE LOS 3000 KILOS DE GASA MENSUALES , ADEMAS DE LAS VENTAS DE INDUMENTARIA DE BIOSEGURIDAD.', 'DROGUERIAS, CLINICAS Y SANATORIOS, CON ESTABLECIMIENTO PROPIO Y ALTO NIVEL SOCIO ECONOMICO ESTABLE DEL SECTOR PRIVADO EN EL AREA DE LA SALUD, HOSPITALES DE LA SALUD PUBLICA DEPENDIENTE DEL ESTADO, MAYORMENTE DE GRAN AMPLIA TRAYECTORIA EN LO PUBLICO Y LO PRIVADO , CON UN EXELENTE NIVEL CREDITICIO , EN UN MERCADO DONDE ESO ES MUY IMPORTANTE PARA TENER CREDIBILIDAD PARA TRABAJAR CON VALORES.', 'A NIVEL PAIS CONTAMOS CON 3 GRANDES COMPETIDORES , ESTAN HUBICADOS EN BUENOS AIRES SON FABRICAS Y DISTRIBUYEN A DISTRIBUIDORES , A NIVEL PROVINCIAL NO TENEMOS COMPETENCIA EN EL MERCADO.', 'NUESTRO PROVEEDOR ES UNA FABRICA DE GASA QUE NOS VENDE LOS ROLLOS CERRADOS SIN FRACCIONAR , NO VENDEN AL PRIVADO , SON PROVEEDORES DIRECTOS  DEL ESTADO EN BS AS , PERO COMPRARON OTRA MAQUINA Y TIENEN ESA PRODUCCION DISPONIBLE LA CUAL A TRAVEZ DE UNA REUNION Y PRONTO CONTRATO ESTARA DESTINADA A NOSOTROS.', 'LOS RIESGOS SON LOS DISTRIBUIDORES DE ESAS 3 MARCAS IMPORTANTES , NUESTRA ESTRATEGIA ES COMPRAR EL ROLLO CERRADO DIRECTO DE FABRICA  Y FRACCIONARLO , VENDERLO SIN INTERMEDIARIOS AL CONSUMIDOR FINAL , ADEMAS DE HACER UN COMBO DE PRECIO A NUESTROS CLIENTES JUNTO CON LA INDUMENTARIA DE BIOSEGURIDAD.', 'VAMOS A DESTINAR $80.000 EN UNA MESA  CON RIELES ESPECIALES Y UNA BALANZA ELECTRONICA  PARA GASA HIDROFILA, $20.000 EN UNA MINICUTTER ELECTRICA PARA CORTAR GASA TROZADA, $100.000 PARA UNA SELLADORA CONTINUA INDUSTRIAL, $1.200.000  COMPRAR 1300 KILOS DE PLANO HILADO 24/1 TRAMA CERRADA .', 'VAMOS A TOMAR INICIALMENTE 2 PERSONAS 1 PARA PRODUCCION DE GASA Y 1 PARA PRODUCCION DE DESCARTABLES , UNA VEZ ENTRENADAS ESAS 2 PERSONAS , VAMOS A DEDICANOS DE LLENO A LA VENTA ONLINE Y PRESENCIAL , AHI VAMOS A TOMAR 2 PERSONAS MAS PARA PRODUCCION QUE VAN A SER ENTRENADAS POR LAS 2 ANTERIORES.', 'GENERAR PUESTOS LABORALES EN CORTO , MEDIANO Y LARGO PLAZO, PUESTOS DE TRABAJO FIJO Y ESTABLE  , ABASTECIMIENTO DE INSUMOS NECESARIOS PARA LA SALUD PUBLICA Y PRIVADA , LOS PUESTOS LABORALES VAN A SER ENFOCADOS MUJERES Y PERSONAS LGBT , YA QUE CREEMOS QUE ES UN SECTOR DE LA SOCIEDAD QUE NECESITA OFERTA DE TRABAJO Y PONDRAN MAYOR ENFASIS EN NUESTRO CREMIENTO EN CONJUNTO COMO PYME', 'GASA TUBULAR: $1200 MARGEN DE GANACIA $300 POR KILO\r\nGASA  TROZADA :$1300 MARGEN DE GANANCIA $400 POR KILO\r\nVENDA CAMBRIC 50 UNIDADES : $1300 MARGEN DE GANANCIA $400 POR KILO', 'NUESTRAS FORTALEZA ES LA CALIDAD , UNA CALIDAD CERTIFICADA , ADEMAS DEL PRECIO COMPETITIVO, LA CAPACITACION CONSTANTE PARA MEJORAR CADA DETALLE EN NUESTROS PRODUCTOS , PARA PODER MEJORAR LAS VENTAS Y EL SISTEMA INFORMATICO QUE NOS PERMITE UNA MEJOR ORGANIZACION , TIRANDO DATOS DIARIAMENTE  DE STOCK, MATERIA PRIMA, COTIZACIONES REALIZADAS, GANADAS Y PERDIDAS.', 'NUESTRAS OPORTUNIDADES ESTAN EN ESTOS TIEMPOS DE PANDEMIA PARA CRECER YA QUE SOMOS INDISPENSABLES , ADEMAS NUESTRA IDEA ES EXPORTAR A LARGO PLAZO , HEMOS AVERIGUADO PARA PODER ACCEDER A UN LOTE PROPIO EN EL PARQUE INDUSTRIAL QUE SERA UNA GRAN OPORTUNIDAD DE CRECIMIENTO A FUTURO , YA QUE NUESTRA IDEA ES A LARGO PLAZO FABRICAR NUESTRA PROPIA GASA , SIENDO ASI LA UNICA FABRICA DE GASA DEL INTERIOR.', 'NUESTRA DEBILIDAD ES QUE PARA ANEXAR LA GASA A NUESTROS PRODUCTOS TENEMOS QUE COMPRAR 200 KG PARA MUESTRAS ASI GANAR CLIENTES Y ADEMAS TENEMOS QUE TENER 1000 KG PARA LA DEMANDA MINIMA,NUESTRAS ACTUALES GANANCIAS ESTAN DESTINADAS EN EFECTIVO A GASTOS FIJOS Y LOS VALORES A MEJORAMIENTO DE PRODUCCION (DESCARTABLES) Y PARA SOLVENTAR AUMENTOS DE MATERIA PRIMA Y NO CONTAMOS CON LOS FONDOS SUFICIENTES PARA LANZAR LAS GASAS Y CUMPLIR CON LA DEMANDA, LO SOLUCIONARIAMOS A CORTO PLAZO CON SU FINANCIAMIENTO', 'UNA AMENAZA QUE TENEMOS SON GASAS QUE PROVIENEN DE CHINA , POR SU BAJO COSTO EN EL MERCADO , AUNQUE ASI COMO SU COSTO ES BAJO SU CALIDAD ES MALA Y ES UNA AMENAZA QUE ES FUERTE SOLO ALGUNOS CLIENTES CON BAJOS RECURSOS, ADEMAS DE NUESTRA COMPETENCIA NACIONAL, LO SOLUCIONAREMOS ARMANDO UNA OFERTA CON NUESTROS 2 PRODUTOS INDUMENTARIA DESCARTABLE Y GASAS,ASI REDUCIREMOS NUESTRA GANANCIAS EN FORMA INDIVIDUAL DE CADA PRODUCTO , PERO CRECERAN NUESTRAS GANANCIAS GENERALES POR LA FLUIDEZ DE LA DEMANDA', '2021-09-22 11:22:56', '2022-06-08 12:21:36'),
(111, 1469, 1667, 19, 1, 'CAPITAL DE TRABAJO PARA FINANCIAR 1ER ETAPA DE PRODUCCIóN DE NUEVO PRODUCTO', 'Hoy hay grave situación sanitaria en la avicultura en zona Río Uuruguay, por la Hepatitis aviar en aves de engorde que está causando graves pérdidas. El 10% de los habitantes de esta zona dependen económicamente en forma directa de esta producción. ¿Cómo se puede solucionar? Previniendo la enfermedad vacunando. La vacuna ya está desarrollada por INMUNER y ya ha sido probada a campo con resultados satisfactorios. Se necesita capital de trabajo para la 1er etapa de la producción de esta vacuna.', '2000000.00', 0, 0, 'Desde inicios del 2021, el virus de la Hepatitis está castigando la producción avícola de la zona, provocando elevada mortandad en los lotes de aves de engorde y baja ganancia de peso. A solicitud de productores locales, Inmuner ha desarrollado una vacuna contra esta enfermedad, con cepas aisladas localmente. Ya desarrollado el producto y efectuadas las comprobaciones del mismo a campo, es necesario el capital de trabajo para poner en marcha la producción de vacunas para uso comercial.', 'Asistir con el capital de trabajo la producción de 15 millones de dosis de vacunas inactivadas contra la Hepatitis aviar. (primera etapa de produccion)\r\nEsta vacuna esta prevista que sea vendida en un periodo de 6 meses.', 'Esta oportunidad de asistir a las grandes empresas productoras avícolas locales significa poder brindarles respuesta para lograr la prevención de esta enfermedad que está  provocando graves pérdidas. Actuar rápidamente demostrando que localmente existe ciencia y tecnología en este campo; que el país está capacitado y hay habilidades, fortaleciendo de esta manera el sector en el plano sanitario y revalorizando la producción nacional de estas vacunas que buscan sustituir importaciones.', 'Esta oportunidad de asistir a las grandes empresas productoras avícolas locales significa poder brindarles respuesta para lograr la prevención de esta enfermedad que está  provocando graves pérdidas. Actuar rápidamente demostrando que localmente existe ciencia y tecnología en este campo; que el país está capacitado y hay habilidades, fortaleciendo de esta manera el sector en el plano sanitario y revalorizando la producción nacional de estas vacunas que buscan sustituir importaciones.', 'Fundado en 1972. Inicia actividad como centro de diagnóstico especializándose exclusivamente en el estudio de enfermedades aviarias. Produce sus primeras vacunas en 1974. Hoy posee 3 plantas de producción, con un equipo de operarios calificados y profesionales especializados, ofreciendo una amplia línea de biológicos. Con propia producción de Aves S.P.F., única a nivel nacional, que es materia prima fundamental para la elaboración de vacunas aviarias.', 'La investigación y el desarrollo son eje fundamental y razón de su existencia. Las vacunas que hoy Inmuner produce son de propio desarrollo, como así también los servicios que brinda. Estos desarrollos se han transfiriendo en carácter de exportación de tecnología a Europa.', 'Concepción del Uruguay - Provincia de Entre Ríos. Es una de las zonas que concentra la mayor producción avícola de la Argentina.', 'No', 'Cultivos vacunales para la inmunización activa y prevención de la enfermedad de las aves de corral, prevenibles por la acción de las cepas de Adenovirus aviar (AdV) Tipo 1 serotipo 8b (Genotipo C) y de Adenovirus aviar (AdV) Tipo 1 serotipo 11 (Genotipo D).\r\nLa vacuna es inactivada. Emulsión oleosa.', 'Esta vacuna conlleva toda la tecnología ya desarrollada por INMUNER para la producción de vacunas inactivadas. Ha sido desarrollada a partir del virus actuantes a campo en la zona del Rìo Uruguay, éste fue aislado y transformado en cepa vacunal, identificada por biología molecular PCR - RT/PCR.', 'En general constan de una etapa de SIEMBRA (obtención del medio de cultivo / inoculación del agente patógeno) - COSECHA - INACTIVACION (según la línea de vacunas) - ENVASADO - LIOFILIZACIÓN (Según la línea de vacunas) - TERMINACIÓN (precintado, etiquetado, packaging)  -', 'La fundamental son las aves SPF (libres de patógenos específicos) y las cepas. Las aves SPF son de propia producción y de estas se obtiene el medio puro para la siembra del agente patógeno. Las cepas contienen el agente patógeno, obtenidas a partir de aislamientos a campo realizados por Inmuner.', 'Líquidos: por limpieza; sanitarios; producto defectuoso.\r\nAtmosféricas: vapor de autoclaves y CO2 por mecheros.\r\nSólidos: aves muertas (residuo biopatogénico) y otros generales (residuos sólidos urbanos).\r\nNinguno de ellos genera impacto significativo al ambiente. \r\n(Auditoria Amb. Planta 2)', 'El mercado lo componen los productores avícolas. \r\n1- Crianza de reproductoras pesadas.  - En  Argentina 8 millones\r\n2- Producción de aves de postura. - En Argentina 14 millones \r\n3- Producción de aves de carne (parrilleros) - En Argentina: 720 millones anuales', 'Los clientes son :\r\n- empresas productoras de aves de engorde \r\n- empresasa productoras de huevos para consumo\r\n- cabañas que crían reproductoras pesadas para vender el huevo a los productores de aves de engorde\r\n- cabañas que crían reproductoras liviana para vender el huevo a los productores de huevos de consumo', 'El 90% de las vacunas la venden laboratorios extranjeros con presencia en todo el mundo que poseen línea completa de vacunas a saber: MSD, CEVA y Behringer y otros laboratorios europeos como Hipra.\r\nEn cuanto a los laboratorios nacionales, además de Inmuner existe un en ciudad de La Plata que -a diferencia de Inmuner- no produce vacunas a virus vivo.', 'Nuestros proveedores son todos nacionales y nos proveen envases (frasco, tapón precinto, etiquetas), e insumos como estabilizantes, excipientes y adyuvantes.', 'No se avizora riesgo alguno.', 'El monto que se solicita será aplicado a la compra de envases, excipientes adyuvantes  para la producción de vacunas contra Hepatitis; en una 1er etapa prevista de 15 millones de dosis. Precisamente: 6.000 frascos y sus correspondientes etiquetas - 6.000 tapones - 6.000 precintos - 1500 litros de vaselina líquida - El arancel de senasa correspondiente a la aprobación para comercialización - Los servicios a campo de seguimiento post vacunación.', 'En Inmuner trabajan 30 personas. Entre ellos profesionales, técnicos y operarios calificados. \r\nEntre los profesionales hay médicos veterinarios, farmacéutico, bioquímico, licenciados en biología. \r\nLos operarios calificados poseen secundario aprobado y se han formado en la producción de vacunas aviarias en Laboratorios Inmuner:  el 30% tiene  más de 15 años de antigüedad (llegando hasta 30 años algunos de ellos),  el 20% posee antigüedad de más de 5 años y hasta 15 años .', 'Esta enfermedad de Hepatitis que hoy azota la producción avícola de la zona del Río Uruguay principalmente, está produciendo graves pérdidas. Actualmente el 10% de los habitantes del Departamento Uruguay- Pcia de Entre Ríos viven directamente de esta producción, además del empleo indirecto que genera que lo septuplica.\r\nCon esta vacuna se busca prevenir la enfermedad y recobrar los parámetros productivos estándar, evitando las cuantiosas pérdidas económicas que produce.', 'Este producto tiene un precio de 1.670 $ al productor cada 1.000 aves que se vacunan. \r\nEste proyecto apunta a la producción de 15 millones de dosis, o sea que sería un total de 25.050.000 $.', 'Vacuna ya desarrollada con Cepa específica para los desafíos de campo.\r\nAbastecimiento de insumos asegurado.\r\nKnow How, infraestructura disponible y recursos humanos especializados.\r\nServicio post venta a medida de las necesidades.', 'Hoy hay una enfermedad que está deteriorando gravemente los resultados de la producción avícola.', 'Recursos financieros limitados.', 'La aparición de productos competidores.', '2021-09-22 14:51:30', '2021-10-22 13:02:40'),
(114, 1049, 1022, 24, 1, 'IMPRESORA DIGITAL TEXTIL UVJET TANGO TX INDUSTRIA ARGENTINA', 'El emprendimiento esta conformado por mi hija y yo que soy diseñadora de indumentaria y textil nos dedicamos a la confeccion de uniformes basicamente escolares y debido al efecto pandemico tuve que ayornar mi emprendimiento agregando la confeccion de blanqueria, ambos y tapabocas sublimados.', '980000.00', 1, 1, 'La adquisicion de la estampadora podría ayudar a independizarnos porque tercerizamos la parte de estampados lo que hace que muchas veces no lleguemos con los tiempos de entrega ya que nuestro proveedor de estampado muchas veces no llega con los tiempos establecidos y eso hace que nuestro trabajo se vea opacado por depender de otra persona.', 'La idea de adquirir estas herramientas de trabajo nos afianzaría en el mercado pudiendo tener la posibilidad de mejorar en nuestros tiempos de entrega y poder realizar libre diseños ya que al depender de un tercero te limita a la cantidad por diseño lo que vuelve a opacar nuestra labor como emprendedoras', 'acortar los plazos de entrega de nuestros trabajos, tener libertad en la ejecución de diseño, calidad, mejor precio.', 'En este momento estamos confeccionando y cortando nuestras prendas y tercerizando nuestros estampados', 'Mi idea como diseñadora fue realizar diseños infantiles pero la realidad economica me fue llevando a realizar uniformes escolares que es  lo que demandaba mi clientela y ahora me dedico basicamente a eso, efecto pandemia fui agregando productos textiles como remeras básicas, ambos y blanquería.', 'La realidad actual confeccionando uniformes escolares para escuelas locales de la zona metropolitana y alrededores también confeccionando ambos tapabocas para los consultorios de la zona San Benito y Colonia Avellaneda.', 'San Benito calle Concordia 1488-1494 (esta habilitado así por la municipalidad tiene dos puertas pero una se usa como vidriera)', 'EL local lo tenemos por tres años en comodato porque con la pandemia nos mudamos cerca de nuestro domicilio y arreglamos pintamos el local y el dueño nos cedio por tres años en comodato para en un futuro alquilarlo es un local con frente, baño , y lugar donde tenemos los maquinas de coser y mesa de', 'remeras de algodon,  chombas de algodon y pique,  pantalones de alpacuna y deportivo, gabardina,  polleras de alpacuna camperas de polar, deportivos y algodon, buzo de algodon y deportivo, chaleco deportivo de polar', 'tecnologia los sofwares que se emplean para diseñar los logos institucionales o comerciales', 'Se genera el molde de la prenda, se presenta el plano de corte, se corta, se confecciona y luego se estampa o borda . Se realiza un control de calidad y envasando.', 'se emplea algodon con un porcentaje de un 30% de poliester para que no encoja,  en el pique también se contempla esta composición, se utiliza para la ropa de gimnasia escolar poliester al 100 % para maximizar su calidad en el tiempo de uso requerido por el niño-joven para que su prenda sea perdurabl', 'en cuanto al corte se desechan retazos de tela pero estoy en contacto con varios artesanos y personas que se dedican al rescate de mascotas por lo tanto nada se desecha ni contamina el medio ambiente ya que todo es reutilizado por estas personas tanto para hacer artesanias o cuchas.', 'El mercado esta determinado por la demanda escolar principalmente, de nuestra parte ofrecer la mejor calidad a un precio acorde y razonable\r\ntambién al agregar ambos para medicos y enfermeras y la parte de delantales para cocina y ordenanzas de las escuelas', 'padrxs de niños escolares principalmente,   medicxs, enfermerxs, ordenanzxs, cocinerxs, microemprendedorxs que quieran su remera con el logo o su tapabocas con su logo y  ahora para el dia de la madre estamos confeccionando turbantes y toallas toda esa línea.', 'confeccionistas que puedan lograr realizar el circulo completo de corte confeccion y estampado de las prendas y excelente atención al cliente', 'vendedores de telas y herramientas textiles  de Paraná, Rosario, Bs As', 'riesgos pasar un largo tiempo sin conseguir materia prima, o que se rompa una maquina y no conseguir respuesto, estrategia de superación conseguir alternativa en la materia prima y conseguir un herrero capaz de implementar la parte de la maquina para darle solución .', 'impresora digital textil uvjet tango tx industria argentina', 'mi hija Belen', 'el impacto económico y social es que podamos realizar el circulo completo de producción para maximizar la calidad, precio y tiempo de entrega de nuestros productos', 'el precio que se establece es acorde a la calidad, confección, logo, talle, tela', 'calidad en las telas   confección  atención al cliente también estuvimos atentas con la pandemia de acercar al domicilio las prendas nos capacitamos en el manejo de redes y prestamos mucha atención a lo que el cliente necesita en cuanto  a la prenda nos familiarizamos con nuestros clientes.', 'poder ofrecer en cuanto al estampado mejores precio y calidad y ofrecer alternativas y asesoramiento en cuanto al distintivo del logo', 'no contar con insumos en el momento de la demanda', 'que aparezca una empresa con mayor capital de  trabajo', '2021-09-30 14:31:58', '2021-10-14 15:06:06');
INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(117, 1648, 1712, 24, 1, 'GUNDA FABRICA DE HELADOS', 'Empresa familiar que se dedica a la produccion y comercializacion de helados, cafeteria y pasteleria. Ubicado en el centro de Crespo en la calle principal donde se ofrece calidad en los productos, atencion personalizada, buen ambiente para permanecer a tener reuniones de negocios, pasar la tarde y disfrutar de un sabor inigualable. La constante mejora y el aumento de eficiencia en los procesos, la cuida de los detalles de limpieza y presentacion nos diferencian del resto.', '1050000.00', 1, 1, 'El proyecto es una hyeladera y una pasteleria, la cual cuenta con una fabrica y un local comercial en el mismo se venden los helados y las tortas, el local cuenta con cafeteria tambien', 'El objetivo es expandir la produccion de helados por medio de las mejoras edilicias, expandir la logistica y las ventas', 'En la expanción de la producción se busca a parte de un beneficio económico personal, significa la generacion de fuentes de trabajo directas e indirectas.', 'Actualmente la fabrica esta ubicada en un salon familiar (cedido por el padre), en el mismo espacio se encuentra las maquinas para la fabricacion de helado y una camara de almacenamiento, tambien en el mismo espacio se elabora pasteleria. Desde la fabrica se transladan los productos al local comercial (alquilado) donde se encuentra la venta al publico. Se revenden helados tambien en la ciudad de Parana y Villa Urquiza. Los productos son transladados en una camioneta Master utilitaria con frio.', 'Hace aproximadamente un año atras contaba con un servicio de catering, en el mismo me iba muy bien, con la pandemia quedo impedida de seguir desarrollando la actividad. La pareja antiguamente contaba con una heladeria familiar quedo impedido de seguir con la actividad por cuestiones familiares decidio desvincularse. En medio de la pandemia no tenian sustento economico y decidieron desprenderse de bienes para armar este proyecto que actualmente llevan a cabo en conjunto.', 'El lugar que se desarrolla la actividad es Crespo, el salon que se realiza la actividad es un salon cedido por el padre, el local comercial de venta al publico es alquilado en el centro de la ciudad.', 'salon cedido por mis padres', '1 año y medio de alquiler, local céntrico, sobre la calle principal, vidriado, con diseño particular que diferencia de los demas locas por su diseño unico.', 'elaboracion de bases para helados con leche meclada con azucar, sabores naturales y aditivos permitidos. Sometidos a un enfriamiento progresivo hasta su congelamiento.', 'La composicion de los helados es muy variable. La mayoria de los estados de la union tiene normas legales que especifican los procentajes minimos de grasa solidos no grasos. Aunque el termino de la crema helada se usa a veces para identificar postres congelados en general', 'se realiza mezcla de leche, crema azucar, saborizantes naturales, aditivos, neutros y estabilizantes permitidos. Se cocina a 78 grados para pasteurizarla, luego se enfria a 5 grados y se madura por 12 horas, luego se pasa por mangueras a la maquina fabricadora se inyecta aire y se enfria a -6 grados', 'La materia prima es adquiere por la compra en lugares especializados, leche pasteurizada, azucar y saborizantes naturales. La materia prima se concentra en la compra de distintos productos no se elabora la materia prima', 'los residuos obtenidos por el proceso productivo son manipulados en contenedores, separados segun su tipo y desechados', 'El mercado esta dado por varios competidores de la zona inclusive el negocio familiar de la pareja pero que son los principales competidores pero la diversificacion de gustos, la presentacion de los productos y la atencion cordial de sus dueños hacen que seamos los mas elegidos de la ciudad segun los ultimos estudios realizados', 'Los clientes son de todas las edades pero principalmente somos elegidos por gente entre 18 y 55 años que son el estrato productivo que buscan un lugar que tenga estilo y calidad', 'la competencia directa esta ubicada a 2 cuadras de distancia, el producto es parecido ya que conocen el proceso productivo, los demas son heladerias franquiciadas lo cual responden a otro tipo de servicio que no hace a la competencia directa gracias a la diferenciacion.', 'Los proveedores realizan sus entregas en nuestro lugar de produccion lo cual facilita la optimizacion del tiempo.', 'Al ser un producto conocido no existe un riesgo aparente referido al producto, el unico riesgo seria referido a la eleccion del cliente por lo que contamos con estrategias de marketing para aumentar la cartera de clientes, la constante mejora es uno de los objetivos principales que persigue este emprendimiento', 'El monto va a ser destinado a la compra de una maquina que acelere el proceso productivo para implementar la produccion, a la reestructuracion del local donde se producte, optimizacion de los procesos, mejora de producto, capacitacion del personal y aumento de eficiencia.', 'Al personal se lo tiene que capacitar para la correcta manipulación de los procesos productivos manteniendo los estandares antes mencionados.', 'Expancion de logistica producto del aumento de la produccion obtenida de la nueva maquina, la aceleracion de procesos y desarrollo del departamento de ventas. Todo aumento lleva aparejado a la necesidad de mano de obra lo que se busca emplear personal lo cual llevara al aumento de contrataciones.', 'kilo de helado: $550 tortas heladas: $850 barras heladas: $340 Bombones helados: $300 Bloques de chocolate: $600', 'Empresa familiar que permite que todo lo obtenido se pueda reinvertir, al conocer el producto tambien es una mejor forma de informar al cliente, la transparencia en los procesos y la presentacion del producto', 'Aumentar el desarrollo y logistica en toda la zona de entre rios y posterior expancion a las demas productos con un producto diferenciado', 'Falta de velocidad actualmente en la produccion y despacho de productos', 'Competencia tambien con un sistema logistico podria llegar a competir en la expancion. Baja de calidad de materia prima. personal no capacitado', '2021-10-18 19:43:20', '2022-06-07 15:26:15'),
(118, 1657, 1690, 19, 1, 'INSTALACION DE INFRAESTRUCTURA ELECTRICA Y ADQUISION DE MAQUINARIAS SECTOR DE PANIFICACION', '1- El proyecto instalación de infraestructura para maquinaria pesada de panificadora a 380 V, aplicación de red eléctrica para 220V para sector fabrica de pastas frescas.\r\n2- Compra de maquinaria pesada para mejorar la producción en el sector panificación.', '1400000.00', 1, 0, 'El proyecto es la reestructuración de la fabrica de panificados para ello es fundamental la ampliación de la red de 380 V para sumistro energético de la maquinaria pesada, instalación de red 220V para dar funcionamiento a la fabrica de pasta, instalación  de salas de frio bajo cero y sala de frio medio, para la conservación de la materia prima y productos terminados.\r\nCompra de maquinaria adicional para aumentar la producción de panificados.', 'El objetivo principal del proyecto es  aumentar y mejorar la cantidad de producción diaria de panificados, para expandir el área de venta e influencia de la empresa, brindar un espacio de trabajo adecuado para el personal.\r\nObjetivo secundario1, poner en puesta en marcha a la fabrica de pastas frescas, lo que generara de manera directa al menos 2 puestos nuevos de trabajo.\r\nObjetivo secundario 2, separar el área de panificación sin TACC y darle mayor impulso a los productos sin TACC.', 'Este proyecto significa una oportunidad que tiene una alta relevancia, ya hace mas de un año tenemos la necesidad de organizar nuestro sistema productivo, sin embargo nuestra mayor barrera ha sido la adquisición de crédito. \r\nCon la obtención de este crédito podremos ampliar el mercado, basados en el aumento de producción.', 'Actualmente la producción se lleva a cabo en uno de los salones de venta al publico, debido a que en la misma se encuentra las maquinarias y la instalación eléctrica adecuada, sin embargo el espacio físico imposibilita el aumento de producción, dificulta el anexo de nuevas actividades como la de fabrica de pastas e imposibilita el ingreso de mayor cantidad de personal.', 'FROZEN GLACIAR nació allá por el año 2019, un año antes estábamos constituidos bajo el regimen de monotributo, empezamos con 1 local en el centro de la ciudad de La Paz, con maquinaria alquilada y poco personal pero con muchas ganas de progresar,', 'Actualmente la empresa cuenta con 4 puntos de venta propios en la ciudad de La Paz, distribuidos de manera estratégica, actualmente estamos proveyendo mercadería a Santa Elena, San Gustavo, Hasenkamp, El Ombú, Colonias 3 y 14, Chajari, y varios comercios de la ciudad de La Paz; incluyendo hotelería y estaciones de servicios, Pueblo Libertador y Guayquiraro provincia de Corrientes.\r\nHemos adquirido maquinaria solo con recursos propios, y se ha triplicado la cantidad de gente empleada.', 'En este momento la empresa funciona en calle Echagüe, donde no tiene el espacio físico ni la infraestructura adecuada para su  funcionamiento.', 'El alquiler esta pactado por 5 años mas los cuales fueron renovados este año.', 'Los productos que ofrece FROZEN GLACIAR:\r\nPanificados congelados, para su comercialización o para terminar su comercialización con el proceso de cocción.\r\nPanificados cocinados, para su consumo directo.', 'Las características tecnológicas de nuestros panificados están dadas básicamente por el uso adecuado de las materias primas para ser aptas para su conservación a bajo cero.', 'Recepción de materia prima y clasificación de las misma\r\nAlmacenamiento y acopio\r\nAmasado, proceso en el cual se introducen las materias primas secas y húmedas en la batea de amasado\r\nSobado, proceso en el cual se estira la masa y se le dan descanso.\r\nEnlatado y sometido a abatimiento de frio\r\nEnvasado', 'Materias primas utilizadas, harinas de trigo, féculas de mandioca, féculas de maíz, azucares grado común, refinadas y con procesos húmedos, materia grasa, oleo margarinas, margarinas de origen animal y vegetal, levaduras, aceites maíz, girasol, aceites vegetales hidrogenados, sal, agua, leche, queso', 'Durante los procesos productivos pueden surgir, retazos de masas que van a reproceso para producción de nuevos productos.\r\nLos residuos secos son enviados a contenedores adecuados para su recolección, cartones, bolsas de papel, envases plásticos.\r\nLos residuos húmedos son derivados a otro contenedor', 'Actualmente se determina el mercado por la cercanía o vecindad de los clientes, o sea por zona geográfica y no por poder adquisitivo ya que tenemos productos de precio competitivo.', 'Clientes internos, nosotros consideramos clientes internos a nuestras sucursales, donde se realiza la venta minorista.\r\nClientes minoristas, son los distintos comerciantes que comercializan nuestros productos.', 'Actualmente en el área de panificado congelado, tenemos varios competidores de distintos puntos de la provincia y de otras provincias. Vemos nosotros una oportunidad muy significativa si logramos aumentar la producción ya que tenemos ventajas en nuestros productos.', 'Contamos con una cartera de proveedores muy variada distribuida en la provincia, también proveedores de distintos puntos del pais, con marcada trayectoria en el mercado.', 'Los riesgos son los habituales de la actividad, ejemplo competitividad se debe superar con mejora en el proceso productivo para lograr mejora en los productos y bajando los costos de producción por mejor aprovechamiento de los recursos disponibles.', 'El monto solicitado será destinado a la adquisición de materiales eléctricos y mano de obra calificada, para la ampliación de la red eléctrica 380V y 220 V.\r\nAdquisición de materiales y mano de obra de refrigeración para la puesta en funcionamiento de las salas de frio para refrigeración y congelamiento de productos terminados.\r\nAdquisición de maquinaria pesadas para ampliar la producción.', 'El personal empleado para la actividad será de 10 personas.', 'El impacto económico será directo sobre el personal empleado que serán todas personas de la ciudad, indirecto sobre la cantidad de nuevos puntos de venta que vamos a poder abastecer gracias al incremento de la producción.', 'En el momento la relacion de precios y calidad de nuestros productos es considerada correcta, pero aplicando nuevas tecnologias al proceso productivo se pueden mejorar y ganar competitividad.', 'Nuestra mayor fortaleza esta dada por la calidad de los productos', 'Esta dada por el mercado que esta deseoso de ser abastecido correctamente y de las necesidad de expansión de la empresa a otros puntos de la provincia', 'Las debilidades que veo con mas fuerza en nuestra empresa son 2 \r\nLa inadecuada estructura que hace que los procesos productivos no sean eficientes\r\nEl abastecimiento o transporte de mercadería, sobre la cual ya estamos trabajando.', 'Amenaza de nuevos competidores siempre esta latente, pero si nos hacemos fuertes y trabajamos sobre la mejora de la producción va a disminuir considerablemente.', '2021-10-19 16:05:39', '2021-10-19 18:17:45'),
(119, 1808, 1616, 19, 1, 'COMPRA DE EQUIPAMIENTO PARA LABORATORIO', 'La Cooperativa se dedica desde hace 20 años a la producción y comercialización  de miel de sus productores asociados. La misma cuenta actualmente con 13  productores apícolas y con unas 12.000 Colmenas. En los últimos años se hizo foco en la centralización de la extracción de miel y el  cumplimiento de la trazabilidad de la misma, permitiendo a los productores  identificar oportunidades de mejora en los apiarios, translado y manipuleo de la  miel.  Nuestro objetivo es generar valor agragado.', '2000000.00', 1, 0, NULL, 'Nuestro objetivo es generar valor agregado de producción, comercialización de  la miel mediante el mejoramiento de la calidad, evitando la mezcla de mieles de  bajo valor con mieles de alto valor. De esta forma lograremos exportar  nuevamente al cliente final (Alemania, España, Marruecos).', 'Mejoramiento de calidad, a través de la clasificación de miel por tipo de ,miel', NULL, 'La Cooperativa se dedica desde hace 20 años a la producción y comercialización  de miel de sus productores asociados. La misma cuenta actualmente con 13  productores apícolas y con unas 12.000 Colmenas.', 'Actualmente la cooperativa esta en un proceso de expansión, el cual abarca  desde el acercamiento a nuevos productores apícolas al negocio, el apoyo a los  productores actuales, y la generación de clientes propios en el exterior para  exportar los productos directamente desde la cooperativa, haciendo incluso  aduana en el mismo deposito, el cual esta pegado a nuestra sala de extracción', 'Propio: Sala de extracción y depósito de miel', 'No aplica', NULL, 'No tiene', 'Producción, extracción, acopio y comercialización de miel.', 'Miel multiflora pura de abeja.', 'Subproductos cera virgen', 'Consumidores de miel Europeos, USA. Nuestros clientes habitualmente lo que  buscan de nosotros es miel de calidad. A sabiendas de que Argentina tiene una  de las mejores calidades de miel del mundo.', 'Hoy nuestras ventas son 95% a exportadores', 'Nuestra competencia es global, en mieles de baja calidad la competencia es  china, que a su vez sufrió algunos reveses en mercados por adulterar la miel. En los  mercados donde se busca mayor calidad de miel, la Argentina esta bien  posicionada, y nosotros dentro de las empresas productoras estamos bien  posicionados. Nuestro trabajo como cooperativa mas que competir con otros  productores locales, debe ser lograr una mejora en todo el sistema de produccion  y comercialización de miel,.', 'Productores apícolas zonales asociados, en general son pequeñas y medianas  producciones, de entre 800 y 1.500 colmenas.  \r\nUno de nuestro desafío es lograr incorporar mas productores a la cooperativa,  como asi generar sinergias en vistas a lograr una mayor escala y sistemas de  gestión acordes que permitan incrementar la escala sin perder el manejo  exhaustivo de la producción.', 'Aseguramiento de calidad, exportacion directa.', 'Compra de equipamiento de laboratorio, compra de miel al productor asociado.', 'Los que trabajamos actualmente somos los socios de la cooperativa', 'Mejora la profesionalización del productor permitiendo el desarrollo personal y  profesional', 'El precio del kg de la miel hoy cuesta entre 260 y 320 ARS dependiendo la calidad.', 'Cercania con el productor \r\nManejo in-house \r\nExtracción y comercialización centralizada', 'Venta al cliente final\r\nMercado exigente en calidad\r\nDemanda creciente', 'Escala \r\nCapital de trabajo \r\nPoca optimización de sub productos', 'Cierre de exportaciones \r\nBarreras arancelarias\r\nProductores de miel de baja calidad y  precio', '2021-10-20 13:06:26', '2022-11-10 14:28:01'),
(120, 1660, 1695, 19, 1, 'IMPLEMENTACIÓN SECTOR MATERNIDAD - INVERNADERO HIDROPONICO', 'Cultivo Hidropónico de hojas verde. Invernadero de estructura metálica con una superficie de 960 m2. Dividido en tres naves productivas que pueden funcionar independiente, obteniendo una producción mensual aprox de 14.000 plantas. El cultivo se realiza por medio de perfiles de polipropileno, los cuales son abastecidos con agua y nutrientes (NFT), el objetivo de este es lograr una producción de calidad, sustentable (80% menos agua vs producción tradicional) y sin la utilización de agroquímicos.', '1600000.00', 1, 0, 'Construcción de un sector de maternidad de plantines. Creación de un espacio para la germinación de semillas para su crecimiento en condiciones controladas, de manera que las semillas germinadas puedan alcanzar la maduración necesaria para poder ser trasplantada al invernadero para su crecimiento. El espacio requerido contempla ejecución de instalación de agua e inyección de nutrientes, luz y consideraciones especiales, que debe ser integrado al espacio actual de manera funcional.', 'Corto plazo:\r\n-Implementar un sector de maternidad para la germinación y maduración de las semillas.\r\n-Comenzar la producción de plantines propios de distintas especies. \r\n-Mejorar la marginalidad de la producción por medio de abaratar costos de insumo directo.\r\n-Mejorar el control de los tiempos productivos e independencia de suministros críticos.\r\nLargo plazo:\r\n-Aumentar la superficie de producción.\r\n-Implementar la producción de otros cultivos diferentes a la hoja verde.', 'La creación del sector de la maternidad permite bajar los costos directos de la producción. El costo de las semillas es considerablemente menor al costo de los plantines. Al agregar esta etapa se logra mejorar el valor agregado en la producción porque implementa un ciclo completo –Semillas, germinación, plantines, cultivo, cosecha- Con una ventaja adicional de mejor control de los tiempos de producción, disponibilidad de stock (acopiar de semillas) y menor probabilidad de introducir plagas.', 'El invernadero está desarrollado en estructura metálica, con cubierta plásticas. Se divide en tres naves productivas, cada una con circuito de alimentación de agua y nutriente, tanque de 4000 litros y tanque de nutrientes independientes. Cada nave cuenta con sus mesadas de fase 1 y fase 2 de manera que pueden producir cultivos distintos, dependiendo del cultivo seleccionado mensualmente puede producir 4800 plantas cada nave. Los ciclos productivos varían en función de la especie seleccionada.', 'Dos de los integrantes relacionados al proyecto son ingenieros agrónomos quienes tomaron contacto con invernaderos de cultivos hidropónicos radicados en otras provincias, y de esa manera nació el entusiasmo y el interés de poder desarrollar un proyecto productivo local. El proyecto nace como una sociedad de hecho entre 4 integrantes que comparten el mismo interés, que se puede resumir en lograr cultivos que brinden un producto de calidad nutritiva y sostenible.', 'El proyecto iniciado se encuentra con una muy buena aceptación, si bien es un proyecto joven que aún está en etapa de maduración las perspectivas son favorables. La conciencia de una mejor alimentación, que es el consumo de alimentos saludables, se interpreta como una tendencia creciente que acompaña la iniciativa. Por otro lado, la capacidad de generar una producción estable también favorece su comercialización. La etapa actual ha generado una capitalización en “know how” muy importante.', 'Lugar en comodato para el uso.', 'Años de alquiler: 1 año y medio. Es una fracción de 5000m2 en un terreno de 2 hs de tercero. En contrato de comodato, emprendimiento está a cargo de todas las mejoras, cuidado y mantenimiento de un predio mayor al en uso. Se encuentra en la ruta 18,centro rural Sauce Montrul departamento Espinillo.', 'Cada especie cultivada, requiere una solución nutritiva específica (concentración y acidez). El sistema NFT implementado, la solución se bombea a los caños que conforman la mesadas (9 m de longitud) y con una pendiente del 5% la solución retorna a los tanques, formando un sistema continuo', 'El sistema NFT (técnica de lámina nutritiva) consiste circular una fina lámina de agua conteniendo las sales nutritivas (fertilizantes), a través de cañerías con orificios en los cuales las plantas se encuentran instaladas. Las cañerías a su vez deben reunir características especiales de inocuidad.', 'Los plantines entran al sistema en los caños chicos (Fase1), como plantas jóvenes hasta 5-7 hojas. Cuando las hojas comienzan a tocarse, pasan a los caños de mayor diámetro (Fase2) hasta la cosecha. Luego una vez cosechadas se acondicionan y se adecuan para su comercialización.', '-Plantines de diferentes cultivos: Lechuga (Francesa, Morada, Hoja de Roble, Mantecosa), Rúcula, Espinaca BB.\r\n-Kit de nutrientes hidropónicos / Sales minerales concentradas.\r\n-Bolsas biodegradables (comercialización minorista)\r\n-Cajas de cartón reciclado (comercializaciones mayoristas).', 'Residuos verdes: Tallos de plantas, raíces, hojas, etc., las cuales son procesado en la generación un compost orgánico. Solución de nutriente pobre en oxigeno de retorno la cual es oxigenada y recirculada. En caso de descarte de solución, la concentración mineral posee un valor inocuo al ambiente.', 'Al ser un producto alimenticio el mercado es toda la población local y de localidades aledañas. Si bien al tratarse de verduras, el mercado presenta una estacionalidad de mayor consumo con el clima cálido, la tendencia de un consumo de alimentos saludables está ocasionando que la estacionalidad deje de ser tan marcada, aumentando el consumo en épocas frías. Por otro lado, el mercado alimenticio presenta una tendencia creciente en ese aspecto, demandando el consumidor productos saludables.', 'El mercado de clientes actuales es local y de localidades aledañas, se divide en:\r\nMayoristas: Concentradores con puestos de venta en el mercado central y establecimientos medianos/grandes. Compran gran volumen, en algunos casos con condición de pago en 30 o más días.\r\nMinoristas: Incluye pequeñas verdulerías, restaurantes y bares. Compran a menor escalas y demanda mayor logística en la coordinación de la entrega, el pago suele ser a contra entrega.\r\nEn una proporción 70/30% respectivamente.', 'La competencia actual es local y de otras provincias.  Sin diferenciación del producto la competencia es directa de otros emprendimientos similares ya montados, y de otros establecimientos con métodos de cultivo tradicionales. Diferenciando el producto por sus características como ventajas, la competencia local es menor y existe competencia a nivel nacional de grandes productores. Santa Fé presenta una amplia franja productiva hortícola, cuya producción también se coloca en mercado locales.', 'Invernadero estructural: ADC Invernaderos https://www.adcinvernaderos.com.ar/index.php\r\nProveedores hidropónicos: Verde Agua www.verdeagua.com.ar - Hidroponia Paraná (Facebook: hidroponía Paraná)\r\nSales Minerales: Hidroponía Rosario www.hidroponiarosario.com - Química Oeste http://www.quimicaoeste.com.ar\r\nPlantines: Del Agua Venimos delaguavenimos@gmail.com - Cooperativa Tecnoflor \r\nProductos Ecológicos y orgánicos para plagas: Eco Mambo (info@ecomambo.com.ar) - Agua Electroactivada.', 'Dependencia energética: Si bien el crecimiento de las plantas es por medio de luz natural se necesita energía eléctrica para el bombeo del agua y circulación de nutriente. En caso de corte de energía pone en riesgo la producción. Se prevé incorporar un grupo electrógeno para alimentar en caso de corte de luz en lo próximo y en lo remoto paneles solares.  \r\nContinúo monitoreo del agua y sus características, en caso de falla pone en peligro la producción, se piensa incorporar control automatizado.', 'Construcción de un sector para la etapa de maternidad para la germinación de semillas y la producción propia de plantines. Adquisición de los insumos necesario para la puesta en producción de lo plantines. Incorporación de un sistema automático de monitoreo de las características del agua y los nutrientes para las diferentes naves del invernadero. Incoporación de un grupo electrógeno y su instalación.', 'Personal contratado por obra para montar la estructura de la maternidad, y realizar las instalaciones necesarias de agua y nutriente, luz y sistemas requeridos para la puesta en funcionamiento.\r\nSe prevé incorporar uno o dos empleados en el emprendimiento para efectuar las tareas propias producción del invernadero ante la nueva etapa productiva a incorporar en el circuito productivo.', 'Desarrollo de Agricultura sustentable y accesible a la comunidad, poniendo a disposición alimentos de calidad nutricional a un costo más bajo. \r\nAumento en la producción local hortícola contemplando una menor huella de carbono y desperdicio en la producción, aumentando los beneficios.\r\nGeneración de fuente de trabajo genuina de manera directa e indirecta, con perspectiva de un crecimiento sostenido en el tiempo. Fomentar el desarrollo de productos locales.', 'Actualmente el precio de la mercadería es impuesto por los grandes concentradores (actualmente supermercados). El parámetro utilizado es que el precio de góndola que presentan los productos en el supermercado. A partir de ahí se define, al precio mayorista como el 50% del precio en góndola y al precio minorista como el 80% del valor de góndola. Actualemten el precio de góndola de la lechuga es de $109.', 'Mayor sustentabilidad por más efectivo uso de los recursos (circuitos cerrados de agua, control de los factores ambientales, sustratos controlados).\r\nMayor Higiene de los cultivos: menor uso de agroquímicos y mayor comodidad del trabajador al ser un trabajo sobre mesadas liviano.\r\nAl hacerse en ambiente controlado, la producción no se ve afectada por inclemencias climáticas.\r\nProducción Hiper-local estabilidad en la producción a lo largo del año y mayor estabilidad en los precios.', 'Lograr optimizar las ventas en función del mercado local. Dado por la disminución en los costos de transporte, producción cercana y visible al consumidor, seguridad en la producción.\r\nImplementar la producción de cultivos diferenciados que permitan mayor rentabilidad por producto y brindar un mayor valor agregado.\r\nDesarrollo de marca propia y creación de una identidad al consumidor.\r\nMejorar la eficiencia al continuar implementando tecnología (energía solar, control automático, etc.)', 'Necesidad de inversión inicial considerable y mayor necesidad de especialización en las características de la técnica de cultivos.\r\nDependencia energética para poder brindar los nutrientes a las plantas.\r\nRequerimiento de control diario de la calidad del agua y nutrientes suministrados.', 'Daños estructurales del invernadero considerables por inclemencias climáticas extremas.\r\nCorte de luz o problemas de abastecimiento de agua, los cuales impidan la producción.\r\nAfectación de la producción del cultivo por temperatura extrema en verano.', '2021-10-21 11:38:59', '2022-02-04 12:26:46'),
(126, 1640, 1665, 24, 1, 'ADQUISICION DE MAQUINARIA', 'SE NECESITA EL CREDITO PARA PODER COMPRAR UN AUTOELEVADOR', '900000.00', 1, 0, 'COMPRA DE UN AUTOELEVADOR MARCA HELI CPQD25 - MODELO: NEW H SERIES - CAPACIDAD: 2500, MOTOR: NAFTA', 'EL OBJETIVO ES TENER CAPITAL DE TRABAJO PROPIO Y DEJAR DE ALQUILAR, SE VA A AVANZAR Y A APURAR EL TRABAJO QUE TENEMOS, YA QUE NO VAMOS A DEPENDER DE UNA MAQUINA ALQUILADA, SE VA A APROVECHAR MAS EN HORARIO Y EN MAXIMIZAR RENDIMIENTOS PARA PODER SATISFACER CON MAS RAPIDEZ A NUESTROS CLIENTES.', 'ESTA OPORTUNIDAD SIGNIFICA DEJAR DE ALQUILAR LA MAQUINARIA PARA PASAR A TENER UN AUTOELEVADOR PROPIO, PUDIENDO ASÍ DESTINAR EL GASTO MENSUAL DE ESE ALQUILER, Y TENER CAPITAL DE TRABAJO PROPIO.', 'EN LA ACTUALIDAD ESTAMOS ALQUILANDO EL EQUIPO MENSUALMENTE A UNA EMPRESA LOCAL, PERO EN OPORTUNIDADES NOS QUEDAMOS SIN LA DISPONIBILIDAD DEL MISMO, POR ENDE SE ATRASAN LOS TRABAJOS Y PERDEMOS CLIENTES.', 'SOMOS UNA EMPRESA CON PROFESIONALES CALIFICADOS PARA DESARROLLAR PROYECTOS EN ACERO INOXIDABLE Y MATERIALES AFINES. CONTAMOS CON CASI 10 AÑOS DE EXPERIENCIA EN LA INDUSTRIA DEL METAL, OFRECEMOS UNA AMPLIA GAMA DE TRABAJOS PARA ENFRENTAR LOS RETOS DEL MERCADO Y SATISFACER LOS REQUERIMIENTOS DE CALIDAD Y SERVICIOS QUE NECESITAN NUESTROS CLIENTES.', 'TRABAJAMOS CON 3 PASANTES DE LA ESCUELA TECNICA DE LA CIUDAD DE LARROQUE, TENEMOS 2 GALPONES PROPIOS EN EL ÁREA INDUSTRIAL.', '1 GALPON DE 150 MTS2 Y OTRO DE 120 MTS2, UBICADOS EN EL AREA INDUSTRIAL DE NUESTRA CIUDAD.', 'PROPIO.', 'SE TRABAJA CON CHAPAS Y LAMINAS DE METAL Y ACERO INOXIDABLE QUE SE COMPRAN Y SE REFORMAN A PEDIDO.', 'SOMOS LOS UNICOS EN LA ZONA CON UN PANTÓGRAFO LÁSER QUE CORTA Y GRABA.', 'SE COMPRA LA MATERIA PRIMA, SE HACEN CORTES Y PLEGADO DE LAS CHAPAS Y/O LÁMINAS DE ACERO INOXIDABLE, SE CORTA CON GUILLOTINA. \r\nSE REALIZAN ARMADOS DE ESTRUCTURAS METÁLICAS Y ARMADO DE NAVES INDUSTRIALES. SOLDADURAS.', 'CHAPA Y LAMINAS DE ACERO. GASES PARA SOLDADURAS.', 'NO GENERAMOS RESIDUOS, LO POCO QUE SE DESECHA ES SOBRANTE DE METAL QUE LO BUSCA GENTE QUE LO RECICLA PARA VENDER, LAS BOBINAS PLASTICAS DE LOS ROLLOS DE ALAMBRE Y EL CARTON SE DEJA EN LA PLANTA DE RECICLADO DE LA CIUDAD.', 'SOMOS LOS UNICOS EN EL MERCADO QUE REALIZA NAVES INDUSTRIALES Y ESTRUCTURAS DE ALMA LLENA. POR LO GENERAL NO TENEMOS COMPETENCIA EN LA ZONA POR EL USO DEL PANTÓGRAFO. SI TENEMOS ALGUNA EMPRESA LOCAL QUE REALIZA DIVERSOS TRABAJOS EN METAL Y ACERO PERO EN MENOR CANTIDAD Y ESTRUCTURA.', 'FRIGORÍFICO DE AVES DOMVIL S.A.\r\nGLOBOAVES ARGENTINA S.A.\r\nR.P.B. CERVECERÍA', 'LA COMPETENCIA LOCAL TRABAJA EN MENOR PROPORCION RESPECTO A NUESTROS TRABAJOS.', 'MATERIALES E INSUMOS PARA SOLDADURAS Y CORTES, SE COMPRA EN BUENOS AIRES.\r\nPROVEEDORES DE GASES Y AFINES SE COMPRA EN LA CIUDAD DE GUALEGUAYCHÚ.', 'LOS RIESGOS QUE TENEMOS COMO EMPRESA ES LA MAYORÍA DE SEGURIDAD LABORAL, ES UN TRABAO MUY COMPLICADO Y DIFICIL YA QUE SE TRABAJA EN ALTURAS CON DIFERENTES HERRAMIENTAS QUE PUEDEN LEGAR A SER PELIGROSAS.', 'EL DESTINO DEL MONTO SOLICITADO SERÁ PARA LA COMPRA DE UN AUTOELEVADOR.', 'TENEMOS 3 EMPLEADOS PASANTES DE LA ESCUELA TECNICA LOCAL.', 'EL IMPACTO ECONOMICO Y SOCIAL DE NUESTRA EMPRESA SERIA EL PODER', 'LOS PRECIOS DE NUESTROS PRODUCTOS DEPENDEN DE LA NECESIDAD DEL CLIENTE, ES MUY VARIADO POR LA DIMENSION DE LAS ESTRUCTURAS Y DISTINTOS TRABAJOS.', 'COMPROMISO DE LA EMPRESA FRENTE A LOS TRABAJOS SOLCITADOS.\r\nLA CAPACIDAD DE INNOVACION.\r\nLA RAPIDA RESOLUCION DE PROBLEMAS.', 'NO HAY COMPETENCIA EN LO LOCAL.\r\nTENEMOS MANO DE OBRA CALIFICADA Y PODEMOS ENSEÑARLES A LOS CHICOS A EJERCER UN OFICIO A TEMPRANA EDAD.', 'ANTIGÜEDAD DE LA MAQUINARIA.', 'CONSTANTE AUMENTO DE LOS IMPUESTOS.\r\nLEJANIA DE LOS PROVEEDORES QUE DEMORAN LA LLEGADA DE MATERIA PRIMA.', '2021-10-25 12:43:12', '2022-06-07 14:20:10'),
(130, 1644, 1717, 19, 1, 'INSTALACIóN DE NUEVAS MAQUINARIAS.-', 'El objetivo central es la instalaciones de nuevas maquinas para aumentar los volúmenes de procesamiento de arroz elaborado.-', '2000000.00', 1, 0, 'Instalacion de nuevas maquinarias para el procesamiento de arroz elaborado.-', 'Mayor volumen de producción .-', 'Mayor volumen de producción es para poder cumplir con  las ventas  que existe en el mercado interno y posibles ventas al exterior .-', 'Hoy no contamos con capacidad de volumen de producción, debido a esto no vemos en la obligación de inversión a corto plazo', 'No tenemos mucha historia en el Mercado, hace poco mas de un año se comenzó con esta industria.-', 'Contamos con producción/elaboración propia , con envasados y con nuestras marcas, ya sea arroz Largo Fino en -0000- y -00000- .-', 'Ruta Nacional 18 km. 204 -San Salvador - E.Rios', 'no tenemos', 'Al ser un cereal, el arroz es rico en hidratos de carbono, fuente esencial de energía para nuestro cuerpo. Así, el arroz integral, proporcionará energía de forma lenta y paulatina, pues su contenido de fibra es mayor que el del arroz blanco y ralentiza la absorción de los nutrientes.', 'Hay mucho uso de tecnologías en la siembra, fumigación y cosecha de este cereal.-', 'El circuito productivo del arroz consta de 3 etapas: una 1er.etapa agrícola donde se produce el cultivo de arroz. Una 2da. etapa comercial donde se produce y elabora el arroz para que quede en óptimas condiciones. Y finalmente, una 3ra. etapa donde el arroz es distribuido y comercializado.-', 'Arroz en cascara.-', 'generan subproductos (cascara)', 'Tenemos hasta el momento Mercado interno, y queremos en un futuro cercano ingresar en el mercado exterior.-', 'Los clientes, que son exigentes cuando se negocia, son cumplidores  es sus obligaciones', 'Si hay mucha competencia, por eso tenemos que cuidar nuestra calidad de producto y competir con los mejores precios.-', 'Tema proveedores siempre tenemos que estar atento a pedir cotizaciones de materiales, por el motivo de los continuos aumento de precio de los mismos.-', 'No observamos muchos riesgos y por el momento no tenemos estrategias adquiridas.-', 'El destino es para la instalaciones de nuevas máquinas', '8 (Ocho)', 'También seria un infectivo para el progreso a nivel social y económico para los empleados .-', 'De Los productos que se adquieren, el precio a no tener un precio oficial surge de acuerdo a la oferta y demanda , teniendo siempre un piso y los servicios si tienen un aumento considerables día a día.-', 'Buen contacto con productores de arroz para conseguir la materia prima,', 'Crecimiento en la compra y venta, expansión de la marca', 'En este aspecto no detectamos hasta el momento de debilidades, pero estamos atento por si surgen.-', 'Alta competencia en el mercado', '2021-10-28 12:45:47', '2021-11-01 21:34:29'),
(133, 1665, 1718, 20, 1, 'NUEVO PROYECTO', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-10-29 13:06:00', '2021-10-29 13:06:09'),
(134, 941, 447, 19, 1, 'GALPON', 'Soy Pablo A. López Van Oosteron y junto a mi hermano, desde 2015 tenemos una pequeña fábrica de máquinas para elaborar discos de empanadas y pastas frescas para mediana y alta producción, siendo la única en la provincia orientada este rubro específico. Comercializamos nuestros productos en Argentina y desde 2017 realizamos algunas exportaciones ocasionales a otros países de la región.', '3000000.00', 1, 0, 'Un proyecto que permitirá ampliar el espacio de trabajo anexando un nuevo tramo al galpón existente, de manera que nos permita comenzar a producir lotes de máquinas en serie y así salir de la producción artesanal. La ampliación del espacio de trabajo prevé la construcción de un nuevo galpón y adecuación de instalaciones.', 'El objetivo principal del proyecto es resolver nuestro mayor problema estructural: la falta de espacio físico. Para ello se prevé la construcción de un nuevo galpón y adecuación de instalaciones para ampliar el espacio de montaje, crear nuevas secciones de producción y contar con un espacio para almacenar productos terminados.', 'Para nosotros, oportunidad significa saber identificar una necesidad del mercado y combinarla con ciertas ventajas actuales (momento oportuno) que pueden conducir al éxito de un proyecto si se sabe aprovechar correctamente. Dicho en otras palabras, podríamos decir que es como aprovechar la ola o caminar con el viento a favor.', 'Desde el comienzo en 2015, pasando por diferentes etapas del país y contextos económicos, venimos creciendo de forma progresiva, pasando de un pequeño taller unipersonal a una pequeña fabrica con 3 empleados a tiempo completo. Hoy buscamos incrementar nuestra capacidad productiva para aprovechar la demanda del mercado local (actualmente reducido por los grandes plazos) y poder explotar el gran potencial exportador que tenemos ingresando a otros mercados a través de importadores y distribuidores.', 'Nuestra historia comienza en 2014 como la continuación de una antigua actividad desarrollada por nuestro padre durante nuestra infancia y desde donde pudimos aprender con ejemplos prácticos los valores de respeto, responsabilidad, honestidad y sacrificio. Desde 2014 hasta 2015 fueron años dedicados a la puesta en marcha en 2017 se produjo una  transformación de nuestra línea de productos nos animamos a nuestra primer exportación y desde 2019 comenzamos a hacernos visibles y expandirnos.', 'En la actualidad, con una línea de productos exclusiva en el rubro y destacada en el mercado por su calidad, innovación y precios competitivos buscamos consolidar la marca, expandirnos a nuevos mercados y aprovechar la gran demanda que tenemos. Desde nuestra participación en importantes ferias nacionales en 2019 hasta hoy, vemos como cada vez más nuestros clientes, referidos por otras personas buscan nuestros productos conformándonos que vamos por el camino correcto.', 'La empresa comenzó a funcionar sobre un galpón propio de 112 m2 ubicado en J.M. de rosas 111, Colonia Avellaneda. En 2019 logramos incorporar un galpón de 225 m2 que nos permitió instalar las secciones de pintura, corte laser corte plasma y mecanizados entre otros aunque nos faltan otras secciones.', 'Desde 2014 hasta la actualidad, el galpón de 112 m2 fue cedido en comodato hasta 2022 y se renovó hasta 2027 para ser utilizado por la fábrica. En 2021 logramos comprar un terreno de al lado, antes alquilado y sobre el cual están construido algunos galpones que permitieron anexar 225 m2 en 2019.', 'Nuestros productos se distinguen por ser innovadores, siendo en algunos casos únicos en el mercado y en otros casos por conservar la esencia de las máquinas del pasado como la robustez y simpleza pero combinada con el diseños y tecnología actual. Buscamos la excelencia en la calidad.', 'Si bien contamos con una amplia variedad de productos, se destacan las máquinas para elaborar pastas frescas, que en si son equipos simples, pero dado su tamaño, robustez y calidad requieren tecnología de punta para su fabricación y medidas de seguridad.', 'El proceso productivo de todos nuestros equipos comienza con la materia prima básica y finaliza con el montaje final y embalaje. Es decir, todos los procesos se realizan en nuestra fábrica: Corte, plegado, soldadura, mecanizado, pintura, montaje, control de calidad, embalaje y despacho.', 'Algunas materias prima son: Chapas, perfiles, barras de acero, planchas de acero inox., teflón, madera, bronce, aluminio, engranajes, cadenas, rodamientos, motores, pintura, bulones, etc. Todos adquiridos en proveedores nacionales.', 'Los principales residuos que se generan son mayormente recortes de chapas y caños, viruta de acero y de bronce y algunos restos de material de embalaje como cartón, polietileno y madera. Los residuos metálicos se entregan en empresas de reciclaje quedando muy pocos desechos p/recolección municipal.', 'Según un informe de la UFRA del año 2020, en 2018 argentina esta entre los 7 principales piases productores de pastas secas y frescas, con 400.025 Tn en ese año y un consumo anual per capita de 8.5 kg. En Estados Unidos, esta en segundo en el ranking mundial con una producción de 2.000.000 de tn en 2018, siendo un excelente mercado potencial para exportar.', 'Nuestro cliente es el fabricante de pastas que ya está produciendo (profesionales), y necesita pasar de baja producción (50/80 kg hora) a mediana producción (120/150 kg hora o aquel fabricante de pastas que se encuentra en el segmento de mediana producción pero necesita pasar a alta producción (200/250 k/h) o simplemente renovar su equipamiento. Por otro lado, también ingresan en el rubro empresas que inician directamente con el equipo de acuerdo a la producción sin escalar previamente.', 'Dentro de la competencia se distinguen tres tipos de competidores: primeras marcas: excelente calidad pero extremadamente caras, segundas marcas: menos conocidas, buena calidad y con precios mas accesibles (segmento en donde se encuentra nuestra empresa, y terceras marcas que se destacan por precios muy económicos pero con calidad deficiente. Dentro de las empresas en nuestro mismo segmento nos destacamos por tener una linea completa, robustez y diseños exclusivos.', 'Los proveedores que tenemos son todos nacionales y los artículos que se les demanda son de uso industrial. Los proveedores de aceros, madera, polietileno, y algunos insumos eléctricos básicos son mayormente empresas Entrerrianas mientras que los proveedores de acero inoxidable, transmisiones, motores  eléctricos y componentes eléctricos y electrónico son proveedores localizados mayormente en Buenos Aires y Rosario.', 'Dado que somos una empresa que ya está funcionando y se sustenta por si mismo desde hace varios años, se podría decir que el riesgo de fracaso ya es muy bajo (prácticamente nulo). No abstante, una de las amenazas es no poder salir de la producción artesanal por falta de espacio físico, que nos impide producir equipos en lotes para bajar costos, aumentar rentabilidad y aprovechar una demanda de venta que se pierde por no poder producir. Con esta inversión, podríamos reducir esta amenaza.', 'El monto solicitado está destinado a la compra de los materiales para construir un galpón que permita anexar 225 m2 a la superficie cubierta actual de 337 m2, sumando un total de 562 m2 en donde se prevé: trasladar el área de corte, plegado y soldadura, ampliar el área de montaje y con un nuevo espacio para almacenar productos terminados que sirvan como pulmón y nos permitan acortar los plazos de entrega hoy de entre 60 y 90 días desde confirmación de la compra.', 'Nuestro equipo de trabajo esta actualmente integrado por: Mi hermano, Mauro López encargado del área comercial y administración, su esposa Lorena (media jornada) apoyando en atención de clientes y administración, yo, Pablo encargado del diseño y coordinar la producción de 3 operarios que realizan tareas de Corte, plegado, soldadura, mecanizados, montaje y pinturas. En total 5 integrantes jornada completa + un integrante media jornada aunque necesitaremos alguien mas en producción.', 'El primer impacto positivo se genera con la incorporación de cada persona que se suma al equipo de trabajo. El segundo impacto lo vemos de forma local en las empresas de transporte y proveedores de materia prima, tanto locales como de otras provincias. El tercer impacto lo vemos reflejado cuando se produce una nueva exportación e ingresan divisas a nuestro país tan necesarias para salir adelante y por último lo contribuir a la sociedad a través de nuestros impuestos.', 'Los precios de nuestros principales productos son: Cortadoras de discos para empanadas: entre $ 645600 y 912.000. Cortadoras de tallarines entre $ 831.900 y 1.289.000. Mezcladoras volcables: entre $ 774.000 y 1290.000 y Laminadoras Pesadas: entre $ 1.248.000 y 2.285.000 y las nuevas Ñoqueras Automáticas de Mesa cuyo valor es de $ 414.993', 'Una de nuestras principales fortalezas es la adaptación a cambios bruscos cambios ya sea económicos o de la demanda de nuestros clientes. Contamos con una gran capacidad de diseño, experiencia en constante crecimiento y baja estructura de gastos que nos permite sobrellevar las fluctuaciones del mercado. Además, en 2017 vencimos el miedo a exportar, lo que nos permite explorar nuevos mercados.', 'El hecho de haber podido conversar con clientes que compraron productos desde el exterior (Estados Unidos, Canadá, Colombia, Ecuador, Chile, Uruguay, Etc.) nos da la certeza que Argentina es un país referente en Latinoamérica en materia de máquinas para la industria alimenticia. Tenemos la oportunidad no solo de posicionarnos en el mercado argentino, sino también de consolidarnos como exportadores y brindar aún más trabajo en nuestra Entre Ríos.', 'Nuestra mayor debilidad es la falta de capacidad productiva, debido a la falta de espacio físico que nos impide dividir las secciones, trabajar de forma mas ordenada y fabricar productos en lotes. Esta debilidad se ve reflejada como plazos de entrega elevados y a su vez se traduce como perdida de venta. También limita nuestra capacidad exportadora impidiendo que podamos buscar importadores.', 'Una de nuestras principales amenazas puede ser el ingreso de nuevos competidores que puedan posicionarse en nuestro mismo segmento, ya sea nuevos o de empresas líderes que incorporen segundas marcas con buena calidad pero con precios mas accesibles y mayor capacidad de inversión que permitan posicionarse por encima nuestro. Otra amenaza es la erosión que genera la inflación en las utilidades a causa de los elevados plazos de producción.', '2021-10-29 15:19:39', '2022-08-01 15:05:22');
INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(136, 1676, 1723, 19, 1, 'PLAYóN PARA MANIOBRAS DE CARGA Y DESCARGA', 'Actualmente el playón es afirmado con brosa, por lo que es un terreno muy inestable para poder cargar y descargar mercadería con el autoelevador, generando pérdida de materiales por derrames y la imposibilidad de transitar en días de lluvia.', '2000000.00', 1, 0, 'El proyecto consta de la construcción de una playa de maniobras para camiones con acoplados y semi remolques, en hormigon elaborado de 20x20mts con 18cm de alto.', 'El proyecto tiene 3 objetivos principales:\r\n1- Trabajar bajo cualquier condición climática: Los días de lluvia no podemos realizar carga y descarga, atrasando las entregas y recepciones\r\n2- Evitar perdidas por derrame: el terreno actual es muy irregular, lo que dificulta el traslado del autoelevador, generando roturas en los envoltorios de la mercadería y derrames innecesarios\r\n3- Celeridad en la carga y descarga: no podemos trabajar de manera ágil e implican mano de obra innecesaria', 'Las oportunidades de este proyectos son muy claras y de beneficios inmediatos:\r\n- Entregas en tiempo y forma\r\n- Eficiencia en la carga de los camiones\r\n- Evitar la aglomeración de camiones de carga y descarga\r\n- Evitar las pérdidas por derrames', 'Actualmente la zona de carga y descarga es de brosa afirmada, dificultando trabajar los días de lluvia, con un nivel alto de polvo en el ambiente en los días secos y muchas demoras y perdidas por la irregularidad en el terreno donde transita el autoelevador', 'Entre Ríos Recicla SRL, fue constituida en 2015 en Rosario del Tala, con socios locales e inversión personal de ellos, con el objetivo de atender la demanda en el reciclado de materiales post-industriales, post-agricolas y post-consumo.', 'La empresa adquirió un predio en el Parque Industrial de Rosario del Tala en el año 2019, donde hemos construido 1.000mts2 de galpones y trabajamos las 24hs los 7 días de la semana, siempre con fondos propios y recursos locales.\r\nLa producción actual es de 70tn/mes promedio, con la intención de aumentar la producción en un 30% durante el 2022.', 'Parque Industrial Rosario del Tala, lote 2', 'no presenta', 'Pellets de Polipropileno reciclado\r\nPellets de Polietileno reciclado\r\nLos mismos se utilizan en la fabricación de piezas plásticas (paragolpes, cajas de herramientas, caños, etc)', 'Los productos cumplen las mismas condiciones que las materias primas vírgenes, siendo un reemplazo directos de materiales importados.', 'Clasificación de materiales, agrumado, molienda y extrusión', 'La materia prima son rezagos plásticos post-industriales, post-agricolas y post-consumo', 'La empresa se dedica al reciclado generando prácticamente ningún desecho, solo algunas piezas que por su caracteristicas no permite ser reciclada.', 'El mercado es muy amplio, orientado a todo tipo de fabricación de piezas plásticas, como reemplazo a materiales vírgenes importados, generando ahorros en el costo de materia primas y disminución en la disposición de rezagos en basurales de cielo abierto.', 'Nuestros clientes, son todos aquellos que fabrican piezas plásticas, como por ejemplo, fabricantes de productos para riego, cajas plásticas de distinta aplicación, tritubos para el tendido de fibra óptica, entre otros.', 'Competimos directamente con materias primas vírgenes, producidas por multinacionales', 'Nuestros proveedores son entre otros:\r\n- Industrias: los rezagos de procesos productivos y productos defectuosos desechados\r\n- Agrícola: silo bolsa y otros packaging y envoltorios generados en los industria agricola-ganadera\r\n- Cooperativas: dedicadas a la clasificación y acopio de reciclables generado por los domicilios particulares\r\n- Pequeños clasificadores: personas dedicada a la recolección de reciclables.', 'Un punto muy importante en la empresa es la correcta clasificación de los materiales para evitar contaminaciones; siendo fundamental el conocimiento y capacitación del personal en el tratamiento de los mismo.\r\nActualmente se recicla un bajo porcentaje de materiales en el país, constituyendo una oportunidad para el continuo crecimiento de la empresa.', 'Construcción de un playón de maniobras para la carga, descarga y manipulación de la materia prima y productos elaborados', 'El trabajo sería realizado por un empresa de la zona, dedicada a la construcción de este tipo de obras, adquiriendo materiales por proveedores locales (malla sima y hormigón elaborado)', 'Esta obra permitirá un obtener un impacto inmediato en las condiciones laborales, ya que en días de lluvia el trabajo es realizado con grandes riesgos de deslizamiento del autoelevador, y en días secos evita la volatibilidad en el polvillo generado por el transito continuo.\r\nTambién genera beneficios económicos, ya que evita derrames de materiales y celeridad en la manipulación de camiones y mercadería.', 'Los productos a obtener son los siguientes:\r\n- Mallas sima: $750.000\r\n- Hormigón: $700.000\r\n- Servicios  y maquinaria contratados: $550.000', '- Celeridad en la carga y descarga\r\n- Ahorros economicos por tiempo de carga y descarga \r\n- Ahorros en perdida de materiales por derrame', '- Entrega en tiempo y forma a nuestros clientes\r\n- Descarga de materiales enviados por nuestros proveedores\r\n- Mejores condiciones laborales\r\n- Mejores condiciones para la clasificación de materiales', 'No presenta', 'No presenta', '2021-10-29 16:57:20', '2021-10-29 17:58:08'),
(138, 1678, 1725, 19, 1, 'AMPLIACIÓN SALA DE PROCESAMIENTO DE NUEZ PECAN', 'El emprendimiento está dedicado a la producción de nuez pecan, en todas las etapas, desde la cosecha hasta el acondicionamiento para la venta. Es liderado por Susana Nava. El proyecto tiene por finalidad realizar una ampliación edilicia en la sala de procesamiento de la nuez pecan. Se contempla la construcción de una nueva sala de aproximadamente 50m2, con piso de hormigón y techo. Este nuevo espacio servirá para realizar el proceso de limpieza y selección de la nuez, una vez cosechada.', '500000.00', 1, 1, 'El presente proyecto tiene por finalidad invertir el monto del crédito en una ampliación edilicia de la sala de procesamiento de la nuez pecan. Actualmente esta actividad se realiza en un espacio prestado, por carecer de infraestructura propia. El crédito sería de gran ayuda para la construcción de una nueva sala de aproximadamente 50m2, con piso de hormigón y techo. Este nuevo espacio servirá para realizar el proceso de limpieza y selección de la nuez, una vez cosechada.', '- Ampliación edilicia.\r\n- Mejoramiento del proceso de limpieza y acondicionamiento de la nuez pecan.\r\n- Inversión en infraestructura. \r\n- Optimización de los procesos, fundamentalmente en cuanto a los tiempos. \r\n- Posibilidad de crecimiento genuino del emprendimiento.', 'El crédito es una oportunidad para mejorar el proceso productivo de la nuez pecan. Resultan de vital importancia los 12 meses de gracia, previos a comenzar con la devolución del monto otorgado, debido a que la cosecha de nuez pecan se lleva adelante una vez por año, siento relevante tener un año para la construcción y una cosecha previa a la devolución.', 'Es una oportunidad para equipar con infraestructura propia los procesos. Actualmente, se realiza en un espacio prestado lindante a la plantación y, en ocasiones, se entrega a una empresa que se dedica al acondicionamiento para venta. Poder avanzar en esta construcción será una inversión que en el mediano plazo nos permitirá reducir costos y tiempos.', 'La plantación inicia en el 2001, en un campo propio de la Sra. María Susana Nava y nace como un emprendimiento a mediano y largo plazo. El campo tiene una superficie de 4,2 hectáreas y poco más de 400 arboles plantados, lo que se realizó de forma gradual. Fue muy difícil en el inicio insertarse en el mercado debido a que las mayores plantaciones de nuez pecan se ubican en la costa del uruguay y que es manejado principalmente por hombres.', 'La inversión inicial fue alta, ya que las primeras cosechas que arrojan ganancias se registran pasados los 15 años. Asimismo, en 2001, no se contaba con la tecnología aplicada a la producción como por estos días. Actualmente, me encuentro en la etapa de producción expansiva, con la colaboración y el trabajo de mi hijo, Victor Raul Ludi. A medida que crece la plantación y se desarrollan los arboles, es necesario invertir en infraestructura edilicia a fin de realizar los procesos completos.', 'El lugar es un campo de 4,2hs, de propiedad de la Sra. María Susana Nava. Se encuentra emplazado en Ruta 18, kilometro, 45,5 y Camino Vecinal de la Aldea San Antonio, Departamento Paraná.', 'No se realiza alquiler ni arrendamiento.', 'La nuez pecan es un fruto seco que crece en árboles de nogal. Entre Ríos se posiciona como la provincia de mayor extensión de suelo cultivado. Es un fruto noble con gran cantidad de propiedades tradicionales y valor alimenticio para una dieta saludable.', 'A medida que el árbol crece, es necesario aplicar tecnología para los procesos. Cosecha: se realiza con un shaker y una cosechadora. Limpieza: se realiza con un cleaner (línea industrial de turbina, armadillo y cinta). Además, a futuro pensamos invertir en cámara de frío y maquina para pelado.', '1) Implantación del monte frutal. 2) Crecimiento de arboles. 3) Producción de la fruta. 4) Cosecha. 5) Acondicionamiento y limpieza. 6) Venta mayorista y minorista. \r\nSe aclara que la implantación se realiza en los meses de invierno de cada año, con extremos cuidados por la fragilidad del árbol joven', 'La materia prima es el fruto de la nuez pecan, el que en procesos de industrialización puede convertirse en: aceite de nuez pecan; harina de nuez pecan;  subproductos comestibles tales como: nuez caramelizada, nuez saborizada salada, nuez con chococolate, garrapiñadas, galletitas dulces, alfajores.', 'Los desechos que la producción genera, se vuelven a reutilizar para abonar el suelo debido a que está formado por material vegetal (materia orgánica). Esto quiere decir que las hojas secas, cascaras (ruezno) y ramas, vuelven al proceso productivo como abono, generando un circulo virtuoso de utilidad', 'El mercado externo se canaliza con la entrega a Cooperativa  La Agrícola Regional de Crespo a fin de la posterior exportación. En el mercado interno se intenta canalizar a través de la venta directa.', 'Los clientes están conformados por: Cooperativa La Agrícola Regional; dietéticas, maxikioscos, distribuidoras mayoristas, verdulerias, entre otros.', 'En la provincia de Entre Ríos existen cada vez más suelos cultivados con nogales, destacándose aquellos que han podido invertir en maquinaria, tecnología y espacios adecuados. No obstante, debido a los elevados costos que conlleva la producción, trabajamos de manera mancomunada con otros productores independientes.', 'La Agrícola Regional Coop. es la proveedora de los insumos agropecuarios, tales como: fertilizantes, granulado y foliares, bolsones BIG, etc.', 'El mayor riesgo es el climático, impredecible y que puede hacer perder un año entero de trabajo. Esto sucedió en distintas oportunidades, siendo la ultima en 2019. La estrategia es poder optimizar tiempo y cosechar rápidamente a fin de conservar la nuez en su estado optimo, para ello resulta necesario este crédito.', 'QUINIENTOS MIL ($500.000)', 'Este emprendimiento es llevado adelante por madre e hijo, con la proyección de sumar personal una vez que se cuente con la infraestructura adecuada. No obstante, se aclara que la maquinaria que se ha adquirido, se ha ensamblado con mano de obra local, lo mismo que las tareas respecto a la colocación de bomba de agua y luz.', 'Socialmente la nuez pecan es un alimento excelencia por sus propiedades nutricionales. El monte cultivado aporta al medio ambiente a atenuar el efecto invernadero y preservar la biodiversidad. Las copas son pulmones naturales proveedores de oxigeno en grandes cantidades. En materia económica, la producción de nuez pecan dinamiza el mercado interno, cada día más competitivo, y el externo a través de la exportación.', 'Precio internacional por kilo: u$s 3,4. \r\nPrecio de venta minorista: $500 el kilo con cáscara, $1500 pelada. \r\nPrecio de venta al por mayor (mercado interno): $350 con cáscara, $1000 pelada.', '- Posibilidad de expansión productiva genuina. \r\n- Conocimiento y no saturación del mercado.\r\n- Posibilidad de desarrollo turístico de la plantación (visitas guiadas).', '- Tendencia a una nueva forma de vida, adquiriendo hábitos alimenticios saludables. \r\n- El producto es noble y con durabilidad en el tiempo con los cuidados básicos. \r\n- Apertura a nuevos mercados.', '- Competencia con la nuez mariposa, que está más consolidada en el mercado.\r\n- La alternancia en la cosecha (un año bueno, un año malo), hace perder la previsibilidad como así también dificulta la comercialización.', '- Cuestiones climáticas.\r\n- Al ser un proyecto de larga duración, requiere más de 15 años para equilibrar la balanza comercial.', '2021-10-31 17:13:48', '2021-10-31 18:13:29'),
(141, 333, 1730, 24, 1, 'MEJORA RAZA HACIENDA VACUNA', 'EL PRESENTE PROYECTO SIGNIFICA PARA LA EMPRESA LYDER S.A.S. C.U.I.T. Nº 30-71646889-1 UNA IMPORTANTE OPORTUNIDAD DE NEGOCIO PARA MEJORAR LA COMBINACION GENETICA ACTUAL, AUMENTAR EL NUMERO DE CABEZAS DE GANADO, Y MUY IMPORTANTE EN ESTOS TIEMPO, MEJORAR EL PORCENTAJE DE RENTABILIDAD.-\r\nACTUALMENTE, LA EMPRESA CUENTA CON 101 VIENTRES, CON TODAS LAS CONDICIONES DE REPRODUCCION.-', '2000000.00', 0, 0, 'REALIZAR UNA CABAÑA DE RAZA PARA PODER INCURSIONAR EN ESTA ÁREA DE LA GANADERIA, BUSCANDO ACCEDER A UNA MEJOR RENTABILIDAD, RESPECTO A LA VENTA DE REPRODUCTORES Y VIENTRES.-', '- MEJORAR LA COMBINACION GENETICA ACTUAL DEL RODEO.-\r\n- AUMENTAR EL NUMERO DE CABEZAS DE GANADO.-\r\n- MEJORAR EL PORCENTAJE DE RENTABILIDAD.-', '- HACER USO DE ESTA OPORTUNIDAD DE FINANCIACION PARA LOGRAR UN SUEÑO QUE ESTÁ LATENTE DESDE EL INICIO DE ESTA EMPRESA: LOGRAR TENER GANADO DE GENETICA RECONOCIDA.-\r\n - SER SER NECESARIO, SE MANEJA LA POSIBILIDAD DE CONTRATAR MANO DE OBRA RURAL PARA EL DESARROLLO DE LA ACTIVIDAD.-', 'ACTUALMENTE SE ESTÁ APOSTANDO A LA ACTIVIDAD GANADERA, TRABAJANDO CON 101 CABEZAS DE GANADO (vientres) , EN UNA PROPIEDAD ARRENDADA, YA QUE LA EMPRESA NO CUENTA CON INMUEBLE RURAL DE SU PROPIEDAD.-', 'LA EMPRESA LYDER S.A.S. TUVO SU COMIENZO EN ABRIL 2.019, ES INTEGRADA POR 3 SOCIOS CON IGUAL PARTICIPACION SOCIETARIA.- SU ACTIVIDAD PRINCIPAL ES EL CULTIVO DE CEREALES, PERO TAMBIEN SE HA DEDICADO AL TRANSPORTE AUTOMOTOR DE CARGAS, CONTANDO CON UN EMPLEADO EN RELACION DE DEPENDENCIA, Y A LA VENTA DE INSUMOS AGROPECUARIOS DIVERSOS, ADEMAS DE BRINDA SERVICIO DE APOYO AGRICOLA PERMANENTE.', 'ACTUALMENTE, ADEMAS DE CONTINUAR CON LAS ACTIVIDADES ECONOMICAS DESARROLLADAS PRECEDENTEMENTE,  DESDE JULIO DE 2.020 SE HA DADO INICIO TAMBIEN A LA CRIA DE GANADO BOVINO, BUSCANDO DIVERSIFICAR LA ACTIVIDAD AGROGANADERA, Y COMPLEMENTANDO LA MISMA CON EL TRANSPORTE DE CARGAS, LOGRANDO UNA IMPORTANTE PRESENCIA EN EL MERCADO LOCAL..', 'ARRENDADO', '- ARRENDO: 01/06/2021 AL 21/05/2024\r\n- PRECIO: 4.5 KG CARNE/HA/MES, EN BASE AL INDICE DE NOVILLO MERCADO DE LINIERS, PAGADERO DE MANERA ADELANTADA.-', '- CALIDAD EN EL RODEO DE CRIA,\r\n- EFICIENCIA EN LA REPRODUCCION A BASE DE GENETICA', 'APUNTAN A LAS TECNOLOGIAS PROPIAS DE LA ALIMENTACION DEL BOVINO EN GENERAL Y LA PROVISION DEL AGUA.-', 'SE PRETENDE LLEVAR ADELANTE UN PROCESO PRODUCTIVO EN REPRODUCTORES Y VIENTRES SELECCIONADOS DE MANERA SEPARADA, YA SEA PARA VAQUILLAS EN SERVICIO, VAQUILLONAS CON GARANTÍA DE PREÑEZ Y TAMBIEN EN LOS NOVILLOS, EN SUS DIFERENTES CATEGORIAS.-', 'NO APLICA', 'NO APLICA', 'LA EXPANSION DEL ESTABLECIMIENTO DE CRIA QUE SE ESTÁ GESTANDO ESTARÁ ORIENTADO A SATISFACER DEMANDAS DEL MERCADO INTERNO, NO SOLO PARA EL CONSUMO SINO TAMBIEN COMO PROVEEDORA DE REPRODUCTORES PUROS POR CRUZA O DE PEDIGREE.', 'PRODUCTORES PECUARIOS DE LA PROVINCIA DE ENTRE RIOS, CON MIRA A LA EXPANSION EN EL LITORAL ARGENTINO, QUE DESARROLLEN SU ACTIVIDAD NO SOLAMENTE EN CABAÑAS SINO TAMBIEN EN ESTABLECIMIENTOS MIXTOS.-', 'EN UN SONDEO DEL MERCADO, HEMOS DETEREMINADO QUE EXISTE DEMANDA INSATISFECHA, LO QUE NOS INCITA A DESARROLLAR ESTE PROYECTO YA QUE LA OFERTA ACTUAL NO ALCANZA A CUBRIR LOS REQUERIMIENTOS DEL SECTOR.-', 'NOS RELACIONAREMOS CON OTROS PRODUCTORES ZONALES QUE YA ESTAN EN DESARROLLO DE ESTE TIPO DE ACTIVIDAD, Y TAMBIEN INTENTAREMOS RELACIONARNOS CON CABAÑAS RECONOCIDAS.-', 'COMO TODO NUEVO EMPRENDIMIENTO, HEMOS EVALUADO LOS DISTINTOS RIESGOS QUE PUEDEN SUSCITARSE TALES COMO CLIMATICOS, ATENCION SANITARIA, FLUCTUACIONES EN EL MERCADO, ETC. PARA LO CUAL NOS ESTAMOS ASESORANDO CON PROFESIONALES ESPECIALIZADOS EN CADA MATERIA, PARA TRABAJAR DE MANERA CONJUNTA Y MINIMIZAR LOS MISMOS.-', '- ADQUISICION DE VIENTRES Y REPRODUCTORES DE RAZA.-', 'SI EL PROYECTO ES RENTABLE, ES UNA DE LAS PRINCIPALES INTENCIONES, CONTRATAR PERSONAL EFICAZ PARA LA REALIZACION DEL MISMO.-', 'NO APLICA', 'EN EL MERCADO ACTUAL UN VIENTRE DE RAZA ESTARIA VALUADO APROXIMADAMENTE EN $90000 Y UN REPRODUCTOR APROXIMA LOS $240000.-', '- EXISTENCIA DE TECNICAS PARA PARA AUMENTAR LA PRODUCCION DE FORMA RENTABLE,\r\n- POSIBILIDAD DE COMPLEMENTAR LA PRODUCCION AGRICOLA Y GANADERA,\r\n- AGREGADO DE VALOR ECONOMICO A LA HACIENDA ACUAL.-', '- PROFUNDIZACION DE LOS ESQUEMAS DE INTEGRACION ECONOMICA REGIONAL,\r\n- GENERACION DE INFORMACION, TRANSFERENCIA Y CAPACITACION DEL PRODUCTOR Y DEL PERSONAL,\r\n- VINCULACION DE NEGOCIACIONES DE MANERA REGIONAL E INTERNACIONAL.-', '- BAJA PRODUCTIVIDAD DEL SECTOR PRIMARIO,\r\n- DIFICULTADES PARA SATISFACER LOS REQUERIMIENTOS DE LOS COMPRADORES EXTERNOS,', '- INCLEMENCIAS CLIMÁTICAS,\r\n- ELEVADOS CONSTOS DE LOS SERVICIOS (TRANSPORTE, COMUNICACION, ENERGÍA, ETC),\r\n- ELEVADO INDICE DE TASAS E IMPUESTOS,(NACIONALES, PROVINCIALES)\r\n- CARGAS SOCIALES MUY ELEVADAS,\r\n- FALTA DE UNA POLITICA GANADERA QUE PERDURE A TRAVES DEL TIEMPO.-', '2021-11-04 13:04:30', '2022-06-08 12:18:50'),
(143, 1666, 1702, 19, 1, 'CENTRO DE VISITANTES EN ANP LA ESMERALDA', 'La construcción del centro de visitantes es la actividad central del proyecto para lanzar al público una nueva propuesta de turismo ecológico en la región centro norte de Entre Ríos que tienen la División Turismo del ANP La Esmeralda en cercanías a la localidad de Hasenkamp, a solo una hora de la capital provincial. Es una propuesta innovadora y diferencial porque se ofrece al turista, visitas guiadas con cientificos locales que estudian diferentes componentes del ecosistema bosque nativo.', '2999999.00', 1, 0, 'La división turismo del ANP La Esmeralda tiene por objetivo la implementación del uso recreativo y turísmo ecológico adecuado de los ambientes boscosos.  Esto se sustenta en la valorización ambiental de la biodiversidad en un territorio altamente fragmentado, en la cual, cuenta con ambientes en diferentes estados de conservación, y la población urbana como rural pueden conocerla.', 'El objetivo central del proyecto es la construcción de un centro de visitantes para recibir a turistas locales, regionales, nacionales e internacionales y tengan la posibilidad de recorrer el Area Protegida La Esmeralda. El mismo resguarda al bosque nativo típico del Espinal Mesopotámico, es decir, un paisaje fragmentado por el desmonte en el cual las áreas remanentes, presentan un alto nivel de conservación que albergan una diversidad de flora y fauna nativa.', 'Desde el aspecto turistico presenta una oportunidad para la región centro-norte del territorio entrerriano. La ausencia de alternativas y propuestas similares en la región genera una oportunidad importante, por un lado, contribuyendo a la cuidado del medio ambiente local, y por otro, favoreciendo al desarrollo del territorio aumentando la mano de obra y las economías regionales.', 'Actualmente el proyecto presenta un grado de avance importante en cuanto a la diagramación y armado de los senderos. Por otro lado, se ha comenzado con el mantenimiento y reparación de los alambrados perimetrales protegiendo antes incendios forestales el patrimonio forestal nativo. En relación a lo estructural del centro de visitantes, se ha realizado la inversión de bajar la energía trifásica para garantizar la energía y sus derivados a los turistas que la visiten.', '‘La Esmeralda’, es un establecimiento agropecuario mixto donde se realiza la producción ganadera y agrícola de forma amigable con los ambientes naturales. Hace 40 años, ha sido un centro de estudio importante para el conocimiento de numerosos aspectos del ecosistema dominante más importante. Todos estos conocimientos mayoritariamente estuvieron asociados a numerosos proyectos de investigación, desarrollo, innovación y transferencia; que actualmente continuan.', 'A paritr de lo mencionado anteriormente, se desprende el fuerte compromiso que tiene el ANP La Esmeralda en la difusión y transferencia de esos contenidos que aportan al entendimiento y mitigación de los efectos y soluciones al cambio climático global. Teniendo en cuenta estas acciones, en los últimos años, se comenzó la elaboración de un Proyecto de Producción y Conservación de estos ecosistemas bajo el lema “conservar los ecosistemas es cuidar el presente y futuro de la humanidad”.', 'La actividad de desarrollaría en una propiedad del titular del proyecto.', '-', 'La construcción de un centro de visitantes (salón de usos múltiples) para público en general debe contar con instalaciones básicas de higiene personal, sanitarios, vestidores, senderos de recorrida, sitios de descanso y esparcimiento, entre otros.', 'Se utilizarán materiales amigables con el medio ambiente, principalmente se buscará construir con madera exótica, como pino o eucaliptus.', 'Se utilizarán procesos que sean amigables con el medio ambiente, por ejemplo la utilización de energía solar para calentar agua en los sanitarios, como así también la implementación de biodigestores para los residuos cloacales.', '-', 'Se generarán desechos propios de una actividad turistica, en el cual se realizarán las vinculaciones necesarias con los municipios locales mas cercanos para realizar el reciclaje adecuado en sus centros de tratamiento, en lo que respecta al plastico, papel, carton, vidrio y metal.', 'El mercado actual es escaso en la región, la ausencia de oferta de este tipo de propuestas hace que el proyecto tenga un potencial desconocido en cuanto a su techo de visitantes. La pandemia que estamos transitando ha ocasionado un cambio sustancial en la elección de los centros de turismo, siendo las alternativas verdes y ecológicas una alternativa de elección frecuente por la población urbana de los pequeños, medianos y grandes poblados.', 'Los clientes de la propuesta es el público general. En una primera instancia se preve la relación con las escuelas primarias y secundarias de la región, a los efectos de incentivar al cuidado del medio ambietne. Posteriormente, y en forma paralela, el publico general será recurrente, teniendo en cuenta que es una proupuesta turistica alternativa y diferente a las que están disponibles en la región.', 'No se conoce competencia directa de este tipo de turismo en forma privada en la región centro-norte de la provincia de Entre Ríos, lo cual supone un potencia interesante para desarrollar esta actividad productiva.', 'Una política de la empresa es la implementación de mano de obra local para el desarrollo de este empremiento, como así también para su posterior funcionamiento. En este sentido, los proveedores de alimentos, materiales de construcción, y de servicios, entre otros, se le dará prioridad a la región, con excepción de aquellos que no estén disponibles.', 'La accesibilidad al predio puede suponer un presunto riesgo, dado que no se cuenta con un camino afirmado para entrar y salir ante eventualidades climáticas. Si bien sólo son 4 km hasta acceder al camino de ripio mas cercano, da a suponer un riesgo para el normal desarrollo de la actividad, pero con estratégias de solución paleativas en cuando a una correcta conservación del camino actual.', 'El monto solicitado será destinado en su totalidad para la construcción de un centro de visitantes con materiales amigables con el medio ambiente, en la cual se pueda ofrecer todas las condiciones mínimas y necesarias para los visitantes, como por ejemplo, instalación de sanitarios, duchas, sitio o lugar de alimentación, proveduría, entre otros espacios comunes.', 'La construcción estaría a cargo de empresas locales o regionales que tendrán a cargo el personal necesario para tales fines.', 'La región presentará una oferta productiva innovadora de bajo a nulo impacto ambiental, en el cual permitiría al mediano y/o corto plazo el desarrollo turistico ecológico qeu vincule la costa del Río Paraná, en el cual involucra a toda la población local, pero también hay que destacar la ubicación del ANP La Esmeralda con las rutas del Mercosur, por lo tanto es factible un turismo internacional.', 'Instalación y Desarrollo del Centro de Visitantes con 45 m2 en madera incluyendo materiales y mano de obra (aproximadamente $1.500.000 pesos)\r\nInstalación de biodigestor para el tratamiento cloacal (aproximadamente $350.000 pesos)\r\nInstalación de termotanque solar para los sanitarios y espacios comunies (aproximadamente $150.000 pesos)', 'El proyecto presenta un sustento importante en cuanto al grado de avance que actualmente tiene en la diagramación de los senderos para la visita de los turistas. Por otro lado, se cuenta con capacidad técnico-científica profesional para que los mismos adquieran información sólida sobre los ecosistema que se conservan en el ANP La Esmeralda en cuanto a su funcionamiento, utilización y estado actual. Otro aspecto importante es la cercanía a los centros urbanos.', 'El desarrollo de este proyecto supone una oportunidad importante por un lado para iniciar las etapas del centro turistico de la empresa, y por otro lado, la mas importante, es una oportunidad para que la sociedad pueda interiorizarse en ecosistemas típicos de la región Mesopotámica. Además es importante mencionar que es una actividad productiva de muy bajo impacto ambiental, en el cual la transformación de los recursos naturales intervinientes es escasa a nula.', 'La debilidad del proyecto radica en la accesibilidad actual hasta el ANP La Esmeralda. Si bien se cuentan con caminos de tierra mejorados, en determinados momentos del año en el cual la actividad agropecuaria de la región es mayor, los caminos se ven deteriorados. Esta situación podría afectar a la accesibidad de los turistas y visitantes que quieran acceder al mismo cuando las precipitaciones se hagan frecuentes.', 'Los cambios de paradigmas mundiales en cuanto al cuidado del medio ambiente, permiten suponer que no existíra una amenza externa en el cual los visitantes no vayan al ANP La Esmeralda. La puesta en valor de los recursos naturales ha aumentado en los útlimos utlimos años, y por ende, es nuevo punto de atracción al momento de destinar un fin de semana libre para el esparcimiento de las personas.', '2021-11-06 21:52:14', '2022-02-07 16:03:06'),
