DE TRABAJOS QUE NO ESTA EXPLOTADO EN EL DPTO', 'COSTO DE INSUMOS', 'RENTABILIDAD RESPECTO AL DOLAR', '2021-11-08 11:25:56', '2021-11-08 13:17:56'),
(147, 333, 303, 19, 1, 'INSUMOS AGRICOLAS', 'EL PRESENTE PROYECTO SIGNIFICA PARA MI EXPLOTACION UNIPERSONAL UNA IMPORTANTE OPORTUNIDAD DE NEGOCIO PARA AUMENTAR LA PRODUCCION ACTUAL AGRICOLA; TAMBIEN TIENE LA INTENCION MUY IMPORTANTE EN ESTOS TIEMPO, MEJORAR EL PORCENTAJE DE RENTABILIDAD,BUSCANDO UNA EXPANSION ECONOMICA.-', '2000000.00', 0, 0, 'REALIZAR UNA EXTENCION DE MI ACTUAL EMPRENDIMIENTO, PERSIGUIENDO CRECER EN EL NUMERO DE HECTÁREAS SEMBRADAS ACTUALES, BUSCANDO ACCEDER A UNA MEJOR RENTABILIDAD.-', '- INCREMENTAR LOS INGRESOS REALES, \r\n- INCREMENTAR LA PRODUCTIVIDAD Y PRODUCCION DE GRANOS BÁSICOS,\r\n- AUMENTAR LA PRODUCCION DE CULTIVOS PERMANENTES,\r\n-  OBTENER UN USO ADECUADO DEL SUELO A FIN DE MINIMIZAR LOS RIESGOS DE LA EROSIÓN.', 'HACER USO DE ESTA OPORTUNIDAD DE FINANCIACION PARA LOGRAR UN SUEÑO QUE ESTÁ LATENTE DESDE EL INICIO DE ESTA EXPLOTACION: LOGRAR UNA EXPANSION EN EL ÁREA AGRICOLA ACTUAL- SER SER NECESARIO, SE MANEJA LA POSIBILIDAD DE CONTRATAR MANO DE OBRA RURAL PARA EL DESARROLLO DE LA ACTIVIDAD.-', 'ACTUALMENTE SE ESTÁ APOSTANDO LA EXPANSION, CONSOLIDACION E INTEGRACION DE LOS SERVICIOS, A FIN DE INCREMENTAR LA PRODUCCION, PRODUCTIVIDAD Y MEJORAR LOS INGRESOS.-', 'MI EXPLOTACION UNIPERSONAL COMIENZA EN EL AÑO 2017, DEDICANDOME A LA EXPLOTACION AGRICOLA. Y CONTINUANDO CON LA MISMA, HOY EN MENOR ESCALA POR SER SOCIO DE UNA S.R.L., PERO SIEMPRE MANTENIENDO LA INTENCION DE CONTINUARLA.-', 'ACTUALMENTE, ESTOY CONCENTRANDO TODA MI ACTIVIDAD ECONOMICA A LA EMPRESA LYDER S.A.S. CUIT 30-71646889-1, EN LA CUAL PARTICIPAMOS 3 SOCIOS, CON IGUAL PARTICIPACION DEL CAPITAL. \r\nSI BIEN MANTENGO MI EXPLOTACION UNIPERSONAL, ESTAMOS TRABAJANDO FUERTEMENTE CON LA EMPRESA, DEDICADA, ADEMAS DE LA AGRICULTURA Y GANADERIA, AL TRANSPORTE DE CARGAS GENERALES Y VENTA DE INSUMOS AGRICOLAS AL POR MAYOR.', 'ARRENDADO', 'EN CASO QUE EL PRYECTO RESULTE FACTIBLE, SE ARRENDARÁ UN INMUEBLE EN LA ZONA, DE 80 HAS.- LA TRANSACCION ESTÁ PENDIENTE POR LO QUE NO SE HAN FIJADO PLAZO, NI COSTOS.-', '- PRÁCTICA DE UNA AGRICULTURA SOSTENBLE, \r\n- APROVECHAMIENTO AL MÁXIMO DE LOS RECURSOS NATURALES (TIERRA, AGUA Y ENERGÍA)\r\n-  REDUCCION DEL IMPACTO MEDIOAMBIENTAL POR EL MAXIMO APROVECHAMIENTO DE LOS INSUMOS: FITOSANITARIOS Y SEMILLAS', 'SE ORIENTA A REDUCIR LA EROSION DE LOS SUELOS DEL ÁREA DEL PROYECTO, MEJORAR EL APROVECHAMIENTO DE LAS AGUAS DE LLUVIA, PARA LO CUAL SE INCORPORARÁN LAS PRÁCTICAS NECESARIAS PARA CADA CULTIVO', 'EL PROCESO PRODUCTIVO SE PUEDE DIVIDIR EN ETAPAS: SE COMIENZA CON LA PREPARACION DE LA TIERRA Y SIEMBRA DE LA SEMILLA, LUEGO DE UN CIERTO TIIEMPO DE CRECIEMIENTO, SE COSECHA LA SIEMPRA Y LUEGO ESTÁ LISTA PARA SER COMERCIALIZADA.', 'INSUMOS, FERTILIZANTES, AGROQUIMICOS, MANO DE OBRA', 'NO APLICA', 'LA EXPANCION DEL ESTABLECIMIENTO QUE SE ESTÁ GESTANDO ESTARÁ OPRIENTADO A SATISFACER DEMANDAS DEL MERCADO INTERNO.', 'COOPERATIVAS AGRICOLA, ACOPIADORES', 'HE DETEREMINADO QUE EXISTE DEMANDA INSATISFECHA, LO QUE NOS INCITA A DESARROLLAR ESTE PROYECTO YA QUE LA OFERTA ACTUAL NO ALCANZA A CUBRIR LOS REQUERIMIENTOS DEL SECTOR.', 'NOS RELACIONAREMOS CON OTROS PRODUCTORES ZONALES QUE YA ESTAN EN DESARROLLO DE ESTE TIPO DE ACTIVIDAD, Y TAMBIEN CON COOPERATIVAS AGRICOLAS', 'HE EVALUADO LOS DISTINTOS RIESGOS QUE PUEDEN SUSCITARSE TALES COMO CLIMATICOS, ATENCION SANITARIA, FLUCTUACIONES EN EL MERCADO, ETC. PARA LO CUAL NOS ESTAMOS\r\nASESORANDO CON PROFESIONALES ESPECIALIZADOS EN CADA MATERIA, PARA TRABAJAR DE MANERA CONJUNTA Y MINIMIZAR LOS MISMOS', 'SIEMBRA Y POSTERIOR COSECHA DE CEREAL, EN UNA PROPIEDAD ARRENDADA DE 80 HAS', 'DE SER NECESARIO, EL EL FUTURO SE TIENE EN MENTE LA CONTRATACION DE PERSONAL. ACTUALMENTE, NO SE CUENTA CON PERSONAS EN RELACION DE DEPENDENCIA.-', 'SE PRETENDE CUMPLIR CON LOS LABOREOS ACTUALES NECESARIOS EN CUANTO A LA ROTACION DE CULTIVO, ELABORACION DE TERRAZAS SI HAY EROSION DEL SUELDO, CON LA FINALIDAD DE CUIDAR LA TIERRA, EN LA MAYOR MEDIDA POSIBLE.', 'COTIZACION OFICIAL ACTUALIZADA - EN DOLARES', '- ACCESO A MERCADOS REGIONALES\r\n- PRESENCIA DE INSTITUCIONES PUBLICAS Y PRIVADAS VINCULADAS AL AGRO\r\n- CULTIVOS RENTABLES', '- ADAPTACION DE NUEVAS TECNOLOGIAS\r\n- ACCESO A COOPERACION TECNICA Y FINANCIERA.', '- USO DE AGROQUIMICOS,\r\nDEFICIENTE MANEJO DE RECURWSOS HIDRICOS\r\n- BAJA CAPACITACION EN TECNICAS DE CULTIVO', '- POLITICAS AGRARIAS INESTABLES,\r\n- DETERIORO ECOLOGICO POR EFECTO DE LA EROSION HIDRICA,\r\n- CONDICIONES CLIMÁTICAS,\r\n- MANEJO INADECUADO DE LOS RECURSOS NATURALES', '2021-11-10 13:20:20', '2021-11-11 14:26:11'),
(148, 1689, 1133, 19, 1, 'PRODUCCIóN DE MATE DE Té Y BLENDS DE YERBA MATE', 'AMANDOTE es una empresa que desarrolla Blends con y sin yerba mate, pensados desde la salud, con fórmulas desarrolladas para que no dañen nuestro organismo, cuidando el impacto de las infusiones en nuestro cuerpo. Además, somos la primer y única empresa del mundo en desarrollar comercialmente el Mate de Té, con una formula propia y todos los registros que se requieren para comercializar en el país productos alimenticios.- La empresa tiene llegada a todo el país a través de las ventas online.', '2000000.00', 0, 1, 'Desarrollo y producción de un nuevo blend de yerba mate.  -este proyecto consta de 4 partes: 1) desarrollar y registrar una nueva fórmula de blend de yerba mate que nos permita tener presencia en dietéticas y supermercados seleccionados; 2) Diseño del packaging; 3) compra de insumos para la producción; 4) Presentación de registros', 'El objetivo del proyecto es contar con un nuevo producto que pueda comercializarse en dietéticas, negocios de cercanía y supermercados seleccionados, para ampliar nuestro mercado y llegar a un nuevo público.', 'Este proyecto es la oportunidad de dar un salto como empresa a través del acceso a nuevos mercados, un aprovechamiento más eficiente de la capacidad instalada a través de un aumento de la producción con la nueva línea.-', 'Actualmente estamos haciendo pruebas para la nueva formula, este proceso se inicio en el mes de Mayo y suele llevar entre 3 y 6 meses de pruebas. Paralelamente nos encontramos en la búsqueda de nuevos proveedores para un packaging desde un concepto menos exclusivo y similar al imaginario de la yerba mate.-', 'AMANDOTE nació en 2018 con la propuesta de desarrollar mates que cuiden el organismo y aporten beneficios. Y de esta forma también dar a conocer nuestras costumbres, por eso nuestro primer producto fué el MATE DE TÉ, una mezcla de hierbas, frutas y flores, sin yerbamate.', 'Este año incorporamos la línea de Blends de yerba mate con dos productos: Dulce Concepción y Bendito Amargo. Ampliamos también la línea bazar de productos que acompañan nuestros mates como bombillas de alpaca, mates de acero, cerámica y madera, mates de vidrio forrados en cuero etc.\r\nHace 4 meses desarrollamos una nueva línea de negocios con la venta de regalos empresariales, lo que nos ha dado la oportunidad de ampliar nuestro alcance.', 'No poseemos', 'Alquiler. Inmueble de 6 ambientes, con habilitación comercial y RNPA. El establecimiento cuenta con áreas de producción, envasado, almacenamiento de stock y oficinas.- Contamos con contrato x 2 años mas', 'Son productos alimenticios. Formulados con diferentes mezclas (según el producto) de hierbas naturales, frutas deshidratadas, flores y yerba mate para ser consumir como infusión (en forma de té, mate de té y/o mate)', 'No aplica', 'Proceso:\r\n1.	Recepción y almacenamiento de materias primas\r\n2.	Recepción y almacenamiento de material de empaque\r\n3.	Control y limpieza de materias primas\r\n4.	Pesado de materias primas\r\n5.	Mezclado de materias primas\r\n6.	Envasado según la presentación\r\n7.	Acondicionamiento final para despacho', 'Las materias primas utilizadas son alimenticias, de origen natural. Las mismas son: hierbas naturales, frutas deshidratadas, flores y yerba mate.', 'Los residuos generados son sólidos alimenticios y sólidos provenientes de oficina y materiales de empaque. Todos asimilables a domiciliarios.\r\nLos mismos son almacenados provisoriamente en el establecimiento y luego retirados por la Municipalidad de Gualeguaychú para su disposición final.', 'El mercado se encuentra en pleno crecimiento.  En Argentina el 90% de los habitantes toma o tomo alguna vez mate, en muchos casos se bebe mas mate que agua. Cada vez más personas toman conciencia de la importancia de cuidar la salud a través de los alimentos. En  Amandote el propósito es sumar beneficios ( micronutrientes y minerales) a la tradición del mate.', 'Consumidores particulares y grandes empresas,  instituciones o administración publica para hagan uso de regalos empresariales.\r\nEl cliente objetivo son hombres y mujeres de de 35 a 60 años que buscan cuidar su salud y se preocupan por su bienestar. O tienen problemas de acidez y reflujo con un nivel socioeconómico medio alto.', 'El Mate de Té no tiene competencia y la línea de blends de yerba mate tampoco, ya que las que existen en el mercado causan acidez o reflujo', 'Todos nuestros proveedores son nacionales.\r\nTenemos alianzas para productos puntuales con proveedores de la provincia donde compramos toda la producción.- Desarrollamos proveedores localmente, les donamos las las plantas madres y se compra la totalidad de la producción. Además trabajamos localmente con emprendedores  para agregar valor a nuestra línea de bazar.-', 'Nuestro riesgo principal y único es  falta de Materia prima. Nuestra estrategia es generar alianzas con proveedores existentes y desarrollar proveedores propios. Esto último lo hacemos en la Ciudad de Gualeguaychú y Concepción del Uruguay. Queremos avanzar todavía más porque sabeos que hay campo para hacerlo y nos baja los costos de la logística, principalmente fletes, a la vez que nos garantiza la calidad de la materia prima.', 'Compra de materia prima e insumos para el packaging, para contar un stock suficiente para atender rápidamente a la demanda de un público más masivo en dietéticas, y supermercados seleccionados.-', '- Gabriela De La Torre: fundadora y gte gral de AMANDOTE\r\n- Paulo Alfonso, Director Técnico. Su rol es \r\n- Valeria Castro, Operaria', 'El beneficio claro para con los consumidores es por sobre todo su bienestar, ya que nuestros productos están pensados desde la salud y otorgan beneficios al organismo. Todas las personas que tuvieron que dejar de tomar mate porque les caía mal o les causaba acidez pueden volver a incorporar esta hábito/ costumbre tan nuestra. Por otro lado es una forma de dar a conocer también nuestras costumbres, ya que nuestros mates son suaves y tan diferentes que hasta a los extranjeros les gusta.', 'Nuestros precios son para el segmento alto de consumo, por eso buscamos desarrollar una línea de consumo mas amplio y para poder acceder a negocios como dietéticas y supermercados.- Esperamos contar un blend en presentación de 250 gramos que ronde los 500 pesos.', 'Empresa sana financieramente. No tiene deudas con terceros, todos los pagos están al día. Tampoco tenemos incobrables, el plazo máximo de pago para nuestras facturas es de 15 días y solo con grandes clientes. el resto es todo pago al contado/transferencia/mercado pago. Menos de un 5% de nuestras ventas se paga con tarjeta de crédito.-\r\nEstamos instalados en el mercado de los productos premium y saludables. Somos una empresa innovadora y en pleno crecimiento', 'Hoy tenemos una demanda que no podemos satisfacer por no contar con un producto de alcance más masivo.- Es una gran oportunidad de desarrollo para AMANDOTE y tenemos capacidad instalada para atender esa demanda', 'La falta de capital de trabajo que nos ralentiza nuestra operatoria y producción. No contar con un stock de materia prima que nos permita dar un salto en la producción.-', 'Nuestra gran amenaza es que nuestra materia prima venga infectada por insectos como polillas o gorgojos. Por eso la importancia en el desarrollo de proveedores y la alianza con proveedores que se manejan con nuestro nivel de cuidado de las materias primas, en cuanto a condiciones de humedad y temperatura.-', '2021-11-10 16:06:11', '2021-12-02 13:55:42'),
