(155, 1628, 1698, 19, 1, 'REACONDICIONAMIENTO DEL SISTEMA ELéCTRICO Y PUESTA EN FUNCIONAMIENTO DEL CNC', 'La empresa se dedica en un 50% a la producción de amoblamientos de cocina y un 50% a placares y vestidores.', '1900000.00', 0, 0, 'Para poner en funcionamiento las maquinas en un 100% de producción debemos ampliar la capacidad eléctrica a 15 KW. Esto nos obliga a adaptar la instalación eléctrica existente.  Con esto pondríamos en funcionamiento el CNC, la pegadora de cantos y el sistema de extracción de aserrín para su posterior envío a la planta recicladora de Ecoplst srl.', 'Lograr tener personal especializado para que todos los cortes y perforaciones se hagan mediante la utilización de maquinaria de control numérico lo que permite no tener errores y desperdicios de materiales.', 'Tener producción modulada e uniforme de todos los amoblamientos de cocina y dormitorio.', 'Actualmente tenemos instalado el CNC a un 60% y la pegadora de cantos al 5%', 'LINEAR AMOBLAMIENTOS es una empresa Argentina dedicada a la fabricación de amoblamientos para la casa y la oficina.\r\nNos orientamos a generar espacios funcionales de calidad y diseño. \r\nDisponemos de un equipo de diseñadores, arquitectos, vendedores y técnicos que nos permiten ser líder en amoblamientos a medida.\r\nAtendemos en Paraguay , Uruguay , Bolivia y Chile. Y ahora en Argentina podes visitarnos en nuestro deposito de Paraná Entre Ríos.', 'Estamos en una etapa para poder ampliar nuestra producción para poder retomar el camino del 2018 donde nos enfocábamos en el mercado de Uruguay.', '-', 'Galpón de 550 m2 ubicado en Av. ejército 1673, Paraná Entre Ríos. $60000', 'Muebles modulados construidos principalmente en revestimientos melamínicos, lacas, vidrios y pvc.', 'Se fabrican en base de MDF en vez de aglomerados como la mayoría de las empresas. Esta característica y los insumos FGV Italianos hacen que nos diferenciemos de la competencias tanto en Argentina como en R.O. del Uruguay.', '1-Ingreso de materias primas, 2-Corte de maderas, 3-Pegado de cantos, 4-Perforado, 5-Armado. Luego pasan a deposito para su posterior instalación.', 'Melaminas, herrajes metálicos, insumos FGV, acero inox.', 'Dentro del proceso productivo se generan en un 10 % de residuos de madera y un 90% de aserrín. Todo el material se traslada en bolsas de PPL recicladas a Ecoplast SRL en el parque Industrial de Paraná para su reciclado.', 'Actualmente nos centramos en la venta en Argentina.', 'Empresas y particulares.', 'Reno srl, Jonson Aceros sa, Arquicocinas SA.', 'Arrial Herrajes srl, Eurotecno SA, Placafe SRL', 'Incertidumbre económica y cierre de fronteras debido a la pandemia. \r\nEstrategia de centrarse y fortalecer el mercado dentro de la nación, a la espera de una mejor oportunidad para retomar con fuerza el mercado internacional.', 'Instalación del cableado interior dentro del Galpón de Av. ejército', '1 electricista y 2 ayudantes para la instalación. \r\n2 técnicos para incorporar a la planta permanente de la empresa', '18% de disminución eléctrica en el tiempo de iluminación y 50% en el consumo de energía para cortes de sierra.', 'Entre $30.000 y $400.000 aproximadamente.', 'Poco uso de mano de obra.\r\nInsumos de materias primas con largo margen de vencimiento.\r\nStock Propio.', 'Venta de amoblados a instituciones publicas y privadas en pos de la necesidad de mayor separación entre el personal debido a la pandemia.', 'Necesidad de un personal muy capacitado.', 'Inestabilidad cambiaria para volver al mercado exterior.', '2021-11-16 12:40:33', '2021-11-25 12:54:00'),
(156, 1693, 1747, 19, 1, 'PREMOLDEADOS', 'Soy Valeria Ocaranza, hace ya un tiempo trabajo con el cargo de gerente para la empresa familiar que hoy es La Picada Hnos SRL. Cuando comencé con el proyecto fui acompañada por JOVENES EMPRENDEDORES para poder acceder a la compra de distintos moldes para la fabricación de tubos de alcantarilla de hormigón, hoy trabajando en conjunto con la empresa mencionada  deseamos incorporar la producción de nuevos productos, tubos de alcantarilla de 80 y de 1 metro respectivamente de radio.', '2000000.00', 1, 0, 'Adquisicion de moldes para fabricacion tubos de hormigon mas aros base de 800  x 1200 y de 1000 x 1200', 'Producción de tubos alcantarillas de 800 x 1200 y de 1000 x 1200', 'Ofrecimiento para venta por mayor ya que actualmente no contamos con esos productos en mostrador y en ocasiones no podemos llegar con la oferta integral con otros productos por no contar con los que tenemos intención de incorporar.', 'Solo contamos con produccion de tubos de 400 y de 600 y no contamos con aros bases para mayor produccion diaria', 'Somos una empresa Familiar que trabaja hace ya mas de 45 años, con los comienzos en transporte de hacienda liderado por el padre de los socios actuales, anexando luego la venta de áridos por mayor.', 'Con la llegada en la linea de gerencia actual (Ocaranza Valeria) se incorporo la producción de premoldeados para la construcción (tubos de alcantarilla de hormigón, cámaras sépticas y postes para cercos),  continuando con transporte, corralon, ferreteria en salon de venta variado, pensado para nuestra zona rural.', 'Inmuebles linderos ubicado sobre ruta Nacional 12 km 26 1/2, propios, galpones cerrados utilizado tanto para depósitos, producción y salón de ventas.', 'Contamos con espacios propios', 'Productos de hormigón utilizando técnica de vibración.', 'Productos de hormigón utilizando técnica de vibración.', 'Preparación mezcla y hierros que hacen el molde, llenado de los mismos, vibración, tiempo de secado, desmolde.', 'Arena, piedra y como material ya procesado cemento y los hierros', 'Preparación mezcla y hierros que hacen el molde, llenado de los mismos, vibración, tiempo de secado, desmolde.\r\nNo hay desechos.', 'Canal minorista, linea de venta salon comercia y redes y contamos con canal mayorista  que es la provisión  de premoldeados para municipios, vialidad provincial asi como corralones y reventas.', 'Publicos y privados (comerciantes y consumidores finales', 'Escasa en nuestra zona (departamento Pna)', 'Son los proveedores de nuetro corralon, Loma Negra empresa reconocida a nivel nacional, asi como los hierros desde Acindar, luego los que proveen de áridos dentro de nuestra provincia.', 'Estrategias complementarnos con los otros rubros que trabajamos, transporte propio y venta de materiales contsruccion.', 'Compra de moldes de diametro  800 cm  y 1000 cm asi como sus aros bases.', 'Actualmente 1 persona y con la intencion de adquirir mayor cantidad de moldes incorporamos nuevos productos en lo que refiere a medidas para lo cual necesitamos un resurso humano mas. Cabe destacar que para nuestro pueblo ( La PIcada) es de importancia contar con fuente de trabajo ya que somos una localkidad muy pequeña donde los empleadores son los menos.\r\nSomos actuamentel de 9 flias que vivimos de este proyecto, si bien es pequeño en comparación a un resto para ntra localidad es significativo', 'mayor produccion, aumento RRHH.', 'Desde postes desde $2500, tubos desde $5000 ( 40cm) ha tubos de 1000 cm de aproximadamente $15000, pasando por tubos de 600 y 800 cm como cámaras septicas.', 'Complementación de rubros, transporte, vta x mayor de áridos y salón de ventas al publico.', 'Ventas al sector publico para mayores obras.', 'NO contar con capacidad productiva q lo dan los moldes.', 'Solo un receso a nivel pais porque en verdad son productos de necesidad, caudal de agua y pasos de vehiculos principalmente.', '2021-11-18 13:01:57', '2021-12-14 12:36:22'),
(157, 166, 154, 24, 1, 'ADQUISICION DE MAQUINARIA.', 'Nuestra empresa se dedica a la fabricación y venta de indumentaria personalizada, para empresas, escuelas, clubes y público en general.', '530000.00', 1, 0, 'Adquisición de una bordadora industrial que mejore la calidad de las terminaciones de las prendas y aumentar las ventas.', 'El objetivo de este proyecto es agilizar y garantizar a las empresas de la zona para que no tengan que preocuparse en buscar dicho trabajo en otras ciudades ya que por el momento somos los únicos que contamos con esa maquina en nuestra ciudad.', 'Aumentar el volumen de ventas, lo que conlleva a poder generar más puestos de trabajo.', 'Vemos la oportunidad de inversión, al adquirir esta maquina, motivo por el cual necesitamos una ayuda crediticia.', 'En nuestros inicios personalizábamos prendas mediante la sublimación, pero vimos que día a día los pedidos aumentaban, por lo que incorporamos otras alternativas, vinilo textil, maquinarias de última tecnología para aumentar así la producción.', 'Nos hemos posicionado muy bien en nuestra localidad y zonas aledañas, brindándonos la oportunidad de que grandes empresas, transportes, clubes día a día adquieran nuestros productos.', 'Contamos con local propio de 7mt de largo x 5mt de ancho, el cual se encuentra dividido, en la parte de adelante para atención al público y atrás nuestro taller de confección, estampado y bordados.', 'no precisamos pagar alquiler ya que el local es nuestro', 'Se confeccionan remeras 100% algodón que se personaliza con vinilo textil, también remeras 50% algodón y 50% poliéster que se subliman con tintas especiales para tal fin, además gorras de variados modelos los cuales se personalizan con vinilo textil o sublimación.', 'Permitir agilizar y aligerar el trabajo a mayor escala', 'Iniciamos con la compra del rollo de tela, se procede al corte de las prendas y su confección. Por otro lado, se edita el logo solicitado que la empresa desea colocar, se lleva a un plotter que se encarga de cortar el vinilo, finalmente se adhiere a la prenda mediante calor.', 'Telas de algodón y poliéster, hilos, elásticos, etiquetas, tintas para sublimar, vinilos textiles, gorras de variadas composiciones.', 'Durante el proceso de corte, los excedentes de telas se donan a talleres mecánicos, papeles y films de vinilo se separa en residuos inorgánicos que son enviados al la planta de tratamiento los días correspondientes.', 'Empezamos con pequeños clientes y poco a poco nos dimos cuenta que nuestro mercado estaba más enfocado a empresas, que adquieren más volumen de productos.', 'Nuestros clientes son empresas, negocios, emprendedor, que quiera que su marca quede reflejada en nuestros productos, ofreciendo un trabajo de alta calidad y terminación.', 'Hicimos un análisis y vimos que hay poca competencia en el mercado, especialmente en el rubro bordados, que es donde apuntamos a expandirnos', 'Nuestros proveedores en su mayoría son de Rosario, tanto en las telas, hilos, y regalos empresariales. Los vinilos los adquirimos en Santa Fe y la parte de papelería y tintas de una empresa de Bs As.', 'Tratamos de siempre entregar nuestra mercadería en tiempo y forma, haciendo hincapié en que los insumos sean de excelente calidad, evitando así perdidas de prendas.', 'El monto se destinará para la compra de una bordadora industrial marca MELCO de 16.', 'En la  empresa trabajamos mi señora y yo, ella se encarga de la confección de las prendas y yo del diseño y la personalización de las mismas.', 'Impacto económico: rapidez que nos permite mejorar el precio a nuestros clientes.\r\nSocial: al crecer tenemos la posibilidad e incorporar personal a nuestra empresa.', 'Bordadora industrial MELCO 16 HILOS $ 890.000', 'Confección propia de las prendas nos permite abaratar los costos y así mejorar el precio a nuestros clientes.', 'Creemos que es una oportunidad única ya que no hay una maquina similar en la zona.', 'demora en la entrega de nuestros trabajos.', 'La competencia puede ser una amenaza, pero día a día tratamos de brindar la mejor atención, precio y calidad para nuestros clientes y a su vez ir incorporando nuevos productos.', '2021-11-18 15:03:18', '2022-06-08 12:13:27'),
(159, 445, 1751, 19, 1, 'AMPLIACIóN DE CAPITAL DE TRABAJO', 'Viejo Molino se dedica principalmente a la molienda de trigo obteniendo como producto final harina de trigo, la cual se comercializa en envases de 50 y 25  kg; de dicha molienda se obtiene como subproducto el afrechillo el cual se envasa o se comercializa a granel.', '2000000.00', 0, 0, 'Readecuar maquinaria para envasado en presentaciones de 1 y 5 kilos, adquirir los insumos para las mismas (envases, descartables, palets, etc) y la materia prima para tal fin (trigo).', 'El objetivo es poner en funcionamiento envasado de harina de trigo en paquetes de 5 y 1 kilogramo, contamos con la maquinaria la cual esta en desuso desde hace varios años por lo cual el fin es realizar mantenimiento y puesta a punto y adquirir las materias primas para su producción final (envases, descartables, etc)', 'Crecimiento para la empresa, nos brindaría la posibilidad de atender las demandas que se presentan en el mercado, ofreciendo el producto en diferentes envases y cantidades lo que nos dará la oportunidad de conquistar otros puntos de ventas.', 'Actualmente se comercializa harina de trigo en envases de 50 y 25 kilos, y comercialización del subproducto que obtenemos el trigo como es el afrechillo, el cual se envasa de 30 y 25 kilos, o se comercializa a granel.', 'Viejo Molino es una empresa familiar creada por el Sr. Jorge Reibel, nace en 2012 cuando se adquirió un molino de unos 100 años aproximadamente el cual estaba abandono y durante el primer año se trabajo en su manteniendo, estructura a fin de retomar la molienda y la comercialización de la Harina de Trigo, y efectivamente en 2014 comenzó su funcionamiento envasando en bolsas de 50 kilos.', 'Continua siendo una empresa familiar conformado por Jorge Reibel y sus dos hijos, Carlos Reibel y Delfina Reibel. Se comercializa harina de trigo en envases de 25 y 50 kilos, y el subproducto que se obtiene de la molienda, afrechillo, en envases de 25 y 30 kilos y a granel.', 'Ubicado en Colonia Nueva, a 1 kilometro de la ruta 12, ingreso a Villa Urquiza. Es una estructura que fue construida hace muchas años para su funcionamiento como molino harinero, contando en su interior con las maquinas pertinentes.', 'Su propietario es Jorge Reibel, el socio mayoritario, quien alquila a la empresa Viejo Molino el inmueble con todas sus maquinarias y el predio que lo rodea para el ingreso y egreso de camiones. Lo alquila desde 2014.', 'Harina de trigo tipo 000, actualmente en presentación de 50 y 25 kilos', 'Envasado de 25 kilos valvuladas con envasadora regulada a dicho pesaje.', 'Trigo: Previo a la descarga, se realiza un análisis de calidad. El mismo es almacenado en silos; para luego ser ingresado a un proceso continuo de molienda y cernido, obteniéndose al final de este la Harina de Trigo y su subproducto (Afrechillo).', 'Trigo con calidad panadera.', 'Se trata de una industria seca que no produce desechos. Del proceso de elaboración se obtiene un único subproducto (Afrechillo de Trigo), el cual se comercializa para consumo animal.', 'Estamos dentro de un Mercado competitivo, donde nuestra eficiencia en los costos es lo que nos ayuda a ser rentables y competitivos.', 'Actualmente nuestros clientes son consumidores intermedios (panaderías) o distribuidores. Con esta nueva puesta en marcha la idea es ingresar al comercio minorista (supermercados, mercados, etc) para llegar con nuestros productos a los consumidores finales.', 'En cercanías tenemos plantas de molienda de trigo que actualmente competimos en la venta de harina de 25 kg para panaderías. Al empezar a producir de 1 y 5 kilos estaríamos en un mercado con menor competencia en nuestra área de influencia.', 'Mayormente los proveedores son de la zona, contamos con proveedores fijos y luego se presentan compra de trigo a nuevos proveedores en tiempo de cosecha.', 'El principal riesgo de nuestra actividad es que existen grandes competidores que son quienes manejan el mercado en cuanto a oferta y precios. Nosotros como Pyme que somos buscamos fortalecernos siendo eficientes en nuestros costos y buscando diversificar productos para no estar dentro de un solo mercado.', 'Destinado a capital de trabajo para poner en funcionamiento la maquinaria de envasado de 5 y 1 kilo. Poner a punto la estructura y adquirir envases, palets.', 'Actualmente contamos con 8 empleados quienes están destinados a la recepción de trigo, molienda, envasado y carga de mercadería. Para poner en marcha esta nueva rama de productos deberíamos contratar 2 empleados mas.', 'Ingresar al mercado con mas ofertas como es el caso del producto envasado de 1 y 5 kilos, brindar nuestro producto no solo a quien consume por mayor sino tambien llegar al consumo diario del hogar.', 'El 80% del costo de nuestros productos es el Trigo, el cual es un comoditi que cuenta con un precio variable atento al mercado. Si bien tenemos una política de estabilidad de precios lo mas larga posible en el tiempo, dependemos del costo del mismo. Actualmente la bolsa de 25 kg a retirar del molino tiene un costo de $ 800 + IVA.', 'Empresa familiar constituida por padre e hijos con grandes proyectos de crecimiento, esfuerzo, dedicación. La mayor fortaleza es la unión del equipo de trabajo y el potencial para dar crecimiento a nuestra empresa.', 'La empresa se encuentra en una zona donde las distancias a los centros de consumo nos ubica en una excelente posicion para abastecer dichos mercados.', 'Somos una empresa joven, que vamos haciendo experiencia de nuestros propios errores.', 'Como mencionábamos anteriormente los mayores competidores de este mercado tienen una posición predominante del mismo.', '2021-11-26 15:35:38', '2021-11-30 17:04:12'),
(160, 1701, 1752, 20, 1, 'NUEVO PROYECTO', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-11-29 12:31:34', '2021-11-29 12:31:34'),
(165, 1698, 1757, 19, 1, 'ADQUISICION DE EQUIPO DE ENRROLLADO', 'El presente proyecto contempla la incorporación de un nuevo equipo de enrollado de pasto (Tractor y Rotoenfardadora) mas la conclusión de galpón, para esto es que se solicita la asistencia.-  Con esto se conseguirá cubrir la demanda actual de servicios de calidad en tiempo y forma, captar mas clientes y brindar mas trabajo para jóvenes de la zona.-', '2000000.00', 1, 0, 'El proyecto consiste en incorporar un nuevo equipo de enrollado de pasto (tractor y rotoenfardadora) sumado a la conclusión de un galpón para guardado de maquinaria de 20x50 mts', 'El objetivo es captar nuevos clientes y satisfacer la demanda de los actuales productores que confían en nosotros.-', 'Esto significa para la firma lograr ampliar el mercado actual y brindar una nueva fuente de ingresos para una familia de la zona.-', 'Actualmente se desarrolla la actividad con un solo equipo de rotoenfardadora, sumado a maquinarias de siembra y cosecha.-', 'La firma comenzó a producir y explotar campos en 2014 con la idea de aplicar los conocimientos de contador e ingeniero agrónomo de mi cuñado, con el fin de brindar servicios de calidad y realizar buenas practicas agrícolas con el objetivo de producir cereales .- Siendo el objetivo final integrar toda la cadena y transformar el cereal en carne.-', 'Hoy la firma explota 180 has de agricultura y confecciona 4000 rollos aproximadamente a productores de la zona-', 'El lugar propio es un campo de 26 has ubicado en Crucesita 7ma propiedad de la famila', 'La actividad agricola se desarrolla en campos arrendados y la de rollos en campos de productores, de la zona de Crucesita 7ma.-', 'El servicio se destaca por la buena confeccion de los rollos', 'Las características del servicios es realizar el mismo con un equipo de tractor y roto enfardadora de ultima generación', 'El Proceso consiste en la confección de rollos de pasto (alfalfa, moha, ratrojo de trigo, sorgo, etc) para alimento del ganado', 'La materia prima es el pasto o cultivo que el productor desea guardar como rollos para la hacienda.-', 'no existen', 'El mercado es amplio atravesando altibajos por factores climaticos y externos a ellos.- Pero demandante de servicios de calidad', 'Los clientes son productores de la zona que buscan un producto / servicio de calidad para su hacienda', 'La competencia es variada con nuevos contratistas rurales', 'Los proveedores son firmas de la zona de influencia Jose Folmer e Hijos, Santiago Dugan Trocello SRL, COOPAR, Coop Gral Ramirez, LAR', 'los riesgos presentes son factores ajenos a la empresa, asociados con el clima mas que nada, los cuales se superan con buenas practicas agrícolas y prestación de servicio eficiente', 'Adquisición de equipo de enrollado y terminación de obras de galpón.-', 'Actualmente se emplea a 1 persona y se incorporara a otra mas', 'Se proyecta un  incremento de los ingresos del 10% de la actividad de enrollado, sumado a la reducción de costos operativos, mas la generación de una fuente de empleo', 'Los rollos se cobran $ 1350, el servicio de siembra $ 4000 /has, el de cosecha$ 6500/ has, el de pulverización $ 450/ has', 'Altos conocimientos del proceso de enrollado y de la actividad agrícola con personal capacitado (Ing Agronomo)', 'Amplio mercado de clientes y posibilidad de expansión.-', 'Falta de un equipo adicional de arrollado para cubrir la demanda.-', 'Surgimiento de nuevos contratistas rurales', '2021-11-29 22:18:26', '2021-12-06 14:36:30'),
(167, 1699, 1759, 19, 1, 'ILUMINAR', 'COMPRA DE PARTES DE PLACAS LED E INSUMOS CORRESPONDIENTES PARA ABARATAR EL COSTO DE LOS ARTEFACTOS A VENDER Y GENERAR MANO DE OBRA LOCAL', '2000000.00', 0, 0, 'COMPRA DE PARTES DE PLACAS LED E INSUMOS CORRESPONDIENTES PARA ABARATAR EL COSTO DE LOS ARTEFACTOS A VENDER Y GENERAR MANO DE OBRA LOCAL', 'NUESTRO OBJETIVO ES ARMAR ARTEFACTOS Y GENERAR MANO DE OBRA', 'ABARATAR COSTO DE LOS ARTEFACTOS Y SER MAS COMPETITIVOS ANTE LOS PRODUCTOS IMPORTADOS', 'ESTAMOS EN EL INICIO Y NECESITAMOS ADQUIRIR LOS INSUMOS PARA EMPEZAR EL ARMADO', 'NUESTRA PYME SE INICIO EN EL AÑO 1998 CON UN PEQUEÑO LOCAL EN CALLE ECHAGUE', 'ACTUALMENTE CONTAMOS CON 2 SUCURSALES Y  QUEREMOS SEGUIR AMPLIANDONOS', 'ALQUILAMOS 2 INSTALACIONES PARA DESARROLLAR NUESTRA ACTIVIDAD', 'LOS CONTRATOS DE ALQUILER SON POR 2 AÑOS', 'PLACAS DE LED, INSUMOS CABLES, PRENSACABLES, CONEXIONES POR BORNERA, FUENTES SWITCH', 'SERAN NECESARIOS LOS CONOCIMIENTOS DE SOLDADURA, ENSAMBLADO, MANEJO DE INSTRUMENTOS DE MEDICION Y LUMINOTECNIA', 'SE REALIZARAN EN FORMA DIRECTA SIN TERCERIZAR', 'ES MATERIA PRIMA ESTANDAR DISPONIBLE EN EL MERCADO NACIONAL', 'ES UN PROCESO LIMPIO QUE GENERA ESCASOS RESIDUOS', 'ES UN MERCADO EN CRECIMIENTO PORQUE EL CONSUMIDOR BUSCA REDUCIR EL COSTO DEL SERVICIO ELECTRICO Y A SU VEZ TENER PRODUCTOS DE BUENA CALIDAD', 'MAYORMENTE CLIENTES PARTICULARES DE CLASE MEDIA, EMPRESAS Y EL ESTADO, TANTO NACIONAL, COMO PROVINCIAL Y LOCAL', 'CREEMOS QUE NUESTROS COMPETIDORES TIENEN BUENA RELACION ENTRE EL COSTO Y LOS SERVICIOS OFRECIDOS, PERO ESTAMOS SEGUROS QUE LA DIFERENCIA LA HARIAMOS EN LA CALIDAD Y EL SERVICIO POSTVENTA', 'NUESTROS PROVEEDORES SON NACIONALES, Y NOS PROVEEN TANTO A NOSOTROS COMO A NUESTRA COMPETENCIA, Y HAY TANTO PYMES COMO EMPRESAS GRANDES', 'EL RIESGO MAYOR DE ESTE EMPRENDIMIENTO ES LA FALTA DE INSUMOS, QUE PODEMOS SUBSANAR COMPRANDO EN DISTINTOS PROVEEDORES', 'EL MONTO SOLICITADO SE UTILIZARA PARA LA ADQUISICION DE MATERIA PRIMA Y LAS HERRAMIENTAS NECES