(171, 1697, 1766, 24, 1, 'COMPRA DE EQUIPAMIENTO', 'La cooperativa de trabajo se origina por abandono patronal, motivo por el cual se recupero la fuente de trabajo.\r\nNuestro objetivo es crecer y mejorar el trabajo agregando fabricación de adoquines lo cual vemos una gran posibilidad por ser únicos en la zona de Victoria Entre Ríos.', '2000000.00', 1, 0, 'Necesidad de generar el trabajo', 'Aumentar la producción y crecer .', 'Crecimiento laboral con expectativa de expansionar debido al mercado a explotar.', 'Hoy en día es la explotación broza, que debido a la baja calidad y al bajo precio no lo vemos como un futuro.', 'La cooperativa se creo por accidente laboral debido al abandono patronal a fines 2002, hoy es una empresa recuperada debido a la intervención  judicial de ese momento.', 'Actualmente explotamos broza, la cual debido el bajo precio y baja calidad solo nos sirve para obtener un muy bajo sueldo y sobrevivir. \r\nLa idea de fabricación de adoquines se debe también a poder crecer y vivir seguramente.', 'La cooperativa funciona en planta y extracción de broza en predio arrendado.', 'Propio', 'Adoquines de 20 cm x 10 cm', 'Característica tecnológicas no tiene', 'Se mezcla la broza, cemento y arena , se lleva a un molde y se pone al secado.', 'Cemento, broza , piedras de descartes , agua y arena.', 'Los desechos se vuelven a reutilizar.', 'Por ser unos de los pocos que existen a nivel provincial, crece el nivel de mercado.', 'Nuestro clientes serian: Corrales beneficios, extracciones de servicios y vecinos etc.\r\nSerian un mercado importante debido a que no había en la zona fabricación de adoquines.', 'Los únicos en la ciudad.', 'Corralon CBC O Marunita', 'El flete,el aumento de costo de materia prima o exista mas adelante un nuevo productor de adoquines', 'Para comprar una maquina bocat e insumos.', '5 empleados.', 'el impacto económico seria generar mas empleos , y que la gente victoria tenga acceso al adoquin.', 'ARENA  METRO $ 670\r\nPIEDRA METRO $ 1200\r\nCEMENTO METRO $ 720', 'CREAR EL ESPÍRITU INNOVADOR DE CRECER.', 'PODER VENDER EN VICTORIA EN ADOQUINES Y GENERAR EMPLEOS.', 'PODEMOS ENCONTRARNOS DEBIDO A LA SITUACIÓN ECONÓMICA ACTUAL, NOS PODEMOS ENCONTRAR CON EL INCONVENIENTES DE QUE NO SE CUMPLAN CON LAS EXPECTATIVAS A FUTURA.', 'AUMENTO DE PRECIOS DE LA MATERIA PRIMA.', '2021-12-03 13:11:15', '2022-06-07 15:25:28'),
(173, 1711, 1768, 19, 1, 'NUEVO PROYECTO SANCHEZ', 'Compra de maquinaria pesada para aumento de producción y mequanizar las horas trabajadas', '1000000.00', 0, 0, 'Este proyecto es presentado por las siguientes razones: adquirir maquinaria pesada para el desarrollo diario de nuestras actividades lo que me permitirá aumentar la producción y mequanizar todo el sistema acortando las horas trabajadas', 'Crecimiento exponencial junto a nuestro pueblo', 'Oportunidad única para la empresa por que en este caso el que esté dinero sea adquirido no nos limita s seguir creciendo conforme las nuevas necesidades de nuestra localidad aparecen', 'Cumpliendo con lo requerido para tener un trabajo cómodo como por ejemplo el revestimiento entero de nuestro lugar de trabajo', 'Esta empresa arranca ya hace dos años con una oportunidad que supimos aprovechar ya que nos desarrollamos en la panificación vinos una demanda de nuestra gente para con una necesidad que no estaba siendo satisfacía fue entonces que nosotros dimos lo que nuestra gente requería productos de primera calidad junto a una atención de primera.', 'Actualmente gracias a el apoyo de nuestra gente y que no nos quedamos con los brazos cruzados obtuvimos un crecimiento del 100% en tan solo dos años', 'La empresa cuanta con cuadra de trabajo y local para atencion al cliente', 'No alquilamos, contamos con propiedad propia', 'Harina de trigo', 'Amazadoras soñadoras etc', 'Desde la creación de los productos de panificación  hasta su cocción y venta', 'Harina 000 sal agua levadura aditivos', 'Desechos son desde bolsa de harinas bolsas de levadura y/o el polvo que se genere mientras se trabaja', 'Tenemos un mercado exigente que necesita productos de primera,  una atención al público decente', 'Clientes críticos para con lo que adquieren de nosotros pero también muy comprensibles si alguna vez tuvimos algún fallo con muchas ganas de ayudarnos a seguir con esto', 'La competencia con la que contamos actualmente son solo los negocios a nuestro alrededor como por ejemplo autoservicios que venden pan', 'Proveedores con años de trayectoria que cumplen con nuestras exigencias al entregarnos la materia prima de primera calidad', 'Sin riesgos', 'Horno convector soñadora grande amenazadora pesada', 'Mi hijo de 20 años somos dueños y empleados negocio familiar', 'Oportunidad de generar una nueva fuente de empleo', 'Pan kg $180\r\nFacturas $40u', 'Ganas de salir adelanté nunca rendirnos a pesar de las circunstancias que nos rodeen como fue en nuestro caso la PANDEMIA', 'Creación de una base firme de trabajo', 'No contamos', 'Ninguna', '2021-12-07 11:12:59', '2021-12-07 11:40:55'),
(174, 1717, 1770, 20, 1, 'NUEVO PROYECTO', NULL, '2000000.00', 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-12-17 13:03:24', '2021-12-17 13:12:08'),
(175, 1713, 1769, 24, 1, 'ADQUISICION DE MAQUINARIA Y EQUIPAMIENTO PARA MEJORAS EN PRENDAS DE VESTIR', 'LA QUE SUSCRIBE, MARTINEZ DALILA EVANGELINA, SE DIRIGE A USTEDES CON EL PROPOSITO DE DAR A CONOCER LOS PASOS A SEGUIR EN MI NEGOCIO COMERCIAL: ACTUALMENTE TRABAJO EN EL RUBRO ELABORACION Y VENTA  DE HILADOS, TEJIDOS Y ARTICULOS DE MERCERIA Y LA IDEA A FUTURO EN EL CORTO PLAZO ES LA DE INCORPORAR MAQUINARIA Y EQUIPAMIENTO QUE ACTUALMENTE NO PUEDO AFRONTAR DEBIDO A COSTOS QUE ME PERMITIRAN MEJORAR LA CALIDAD Y TERMINACIONES DE LOS TRABAJOS.-', '700000.00', 1, 1, 'LA IDEA ES ADQUIRIR LA MAQUINARIA Y EQUIPAMIENTO NECESARIO PARA PODER ELABORAR PRENDAS DE CALIDAD EN CUANTO A TERMINACION ENTRE OTRAS COSAS.-', 'EL OBJETIVO DEL PROYECTO ES INCORPORAR MAQUINARIA Y EQUIPAMIENTO QUE PERMITIRA INCREMENTAR LOS VOLUMENES DE PRODUCCION Y VENTAS DEBIDO AL MAYOR MOVIMIENTO DE CLIENTES.-', 'LA OPORTUNIDAD ES LA DE PODER ACCEDER A OTRO TIPO DE CLIENTES Y AFRONTAR/CUMPLIR SUS NECESIDADES ACTUALES Y POTENCIALES INCORPORANDO PRODUCTOS Y SERVICIOS ADICIONALES DE ELABORACION DE PRENDAS/VESTIDOS.-', 'CUENTO CON UN LOCAL ALQUILADO QUE POSEE EL ESPACIO FISICO NECESARIO PARA PODER DESARROLLAR MI ACTIVIDAD Y CUENTO CON LA EXPERIENCIA SUFICIENTE PARA PODER ENCARAR ESTAS NUEVAS INVERSIONES/RETOS EN EL CORTO Y MEDIANO PLAZO.-', 'SOY UNA PYME JOVEN CON POCOS AÑOS DE ANTIGUEDAD EN EL SECTOR. MI ACTIVIDAD LA DESARROLLO EN LA LOCALIDAD DE LARROQUE DONDE MIS PRINCIPALES CLIENTES TAMBIEN SON DE ESTA LOCALIDAD. ES UNA ACTIVIDAD QUE ME HA PERMITIDO CRECER COMO EMPRESA UNIPERSONAL (MONOTRIBUTISTA) DESDE MIS COMIENZOS Y ESPERO CON ESTE NUEVO PROYECTO AVANZAR HACIA NUEVOS HORIZONTES Y CAPTAR MAS ZONAS Y/O CLIENTES DE MERCADO.-', 'CUENTO CON UNA AMPLIA VARIEDAD DE HILADOS, TEJIDOS, MATERIAS PRIMAS ENTRE OTROS QUE ME HAN PERMITIDO POSICIONARME EN EL MERCADO LARROQUENCE EN EL CUAL ACTUALMENTE POSEO UNA CLIENTELA SEGURA Y QUE SE HA FORTALECIDO CON EL PASAR DEL TIEMPO.', 'NO POSEE LOCAL PROPIO', 'EL LOCAL ESTA ALQUILADO POR EL PLAZO DE CINCO AÑOS CON LA IDEA DE AMPLIAR DICHO PLAZO SI ES QUE LAS PARTES NOS PONEMOS DE ACUERDO. ES UN LOCAL QUE ESTA UBICADO A EN UNA DE LAS ARTERIAS MAS IMPORTANTES DE LA CIUDAD DE LARROQUE, A SOLO 50 METROS DE LA AVENIDA PRINICIPAL DE ACCESO A LA LOCALIDAD.-', 'LA CARACTERISTICA TECNICA PRINCIPAL RADICA EN LA PROLIGIDAD EN LA CONFECCION DE DICHAS PRENDAS CON LA IDEA DE TENER LA CALIDAD SUFICIENTE PARA RETENER A LOS CLIENTES ACTUALES Y POTENCIALES.-', 'LA CARTACTERISTICA TECNICA ES EN PARTE CON LA UTILIZACION DE MAQUINARIA ESPECIFICA PARA LA ELABORACION DE DICHAS PRENDAS Y LA EXPERIENCIA SUFICIENTE PARA PODER PRESTAR EL SERVICIO DE CONFECCION DE LA MEJOR MANERA POSIBLE.-', 'EL PROCESO PRODUCTIVO CONSTA PRIMERAMENTE DE LA SELECCION DE LAS TELAS, LUEGO ESTABLECER PATRONES ACORDE, REALIZAR LOS CORTES CORRESPONDIENTES Y LUEGO EL ARMADO FINAL DE LAS PRENDAS CON LA UTILIZACION DE MAQUINARIA Y PRESTACION DE SERVICIOS DE LA EMPRESA.-', 'HILADOS, TEJIDOS Y ARTICULOS DE MERCERIA ENTRE OTROS.-', 'NO SE GENERAN DESECHOS Y/O RESIDUOS YA QUE TODO SE REUTILIZA.-', 'EL MERCADO ES LOCAL, POR LO PRONTO EXCLUSIVAMENTE EN LA LOCALIDAD DE LARROQUE PUDIENDO AMPLIAR HACIA OTRAS LOCALIDADES DE CORRESPONDER SI TODO PROSPERA DE ACUERDO A LO PLANEADO.-', 'CLIENTES FIELES, NIÑOS, JOVENES Y ADULTOS.-', 'NO HAY COMPETENCIA EN LA LOCALIDAD DE LARROQUE, SOLO NEGOCIOS SIMILARES QUE VENDEN ALGUNO DE LOS PRODUCTOS QUE LA EMPRESA COMERCIALIZA.-', 'SON PROVEEDORES LOCALES (ARGENTINA) Y QUE SE LOCALIZAN EN UN RADIO MUY CERCANO AL DOMICILIO DE LA EMPRESA.-', 'LOS RIESGOS SON MENORES Y LAS ESTRATEGIAS ESTARAN FOCALIZADAS EN LA CALIDAD POR EXCELENCIA EN LAS PRENDAS A ELABORAR.-', 'A ADQUIRIR MAQUINARIA Y EQUIPAMIENTO NECESARIO QUE PERMITIRA MEJORAR LA CALIDAD E INCREMENTAR LOS VOLUMENES DE PRODUCCION Y VENTAS.-', 'SES UNA EMPRESA FAMILIAR Y POR CONSIGUIENTE NO HAY EMPLEADOS EN RELACION DE DEPENDENCIA', 'ESTAS CUESTIONES SE VERÁN DE CORRESPONDER CUANDO ESTE EL PROYECTO ENCARADO Y EN FUNCIONAMIENTO.-', 'LOS PRECIOS ESTARÁN DE ACUERDO A LAS TELAS, HILADOS A APLICAR Y LAS EXIGENCIAS DE LOS CLIENTES.-', 'EXPERIENCIA EN EL RUBRO', 'CONTAR CON CLIENTELA FIJA Y SEGURA', 'NO PODER ACCEDER A LINEAS DE CREDITOS', 'NO HAY', '2022-01-17 19:24:19', '2022-06-07 15:28:09'),
(176, 1722, 1773, 19, 1, 'DESARROLLO DE ESTABLECIMIENTO DE CRíA DE BOVINO', 'Consolidar e incrementar la producción de Terneros de 200 Kgs en establecimiento Ganadero', '3000000.00', 1, 0, 'Retener y recrear las crías hembras a fin de convertirlas en futuras madres de calidad con genética de punta. Y a su vez elevar el indice de preñez y destete los próximos años en un 20%', 'Alcanzar el 92/95 indice de preñez y 80/85 indice de destete de terneros con 200 Kgs.- complementando con raciones de comida', 'Esta oportunidad es beneficiosa para incrementar la zafra de terneros  con buena genetica y rapido desarrollo posterior para su terminación y consumo', 'Actualmente existe un rodeo con alimentacion pastoril y reservas de rollos y picado y un destete al pie de la madre de 180/190 kilos. con un indice del 75 / 80 %.', 'Etablecimiento de 30 años de experiencia con rotacion periodica de chacras entre siembra de maiz/soja y pradera anual y monte nativos de reservas para las madres vacias', 'actualmente se cuenta con 400 vientres angus con buena genética y reproductores machos registrados, con obtención de 380 terneros anuales, con uso de mas de 30 trabajadores y servicios de terceros (veterinario, molineros, alambradores, mecánicos etc)', 'Establecimiento ubicado en distrito bergara del Dpto villaguay', 'Se arriendan 300 Hectáreas ubicadas en forma lindera', 'Se cuenta como se expreso con 400 vacas angus, 20 toros angus y aproximadamente con 380 terneros\r\nInstalaciones de trabajo, aguadas, tractores, micer, porta rollos , tolvas y demás Maquinas de trabajo de mantenimiento de abastecer de comida a la hacienda', 'Los productos obtenidos son de excelente calidad con genética de punta y buen desarrollo posterior', 'Es un típico establecimiento de cría con ciclo completo hasta la obtención del ternero de invernada.\r\nPara ello la alimentación sanidad, y bienestar de la hacienda son prioridad', 'Vientres (vacas) y Productores (toros), Alimentacion con maiz picado y rollos de Praderas, son elementos necesarios, Vacunacion preventiva de enfermedades tambien.-', 'Los desechos que se producen se acondicionan para su correcta degradación ( Lagunas de decantacion de mortandad infecciosa si las hubiera, recolección y venta de residuos plásticos etc.', 'Mercado de hacienda en ferias , televisado y demas tecnologías, donde se conoce el precio al dia con cierta facilidad de acceso. Tambien puede exitir ventas directas a particulares.', 'Consignatarios de Hacienda de la zona que periódicamente realizan remates ferias', 'Demas productores de hacienda de cria.', 'Cabañas con hacienda de calidad.  Servicios de labranza y demas tareas como poceros, alumbradores, veterinarias', 'Existen riesgos climaticos (sequias, inundaciones, tormentas) Se tratan de superar con buenas reservas  de alimentos. Enfermedades con prevención de vacunas', 'Incrementar el rodeo en 20% A través de incorporación y recrías de Vientres.-', '5 personas permanentes y 2 jornaleros', 'esto lleva a mayor demanda de insumos y personal para el manejo de rodeo y también mayor demanda de servicios', 'Actualmente un vientre Vaca tiene un valor de 60.000 y una ternera 45000', 'es una actividad de poco riesgo y mantiene su valor en el tiempo', 'La actividad tiene un gran margen de crecimiento y desarrollo para animales de calidad, por el crecimiento de la demande interna y externa', 'La ocurrencia de un desaste¿re natural que ocurren con poca frecuencia Secas Inundaciones Tomentas', 'Idem debilidades', '2022-01-19 14:51:25', '2022-01-20 12:08:55'),
(177, 1724, 1775, 19, 1, 'COMPRA DE VIENTRES', 'La empresa inició su actividad hace 18 años dedicandose a la actividad de cría de ganado bovino.', '900000.00', 1, 0, 'El proyecto consiste en incrementar el plantel de hacienda a través de la incorporación de 20 vientres con el monto solicitado anteriormente.', 'El objetivo del proyecto es incrementar el porcentaje de preñés para poder solventar los costos fijos e incrementar la rentabilidad del proyecto.', 'La oportunidad de contar con una mayor superficie, a través de nuevos contratos de arrendamientos y el precio de la hacienda.', 'Actualmente cuento con 180 madres con 100 terneros al pie de la madre.', 'La empresa arrancó hace 18 años con un plantel de 15 madres logrando un crecimiento sostenido año tras año.', 'Actualmente la actividad se ha visto favorecida por los aumentos de precios de valores de hacienda en plaza.', 'El lugar no es propio, por el contrario la actividad se realiza en un campo arrendado.', 'Si - Actualmente se encuentra con un contrato de arrendamiento de hace 5 años con un vencimiento del mismo para 2024. Se encuentra ubicado en Mojones Sur - Departamento Villaguay.', 'La actividad de la empresa no cuenta con características técnicas en este caso.', 'Al ser una actividad de hacienda no contamos con características tecnológicas para mencionar.', 'El proceso productivo consta en preñar a la vaca, lo cual puede suceder cada 9 meses, la misma cría el ternero el cual a los 7 u 8 meses es vendido. Es decir que el proceso productivo completo demora aproximadamente 1 año y medio.', 'La actividad no cuenta con una materia prima específica.', 'La actividad de hacienda realizada no genera desechos o residuos tóxicos durante el proceso productivo que deban mencionarse.', 'El mercado está determinado por la oferta y demanda de la hacienda bovina.', 'Los principales clientes que se pueden mencionar al respecto serían Cooperativa de Bovril, Cooperativa de Hasenkamp y Cooperativa de Villaguay.', 'En cuanto a la competencia podemos mencionar como principales competidores los pequeños productores que se encuentran en la misma zona.', 'Los principales proveedores con los que cuenta nuestra actividad en este caso serían la Cooperativa de Bovril, Cooperativa de Hasenkamp y Cooperativa de Villaguay.', 'Los principales riesgos que puede tener nuestro proyecto serían aspectos externos al mismo, los cuales no podemos controlar, como por ejemplo las sequías que pueda sufrir la zona donde se desarrolla la actividad. Otro aspecto de riego para el mismo podría ser la baja en el precio de la hacienda.', 'El destino del monto solicitado es para la compra de hacienda.', 'En nuestro caso particular no contamos con empleados, si no que la actividad es trabajada por la familia.', 'El impacto económico que tendría para nuestra actividad esta financiación sería de gran ayuda para facilitar el crecimiento de la misma.', 'El precio promedio del kilo vivo es de $250, segun precio de Liniers.', 'Como fortaleza podemos mencionar que contamos con un bajo endeudamiento y en cuanto a los gastos operativos podemos agregar que no son de gran magnitud.', 'La oportunidad de contar con una mayor superficie, a través de nuevos contratos de arrendamientos y el precio de la hacienda.', 'En nuestro proyecto hoy en día no se observan debilidades para mencionar en este caso.', 'Como se mencionó anteriormente, las amenazas que podríamos afrontar son: riesgos de sequías, riesgo climatico y baja de precio de hacienda.', '2022-01-25 03:40:22', '2022-04-27 12:25:00'),
(183, 1728, 1785, 20, 1, 'NUEVO PROYECTO', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-02-03 20:18:21', '2022-02-03 20:18:21'),
(184, 1735, 1791, 19, 1, 'MAQUINARIA PARA DVH', 'Somos una empresa que fabrica aberturas de PVC de altas prestaciones, nuestro proyecto consta en la compra de las maquinas necesarias para el armado de DVH (doble vidriado hermético) para complementar la producción de aberturas de PVC que llevamos adelante.', '2500000.00', 1, 0, 'El armado de DVH es un proceso delicado y que implica la utilización de maquinaria adecuada para logra un producto final de muy buena calidad, el armado del doble vidriado nos dá mayor previsibilidad y mayor rentabilidad a nuestro trabajo.', 'comprar las maquinarias y elementos necesarios para el armado del doble vidriado hermético y con ello logra un producto de mayor calidad y mayor garantía de satisfacción para el clienta, dado que nos aseguramos la aislación térmica y acústica sean las esperadas y los tiempos de entrega se reduzcan.', 'De esta manera seriamos mucho más competitivos en cuanto a precios y podríamos hacer que más entrerrianos y/o argentinos accedan a esta tecnología que ayuda a economizar en climatización de una casa, por lo tanto mayor eficiencia térmica.', 'hoy se realizan las actividades tercerizando la producción de los DVH.', 'Somos una empresa creada en 2017 por dos ingenieros que desde entonces hemos dedicado nuestro tiempo y esfuerzo en producir aberturas de altas prestaciones a nivel internacionales a valores más acordes a nuestra realidad.', 'estamos en permanente crecimiento, incorporando y haciendo participar a más gente de nuestra cadena de trabajo, desde personal en planta hasta los instaladores.', 'estamos instalados en Paraná. en un predio de aproximadamente 700 m2', 'El predio pertenece a uno de los dueños de la empresa', 'son aberturas de altas prestaciones con aislación acústica y térmica. Excelente nivel de seguridad y durabilidad.   garantías de 10 años en los productos', 'Son aberturas realizadas en PVC, con altos estándares de seguridad y calidad', 'desde la llegada a la fábrica de los insumos, se los trabaja, corta, maquina, ensambla/suelda y acondiciona para que lleguen a ser las aberturas que fueron pensadas y planificadas por los arquitectos o diseñadores que pensaron espacios para vivir o trabajar.', 'utilizamos PVC de altísima calidad y vidrios de igual tecnología, también los herrajes utilizados son del más alto estándar', 'Los residuos que se generan son 100% reciclables.', 'El mercado es nuestra Argentina, también existe la posibilidad de exportar en un futuro nuestro trabajo', 'los clientes son desde las grandes empresas constructoras de edificios, hasta los clientes particulares, pasando por  corralones, arquitectos y hasta el estado.', 'No hay empresas que realicen idéntico trabajo en esta ciudad, con los insumos que nosotros utilizamos.', 'los proveedores son empresas argentinas', 'El hecho de ya utilizar los elementos que queremos fabricar por nuestra cuenta nos hace conocer bien la cantidad y las posibilidades de venta.', 'el monto solicitado es para la compra de maquinas e insumos para realizar los productos antes descriptos', 'se utilizarán 2 personas para este', 'ampliaría nuestra planta de personal.', 'acorde al momento y a las especificaciones', 'Nosotros ya trabajamos y conocemos el proceso y el producto final que queremos, también es un insumo para el resto de nuestro proceso que están en marcha', 'posibilita el crecimiento y la mayor velocidad de entrega de nuestras aberturas', 'No creo que tenga dado que es un insumo ya utilizado', 'Los problemas económico generales de nuestro país', '2022-02-08 16:29:18', '2022-02-08 17:00:37'),
