INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(187, 385, 353, 24, 1, 'CHILLER EQUIPO DE FRIO', 'El Pedido está destinado a incorporar un Chiller de 6hp (Banco de Frío) y poder realizar las obras necesarias para aumentar la capacidad de control de temperatura de fermentación durante el proceso de elaboración de cerveza, esto nos permite aumentar la capacidad de litros de cerveza que se pueden mantener y producir por mes.', '350000.00', 1, 0, 'El Pedido está destinado a incorporar un Chiller de 6hp (Banco de Frío) y poder realizar las obras necesarias para aumentar la capacidad de control de temperatura de fermentación durante el proceso de elaboración de cerveza, esto nos permite aumentar la capacidad de litros de cerveza que se pueden mantener y producir por mes.', 'El monto solicitado cubre aproximadamente un 50% del equipamiento, ya que los presupuestos con los que contamos a la fecha, son de aproximadamente $650.000 pesos para un equipamiento de frío de 6 hp con condensadora dimensionada para trabajar holgada en las condiciones actuales y adicionalmente unos $80.000 en materiales, reacondicionar el sistema de frio, compra y aislación del tanque de 500 lts. y adquisición de Propilenglicol para usar como refrigerante y materiales extras.', 'Actualmente estamos produciendo 3000 Litros/mes de cerveza con picos de 4000 litros/mes pero exigiendo nuestro equipo de frio y con el consiguiente aumento del desgaste, debido a la demanda de la temporada alta de nuestro sector (Octubre - Marzo) es cuando obtenemos nuestra mayor rentabilidad', 'Actualmente estamos produciendo 3000 Litros/mes de cerveza con picos de 4000 mil litros/mes pero exigiendo nuestro equipo de frio y con el consiguiente aumento del desgaste. Con el cambio de equipo de frió podemos paulatinamente aumentar nuestra producción a 7000 litros/mes lo que nos permite licuar muchos gastos fijos en un mayor volumen de productos, idealmente deberíamos estabilizarnos alrededor de los 6000 litros/mes para aprovechar al máximo la capacidad instalada actual.', 'Somos una Pyme de la localidad de Paraná, que desde 2017 elaboramos Cerveza de forma independiente, con acento en la calidad y estabilidad del producto, apostamos a la producción regional y vincularnos con nuestra comunidad de forma responsable.\r\nConformada por dos socios, ambos con mas de 10 años de experiencia en el sector, logrando a principios de 2019 mudarnos y acondicionar una planta con la intención de aumentar la producción y poder dedicarnos de lleno a la producción de Cerveza.', 'Actualmente nos encontramos en producción activa, constituidos como una S.R.L y con habilitación municipal para la elaboración de Cerveza, abasteciendo a bares y comercios de Paraná, con la habilitación provincial en curso para poder expandirnos y llegar a otras localidades, con un esperanzador objetivo a futuro de aumentar la producción y diversificar los canales de venta.', 'Alquilado', 'Desde principios de 2019 estamos alquilando un inmueble de 300mt2, del cual 100mt2 están destinados al sector de producción, y 200mt2 están destinados a oficinas, baños y un futuro sector sector de degustación, el mismo se encuentra ubicado en la zona sur de Paraná (Dr. Alejandro Gessino 104)', 'Elaboramos Cerveza en diversos estilos (4 fijos y aprox. 5 rotativos de estación) los mismos se comercializan en barriles principalmente a bares o pubs de Paraná, además contamos con un local propio en Villa libertador San Martín, ER. Donde realizamos recargas de growlers  y venta directa.', 'Somos una empresa que trabaja y tienen todos sus sistemas en la nube, utilizamos software libre para todas las áreas de gestión, nuestra planta es totalmente de acero inoxidable de grado sanitario tanto el sector de cocción como de fermentación, y disponemos de control de frió automatizado para el m', 'La Cerveza es un fermentado, se muele la Cebada malteada y los adjuntos, luego se macera para extraer azúcares, se hierve y adiciona lúpulo, finalmente ese mosto se enfría y se fermenta a temperatura controlada.\r\nLa totalidad del proceso lleva entre 2 y 4 semanas aproximadamente', 'Principalmente Cebada Malteada, Lúpulo y Levadura, Argentina es productor líder de Cebada Cervecera a nivel mundial, el lúpulo también es producido en el país, mientras que la levadura (Saccharomyces cerevisiae) también es producida en el país se dispone de variantes importadas como nacionales.', 'Limpieza de barriles en los cuales se envasa la cerveza, los productos, procesos y protocolos, al ser todo de inoxidable son los mismos que los utilizados en la industria láctea, el desecho principal es el bagazo Cervecero (grano húmedo de desecho) que va a una granja de porcinos como alimento.', 'Actualmente existe una amplia demanda de Cerveza independiente en todo el país, y puntualmente en la ciudad de Paraná, se instalaron bares y comercios especializados, como así también ferias y eventos que refuerzan y aumentan el conocimiento y demanda del producto por parte de los consumidores, entendemos que existe margen para seguir ese crecimiento y aumentar la cuota de consumo, en esa dirección se dirige este proyecto.', 'Apuntamos a consumidores que gustan del producto y tienen un conocimiento intermedio del la Cerveza Artesanal, que suelen frecuentar lugares donde el producto ya está disponible, con el aumento de producción la idea es poder brindar nuevos lugares donde consumir nuestros productos', 'No vemos como competencia directa a otras cervecerías, ya que entendemos que la cuota de mercado de la cerveza artesanal dentro del consumo total de cerveza, tiene un margen muy importante todavía para crecer, solemos trabajar con con otros productores de la zona, para reforzar el concepto de la calidad de cerveza regional y la diversidad de opciones que existen en la zona.', 'Actualmente disponemos de una cadena de proveedores consolidada y estable, lo que nos permite tener estabilidad en la producción, de los proveedores con los que actualmente trabajamos, el principal es el el distribuidor zonal de insumos de cerveza (Almacén Cervecero en Paraná) y otros insumos lo manejamos directamente con importadores o productores como el caso del lúpulo que compramos directamente a productores del sur del país.', 'La volatilidad de las materias primas (tanto nacionales como importadas) Puede provocar que el precio de las cervezas regionales se eleve y haga caer el consumo de este segmento, si bien el consumo por capita en argentina viene creciendo año a año, existe la posibilidad que el público se vuelque a cervezas industrializadas más económicas, en nuestro caso disponemos de dos líneas con diferenciación de precio bien marcada, para poder satisfacer esta eventual cambio de pauta de consumo.', 'Adquirir un chiller (equipo de frió) de mayor capacidad, ya que actualmente estamos limitados por este equipamiento para el crecimiento de nuestra empresa, porque limita la cantidad de cerveza mensual que podemos producir y mantener.', 'Actualmente disponemos de 2 personas trabajando directamente en planta, y un reparto semanal tercerizado, la idea de aumentar la cantidad de barriles que comercializamos, es aumentar a dos repartos semanales al incorporar mas bares y un eventual personal extra de planta, si logramos estabilizar los volúmenes de producción por encima de los 6000 litros/mes.', 'La importancia del proyecto radica en que el equipo puede ser desarrollado y producido en la provincia, actualmente estamos exigiendo el equipo por lo que la demanda eléctrica es muy alta por la cantidad de horas que necesita estar funcionando, con un equipo adecuadamente dimensionado, el consumo energético baja ya que funciona menor tiempo y con mayor eficiencia.', 'Actualmente los precios del litro de cerveza de ,microcervecerias locales se ha vuelto competitivo con un promedio de $170 pesos mas impuestos para revendedores (Bares o distribuidoras) en cervezas suaves (segmento de mayor consumo) y por la dependencia de insumos importados y dolarizados (lupulos) las cervezas mas fuertes si presentaron un incremento de precios, llegando actualmente a un rango de entre $260 a $350 pesos mas impuestos por litro.', '- Conocimiento del mercado\r\n- Material con fabricación y mantenimiento en la provincia.\r\n- Conocimientos de los proveedores y equipos.\r\n- Disponemos de la demanda de producto para poder ubicar mas producción.', '- Disponer de más stock y poder abastecer más locales gastronómicos\r\n- Mejora de la rentabilidad al aumentar el volumen de producción.\r\n- Bajar la huella energética de la empresa en la producción de cerveza.', '- Puede existir demora en la entrega del equipo.\r\n- Requiere una curva de aprendizaje nueva de procesos.\r\n- Require adecuar una zona de la fabrica para el equipo.', '- Gran parte de los insumos de cerveza están atados a la variación del dólar.\r\n- Posibilidad que el sector gastronómico tenga un nuevo cierre por cuestiones sanitarias debido a nuevas cepas.', '2022-03-04 19:22:31', '2022-04-06 14:59:07'),
