(193, 413, 381, 19, 1, 'ADQUISICION MAQUINA CORTADORA AUTOMATICA DE BOLSAS', 'MEDIANTE EL PROYECTO SE BUSCA ADQUIRIR UNA UNIDAD NUEVA DE UNA MAQUINA CORTADORA AUTOMATICA DE BOLSAS PARA ACELERAR EL PROCESO DE CONFECCION DE LAS BOLSAS.', '3000000.00', 0, 0, 'LA ADQUISICION DE ESTA MAQUINA AUTOMATIZA EL PROCESO DE CONFECCION DE LAS BOLSAS, ES DECIR EL PROCESO DE CORTE, SELLADO Y PLEGADO DE NUESTROS PRODUCTOS PARA SALIR AL MERCADO.', 'MEDIANTE ESTA NUEVA MAQUINA SE RENUEVA LA OBSOLETA, SE ACELERAN LOS PROCESOS DE PRODUCCION PERMITIENDO SEGUIR CRECIENDO EN EL MERCADO AUMENTENDO NUESTRA PRODUCCION Y GENERANDO MAYOR DEMANDA DE MANO DE OBRA.', 'ESTE AUMENTO EN NUESTRO PROCESO DE PRODUCCION NOS PERMITIRA CONSOLIDARNOS EN NUESTRO NICHO DE MERCADO ADEMAS DE SALIR A COMPETIR EN NUEVOS MERCADOS PERMITIENDO CRECER COMO EMPRESA Y GRUPO HUMANO.', 'HOY EN DIA ESTAMOS TRABAJANDO A NUESTRA MAXIMA CAPACIDAD EN CUANTO A NUESTRO PROCESO DE CONFECCION ADEMAS DE TARDAR EL DOBLE DEL TIEMPO LA MAQUINARIA REQUIERE DE MAYOR MANTENIMIENTO GENERANDO MAYOR COSTO DE PRODUCCION TANTO SEA EN LA CONFECCION COMO EN EL MANTENIMIENTO.', '-1985: creación de la firma bajo la titularidad de su fundador “Martinez Damaso Juan” (mi padre).\r\n-2001: la firma pasa a manos de Schmith Olga Beatriz (mi madre) a raíz del fallecimiento de su fundador.\r\n-2010: me recibo de Lic. En Marketing y Administracion De Empresas y tomo la gerencia de la empresa luego de estar vinculado trabajando desde los 15 años.\r\n-2012: la firma pasa a mi nombre bajo la denominación de “Polietilenos Oro Verde” a raíz de la jubilación de mi madre hasta la actualidad.', 'Actualmente la empresa esta consolidad en el departamento Parana desde hace muchos años, provee a diferentes reparticiones del estado tanto municipales como provinciales ademas de estar ampiando su participacion dentro de la provincia de Entre Rios y con miras a comercializar en otras provincias en un futuro proximo.', 'Actualmente la empresa funciona en un galpon de propiedad familiar en la localidad Oro Verde.', 'La propiedad consta de un galpon con oficinas de propiedad familiar donde no se paga alquiler, solo impuestos', 'La actividad consiste en la fabricación de bolsas de polietileno de todo tipo para basura, residuos patológicos y comercios, y la misma abastece de mercadería a toda la provincia de entre ríos.', 'La solucion que brinda al packaging de diversos productos utilizados en la industria tecnologica.', 'El proceso de fabricación incluye la extrusión donde se utiliza el grumo plástico como materia prima, éste es colocado en un molde y mediante el calentamiento el polietileno se adhiere para formar una pieza hueca.\r\nEl mismo pasa por medio de unos cilindros donde toma forma y luego sale como bobina.', 'El grumo plastico puede ser de materia prima virgen o de materia prima reciclada.', 'Estos productos son susceptibles de ser reciclados, por lo cual tienen un valor agregado al medio ambiente. \r\nTodos los retazos y desperdicios son enviados a otra empresa que los recicla y luego vuelven en forma de materia prima reciclada para ser usada.', 'El mercado se compone de todo tipo de comercio que utilice nuestros productos para su packaging ademas de otros entes los cuales lo utilizan para su limpieza e higiene.', 'Los clientes son todo tipo de comercios y reparticiones municipales y provinciales tales como hospitales, clinicas y municipios.', 'Nuestra competencia se compone de otras empresas que estan en la provincia las cuales brindan productos similares a los demas comercios de la provincia.', 'Nuestros proveedores de materia prima recuperada estan en buenos aires y en el departamento parana, mientras que nuestro proveedor de materia prima virgen importada esta en Rosario.', 'Nuestras estrategias radican en brindar un producto economico y con entrega inmediata en destino, mientras que los riesgos son que la competencia tienen maquinaria mas nueva la cual permite tener mayor calidad en el producto final.', 'El monto solicitado esta destinado a adquirir una maquina confeccionadora nueva.', 'Se emplea un grupo de trabajo destinado a la instalacion y puesta en funcionamiento de la misma.', 'El impacto economico se va a manisfestar en el aumento de produccion de la empresa, generando mas puestos de trabajo y mas demanda de trabajo para otras empresas de la zona que estan indirectamente relacionadas tales como la logistica y sistemas.', 'Nuestros productos son economicos de facil acceso para todo tipo de mercados ya que hay diferentes tipos de comercios que consumen los mismos ya sea de materia prima virgen o recuperado.', 'Nuestra fortaleza es que hace muchos años estamos presentes en el mercado con un grupo humano consolidado que trabaja de manera coordinada para alcanzar los objetivos y atender la demanda.', 'Las oportunidades estan en explorar nuevos mercados para aumentar la demanda y poder ampliar nuestra participacion en el mercado local y de otras provincias.', 'El tiempo que va a demandar la adaptacion a la nueva maquinaria y en el conocimiento de nuevos mercados para poder aumentar nuestra produccion.', 'La competencia que esta instalada en el mercado y en algunos casos con una maquinaria mejor que la nuestra.', '2022-03-14 13:42:42', '2022-03-23 13:09:07'),
