(197, 1439, 1473, 19, 1, 'PRODUCCIÓN DE PACÚ', 'Producción primaria de pacú basada en tecnología semi-intensiva. Comienza con la compra de alevines para la recría, sigue con el engorde en estanques de mayor tamaño hasta la cosecha. Finalmente, se comercializa directamente a consumidores finales con proyección al mercado mayorista. En un futuro cercano, el objetivo es incrementar la productividad vía incorporación de tecnología y asociación con productores locales.', '500000.00', 0, 0, 'Ampliación de la capacidad productiva instalada para el engorde de pacú.', 'Producir carne de pacú de calidad homogénea en un entorno ambiental sustentable. Proveer a la población de alimento con altos valores nutricionales. Incentivar el consumo de pescado. Asociarse con productores entrerrianos para optimizar la producción y aumentar el volumen de comercialización.', 'Existe una demanda creciente e insatisfecha y una oferta estacional y volátil. Nuevos segmentos de mercado.', 'Capacidad instalada y conocimientos para producir 5 tonelada de pescado por año.', 'En noviembre de 2018 el emprendimiento empezó con la siembra de alevines de pacú. Todo el 2019 transcurrió aprendiendo sobre alimentación, manejo y control de variables del proceso productivo. En marzo del 2020 se realizó la primer cosecha total, en abril del 2021 la segunda y actualmente en el 2022 la tercera.', 'Establecimiento ubicado en la localidad de Espinillo Norte, dirigido por el Cr. Lucas Marcos y el Ing. Ind. Juan Manuel Rossi. En el mes de abril de 2023 finalizaremos la tercera campaña de producción.', 'Predio de 5,5 Ha. frente a la ruta 18 en el km. 23,5, localidad de Espinillo Norte.', 'Establecimiento habilitado para la producción de piscicultura. \r\nContrato comodato.', 'Pacúes a base de alimento balanceado de alta calidad en un ambiente controlado.', 'Carne de pacú homogénea, de alta calidad proteica, abundante en minerales y vitaminas con un peso promedio de 1,2 [kg].', 'Producción en estanques rectangulares en tierra con sistema de bombeo y renovaciones parciales de agua, provisión de oxígeno, aporte de alimento, manejo y control de los peces y calidad del agua.', 'Alimento balanceado con proteína mayor al 32%.\r\nFertilizantes naturales a base de nitrógeno, fósforo y potasio.', 'El agua desechada, enriquecida por la actividad de los peces, fertiliza las tierras aledañas del establecimiento.', 'En Argentina se consume 5 kg por habitante por año, mientras que en el mundo ese promedio es de 20,5 kg.', 'Consumidores finales, restaurantes y comercio minorista de Paraná y alrededores.', 'Comercios de venta al público como pescaderías o puestos informales de pescado en zonas aledañas al río Paraná. A diferencia de ellos que se abastecen de la pesca extractiva, nosotros engordamos especies a partir de la reproducción artificial de larvas.', 'HOMEOAGRO (referencia en provisión de alimento balanceado).\r\nEmpresa ISLA PE (experiencia nacional en el ramo, confiabilidad y alta tecnología en acuicultura).', 'El mayor riesgo es el de mortandad de los peces cuando la temperatura del agua disminuye por debajo de los 10 °C.  Para superarlo, se instaló una bomba sumergible a 55 metros bajo tierra que permite inyectar agua en los estanques a 21 °C independientemente de la temperatura atmosférica.  Asimismo, el ingreso del agua a 21 °C se combina con el accionar de válvulas que permiten el desagote del agua fría.', 'Aumento de la producción de carne de pacú.', 'Marcos, Lucas: economía-finanzas, legales, proveedores y comercialización.\r\nRossi Juan Manuel: producción, administración y organización.', 'Novedosa actividad productiva en la región con generación de empleo indirecta, consumo de insumos, materiales y mano de obra local, búsqueda de asociación con otros productores para aprovechar oportunidades, ampliación de la oferta de carne de pescado, concientización de una sana alimentación, interacción científica con el INTA Concordia e INALI-CONICET.', 'VENTAS AL POR MENOR _ Consumidores Finales: $ 1.100 por Kg de Pacú Despinado\r\nVENTAS AL POR MAYOR _ $ 900 por Kg de Pacú Despinado', 'Margen de agregado de valor del producto. Posibilidad de desarrollo de nuevos segmentos de mercado. Potencialidad agroecológica. Disponibilidad de conocimiento, técnicas y tecnología para mejora de los procesos productivos y productos. Grupo humano.', 'Demanda creciente e insatisfecha. Oferta volátil. Productos heterogéneos y de baja calidad. Turismo. Producción limpia y sustentable.', 'Seguridad en el establecimiento. Largo ciclo productivo. Bajo volumen de producción. Canales precarios de comercialización. Nula capacidad de inversión con fondos propios.', 'Alimento balanceado costoso y provisión volátil. Logística de transporte inadecuada. Posición monopólica de frigoríficos. Baja interacción entre el sector científico-tecnológico y productivo. Escaso hábito de consumo de pescado en la población.', '2022-03-23 19:39:03', '2022-04-08 14:30:58'),
(198, 1771, 1829, 20, 1, 'NUEVO PROYECTO', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-03-31 12:07:22', '2022-04-06 14:33:06'),
(200, 1773, 1831, 19, 1, 'CAPITAL DE TRABAJO E INVERSIONES', 'Financiamiento de maquinaria AMASADORA ARGENTAL MBE-80U-S T380/50, con proforma N°00001-00011299 del día 05/05/2022, un monto final de US$ 14.156,91. Pesificado al día de proforma: $1.720.064,5\r\nAdquisición de 10 lateros y latas para horneo de los productos, aproximadamente de costo $90.000 la unidad. \r\nRemanente: adelanto a proveedores', '3000000.00', 1, 0, 'Continuar desarrollando procesos productivos eficientes\r\nAmortiguar el impacto de las dificultades económicas del entorno regional y nacional', 'Agilizar procesos, destinando horas hombres a tareas no repetitivas y que impliquen un grado de crecimiento de la productividad', 'Producir de una manera mas eficiente, por ende, lograr un aumento de paquetes por día. Satisfaciendo así la demanda regional', 'Crecimiento de las ventas', 'Panadería fundada por el ímpetu emprendedor de 3 hermanos que desde jóvenes adolescentes se dedicaron al rubro, ya sea haciendo productos artesanales en su casa para aportar al sostén económico del hogar y como también sumando experiencia en una panadería del barrio. En los años 1990-2000 pudieron establecerse como Empresa, logrando afianzarse en el mercado', 'Actualmente la Empresa vende sus productos en la región, ya sea por medio de si misma como de distribución terciaria. Se encuentra en una etapa de transformación de la producción, intentando acelerar procesos a través de la tecnología', 'Fabrica instalada en terreno propio', 'No', 'Productos de panadería: pan, facturas, bizcochitos, galletas, etc\r\nEnvasados y no envasados', 'Productos envasados con su correspondiente fecha de Vto', 'Procesos semi-industriales. Aproximadamente 10 maquinas entre las que se encuentras amasadoras, sobadoras, hornos(2), cortadoras y formadoras', 'Harina adquirida de molinos y distribuidores\r\nAditivos y accesorios de panadería adquiridos de distribuidores', 'Reciclado de cartón\r\nCorrecto agrupamiento de plástico y vidrio\r\nLos desechos orgánicos son destinados a chancherías de la zona para alimento de ganado porcino', 'Mercado regional competitivo, no así agresivo\r\nConsideramos que contamos con buen porcentaje del mercado. Clientela fiel', 'Consumidores finales que adquieren los productos tanto en el negocio particular como en los quioscos/supermercados \r\nEmpresas y escuelas que destinan las compras para buffet del personal', 'Competencia sana\r\nConsultas a la hora de aumentar precios\r\n\"Suplencia\" cuando alguna de las panaderías cierra por vacaciones', 'Buena relación con los proveedores, tanto con los locales como los nacionales\r\nPocas modalidades de financiación, que vuelven engorroso el flujo de caja', 'Riegos inherentes a la situación socio-económica del país\r\nEstrategias: ser prolijos en la gestión de cobranzas y pagos', 'Financiamiento de maquinaria AMASADORA ARGENTAL MBE-80U-S T380/50, con proforma N°00001-00011299 del día 05/05/2022, un monto final de US$ 14.156,91. Pesificado al día de proforma: $1.720.064,5\r\nAdquisición de 10 lateros y latas para horneo de los productos, aproximadamente de costo $90.000 la unidad. \r\nRemanente: adelanto a proveedores', '8 empleados y 3 socios', 'Ser parte del sostén de 10 familias', 'Precios acordes a los poderes de nivel adquisitivo de la clientela', 'Productos afianzados\r\nClientela fidelizada', 'Expansión de mercado\r\nExpansión de capacidad productiva', 'Procesos manuales lentos propios de la actividad\r\nProcesos no automatizados', 'Inflación, incertidumbre económica', '2022-04-13 12:15:43', '2022-05-06 18:53:15'),
(204, 1776, 1836, 19, 1, 'SALA DE FRACCIONAMIENTO Y ENVASADO DE MIEL ENTRERRIANA', 'Construcción Tradicional en una superficie de 6x9 mts sobre predio de 4 Hectáreas de una de Sala de Fraccionamiento y Envasado de Miel para abastecer el mercado interno, proyectando la exportación de Miel de Origen.', '2895000.00', 1, 0, 'Consiste básicamente en la Construcción e instalación de servicios básicos de una Sala de Fraccionamiento y Envasado de Miel de Origen dentro del Predio de 4 Hectáreas donde funcionan la sala de deposito, extracción, descarga, inicio de carpintería y de limpieza de cuadros, y una salita de reuniones.', 'Abastecer la demanda  del consumo interno y externo de miel; Agregar valor al desarrollo del producto final suprimiendo un trabajo que se tercializaba; Completar el proceso horizontal de comercialización del producto realizándolo de manera propia, generando nuevos puestos de trabajo a Apicultores asociados a la cooperativa; Reducción de costos de envasado y fraccionamiento, fletes y tiempo de los procesos.', 'Contar con una Sala de Fraccionamiento y Envasado de Miel de Origen propia, para ser usada exclusivamente por los 55 Apicultores de distintas regiones Asociados a la Cooperativa. Oportunidad de Comercializar un Producto que cumpla con los estándares internacionales para volcarlo de manera inmediata al mercado Externo y abastecer la demanda Nacional de la Miel.', 'Actualmente la Cooperativa esta acopiando Materiales en corralones para congelar precio y preparando el suelo donde se va a Construir. Así mismo se están definiendo con los arquitectos las divisiones internas de la sala y distribuciones de maquinaria y equipos.', 'Por el año 2000 pequeños y medianos productores, formamos un Centro Apícola, con el objetivo de vender en forma conjunta nuestras mieles y comprar insumos, y así obtener mejores beneficios. En el año 2005 se formó La Cooperativa fundada con 11 socios .- Hasta el año 2014 la cooperativa estuvo funcionando sin un espacio físico propio, con el aporte de los asociados y un crédito del Banco Nación se pudo comprar ese año un predio de 4 hectáreas donde hoy funcionan nuestras dependencias.', 'Actualmente la COOPERATIVA cuenta con 55 Asociados de zonas aledañas y vecinas, todos Apicultores inscriptos en el RENAPA (Registro Nacional de Productores Apícolas). Nuestra producción actual es de 210.000Kg anual de miel que representa 700 tambores aproximadamente. Además se esta Tramitando el alta como Importador/Exportador a la cooperativa y la tramitación de Producto Orgánico de la Miel con una certificadora de normas internacionales.', 'Se cuenta con predio de 4 Hectáreas con portón de ingreso y cerco perimetral y a la fecha cuenta con Sala de extracción de Miel, sala de depósito de alzas con miel, zona de descarga cubierta, depósito de tambores, baños , sala de laboratorio, cocina, sala de reuniones, cloacas y el predio parquizado', 'No se alquila ni se arrienda.', 'Producto principal es Miel pura, sin aditivos, de origen Natural extraída de Colmenas instaladas por los asociados Apicolas. \r\nProducto y Servicio Secundario es la cera que se obtiene del proceso de limpieza de los cuadros.', 'no poseen características tecnológicas.', 'La Miel se extrae en la planta de extracción que esta en el predio directamente de la caja que forman la colmena finalizado el proceso se devuelven las cajas a los asociados \r\nEn el proceso limpieza de cuadros se extrae la cera y acondicionan los mismos para volver a utilizarlos.', 'La miel es un alimento compuesto en su mayor parte por azúcares. El aroma y sabor de la miel están relacionados con el néctar de las flores que visitaron las abejas. El color de la miel varía y se relaciona con el contenido de minerales, polen y compuestos volátiles que son responsables del aroma.', 'La producción Apícola no genera residuos y/o desechos como otros procesos industriales, con lo cual no se genera contaminación de ningún tipo. Asi mismo de la limpieza de cuadros se obtiene un subproducto -Cera- que se comercializa en estado puro para uso cosmético entre otras formas.', 'La demanda nacional e internación de la miel en los últimos años aumentó significativamente gracias a los beneficios que aporta a la salud de la personas. El mercado externo juega un factor importante, hoy en día la miel que se produce en esta región es reconocida a nivel mundial y demandada por países como Emiratos Árabes Unidos, China, EEUU y el viejo continente. Argentina es el según exportador de miel a nivel mundial y el 95% de la producción se destina a la exportación -commodity-', 'Todos los clientes son Exportadores de miel. El principal cliente es ACA, luego en menor medida  Nexo, Villa Mora, entre otros. En cuanto al servicio de extracción solo se realiza a Asociados Apícolas y se los provee de tanques de 300kg y cera para cuadros.', 'La forma de Empresa por excelencia adoptada por los productores apícolas es la Cooperativa. No hay competencia directa ya que la demanda externa es muy alta y toda la producción se coloca con facilidad.', 'los Asociados proveen las colmenas para utilizar el servicio de extracción y luego de comercialización. Los demás proveedores son CoSdE - Compañía Sudamericana de envases - FECAER que provee el servicio de Fletes y en menor medida proveedores de cera - la mayor parte se hace por canje en el servicio de Limpieza de cuadros.', 'No se detectaron riesgos ni estrategias de superacion.', 'Para la Construcción Tradicional en una superficie de 6x9 mts sobre predio de 4 Hectáreas de una de Sala de Fraccionamiento y Envasado de Miel', 'la cooperativa no cuenta con empleados en relacion de dependencia. Todas las personas  que trabajan son Asociados a la Cooperativa, son todos Apicultores inscriptos en RENAPA (Registro Nacional de Productores Apícolas)', 'El impacto económico se vera reflejado en la reducción de costos ya que suprime la terciarización de fraccionamiento y envasado y el flete. como corolario aumenta el margen de venta de los productos.  La compra de materiales para fraccionar y envasar impactara positivamente en la economía regional y aumentara la contratación de nuevos servicios y de nuevos proveedores.  Se capacitara de manera constante a jóvenes apicultores, se les brindara acompañamiento técnico - legal y en bromatología.', 'El precio de la miel actual es de aproximadamente de $ 300 por Kg. la misma se comercializa por cuenta y orden de los apicultores asociados, quedando una comisión por comercialización a la Cooperativa del 2%. El precio, en nuestro caso lo fija el mercado externo. Por el servicio de extracción se comisiona un 3% del precio de venta. También se venden los tanques de 300 kg y se obtiene una ganancia neta del precio de costo del 15%.', 'El trabajo conjunto con el INTA, como organismo técnico y de tecnología, en toda la campaña apícola. Asociados altamente calificados y una cooperativa con una trayectoria de 16 años ininterrumpidos que trabajamos en forma asociada. Predio de 4 Hectáreas con distintas áreas de Producción y Comercialización. La cooperativa es socia fundadora y asociada a la Federación de Cooperativas Apícolas de Entre Ríos –FECAER-', 'De brindar mas y mejores servicios a los asociados Apícolas; De aumentar la producción y el margen de venta manteniendo los precios constantes.  De reducir costos. De abastecer el Mercado Interno y de exportar producción Nacional con valor Agregado aumentando el margen de venta de los productos.  De fomentar el arraigo de Jóvenes Apicultores brindándoles oportunidades.', 'La Falta de Crédito Genuino o apoyo económico social para aumentar la producción o reducir costos. La falta de Jóvenes que se vuelquen a la apicultura como un trabajo principal y/o de apoyo al mismo.', 'El aumento sostenido en el nivel de precios (Inflación). La Concentración de la capacidad exportable de miel en una o dos Empresas en la región.', '2022-04-26 13:11:38', '2022-05-04 12:46:15'),
(205, 1782, 1838, 20, 1, 'NUEVO PROYECTO', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-04-29 14:17:13', '2022-04-29 14:17:13'),
(206, 1552, 1839, 19, 1, '1 FURGON TERMICO Y EQUIPO DE FRIO', 'La empresa inició sus actividades productivas en el mes de Agosto de 2015, desde entonces este emprendimiento lácteo establecido en la ciudad de Nogoyá Provincia de Entre Ríos se dedica a la producción y comercialización de quesos y productos lácteos en distintas variedades que pueden adquirirse en supermercados, hipermercados reconocidos de las principales ciudades de las provincias de Entre Ríos, Corrientes, Chaco, Buenos Aires, Formosa y Misiones.', '3000000.00', 1, 1, 'El proyecto que queremos llevar a cabo es la compra de un 1 Furgon Termico y Equipo de Frio', 'El objetivo del proyecto es obtener este tipo de equipos para la distribución de nuestros productos en el mercado.', 'La oportunidad es de lograr obtener camiones refrigerados', 'En la actualidad buscamos renovar nuestras metas y vision para cumplir con los objetivos propuestos y contribuir al desarrollo de nuestra comunidd acercandole las mejores propuestas del mercado en materia de productos alimenticios que se obtienen de la leche.', 'La empresa inició sus actividades productivas en el mes de Agosto de 2015, desde entonces este emprendimiento lácteo establecido en la ciudad de Nogoyá Provincia de Entre Ríos se dedica a la producción y comercialización de quesos y productos lácteos en distintas variedades que pueden adquirirse en supermercados, hipermercados reconocidos de las principales ciudades de las provincias de Entre Ríos, Corrientes, Chaco, Buenos Aires, Formosa y Misiones.', 'Ubicada en el corazón de la cuenca lechera Argentina procesa 10 millones de litros de leche por año que se transforman en una completa línea de productos comercializados con la marca Nogolac. A la fecha la firma posee 20 empleados en relación de dependencia. La empresa es dirigida por los socios, quienes se ocupan personalmente de la toma de decisiones, cuestiones comerciales y administrativas.', 'planta fabril', 'contrato de comodato', 'Lineas de quesos y productos lacteos de consumo masivo', 'Linea de produccion de quesos semiautomatizada, tinas de producesamienti semiautomaticas, pasteurizador de leche y envasadora al vacio de productos.', 'El proceso consiste en calentar la leche a 139 ºC durante 4 segundos, bajar rápidamente la temperatura y envasarla bajo condiciones asépticas en envases estériles y herméticamente cerrados. Mediante este proceso se logra eliminar prácticamente todas las bacterias.', 'Leche cruda proveniente de tambos de la zona..', 'Suero de queso preenfriado y desnatafo', 'Mercado Interno', 'Nuestros clientes son de distintas ciudades de las provincias de Entre Rios, Corrientes, Chaco, Buenos Aires, y Misiones', 'Empresas competidoras de la zona de influencia.\r\nCremigal SRL, La Lecherita, La Sibila, Lacteos Tonutti.', 'Nuestros principales Proveedores son de materias primas tales como Winflex SA, Martinez Oscar Alfredo, El Cardenal SRL entre otros', 'Los riesgos que pueden surgir es que la leche puede contener microorganismos nocivos como salmonella, escherichia coli entre otros, puede sufrir adulteraciones, como adición de agua, de suero, alteraciones, como acidificación y posterior coagulación, desnaturalización de proteínas, pérdida de vitaminas y contaminaciones. Las estratégicas son la gestión de inventarios, planificación de la producción y el desarrollo de productos; obedeciendo que los productos elaborados tienen un período de vcto.', 'La compra de un FURGON TERMICO Y un EQUIPO DE FRIO', 'La empresa hoy dia cuenta con 20 empleados', 'Los factores tanto economico y social que impulsan el desarrollo del sector lechero son las variaciones de la demanda; los adelantos en materia de producción, transporte y tecnología de las comunicaciones; la mejora de la productividad en la explotación; y el aumento de la eficacia de las cadenas lácteas.', 'El precio de la leche depende de varios factores: el balance entre oferta y demanda, la tasa de crecimiento de la producción de leche, el aumento poblacional y su consumo per cápita, la tasa de cambio entre las diferentes monedas, entre otros.', 'Flexibilidad de la producción primaria basada en su amplia distribución geográfica y con\r\ncapacidad para la expansión horizontal y vertical. Calidad percibida de los productos. Disponibilidad de tecnología. Elevada productividad en grandes productores. Creciente inserción de los productos en el mercado interno. Capacida Instalada', 'Perspectivas de crecimiento de la demanda. Expectativa de sostenimiento del alza de los precios. Cambios en los patrones de consumo. Aumento sostenido del consumo lácteo junto con un importante desarrollo del sector gourmet.', 'Poca coordinación entre los eslabones de la cadena. Escaso poder de negociación de productores primarios para con la industria. Problemas de infraestructura logística.  Escasez de financiamiento para pequeños productores. Baja productividad en pequeños productores.', 'Competencia de grandes productores. Exigencias normativas para acceso a mercados. Elevada fluctuación de precios internacionales.', '2022-04-29 17:34:13', '2022-05-31 12:27:50'),
(207, 1786, 1841, 19, 1, 'COCOMELóN- FABRICACIóN DE INDUMENTARIA TEXTIL PARA BEBéS Y NIñOS DE 0 A 6 AñOS', 'Fabricación de prendas de vestir para bebés y niños desde 0 a 6 años, en la ciudad de Paraná, abarcando los procesos de moldería, corte, confección, terminación, almacenamiento y distribución hacia todo el país, abasteciendo el mercado minorista y mayorista a través de nuestras dos tiendas online. Tenemos una antigüedad de 5 años en el mercado, a lo largo de los cuales la demanda fue creciendo al punto de no poder abastecerla por falta de maquinaria y operarios.', '900000.00', 1, 1, 'Cocomelón es un emprendimiento dedicado a la fabricación de indumentaria para bebes y niños. Realizamos ventas mayoristas y minoristas alrededor de todo el país. Contamos con un taller propio que produce aproximadamente 1500 prendas al mes. Distribuimos a alrededor de 80 revendedores y más de 100 clientes minoristas mensualmente. La demanda que estamos teniendo duplica la producción que podemos generar.', '- Brindar un mejor servicio a nuestros clientes, abasteciendo la creciente demanda de nuestros clientes actuales e incorporar nuevos. \r\n- Aumentar la productividad a través de la sistematización de nuestras operaciones y la incorporación de nuevas tecnologías. \r\n- Disminuir los tiempos de envío y distribución, acelerando los procesos productivos. \r\n- Innovar en nuestros productos para seguir las tendencias de la industria textil. \r\n- Posicionar la marca a nivel nacional como referentes del rubro.', 'Gracias a los avances del comercio electrónico en los últimos años pudimos potenciar nuestro negocio. Tenemos 2 (dos) plataformas de e-commerce y operamos con numerosas aplicaciones de marketing digital para lograr más alcance y ampliar nuestras posibilidades de venta en todo el país. Tenemos más de 30 mil seguidores en nuestras redes sociales, Instagram y Facebook, las cuales funcionan como nuestro principal canal de comunicación, publicidad y ventas.', 'En los últimos 6 meses hemos logrado triplicar nuestra producción, mejorar la calidad y variedad de nuestros productos, incorporar más de 60 puntos de venta en todo el país, consolidar la imagen de la marca y reforzar nuestras estrategias de marketing digital, factores que fueron determinantes en el crecimiento de las ventas, llegando hoy al límite de nuestra capacidad productiva, exigiéndonos incorporar nuevas tecnologías y mano de obra para abastecer la demanda', 'Comenzó como un proyecto unipersonal de quien escribe, Paula, que compatibilizaba con mi trabajo en relación de dependencia. Con la llegada de nuestro segundo hijo, aproveché el periodo de licencia extraordinaria por maternidad para volcar energías en poner en marcha el emprendimiento, logrando resultados favorables que me permitieron en menos de 3 meses dejar el trabajo en relación de dependencia y dedicarme a tiempo completo al emprendimiento', 'En los años posteriores mi pareja, Lautaro, también dejo su trabajo en relación de dependencia y actualmente ambos trabajamos en la marca, es nuestra fuente de ingresos exclusiva. En los últimos meses pudimos concretar la apertura de un local comercial en Paseo Las Luces, Paraná, y además mudamos el área de producción, que funcionaba dentro de nuestro domicilio, a un domicilio externo.', 'Nuestro Taller funciona en un domicilio de aproximadamente 70 mts cuadrados, donde tenemos sala de costura, sala de corte, sala de embalaje y oficina', 'Alquilamos recientemente el espacio físico antes mencionado, anteriormente funcionaba todo el área productiva en locaciones de nuestro domicilio particular. También pudimos alquilar recientemente un local comercial en una galería cercana a la zona peatonal destinado a la venta minorista.', 'Desarrollamos variedad de productos: Jardineros, remeras, buzos, pantalones, vestidos, entre otros. En cuanto a sus características técnicas buscamos en primer lugar la calidad de la tela, su durabilidad y que su composición sea apta para la piel de bebés y niños.', 'La tecnología necesaria para elaborar nuestros productos se encuentra disponible en nuestro país y es de última generación. Las principales marcas de maquinaria para la industria textill son typical, Jack,  Gemsy, Siruba, entre otras. Se destacan por su alto nivel de tecnología', '1.	Diseño y elección de modelos, investigación de mercados y tendencias.\r\n2.	Tizado y corte de las prendas con cortatelas automático y en serie.\r\n3.	Confección con maquinas industriales, overlock, recta y collareta.\r\n4.	Control de calidad y planchado\r\n5.	Empaquetado y despacho', 'La principal materia prima es la tela. Usamos rollos que varían entre los 50 y 70 metros. El ancho del rollo de tela es de 1,5 metros. De un rollo de 50 metros de largo obtenemos cortes de aproximadamente 150 a 200 prendas. Por unidad producida se utiliza de 25 a 35 centímetros del largo del rollo.', 'Con las pequeñas fracciones de tela sobrantes en la etapa de corte producimos accesorios y prendas de menor tamaño: gorros, baberos, etc. Recientemente recibimos una oferta de compra de residuos de la industria textil por parte de la industria de fabricación de envases descartables.', 'Es un negocio de primera necesidad y de rápida obsolencia (los talles caducan rápido) y, particularmente los productos de bebés, tienen un patrón emocional a la hora de la compra, por lo que no se ve afectado por cambios bruscos en los ciclos económicos. Según datos del indec (2018) el gasto en indumentaria en los hogares con uno o dos hijos se eleva entre el 5 y 6%.', 'Estadísticas de nuestra plataforma de ecommerce muestran 99 % de mujeres, 1% de hombres entre nuestros clientes. Las mismas indican que la edad preponderante ronda en la franja entre los 23 a 35 años. La mayor parte de nuestros público son clientes mayoristas, que revenden en locales comerciales, showrooms o desde plataformas online.', 'En la actualidad existen alrededor de 1200 fabricantes de ropa de niños en nuestro pais. Tenemos por un lado grandes marcas establecidas como referentes de la industria y de la producción masiva. Su principal canal de ventas ha sido el comercio físico en shoppings (Cheeky, Mimo&Co, Broer, etc.). Por otro lado tenemos los fabricantes mayoristas ubicados en zonas de Avellaneda y Once, que ofrecen precios bajos y abastecen al resto del país.', 'Tenemos por un lado importadores directos de telas provenientes en su mayoría de países del sudeste asiático. Los costos son sustancialmente más bajos, pero presentan la particularidad de vender solo en grandes volúmenes. Por otro lado están los fabricantes de telas nacionales, que compiten en calidad y precio con los anteriores.', 'El principal inconveniente al que nos enfrentamos es la imposibilidad de generar un copyright por cada producto. En términos de derechos de autor, solo es posible en nuestra industria registrar la marca. Para hacer frente a la copia e imitación utilizamos un método que nos funciona muy bien, el de “colección por goteo”, consistente en no lanzar de una sola vez toda nuestro catálogo, sino que ofreciendo al cliente constantemente modelos diferentes e innovadores, manteniendo su atención permanente', 'El monto solicitado será destinado a la compra de maquinaria e insumos.\r\n1 (una) Maquina Recta industrial. Precio $130.000\r\n1 (una) Maquina Collareta industrial. Precio $170.000\r\n1 (una) Maquina Overlock industrial. Precio $110.000\r\n4 (cuatro) rollos de tela plana. Cada uno $60.000. Total $240.000 \r\n5 (cinco) rollos de tela de punto. Cada uno $50.000. Total $250.000\r\nDebes poner más insumos para que haya una relación entre herramientas y elementos de trabajo)\r\nMonto total: $900.000', 'Además de las 2 personas que trabajamos asociadas en el emprendimiento, mas 1 (un) empleado que tenemos en relación de dependencia, necesitamos incorporar: \r\n-1 operario maquina recta industrial\r\n-1 operario maquina overlock industrial\r\n-1 operario maquina collareta industrial\r\n-1 operario maquina cortadora industrial', 'Consideramos que la demanda existente de nuestros productos puede satisfacerse con más personal de trabajo en primer lugar, y maquinaria en segundo lugar, por lo tanto, el crecimiento de la empresa va a estar siempre ligado a la generación de mas puestos de trabajo. En cuanto a los consumidores, los mismos se verán beneficiados de tener una oferta local de indumentaria para bebes y niños de calidad y a un precio accesible.', 'Nuestros precios mayoristas varían entre $1500 y $3000, y minoristas entre $2000 y $5000 según el item. Para fijarlos tenemos en cuenta principalmente la demanda, ya que al ser productos de diseño de autor, tienen un valor agregado que hace que se posicionen en el mercado y se diferencien de otros productos del rubro (estrategia de diferenciación). Como factores secundarios influyen los precios de nuestros competidores y los costos fijos y variables.', 'Nuestras principales fortalezas son la diferenciación de nuestros productos, la creatividad y la continua innovación, ofreciendo productos de alta calidad que se destaquen por encima del comercio masivo. Nuestros canales de comercialización y marketing son las redes sociales y tiendas online, para los cuales nos capacitamos de forma recurrente a través de cursos y workshops.', 'La apertura del comercio amplió favorablemente nuestro nicho de mercado. Según la Cámara Argentina de Comercio Electrónico en el año 2021 creció un 68% con respecto al año anterior, siendo la indumentaria uno de los rubros principales que forman parte de ese porcentaje. Otra posibilidad que se nos presenta recurrentemente está vinculada con el potencial exportador de nuestros productos.', 'Si bien hemos crecido considerablemente en el último año, nuestra estructura aun pequeña y la falta de volumen para abastecer la creciente demanda es nuestra principal debilidad, lo que genera que muchos clientes compren a otros competidores al no encontrar stock en nuestra web.', 'La importación de productos con precios muy competitivos es una amenaza constante en la industria textil y en diversos rubros, pero la misma puede ser enfrentada a través de la diferenciación e innovación constante, el aumento de volumen en la adquisición de insumos (lo que abarataría nuestros costos) y la mejora en la organización para optimizar los tiempos de producción.', '2022-05-06 13:52:31', '2022-05-17 11:58:09'),
(208, 79, 1842, 20, 1, 'NUEVO PROYECTO', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-09 12:52:47', '2022-05-09 12:52:47'),
(209, 1788, 1843, 20, 1, 'INVERSION GANADERA', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-09 14:01:37', '2023-05-18 11:59:25');
INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(210, 713, 693, 19, 1, 'TECNIFICACIóN Y AUTOMATIZACIóN EN PLANTA LACTEA', 'Nos dedicamos a la elaboración de diferentes variedades de quesos, los cuales son comercializados en ciudades de la provincia como así también en provincias como Corrientes y Misiones. Contamos con un equipo de trabajo especializado y comprometido. Al tratarse de un rubro muy competitivo consideramos que la innovación en los procesos productivos es el camino para permanecer dentro del negocio. Con la incorporación de mayor tecnología en estos procesos se mejoraría notablemente la productividad.', '3000000.00', 1, 0, 'Automatización de líneas de producción para elaboración de quesos y aumento de la capacidad operativa de la planta.', 'Aumentar la producción. Disminuir costos operativos. Eficiencia en el uso de recursos (gas,luz,agua).', 'Nos permite ser competitivo ante otras industrias de mayor envergadura. Podríamos expandirnos hacia otros mercados.', 'Baja escala de producción. Elevados costos operativos. Maquinarias obsoletas lo que conlleva a altos costos de mantenimiento.', 'Empresa familiar con 29 años en el rubro lácteo. En un principio se procesaban 100 litros diarios de una forma artesanal. Se elaboraba solamente queso sardo. La materia prima provenía de pequeños tambos zonales. Trabaja sólamente el dueño.', 'En la actualidad se elaboran 4000 litros de leche diarios. Se elaboran queso de pasta blanda, semiduro y duro. La materia prima proviene de tambo propio. Trabajan seis personas en forma directa.', 'Lugar propio. Planta ubicada dentro del ejido urbano de Hernández', 'Lugar propio', 'Productos alimenticios. Elaboración de quesos de pasta blanda, semiduro y duro.', 'Actualmente la elaboración de los productos es de forma artesanal con un nivel de tecnología muy básico.', 'Recepción y acondicionamiento de materia prima. Elaboración del queso. Envasado y empaquetado. Maduración. Comercialización.', 'Leche de vaca proveniente de tambo perteneciente a la misma firma.', 'Se obtiene como subproducto de la leche el suero con el cual se elabora la Ricota.', 'Ventas al por mayor, distribuidores y comercios. Zonales y regionales.', 'Distribuidores de lácteos y otros productos alimenticios, el resto se trata de comercios con venta directa al público', 'Elevado nivel de competencia debido a la gran cantidad de industrias del mismo rubro y de mayor capacidad operativa.', 'Contamos con alrededor de 12 proveedores de los cuales la mitad se encuentran dentro de la provincia mientras que el resto son de otras provincias', 'Riesgo: ineficiencia de los procesos productivos debido a que la mayoría de la maquinaria ha cumplido su ciclo de vida útil. \r\nEstrategia: incorporación de nuevas maquinarias que permitan automatizar y optimizar procesos productivos.', 'Incorporación de activo fijo.', 'Actualmente contamos con seis operarios. Tres de los cuales dedicados a la obtención de la materia prima y tres en planta industrial.', 'Generación de nuevos puestos de trabajos genuino. Permite que los jóvenes se quedan en el lugar de origen y no migren hacia las grandes urbes. Colaboración y acompañamiento con instituciones sin fines de lucro. Se adopta la responsabilidad social empresaria.', 'Los precios de los quesos que se elaboran son los siguientes:\r\n* Pasta blanda: $450 el kilogramo.\r\n* Pasta semiduro: $540 el kilogramo.\r\n* Pasta dura: $620 el kilogramo.', 'Buen posicionamiento y reconocimiento en el mercado. Productos de calidad. Recursos humanos capacitados. Emprendedurismo.', 'Alta demanda de los productos. Financiamiento a tasa subsidiada.', 'Escasez de materia prima. Suba de precio en insumos. Cambios climáticos.', 'Alto nivel de competencia.', '2022-05-10 13:52:25', '2022-05-30 13:30:18'),
(211, 445, 1751, 19, 1, 'PUESTA EN MARCHA DE ENVASADORAS DE 1 Y 5 KG', 'VIEJO MOLINO SE DEDICA PRINCIPALMENTE A LA MOLIENDA DE TRIGO OBTENIENDO COMO PRODUCTO FINAL HARINA\r\nDE TRIGO, LA CUAL SE COMERCIALIZA EN ENVASES DE 50 Y 25 KG; DE DICHA MOLIENDA SE OBTIENE COMO\r\nSUBPRODUCTO EL AFRECHILLO EL CUAL SE ENVASA O SE COMERCIALIZA A GRANEL.', '3000000.00', 0, 0, 'READECUAR MAQUINARIA PARA ENVASADO EN PRESENTACIONES DE 1 Y 5 KILOS, ADQUIRIR LOS INSUMOS PARA LAS\r\nMISMAS (ENVASES, DESCARTABLES, PALETS, ETC) Y LA MATERIA PRIMA PARA TAL FIN (TRIGO).', 'EL OBJETIVO ES PONER EN FUNCIONAMIENTO ENVASADO DE HARINA DE TRIGO EN PAQUETES DE 5 Y 1 KILOGRAMO,\r\nCONTAMOS CON LA MAQUINARIA LA CUAL ESTA EN DESUSO DESDE HACE VARIOS AñOS POR LO CUAL EL FIN ES\r\nREALIZAR MANTENIMIENTO Y PUESTA A PUNTO Y ADQUIRIR LAS MATERIAS PRIMAS PARA SU PRODUCCIóN FINAL\r\n(ENVASES, DESCARTABLES, ETC)', 'CRECIMIENTO PARA LA EMPRESA, NOS BRINDARíA LA POSIBILIDAD DE ATENDER LAS DEMANDAS QUE SE PRESENTAN\r\nEN EL MERCADO, OFRECIENDO EL PRODUCTO EN DIFERENTES ENVASES Y CANTIDADES LO QUE NOS DARá LA\r\nOPORTUNIDAD DE CONQUISTAR OTROS PUNTOS DE VENTAS.', 'ACTUALMENTE SE COMERCIALIZA HARINA DE TRIGO EN ENVASES DE 50 Y 25 KILOS, Y COMERCIALIZACIóN DEL\r\nSUBPRODUCTO QUE OBTENEMOS EL TRIGO COMO ES EL AFRECHILLO, EL CUAL SE ENVASA DE 30 Y 25 KILOS, O SE\r\nCOMERCIALIZA A GRANEL.', 'VIEJO MOLINO ES UNA EMPRESA FAMILIAR CREADA POR EL SR. JORGE REIBEL, NACE EN 2012 CUANDO SE ADQUIRIó\r\nUN MOLINO DE UNOS 100 AñOS APROXIMADAMENTE EL CUAL ESTABA ABANDONO Y DURANTE EL PRIMER AñO SE\r\nTRABAJO EN SU MANTENIENDO, ESTRUCTURA A FIN DE RETOMAR LA MOLIENDA Y LA COMERCIALIZACIóN DE LA\r\nHARINA DE TRIGO, Y EFECTIVAMENTE EN 2014 COMENZó SU FUNCIONAMIENTO ENVASANDO EN BOLSAS DE 50 KILOS', 'CONTINUA SIENDO UNA EMPRESA FAMILIAR CONFORMADO POR JORGE REIBEL Y SUS DOS HIJOS, CARLOS REIBEL Y\r\nDELFINA REIBEL. SE COMERCIALIZA HARINA DE TRIGO EN ENVASES DE 25 Y 50 KILOS, Y EL SUBPRODUCTO QUE SE\r\nOBTIENE DE LA MOLIENDA, AFRECHILLO, EN ENVASES DE 25 Y 30 KILOS Y A GRANEL.', 'Propio:: UBICADO EN COLONIA NUEVA, A 1 KILOMETRO DE LA RUTA 12, INGRESO A VILLA URQUIZA. ES UNA ESTRUCTURA QUE FUE CONSTRUIDA HACE MUCHAS AñOS PARA SU FUNCIONAMIENTO COMO MOLINO HARINERO, CONTANDO EN SU INTERIOR CON LAS MAQUINAS PERTINENTES.', 'SU PROPIETARIO ES JORGE REIBEL, EL SOCIO MAYORITARIO, QUIEN ALQUILA A LA EMPRESA VIEJO MOLINO\r\nEL INMUEBLE CON TODAS SUS MAQUINARIAS Y EL PREDIO QUE LO RODEA PARA EL INGRESO Y EGRESO DE CAMIONES.\r\nLO ALQUILA DESDE 2014.', 'HARINA DE TRIGO TIPO 000, ACTUALMENTE EN PRESENTACIóN DE 50 Y 25 KILOS', 'ENVASADO DE 25 KILOS VALVULADAS CON ENVASADORA REGULADA A DICHO PESAJE.', 'TRIGO: PREVIO A LA DESCARGA, SE REALIZA UN ANáLISIS DE CALIDAD. EL MISMO ES ALMACENADO EN SILOS; PARA\r\nLUEGO SER INGRESADO A UN PROCESO CONTINUO DE MOLIENDA Y CERNIDO, OBTENIéNDOSE AL FINAL DE ESTE LA\r\nHARINA DE TRIGO Y SU SUBPRODUCTO (AFRECHILLO).', 'TRIGO CON CALIDAD PANADERA.', 'SE TRATA DE UNA INDUSTRIA SECA QUE NO PRODUCE DESECHOS. DEL PROCESO DE ELABORACIóN SE OBTIENE UN\r\núNICO SUBPRODUCTO (AFRECHILLO DE TRIGO), EL CUAL SE COMERCIALIZA PARA CONSUMO ANIMAL.', 'ESTAMOS DENTRO DE UN MERCADO COMPETITIVO, DONDE NUESTRA EFICIENCIA EN LOS COSTOS ES LO QUE NOS\r\nAYUDA A SER RENTABLES Y COMPETITIVOS.', 'ACTUALMENTE NUESTROS CLIENTES SON CONSUMIDORES INTERMEDIOS (PANADERíAS) O DISTRIBUIDORES. CON\r\nESTA NUEVA PUESTA EN MARCHA LA IDEA ES INGRESAR AL COMERCIO MINORISTA (SUPERMERCADOS, MERCADOS,\r\nETC) PARA LLEGAR CON NUESTROS PRODUCTOS A LOS CONSUMIDORES FINALES', 'EN CERCANíAS TENEMOS PLANTAS DE MOLIENDA DE TRIGO QUE ACTUALMENTE COMPETIMOS EN LA VENTA DE\r\nHARINA DE 25 KG PARA PANADERíAS. AL EMPEZAR A PRODUCIR DE 1 Y 5 KILOS ESTARíAMOS EN UN MERCADO CON\r\nMENOR COMPETENCIA EN NUESTRA áREA DE INFLUENCIA.', 'MAYORMENTE LOS PROVEEDORES SON DE LA ZONA, CONTAMOS CON PROVEEDORES FIJOS Y LUEGO SE PRESENTAN\r\nCOMPRA DE TRIGO A NUEVOS PROVEEDORES EN TIEMPO DE COSECHA.', 'EL PRINCIPAL RIESGO DE NUESTRA ACTIVIDAD ES QUE EXISTEN GRANDES COMPETIDORES QUE SON QUIENES\r\nMANEJAN EL MERCADO EN CUANTO A OFERTA Y PRECIOS. NOSOTROS COMO PYME QUE SOMOS BUSCAMOS\r\nFORTALECERNOS SIENDO EFICIENTES EN NUESTROS COSTOS Y BUSCANDO DIVERSIFICAR PRODUCTOS PARA NO\r\nESTAR DENTRO DE UN SOLO MERCADO', 'DESTINADO A CAPITAL DE TRABAJO PARA PONER EN FUNCIONAMIENTO LA MAQUINARIA DE ENVASADO DE 5 Y 1 KILO.\r\nPONER A PUNTO LA ESTRUCTURA Y ADQUIRIR ENVASES, PALETS', 'ACTUALMENTE CONTAMOS CON 8 EMPLEADOS QUIENES ESTáN DESTINADOS A LA RECEPCIóN DE TRIGO, MOLIENDA,\r\nENVASADO Y CARGA DE MERCADERíA. PARA PONER EN MARCHA ESTA NUEVA RAMA DE PRODUCTOS DEBERíAMOS\r\nCONTRATAR 2 EMPLEADOS MAS.', 'INGRESAR AL MERCADO CON MAS OFERTAS COMO ES EL CASO DEL PRODUCTO ENVASADO DE 1 Y 5 KILOS, BRINDAR\r\nNUESTRO PRODUCTO NO SOLO A QUIEN CONSUME POR MAYOR SINO TAMBIEN LLEGAR AL CONSUMO DIARIO DEL\r\nHOGAR.', 'El 80% del costo de nuestros productos es el Trigo, el cual es un comoditi que cuenta con un precio variable atento al mercado. Si\r\nbien tenemos una política de estabilidad de precios lo mas larga posible en el tiempo, dependemos del costo del mismo. Actualmente\r\nla bolsa de 25 kg a retirar del molino tiene un costo de $ 13500 + IVA.', 'Empresa familiar constituida por padre e hijos con grandes proyectos de crecimiento, esfuerzo, dedicación. La mayor fortaleza es la\r\nunión del equipo de trabajo y el potencial para dar crecimiento a nuestra empresa.', 'La empresa se encuentra en una zona donde las distancias a los centros de consumo nos ubica en una excelente posicion para\r\nabastecer dichos mercados.', 'Somos una empresa joven, que vamos haciendo experiencia de nuestros propios errores.', 'Como mencionábamos anteriormente los mayores competidores de este mercado tienen una posición predominante del mismo.', '2022-05-10 14:32:16', '2022-06-07 17:31:39'),
(212, 892, 1849, 20, 1, 'NUEVO PROYECTO', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-12 19:30:46', '2022-05-12 19:30:46'),
(215, 1803, 1864, 19, 1, 'COMPRA MATERIALES APICOLAS', 'Adquisición de préstamo para la compra de materiales apicolas.', '1550000.00', 1, 0, 'Ayuda económica , adquisición de nuevos materiales para la producción y cosecha de miel.', 'Desarrollo, crecimiento y expansión de la empresa en el sector apicola.', 'Mayor aprovechamiento del recurso natural en la región.', 'Se dispone de materiales viejos con escasos recursos para el cuidado de colmenares y la crianza de abejas.', 'Se iniciaron las actividades en el año 1990 con un escaso número de materiales y  con inmueble prestado para la extracción de miel', 'Hoy en día se cuenta con inmueble propio para el mantenimiento de herramientas y para la extracción de miel.', 'Ubicado en ruta 32, km 66. El inmueble cuenta con varios sectores de trabajo donde se realiza el mantenimiento de los materiales, deposito y la extracción de miel.', 'No se alquila', 'Obtención de la miel, alimento natural producido por las abejas y extraída por el hombre para su consumo.', 'Para la producción y cosecha de la miel se utilizan colmenas de materiales diversos como la madera y el metal.', 'La miel es producida por las abejas que se encuentran en diferentes colmenas, ubicadas estrategicamente para el aprovechamiento de la flora de la región. En una determinada fecha del año se realiza la cosecha a través de maquinaria exclusiva para la extracción.', 'La miel es una sustancia dulce natural producida por las abejas a partir del néctar de flores o plantas. Transforman el néctar combinándolas con sustancias específicas de las propias, depositan,\r\ndeshidratan, almacenan y las dejan en las colmenas para que madure.', 'El único desecho que genera la extracción de miel es la cera y esta es reutilizada para producir nuevos estampados de cera.', 'Destinado a la venta local y provincial.', 'Mayoristas, minoristas y consumidor final.', 'Pequeños productores donde cuya finalidad es la venta local en pequeñas fracciones.', 'Empresa \"Fabritamb\" fabrica de tambores\r\nEmpresa \"El ceral\" proveedor de alimentos para abejas, como el caramelo.', 'Riesgos naturales a causa del clima.\r\nRuptura o daño del material por el uso continuo.\r\nUna de las estrategias es el monitoreo diario de los colmenares y llevar un registro periódico de cada sector (deposito, maquinaria, inmueble, bienes activos, etc)', '500 cámaras de cría $885 c/u $442500\r\n500 pisos $650 c/u $325000\r\n500 techos $750 c/u $365000\r\n4000 ojalillos c/u $92 $368000\r\nPintura $39500', 'Trabajo familiar, no se posee empleados', 'Con el crecimiento de la empresa se puede generar puestos de trabajo y así contratar empleados para una mayor producción.', '$290 el kilo de miel', 'Conocimientos en el ámbito de la apicultura, el medio ambiente natural y otros campos como la agricultura y la ganadería.\r\nCapacidades económicas para generar negocios y trabajo.', 'Crecimiento en el ámbito laboral y obtención de conocimientos tanto tecnológicos como económicos.\r\nOportunidad de expandirse en otras zonas dentro territorio tanto provincial como nacional.', 'Dependencia de los cambios climáticos y poca accesibilidad en caminos rurales para el ingreso a colmenares.\r\nDeterioro de materiales y maquinarias para la extracción de miel.', 'Mala manipulación de productos químicos en el sector agrícola (fumigación con plaguicidas, herbicidas, agrotóxicos, etc) que afectan a la tasa de natalidad de las abejas, si estas mismas se encuentran cerca de campos de siembra.', '2022-05-23 12:42:22', '2022-06-07 14:09:22'),
(216, 1806, 1866, 19, 1, 'TECNIFICACION Y MEJORAMIENTO DE LA PRODUCTIVIDAD A TRAVEZ DE LA INVERSION EN BIENES DE CAPITAL', 'A través de la compra de dos máquinas queremos mejora la productividad en dos unidades de negocio de nuestra empresa.\r\nLa compra del plotter Roland nos permitiría imprimir al doble de velocidad, lo que mejoraría nuestra productividad.\r\n\r\nLa compra de la maquina Heidelberg MO de offset, nos permitiría imprimir cajas y papelería en un formato más grande que actualmente no lo podemos hacer, y lo tenemos que tercializar en imprentas de Santa Fe y Buenos Aires.', '3000000.00', 1, 0, 'A través de la compra de dos máquinas queremos mejora la productividad en dos unidades de negocio de nuestra empresa.\r\nLa compra del plotter Roland nos permitiría imprimir al doble de velocidad, lo que mejoraría nuestra productividad.\r\n\r\nLa compra de la maquina Heidelberg MO de offset, nos permitiría imprimir cajas y papelería en un formato más grande que actualmente no lo podemos hacer, y lo tenemos que tercializar en imprentas de Santa Fe y Buenos Aires.', 'mejorar la productividad y la facturación de la empresa a traves del mejoramiento de bines de capital', 'La oportunidad de este proyecto es poder consolidarnos como fabrica de empaques. ya que todo ese trabajo se realiza fuera de la provincia', 'Actualmente nosotros tenemos una limitación par imprimir en offset por el tamaño del pliego y por la calidad de las maquinas de offset, con esta maquina nosotros podríamos mejorar la calidad de los trabajos, el precio y la cantidad y serian realizado exclusivamente por nosotros en esta provincia, con respecto al plotter de impresión, renovaríamos una  maquina lo que nos permitiría imprimir al doble de velocidad con mejor calidad y solucionaríamos un cuello de botella', 'Print nace en marzo de 2005 comienza como una tarjetería e impresión digital, orientada como imprenta rápida, con dos socios y una empleada, luego nos fuimos integrando verticalmente y horizontalmente. Comenzamos a desarrollar la impresión en offset para tiradas mayores y todo lo que sea terminado o post impresión, y también compramos plotters de impresión con lo que podemos imprimir vinilos comerciales , decorativos y lonas para cartelería. Estas diversificaciones nos han permitido resistir.', 'Actualmente contamos con dos establecimientos\r\n1 el local comercial ubicado en calle santa fe 39 donde realizamos impresiones digitales\r\n2 el taller grafico en pasaje bravo donde tenemos las maquinas de offset, digitales, plotters y de terminado\r\nDando trabajo a 10 personas en total, 2 socios y 8 empleados', 'planta de pasaje bravo 628 de 300 metros cuadrados, donde se realiza el 80% de la produccion', 'local comercial de calle santa fe 39, se realiza la atención a los clientes y las impresiones que se necesitan en el momento', 'digital: impresión en papel de BAJAS TIRADAS, folletería planillas comerciales, revistas libros, tarjetas, carpetas palasatificados etc\r\nOFFSET:  impresión en papel de GRANDES TIRADAS, folletería planillas comerciales, revistas libros, tarjetas etc\r\nPLOTTER: cartelería, señalética, lonas, calcos, etc', 'no aplica por el tipo de producto', 'impresion en offset, digital y por plotters', 'ppapel\r\nlonas\r\ntintas\r\ntoner', 'tintas, trapos y toner, los retira la empresa horizonte todo los años de residuos', 'TENEMOS\r\nCUATRO  TIPOS DE CLIENTES:\r\nPARTICULARES, GREMIO(DISEÑADORES E IMPRENTAS), EMPRESAS E INSTITUCIONES GUBERBNAMENTALES\r\nTRES FAMILIAS DE PRODUCTOS:\r\nDIGITAL---OFFSET---PLOTTER', 'PARTICULARES: CLIENTES QUE ACUDEN A NOSTROS PAR IMPRIMIR COSAS PARTICULARES, YA SEA PARA EVENTOS O PROPIOS\r\nEMPRESAS: EMPRESAS QUE IMPRIMEN PRODUCTOS PARA PROMOCION Y PAPLERIA COMERCIAL\r\nINSTITUCIONES GUBERNAMENTALES: IMPRIMEN PRODUCTOS PARA PROMOCION Y PAPELERIA Y CARTELERIA\r\nGREMIO: TODO TIPO DE IMPRESIONES PARA SUS CLIENTES', 'EN CADA SECTOR TENEMOS DISTINTOS COMPETIDORES, YA QUE SOMOS LOS UNICOS QUE PODEMOS REALIZAR TODO EN LA CIUDAD', 'PAPELERAS DE CORDOBA, BUENOS AIRES Y PARANA (PAPELERA CUMBRE, HUTTON, PAPELREA DE ENTRE RIOS)\r\nINSUMOS PARA PLOTTER TINTAS Y LONAS (INSUFE PLOTER SERVICE)\r\nINSUMOS PARA MAQUINAS  DIGITALES (IMAGEN SISTENAS DE IMPRESION. M Y N)', 'AUMENTO DE LOS INSUMOS POR INFLACION O AUMENTO DEL DOLAR', 'EL MONTO SOLICITADO TENDRA COMO DESTINO PARTE DE LA COMPRA DE DOS MAQUINAS:\r\nPLOTER ROLAND RF 640	--------	$2071927\r\nMAQUINAOFFSET HEILDERBERG MO-----	$2420000\r\nT O T A L	-----------$4492427', '8 EMPLEADOS Y 2 DUEÑIOS', 'SE GENERARRA TRABAJO QUE ACTUALMENTE SE REALIZA EN OTRAS PROVINCIAS LO QUE GENERA PUESTOS DE TRABAJO Y TRIBUTACION LOCAL', 'SON MUY DIVERSOS', '17 AÑOS DE EXPERIENCIA\r\nCAPACIDAD INSTALADA\r\nPERSONAL CAPACITADO\r\nGRAN CAPACIDAD DE ADPTARNOS AL MERCADO\r\nMUY BIEN POSICIONADOS EN EL MERCADO\r\nBIEN INTEGRADO VERTICAL Y HORIZONTALMENTE', 'CAPTAR UN MERCADO QUE HOY LO TIENEN LAS EMPRESAS DE  AFUERA\r\nPASAR DE SER UNA IMPREENTA POR DEMANDA A UNA PRODUCRTORA DE ENVASES QUE ABASTEZCA A LAS INDUSTRIAS LOCALES', 'FALTA DE CAPACIDAD INSTALADA PARA CIERTOS PRODUCTOS\r\nFALTA DE LIQUIDEZ FINANCIERA', 'QUE SE REDUZCA EL SECTOR GRAFICO Y QUE NO LOGREMOS TRANSFORMARNOS\r\nQUE VENGAN COMPETIDORES DE OTRO LUGARES', '2022-05-23 14:50:01', '2022-05-24 14:11:06'),
(217, 1812, 1871, 20, 1, 'PRODUCCIóN DE IMAGEN', 'Adquisición  de una herramienta de trabajo (Cámara Sony Digital Mirrorless Full Frame ILCE-7RM4A A7RIV', '600000.00', 1, 0, 'El paso del tiempo y llegar a la nueva tecnología\r\nCon la adquisicion de estos nuevos equipos voy a poder mejorar la velocidad de entrega y la calidad de trabajo final; porque cuento con herramientas que se tornan  lentas en las tranferencias de archivos y con una calidad inferior a la nuevas tecnologías.', 'Adquisición de una cámara 4K y full frame, con  alta resolución del sensor CMOS, potenciada mediante el motor de imagen y la vibración reducida con un estabilizador de imagen de 5 ejes, excelente cobertura, velocidad y seguimiento del enfoque automático (eye en tiempo real).', 'Como emprendedor de una mini pyme, esta oportunidad significaría la expanción a otro mercado de trabajo (registro de imágen para remates: vacunos - ovino -  caprinos - caballos, remates on line, deportes, turismos, eventos sociales) , ya que contando con las herramientas adecuadas y actualizadas segun las nuevas tecnologías , se puede comenzar a introducirse en el ambito laboral con mayor competitividad y  adecuación al registro  audiovisual que requieren los clientes.', 'Actualmen estoy trabajando en la toma de fotografía para publicidad con empresas locales y regionales.', 'El empredimiento lo comencé hace aproximadamente  20 años, realizando coberturas de eventos sociales, filmacion de diferentes deportes ( futbol, automovilismos). Luego incorporé trabajo con productores rurales para publicidad', 'Actualmen estoy trabajando en la toma de fotografía para publicidad con empresas locales y regionales.', 'Hogar familiar', NULL, 'Registro audiovisual, edición de imágen, proyección de videos y fotografía', 'Full HD, 4 k, Full frame', 'Filmacion y edición de imagen', 'servicios técnicos, cámaras, tarjetas de memorias, iluminación, electricidad, movilidad', 'No genera', 'Mercado publicitarios en 4K y full frame', 'Sujeto de derechos públicos y privados\r\nProductores ganaderos y agropecuarios', 'título de camarógrafo profesional y editor de video adobe premiere pro', '\"Megaservice\", \"tvgroup\"', 'Superar la calidad de imágen y tratar de actualizarse con herramientas adecuadas para comppetir en el mercado laboral en que me encuentro.', 'Es para la compra de una camara profecional.', 'No tengo empleados', 'Mejorar la calidad de mi empresa, ya que contando con herramientas de trabajo actualizadas, puedo tener mayor ingreso y poder solventar los diferentes gastos que me surgen a diario como emprendedor.', '$600.000 Cámara Sony Digital Mirrorless Full Frame ILCE-7RM4A A7RIV', 'Conocimientos sólidos de lenguaje de imagen.\r\nManejos especializados de programa de edición.\r\nBuena calidad en productos finales.', 'Expansión a todo tipo de mercado y regiones.\r\nAdaptación a las tecnologías actuales.\r\nAumento del consumo de material audiovisual en redes sociales', 'Necesidad de mayor calidad en los equipos tecnológicos para desarrollar proyectos audiovisuales\r\nNecesidad de personal para el equipo de producción.\r\nBaja cartera de clientes\r\nPoca presencia en redes sociales.', 'Anunciantes con producción propia.\r\nAgencias de comunicación con producción propia.\r\nFuertes competencias de otras productoras.\r\nAplicación en dispositivos móviles con herramientas que facilitan la elaboración de material audiovisual', '2022-05-30 13:08:40', '2022-06-08 15:06:34'),
(220, 206, 1874, 20, 1, 'NUEVO PROYECTO', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-31 13:10:47', '2022-05-31 13:10:47'),
(221, 1796, 1875, 19, 1, 'SOLICITUD DE PRéSTAMO PARA ADQUISICION DE CAPITAL DE TRABAJO', 'Adquisición de bienes de cambio para poder tener un stock adecuado a las necesidades y elementos para almacenar la mayor cantidad de mercadería.\r\nEl objetivo es cumplir en tiempo y forma con los pedidos de clientes a efectos de fomentar una mayor fidelización de los mismos.', '3000000.00', 0, 0, 'Adquisición de bienes de cambio para poder tener un stock adecuado a las necesidades y elementos para almacenar la mayor cantidad de mercadería.', 'Cumplir en tiempo y forma con los pedidos de clientes a efectos de fomentar una mayor fidelización de los mismos.', 'Poder expandir la empresa al incrementar las ventas y por lo tanto incorporar personal.', 'Actualmente no siempre es posible cumplir con todos los pedidos debido a la falta de existencia de algunos productos, carencia de personal y espacio físico motivada en la limitada disponibilidad de recursos económicos.', 'Nuestra empresa empezó en 2015 cuando los socios Simaldone Hector Rodolfo y Pereyra Juan Manuel se asocian para vender pescado, trabajaron a su nombre hasta que en Noviembre de 2020 constituyen Litoral Fish SRL, que inicia actividades en Febrero de 2021, pero no fue hasta Agosto que logran obtener todas las habilitaciones municipales y de SENASA para poder comenzar a comercializar. Por este motivo, en el año 2021 las ventas fueron bajas, porque hasta el mes de Julio facturaron los socios.', 'Actualmente la empresa cuenta con 5 empleados, mas los 2 socios que trabajan en la misma. Necesitaríamos ayuda financiera porque al ser el primer ejercicio los volúmenes de ventas fueron bajas, y por el sistema bancario no podemos obtenerla.', NULL, 'El lugar donde funciona la planta es alquilado, está ubicada en el barrio Quinto Cuartel de Victoria, Provincia de Entre Ríos. Estamos alquilando hace 6 años, y hemos realizado todas las mejoras posibles para asegurar la excelente calidad de los productos.', 'Elaboramos y vendemos productos de mar y río, filetes de pescados, mariscos y moluscos.', 'Se trata principalmente de mercadería congelada, que se recibe, elabora y posteriormente se congela para su comercialización.', 'Ingreso de mercadería fresca, lavado, eviscerado, congelado y envasado.\r\nSi se realiza fileteado y/o despinado en planta, el subproducto va a molienda y envasado obteniéndose carne molida de pescado de río\r\nSi ingresa producto congelado se procesa para ser congelado individualmente y luego ser envasad', 'Pescado de río entero, fileteado y/o despinado\r\nPescado de mar entero, fileteado y/o despinado\r\nCrustáceos, mariscos y moluscos \r\nProductos elaborados rebozados', 'En toda la planta donde se procesa la materia prima, se cuenta con rejillas de desagüe en todos los sectores para captar líquidos generados en las operaciones de limpieza de cada sector de elaboración. Se cuenta con rejillas distribuidas por todos los sectores para evitar el desplazamiento de sólido', 'Nuestro mercado esta enfocado principalmente en provincias del norte (Misiones, Salta, Jujuy), pero realizamos ventas en 9 provincias.', 'Establecimientos de venta de alimentos (Pescaderías, supermercados, autoservicios, etc.)\r\nEstablecimientos gastronómicos (Restaurantes, comedores, etc.)\r\nDistribuidoras de productos congelados.', 'La competencia se conforma de otros frigoríficos y establecimientos de ventas de pescados.', 'Nuestros proveedores de pescados de río son principalmente pescadores artesanales, y los proveedores de pescados de mar son distribuidores de la Provincia de Buenos Aires.', 'Los riesgos son los normales de toda actividad económica que se realice de forma privada, con cierta estacionalidad de ventas en los meses de mayo a septiembre. Nuestra estrategia se basa en utilizar la mayor capacidad de planta, dejando poco lugar a la ociosidad, para aprovecharla al máximo.', 'Compra de materia prima\r\nCompra de equipamiento', 'Tenemos actualmente 4 empleados en sector de producción, 1 en administración y los 2 socios que se encargan de la comercialización.', 'A pesar de ser una empresa pequeña, nuestra idea es expandirnos a medida que obtengamos mas participación del mercado, dando trabajo a mas personas tanto de forma directa como indirecta, y de esa manera contribuir de una manera positiva hacia la comunidad.', 'Los precios habituales de mercado que se determinan por oferta y demanda, generalmente tomamos precios similares a nuestra competencia.', 'Imagen corporativa\r\nEstructura armada y experiencia en el rubro\r\nCalidad de los productos\r\nAnsias de superación y crecimiento', 'La situación del país no es fácil, pero esto a su vez es una oportunidad de captación de mercado porque está haciendo que muchas empresas cierren sus puertas.', 'Al tener una capacidad de compra limitada, no tenemos buenos precios de proveedores.', 'La amenaza más fuerte podría ser la reducción de consumo en caso que la situación económica del país se complique.', '2022-05-31 13:17:41', '2022-08-02 11:59:39'),
(223, 1817, 1880, 19, 1, 'AMPLIACIÓN DEPOSITO DE TAMBORES Y CONSTRUCCIÓN DE SALA DE ENVASADO.', 'El ingreso de nuevos socios a la  cooperativa hizo aumentar la producción de miel y los espacios se han reducido, por lo que es imprescindible una ampliación del depósito de tambores que permita trabajar con mayor comodidad y orden. Al ampliar el espacio se podrá construir una sala de envasado separada de la sala de extracción como lo exigen las normativas de SENASA.', '3000000.00', 1, 0, 'Actualmente existe un espacio de unos 60 m2 cubierto por un tinglado que también tiene su piso de hormigón, el cual se cerrará ganando un importante espacio que se podrá utilizar para depósito de tambores liberando otro lugar interno donde se construirá la sala de envasado que actualmente y por falta de espacio está ubicada dentro de la sala de extracción.', 'El principal objetivo del proyecto es lograr mayores espacios para trabajar con mayor comodidad, tener un mejor ordenamiento de las instalaciones y de esa manera lograr ser más eficientes en la producción ya que actualmente se debe dejar parte de los materiales a la intemperie ó se amontonan dentro del depósito de tambores generando dificultades que complican el trabajo.', 'El hecho de conseguir este crédito permitirá a la cooperativa mejorar su ordenamiento con lo que el proceso productivo se verá beneficiado aumentando de esa forma la eficiencia, tanto en la sala de extracción como en el depósito de tambores, a la vez que con la construcción de la sala de envasado separada de la sala permitirá cumplir con las normativas exigidas.', 'Cuando se construyó el tinglado destinado a ser depósito de tambores con su correspondiente piso de hormigón no se pudo terminar el cerramiento del mismo quedando una superficie de alrededor de 60 m2 que es la que actualmente se quiere cerrar para lograr mayores espacios que permitan mejorar el funcionamiento Cuando se construyó el tinglado destinado a ser depósito de tambores con su correspondiente de la sala de extracción.', '\"RIO DE LOS PAJAROS\" Cooperativa Apícola Limitada fue aprobada por el INAES en Julio del año 2.010 y estuvo integrada en aquel momento por diez pequeños apicultores de Concepción del Uruguay y la zona que decidieron unirse para conseguir beneficios al comprar en conjunto insumos como materiales, tambores, etc. como así también lograr vender la miel de su producción consiguiendo mejores precios al vender en conjunto.', 'En la actualidad la cooperativa tiene veintidos socios a los que brinda sus servicios de extracción de miel como así también la provisión de insumos y, fundamentalmente, realiza la venta de miel por cuenta y orden de los productores que se ven beneficiados por tener la cooperativa mayor poder de negociación al ofrecer lotes de tambores importantes que si se hicieran en forma particular no lograrían.', 'La sala de extracción de miel está ubicada en el Parque Industrial de Concepción del Uruguay Calle Pública Lote 17 Manzana 4.', 'No se alquila. El terreno y la sala son propiedad de la cooperativa.', 'La cooperativa brinda servicio de extracción de miel tanto a sus socios como también a terceros que así lo requieran. Para ello el productor llega a la sala con sus alzas melarias llenas de miel, se pesan en una balanza, se anota el peso bruto y se asigna un número de lote para ordenar su extracción', 'La sala de extracción está integrada por balanza electrónica, desoperculadora de marcos, prensa de opérculos separadora de miel y cera, fosa receptora, extractor centrífugo, bomba elevadora de miel, tres decantadores con capacidad de 2.000 kgs. cada uno. Todo este material es de acero inoxidable', 'Ingresan las alzas melarias llenas de miel, se pesan, se anota el peso bruto y se asigna número de lote. Luego se desoperculan los marcos, se llenan los canastos y estos son colocados en el extractor que por fuerza centrífuga saca la miel y esta cae en la fosa para ser enviada a los decantadores.', 'Una vez extraida la miel se envía a los decantadores, donde queda unas 48 horas para que floten restos de cera, abejas muertas y algunas otras impurezas. Pasado ese tiempo en los decantadores se saca la miel de estos por una canilla inferior yendo directamente a los tambores totalmente limpia.', 'El proceso de extracción de miel se hace en frío, salvo el desoperculado donde una cuchilla es entibiada a unos 50° para retirar los opérculos que cubren el panal. No existe ningún tipo de subproceso como tampoco desechos y/o residuos, salvo algo de miel que cae en el piso, el que se lava con agua.', 'El consumo per cápita de miel en la Argentina es de solo 180 grs. al año. Casi el 95 % de la miel producida en el país es exportada, fundamentalmente a Europa, EEUU, Japón y otros. Se ha incrementado algo el consumo local por personas que buscan una alimentación natural, pero lejos estamos de aquellos países que consumen entre 800 grs. y 1,200 kgs. por persona y por año. Faltaría una campaña promocionando las propiedades de la miel.', 'La mayor parte de nuestra producción se vende en tambores de 300 kgs. directamente a acopiadores ó exportadores. Nuestra cooperativa adquirió hace un año una envasadora para fraccionar y vender en potes de 1 kg., 1/2 kg. y 1/4 kg. y se van ganando clientes tratando de imponer nuestra marca, tanto en nuestra zona como enviando a Buenos Aires, Misiones y Córdoba en pequeñas cantidades.', 'El mayor problema que tiene todo el sector apícola es la competencia desleal que se genera con productos denominados Alimentos a base de MIEL con JMAF, que no es otra cosa que jarabe de maíz de alta fructosa, producto industrial que desvirtúa totalmente lo que significa un producto natural como es la miel. Aquel \"alimento\" es lisa y llanamente una adulteración pero está permitido por el Código Alimentario Argentino y, por supuesto, se vende mucho más barato por ser industrial.', 'En el transcurso de los años hemos establecido buenas relaciones con proveedores de insumos como materiales apícolas, indumentaria, tambores y medicamentos, como así también con varias empresas compradoras de miel como Nexco, Villamora, New San, Grúas San Blas, Naiman y otras.', 'La experiencia nos indica que debemos ir ganando cada cliente y fidelizarlo con un producto sano, nutritivo y totalmente natural como es nuestra miel. Vendemos a pequeños negocios como dietéticas, verdulerías y carnicerías donde el propio dueño atiende a sus clientes y está concientizado del producto que vende. No pasa lo mismo con los grandes supermercados donde la miel ó el \"alimento a base de MIEL\" están juntos y estos salen menos de la mitad que aquella.', 'El crédito será destinado a la ampliación del depósito de tambores, ganando un espacio importante para mejorar el proceso productivo y poder construir la sala de envasado separada de la sala de extracción consiguiendo mejorar la eficiencia tanto de esta como del fraccionado por estar ambos espacios independientes uno de otro.', 'La característica de nuestra cooperativa es que los propios socios se ocupan del proceso de extracción en la temporada de cosecha como así también del mantenimiento, limpieza y orden dentro de la sala. Agregado a esto hay varios socios que se ocupan de la comercialización de los productos. Por lo tanto no existen empleados en relación de dependencia de la cooperativa.', 'Lograr un mayor espacio mejorará enormemente la comodidad de trabajo, facilitará las tareas al estar ordenado el depósito de tambores y al separarse la sala de envasado permitirá aumentar la eficiencia en la producción. Todo esto sin dudas que abaratará los costos generando beneficios a la cooperativa en primer lugar y, consecuentemente, a los socios y sus familias que conseguirán mejorar su calidad de vida.', 'El precio de la miel en tambores en este momento oscila entre $ 290.- y $ 300.- el kg. por lotes importantes, mientras que el precio envasado actualmente lo vendemos al comercio a $ 460.- y  directo al público entre $ 550.- y $ 600.- Por el servicio de extracción la cooperativa le cobra a los socios un 9 % de la miel extractada y un 13 % a lo no socios.', 'En estos doce años de vida de la cooperativa se han ido consiguiendo mejoras cada año sin endeudarnos más allá de lo estrictamente necesario, siempre con el objetivo de conseguir beneficios a los socios. Además de las mejoras en maquinarias ó herramientas se ha conseguido la habilitación de la sala de extracción por SENASA, el RNE y RNPA como así también el código de barras para nuestros productos envasados.', 'Con la nueva sala de envasado se podrá mejorar notablemente la producción y tenemos proyectado contactarnos con distribuidores en distintos lugares del país para conseguir mayores ventas de miel envasada generando mayor valor agregado que si vendemos la miel a granel en tambores de 300 kgs.', 'La mayoría de los socios de la cooperativa tienen a la apicultura como segunda actividad, por lo que el elemento tiempo es el que más escasea y condiciona muchas veces el funcionamiento de la misma. Llegará el momento que se deberá tomar personal para algunas actividades que en este momento hacen que muchas cosas se posterguen por falta de tiempo.', 'Las mieles adulteradas y permitidas son la principal amenaza por ser una competencia desleal, además de realizar una publicidad engañosa al vender como si fuera miel genuina lo que es un \"Alimento a base de MIEL\" que confunde al público consumidor agregado al precio irrisorio comparado con la miel pura.', '2022-06-02 14:32:07', '2022-06-06 17:08:59'),
(225, 1821, 1885, 20, 1, 'NUEVO PROYECTO', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-06-08 15:22:50', '2022-06-08 15:22:50'),
(226, 1811, 1886, 19, 1, 'ARMADO DE TABLEROS', 'La idea es armado de tableros de pino y eucalipto, a partir de la creciente demanda de los mismos, por parte de carpintero y hobbistas,', '2450000.00', 1, 0, 'Armado de tableros de pino y eucalipto alistonados, aprovechando medidas que tienen poca salida por si solas, y con esto al pegarlas se obtiene como producto final un tablero de mayor dimension el cual se utiliza por ejemplo, muebles, tapas, mesas, estantes etc.', 'Darle valor agregado a la madera de menores dimensiones, logrando con el pegado de las mismas un producto uniforme y de mayor dimension, el cual se obtiene un mayor margen final.', 'Aprovechamiento de maderas de poca salida y de recupero en los aserraderos, se consigue a un precio inferior, con el producto ya elaborado se le da un valor agredo muy significativo.', 'En la actualidad se realiza de manera muy rudimentaria, no obteniendo una gran produccion de los mismos, la idea es ampliarla.', 'Arranque mi negocio de venta de madera a finales del 2004, primero solo venta de de madera rustica, luego incorporae maquinaras diversas, machimbre, tableros, deck, zocalos cornizas, multilaminados, lo cual contaba con equipo finger, moldurera, cepilladora, lijadora de contacto, zunchadora termica, escudadradora horizontal y vertical, prensa de 10mts,compraba madera en bruto y elaboraba mis propios productos, hasta el 2015 el cual sufri un incendio total del galpon, perdiendo todo.', 'Luego del incendio logre recuperarme de a poco y logrando una captacion importante en gualeguaychu y alrededores, fabrico algunos productos para Walker Cosmetica del automotor, sombrillas del sur, tambien soy un gran proveedor de madera a la municipalidad de gualeguaychu y caminos del rio uruguay.', 'Cuento con un galpon de 300m2, superfice total de predio  1350m2.', 'Años de alquiler 10 años.', 'no aplica', 'no aplica', 'Seleccion y corte de madera, luego se procede a cepillar para dejar una medida uniforme, para culminar con el pegado de las mismas en una prensa.', 'Pino o eucalipto, mayormente en medidas poco comerciales.', 'Los desechos que se generan generalmente se vende para artesanias o se envia a colegios para manualidades, con respecto a la viruta se vende para los boxes de caballos.', 'El mercado a raíz de la pandemia genero que la gente comenzo a trabajar en su casa en el armado de muebles, y el consumo de placas alistonadas tuvo un crecimiento muy grande.', 'Carpinteros y hobbistas.', 'Con respecto a la competencia cuento con un precio diferencial, debido a la propia fabricacion de los mismos.', 'Mayormente de la zona de misiones.', 'Riesgo generalmente no existe en el desabastecimiento ya que es una madera que siempre se tiene stock por recupero.', 'Compra de cepilladora y prensa de tableros rotativas.', '2', '.', 'Los precios al fabricar mi propia prouccion son muy competitivos con respecto a la competencia.', 'Aprovechamiento madera de menor valor.\r\nArmado de propios tableros lo lleva a un menor costo.', 'Ampliar venta al por mayor, se cuenta con posible comparador teniendo stock y produccion.', 'Poca capacidad de produccion.', 'Sobre stock por falta de venta de acuerdo a situacion economica del pais.', '2022-06-08 15:46:16', '2022-06-13 14:16:35'),
(231, 1824, 1895, 19, 1, 'CANTERA SUELO CALCAREO', 'EXPLOTACION DE CANTERA DE SUELO CALCAREO EN COSTA GRANDE, DEPARTAMENTO DIAMANTE', '3000000.00', 0, 0, 'MOVIMIENTO DE SUELO, DESTAPE Y EXTRACCION DE SUELO CALCAREO DESTINADO A LA VENTA', 'INVERSION PARA MAXIMIZAR LOS RECURSOS PARA EXTRACCION DE SUELO CALCAREO', 'ABASTECER VARIOS MUNICIPIO DE LA ZONA Y A LAS EMPRESAS QUE EN ESTE MOMENTO ESTAN REPAVIMENTANDO RUTAS Y USAN ESTE MATERIAL DE BASE', 'CONTAMOS CON 2 MAQUINAS Y 2 OPERARIOS Y PROVEEMOS A MUNICIPIOS MEDIANTE CONCURSOS DE PRECIOS Y LICITACIONES', 'TRANSER ES UNA EMPRESA FAMILIAR CREADA EN 2011 QUE ORIGINALMENTE SE CREO PARA TRANSPORTE DE MERCADERIA A GRANEL Y VENTA DE MATERIAL DE CONSTRUCCION', 'HOY CONTAMOS CON UNA FLOTA DE 7 EQUIPOS DESPINADOS AL TRANSPORTE Y DESDE HACE UN AÑO COMENZAMOS CON EL PROYECTO DE EXPLOTACION DE CANTERA', 'KM 52 RUTA 11 COSTA GRANDE DEPARTAMENTO DIAMANTE', '2 AÑOS DE ARRENDAMIENTO RENOVABLE AUTOMATICAMENTE ES UN CAMPO DE 5HAS UBICADO A 2 MIL METROS DE LA RUTA 11 KM 52 DEPARTAMENTO DIAMANTE SENTIDO HACIA EL RIO', 'EXTRACION DE SUELO CALCAREO UTILIZADO DE BASE PARA CONSTRUCCION DE CALLES RUTAS Y PLATEAS DE VIVIENDAS', 'EL PRODUCTO TIENE VALORES SOPORTE Y DENSIDAD QUE SON LO QUE NECESITAN LAS CONSTRUCTORAS PARA REALIZAR SUELO BASE PARA AUTOVIAS Y PARA RELLENO DE PLATEAS PARA VIVIENDAS DADAS SUS CARACTERISTICAS', 'EL PROCESO SE REALIZA CON MAQUINAS VIALES , CARGADORA Y EXCAVADORA, LO CUAL SE COMIENZA CON LA EXTRACCION DE LA CAPA SUPERIOR (TIERRA) , LO QUE REQUIERE UN MOVIMIENTO IMPORTANTE PARA EL DESTAPE DE LA BASE INFERIOR DONDE SE ENCUENTRA EL SUELO CALCAREO , SE EXTRAE POR ETAPAS HASTA EL NIVEL PERMITIDO', 'NUESTRA MATERIA PRIMA FUNDAMENTAL SON LOS COMBUSTIBLES ,LUBRICANTES Y REPUESTOS DE LAS PROPIAS MAQUINAS COMO TAMBIEN EL COSTO ORIGINARIO POR EL ARRENDAMIENTO', 'EN ESTE CASO NO HAY DESECHOS , LUEGO DE DETERMINADO TIEMPO Y TERMINADA LA EXPLOTACION SE REINCORPORA EL SULO PRIMARIO AMSU ESTADO NATURAL', 'HOY EN DIA EL MERCADO DE ESTE PRODUCTO ESTA SIENDO MUY DEMANDADO YA QUE HAY VARIAS OBRAS VIALES EN CURSO', 'LEMIRO PIETROBONI\r\nCONSTRUCTORA DOS ARROYOS\r\nPITON\r\nMUNICIPALIDAD DE CRESPO\r\nMUNICIPALIDAD DE SEGUI\r\nMUNICIPALIDAD DE TABOSSI\r\nMUNICIPALIDAD DE MARIA GRANDE\r\nCOMUNA DE LAS TUNAS\r\nCOMUNA DE ALDEA EIGENFELD\r\nCONSTRUCTORA BOLZAN\r\nMAIOCCO CEREALES\r\nNORVIAL SA', 'EN LA ZONA NO TENEMOS CANTERAS CERCANAS SI SE ENCUENTRAN MAS CERCA DE LA ZONA DE PARANA', 'GOTTIG\r\nFERNANDES INSUA', 'EN ESTE RUBRO EL RIESGO EL LA ROTURA DE LAS MAQUINAS Y ESO IMPLICA LA IMPOSISBILIDAD DE EXPLOTACION Y ACOPIO , NUESTRA ESTRATEGIA ES GARANTIZAR EL ACOPIO Y LAS HORAS DE MAQUINA PARA TENER SUFICIENTE MATERIAL ACOPIADO', 'COMPRA DE COMBUSTIBLES Y LUBRICANTES', '2 MAQUINISTAS Y 6 CHOFERES DE CAMIONES', 'PROVEEER EL MATERIAL PARA BRINDAR RAPIDEZ A LAS OBRAS', 'EL PRECIO DE MERCADO ES DE 420 EL M3 PUESTO SOBRE CAMION', 'UBICACION LOGISTICA \r\nCALIDAD DEL MATERIAL\r\nDISPONIBILIDAD DE ENTREGA', 'OBRAS EN CURSO\r\nGENERACION DE MAS CLIENTES', 'FALTA DE FINANCIAMIENTO\r\nFALTA DE EQUIPOS NUEVOS', 'ROTURAS DE EQUIPOS\r\nAPERTURA DE OTRA CANTERA', '2022-06-22 12:47:52', '2022-06-29 17:31:06'),
(233, 1129, 1135, 20, 1, 'SOLICITUD DE FINANCIAMIENTO PARA LA COMPRA DE MAQUINAS NECESARIAS PARA LA PRODUCCIÓN DE ALIMENTOS LIBRE DE GLUTEN Y CAPITAL DE TRABAJOY', 'Se trata de la adquisición de una maquina necesaria para el proceso de elaboración de Galletitas Libre de Gluten y ademas un compresor asociado a todo el proceso que se lleva adelante en la Planta de Elaboración de Productos Libre de Gluten incluido el Fraccionamiento de Miel. Ademas la necesidad de fondos para Capital de Trabajo ya que incluimos una innovación en el trabajo de envasado que incluye gastos en nuevos insumos necesarios para el arranque de el nuevo proceso.', '3.00', 1, 1, NULL, 'Lograr que los productos libre de gluten sean saludables, sin agregado de conservantes, colorantes o saborizantes y cuyos ingredientes tengan el agregado de valor de insumos de nuestras economías regionales. Que el producto galletitas libre de gluten se pueda elaborar en mayores cantidades y con la innovación en el envasado de las mismas extender la vigencia de las mismas que nos permita obtener un producto que pueda ser competitivo en el mercado interno como en el mercado internacional.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-06-22 19:34:00', '2022-06-22 20:17:13'),
(235, 1831, 1902, 20, 1, 'LAVADORA AUTOMáTICA DE BARRILES Y ESTACIóN CIP', 'Armado de una lavadora automática para mejorar el proceso y tiempo en el lavado de barriles, lineas de productos, enfriador de placas, choperas, fermentadores y maduradores', '370000.00', 1, 0, 'Adquisición de componentes para el armado de una lavadora automática', 'Mejora en el proceso de limpieza de barriles\r\nReducir tiempos de limpieza\r\nAutomatizar el proceso\r\nLograr la autonomía para realizar otras tareas durante la limpieza de barriles', 'Actualmente, el proceso de limpieza de barriles para el envasado de 1 producción se realiza de manera rudimentaria y manual. El proceso tiene una demora de 1 día hasta 1 día y medio de trabajo. Con esta lavadora automática esperamos alcanzar el mismo trabajo en 3 horas con una eficiencia mucho más eficiente.', 'Aparte de reducir tiempos y de no necesitar una persona atenta constantemente al lavado', NULL, NULL, NULL, 'Hace 5 años que funciona la', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-06-23 04:27:49', '2022-06-29 23:38:25'),
