INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(249, 1857, 1916, 19, 1, 'PRODUCCIóN DE CAPONES DE ALTA CALIDAD, CON DESTINO A CONSUMO HUMANO', 'El proyecto esta destinado a la construcción de galpones para la producción intensiva de cerdos, capones de genética y alta calidad, para consumo de la población, en un sistema intensivo de producción. EL emprendimiento es de origen familiar, financiado con capital propio;  se cuenta con instalaciones con un alto nivel de tecnificación para poder alojar a las cerdas de alto valor genético y de grandes prestaciones productivas.', '3000000.00', 1, 1, 'Construcción de galpones para la producción intensiva de cerdos, capones de genética y alta calidad, para consumo de la población.', 'Ampliar la producción, mantener y mejorar el nivel sanitario de la granja. Generar puestos de trabajo, desarrollar la región y zona de influencia. Aportar a la economía regional. Aumentar la Productividad y mejoramiento genético.', 'Crear y desarrollar puestos de trabajo, lo cual permitiría introducir mano de obra especializada como veterinarios, técnicos en producción porcina, nutricionistas, ingenieros agrónomos, técnicos en mantenimiento, entre otros. Como oportunidades comerciales se puede mencionar que solo existe 1 competidor importante en la zona lo cual nos permite tener un escenario positivo con respecto al mercado.', 'Actualmente la granja se encuentra en marcha con una producción anual de aprox. 36 lechones destetados por madre al año, lo que significa producir 3744 kg de capones al año por cada madre. Hoy en día se cuenta con un plantel de 60 madres en producción.', 'En el año 2020 se decidió comenzar un proyecto con cerdos de genética y bienestar animal; por lo tanto se tomo la decisión de confinar todas las etapas del proceso productivo en diferentes galpones para llevar un control y aumentar la productividad.\r\nSe inicio primeramente con la venta de lechones, la cual permitió invertir las ganancias obtenidas con dichas ventas en la construcción de túneles de viento para comenzar con el engorde y venta de Capones de genética y alta calidad.', 'Hoy el emprendimiento se encuentra como una sociedad de acciones simplificadas, conformada por 3 socios, siendo el 25% del capital societario propiedad de una mujer, quien ejerce el cargo de Directora junto a los otros dos socios teniendo a cargo el sector administrativo completo de la sociedad. Actualmente contamos con un plantel de 60 madres, las cuales son capaces de producir aprox. 36 lechones por año con un total de 2160 capones anuales.', 'El lote esta situado en el distrito Antonio tomas, departamento Paraná, el mismo cuenta con 28 hectáreas, de las cuales 13 son de monte natural  y 15 de chacras, de las cuales 5 H están destinadas a la producción porcina donde se encuentran las instalaciones.', '-', 'La técnica utilizada para la producción esta basada en un flujograma, el cual comprende 5 fases. La 1era es el servicio de inseminación artificial, 2da es la gestación de las madres, 3era es la maternidad donde dan a luz los lechones, 4ta referido al destete y 5ta es la fase de engorde de capones.', 'Contamos con genética de excelente eficiencia y sustentabilidad, ya que los mismos son capaces de producir cerdos con altos pesos de faena, buena conformación, acelerada velocidad de crecimiento, conversión alimenticia y una excepcional calidad de carcaza con un alto porcentaje de carne magra.', 'El proceso es un ciclo completo descripto anteriormente, el mismo esta realizado de manera directa por los socios de la empresa sin terciarización de ninguna de las tareas. Se cuenta con asesoramiento profesional referido a la administración, sanidad y nutrición de todos los animales.', 'Agua potable con un consumo mensual de 350000lt, Electricidad se cuenta con una potencia instalada de 32 Kva destinado para la producción con un consumo mensual de 1751 Kwh. El alimento esta compuesto por maíz, expeler de soja, afrechillo de trigo y mezclas vitamínicas.', 'Los desecho que se generan son líquidos llamado purín que contiene materia fecal, orina y restos de alimento que no fueron consumidos, este desecho son almacenados en lagunas de tratamiento impermeabilizada para luego ser esparcidas en las chacras como un abono orgánico.', 'Nos dirigimos a la venta de capones de alta calidad genética, este mercado es de gran tamaño y con un constante crecimiento, por lo que es necesario tener una alta productividad para ser competitivo en el segmento al cual se apunta. Dicho mercado es estable y permite un desarrollo productivo muy interesante y positivo.', 'Actualmente nuestros clientes son Frigoríficos de la región; en un futuro se proyecta abarcar además la faena y abastecimiento de cortes porcinos a un mercado que se encuentra en auge. Los potenciales mercados en dicho escenario son carnicerías, supermercados, comedores, entre otros.', 'Actualmente las fuerzas de las competencias no se consideran significativas, dado que la producción conjunta de todos los competidores no es suficiente para abastecer la demanda total de mercado. En la zona en general solo operan algunos productores de escaso tamaño productivo y sin calidad de producto.', 'Productores agrícolas de la zona que proveen cereales, Veterinarias donde se provee de insumos para la sanidad animal, Granjas multiplicadoras, Corralones de materiales, ferreterías, herrerías para el mantenimiento y construcción en general de la granja.', 'Los riesgos se encuadran en torno a la economía del país, debido a que a partir de ella se establecen los precios del mercado y los mismos son manipulados por las grandes cadenas frigoríficas y frigoríficos en general. La estrategia es la negociación de precios y la prioridad en la calidad del producto.', 'El monto solicitado esta destinado para la construcción de galpones para engorde de capones.', 'Miraglio Agustina, se encarga de la parte Administrativa; Miraglio Dante, se encarga de la producción, mantenimiento y compras; Miraglio Gerardo, se encarga de la comercialización. Además se cuenta con asesores externos como veterinarios, ingeniero ambiental, nutricionistas, técnicos zootecnistas, Contador, entre otros.', 'El proyecto tiene y refleja un impacto significativo ya sea social y económico en la región, debido a que el crecimiento y ampliación de la misma trae aparejado la generación de fuentes genuinas de trabajo, las cuales repercutirán de manera positiva en la economía de la zona, como así también ayudaría a disminuir el precio de la competencia y que sea accesible a toda la población.', 'El precio es variable, ya que existe un mercado que lo regula. Actualmente el precio es de $205 el Kg. vivo de capón.', 'Instalaciones propias; nivel sanitario superior a granjas de la zona, genética de calidad, localización estratégica con cercanía a los centros de consumo, ya sean centros urbanos y frigoríficos; clima optimo para la producción, agua potable de calidad y abundante; cercanía de proveedores de materias primas.', 'Baja o escasa competencia en la región, posibilidad de crecimiento y mejoramiento genético, oportunidad de ingresar a un mercado de consumo masivo. Aumento de consumo per cápita de carne de cerdo. Canes magras de alta calidad debido a una alimentación y cuidado adecuado. Recuperación de economías regionales y zonales.', 'Nivel bajo de capones producidos al año en comparación con la competencia directa, ya que se necesita mejorar las instalaciones para alojar más y con mayor calidad los animales. Dependencia hacia productores agrícolas de la zona que proveen de materia prima. Producción en un 40% de la capacidad total por falta de infraestructura para los engordes de los capones.', 'Aumento en los costos fijos y variables de producción, pérdida de valor de la carne porcina en relación a otras carnes sustitutas; situación económica del país.', '2022-06-24 14:48:06', '2022-08-09 13:57:29'),
(250, 944, 918, 19, 1, 'COMPRA DE MATERIA PRIMA PARA PODER ABASTECER A CARREFOUR Y COOPERATIVA OBRERA', 'Este proyecto llega de la mano de la demanda de dos de las cadenas de supermercado más grandes del país. Hemos logrado ingresar en 141 sucursales de Carrefour y 103 de la Cooperativa Obrera, lo cual nos significa un aumento en la facturación de más de un 50%. Para poder responder ante los mismos en tiempo y forma, hemos postulado la compra de 125.000 frascos de vidrio, principal faltante a nivel país en insumos para alimentos, lo cual nos permite trabajar 2 meses de manera asegurada.', '3000000.00', 0, 0, 'Se busca financiamiento para la adquisición de frascos de vidrio (amanecer 360) para poder abastecer a dos grandes cadenas a nivel nacional. Estos son fabricados por una sola empresa en el país y la misma exige el pago de manera anticipada. Las demás materias primas se adquieren con plazo de pago, además la empresa cuenta con la maquinaria y el equipo idóneo para llevarlo adelante.', '- Contar con stock de materia prima para hacer frente al aumento exponencial de la demanda.\r\n- Lograr abastecer y hacerse fuerte dentro de las dos cadenas de supermercado.', 'Este proyecto significa un aumento de más del 50% en la facturación y producción, además de permitirle a la empresa una visibilidad mayor a nivel país.', 'Hoy en día la empresa vende 50.000 unidades mensuales entre todos sus productos, con este proyecto la venta se dispararía a más de 80.000 unidades. La empresa cuenta con las máquinas y el personal para responder al aumento, pero no con la materia prima necesaria.', 'La empresa nace en 2020 en la ciudad de Colón, en una planta de 200m2 con el fin de abastecer un mercado provincial insatisfecho de productos saludables y libres de gluten. Con el paso de meses el crecimiento y el reconocimiento se vio impulsado por un nuevo consumo inclinado a la alimentación saludable debido a la pandemia. En 2021 la empresa se muda una nueva planta, habilitada para producción sin tacc, de 800m2 para poder crecer y comercializar a todo el territorio nacional.', 'La empresa se encuentra ubicada en Ferrari 715 de la ciudad de Colón, en una planta con habilitación para la producción y comercialización de alimentos libres de gluten a nivel nacional e internacional. Entre estos se encuentran las pastas de maní, aceite de coco, miel, entre otros. Cuenta con la capacidad de elaborar 4500 unidades por turno de trabajo y con un proyecto en marcha para duplicar la capacidad. Además, la empresa comercializa a través de distribuidores en las 24 provincias del país.', '.', 'Alquiler - 5 años - Terreno de 800 metros cuadrados, con oficinas, planta, deposito, playa de carga y descarga.', 'Alimentos libres de gluten, sin conservantes, sin aditivos, sin azucares añadidos, sin colorantes.', 'Elaborados con maquinaria de origen nacional', 'Molienda en molino coloidal; mezclado en tanques industriales; llenado, tapado y etiquetado en línea automática.', 'Maní con certificación libre de gluten, frascos, tapas, precintos de seguridad, etiquetas opp, miel, cajas de cartón corrugado, aceite de coco, cacao en polvo, stevia pura, coco rallado, esencia de coco, mix de semillas, pimentón, humo líquido.', 'No se generan desechos o residuos ya que se trabaja en una industria seca. Los desechos por limpieza son tratados con una cámara desengrasadora. \r\nLos envases, plásticos o cartones son entregados como donación a recolectores de las recicladoras de la ciudad', 'Hoy en día el mercado meta al que apunta la empresa es aquel compuesto por personas mayores a los 2 años que habitan en el territorio nacional y tienen un nivel socioeconómico medio. Si bien se cuenta con una segmentación aun mayor no se puede exhibir la misma en pocos caracteres, existe una clasificación por tipo de productos, cantidades de consumo nacional anual y mensual a disposición.', 'Hoy en día la empresa cuenta con cuatro tipos de clientes: distribuidoras y mayoristas masivos; distribuidoras y mayoristas saludables; cadenas de dietéticas y supermercados; y entidades sin fines de lucro y gubernamentales. A través de esta clasificación la empresa llega a los diferentes rincones del país y el mercado.', 'El nivel de la competencia es medio alto, si bien no existen muchas empresas que comercialicen los mismos productos si se cuenta con algunas establecidas en el mercado que compiten a nivel nacional. Estás se encuentran su mayoría en la provincia de Buenos Aires', 'Los proveedores tienen diversas procedencias, encontrándose los principales en Buenos Aires, Córdoba, Paraná y Rosario. El pequeño grupo de empresas con las que se estrechan los lazos ofrecen a la empresa descuentos por cantidad, bonificaciones por pago de contado y algunas con valores a 30 o 45 días, muy valiosos todos para las finanzas de la organización.', 'Uno de los riesgos a los que enfrenta la empresa es el faltante de vidrio para la producción de los envases (frascos), debido a esto es que se busca stockear este material para no tener que mudar a otro tipo de envase menos reciclable y amable con el medioambiente', '100% a la compra de frascos de vidrio amanecer 360', '4 empleados en relación de dependencia. Este proyecto llevará a la contratación de 2 personas, las cuales ingresaran para encargarse de la limpieza de las máquinas, ya que el personal actual se avocara 100% a la producción.', 'Este proyecto generará 2 empleos genuinos, estos serán ocupados por chicos que tengan su primera experiencia laboral.', 'Pastas de maní $170; Dulce de leche sin azucar $330; Miel cremosa $290; Miel Liquida $280; Bebida vegetal a base de maní $90; Ghee $350; Dulce de leche $240; Aceite de coco $340; Alfajor $70. Todos estos precios son +IVA.', '•	Excelente relación calidad-precio. \r\n•	Productos sin conservantes. \r\n•	Productos adaptados a los deseos del consumidor. \r\n•	Productos innovadores en el territorio nacional.\r\n•	Recursos humanos competentes, capacitados y motivados.\r\n•	Maquinaria de última generación.\r\n•	Procesos de producción sencillos.\r\n•	Ubicación estratégica de la planta, con un fácil acceso y salida de la ciudad.\r\n•	Lazos comerciales fuertes con productores de la zona.\r\n•	Fuerte presencia de la marca en el mercado.', '•	Maní argentino reconocido mundialmente por su excelente calidad.\r\n•	Cadenas de supermercado adaptadas al consumo saludable\r\n•	Escasa competencia en el mercado de destino. El mayor porcentaje de la producción nacional se exporta, por lo tanto, genera un mercado interno explotable.\r\n•	Industria de la alimentación saludable en continuo crecimiento.\r\n•	Tendencia global hacia el consumo responsable y saludable de alimentos. \r\n•	La devaluación del peso genera un mayor turismo internacional', '•	Recursos financieros limitados para hacer crecer el proyecto.\r\n•	Empresa nueva, que incursiona en un mercado a explotar.\r\n•	Productos poseen una vida útil corta, al no tener conservantes. \r\n•	Ubicación de la planta fuera de los centros urbanos de mayor consumo.', '•	Dependencia de proveedores para los principales insumos, quienes generan la calidad final del producto. \r\n•	Inestabilidad cambiaria en el país, lo cual repercute en el precio de la materia prima, transporte y servicios.\r\n•	Producción de la materia prima dependiente de cambios climáticos. \r\n•	Existencia de productores del mismo producto en el país. \r\n•	Incertidumbre macro económica y cargas impositivas que alteran el costo del producto.', '2022-06-24 15:43:58', '2022-07-04 15:44:21'),
(251, 1841, 1332, 19, 1, 'INVERSION PARA ADQUISICION DE INSUMOS Y MATERIALES PARA CONSTRUCCION', 'LA FINALIDAD DE LA PRESENTE SOLICITUD ES PARA LA ADQUISICION DE INSUMOS Y MATERIALES QUE SERAN DESTINADOS A LA CONSTRUCCION DE LA NUEVA UNIDAD DE NEGOCIO QUE  DESARROLLARA LA EMPRESA CON MIRAS A PODER EXPORTAR PRODUCTOS EN EL MEDIANO Y LARGO PLAZO', '3000000.00', 1, 0, 'LA FINALIDAD ES LA CONSTRUCCION DE UNA NUEVA UNIDAD DE NEGOCIO. LA EMPRESA CUENTA CON EL INMUEBLE PARA PODER DESARROLAR EL PROYECTO PERO NECESITA LA OBTENCION DE FONDOS PARA ADQUISICION DE INSUMOS Y MATERIALES QUE SERAN VOLCADOS AL INMUEBLE CON MIRAS A PODER DESARROLAR PRODUCTOS CON LA FINALIDAD DE PODER EXPORTAR EN EL MEDIANO Y LARGO PLAZO.  LA EMPRESA ESTA EN UNA POSICION INMEJORABLE ACTUALMENTE DONDE CUENTA CON LOS CLIENTES POTENCIALES PARA EL DESARROLLO DEL PROYECTO.', 'ES FABRICAR NUEVOS PRODUCTOS APLICANDO LA TECNOLOGIA DE PUNTA Y GRAN EXPERIENCIA QUE POSEE LA EMPRESA CON MIRAS A LOGRAR LA EXPORTACION DE LOS MISMOS EN EL MEDIANO Y LARGO PLAZO', 'LA OPORTUNIDAD ES AHORA YA QUE LA EMPRESA ESTA EN CONDICIONES DE PODER DESARROLAR/FABRICAR NUEVOS PRODUCTOS DESTINADOS A LA EXPORTACION PERO DEBIDO A NO CONTAR CON FIANANCIACION DE TERCEROS EN LA ACTUALIDAD, SE ESTA RETRASANDO LA EJECUCION DE LAS TAREAS DE CONSTRUCCION HASTA PODER DISPONER DE FONDOS PARA ARRANCAR CON LAS OBRAS', 'SE CUENTA CON EL INMUEBLE PROPIO, LOS PROVEEDORES DE INSUMOS Y SERVICIOS, EXPERIENCIA DEL CUERPO DE PROFESIONALES CON EL QUE CUENTA LA EMPRESA Y CONTACTOS CON LOS POTENCIALES CLIENTES TANTO LOCALES COMO DEL EXTERIOR REFERIDO A LA FABRICACION DE LOS PRODUCTOS DESTINADOS A LA EXPORTACION QUE TAMBIEN SE PUEDEN VOLCAR AL MERCADO INTERNO', 'ES UNA EMPRESA FAMILIAR QUE VIENE TRABAJANDO DESDE HACE MÁS DE 16 AÑOS CON LA FIRMA FAMET SRL PERO DESDE HACE MUCHOS AÑOS EN SUS INICIOS CON LA EMPRESA UNIPERSONAL DE SERGIO DE LUCA QUIEN ES EL SOCIO GERENTE DE LA ACTUAL EMPRESA. VIENE TRABAJANDO DESDE SUS ORIGENES CON GRANDES EMPRESAS DEL SECTOR ALIMENTICIO RADICADAS EN EL DEPARTAMENTO GUALEGUAYCHU Y CONCEPCION DEL URUGUAY. A CONTADO DE PERSONAL MUY CAPACITADO QUE SE HA IDO FORMADO EN LA EMPRESA Y MUCHOS CONTINUAN HASTA LA ACTUALIDAD.', 'ES UNA PYME FUERTE EN LA REGION CON DESARROLLO DE SUS ACTIVIDADES ECONOMICAS EN LAS PRINCIPALES EMPRESAS DEL PARQUE INDUSTRIAL DE GUALEGUAYCHU Y TAMBIEN EN EMPRESAS DE IMPORTANCIA DEL DEPARTAMENTE CONCEPCION DEL URUGUAY. ACTUALMENTE, DEBIDO A LA ALTA DEMANDA DE PRODUCTOS Y SERVICIOS QUE DESARROLLA LA EMPRESA SE ESTA CONTRATANDO CADA VEZ MAS PERSONAL Y PRACTICAMENTE SIN OCIOSIDAD DE CARGA HORARIA PARA EL PERSONAL DEPENDIENTE E INDEPENDIENTE', 'LA EMPRESA ESTA RADICA EN EL PARQUE INDUSTRIAL DE LARROQUE Y EL NUEVO PROYECTO SE DESARROLLARÁ EN UN INMUEBLE LINDERO TAMBIEN EN EL AREA INDUSTRIAL Y CON LA VENTAJA DE TRABAJAR EN CERCANIA LAS DIFERENTES UNIDADES DE NEGOCIO', 'NO CORRESPONDE', 'CUENTA DE UNA SERIE DE PROCESOS QUE SE INICIAN CON LA PLANIFICACION, APROBACION DE PROYECTOS, ADQUSICION DE INSUMOS Y MATERIALES, FABRICACION Y CONTROL DE CALIDAD DE LOS PRODUCTOS OBTENIDOS', 'LA FINALIDAD ES INCORPORAR TECNOLOGIA DE PUNTA PARA EL DESARROLLO/CONTROL DE CALIDAD/GESTIONES Y TERMINACION DE LOS PRODUCTOS ACTUALES Y POTENCIALES A DESARROLAR POR LA EMPRESA CON PROPOSITO DE LOGRAR LA MAYOR EFICACIA POSIBLE EN LOS BIENES Y SERVICIOS FINALES', 'PRESUPUESTACION,PLANIFICACION, APROBACION DE ORGANISMOS DE CONTROL, EJECUCION DE TAREAS DE FABRICACION Y PUESTA EN MARCHA/COLOCACION DE PRODUCTOS.', 'INSUMOS PROPIOS DE LAS TAREAS DE FABRICACION DE PRODUCTOS METALICOS: CHAPAS, HIERROS, TORNILLOS, Y DEMAS INDUMOS ESPECIFICIOS DE CADA PRODUCTO A FABRICAR SEGUN LAS EXIGENCIAS DEL CLIENTE.', 'NO SE GENERAN DESECHOS YA QUE SE TRATA DE REUTILIZAR LOS RETAZOS DE CADA OBRA', 'EL MERCADO ES MUY BUENO, NO HAY ACTUALMENTE COMPETENCIA PARA LA EMPRESA YA QUE LOS PRODUCTOS Y SERVICIOS CONEXOS QUE SE DESARROLLAN NO LO ESTAN HACIENDO EL RESTO DE LAS EMPRESAS DEL SECTOR Y POR CONSIGUIENTE SE ESTÁ EN CONTINUO CRECIMIENTO.', 'SON GRANDES EMPRESAS DE LA ALIMENTACION Y CONSUMO MASIVO, ENTRE OTRAS, QUE POSEEN PLANTAS EN LA PROVINCIA DE ENTRE RIOS', 'NO HAY COMPETENCIA ACTUAL PARA LOS PRODUCTOS Y SERVICIOS PRESTADOS POR LA EMPRESA', 'LOS PRINCIPALES SON PROVEEDORES NACIONALES, PRINCIPALMENTE EMPRESAS FUERTEMENTE ARRAIGADAS EN EL PAIS Y QUE ABASTECEN A LA MAYORIA DE LAS GRANDES EMPRESAS DE LA REGION. EL RESTO SON PROVEEDORES LOCALES DE LA ZONA DEL DEPARTAMENTE GUALEGUAYCHU.', 'DEBIDO A LA SITUACION ECONOMICA ACTUAL Y LA INCERTIDUMBRE RESPECTO DE LA INFLACION, LA EMPRESA ASUME RIESGOS PROPIOS DE LA ACTIVIDAD EN CUANTO A COMPETENCIA DE PRECIOS Y PRESUPUESTACION. LOS CLIENTES HAN DEPOSITADO CONDIANZA Y LO SEGUIRAN HACIENDO YA QUE ELLOS MISMOS LO HAN COMUNICADO A LA EMPRESA Y DE CORRESPONDER LOS RIESGOS PODRAN NO IMPACTARAN DE CONSIDERACION PARA LA EMPRESA Y LAS ESTRATEGIAS ADOPTADAS ES LO QUE HA CARACTERIZADO A LA EMPRESA EN EPOCAS ANTERIORES DE CRISIS', 'EL DESTINO ES PARA LA ADQUISICION DE INSUMOS Y MATERIALES PROPIOS PARA LA CONSTRUCCION DE UNA NUEVA UNIDAD DE NEGOCIO CUYO DESTINO FINAL ES LA FABRICACION DE PRODUCTOS DESTINADOS A LA EXPORTACION', 'ACTUALMENTE SE CUENTA CON MAS DE 50 EMPLEADOS EN RELACION DE DEPENDENCIA QUE VARIAN SEGUN LA CANTIDAD DE ACTIVIDADES Y OBRAS QUE SE EJECUTEN Y/O DESARROLLEN. CON LA NUEVA UNIDAD DE NEGOCIO SE INCORPORARAN NUEVOS EMPLEADOS A DEFINIR SEGUN EL VOLUMEN DE ACTIVIDADES.', 'ES UN IMPACTO MUY SATISFACTORIO PARA LA LOCALIDAD DE LARROQUE YA QUE ES UNA CIUDAD DE MENOS DE 10000 HABITANTES Y ESTA NUEVA UNIDAD DE NEGOCIO GENERARA MUCHO MOVIMIENTO EN MATERIA DE PROVEEDORES DE LA CIUDAD YA SEA REFERIDO A INSUMOS COMO ASI TAMBIEN DE SERVICIOS TERCERIZADOS QUE APORTARAN SEGUN CORRESPONDAN AL DESARROLLO DEL PROYECTO. ADEMAS SE REQUERIRA LA CONTRATACION DE NUEVOS EMPLEADOS EN RELACION DE DEPENDENCIA QUE SEGUN SEA LA ACTIVIDAD SE NECESITARAN CON MAYOR O MENOR FRECUENCIA.', 'DEPENDERA EL TIPO DE BIEN A FABRICAR/CONSTRURIR  EN BASES A PRESUPUESTACIONES QUE VARIARAN SEGUN LOS PRECIOS DE INSUMOS, MATERIALES Y MANO DE OBRA AL MOMENTO DE CORRESPONDER Y CONSIDERANDO LA SITUACION INFLACIONARIA.', 'AÑOS DE EXPERIENCIA EN EL RUBRO QUE GENERRAN TRANQUILIDAD Y SEGURIDAD EN LOS CLIENTES.', 'EL MERCADO ESTA EN CRECIMIENTO Y SE REQUIERE CADA VEZ MAS DE PRODUCTOS Y SERVICIOS CONEXOS COMO LOS QUE DESARROLLA LA EMPRESA', 'NO HAY', 'NO HAY, SOLO DEPENDERA DE LA SITUACION ECONOMICA DEL PAIS EN CUANTO A PROBLEMAS DE INFLACION Y CUESTIONES REFERIDAS A IMPORTACION Y EXPORTACION DE BIENES Y SERVICIOS', '2022-06-24 17:17:45', '2022-07-14 14:13:31'),
(253, 1846, 1499, 19, 1, 'NUEVO AUTO ELEVADOR PARA PLANTA PRODUCTIVA', 'Nuestra compañía está abocada a la fabricación integral del acumulador lo cual nos permite ofrecer al mercado un producto verificado en todas sus etapas de fabricación. La tecnología que se utiliza en la fabricación, permite entregar un producto de alta performance con un costo muy competitivo. Con los años y mucho esfuerzo, el crecimiento ha transformado a FADEMI S.A. en una empresa líder en la industria de baterías.', '3000000.00', 1, 1, 'Adquisición de nuevo auto elevador para carga y descarga de materia prima y mercadería final.', 'Debido a un aumento en la producción en nuestra planta, actualmente tenemos un cuello de botella en la logistica interna con la carga , descarga y traslado de mercaderia. Es por eso que necesitamos adquirir un nuevo auto elevador que nos permita afrontar este crecimiento.', 'Mayor  producción , al lograr descargar los insumos de manera mas ágil, y también al lograr cargar las entregas finales de manera mas eficiente.', 'En la actualidad, debemos esperar a que se libere un auto elevador cada vez que se necesita realizar una carga y descarga. Lo que atrasa toda la cadena productiva.', 'Nacida hace más de 50 años, como una empresa familiar en la ciudad de Larroque (Entre Ríos Argentina). Con los años y mucho esfuerzo, el crecimiento ha transformado a FADEMI S.A. en una empresa líder en la industria de baterías.', 'Actualmente FADEMI s.a se encuentra entre las empresas mas importantes en la fabricación de baterías para vehículos, junto con su marca Insignia CLOREX la cual se la ve presente en gran parte del parque automotor. Por otro lado la misma actualmente comercializa y reemplaza con mucho exito marcas que anteriormente provenían del exterior a costos mucho mas elevados.', 'Planta Fabril en la localidad de Larroque, Entre Rios.', 'inmueble propio de nuestra empresa', 'Acumuladores Eléctricos', 'Ultima generacion de Acumuladores Electricos, para los requerimientos actuales de los vehiculos.', 'PRODUCIMOS CALIDAD, DURABILIDAD Y RENDIMIENTO EN BATERÍAS PARA VEHÍCULOS\r\nDE TODO TIPO Y TAMAÑO. NOS ENFOCAMOS EN LA ALTA TECNOLOGÍA, INGENIERÍA\r\nE INNOVACIÓN. CUIDANDO SIEMPRE LOS ASPECTOS AMBIENTALES, SOCIALES Y DE\r\nSEGURIDAD LABORAL', 'Nuestros productos son fabricados con insumos analizados previamente , los cuales cuentan con el respaldo de certificaciones correspondientes.', 'Todos nuestros procesos de desechos y residuos están controlados y en constante revisión y auditados por los entes correspondientes.La mayoría de los residuos resultantes de los subprocesos se reprocesan en el mismo sector. Los residuos resultantes se envían a una planta de tratamiento y reciclado.', 'Nuestros productos se comercializan a lo largo y ancho del territorio nacional, contamos con presencia en mas de 15 provincias.', 'Nuestra cadena de comercialización esta compuesta por Grandes distribuidores, Supermercados, Clientes de bocas directa al publico, prestadores de servicios publicos, entre otros.', 'Estamos entre las empresas lideres del rubro, en constante mejoras y a la vanguardia de actualizaciones para no quedarnos fuera del mercado.', 'Nuestros proveedores pasan por un estricto proceso de análisis y selección , los mismos deben estar dados de alta por nuestra empresa cumpliendo con nuestras normas internas.', 'Nuestra empresa se encuentra en constante actualizacion , contamos con muchos proyectos en marcha y a futuro para estar acorde a las nuevas tecnologias que se vienen.', 'Auto elevador', '120 personas', 'Generamos empleo tanto propio como terciarizado , desarrollando un gran movimiento económico en nuestra localidad, la cual es pequeña y el impacto de nuestra empresa es muy grande en la misma', 'Amplia gama de precios, ya que nuestros productos van desde un automovil particular a estacionales que utilizar energía solar.\r\nValores de referencia aproximados desde los $15.000 a los $60.000 por unidad.', 'Producto con valor agregado\r\nReducción de tiempos por incorporación tecnológica\r\nTrazabilidad del producto\r\nResponsabilidad social con el medio ambiente\r\nCertificación de normas ambientales, de seguridad y de calidad (ISO, CHAS)\r\nCalidad del producto\r\nAutomatización de procesos', 'Posibilidad de abastecer a grandes cadenas de hipermercados\r\nAumento de controles a las empresas sobre el cuidado del medio ambiente\r\nPosibilidad de innovación de líneas del producto', 'Falta de desarrollo de la parte comercial\r\nProblemas socio-culturales vinculados a los componentes del producto. \r\nEstructura centralizada\r\nDificultad para desarrollar ciertos proyectos', 'Apertura de mercados internacionales \r\nPrecios internacionales poco rentables\r\nProblemas sindicales a nivel nacional que afectan directamente a la empresa\r\nInestabilidad económica', '2022-06-27 14:24:20', '2022-07-04 13:43:00'),
(260, 1851, 1927, 19, 1, 'NUEVO PROYECTO COOP VIDA LIMPIA LIMITADA.', 'Somos un equipo de trabajo que necesita apoyo económico para poder expandir y ganar mercado.', '1000000.00', 1, 1, 'La compra de diversas maquinarias que nos brindarian mayor oportunidad y expansión laboral e indumentaria necesaria para el equipo de trabajo.', 'Ampliar las posibilidades de generar mas trabajo, y marcar una impronta positiva relacionada a nuestra cooperativa desde la presentación hasta las maquinarias para poder brindar asi un mejor servicio, y ganar reputación.', 'Significa una oportunidad unica de abastecimiento de maquinaria para poder competir en el mercado con empresas privadas.', 'Actualmente el consejo administrativo se encuentra invirtiendo en indumentaria y demas necesidades para el equipo de trabajo, una situación que mas allá de las ganas resulta sumamente dificil en estas condiciones.', 'La cooperativa de trabajo vida Limpia Limitada nació en el año 2015 liderada desde el inicio y hasta hoy en dia por mujeres, llego al actual consejo de administración la oportunidad de unirse como socias para luego finalmente ser elegidas como consejeras ante la posibilidad de un cierre definitivo en 2019. Y es desde este papel que manifiesto mi responsabilidad de generar fuentes y oportunidades laborales, para lo cual es indispensable un apoyo económico.', 'Hemos logrado ubicarnos nuevamente en el mercado luego de la reactivación económica post pandemia, y se nos presentan oportunidades de nuevos contratos en los cuales no nos encontramos en situacion de competir ante las empresas privadas, por esta cuestion es sumamente necesario el poder abastecer al equipo de las maquinarias e indumentaria necesaria para poder seguir brindado fuentes de trabajo a nuestros socios.', 'Nuestra sede funciona actualmente en la vivienda de una de las consejeras. Sin un espacio definido para dicho fin.', 'Vivienda alquilada, hace 4 años.', 'Nuestro equipo presta en servicio de mantenimiento de espacios abiertos y cerrados, desde la limpieza de oficinas hasta refacciones edilicias.', 'Para llevar adelante dicho servicio necesitamos la maquinaria necesaria.', 'Mediante licitación o contratacion directa.', 'Nuestra principal área son nuestros socios, gente que quiere trabajar.', 'Al no ser un proceso de producción no contamos con dicha situación.', 'Entes del estado y entes privados.', 'Mayormente tenemos contratos vigentes con oficinas del estado. Y hay un gran mercado disponible.', 'Empresas privadas con maquinaria actualizada. Y presupuestos elevados.', 'Minorista y emprendedores.', 'Fortalecer el equipo de trabajo.', 'Compra de indumentaria y maquinaria necesaria para tener mas competencia ante las empresas privadas, y poder así ganar contrataciones.', 'Somos actualmente 20 socios.', 'Somos un lugar de reinserción laboral para todo un estrato de la sociedad. Brindado la oportunidad laboral a un sector muy vulnerado.', 'Nuestro servicio es estrictamente mas económico de aquello que ofrecen nuestras competencias privadas.  Nuestros ultimas oportunidades laborales varias Desde $85.000 hasta $440.000', 'Equipo con ganas de crecer, y generar oportunidades. Gran mercado para nuestro servicio', 'Variedad de oportunidades que procuramos aprovechar ante cualquier propuesta.', 'No poseer apoyo económico para invertir.', 'Competencia, equipada con maquinaria actualizada.', '2022-06-28 13:06:47', '2022-06-28 13:45:27'),
(265, 1853, 1932, 20, 1, 'NUEVO PROYECTO', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-06-30 12:49:01', '2022-06-30 12:49:01'),
(266, 1836, 1931, 19, 1, 'HUERTA LA ESMERADA', 'Adquisición de Tractor Kubota L3800\r\nCámara frigorífica, Degani refrigeraciones\r\nSe adjuntan presupuestos de	ambos bienes	de capital de trabajo.', '3.00', 0, 1, 'Con	la intención de facilitar la recolección de la cosecha con un	tractor al	cual	se le	puede agregar un ¨paraguas	recolector, se consideró	adecuado responder a la invitación de aplicar a los créditos	ofrecidos	por	el Ministerio de Producción Turismo y Desarrollo	para	adquisición de	capital de trabajo.\r\nTambién se desea adquirir un	cámara frigorífica para la conservación	de la nuez con	cáscara.', 'primer etapa de mecanización de la cosecha de nuez pecan de la Huerta orgánica La Esmerada', 'La ayuda económica de adquirir un equipo para optimizar la cosecha .\r\nCon respecto a la cámara es contar con un lugar para la conservación ,para mantener las cualidades de la nuez pecan teniendo en cuenta que por tratarse de una producción orgánica con trazabilidad no se puede estibar ni negociar con un acopiador general', 'En este año se proyecta aumentar el volumen de lo cosechado.\r\nSe generó un marca registrada Ramada para los subproductos de nuez como garrapiñadas ,aceite de nuez ,pasta de nuez ,alfajores de nuez', 'Con el objetivo de contribuir a la alimentación saludable y preservar la naturaleza inicié el proyecto	de la huerta La Esmerada en 2006.	\r\nSituada en la zona de la Picada, Entre Ríos. \r\nLugar libre de	agroquímicos dedicado a producir hortalizas, frutas, huevos y lácteos orgánicos para COCINA	SANA del	Centro de Vida Sana y Nutrición SRL, del cual soy socia gerente. \r\nLuego de 3 años de conversión de agricultura convencional a orgánica, se logró la primer certificación en 2009 otorgado por la OIA.', 'Entre 2008-2009-2010 se implantaron los primeros nogales	pecan.\r\nDadas las	características	orgánicas	de la producción recién se alcanzó una cosecha de media tonelada en 2021.\r\nEse año se adquirió	una peladora y separadora para el	procesamiento de la nuez que se realiza en COCINA SANA del Centro de Vida Sana y Nutrición SRL.', 'Lugar libre de agroquímicos dedicado a producir hortalizas, frutas, huevos	y lácteos orgánicos. Situada en la zona de la Picada, Entre Ríos.', 'CAMPO ORGÁNICO DE 20 HECTÁREAS (propio)', 'producimos, nueces hortalizas, frutas, huevos y lácteos orgánicos.', 'producción primaria', 'siembra , cosecha, lavado empacado y despacho a  Cocina Sana o venta directa ocacional a visitantes', 'NO GMO ,de propagación orgánica', 'Las cáscaras de nuez pecan se utilizan como compostaje  o cama de pollo, también para producir lumbricompuesto', 'El interés del consumidor por  una vida saludable y una mejor alimentación va en aumento', 'jóvenes que buscan una alimentación saludable', 'empresas más desarrolladas ,con mejor marketing y comercialización', 'Solo está autorizado comercializar con proveedores de nutrición vegetal certificada', 'mejorar la gestión productiva, comercial y de comunicación', 'compra de tractor \r\ninstalación de cámara de refrigeración', 'trabajo familiar y 7 empleados de la SRL', 'impacto de beneficio para la salud y ambiental', 'nueces mariposa envasadas premiun 2500 $ más iva por kilo', 'experiencia en producción orgánica certificada de mas de 10 años', 'producción con buena aceptación social', 'falta de desarrollo de canales de comercialización', 'dificultades económicas, estanflación', '2022-06-30 20:47:20', '2022-07-01 21:07:41'),
(270, 1858, 1937, 24, 1, 'MANTENIMIENTO Y MEJORAS DE LAS INTALACIONES RURALES', 'Realizar mantenimientos de corrales, mejoras de caminos del establecimiento de explotación.', '3000000.00', 0, 0, 'Realizar mantenimiento del camino interno, reparación de alambrados y tranqueras, corrales de encierro y realizar la sanidad de los caballos afectados a la producción bovina.', 'Mejorar la sanidad animal.\r\nAgregar mas tecnología en la manipulación de la hacienda bobina (corrales y mangas)', 'Realizar una mantención y reparación general de la inversión en infraestructura realizada hace 8 años, para asegurar el buen estado y prolongar la durabilidad de la misma.', 'Se ha comenzado con la reparación de alambrados y mejoras de caminos internos', 'Es una PyME familiar manejada por el padre de familia, donde trabaja toda la familia. La empresa comenzó con el familiar ascendente, donde la actividad principal era ganadería y cultivos de trigo y lino. Hoy en día, la parte agrícola predomina, y la actividad secundaria de gran importancia es la ganadería con la raza BRANGUS dando le importancia a la genética. También otra actividad que tiene es el transporte de cargas.', 'Actualmente la empresa se encuentra en un cambio generacional donde sus descendientes, dirigen las distintas áreas, el mayor es Licenciado en Comercio Internacional y esta a cargo de la parte administrativa y financiera de la empresa, el menor dirige la parte ganadera y el titular la parte agrícola. A la fecha contamos con 6 empleados 3 agrícola, 2 ganadera, 1 en transporte.\r\nIntentamos seguir creciendo con las mismas convicciones de nuestros antepasados, a pasos firmes.', 'Contamos con 140 has para desarrollar la actividad ganadera de primera parición controlada. El lugar esta compuesto por campo limpio de pasturas 2 arroyos que pasan en cada extremo del campo.', 'Establecimiento propio.', 'Realizamos cría de ganado bobino de raza Brangus con un destete de 200 kilos por ternero/a', 'Genética de 35% Brahmán y 65 Angus. El primer entore se realiza con toros Angus para evitar complicaciones en el parto.', 'El ciclo productivo es de aproximadamente 18 meses, son 3 meses de entore, 9 meses de gestación hasta el parto y 6 meses mas de amamantamiento del ternero, para pasar a ser novillito y obtener el producto final.', 'Forrajes con cultivos perennes y temporales.\r\nAlmacenamiento de forrajes como picado y silaje.', 'Proceso de producción extensiva, que genera residuos orgánicos lo cual sirve como abono de las misma parcelas, se siembra pasturas para los animales y se obtiene la materia seca', 'Mercado fluctuante, sumamente sensibles y especulativos por el contexto mundial. Precios de commodities dictado (fijado) por mercados o plazas externas y manipulado por políticas internas. Mercado concentrado', 'Trabajamos con distintos exportadores y cooperativas, no existe diferenciación ni posicionamiento, pero muy capacitados.', 'Mercado de competencia, limitación con tierras existentes, fuertes impactos por llegada en la zona de pooles de siembra por la dificultad y restricciones del movimiento financiero de políticas publicas se crean nuevos.', 'Proveedores cadena agroindustrial de altos avances tecnológicos, principales proveedores cooperativa de la zona y cooperativa a nivel nacional.', 'Fluctuación de precios, incertidumbre de políticas económicas. Estrategias de coberturas y diversificación de carteras. Maximización de eficiencia y eficacia de costos, reducción de gastos', 'Mantenimiento de las instalaciones y mejoras de los caminos internos', 'En el área de ganadería 5', 'Desarrollo y mantenimiento de inversiones anteriores, contratación de nuevo personal para manejo de rodeo de cría mas amplio y con mas carga animal. Capacitación del personal existente en la ganadería de precisión.', '$ 430 el kilo de invernada producidos', 'Trayectoria en la cría de bovinos\r\nExcelente genética adaptada a la zona\r\nCircuito armado para rodeo de ciclo completo\r\nRenspa habilitado para producción y faena de exportación UE\r\nPersonal a cargo experimentado con mas de 15 años a cargo del rodeo de cría\r\nBuen manejo y sanidad del ganado\r\nExcelentes asesores (Veterinario-Ingeniero Agrónomo)\r\nBuenas pasturas', 'Políticas aplicadas al aumento de cabezas de cría\r\nPrecios estables y en aumentos', 'Limitantes del campo\r\nFalta de inversión en infraestructura\r\nFalta de oferta forrajera\r\nCarencia en aguadas\r\nDifícil acceso al campo días de lluvias por barro', 'Cepo cárnico\r\nInestabilidad macro-económica\r\nPolíticas a bajar el precio de la carne y controlar stock\r\nProbable sequia proyectada hasta diciembre', '2022-07-04 15:16:36', '2022-07-27 01:13:55'),
(271, 1839, 1938, 19, 1, 'TIERRA ADENTRO ARTESANAL', 'Somos un emprendimiento que nace desde de la necesidad de generar productos funcionales de uso cotidiano (calzados y accesorios) a partir del empleo del cuero como una de las principales materias primas que nos caracterizan como región teniendo en cuenta las costumbres alimenticias y productivas de nuestro país, haciendo uso de las mismas para generar productos de primera calidad con diseños modernos, sencillos, atemporales, perdurables en el tiempo y sin género (M/F).', '3000000.00', 1, 1, 'Tierra Adentro Artesanal, nace con el objetivo de brindar productos funcionales de calidad con diseños atemporales, empleando una de las mejores materias primas del mundo en lo que respecta al cuero argentino en todas sus variantes', 'El objetivo es ampliar la producción, investigación, desarrollo e innovación para poder crecer en el mercado interno y en un futuro llegar al mercado externo, para esto sería fundamental la adquisición de materiales, herramientas y maquinaria especializada, así como también contar con un equipo humano para las diferentes áreas que hoy son administradas por un grupo reducido.', 'Nuestro proyecto significa la oportunidad de re valorar y reivindicar la industria del cuero argentino a partir de la confección de productos modernos, funcionales, atemporales y sin género. \r\nMuchos de nuestros productos son conocidos tradicionalmente, como billeteras, carteras y otros más contemporáneos como tabaqueras, rolls de accesorios, fundas para laptop, fundas para celulares que han ido surgiendo a partir de las nuevas necesidades y costumbres no sólo a nivel nacional.', 'Actualmente el desarrollo del proyecto se encuentra encaminado y funcionando desde el año 2014 sin interrupción. Hemos venido creciendo año a año y creemos que con ayuda de financiamiento podríamos mejorar notablemente el desempeño y poder así seguir dando lo mejor de nosotros, con el objetivo claro de ampliar la producción, la investigación, el desarrollo e innovación de nuestros productos.', 'Tierra Adentro Artesanal, es gestado en el año 2014 como un negocio online de fabricación y venta de artículos de primera calidad realizados su gran mayoría en cuero genuino y abarcando todo tipo de productos personalizados y realizados a medida del cliente sin importar edad, sexo o ubicación en el país ya que llegamos a través de Mercado Libre a todo el territorio nacional siendo esta nuestra base principal de ventas.', 'Actualmente el negocio se encuentra funcionando; con un crecimiento paulatino a través de los años en materia de producción y atención (pre-venta / pos-venta). El mismo tiene una estacionalidad positiva marcada en la temporada estival, en la cual no se llega a producir debidamente lo que implica la demanda a partir de la carencia de herramientas específicas y maquinarias que nos ayuden a mejorar en tiempos y eficiencia.', 'El emprendimiento se desempeña en un piso alquilado en el cual funciona la parte operativa: Ventas, producción de accesorios y empaquetado final.', 'El piso es un departamento, el cual fue adaptado a oficina y taller en el cual se desempeñan mayormente las actividades operacionales y de producción de accesorios, almacén de un pequeño stock y preparación de envíos', 'En relación a las características técnicas de los productos, podemos mencionar que algunos son elaborados, cortados y cocidos completamente a mano; en otros, en su proceso de fabricación, intervienen maquinarias rudimentarias. Respecto al servicio de venta, hasta el momento es 100% online.', 'Los productos en su mayoría son cortados a mano sobre un tablero, pegados y cosidos a mano o en una maquina recta industrial.', 'Etapa diseño: Búsqueda de necesidad e Idea del producto; Etapa testeo: Se realizan testeos de los nuevos productos; Diseño y producción de moldes;  Estandarización del producto; Fotografía, edición y producción de imágenes; Publicación ; Venta ;  ; Empaquetado, envío ; Facturación; Post-venta.', 'Desde un inicio pusimos foco en una de las materias primas mas nobles que nos otorga la naturaleza como es el cuero genuino.', 'La optimización de los recursos es uno de los principales intereses a la hora de producir. Los residuos son muy escasos ya que hasta la menor pieza de cuero es aprovechada.', 'Tenemos una amplia llegada no solo vinculada a menor escala (ventas minoristas) si no también una buena influencia en un público de mayor escala (ventas mayoristas). Logrando incursionar en una amplia gama de público a escala regional y nacional. Actuamos en un espacio de competencia brindado a través de la plataforma MercadoLibre desde el año 2014, a través de los años nos hemos ido perfilando y mejorando nuestro desempeño dentro de la misma lo cual nos ha brindado una mejoría en las ventas.', 'Los clientes de nuestra marca, son personas a las cuales les gusta lo artesanal principalmente, dándole valor e importancia a objetos que llevan cada uno su sello propio, sus marcas de materia prima natural; potenciando aquello que se distingue de la fabricación en serie. Nuestros clientes buscan un producto exclusivo, de calidad y con historia.', 'La competencia respecto a la producción, es pobre respecto a la manufactura nacional, diversos talleres tradicionales en el interior del país y algunos grandes en la provincia de Buenos Aires donde se producen artículos en cuero más ligados a lo tradicional y folclórico. La competencia de mercado la medimos directa y casi exclusivamente con la plataforma de MercadoLibre, la cual nos brinda mucha información respecto al perfilamiento de nuestros productos, clientes y la competencia.', 'Los proveedores son empresas y curtiembres con trayectoria, la mayoría ubicadas en la provincia de Buenos Aires.', '- Fomento de productos de uso circular y obsolescentes. Estrategias: Considerar y definir que nuestros productos tienen mucha durabilidad e incluso dependiendo de la función del mismo, se puede pasar de generación a generación; también desde el punto de vista ecológico, en el caso de ser derrochado, es material 100% degradable.', 'I+D+I : Investigación, Desarrollo e Innovación . Cursos y Capacitaciones. Tienda Online propia. Marketing y Publicidad; 1 Pc ; 1 Maquina de grabar laser. 50W a 100W; 1 Máquina de coser triple arrastre; Materia prima; Insumos y herramientas para talabartería; Troquelado de Moldes;', 'Actualmente somos tres personas en el equipo las cuales subsistimos con el emprendimiento, aparte de tener todos los integrantes otras fuentes de ingresos. \r\n\r\nLa adquisición de la ayuda económica sería fundamental para incrementar los volúmenes de producción siendo posiblemente necesaria la contratación de personal extra para mantener la capacidad operacional, gestión de ventas y confección de productos.', 'El proyecto ha ido creciendo paulatinamente desde el inicio ya que trabajamos día a día en mejorar nuestro desempeño; el mismo no podría ser sostenible sin un equipo humano que lo sustente. Creemos que en el futuro, esto no va a cambiar y esperamos poder seguir creciendo como equipo tanto como sea posible.  Por otro lado, también nos interesa estudiar el fomento de la actividad y la creación de empleo a través de un proyecto relacionado a nuestro origen e identidad que pueda ser franquiciado.', 'El ticket promedio de los productos vendidos en el último año a través de la plataforma es de $4381,90.', 'Calidad producto.\r\nProductos de origen nacional y artesanal.\r\nIntegrantes del equipo capacitado y calificado (en diseño y fabricación de productos, diseño gráfico, entre otros)\r\nDistribución hacia todo el país (mercado libre), también contamos con la distribución y logística de Correo Argentino para ventas particulares, donde tenemos una cuenta de negocio con beneficios particulares.', 'Actualmente nos encontramos bien posicionados en la plataforma con casi 200 productos en línea y medalla de Mercadolider; por lo que tenemos la posibilidad de ampliar el catalogo las veces que sea posible. Esto influiría directamente sobre el volumen de ventas.\r\nPosibilidad de tener nuestra propia tienda online, como así también presencia en otras plataformas y redes sociales; incluso algunas con proyección y venta al extranjero.', 'Falta de una tienda online propia fuera del sistema de Mercadolibre.\r\nCarencia de marketing en redes sociales.\r\nEstacionalidad de las ventas de los productos.\r\nDependencia de la estrategia de venta de acuerdo a la elección de plataformas online como medio de llegada al público. \r\nAusencia de Derechos personales y de propiedad intelectual.', 'Devaluación constante de la moneda con el consiguiente aumento de precios en los insumos, transporte y cadena logística. \r\n\r\nInestabilidad económica y financiera del país.\r\n\r\nLa crisis por la falta de combustible repercute directamente en los costos de envío de los productos en distintos punto del país', '2022-07-05 15:54:48', '2022-07-15 16:10:10');
INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(274, 217, 213, 19, 1, 'PROTOTIPO ENVASADORA', 'La empresa se propone desarrollar un protocolo para la creacion de una nueva envasadora de dulce de membrillo.\r\nEste proyecto surge de la deteccion de una necesidad en nuestros clientes. Nos enfocaremos en lograr una envasadora innovadora y que logre optimizar este proceso de envasado en las empresas que la utilicen.', '3000000.00', 0, 0, 'El proyecto que se llevara a cabo tiene como finalidad brindar una solución a los clientes mediante la creación de un prototipo para el desarrollo de una nueva envasadora.', 'El objetivo del proyecto es la creación de un prototipo de una nueva envasadora para dulce de membrillo, atendiendo a las necesidedes y solicitudes de nuestros actuales y potenciales clientes.', 'Observamos las necesidades de los clientes y nos enfocamos en ofrecerles soluciones efectivas. La creación de esta nueva envasadora nos permitirá brindarles la posibilidad de automatizar otro de sus procesos de envasado.', 'En este momento nos encontramos en la etapa de idea, desarrollo y diseño de la nueva envasadora de dulce de membrillo.', 'La empresa inicio hace 15 años de la mano del Ingeniero Luciano Martin Cettour, con sus ideas innovadoras y su capacidad para los negocios ha logrado ser una de las empresas mas reconocidas en el rubro. Con el transcurso de los años, esta empresa ha logrado sobrellevar todas las difeicultades del pais y seguir en constante crecimiento.', 'Key Automatizaciones es una empresa con 15 años de experiencia en el mercado. Nos dedicamos a la fabricacion de lineas de envasado automatico y ofrecimiento del servicio de optimizacion de recursos de otras empresas, conforme a las necesidades de cada una. Brindamos soluciones efectivas a los clientes, comprometiendonos a acompañarlos durante todo el proceso.', 'El lugar donde la empresa desarrolla sus actividades tanto de producción, administración y comercialización es propio. Se encuentra en la ciudad de Villa Elisa. El terreno tiene aproximadamente 2,2 hectareas, con 1100 metros cuadrados ya construidos.', 'No corresponde.', 'Envasadoras: todas nuestras envasadoras llenan, forman y cierran los paquetes automaticamente. De acuerdo al modelo de la misma, servira para el envasado de productos granulados, productos finos o productos solidos. Tambien fabricamos enfardadoras y palletizadoras.', 'Las envasadoras son de alto rendimiento y exactitud de pesaje. Realizan distintos tipos de costura. Conforme al modelo de la misma funcionan a travez de dosificadores volumetricos, de un tornilo sinfin o de un multicabezal con balanzas.', 'Fabricacion envasadoras: 1-Corte en pantógrafo las piezas de hierro. 2-Limpieza, agujereado y roscado de las piezas, corte de los caños estructurales que se utilizan para armar los chasis. 3- Soldaduras. 4-Arenado. 5-Pintura. 6-Secado. 7-Ensamblado. 8-Armado de partes electricas. 9- Puesta en marcha', 'Para la fabricación de nuestros productos se utiliza hierro, caños estructurales, pintura, motores, insumos de neumática, tornería, rodamientos, piezas de sellado frezadas, insumos eléctricos, fechadoras', 'Los residuos que se generan en nuestros procesos de producción son todos sólidos, los mismos luego se venden a chatarreros motivo por el cual quedamos sin desperdicio alguno.', 'Este produto se desarrollara tanto para el mercado interno como externo. \r\nAl ser un producto que se desarrollara a partir de una necesidad de los clientes, confiamos en que al igual que las demas envasadoras que fabricamos, esta sera muy bien recibida en el mercado.', '-	“DICOMERE”\r\n-	Razón social: AGRO ANCONA S.A.\r\n-	Productos adquiridos: Envasadora G16-V / Envasadora XG16-V / Envasadora G16-T / Envasadora G16-M / Envasadora AO16-T / Enfardadora MK80.\r\n-	“PRODUCTOS LA ABADIA”\r\n-	Razón social: CAREAGA HNOS & TEGLIA SRL.\r\n-	Productos adquiridos: Envasadora G16-V / Enfardadora MK80 \r\n-	\r\n-	“ARROZ TRIMACER”\r\n-	Razón social: LOS CERRILLOS S.A.\r\n-	Productos adquiridos: Envasadora G16-V / Enfardadora MK80 / Balanza valvular', '-	CARLINI Y CIA SRL\r\n-	Productos: envasadoras y enfardadoras automáticas.\r\n-	Ventajas competitivas: precio – adaptación a nuevos proyectos – productos personalizados – plazos de entrega – ubicación.\r\n-	INGESIR ENVASADORAS SRL\r\n-	Productos: envasadoras automáticas.\r\n-	Ventajas competitivas: fabricación de enfardadoras – calidad – ubicación.\r\n-	INDUMAK MAQUINAS LTDA\r\n-	Productos: envasadoras y enfardadoras automáticas.\r\n-	Ventajas competitivas: precio – ubicación – atención personalizada', 'STM ARGENTINA S.A.\r\n011 – 47570504\r\nErnesto Sábato 3341 – Santos Lugares – Bs. As. \r\nVentajas: primera calidad – precio – forma de pago.\r\nDesventajas: demoras de entrega – costo de flete\r\nVIDEOJET ARGENTINA SRL.\r\n011 – 51284574\r\nCalle 122 (ex Gral. Roca) 4785 – Villa Ballester – Bs. As.\r\nInsumos: fechadores digitales de distintos modelos y tamaños.\r\nVentajas: primera calidad – descuentos.\r\nDesventajas: demoras de entrega.', 'El riesgo que siempre esta presente en nuestro rubro es el ingreso de maquinaria de origen extranjero a un costo muy inferior a los costos de produccion que tenemos en nuestro pais. \r\nDesde nuestro lugar seguimos apostando a la industria nacional, a la creacion de puestos de trabajo, a la investigacion, desarrollo, a la capacitacion constante de nuestros colaboradores. Buscamos la mejora continua y la optimizacion de los procesos de produccion.', 'El importe solicitado será destinado a la compra de acero inoxidable para poder desarrollar el prototipo de la envasadora.', 'Actualmente la empresa cuenta con 10 trabajadores activos.', 'El desarrollo de este proyecto tendrá un impacto totalmente positivo tanto económico como socialmente. Desarrollar un producto que observamos que es una necesidad latente en nuestros clientes es un buen punto de partida y nos permite proyectar que va a ser muy bien recibido en el mercado. Por otro lado, destacar que la fabricación de un nuevo producto será generadora de nuevos puestos de trabajo.', 'Los precios de los productos son aproximados ya que muchas veces se hacen adaptaciones conforme a lo solicitado por cada cliente.\r\nEnvasadoras $ 3.357.262\r\nEnfardadora $ 2.960.892\r\nPalletizadora $8.174.25', '- Empresa joven.\r\n- Ideas innovadoras.\r\n- Abierta a escuchar las necesidades de nuestros actuales y potenciales clientes. \r\n- Nos adaptamos facilmente a los cambios.\r\n- Constante innovacion y desarrollo.', '- Este proyecto en particular nos dara la oportunidad de seguir afianzando nuestra empresa en el mercado. \r\n- Captar nuevos clientes', 'Consideramos que una de las debilidades de la empresa es la ubicacion de la fabrica. Ponemos nuestro empeño para que esto no sea una dificultad para nuestros clientes brindando lineas de comunicacion directas con todas las areas de la empresa y nos encargamos personalmente de la entrega y puesta en marcha de las maquinas.', '- Problemas de Importacion.\r\n- Ingreso de Maquinaria extranjera a costos muy inferiores.', '2022-07-08 15:30:43', '2022-11-14 13:59:45'),
(275, 1217, 38, 19, 1, 'ACOPLADO PORTA BINS', 'La empresa se propone desarrollar un nuevo producto referido al mismo rubro, se trata de un acoplado porta bins. Nos enfocamos fuertemente el diseñar nuevos tipos de acoplados para nuestros clientes, que se adapten a sus necesidades reales.', '3000000.00', 0, 0, 'El proyecto que se llevara a cabo tiene como finalidad el desarrollo de un nuevo producto. Se trata de un acoplado porta bins de alta calidad, que soportara hasta 5 bines, con una capacidad de carga de hasta 3.000kg. Al igual que todos nuestros productos sera elaborado con materiales de alta calidad.', 'El obejtivo principal de este proyecto es la creacion de un nuevo acoplado porta bins que se utilizara para las cosechas de citrus. La empresa ya tiene el diseño del producto, con el monto solicitado mediante este proyecto queremos adquirir los materiales para poder fabricar y tener unidades disponibles para la venta.', 'La oportunidad mas importante de este proyecto sera que nos permitira captar nuevos clientes. Siguiendo nuestro proposito de diseñar, fabricar y comercializar productos de calidad que brinden soluciones a las necesidades reales de los clientes, confiamos en que este producto sera una oportunidad para incrementar nuestras ventas.', 'La empresa ya cuenta con el diseño del producto, solo resta la compra de los materiales para para poder producirlo.', 'Industrias Riehl S.R.L. es una empresa nacional, familiar, iniciada por Hugo Enrique Riehl junto con su esposa en la ciudad de San Salvador. Con esfuerzo, dedicacion y trabajo honesto han podido progresar año tras año, lograr un notable crecimiento y mantenerse en la industria.', 'Somos una empresa familiar dedicada a la fabricacion de acoplados, remolques y semirremolques, desde nuestros inicios nos esforzamos por diseñar productos que se adapten a las necesidades reales de los clientes.', 'La empresa se encuentra ubicada en la ciudad de San Salvador, sobre el Bv. Concordia al 367. El lugar donde se llevan a cabo las activades de produccion, administracion y comercializacion, es propiedad de la empresa.', 'No corresponde', 'El nuevo producto: Acoplado Porta Bins\r\n- De 1 eje con suspension\r\n- Capacidad de carga 3.000 kg.\r\n- Medidas ancho x largo carga: 1.340 x 6.050 mm.\r\n- Soporta  5 (cinco) bines\r\n- Suspensión con elásticos y eje con maza 2 1/2” centro 150 mm. 5 agujeros\r\n- Rodado 22,5”', 'Producto: Acoplado Porta Bins\r\nSistema de descarga de los bines con correderas de rodillos dispuesto a lo largo del chasis.\r\nEstribos ambos laterales para uso del cosechero, descarga la fruta en el interior del bins.', 'Plegado y estampado de piezas\r\nPerforado de perfiles de acero\r\nSoldado de estructuras de chasis y partes anexas\r\nPintado total\r\nArmado de la unidad', 'Perfiles laminados de acero UPN e IPN\r\nChapas de acero SAE 1010\r\nMetal desplegado\r\nElásticos de suspensión\r\nEjes con mazas de acero\r\nPinturas poliuretanicas', 'Todos lo desechos que surgen de la fabricacion de nuetros productos son residuos de acero que se reciclan como chatarra.', 'El nuevo producto que a empresa se propone comenzar a fabricar y comercializar, esta destinado principalmente a los productores de citrus.', '- SMIETUCH BASILIO LEONARDO, CUIT 20-18535472-6. PRODUCTO ADQUIRIDOS: CARROCERIA APICOLA.\r\n- FRIGO MARIO ALBERTO, CUIT 20-25481306-1. PRODUCTO ADQUIRIDO: CARROCERIA APICOLA.\r\n- BORGHESAN MATIAS ALEXIS, CUIT 20-34678936-1. PRODUCTO ADQUIRIDO: CARROCERIA BARANDAS REBATIBLES SOBRE ACOPLADO. \r\n-', '- Gross\r\nUbicacion: Ramirez', 'Perfiles de acero laminado: FABAHER SA – Rosario S.F.\r\n\r\nCapas de acero laminado: PACHECO CHAPAS SA – Bs. As.\r\n\r\nRodillos de polímeros: RESINGER SRL – Bs. As.\r\n\r\nPinturas poliuretanica: MC PINTURAS SA - Bs. As.\r\n\r\nEjes: MSM SA – Miguel Torres – S.F.', 'Nos encontramos en una situacion a nivel pais en la que podemos sufrir la falta de materia prima para la fabricacion de nuestros productos. \r\nNuestra estrategia para poder llevar a cabo este proyecto de manera exitosa sera la compra de materia prima para poder fabricar unidades y tenerlas disponibles para la venta.', 'El monto solicitado se utilizara para la compra de la materia prima necesaria para la fabricacion de unidades este nuevo producto que la empresa ya diseño y va a fabricar y comercializar.', 'Actualmente la empresa cuenta con 8 trabajadores activos.', 'El hecho de que la empresa implemente un nuevo producto para fabricar y comercializar, no solo nos permitira lanzar al mercado una nueva solucion para nuestros actuales y potenciales clientes. Si no que tambien implicara la creacion de nuevos puestos de trabajo que seran necesarios para el proceso de produccion de este nuevo producto que la empresa incorporara.', 'El precio del producto esta previsto en $790.000', '- Empresa reconocida en el mercado. \r\n- Amplia trayectoria en el rubro. \r\n- Constante evolucion en los diseños.\r\n- Productos de calidad.\r\n- Nos adaptamos con facilidad a las necesidades de los clientes, realizando modificaciones que sean solicitadas por los mismos.', '- Nuevo nicho de mercado.\r\n- Ampliacion de la cartera de productos.', '- Dificultades para brindar financiaciones a nuestros clientes.', '- Ingreso del exterior de productos a costos mas bajos que los de produccion.\r\n- Problemas de importacion de materias prima que dificulten la produccion.\r\n- Inestabilidad politica y economica del pais.', '2022-07-15 11:56:12', '2022-07-26 14:10:18'),
(279, 1903, 1537, 19, 1, 'AMPLIACION DE INSTALACIONES DE TRABAJO', 'SE TRATA DE UNA EMPRESA FAMILIAR INTEGRADA POR 2 HERMANOS EN PLENA EXPANSIÓN CUYA ACTIVIDAD PRINCIPAL ES LA ELABORACION Y VENTA DE CARNES DE CERDO Y SUS DERIVADOS', '3000000.00', 1, 0, 'EL PROYECTO SE FUNDAMENTA EN LA ADQUISICIÓN DE UNA CAMARA FRIGORIFICA, MESAS DE TRABAJO DE ACERO INOXIDABLE Y RIELERA PORTANTE FRIGORIFICAS, CABE ACLARAR QUE ESTO SE UTILIZARA EN EL LOCAL PROPIO QUE ESTAMOS CONSTRUYENDO', 'EL OBJETIVO DEL PROYECTO ES INCREMENTAR  LA CANTIDAD DE KG  CARNE QUE ESTO SE TRADUCE EN MAYOR PRODUCCION Y VENTA DE LA MISMA, POR ESO SE NECESITA AMPLIAR LA CAMARA EXISTENTE, MESAS DE TRABAJO Y EL INGRESO DE LAS MEDIAS RES POR SISTEMA DE RIELERA, ACTUALMENTE ES MANUAL', 'APOSTAMOS AL CRECIMIENTO ES POR ESO QUE ESTAMOS CONTRUYENDO UN LOCAL PROPIO CON INSTALACIONES MUCHO MAS AMPLIAS, MEJOR INGRESO DE LA MERCADERIA, MAYOR CAPACIDAD EN EL ACOPIO DE MEDIAS RES, Y MEJORA EN LAS INSTALACIONES DE TRABAJO DEL PERSONAL.', 'ACTUALMENTE NOS ENCONTRAMOS TRABAJANDO EN UN LOCAL ALQUILADO, CON INGRESO DE MEDIAS RES EN FORMA MANUAL, ESPACIOS DE TRABAJOS ACOTADOS Y LA CAMARA FRIGORIFICA QUE ESTÁ TRABAJANDO A SU MÁXIMA CAPACIDAD, POR LO QUE APOSTAMOS AL CRECIMIENTO Y EL SALTO NO SOLO CUALITATIVO SI NO QUE CUANTITATIVO CON ESTE NUEVO PROYECTO', 'EL EMPRENDIMIENTO ARRANCO COMO UNA IDEA DE 2 HERMANOS DE HACER ALGO JUNTOS, ASI LE DIMOS FORMA A UN PROYECTO DE ELABORAR Y COMERCIALIZAR CARNE DE CERDO QUE EN AQUEL MOMENTO ERA QUIZAR LA TERCER ALTERNATIVA POR DETRAS DE LA CARNE DE VACA Y EL POLLO, FUIMOS CRECIENDO A PASO FIRME COMPRANDO A TROZADEROS, PARA LUEGO PASAR A COMPRAR MEDIA RES Y COMENZAR A DESARMAR EN EL LOCAL.', 'ACTUALMENTE Y DADO EL VOLUMEN  SE LLEGO A COMPRAR DIRECTAMENTE A PRODUCTOR EL CERDO EN PIE BUSCANDO DE ESTA MANERA SEGUIR CON LA DISMINUCIÓN DE  COSTOS CON LA MEJORA EN LA RENTABILILDAD,  EL BUEN PRESENTE QUE ESTA GOZANDO LA CARNE DE CERDO NO SOLO POR EL PRECIO SI NO POR LA MEJOR EN LA GENETICA DE LA MISMA HACE QUE SEA UNA OPORTUNIDAD UNICA PARA APOSTAR AL CRECIMIENTO.', 'LA EMPRESA FUNCIONA ACTUALMENTE EN UN LOCAL ALQUILADO Y DADO EL CRECIMIENTO EN EL VOLUMEN DE CARNE QUE SE TRABAJA LOS ESPACIOS ESTAN ACOTADOS, EL INGRESO ES COMO SE MENCIONO EN FORMA MANUAL Y LAS MESAS DE TRABAJO SON POCAS, PERO AL NO CONTAR CON ESPACIO NO SE PUEDEN  INCORPORAR MÁS.', 'EL LOCAL SE VIENE ALQUILANDO DESDE EL AÑO 2013 QUE FUE CUANDO INICIAMOS LAS ACTIVIDADES, EL MISMO CUENTA CON UN SALON DE VENTA AL PUBLICO SEPARADO DE LA PARTE DE ELABORACION, DESPOSTE Y EMPAQUETEADO DE CARNE, TAMBIÉN ESTAN LAS CAMARAS FRIGORIFICAS Y MESAS DE TRABAJO', 'ACTUALMENTE SE ELABORA EN FORMA MANUAL, TIPO ARTESANAL, NO SOLO POR LAS LIMITACIONES EN EL VOLUMEN DE CARNE SI NO TAMBIEN DE ESPACIOS', 'ACTUALMENTE SE CUENTA CON PICADORA, EMBUTIDORA, MEZCLADORA, 2 MESAS DE TRABAJO YUNA EMPANADORA PARA HACER MILANESAS', 'INGRESA LA MEDIA RES, LUEGO DEL DESPOSTE SE SEPARAN LOS CORTES QUE  SON EMBANDEJADOS Y LLEVADOS A LAS EXIBIDORAS, OTROS PASAN A ELABORACION TANTO DE EMBUTIDOS COMO DE MILANESAS', 'LA MATERIA PRIMA PROVIENE COMO SE MENCIONO ANTERIORMENTE DEL DESPOSTE DE LA MEDIA RES DEL CERDO, DE LA QUE SE OBTIENEN CORTES COMO MATAMBRE, SOLOMILLO, CARRE, COSTILLAR,BONDIOLA, PULPAS,CARNES DE RECORTE ENTRE OTROS.', 'DE LOS SUBPRODUCTOS, HOY POR FALTA DE ESPACIOS Y DE INSTALACIONES SE TERCERIZA EL SERVICIO DE DERRETIR GRASA LA QUE LUEGO SE VENDE EN BALDE Y EN POTE, CON EL CUERO, RIÑONES Y CABEZA SE ELABORA CHORIZO BLANCO , EL LLAMADO \"QUESO DE CHANCHO\" Y MORCILLA.', 'CLARAMENTE EL MERCADO SE MUESTARA PROPICIO PARA EL CRECIMIENTO POR LA COMPETITIVIDAD NO SOLO DE PRECIO SI NO DE LA CALIDAD DE LA CARNE DE CERDO, POR TAL MOTIVO APOSTAMOS AL CRECIMIENTO  Y AMPLIACION DEL MERCADO NO SOLO LLEGANDO AL CONSUMIDOR FINAL SI NO TAMBIÉN AL COMERCIANTE PARA QUE PUEDA REVENDER NUESTROS PRODUCTOS, PARA ESTO NECESITAMOS AMPLIAR Y MEJORAR NUESTROS ESPACIOS DE TRABAJO, INCORPORAR PERSONAL ENTRE OTRAS COSAS', 'CUANDO COMENZAMOS CON EL PROYECTO, APOSTAMOS NO SOLO A UNA ALTERNATIVA DE CARNE QUE EN AQUEL MOMENTO ERA POCO CONOCIDA EN LA CIUDAD DE CRESPO, SI NO QUE TAMBIÉN A LA OPTIMIZACIÓN DE TIEMPOS DE COMPRA CON LA PRESENTACIÓN DEL PRODUCTO EMBANDEJADO, EL CLIENTE POCO A POCO FUE CONOCIENDO NUESTRO PRODUCTOS, LA SERIEDAD Y LA RESPONSABILIDAD CON LA QUE DEDICAMOS DIA A DIA NUESTRO TRABAJO, AÑO A AÑO LA CANTIDAD DE CLIENTES SE FUE INCREMENTANDO LO QUE NOS PERMITIÓ SEGUIR CRECIENDO EN EL VOLUMEN DE CARNE', 'RESPECTO A LA COMPETENCIA PODRIAMOS DECIR QUE NO SE ENCUENTRA EN LA CIUDAD UN NEGOCIO ESPECIALIZADO EN CERDO COMO EL NUESTRO, SE PODRIA DECIR QUE HAY COMPETENCIA INDIRECTAS CON LAS CARNICERIAS O DE PRODUCTOS SUSTITUTOS COMO LA CARNE DE VACA O EL POLLO, POR LO QUE APOSTAMOS A PODER INGRESAR NUESTROS PRODUCTOS AL MERCADO MAYORISTA.', 'RESPECTO A LOS PROVEEDORES LOS DOS MAS IMPORTANTES SON EL PRODUCTOS DE CERDO A LOS CUALES LES COMPRAMOS EL CERDO EN PIE Y EL FRIGORIFICO QUE NOS PRESTA EL SERVICIO DE FAENA.', 'LOS RIESGOS QUE HOY ENCONTRAMOS ES QUE SI NO AVANZAMOS EN EL CRECIMIENTO DEL VOLUMEN DE CARNE CON EL QUE TRABAJAMOS ESTARÍAMOS PERDIENDO UNA OPORTUNIDAD INIGUALABLE DE MERCADO, ES POR ESTO QUE APOSTAMOS A LA CONSTRUCCIÓN DEL LOCAL PROPIO QUE NOS PERMITA SUPERAR ESTAS LIMITACIONES.', 'EL DESTINO DEL MONTO SOLICITADO ES BASICAMENTE LA ADQUISICIÓN DE UNA RIELERA QUE FACILITE EL INGRESO DE LA MEDIA RES A LA CAMARA DESDE EL CAMIÓN, LA ADQUISICIÓN DE UNA CAMARA FRIGORIFICA  CON MAYOR CAPACIDAD A LA QUE TENEMOS ACTUALMENTE Y LA INCORPORTACION DE NUEVAS MESAS DE TRABAJO DE ACERO INOXIDABLE.', 'ACTUALMENTE CONTAMOS CON 2 EMPLEADOS, CON LA CONTRUCCION DEL NUEVO LOCAL VAMOS A NECESITAR INCORPORAR MAS GENTE, YA QUE EL VOLUMEN Y LA AMPLITUD FISICA DEL LUGAR LO VAN A PERMITIR.', 'APOSTAMOS A QUE SEA UN IMPACTO POSITIVO EN NUESTROS CLIENTES LA CONSTRUCCION DE ESTE NUEVO LOCAL, POR LA MEJORA EN LAS INSTALACIONES, MEJORA EN LA ATENCIÓN CON LA INCORPORACIÓN DE NUEVO PERSONAL, INCORPORACION DE NUEVOS PRODUCTOS', 'DADA LA VARIACION DE PRECIOS QUE TENEMOS ACTUALMENTE SOLICITAMOS LOS $3000000 ESTIMANDO QUE PODREMOS ADQUIRIR LA RIELERA, LA CAMARA Y LAS MESAS DE TRABAJO, IGUALMENTE LO TENDREMOS QUE COTEJAR UNA VEZ RECIBIDO EL DESEMBOLSO PARA LA ADQUISICIÓN DE LOS MISMOS.', 'SIN DUDAS LA FORTALEZA VA A ESTAR DADA EN LA MEJORA EN  LA ENTRADA DE MERCADERIA, MAYOR CAPACIDAD DE ALMACENAJE DE MEDIA RES, MEJORA EN LA AMPLITUD Y CALIDAD DE LOS ESPACIOS DE TRABAJO, AGILIDAD EN LA ATENCION DEL CLIENTE, MEJORA DE RENTABILIDAD.', 'POR TODO LO ANTERIORMENTE EXPUESTO, EL MERCADO MUESTRA UNA PROYECCIÓN FAVORABLE PARA LA CARNE DE CERDO, ES POR ESO QUE APOSTAMOS AL CRECIMIENTO.', 'LAS DEBILIDADES QUE ACTUALMENTE TENEMOS ES LA FALTA DE ESPACIOS FISICOS QUE NO NOS PERMITE TRABAJAR CON COMODIDAS, TAMPOCO NOS PERMITE INCORPORAR PERSONAL, LENTIFICA LA ENTRADA DE MERCADERIA AL SER MANUAL, CON LA LIMITACION EN LA CAPACIDAD NO NOS PERMITE SATISFACER A LA DEMANDA CRECIENTE DE LOS CLIENTES.', 'COMO AMENAZAS VEMOS LA POTENCIAL ENTRADA DE LA COMPETENCIA QUE VEA LA CRECIENTE DEMANDA A LA CUAL SI NO DAMOS ESTE PASO IMPORTANTE NOS VEMOS IMPOSIBILITADO DE SATISFACER.', '2022-07-29 11:52:29', '2022-08-03 12:39:58'),
(280, 1856, 1468, 19, 1, 'FABRICA DE ALPARGATAS LRB - LA ROSA BLANCA', 'El presente proyecto tiene como objetivo obtener financiación con la idea de aumentar y mejorar los procesos productivos,  y a su vez, el orden y depósito de los productos terminados. A través de estos objetivos, creemos posible un aumento en las ventas, lo que traerá también aparejado consecuentemente una mayor demanda de puestos de trabajos.\r\nEl contar con capital de trabajo (pcipalmente Materias primas) es primordial, para asegurar el cumplimiento en tiempo y forma de nuestras obligaciones.', '5000000.00', 1, 1, 'El presente proyecto se basa principalmente en la posibilidad de obtener financiación, herramienta indispensable para las empresas productivas, a través del trabajo conjunto y articulado entre el sector publico y privado. A través de esto, buscaremos destinar los fondos a la inversión en mobiliario y capital de trabajo, que tendrá como finalidad un aumento en la producción, mayores ventas, y en consecuencia mayores puestos de trabajo.', 'Obtener financiación para:\r\n1. Capital de trabajo, principalmente insumos o materias primas indispensables para la fabricación de nuestro producto, como así también los mobiliarios (estanterías) para el orden y depósito de nuestros productos; y\r\n2. a través de esto, mayor producción, que lleve a mayores ventas, y la creación de nuevos puestos de trabajo.', 'La compra de Materia Prima, más la posibilidad de agregar una inversión en mobiliarios, se torna fundamental para nosotros en esta instancia, ya que comenzamos a transitar la una nueva temporada que dadas las características de nuestro producto, consideramos como temporada alta. \r\nPor eso, contar con esta financiación, significaría una gran oportunidad de crecimiento no solo a nivel de nuestra empresa, sino colectivo.-', 'Actualmente la empresa se encuentra operando en condiciones normales, financiándose principalmente a corto plazo a través del crédito de sus principales proveedores, y en cuanto a su depósito, realizando obras para la posterior incorporación de los mobiliarios/estanterías.-', 'En LRB hacemos alpargatas desde mucho antes que esté de moda usar alpargatas. Las hacemos en Aranguren, un pequeño pueblo de Entre Ríos, donde andar en alpargatas es lo más natural del mundo. Nos ocupamos de que resulten confortables, cómodas y con estilo. Una alpargata de “fierro” para tus trabajos, una compañera inseparable para los días. Somos una familia alpargatera Nos emociona y enorgullece fabricar Alpargatas LRB, las de ayer, de hoy y de siempre…desde hace 30 años.', 'Actualmente la empresa se encuentra en un proceso constante de mejora y crecimiento, trabajando arduamente para seguir consolidándose en el mercado, fortaleciendo las relaciones con nuestra destacada clientela y proveedores, con el convencimiento de que todas estas acciones contribuyen a un país más productivo, mediante la generación de empleo.-', 'Tanto las oficinas de la empresa, como el inmueble del área/sector de producción, son propiedad de la empresa. Además cuenta con un depósito para los productos. Todo ubicado en Villa Aranguren, Dpto. Nogoyá, Entre Ríos.', 'No Alquila.-', 'Contamos con dos lineas de productos diferenciadas, cada una de ellas con sus propias características técnicas. La linea LRB (alpargata tradicional), más bien rústica, de campo o trabajo; LAS CLÁSICAS. Por otro lado la Linea \"La Rosa Blanca\", alpargata de diseño, más informal, LA URBANA.', 'Si bien nuestros productos y el proceso producto en si, cuenta con máquinas y tecnologías adecuadas y necesarias para tal fin, siempre priorizamos la parte artesanal/tradicional en el armado de las alpargatas, manteniendo la esencia de nuestro producto. No obstante, lleva aparejado innovación.', 'El proceso productivo consta de diversas etapas. Comenzado por el CORTADO de la telas, gomas (suelas) y las plantillas. Luego pasa al sector de ARMADO. Continua el proceso en el PINTADO/PEGADO del producto, pasando a continuación por el horno (para el secado del pegamento) para terminar el producto.', 'En cuanto a la materia prima, se es muy cuidadoso y detallista en las mismas, ya que son parte fundamental del producto, Se trabaja con materias primas de calidad. Las principales son Goma, Telas, Pegamentos y Plantillas.-', 'En general por las características de las materias primas, muchas se reutilizan. Con las que no es posible su uso, se desechan cuidadosamente, en el lugar y con el tratamiento adecuado.-', 'La determinación del Mercado se delimita por las características propias de nuestros productos. Es así que atendemos las necesidades del mercado local (refiriendo a todo el país), ya el producto es demandado a lo largo y ancho de la Argentina. Enfocados en la satisfacción de las necesidades del mercado del calzado.', 'A lo largo de la historia de la empresa, nos acompañan una cartera de clientes con los cuales hemos logrado una relación comercial fiel y duradera. Asimismo, se siguen sumando clientes nuevos a través de los diversos canales con lo que opera la empresa. Entre los clientes contamos con negocios en general (mayoristas-minoristas), talabarterias, cooperativas, veterinarias, etc.', 'En cuanto a la Competencia, en la provincia como a nivel nacional, encontramos empresas producen y venden alpargatas. En cuanto a ello, podemos mencionar La Copetona, Calzados la Litoraleña, Confortables SRL, entre otras.', 'El suministro de las distintas materias primas para la fabricación de los productos es realizado por diferentes proveedores establecidos tanto dentro como fuera de la provincia. Contamos con una relación comercial de años con muchos de ellos, los que nos garantiza seguridad, calidad y puntualidad que nos permite obtener un excelente producto. Entre ellos, proveedores de Goma (suela), Telas, pegamentos, entre otros.-', 'Los Riesgos considerados son los propios de cualquier actividad comercial hoy en día, determinadas sobre todo por las condiciones y circunstancias económicas del País y la Región. No obstante, confiamos en que irán mejorado. Para superar el Riesgo mencionado, emplearemos o tomaremos las mejores decisiones en cuanto a las variables que están a nuestro alcance como Precio (competitivo), asociado a una excelente calidad del producto, con base en promoción y publicidad.', 'El destino será  básicamente para:\r\n1. La compra de materias primas Claves para la actividad (telas, Gomas, etc) dado la temporada que se aproxima.\r\n2. La adquisición de mobiliario (estantería) para el orden y depósitos de los productos terminados.-', 'En total la empresa emplea 9 personas, más el personal jerárquico y de dirección.- La idea es incrementar la planta del personal permanente a corto o mediado plazo.', 'Nuestra organización enfoca sus esfuerzos en lograr que el impacto económico y social sea beneficioso para el colectivo de nuestra comunidad, tanto en el ámbito Local, Provincial como Nacional, contribuyendo a la generación de empleo y el aporte de riqueza a través del cumplimiento de las obligaciones impositivas vigentes, primando en todo momento la responsabilidad social que significa todo desarrollo de una actividad productiva.', 'El precio de nuestros productos se determina considerando un motón de variables, todas ellas necesarias para satisfacer las necesidades de los clientes, asegurando un precio competitivo y minuciosamente cuidado. En general el precio de nuestros producto oscila entre los $ 750 y los $2.800, dependiendo del modelo seleccionado.-', 'Somos una empresa con mucha experiencia en el negocio, experiencia que hemos ido adquiriendo a lo largo de todos estos años de vida, lo que sumado a la calidad de nuestros productos, la solidez en nuestra organización y dirección interna, la imagen de nuestra marca y la relación de fidelidad con nuestros clientes, hacen al conjunto de nuestras fortalezas internas. Mención especial también a los procesos de INNOVACION de nuestros productos, reflejados en una amplia variedad de colores y diseños.-', 'Como oportunidad principal, marcamos el comienzo de una nueva temporada estival, que dadas las características de nuestros productos, la demanda presenta un fuerte aumento año tras año.  Otro punto a destacar es la creciente demanda de los mercados hacia las alpargatas, como búsqueda de una calzado cómodo, duradero y significativamente más económico que otros tipos de calzados.-', 'Trabajamos intensamente en la búsqueda y reconocimiento de nuestras posibles debilidades. Es así, que cuando detectamos una posible debilidad dentro de este análisis, hacemos foco en ella y tratamos de mejorarla. Ejemplo de ello, en la actualidad estamos trabajando arduamente para mejorar nuestros puntos de ventas electrónicos, a través de nuestras diversas redes, sitio web, etc.', 'Muchas veces nuestra empresa se ve afectada por variables de índole macroeconómicas, lo cual dificulta la correcta planificación en la organización.  Así variables como la inflación, hacen que el negocio se vea afectado en cuanto a sus costos, a la disponibilidad de las materias primas primordiales para la fabricación de nuestros productos y a la posibilidad de establecer políticas de precios más estables a mediano y largo plazo.-', '2022-07-29 13:40:50', '2023-02-13 14:00:28'),
(282, 1907, 1979, 20, 1, 'PLANTA DE PRODUCCION DE PASTA Y HARINA DE NUEZ PECAN', 'BUSCAMOS INVERSION PARA AMPLIACION Y ACONDICIONAMIENTO DE NUESTRA PLANTA DE PRODUCCION; Y  OBTENCION DE CAPITAL DE TRABAJO. EN NUESTRA PLANTA DE PRODUCCION DE PASTA Y HARINA DE NUEZ PECAN, EN LA CIUDAD DE COLON.', '2000000.00', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-30 16:46:45', '2022-07-30 16:52:46'),
(283, 941, 447, 20, 1, 'AMPLIACIÓN GALPÓN DE PRODUCCIÓN', 'SOY PABLO A. LOPEZ VAN OOSTERON Y JUNTO A MI HERMANO, DESDE 2015 TENEMOS UNA PEQUEÑA FÁBRICA DE\r\nMÁQUINAS PARA ELABORAR DISCOS DE EMPANADAS Y PASTAS FRESCAS PARA MEDIANA Y ALTA PRODUCCIÓN,\r\nSIENDO LA ÚNICA EN LA PROVINCIA ORIENTADA ESTE RUBRO ESPECÍFICO. COMERCIALIZAMOS NUESTROS\r\nPRODUCTOS EN ARGENTINA Y DESDE 2017 REALIZAMOS ALGUNAS EXPORTACIONES OCASIONALES A OTROS PAÍSES\r\nDE LA REGIÓN.', '3000000.00', 1, 0, 'UN PROYECTO QUE PERMITIRÁ AMPLIAR EL ESPACIO DE TRABAJO ANEXANDO UN NUEVO TRAMO AL GALPÓN\r\nEXISTENTE, DE MANERA QUE NOS PERMITA COMENZAR A PRODUCIR LOTES DE MÁQUINAS EN SERIE Y ASÍ SALIR DE LA PRODUCCIÓN ARTESANAL. LA AMPLIACIÓN DEL ESPACIO DE TRABAJO PREVEE LA CONSTRUCCIÓN DE UN\r\nNUEVO GALPÓN Y ADECUACIÓN DE INSTALACIONES.', 'EL OBJETIVO PRINCIPAL DEL PROYECTO ES RESOLVER NUESTRO PRINCIPAL PROBLEMA ESTRUCTURAL: LA FALTA DE\r\nESPACIO FíSICO. PARA ELLO SE PREVEE LA CONSTRUCCIóN DE UN NUEVO GALPóN Y ADECUACIóN DE INSTALACIONES\r\nPARA AMPLIAR EL ESPACIO DE MONTAJE, CREAR NUEVAS SECCIONES DE PRODUCCIóN Y CONTAR CON UN ESPACIO\r\nPARA ALMACENAR PRODUCTOS TERMINADOS.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-08-01 14:12:03', '2022-08-01 14:29:21'),
(284, 1849, 1981, 20, 1, 'NUEVO PROYECTO', 'Mi proyecto consiste en la implementacion del pastoreo racional en la ganaderia. He detectado que el manejo tanto de las pasturas naturales como de las pasturas implementadas, se caracterizan por presentar habitos y costumbres que conducen al sobrepastoreo repercutiendo en los cotos y en las ganancias; con el pastoreo racional se maximizan los resulatados, buscando siempre la mayor eficiencia productiva, acorde a los patrones de calidad para una producción orgánica y sustentable.', '3000000.00', 1, 0, 'El pastoreo racional es la más avanzada y eficiente de las técnicas de manejo de los pastos que se basa en la armonización de los principios de la fisiología vegetal con las necesidades cuan y cualitativas de los animales, con el mejoramiento creciente del suelo, por procesos bióticos, bajo la intervención ydirección del homb', 'Mi objetivo es comenzar el pastoreo racional con 100 animales, para luego ir aumentando gradualmente a medida que aumente la fertilidad del suelo y amedida que se vallan cumpliendo los objetivos de la impementacion de dicha tecnica.', 'La implementacion de este proyecto significa la oportunidad de poner en practica todos los conocimientos que he adquirido en estos años. Conozco y entiendo el manejo y el cuidado de las pasturas en si y en funcion de los requerimientos de los animales que lo pastan.Tambien implica la posibilidad de incrementar la produccion por unidad de superficie en forma sustentable con el transcurso de los años.', 'En la actualidad no puedo implementar el pastoreo racional por la falta de recursos, encontrandome imposibilitado para comprar los animales; tambien es necesario la instalacion de bebederos de manera que los animales no tengan que hacer largos recorridos, y a su vez para aprovechar la fertilizacion proveniente del animal a través de su bosteo y la orina.', 'Desde que soy niño he vivido el campo. Para mi es el campo la raiz de nuestra Argentina, fortalecerlo e incentivar a que se trabaje seria una de las fuentes que ayudaria en gran parte a mejorar la economia de nuestro pais.', 'Actualmente desarrollo el pastoreo tradicional a campo abierto con un numero reducido de animales; los recursos economicos para poder poder desarrollar el pastoreo racional con que cuento son escasos', 'Gobernador Mansilla, provincia de Entre Rios, pertenece al departamento Tala', 'No alquilo, el campo en el que desarrollo mi emprendimiento pertenece a mi padre, anteriormente pertenecia a mis abuelos. Trabajo en forma conjunta con mi padre desde hace varios años', 'Implementando el pastoreo racional, se producen animales de alta calidad en carne, esto se debe al cuidado del suelo a la fertilizacion organica del mismo, se genera mejor pasto se da de comer buen alimento obteniendo mejor rinde en menor tiempo con animales saludables', 'No requiere procesos tecnologicos', 'Proceso: conciste (a grandes rasgos) en lotear el campo, c/lote con bebedero, se ingresas tantos animales por lote y luego se van rotando los animales siguiendo determinado orden y secuencia; se llevan registros para posibles evaluaciones y cambios atendiendo los requerim de los animales y de pastos', 'El animal chico- ternero destetados - y el costo de la siembra de pastos para alimento (alfalfa, festuca, lotus)', 'no posee', 'El mercado es muy bueno y grande', 'Frigorificos', 'Si hay competencia, pero en la zona no se lleva a cabo el pastoreo racional', 'Existe oferta de alta calidad y cantidad', 'Son minimos los riesgos, y en su mayoria estan asociados al clima o situaciones externas', 'Para la compra de animales,para sembrar pasturas y para mejorar el sistema de bebederos y el suministro de agua', 'Actualmente no poseo empleado', 'El impaco economico y social no solo seria mejor para mi, sino para toda la cadena productiva y para la sociedad en su conjunto, ya que el animal que estariamos vendiendo seria de alta calidad y rinde en Kg de carne.', 'Siguen el mercado', NULL, NULL, NULL, NULL, '2022-08-08 18:53:30', '2022-08-09 22:38:53'),
