(293, 1824, 1895, 19, 1, 'CANTERA RIPIO NATURAL ARCILLOSO', 'Extracción de ripio arcilloso', '6000000.00', 0, 0, 'Extracción de ripio arcilloso utilizado por empresas viales y vialidad provincial y nacional', 'Fortalecer e invertir en capital de trabajo para una mayor produccion', 'Obras en curso ganadas por nuestra empresa en vialidad provincial', 'Contamos con máquinas pero se necesita mayor caudal de trabajo para cumplir los compromisos y futuras ventas', 'Transer es una empresa familiar dónde contamos con transporte de áridos y canteras somos productores mineros inscriptos en la provincia', 'Estamos con obras adjudicadas en vialidad provincial y concursos de precios en diferentes municipios para el material a explotar', 'Ruta 11 km 52.5', 'Arrendamiento', 'Ripio arcilloso (canto rodado) y transporte', 'Material natural', 'Extracción y carga sobre camion', 'Material natural arcilloso sacado de suelo, insumos son combustible para la maquinaria y mano de obra', 'Ninguno, tenemos certifica ambiental vigente', 'Cumplir con las licitación y consursos ganados en lo publicó y privado', 'Municipalidad de villaguay\r\nMunicipalidad de San Benito\r\nMunicipalidad de seguí\r\nPiton\r\nCpc- rovella ruta 18', 'La minera srl\r\nLa herminia srl\r\nLa chola\r\nComesa', 'Gottig e hijos\r\nArrodar\r\nAmerican vial', 'El riesgo es la falta de financiamiento para esperar la cobranzas propias de los procesos administrativos de los clientes y la estrategia es la posibilidad de cobrar con los papeles habilitados al día y tener transporte propio', 'Capital de trabajo', '2 maquinistas', 'Posibilidad de crecimiento generando más trabajo', '$3500 el metro cubico', 'Fácil Complemento de lo ya invertido', 'Crecimiento y mayor cumplimiento a los pedidos', 'Falta de financiamiento por los costos excesivos', 'Clima y devaluación de la moneda', '2022-11-29 21:34:21', '2022-11-29 22:13:55'),
(295, 1930, 1998, 24, 1, 'NUEVO PROYECTO', 'Nuestra empresa Áridos El Tena, se dedica principalmente a la explotación y comercialización de ripio natural arcilloso, siendo proveedores de toda la provincia de Entre Ríos, como Vialidad Provincial, Municipalidades, Juntas de Gobiernos y entes particulares. A su vez contamos con logística de transporte y construcción de pavimentos, cloacas, alcantarillas, etc.\r\nNuestra cantera se ubica en Puerto Yerúa, Provincia de Entre Ríos.', '6000000.00', 0, 1, 'Debido a la inflación existente en el país se vio afectada la economía de la empresa, ocasionando que se nos sea imposible adquirir productos para mantener en condiciones nuestros equipos de trabajo. \r\nPor consiguiente decidimos presentar este proyecto, con la finalidad de obtener una ayuda económica.', 'Nuestros objetivos se basan en compensar la economía de Áridos El Tena, cubriendo todos los gastos que sean necesarios para llevar adelante esta empresa. A su vez ofrecer capacitaciones para generar nuevos empleos.', 'Recibir la ayuda económica solicitada nos daría la oportunidad de poner en condiciones las maquinas de trabajo, adquirir nuevas herramientas que son útiles en el rubro, y comenzar a expandirnos como una empresa reconocida.', 'Actualmente nos encontramos sin actividad, ya que no contamos con recursos para mantener los equipos  y poder lograr un trabajo eficaz.', 'Áridos El Tena, comienza sus actividades en el año 2021 como una empresa familiar, con fines de lucro personales. La misma es administrada por Barrio, Lourdes Micaela, en sus 21 años, con la ayuda de su padre. La cantera se encuentra en la localidad de Puerto Yerúa, departamento Concordia. En sus comienzo realiza la venta de ripio natural arcilloso cargado sobre camión a diferentes entidades.', 'Actualmente la empresa sigue siendo administrada por la misma persona y ademas de la explotación del material antes nombrado,cuenta con servicios como movimientos de suelos, logística de transporte y  construcción de pavimentos, cloacas, etc,', 'Puerto Yerúa, departamento Concordia', 'Dos años de arrendamiento, en el cual pagamos un monto por los metros cúbicos vendidos.', 'Ripio natural arcilloso y arenoso.', 'No contamos con tecnologías dentro del establecimiento.', 'Consiste en un cateo de suelo, destape de la zona a explotar, clasificación del mismo, acopio de ripio para la carga de camiones y la distribución del mismo.', 'Se clasifica en ripio natural arcilloso, arenoso y ripio colorado. Esto varia de lo que pida el cliente.', 'Los desechos son el destape de tierra que luego se comercializa para movimientos de suelo y relleno de superficies.', 'Nos encontramos en una buena posición frente al mercado, somos elegidos por la buena calidad de los productos.', 'Nos relacionamos con clientes, como Vialidad Provincial, Municipalidad, Junta de Gobiernos y entes particulares', 'Nuestra competencia se centra con empresas que presentan un mayor reconocimiento, llevan años trabajando en el rubro y cuentan con experiencia.', 'Nuestro mayor proveedor actual es de combustible, aceites y repuestos para las maquinas, ya que contamos con un gran consumo de los mismos mensualmente.', 'Como riesgo principal tenemos la lluvia, cuando llueve es imposible entrar a las cavas y por lo tanto no se pueden cargar los camiones.', '3 tambores de aceite.\r\n4 cubiertas para maquinas.\r\n3.000 litros de gasoil.\r\n4 tambores de 15 w 40\r\n8 cubiertas de camión.', 'Contamos con personal capacitado para las diferentes áreas de la empresa.', 'Como impacto económico tenemos la alta demanda de empleo, ya que a menudo se necesita personal para diferentes puestos. A su vez se genera un impacto social, debido a que los empleados cuentan con un sueldo fijo y acceso a la salud.', '1500 pesos por metro cúbico.', 'La fortaleza que nos destaca es la calidad de los servicios y productos que tenemos para ofrecer, además de la buena atención y responsabilidad.', 'Desarrollarnos aún más como empresa, incorporando nuevos productos para ofrecer al mercado y generar empleos para nuevos puestos.', 'La gran debilidad presente en la empresa se centra en las malas condiciones en las que se encuentran las máquinas, debido a la falta de presupuesto para poder mantener las mismas.', 'La principal amenaza con la que cuenta la empresa, es la lluvia, ya que como mencionamos antes, cuando nos encontramos con esta condición climática, no se pueden desarrollar las tareas previstas para el dia.', '2023-01-09 14:47:33', '2023-03-10 19:15:39'),
(301, 1709, 2004, 20, 1, 'NUEVO PROYECTO', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-03-09 11:24:35', '2023-03-09 11:24:35'),
(303, 1939, 2006, 19, 1, 'RECONSTRUCCION DE LA PARRILLA \"LO DE MANOLO\"', '“Parrilla Lo de Manolo” ubicada en 1° de Mayo y Avenida de los Pueblos Originarios es una esquina muy concurrida de la Costanera de nuestra ciudad, que trabaja desde hace 18 años y es un punto de encuentro tanto para nuestra comunidad local y regional como así también para nuestros vecinos salteños.\r\n Pasadas las 20:00 horas del 28 de diciembre del 2022 un voraz incendio originado por un desperfecto en el funcionamiento de un calefón consumió el establecimiento a un 99 %.LO DE MANOLO', '3000000.00', 0, 0, 'Reconstruccion de la Parrilla Lo de Manolo con sus resoectivos materiales de trabajo.', 'objetivo es lograr nuevamente a reconstruir la parrilla tal como estaba funcionando con sus instalaciones', 'Puestos laborales e ingreso de fuente personal de dinero', 'Se esta trabajando en este momento a un 20 % debido a la falta de estructura correspondiente y sometidos ademas a las contingencias climaticas', '“Parrilla Lo de Manolo” ubicada en 1° de Mayo y Avenida de los Pueblos Originarios ya que es una esquina muy concurrida de la Costanera de nuestra ciudad, que trabaja desde hace 18 años y es un punto de encuentro tanto para nuestra comunidad local y regional como así también para nuestros vecinos salteños.\r\nTrabajando para el turismo y la cultura a traves de shows en vivo y su arte culinario, como los pescados de rio, comida tipica de nuestra ciudad.', 'Gracias a algunas colaboraciones de herramientas prestadas por colegas (horno, freidora, cocina, freezer, vajillas, mesas, sillas, etc), donaciones y rifas que se realizaron, se logró juntar una mínima suma de dinero para reabrir la parrilla el día 8 de febrero, pero de forma frágil, ya que es a la intemperie, con lo que implica estar sujeto a las contingencias del tiempo para poder trabajar diariamente.', '1 de mayo y Av Costanera de los Pueblos Originarios', 'Se solicito el lugar a traves de un Cannon mensual brindado por el municipio desde el año 2005', 'Venta de alimentos preparados y elaborados en la parrilla para la degustacion de nuestros clientes.', 'Para la preparacion de las comidas utilizamos todo lo referido a cocinas, hornos, freidoras industriales, para la conservacion de las materas primas Heladeras y frezzers.', 'Los platos de alimentos se producen solo para el dia, lo que se conserva en refrigeracion es la materia prima de ellos.', 'Utilizamos carnes rojas, pescado, pastas, pizzas, minutas.', 'Se producen desechos de cascaras de vegetales,huevos y resto de comidas de los platos que han sido degustados.\r\nTambien desecho de aceite de las freidoras las que utilizamos para la fritura de papas fritas, milanesas, etc., los mismos son retirados a traves de la empresa encargada de la tarea.', 'La ventas son atipicas, segun los dias de la semana, generalmente el fin de semana aumentan la mismas, tambien esta sujeto al clima, debido a que en el invierno bajan las ventas.\r\nLa facturacion del año pasado fue de $ 1.142.742', 'Generalmente turistas y gente local.\r\nAsisten familias.\r\nSe trabaja con turismo y deporte perteneciente al municipio.', 'Hay otros negocios gastronomicos en la costanera donde asisten otros clientes.\r\nLa calidad de nuestros productos se basa en :\r\n-pescado despinado\r\n- carnes de ternera\r\n-pastas, pizzas y minutas con elaboracion propia.', 'Utilizamos varios proveedores en gaseosas cervezas y aguas ( ARLETAZ DISTRIBUCIONES)\r\nEn carnes ( Carniceria La Hacienda)\r\nEn verduleria ( GOTTE verduleria)\r\nEn materia prima ( Buraglia Distribuciones)', 'El principal riesgo es la inundación, debido a las diferentes crecidas del Rio Uruguay, se supera con ayuda de comerciantes, amigos, clientes y empleados.\r\nA largo de estos 18 años hemos superados 9 inundaciones que puso a prueba nuestra capacidad de resiliencia ante tan grave situación', 'Se requiere un monto mayor de lo solicitado para la recontruccion al 100 % de la parrilla, lo solicitado lo utilizaremos para la compra de herramientas de cocina: frezzer, heladeras, vajilla, computadora, camara de vigilancia, aire acondicionado, calefactores, equipo de sonido, y reconstrucción del salon ( aberturas, ladrillos, ceramica, chapas, etc)', 'Dueño: dedicacion 100%\r\nEmpleados: cocineros y mozos, con dedicación al 100% en su trabajo, principalmente en la atencion a los clientes.', 'Evitar la perdida de puestos laborales y proteger mis ingresos economicos, ya que dependo solo de la entrada de dinero de la parrilla para poder subsistir.\r\nLa parrilla se encuentra ubicada en un punto estrategico para el turismo local, nacional e internacional,.\r\nSe le da lugar a la cultura y a los artistas locales para que puedan expresar sus talentos a traves de sus shows.', 'Los precios de los productos se basan de acuerdo al costo de la materia prima, Lamentablemente este ultimo año, como es de publico conocimiento, el aumento de los precios estuvo sujeto a la inflacion, eso hizo que se registrara un aumento de precios en la compra de las materias primas para la elaboración de los alimentos.', 'Buena calidad en los platillos y cortes de carne y pescado de rio despinado.\r\n·         Excelente calidad en el servicio.\r\n·         Platos bien presentados.\r\n·         El uso de la tecnología ( shows en vivo los fin de semanas).\r\n·         Ambiente agradable para los comensales.', 'El crecimiento de la zona donde se establece la parrilla.\r\n·         El sector restaurantero está en crecimiento en la Costanera.\r\n·         La costumbre de asistir a parrillas.\r\n           Fuente laboral para varias flias.\r\n           Colaboracion con la cultura local\r\n           Ofrecer un buen servicio de calidad y atencion a los comensales.', 'No poseer un seguro contra incendio y/ o inundaciones,, por estar ubicada la parrilla en la COTA 14.', 'Estar sujeto a las contingencias del clima por las crecientes del Rio Uruguay.\r\nRobo, incendio.', '2023-03-10 17:30:04', '2023-03-20 21:31:45');
INSERT INTO `proyecto` (`id`, `titular`, `empresa`, `estado`, `activo`, `denominacion`, `resumenejecutivo`, `monto`, `destino`, `esliderMujer`, `descripcion`, `objetivos`, `oportunidad`, `desarrollo`, `historia`, `presente`, `propio`, `alquilado`, `ctecnicas`, `ctecnologicas`, `pproductivos`, `mprimas`, `subprocesos`, `mercado`, `clientes`, `competencia`, `proveedores`, `riesgos`, `destinomonto`, `personal`, `impacto`, `precios`, `fortalezas`, `oportunidades`, `debilidades`, `amenazas`, `created_at`, `updated_at`) VALUES
(306, 1947, 634, 19, 1, 'PROYECTO PLANTA 2 E INNOVACION TECNOLOGICA', 'La empresa solicita un credito para culminar el final de obra, traslado y adquisicion de nuevas maquinas, para la nueva planta procesadora que se esta terminando de montar en Colonia Avellaneda.  Dicha planta es desarrollada siguiendo las ultimas normas sanitarias y de calidad para poder elaborar los productos cumpliendo las normas nacionales y adaptandola a estandares internacionales, con el fin de consolidar la empresa en el mercado  exterior y favorecer las exportaciones regionales.', '8000000.00', 1, 0, 'EL proyecto actualmente se esta llevando a cabo y consiste en el montaje de una segunda planta procesadora, que cumpla con las normas sanitarias del Anmat para la elaboración de suplemento dietarios y agregando una nueva área de medicamentos fitoterapicos. La planta nueva se penso y se diagramo para optimizar todos los procesos productivos, de carga y descarga, cumpliendo con la normativa de zonificación establecida por el municipio y poder cumplir normas internacionales de calidad y de procesos', 'El objetivo del proyecto es mejorar la capacidad de producción, lograr un area de desarrollo e innovación tecnológica en suplementos dietarios líder en nuestra region . Al iniciar una planta de cero nos permitió diseñarla, pensando en lograr la aprobacion del Anmat medicamentos para la elaboración de medicamentos fitoterapicos, cumplir con todo lo necesario para poder tramitar las normas iso y hccp. Nos permite consolidarnos a nivel nacional, mejorando y abaratando nuestros productos.', 'El lograr la apertura de la planta nueva significa una mejora en los costos y los procesos, lo cual nos permitira ser mas competitivos a nivel nacional o internacional. Cumpliendo con toda la normativa vigente para tener una planta modelo que permita los mayores controles de calidad, con una mejora eficiente de la logistica, lo que permitira mejorar los precios y la calidad de nuestros productos y sus presentaciones', 'Actualmente la empresa ha conseguido adquirir el predio, realizar la planta, establecer las divisiones, montar los sistemas eléctricos y de filtrado de aire. Montar la planta con sistema de protección sanitaria, tener areas de higiene máxima, con zócalos sanitarios, pisos y paredes revestidos azulejados cumpliendo con las máximas normas de calidad. Se esta en el proceso de mudar varias de las maquinas que en la planta actual ya no tienen lugar, y se esta buscando la compra de todos los elementos', 'PGN s.a.\r\nSomos una empresa dedicada a la elaboración de suplementos dietarios, con más de 30 años de experiencia en el mercado de los productos naturales, para el cuidado del bienestar de las personas. Contamos con una variedad de productos naturales para la salud y preventivos de las dolencias crónicas del organismo de cobertura en todas las farmacias y almacenes naturales de todo el país. Desde Entre Ríos para todo el país y con proyección internacional. Premio al major exportador 2011', 'Nos caracterizamos por estar siempre a la vanguardia en las últimas metodologías de producción y control de calidad. Tecnología: Adquiriendo constantemente nuevos y los más avanzados equipos y maquinaria para la elaboración eficiente y de excelencia de nuestros productos. Logística: Siempre en búsqueda de soluciones organizamos toda la logística y canales de distribución contando con depósitos propios tanto en Entre Ríos como en Buenos Aires.', 'Actualmente la empresa tiene una planta propia con oficinas en la calle O Brien 1246, y se esta desarrollando la segunda planta en colonia avellaneda.', 'Ambas plantas son propias', 'Nuestra planta posee un moderno laboratorio con un estricto control que certifica la pureza y calidad de los productos.\r\nSe realizan análisis macro y microscópicos de las materias primas por cromatografía de capa delgada TLC con la que se produce la identificación de principios activos', 'Para todos los productos: Se obtienen los extractos secos asegurando concentración de cada producto y se extraen los principios activos a través de maceración, obteniendo las tinturas madre que luego son combinadas. Para las cápsulas: Se fabrican con maquinas de ultimas tecnología y alta producción', 'La empresa utiliza diferentes procesos productivos dependiendo del producto a realizar, toda vez que se fabrican mas de 100 productos distintos. Dentro de las presentaciones, se realizan capsulas, jarabes y suplementos liquidos. Utilizando llenados y capsuleras automatizadas', 'Se utilizan hierbas naturales, algunas que son remitidas en estado natural por nuestros productores proveedores. Otros principios que utilizamos son adquiridos a otros laboratorios tanto locales como internacionales.', 'De todos los procesos se ha buscado minimizar al maximo los desechos y aquellos que se producen son recolectados por una empresa privada especializada en desechos industriales y sanitarios para su mejor disposicion final.', 'Es un mercado en constante crecimiento, atento que la poblacion esta escapando de los medicamentos eticos y quimicos y volcandose a una vida mas natural. Nuestros productos ha tenido un constante crecimiento siendo un mercado en constante expansion y donde cada vez existen mas consumidores y actores en el sistema. América Latina es la segunda región del mundo con más ventas (5,5 milmillones de dólares en el año 2018). Gran parte de estas se debieron a la demanda de personas no deportistas.', 'Nuestros clientes se encuentran muy afianzados y confiados con las lineas de productos que se fabrican, son principalemente personas que buscan soluciones a problemas diarios de salud con una solucion natural y que no les genere efectos adversos. Son clientes muy conscientes de los natural y del cuidado del cuerpo. Se abarcan dentro de las distintas lineas todas las edades de consumidores de segmentos en general medios y altos, aunque los segmentos de mas bajos recursos tambien consumen.', 'Es un mercado con varios actores, en donde los laboratorios mas grandes estan empezando a tener una participacion cada vez mayor. Lo bueno es que el posicicionamiento de los productos por parte de cualquiera de los actores colabora con las ventas de todos.', 'Los proveedores son productores de hierbas algunos locales y otros de cordoba y buenos aires. Todo los envases se compran en buenos aires y toda la cartoneria, asi como packaging de carton se imprime y compra localmente. La logistica es manejada con una empresa local que lleva los productos a todo el pais', 'El mayor riesgo que se avizora es la participación de grandes jugadores que buscaran sacar las líneas de suplementos dietarios del área de fabricación como alimentos y pasarlos a ser medicamentos. La estrategia planteada por la empresa fue la construcción de una nueva planta adaptándose a todos los requerimientos necesarios para lograr la habilitación del ANMAT como fabrica de medicamentos fitoterapicos.', 'El monto solicitado estará destinado a terminar de mudar la planta, adquirir nuevas maquinas para el laboratorio de investigacion y desarrollo, como ser un cromotagrofa, dos tolvas de maceración, y un reactor extractor de principios activos. Asimismo sera necesario invertir en capacitacion para el personal y nuevos empleados capacitados para el area de investigacion y desarrollo, asi como para el area de comercio exterior.', 'Actualmente la empresa emplea a 16 Personas con la nueva planta se incorporarían 10 personas mas para trabajar en la nueva planta', 'La apertura de la nueva planta permitira emplear gente local de colonia avellaneda y San Benito. El cumplimiento de todas las  nuevas normas y las mejoras productivas permitiran aumentar tanto la produccion con destino nacional, asi como aumentar la oferta exportadora de Entre Rios, logrando que la empresa entre en el mercado global.', 'Los precios de los productos son muy competitivos en el mercado. Ademas se realizan servicios de tercerizados para empresas como grandiet, farmacity, doctor ahorro y varios centros medicos en buenos aires, que comercializan nuestros productos con marcas propias.', 'La mayor fortaleza de la empresa es que tiene casi 40 años en el mercado, que no tiene deudas, con un capital humano consolidado, agilidad para el desarrollo de nuevos productos y una enorme capacidad de crecimiento tanto local como internacional', 'Actulmente con los costos Argentinos  surge una gran oportunidad de exportacion y con el creciente mercado local surge asimismo un enorme potencial de crecimiento a nivel nacional', 'La mayor debilidad es que la planta actual no fue concebida de manera orgánica, por lo que la nueva planta solucionara todos los problemas de producción y despacho, para lograr una mejora en la calidad y precio de los productos. Asimismo el desarrollo de una área de innovación y desarrollo permitirá desarrollar lineas de nuevos productos, actualmente solo se cuenta con un area de control de calidad y no de innovacion.', 'Las mayores amenazan surgen de la participación de los grandes actores en el mercado que pueden llegar a generar un distorsión del mismo. El segundo gran problema permanente es la litigiosidad laboral que es un riesgo constante e imprevisible en cuanto a los montos de los reclamos.', '2023-04-11 11:25:38', '2023-04-14 14:23:10'),
(307, 1847, 1422, 19, 1, 'INFRAESTRUCTURA ETAPA 1', 'INCOPORACION DE M2 DE NAVE INDUSTRIAL PARA MEJORA LA PRODUCTIVIDA Y DE ESTA MANERA MEJORAR PRESTACION Y CALIDAD DE NUESTROS PRODUCTOS\r\nATENTO A LA DEMANDA ACTUAL COMO ASI TAMBIEN DE NUEVOS Y PONETCIALES CLIENTES EN GESTION', '8000000.00', 1, 1, 'CONSTRUCCION DE GALPON SOBRE PREDIO EN PARQUE INDUSTRIAL PARANA GENERAL BELGRANO 450 m2 \r\nEtapa 1 - suelo / estructura / monatje / techo \r\n\r\nESTADO DE PROYECTO - ABRIL 2023\r\nTODO el proyecto se encuentra APROBADO POR OBRAS PARTCIULAES de la MUNICPALIDAD de PARANA bajo la normativas vigente.\r\nESTRUCTURA: SE ENCUNTRA TERMINADA TODOS LOS CALCULOS ESTRUCTURALES Y DESARROLLOS NECESARIOS', 'INCOPORACION DE M2 DE NAVE INDUSTRIAL PARA MEJORAR LA TRAZABILIDAD DE PRODUCCION ACORDE A NUESTROS PROCESOS Y LA INCORPORACION DE NUEVOS PORCESOS DE PRODUCCION', 'MEJORAR LAS CONDICIONES GENERALES DE PROCESOS Y OBTENER POSICIONAMIENTO SUPERIOR ANTE POTENCIALES CLIENTES', 'AIRE VISUAL S.R.L. SE ENCUENTRA EN UN ESTADO DE MADURACION Y AFIANZAMIENTO DE PROCESOS PRODCUTIVOS Y DE TRAZABILIDAD TANTO DE GESTION COMO DE PROECESOS, AVALDO POR NUESTRA TRAYECTORIA DE MAS 28 DE AÑOS DE EXPERIENCIA EN EL RUBRO DE SUS DIRECTIVOS Y SIEMPRE LIDERNADO EL MERCADO LOCAL Y REGIONAL', 'SOMOS EMPRESA DEDICADA A LA CONTRUCCION INDUSTRIAL DE  CARTELERIA CON MAS 14 AÑOS EXPERIENCIA EN RUBRO Y CON EXCELENTE PRESENCIA EN MERCADO REGIONAL (REGION CENTRO) Y AMPLIANDO LA ZONA DE COBERTURA CON BS AS', 'ACTAULMENTE NOS ENCONTRAMOS ATENDIENDO MARCAS LIDERES EN NUESTRA ZONA DE COBERTURA Y CON LA MEJOR TECNOLOGIA Y CAPACITACION EN NUESTRO SEGMENTO', 'VALENTIN TORRA 5080 - PARQUE INDSUTRIAL GENERAL BELGRANO PARANA - PRODUCCION - SUPERFICIE TOTAL ACTUAL DE TRABAJO GALPON 240 M2', 'CATAMARCA 501 - OFICINA COMERCIAL, ADMINISTRACION, DISEÑO Y DESARROLLO, CON ESPACIO DE TABAJO. SUPERFICIE TOTAL DE 180 M2', 'Nos dedicamos a la comunicación visual a través de distintos soportes y servicios gráficos, especialistas en fabricación industrial de carteles y gigantográfías.\r\nWWW.AIREVISUAL.COM.AR', 'DISEÑO Y DESARROLLO\r\nIMPRESION DE GRAN FORMATO CON TECNOLOGIA DE ULTIMA GENERACION Y ECO FRIENDLY\r\nPROCESOS DIGITALES DE CNC - SOLDADURA LASER/MIG/TIG - PLEGADO CNC - CORTE LASER - SOLDADURA DE LONAS - CORTE CNC DE COROPOREOS -', 'DISEÑO - DESARROLLO DE IMAGEN Y PLANOS PORDUCTIVOS\r\nARMADO DE HERRERIA - LETRAS - PORCESOS VARIOS DE PRODUCCION - MONTAJE EN OBRA', 'CAÑOS - CHAPAS - LONAS VINILICAS - TINTAS - ACRICLOS - MADERAS - PVC - ACERO INOXIDABLE - CONSUMIBLES DE CADA AREA ESPECIFICA', 'HERRERIA - DESPERDICIOS DE CAÑOS - RECORTE SON VENDIDOS EN RECICLADORA\r\nIMPRESION - UTILZACION EN PRODCUTOS 98 % - 2 % SE UTULIZA DE EMBALAJE \r\nPINTURAS - EL RECIPIENTE SE GUARDA EN CONTENEDOR PARA AGUARDAR SU RETIRO ANUAL', 'EL MERCADO ES MUY AGIL Y DINÁMICO EL CUAL NECESITA CONSTANTE ACTUALIZACION PREFESIONAL Y DE DISEÑO. PARTICIPAMOS EN FERIAS Y EVENTOS DEL RUBRO PARA MANTENERNOS INFORMADOS Y EN LA VANGUARDIA TECNOLOGICA\r\nLA NECESIDAD DE NUESTRO HORIZONTE ES ATENDER MEJOR E INCORPORAR NUEVOS CLIENTES, EMPRESAS POTENCIASLES CON PARTICIPACION EN NUESTRA REGION LITORAL Y ASI EVITAR EL INGRESO DE OTROS ACTORES A NUESTRA ZONA', 'CASI EN SU TOTALIDAD,  SON EMPRESAS NACIONALES, MULTINACIONELAS, ESTADO  Y COMERCIOS MEDIANOS A GRANDES', 'LA COMPETENCIA MAS CERCANA Y REGIONAL SE ENCUENTRA EN SANTA FE LUEGO ROSARIO \r\nEN NUESTROS MERCADO LOCAL HAY COMPETENCIA, PERO ESTA SEGMENTADA. NINGUNA ENGLOBA TODO EL PROCESO PRODUCTIVO CON LA EXPERIENCIA Y CALIDIDA PORFESIONAL QUE TENEMOS EN EL RUBRO.\r\nNUESTROS APSPECTOS PREFESIONALES COMBINADOS CON LA TECNOLOGIA NOS DIFERENCIAN DE NUESTAR COMPETENCIA RESPECTO CALDIAD, TRAZABILIDAD, SOLUCION Y TIEMPOS DE ENTREGA', 'LOS PROVEEDORES DE MAQUINA SON NACIONALES E INTERNACIONALES   \r\nRESPECTO A LA INSUMOS Y MATERIALES SON LOCALES Y DEPENDIENDO EL CONSUMOS', 'LOS RIESGOS CLAROS QUE YA LO HEMOS VIVIDO ES LA FACTURACION CONCENTRADA EN UN UNICO CLIENTE / SECTOR, POR LO QUE SE HA TRABAJADO EN ESA DIRECCION, INCOPORANDO DE MANERA CONSTANTE TANTO RUBROS Y CLIENTES.', 'FABRICACION DE ESTRUCTURA METALICA PARA NAVE INDUSTRIAL', 'AIRE VISUAL SRL: HOY CUENTA 6 PERSONAS DIRECTAS 7 PROFESIONALES DE MANERA INDIRECTA ASOCIADA A LA ORGANZAICION \r\nSE PROYECTA INCREMETAR UN 50% EL PERSONAL TANTO DIRECTO COMO INDIRECTO EN LOS PROXIMOS 2 AÑOS \r\nPara la obra: etapa 1 LA COSNTRUCCION SE REALZAICION CON LA INCOPORACION DE PERSONAL A NUESTRO SECTOR DE HERRERIA Y CON EMPRESA CONSTRCUTORA DE TERCEROS SE TERMIANAR LA OBRA CIVIL', 'EL IMPACTO ECONOMICO ESTARTEGICO Y PRINCIPAL ES ESTAR A NIVEL PRODCUTIVO, TECNOLOGICO, DE EMPRESAS A NIVEL NACIONAL Y ASI PODER DESDE PARANA GENERAR TRABAJO GENIUNO, POSICIONANDO NUESTRA PORVINCIA Y EVITANDO EL DESEMBARCO DE EMPRESAS DE NO LOCALES PARA RESPONDER A NECESIDADES DE NUESTRA ZONA GEROGRAFICA.', 'LOS PORCESO DE COSTOS Y PRESUPUESTO DEPENDEN DE LO COMPUTOS Y TAMAÑO DEL TRABAJO A REALIZAR, TENIENDO EN CUENTA LOS VALORES DE MERCADO.', 'LA TRAYECTORIA, TECNOLOGIA, POSICIONAMIENTO Y RECONOCMIENTO DE AIRE VISUAL S.R.L. NOS AVALAN COMO ASI TAMBIEN EL ORDEN PORLIGIDAD ARMINISTRATVA Y DE GESTION CONSTANTE\r\nNUESTROS Valores\r\n• Calidad • Experiencia • Servicio • Rapidez  • Conocimiento/ Know How • Responsabilidad social', 'A PARTIR DE LA TRAZABILIDAD BAJAR COSTOS Y LOGRAR MAYOR COMPETITIVIDAD EN DISTINTOS SEGMENTOS Y NICHOS DE MERCADO\r\nSIN SOBRECARGAR LOS COSTOS FIJOS', 'FALTA DE INCORPORACION TECNOLOGIA 4.0 PUNTO A ENCARAR EN PROXIMOS PROYECTOS.', 'LAS AMANAZA TIENE QUE VER EL HORIZONTE DEL PAIS DE VOLVER A CAER DENTRO DE RECECIONES Y GRANDES CAMBIOS EN LAS REGLAS JUEGO Y VUELVAN A FRENA EL FLUJO DE COMPRA DE LAS GRANDES EMPRESAS Y QUE TAMBIEN ASOCIADO A LAS MATERIAS PRIMAS QUE NECESITEN BIENES DEL EXTRANJERO SIN TENER POSIBILIDAD DE ADQUILIRILAS Y DE ESTA MANERA RETRAZAR LOS PROCESOS PORDUCTIVOS', '2023-04-12 14:11:11', '2023-04-20 12:40:28'),
(309, 1949, 1200, 19, 1, 'COMPRA DE INSUMOS', 'Crédito destinado a empresas para capital de trabajo.', '8000000.00', 0, 1, 'Adquisición de capital de trabajo: compra de insumos productivos.', 'Comprar insumos para la producción.', 'Adquirir insumos con una financiación conveniente para la empresa.', 'Resulta oportuno adquirir insumos con buena financiación para apoyar a la producción.', 'Somos una empresa dedicada, desde 1977, a la fabricación de puertas de interior, corredizas de embutir y frentes de placard, en el Parque Industrial de la Ciudad de Paraná. Fue fundada por Carlos D. Valentinuz quién la llevó adelante hasta su fallecimiento en 1995. A partir de allí venimos trabajando continuando con su legado en la producción de puertas placas.', 'Actualmente nos encontramos, como desde sus comienzos, produciendo y comercializando puertas de interior, placares y corredizas. Con altibajos, pero tratando siempre de piorizar la continuidad de nuestras fuentes de trabajo y es pensando en todas las familias que componemos esta empresa que no bajamos los brazos y estamos abocados al crecimiento de la misma.', 'Parque Industrial de la Ciudad de Paraná', NULL, 'Nuestros productos son el fruto de un proceso de producción en línea, seriado, utilizando materias primas como la madera de pino, cedro, guatambú entre otras. Marcos confeccionados en chapa, madera y aluminio, con todas sus variantes. En diferentes medidas.', 'Producimos en serie y en línea productiva, utilizando maquinarias de prensado en caliente, escuadrado, enfichado y terminaciones finales.', 'Nuestros procesos productivos son a la vez, y por secciones. Por un lado se producen las hojas, proceso en línea desde el corte del terciado, armado, prensado, escuadrado hasta la colocación de cerradura y bisagras; y a la par se realiza la producción de marcos de chapa, madera y aluminio.', 'Utilizamos diversas maderas, en su mayoría terciado y madera maciza de pino, también cedro y guatambú entre otras.\r\nChapa y aluminio para nuestros marcos.', 'La madera de descarte o recortes que se generan son utilizadas para nuestra caldera, con la cual calentamos el aceite para el sistema de prensado.\r\nLos recortes de aluminio y chapa son enviados para su reciclaje.', 'Nuestro mercado está distribuido en todo el territorio del país, contando con clientes en las diferentes zonas geográficas.', 'Nuestros clientes son comercios dedicados a la venta de aberturas o corralones de materiales de construcción. Siempre revendedores, no vendemos al público en general.', 'Nuestra competencia son fabricantes que se encuentran en otras provincias, en Buenos Aires varias de ellas, lo cual hace que sean algo más competitivos a la hora del transporte de sus mercaderías.', 'Nuestros proveedores son fabricantes o distribuidores. Los referidos a madera se encuentran en las provincias de Corrientes y Misiones y el resto en Rosario y Buenos Aires.', 'Siempre buscamos superar los obstáculos y luchamos día a día por superarlos.', 'Capital de trabajo: compra de insumos', 'Actualmente contamos con 64 empleados en relación de dependencia.', 'Siempre priorizamos el poder mantener los puestos de trabajo y las familias que hay detrás de cada uno.', 'Los precios de nuestros productos son muy variados. Por tomar uno como referencia podría citar $15.300 + IVA una puerta de pino', 'Contamos con capacidad instalada, tanto en maquinarias como en edificio, para producir muchas más unidades que las que hacemos actualmente. Podemos responder a una mayor demanda fácilmente en ese sentido.', 'Estamos tratando de ampliar nuestro mercado de ventas, en búsqueda de nuevos clientes y analizando la posibilidad de desarrollar un producto nuevo: los placares de melamina con terminaciones en aluminio. También existe la inquietud de desarrollar posibilidades que puedan abrirse en el exterior, sobre todo incursionar en países limítrofes.', 'Las ventas se vienen resintiendo últimamente. No contamos con fondos suficientes para el abastecimiento de materias primas para hacer frente a una mayor demanda posible.\r\nPensando en innovar en productos nuevos, nos vemos en la necesidad de adquirir nuevas máquinas y herramientas para lo cual no contamos con los fondos.', 'El aumento sostenido de precios que viene sufriendo el país hace que nuestras ventas se recientan y nuestros costos se distorsionen.\r\nLa retracción del consumo en productos que no son de primera necesidad nos viene afectando bastante.', '2023-04-17 14:30:00', '2023-04-28 12:37:03'),
(310, 1953, 2013, 19, 1, 'INVERSION EN MAQUINARIA', 'El Negocio consiste en innovación y ampliación de la capacidad productiva de nuestra empresa. Se incorporarán 2 maquinas de gran importancia, que nos permitirá automatizar, disminuir scrap, disminuir costos, aumentar producción y como consecuencia, penetrar en mercados a nivel nacional e internacional. Tendrá impacto ambiental sustentable, ya que reduciremos desechos en general. Seremos mas competitivos en precio, favoreciendo la economía de nuestros clientes.', '80000000.00', 1, 0, 'El proyecto consiste en la incorporación de 2 maquinas indispensables para el fraccionamiento de nuestras bebidas.\r\nSon maquinas que trabajarán dentro de una misma línea de producción, y se encuentran asociadas directamente. \r\nLlenadora automática y tapadora automática, ambas con productividad de 2000 botellas hora..\r\nLas mismas podrán ser utilizadas una vez ingresadas en planta. Plazo de entrega desde la compra:40 días aproximadamente.\r\nProductividad actual: 200 botellas hora.', 'Solicitar crédito para incorporar 2 maquinas a nuestra línea de producción. Reemplazando máquinas completamente obsoletas.', '- Aumentar la productividad en 1000 % respecto a la actual.\r\n- Disminuir al mínimo los tiempos por parada de máquina.\r\n- Optimizar la generación de SCRAP, favoreciendo el cuidado del medioambiente.\r\n- Mejorar la calidad y presentación de nuestros productos.\r\n- Ser competitivos en el mercado actual local, e insertarnos en mercados nacionales e internacionales.\r\n- Agrandar nuestra cartera de productos\r\n- Incrementar el personal de trabajo.', 'Nos encontramos en la última etapa del proyecto: adquisición de las maquinas.\r\nYa realizamos previamente durante un periodo largo de tiempo análisis de mercado de diferentes opciones.\r\nVenimos desde hace varios años teniendo inconvenientes en la producción cada vez mas impactantes en : productividad, generación de scrap, mano de obra, costos, y competitividad en el mercado.', 'Empresa creada en el año 1992 por sus dos socios. poco tiempo después uno de ellos vende su parte a un tercero, y desde entonces estos dos siguen siendo los dueños. Ambos ingenieros químicos, con experiencia previa en SIBSAYA en la formulación de bebidas; sus objetivos iniciales era la elaboración de licores artesanales para abastecer el mercado local. Con el paso de los años, se fueron incorporando productos nuevos, llegando a tener 13 productos diferentes hasta el año 2020.', 'Desde el año 2020 nos encontramos lanzando productos nuevos al mercado, que nos permiten participar en un segmento diferente. Así como también realizando producción a fason para terceras marcas. Esto, nos permite la oportunidad de ser competitivos a nivel nacional e internacional. Para ello, debemos contar con instalaciones acordes.', 'Fábrica ubicada en la Ciudad de Concepción del Uruguay, Entre Ríos.', 'El lugar es propiedad de los Socios.', 'Los productos elaborados en la empresa son bebidas alcohólicas de media/alta graduación.\r\nTodas son elaboradas de manera artesanal in situ y fraccionadas en envases de vidrio.\r\nEn la empresa se realiza el proceso completo desde la elaboración de las bebidas, hasta el encajonado y depósito.', 'Luego de 30 años en el rubro, nos encontramos muy capacitados técnicamente para dar uso a las máquinas solicitadas. La fábrica se encuentra en condiciones de incorporar las mismas y dejarlas en funcionamiento de manera inmediata, una vez puestas en planta. Se reemplazarían máquinas de los años 19876', 'Elaboración: elaboración de las bebidas en el sector correspondiente.\r\nFraccionamiento: incluye lavado de botellas, llenado , tapado , etiquetado y encajonado de las mismas para ser paletizadas y puestas en depósito, a la espera del envío logístico a destino.', 'En la actualidad contamos con acceso directo a los proveedores de la materia prima, la cual se divide en : nacional e importada.', 'Desechos: agua limpia de enjuague.\r\nScrap: Vidrio , aluminio y papel, se separan para la recolección y reciclado.', 'Mercado actual:- participación media en consumo masivo local de los productos de segmento estándar. ( estable de hace 10 años\r\n- Participación media en consumo de nicho de los productos de segmento premium, mercado zonal. creciente desde el lanzamiento hace 3 años.\r\nProductividad actual: 200 bot/h.\r\nProductividad con máquinas nuevas : 2000 bot/h.\r\nBeneficio: penetrar en mercado nacional e internacional con alta productividad.\r\nVolumen de venta mensual proyectado en 2 años: 40.000 botellas', 'Clientes directos: \r\n- Distribuidores de bebidas\r\n- Mayoristas de bebidas.\r\n- Cadenas de supermercado.\r\n-Vinotecas.\r\n- Clientes Minoristas.\r\n- Empresas ( se les hace producción a fason)', '- Marcas líderes en segmento premium : competencia directa Generalmente precios similares. muy competitivos en CALIDAD.\r\n- Marcas líderes en segmento estándar: competencia directa , nuestros precios son mas bajos. Desventaja en la presentación de los productos  ( MEJORARIA CON LAS MÁQUINAS). muy competitivos en CALIDAD.\r\n- Segundas marcas segmento estándar y premium : Competencia directa , mejor calidad que la competencia, precios similares, presentaciones similares.', 'Principales Proveedores: Empresa importadora de tapas de aluminio, empresas importadoras de hierbas, empresas productoras de hierbas nacionales, empresas productoras de botellas de vidrio, empresas productoras de etiquetas ( Imprentas), empresas productoras de cajas de cartón corrugado, empresa fraccionadora de alcohol para el consumo. ( Para cada rubro contamos con al menos 2 opciones).\r\nSe suelen compartir proveedores con la competencia, dependiendo el caso.', 'Riesgo técnico: adaptación de las máquinas, y tiempos de capacitación en la utilización de las mismas.\r\nEstrategia asociada a dichos riesgos: capacitación progresiva y organizada utilizando los manuales tecnicos de las mismas. utilización progresiva de las máquinas en etapas: testeo, puesta a punto y alta de maquina.\r\nEn todo este proceso se contará con las máquinas actuales como back up.', 'El monto solicitado será destinado 100 % a la adquisición de las máquinas. ( las máquinas tienen un costo aún mayor )', 'SOCIOS (2):\r\nRoles principales: administración, costos, liderazgo, ventas, compras, elaboración y fraccionamiento.\r\nPLANTA (2): Fraccionamiento, limpieza, puesta a punto de maquinarias, reparaciones, logística.\r\nNo existe organigrama vertical de la empresa. trabajo colaborativo.', 'Se obtendrán buenos resultados económicos en la empresa, logrando ingresos para re-invertir en capital humano y desarrollo de nuevos productos.\r\nLa imagen será positiva en los consumidores , ya que tendrán productos de mejor calidad y mas competitivos en precios.', 'Son muy variables dependiendo que línea de producto, y dentro de qué segmento de producto se encuentre.\r\nSegmento estándar: precios que EN LA ACTUALIDAD se encuentran entre los $ 350 por unidad y $900 por unidad al público.\r\nSegmento premium: precios que EN LA ACTUALIDAD se encuentran entre los $1500 y $3500 por unidad al público.', 'REDUCCIÓN DE SCRAP \r\nREDUCCIÓN DE PARADAS DE MÁQUINAS\r\nOPTIMIZACIÓN DE LA PRODUCTIVIDAD ( reducción de tiempos de producción, reducción de re trabajo, reducción de pérdida de insumos y materia prima, aumento de capacidad de producción)\r\nReducción de costos.', 'Penetrar en mercado nacional e internacional.\r\nSer competitivos en precio y calidad.\r\naprovechar los tiempos para generación de nuevos negocios.\r\nAumentar la producción', 'Inversión en maquinaria.\r\nCapacitación de mano de obra para las nuevas maquinarias', 'Posibilidad de demoras en la capacitación para las nuevas maquinarias.\r\nPosibilidad de complicaciones en la adaptación técnica de las nuevas maquinarias.', '2023-04-19 13:59:58', '2023-05-19 13:26:23'),
(312, 1954, 606, 24, 1, 'ADQUISICION DE CAPITAL DE TRABAJO PARA AUMENTAR LA PRODUCCION DE ALGODON HIDROFILO', 'Se necesita adquirir capital de trabajo incremental para lograr un aumento en la producción de algodón hidrófilo de la planta industrial que nuestra empresa tiene radicada en el parque industrial de Paraná.', '8000000.00', 0, 1, 'Adquisición de capital de trabajo para aumentar la producción de algodón hidrófilo y poner en marcha una nueva línea de producción que se está instalando en el corto plazo.', 'Aumentar la producción de algodón hidrófilo en 10.000 kilos mensuales en promedio', 'El incremento de la producción permitirá atender a una mayor cartera de clientes, hoy se están desperdiciando oportunidades comerciales por falta de volumen de producción.  Además se podrán fabricar nuevas presentaciones de algodón.', 'Actualmente la fábrica está con una producción mensual de 50.000 kilos en promedios, el objetivo es aumentarlo a 60.000 kilos mensuales en promedio', 'La empresa fue creada en el año 2002 para encarar el negocio de la fabricación del algodón hidrófilo, apostando a instalar una fábrica de escala industrial para llevar adelante la idea.  En los últimos años la empresa con la incorporación de socios que tienen conocimientos en cultivo y desmote de algodón, se avanzó hacia la verticalización de la empresa, logrando que en este momento Ejemplar produzca el algodón desde la semilla hasta el producto final.', 'Ejemplar SA produce y vende algodón hidrófilo a clientes de todo el país bajo la marca Ejemplar y bajo marcas propiedad de algunos de los más importantes clientes, y está haciendo desarrollos para lograr productos acordes a los requerimientos de clientes del exterior.  Los clientes del mercado nacional consumen toda nuestra capacidad de producción y necesitamos aumentarla para aprovechar oportunidades comerciales que estamos desaprovechando y lograr el objetivo de exportar.', 'Galpón en parque industrial de 6000 metros cuadrados en terreno de 8000 metros cuadrados.', 'No aplica', 'Los productos fabricados son diferentes presentaciones de algodón 100% natural, hidrófilo, plisado en zigzag.  Se está instalando una nueva línea de producción para producir algodón en bolitas y en rollos.  Se utilizan como material de absorción para fines domésticos y sanitarios.', 'Los productos se fabrican con máquinas de alta tecnología, parte de las cuales no se ensamblan ni fabrican en el país.  Caso de las cardas, de los alimentadores de estas, los equipos de envasado, entre otros. Por ello si hay que adquirir máquinas nuevas hay que importar las mismas.', 'El proceso productivo consta de las siguientes etapas, compactado de fibras en un tortera, hidrofilizado, centrifugado, secado, cardado, envasado, almacenamiento, distribución.', 'Fibras cortas de algodón, generalmente desperdicios de otras fábricas textiles\r\nProductos Químicos: Soda Cáustica, Agua Oxigenada, Detergente, suavizante y neutralizante\r\nEmbalajes de plástico flexible.', 'Durante el proceso se genera desperdicios textiles que se intentan recuperar en la mayor medida posible y agua de los enjuagues del algodón. Envases de productos químicos que su mayoría son con devolución a los proveedores.', 'El mercado que atendemos actualmente es todo el país, se vende algodón a través de distribuidores para encarar los diferentes segmentos del mercado.', 'Los clientes consumen algodón por diferentes motivaciones, uno de los principales canales de consumo es el institucional/hospitalario, otro es el canal pañalero y farmacéutico, también tenemos clientes industriales que consumen nuestros productos como materia prima, y por último están los clientes de retail, supermercados y cadenas de supermercados.  Para encarar cada canal tenemos diferentes marcas, Ejemplar que es la propia y marcas de nuestros clientes cuando el volumen lo justifica.', 'Las empresas que fabrican algodón hidrófilo y con las que compartimos el mercado son Algodonera Avellaneda que fabrica el algodón marca Estrella y es el número uno del mercado, Lenterdit que fabrica algodón marca Doncella, Insumos XXI que fabrica el algodón de la marca homónima y marca Saenz Peña.  Es un mercado con pocos jugadores, existen otros pero no de escala industrial.', 'Nuestros principales proveedores son desmotadoras de algodón e hilanderías a las que les compramos las fibras cortas que para ellos son dehechos de fabricación.  Además están los proveedores de productos químicos, envases flexibles, repuestería y otros insumos menores.', 'Posible falta de insumos de origen importado que paralicen nuestra producción, la estrategia es aumentar los stock de insumos y bajar los puntos de reposición para tener mayor tiempo de gestión de compras que permita resolver en tiempo este inconveniente.', 'Aumentar la capacidad de producción', 'Cuenta con 98 de empleados. El personal empleado se mantendrá estable.', 'Permitirá aumentar la facturación de la empresa en un 20% con el consecuente impacto en el aumento de recaudación tributaria por parte del estado municipal, provincial y nacional.', 'Los productos ofrecidos tienen una muy buena relación entre el precio cobrado y la calidad ofrecida.', 'Equipo gerencial con espíritu emprendedor, Recursos humanos capacitados, abastecimiento continuo de materia prima principal a bajos costos.', 'Importamos máquinas para desarrollar nuevos productos y encarar nuevos mercados.\r\nPresentamos un proyecto de subsidio Prodepro para seguir tecnificando la empresa orientando la oferta de productos a la salud.\r\nConseguimos financiamiento para incorporar nueva tecnología de producción.', 'Falta de definición de un plan de traspaso generacional, falta de un plan de marketing, falta de registro de marcas en algunos países.', 'Que ocurran incrementos de costos que no se puedan trasladar a precio de producto, que ocurran enfermedades que afecten a varios empledos a la vez y tengamos que parar la producción, que ingresen al mercado empresas nuevas.  Falta de abastecimiento de productos que si bien adquirimos internamente son de origen importado. Que no se consigan repuestos para el mantenimiento de la fábrica.  Obstáculos por cambio de normativa que impidan traer las máquinas que necesitamos para seguir creciendo.', '2023-04-26 16:45:31', '2023-06-03 18:40:46'),
(313, 1955, 2017, 19, 1, 'PALA CARGADORA', 'ADQUISICION PALA CARGADORA', '2570000.00', 1, 0, 'ADQUISICION PALA CARGADORA HANOMAG MODELO H104 SIN CABINA DE DOBLE TRACCION, CAPACIDAD DE CARGA 1000 KGS.', 'LA ADQUISICION DEL BIEN REFERENCIADO IMPLICARIA UNA MAYOR CAPACIDAD PRODUCTIVA', 'LA COMPRA DEL ACTIVO FIJO DESCRIPTO PERMITIRA EXPANDIR LA PRESTACION DE LOS SERVICIOS QUE SE REALIZAN ACTUALMENTE PUDIENDO AMPLIAR EL GRUPO DE TRABAJO REALIZADO ACTUALMENTE EN FORMA UNIPERSONAL CON LA COLABORACION DEL GRUPO FAMILIAR', 'EL OTORGAMIENTO DEL CREDITO PERMITIRIA CONCRETAR LA COMPRA, PUDIENDO FINANCIAR CON RECURSOS PROPIOS LA DIFERENCIA DEL VALOR', 'SE TRATA DE UNA EMPRESA UNIPERSONAL CON LA COLABORACION ACTIVA DEL NUCLEO FAMILIAR PRIMARIO CON MAS DE 10 AÑOS DE ANTIGÜEDAD, INICIANDO ACTIVIDADES COMO MONOTRIBUTISTA PARA PASAR POSTERIORMENTE AL REGIMEN GENERAL COMO SE PUEDE APRECIAR EN LAS INSCRIPCIONES QUE ACOMPAÑAN ESTE PROYECTO. LOS SERVICIOS SE PRESTAN EN TODA LA PROVINCIA DE ENTRE RIOS, INCLUSO EN PROVINCIA VECINAS', 'A PESAR DE UN CONTEXTO ECONOMICO GENERAL NO MUY FAVORABLE LA ACTIVIDAD DE COLOCACION DE ALAMBRADOS Y CONSTRUCCION DE GALPONES TIENE UNA DEMANDA IMPORTANTE LA CUAL PRETENDO ATENDER CON MAYOR AMPLITUD Y/O EN MENORES PLAZOS TEMPORALES', 'GALPON UBICADO EN LA LOCALIDAD DE VILLA DOMINGUEZ', 'GALPON PROPIO', 'LA TAREA ES BASICAMENTE MANUAL PERO SE REQUIEREN BIENES DE USO PARA LLEVAR ADELANTE LA MISMA.', 'BIENES DEL ACTIVO FIJO BASICOS PARA TRABAJOS DE MOVIMIENTOS DE SUELO, PERFORACION DEL MISMO Y ACARREO DE MATERIALES', 'SE EFECTUAN MOVIMIENTOS DE SUELOS. ADEMAS, SE TRABAJA EN LA COLOCACION DE POSTES, TRANQUERAS, ARRANQUES, ETC. Y ALAMBRADOS\r\nLAS TAREA SE DESARROLLAN INTEGRAMENTE EN EL LUGAR SOLICITADO.', 'PARA LA PRESTACION DE LOS SERVICIOS DE MAYOR DEMANDA SE UTILIZAN BASICAMENTE HIERRO, POSTES Y\r\nALAMBRES', 'NO EXISTEN MAYORES DESECHOS EN EL PROCESO DE LAS TAREAS PORQUE CONSISTE MAYORITARIAMENTE EN MOVIMIENTO DE SUELO Y, EN EL RESTO DE LAS TAREAS, LOS\r\nELEMENTOS UTILIZADOS NO POSEEN PRACTICAMENTE DESPERDICIOS.', 'PROVINCIA DE ENTRE RIOS Y PROVINCIAS VECINAS', 'EMPRESAS PRIVADAS EN SU GRAN MAYORIA, AUNQUE SE HAN HECHO INSTALACIONES DE GALPONES DE ESTABLECIMIENTOS\r\nEDUCATIVOS PROVINCIALES, POR EJEMPLO', 'EXISTE COMPETENCIA REGIONAL PERO INSUFICIENTE ANTE LA DEMANDA ACTUAL', 'LA MAYORIA DE LAS MATERIAS PRIMAS SON APORTADAS POR LOS CONTRATANTES DEL SERVICIO, POR LO TANTO LOS\r\nPROVEEDORES HABITUALES SON LOS VENDEDORES DE MAQUINAS HERRAMIENTAS, COMBUSTIBLES, LUBRICANTES,\r\nREPUESTOS, ETC.', 'EL RIESGO PRINCIPAL CONSISTE EN ALGUN EVENTUAL ENFRIAMIENTO DE LA DEMANDA O EN LA APARICION DE NUEVOS\r\nPRESTADORES DE SERVICIOS PARA LO CUAL LA ADQUISICION DE BIENES DE USO PARA AFECTAR A LA ACTIVIDAD ES PARTE\r\nIMPORTANTE DE LA ESTRATEGIA PARA FORTALECER LA PRESENCIA EN EL MERCADO', 'ADQUISICION DE PALA CARGADORA', 'UNIPERSONAL CON LA EVENTUAL SUB CONTRATACION PARCIAL DE SERVICIOS', 'PERMITE INCORPORACION DE MANO DE OBRA PARA ATENDER UNA MAYOR DEMANDA', 'EL IMPORTE DEL BIEN QUE SE PRETENDE ADQUIRIR ES DE $ 5.930.196 MÁS I.V.A. (TOTAL I.V.A. INCLUIDO: $ 6.552.866.-)', 'EXPERIENCIA LABORAL EN LA ZONA Y BUENA CAPACIDAD PARA RESPONDER A LA DEMANDA', 'CRECIMIENTO CONTINUO EN LA DEMANDA DE LAS TAREAS QUE SE DESARROLLAN', 'ESTRUCTURA PEQUEÑA PARA DEMANDA DE GRANDES DIMENSIONES', 'RALENTIZACION EN LA INVERSION EN LAS EMPRESAS AGROPECUARIAS POR LA EMERGENCIA ACTUAL', '2023-05-02 12:09:36', '2023-05-22 14:37:41'),
(314, 1957, 120, 19, 1, 'RENOVACION ETAPA DE SECADO DENTRO DEL PROCESO DE RECICLADO DE POLIETILENO', 'El proyecto consiste en el reemplazo de la caldera explotada por una máquina denominada squeezing Modelo FSP 250 PE PP FILM.  Cumpliría la función de secado del polietileno en el proceso de reciclado.\r\nAdemás se requiere la construcción de un galpón que una el proceso de secado con las demás etapas del reciclado y galpon continuo al mismo\r\nReparación de galpón dañado, sus intalaciones afectadas y maquinarias.', '8000000.00', 1, 0, 'El proyecto consiste en el reemplazo de la caldera por una máquina denominada squeezing Modelo FSP 250 PE PP FILM.  Cumpliría la función de secado del polietileno en el proceso de reciclado.', 'con el secado o la extracción de agua al plástico, terminaríamos el proceso de reciclado para poder tener la materia prima lista para poder producir las bolsas', 'La oportunidad de reemplazar la caldera dañada por esta nueva máquina es optimizar el secado, es decir, permitiría procesar mayor cantidad de desechos por hora, obteniendo mayor cantidad de grumo para poder fabricar los productos finales.\r\nHoy nuestro cuello de botella se encontraba en el secado. A su vez esta nueva maquinaría, permitiría reemplazar la caldera y reducir los riesgos de una nueva falla.', 'Actualmente nos encontramos en la búsqueda de reactivar el proceso productivo de manera provisoria para poder cumplir con obligaciones pendientes contando también con un stock mínimo de materia prima que nos permitiría funcionar a muy corto plazo y buscando soluciones urgentes para evitar el paro de total de actividades,', 'UbicaDOS en el Parque Industrial de Paraná, elaboramos envases plásticos flexibles a través de materia prima reciclada, desarrollando el proceso productivo desde la recolección y transformación de los desechos hasta la obtención del film, bolsas o termocontraibles como productos finales. Somos pionetos y únicos en nuestra región en la actividad del reciclado plástico. Para ello contamos con equipamiento de alta tecnología y trabajadores especialmente capacitados.', 'Organizada en dos plantes de 1400 metros cubiertos, reciclamos 50.000 kg. mensuales de desechos, convirtiéndolos en una amplia gama de productos y satisfaciendo los requerimientos de un mercado muy diverso. Acompañando las exigencias del mismo incursionamos en 2018 en la fabricación de bolsas ecológicas de tela no tejida (friselina).\r\nHoy nos encontramos en una situación de emergencia, donde por una exploción perdimos una caldera (etapa esencial del proceso de reciclado), y un galpón.', 'La planta se encuentra en el Parque Industrial de la ciudad de PARANA', 'El predio es propiedad de la firma', 'el producto final que la empresa fabrica son envases flexibles de polietileno (bolsas, film, láminas termocontraíbles)', 'Nuestros productos son elaborados con materia prima 100% reciclada en nuestras instalaciones.', 'Nuestra actividad consta de dos procesos. Por un lado el reciclado de desechos plásticos, por el otro la fabricación de bolsas.  En el primero, los desechos recibidos son transformados mediante un proceso de clasificación, lavado, secado y extrusión, en M.P para poder fabricar luego el envase.', 'desecho de polietileno de alta o baja densidad', 'Tenemos dos grandes procesos. Por un lado el reciclado de los desechos plásticos, que comienza con la clasificación de los residuos, lavado, molido, extrusado y secado, obteniendo el grupo que será la materia prima para el segundo proceso; el cual es la fabricación del envase propiamente dicho.', 'Abarcamos un amplio mercado, desde industrias, comercios, hospitales, municipio', 'nuestros clientes son industrias que consumen film de polietileno, láminas, tubos de polietileno, termocontraíbles, etc.\r\ncomercios que compran sus bolsitas para sus productos.\r\nhospitales con bolsas de residuos, bolsas patológicas, etc\r\netc\r\nsomos fabricantes a gran escala, nuestras ventas son mayoristas, con mínimos a producir en cada medida especial para cada cliente.', 'No tenemos competidores directos.  Existen fabricas que venden bolsas pero de material virgen, es decir compran grumo virgen.\r\nTampoco existe fabrica que se dedique a reciclar residuos provenientes de diferentes origenes como nuestro caso.', 'En el reciclado, tenemos como proveedores, industrias entrerrianas y de provincias vecinas, que necesitan despositar sus residuos plásticos por la responsabilidad social empresarial. Cooperativas que recolectan y  clasifican residuos, pequeños recolectores y acopiadores de plástico, etc.\r\nPara la fabricación de bolsas, tenemos proveedores de masterbach, tintas, polímeros de impresión, y servicios tercerizados y proveedores de tela para lo que es bolsa de friselina.', 'Riesgos de una economia inestable en general.\r\nRiesgos con la compra de friselina que es importada, pero lo reducimos vendiendo bolsas de polietileno.', 'El monto solicitado especialmente en esta línea,  sería destinado a la compra de materiales de la construcción para poder construir la habitación donde se haría el secado.', '8 personas en producción.', 'la actividad del reciclado tiene un importante impacto social, económico y sobretodo ambiental. No solo trabajamos con volcaderos y recolectores y acopiadores de plástico, sino tambien articulamos con industrias convenios asegurando la diosposición final de sus residuos.', 'Los productos finales tienen precios muy variados, va a depender del tamaño de la bolsa, de la cantidad comprada, del espesor, de los colores pedidos, del tamaño y color de la impresión, etc.', 'Compromiso con el medio ambiente (se reciclan 50.000 kg de desechos plasticos al mes)\r\ncartera de clientes diversificada\r\nDeuda baja.', 'A raíz de lo acontecido la empresa quiere optimizar procesos,renovación tecnológica y reordenamiento en general.', 'Dificultades para acceso a créditos, requiriendo agilidad en las gestiones.\r\nAtento a lo acontecido, (explosión) queda anulado el proceso de reciclado de plástico, por ende se para la producción de bolsas,  debido a que la materia prima necesaria para su producción surje del proceso de reciclado-', 'imposibilidad de cumplimiento de las ordenes de producción (a raiz de la detención de la planta por lo acontecido)\r\ndisminución de ventas  que van a provocar un desequilibrio financiero-\r\nDestinar fondos a lo acontecido.', '2023-05-05 19:40:54', '2023-05-11 12:05:16');
