(318, 460, 432, 19, 1, 'PRODUCCIóN DE ALIMENTOS A BASE DE CEREALES, SIN CONSERVANTES, 100% NATURAL', 'Empresa ya funcionando que se dedica a la fabricación y producción de alimentos sin conservantes ni aditivos con un valor agregado que son para publico vegano.\r\nActualmente fabricamos barras de cereales, con un techo de 60mil barras por mes. El objetivo es cuatriplicar este año la producción y sacar nuevos productos al mercado con esta maquinaria.\r\nSe van a llevar a cabo con contactos ya echo (fabricación para terceros, cadenas de supermercados, exportaciones y grandes cadenas de distribuidores)', '4600000.00', 1, 1, 'Nos dedicamos a la fabricación y elaboración de barras de cereales, sin conservantes ni aditivos. 100% natural.\r\nNuestras ventas están enfocadas al distribuidor, representante o mayorista, así como también en cadenas de supermercados, estaciones de servicios, refrigerio para empleados en empresas como: Johnson Acero, Petropack, etc.\r\nEn el año 2022, a partir de Marzo, todos los meses se vendió la producción total. Por este motivo necesitamos automatizar los procesos con estas maquinarias.', 'Al adquirir esta máquina, vamos a poder cuatriplicar la producción por jornada laboral. Esto nos permite tener una mejor rentabilidad; los costos fijos se van a solventar más rápido; poder abastecer a las propuestas que tenemos (ya sea fasón, líneas de supermercados y grandes distribuidores); poder conseguir materia prima a mejor precio al comprar por más cantidad; y sacar nuevos productos con esta misma maquinaria', 'Adquiriendo esta máquina, proyectamos a fin de año cuatriplicar la producción y sacar con la misma maquinaria, nuevos productos. Como, por ejemplo, una barra proteica.\r\nHoy en día contamos con 76 clientes activos. (Muchos otros clientes y propuestas fueron rechazados este año por no poder abastecerlos). \r\nAlgunas de las propuestas rechazadas son:\r\nVenta a la cadena de supermercados (Coto, Jumbo)\r\nFasón de tres fábricas.\r\nPropuestas para exportar a Brasil, Uruguay y Paraguay.\r\nGrandes distribuidores.', 'Actualmente la fábrica produce un promedio de 60.000 barras mensuales, donde llegamos a todo el País.\r\nEn el año 2022, a partir de Marzo, todos los meses se vendió la producción total.\r\nHoy en día contamos con 76 clientes activos. \r\nEs una producción 100% artesanal, lo que nos limita la producción.', 'Somos una empresa joven que nace hace 4 años con el sueño de una pareja al querer independizarse y salir adelante; con nuestro propio lema “Vamos por todo”. \r\nNuestro producto gusto desde el primer día. Tanto, amigos, familiares e incluso en negocios del barrio.\r\nDesde el comienzo del emprendimiento fue difícil, ya que no se contaba con nada de capital. Vendimos lo poco que teníamos; desde la cama hasta la ropa vieja y lo que se ganaba se reinvertía el 100% para poder seguir creciendo', 'Actualmente la fábrica produce un promedio de 60.000 barras mensuales, donde llegamos a todo el País.\r\nFormada por los dueños: Fabiana y Leonardo\r\n3 empleados: encargados de la producción', NULL, 'Alquiler de un galpón con oficina que fue modificado adecuadamente para la fabricación de alimentos. \r\nDesde 1 de Septiembre de 2020 (casi 3 años)\r\nEstructura: 350 mts2', 'Barras de cereales: \r\nContamos con 5 variedades (lino y chia – Zapallo y sésamo integral – Mix de cereales y pasas de uva – Sport – Kids)\r\nElaboradas artesanalmente sin conservantes ni aditivos. Veganas', 'Tenemos desarrollado nuestros productos con ayuda de un bioquímico en alimentos. El cual al obtener maquinarias se van a tener que modificar algunos procesos y hasta reacomodar las recetas actuales para poder aplicarlas a la maquinaria.', 'Se realiza una mezcla liquida para unificar el producto, luego se mezcla con la materia prima, se lleva a una mesa donde se amolda y corta la masa para llegar al producto final; después viene el enfriado y empaquetado del mismo.\r\nUna vez terminado estos procesos se guarda en cajas para ser despachado', 'Nuestra materia prima es producida en Argentina, donde todo proviene del campo, ya sea semillas, azúcar, arroz, etc.\r\nActualmente compramos directo de fabrica el 80% de estos. al producir más se podrá llegar a comprar todo de fábrica', 'En la elaboracion no tenemos desechos, ya que si un producto sale mal (ya sea por falta de peso o mal formaciones) se puede volver a reutilizar inmediatamente.\r\nSe desechan todas las bolsas que trae la materia prima, que son luego recicladas.', 'Nuestros productos pertenecen más al nicho golosinero, aunque también se consume en el rubro de dietéticas. \r\nNuestras ventas están enfocadas al distribuidor, representante o mayorista, así como también en cadenas de supermercados, estaciones de servicios, refrigerio para empleados en empresas.\r\nActualmente vendemos a toda la Argentina pero proyectamos vender en el exterior y también fabricar a otras empresas\r\nEs un mercado en pleno crecimiento, buscando lo natural, sin aditivos y vegano.', 'Nuestros clientes directos son los mayoristas, distribuidores y fabricas.\r\nLuego el consumidor final son gente que busca cuidarse o alimentarse mejor. Por lo general de una clase media a una clase alta económicamente.', 'Nuestra competencia hoy son Muecas e Integra, Barras que actualmente están a un precio muy elevado a comparación de las nuestras ya que no cuentan con fabricación propia. Luego están las marcas más industriales como por ej. Arcor, que no la consideramos una competencia directa, ya que nuestro producto no contiene conservantes, el tamaño de nuestro producto llega a casi el doble y el costo a consumidor final es muy similar.', 'Tenemos varios proveedores, todos son de Argentina.\r\nAlgunos son pequeñas empresas productoras y otras de mediana a grandes empresas que nos proveen la materia prima.', 'Riesgos que se nos presentan sobre todo son a nivel país, sobre todo en un año de elecciones.\r\nLas estrategias: adquirir maquinarias para que sea más rentable y poder tener una espalda por si surge algo imprevisto, fabricación a terceros (ya tenemos 2 empresas esperándonos para trabajar en conjunto). Exportar a Uruguay (ya tenemos un contacto esperando) y a otros países. Comprar materia prima mas directo para obtener mejores precios. Sacar nuevos productos. Etc.', 'Maquinaria laminadora, cortadora y empaquetadora: \r\nEsta máquina nos permite automatizar gran parte del proceso de elaboración y empaquetado, pudiendo cuatriplicar la producción por jornada laboral', 'Formada por los dueños (Novios): \r\nFabiana Selenscig: Ventas y Marketing\r\nLeonardo Senger: Administrativo\r\nDedicados 100% a la empresa. En continua capacitación mediante cursos, charlas, mastermind, etc.\r\n3 empleados: operarios', 'Impacto social: Somos una empresa que busca desarrollar productos naturales ya sea sin conservantes ni aditivos para un mejor cuidado de las personas. \r\nImpacto económico: poder dar mas puestos de trabajo tanto directo como indirectamente', 'Nuestros precios son estipulados a un porcentaje que se fue sacando y puliendo en todos estos años de trabajo. (siempre con vista y análisis de la competencia directa)\r\nActualmente esta llegando cada unidad a consumidor final a: $170 - $200', 'Somos una empresa joven con mucho empuje y con el lema \"vamos por todo\"\r\nTenemos años de experiencias y gente que nos ayuda en el desarrollo de la empresa y productos.\r\nProducto en pleno crecimiento, donde la gente busca alimentos mas naturales y veganos.', 'Venta a la cadena de supermercados (Coto, Jumbo)\r\nFasón de tres fábricas.\r\nPropuestas para exportar a Uruguay y Paraguay.\r\nGrandes distribuidores de Buenos Aires y Santa Fe.\r\nDesarrollo de nuevos productos.', 'Nuestra debilidad hoy en día es el capital con el que contamos, ya que comenzamos muy de abajo y todo lo que se gana se invierte 100% a la empresa. Cuesta hacerse de una espalda financiera.\r\nAl ser una empresa que no para de crecer se necesita inversiones continuamente.', 'Amenazas a nivel país (hay momentos donde no se consigue materia prima) y es un año de elecciones donde no se sabe que puede llegar a pasar.', '2023-05-17 20:43:29', '2023-05-29 14:33:16'),
